VALUES
	('029e96b2ca9888e476557473088046fe','03279e7fdf98f54450facd4636bf29b9','宝贝Y很乖','4',3,2,2,'【试吃/体验点评】团购买了张券，我们要的是微辣的，吃的还行，味道挺好的，跟鱼酷差不多，但是因为有券所以比鱼酷便宜好多，去的时候是中午又是周末所以人还挺多，以后如果有机会还是会去的','0','2011-12-30 19:06:00',NULL),
	('107c189e1ba359a3e1226c45d75a207e','03279e7fdf98f54450facd4636bf29b9','龙行天下s','4',3,3,2,'和朋友聚会去吃过几次，口味还是很不错的，环境也还好吧，他那菜的种类还是挺多的，还有些汤也很不错，价位一般，服务还行吧~','0','2011-10-26 09:26:00',NULL),
	('13b624d69d066857b2b2a7e8053d079b','03279e7fdf98f54450facd4636bf29b9','小西亲','4',3,2,3,'我就爱吃这个，味道非常好，这里人可真不少，估计都爱吃这个，这个的价格也能够接受。而且可选的味道很多，最爱这里的香辣烤鱼和饼。','50','2011-10-29 17:57:00',NULL),
	('15744b416a018e924c0629bc7993e50b','03279e7fdf98f54450facd4636bf29b9','Me蜡烛_盗我图死全家','1',2,2,1,'【团购点评】预定的8点.7点45分到的.人很多.不过还好有位置.坐下后.因为是团购的.给了券然后点了香辣味的鲶鱼就开始等了.皮蛋豆腐和花生米很快就上了.然后就开始吃皮蛋豆腐和花生米.吃的那叫饱啊.基本都吃光了.烤鱼还没上.这是要等多久啊?看到斜对面那桌比我们后点.烤鱼比我们先上个15分钟绝对有的.后来他们买单才知道.他们非团购.这就是区别吗?这也就算了.团购上说了有茶水.有红酒雪梨.有汤.结果呢?我是烤鱼都快吃完了.问服务员我们的红酒雪梨呢.服务员说卖完了.我不问你就不上也不说了啊?后来给我换了同价位的菜.最后汤还是没喝到.我也无语了.也不想要了说起烤鱼吧.味道一般.不入味.鱼酷绝对比这的好吃.真是一分价钱一分货.以后宁愿吃鱼酷的.贵是贵.但起码好吃.这家团购做的我以后真不会再去吃了','50','2011-07-04 22:19:00',NULL),
	('18392584350e9951a4a7caeab13a1f8b','03279e7fdf98f54450facd4636bf29b9','逸品油条','3',3,2,2,'第一次吃烤鱼，感觉味道还不错，基本都是调料味，跟烤肉差不多，一份烤鱼再配点菜，还比较能吃饱，团购的40元卷，结账的时候比较划算。要是没有优惠劵，不太想去尝试，没有烤肉好吃。等烤鱼的时间比较长，大概半个小时。','55','2011-11-24 23:11:00',NULL),
	('1892e83c272beeea9858534fb063298f','03279e7fdf98f54450facd4636bf29b9','联合创业','3',2,2,2,'我是喜欢吃鱼的，怎么做的鱼我都喜欢吃，没办法就是喜欢吃这一口，难怪家人说我是属猫的呢。在他家吃过一次，环境呢一般吧，服务也是一般，没有什么值得留下深刻印象的东西。烤鱼确实很香，越嚼越香，我口比较重，觉得有些淡了，再咸一点会更好吃哦。','0','2011-04-22 08:48:00',NULL),
	('066bbfe6c6c361a29b396b6457d1e606','0f535874f9ce1b9dd9472cf1c5c56d71','夕夜Sophia','5',4,4,4,'陪领导吃饭来过一次，够气派，够豪华，还有鳄鱼，足够赚饱眼球，包厢限制消费一定金额才可以使用，一个经理两个领班的服务，想不周到都难，菜品很精致','0','2011-09-28 21:22:00',NULL),
	('06b7bc3a9308fa282110b35e5b6cfa09','0f535874f9ce1b9dd9472cf1c5c56d71','乐乐小谗猫','0',3,5,3,'让你感觉这里不是饭店，是个公园，植物园，或是动物园，环境非常棒，有一些植物都是从国外运来得。在这种环境就餐心情舒畅，但价格也不便宜，菜的口味还不错','100','2008-09-11 11:11:00',NULL),
	('0ab9e948ec7e0d45001662a3b2901a6b','0f535874f9ce1b9dd9472cf1c5c56d71','长角果','0',4,5,4,'环境没得说了，整个一个巨大的植物园+小型动物园，带小朋友来做个简单的生物启蒙可以了。 如果在大厅中间树丛、亭子中吃饭感觉会更好---不过得提前很久预定。吃完饭可以在里面逛一逛，小朋友还有专门的游乐区。饭菜品种很丰富、海鲜很多，整体色香味都不错，当然价格也不菲，适合商务宴请和家庭聚会。','100','2009-10-10 18:17:00',NULL),
	('0d10242b9f49383a0a7b91aa889f35f4','0f535874f9ce1b9dd9472cf1c5c56d71','陶小明','0',2,4,4,'多少有些形式大于内容的意思吧。饭菜没什么特别之处，环境特别倒是得到了大家的一直认可。这样的消费档次服务好也是必然的。偶尔为之还有些新鲜感。','100','2009-02-02 19:52:00',NULL),
	('181306b9762e2a1e689b099d6fb019b8','0f535874f9ce1b9dd9472cf1c5c56d71','坐岸观澜','3',4,3,3,'全中国好像哪里都是有这种生态园在北方还真的是喜欢这个就餐的环境尤其是在山西，这里是出了名的环境污染有这样一个园子没准儿能长寿那这园子算是大的了，里面还起了楼包间更是安静的很，菜品做得也算不错口味也算是多样吧（这好像是生态餐厅的传统）','0','2010-04-15 16:56:00',NULL),
	('184f936c51cda6b37a0548f4fa12e8d7','0f535874f9ce1b9dd9472cf1c5c56d71','little丢丢熊','3',3,4,2,'同事聚餐一起去的，环境感觉相当不错，因为是生态园，与其他酒店的风格迥异，感觉比较幽静、浪漫，饭菜还好吧，但是饮料我们从开始到最后只点了一次，一瓶饮料倒完，服务员就主动开启同样的另外一瓶，而没有询问我们的意见，连男士的也没问，都给倒上了，导致饮料消费飚升，其他朋友最好还是注意一下，避免遇到同样的问题。','0','2009-11-09 10:58:00',NULL),
	('19a788017a44f04f7867015c7045a364','0f535874f9ce1b9dd9472cf1c5c56d71','xwclove','0',3,4,3,'一家子经常喜欢去~环境不错，这是最重要的，让人吃饭的心情比较愉悦，性价比么要连环境一起算的 就还可以，','200','2009-05-03 17:38:00',NULL),
	('1c50a3109ff6d3dc9bc44608227c6f20','0f535874f9ce1b9dd9472cf1c5c56d71','deeaf','3',2,2,2,'以前感觉还可以 昨天去了之后发现啥都那么难吃 莜面黄瓜居然都是甜的 啥菜都是甜甜的 晋菜做的奇差 火锅没味 烧饼都是甜的 娘的 环境还那样 空气有些发霉的味道 人均 150','0','2012-01-31 23:33:00',NULL),
	('0062cd7429a8d509f08d47eed250bd6f','1057195d6992c3cbadeef8fe3cbdd473','枫子123456','3',4,2,2,'【团购点评】团购去的，所以还算划算。优点：（1）地方好找，上4楼，正对着电梯口就是（2）环境不错，装修的很大众化，不过还算可以。（3）肉是喂好的，口味还不错（4）凉菜很好吃，就是有点辣（5）调料可以自选，都很好吃；（6）有冰激凌，宝宝喜欢；（7）水果也有2-3样可以自选。（8）有免费的南瓜粥（就是有点凉）缺点：（1）进门先问是不是团购，回答是以后，就一直往里面领，到最里面连灯都没开的地方给我们安排了座位，旁边居然就是收盘子的垃圾车，恶心死了，服务员告诉只有这里有位置，可我明明看到门口还有好多地方有空位！团购啊~~~受歧视！（2）有一盘菜是辣白菜炒五花肉，我和老公翻了个底朝天只找到小小的4片1元硬币大小的肉，不如就叫炒辣白菜比较合适。（3）上菜比较慢，坐好到上菜足足有15分钟，后来又加了一点菜，快吃饱了才上来。（4）女服务员态度很差，速度很慢，经常消失不见，想点菜还得下地去找。（5）团购烤肉没有服务员帮忙烤的，全部自助。（6）赠送的小菜巨辣，就吃了1口，辣死了！（7）主食只有小小的1份石锅拌饭，不够吃，又点了炸馒头。（8）主食比较贵，基本都在20元左右一份。','33','2011-01-17 11:05:00',NULL),
	('05266f397006064fc7e27da386aa5d51','1057195d6992c3cbadeef8fe3cbdd473','昔日风清','5',5,4,5,'四个月之前来过,那时服务不是很好,服务员少吧!今天特想吃就和老公一起来了,等了半个小时位,好像比以前生意好了,听服务员说是从北京调过来的店长!来了有四五个月了,服务员服务确实有所提高,但是服务员还是不太多,但是服务挺好!我们点了烤牛肉,牛排,五花肉,海鲜炒年糕还有拌饭,味道很好,和北京一样!值得一提的是服务确实好!吃的也值!','78','2011-12-10 22:47:00',NULL),
	('05fd9d734d288fa8b9ad503c8a681b34','1057195d6992c3cbadeef8fe3cbdd473','ε冄з','3',3,3,2,'北京的汉拿山终于开到大连来了。。可能大连的韩式烤肉太多了。。所以审美疲劳诶~~刚开业就去了。。拿了会员卡。。可以打88折。。性价比还是比较高的。。主要我喜欢他的南瓜粥和自助的小食啦。。肉什么的也就那样啦~','50','2010-10-25 23:13:00',NULL),
	('09151864561511366f743e8f6f6d4442','1057195d6992c3cbadeef8fe3cbdd473','明则','1',2,2,1,'在北京玉泉吃了两次汉拿山，印象很好，所以大连的汉拿山开张后，一直去那儿吃饭，去了10次左右吧，算是见证了汉拿山的每况愈下。刚开始，服务还过得去，上菜也快，篦子换的勤，水果也够，南瓜粥也稠。现在，神马都不行了，水果没了，南瓜粥像水了。上周去乐购买东西，想想附近也没有什么好地方了，也懒得走，就去汉拿山看看吧。下午4点多点，人也不多，很多座不让坐，只有门口和旮旯的座位让坐，哪有这样做生意的！！！又不是来白吃的，真是的，到哪儿不能把钱花出去！！！看见门口菜品特价，如果服务继续下滑，再特价也挡不住关门大吉的。后来还是去了宣吉，价格差不多，但是服务很好，还会主动来给椅子加个套。谁吃饭不想开开心心的，我也不是挑剔的人，怎么到这儿就一肚子火？','60','2011-04-14 22:32:00',NULL),
	('15a2bf3f358a48357c9b94eb2b2d5b91','1057195d6992c3cbadeef8fe3cbdd473','大连海岸','3',2,2,2,'之所以我还能给&quot;一般&quot;的评价是因为他家服务还算可以.肉品,牛肉羊肉味道那么回事,酱料我比较喜欢送的南瓜粥是凉的, 西瓜是不新鲜的,蔬菜拼盘是没洗干净的...第一个上菜的服务员让我无语,一边上菜一边唱歌,唱的那种山寨网络歌曲,还那么大声.还说是给顾客唱首歌听听....烤肉就得说肉肉比较新鲜,但是肉质偏老,有点咬不动了换帘子的服务员还算比较勤快,这一点也是给我留下了好印象.','0','2011-03-27 00:46:00',NULL),
	('183cc79dc5d5956b0954e47c04c4ef99','1057195d6992c3cbadeef8fe3cbdd473','claire0','3',2,2,1,'我对饭店的评价一向是偏宽松的，从来没有给出过两颗星，所以汉拿山是属于我不推荐的了以前在北京的时候吃过一次，看见大连开店了一直想尝试调料自助比较好，可以多尝试几种口味但不得不说，服务很差劲，烤肉口味也十分一般点了几种牛肉都很柴的口感，远远没有圣道烤肉好吃蘑菇拼盘一烤就黑，小凉菜也不出彩完全没有服务而言，我们正在吃饭过程中，就有服务员过来把篦子拿走，调整炭火，整个过程一句话也没有说，我和朋友面面相觑，要不是为了这点小事影响心情肯定要质问他的以后不会再去了','70','2011-03-23 19:37:00',NULL),
	('18783fd81bebc48004bcd9e23089acd1','1057195d6992c3cbadeef8fe3cbdd473','大笨猪斌','4',3,3,3,'【团购点评】当时团购的券，让老爸老妈去吃的。可能是老年人不太喜欢此类的东西，回来评价不是很高。有些东西不是很烂。下次自己去尝尝','0','2011-11-08 17:10:00',NULL),
	('1c36bcc6f4b4644c76dce4585392686e','1057195d6992c3cbadeef8fe3cbdd473','1234321A','4',3,2,2,'地方不小，烤肉味道还不错，南瓜粥女朋友很爱喝，酱料种类很多，还有免费冰激凌。就是赠送的水果是事先摆好的，都蔫吧了。赠送的生菜也都蔫吧了，要了份生菜，一小盘居然8块钱。结账后给了两张代金券。','110','2011-12-19 01:39:00',NULL),
	('020aac54f9e646199d95720d0bf9dec6','1185a6d490b678251cf7f4b785444d92','shimer','4',4,4,4,'去吃的午餐～mmmm...只能说我对法国菜果然没有鉴赏能力。中午套餐时218＋10％，2道菜，多一个菜＋98块～我吃的是鹅肝 芦笋色拉 主菜是马格丽塔披萨没有给我留下特别的感觉，口味的话和好多餐厅差不多哦...中午人比较少，服务还是可以的。不过感觉有点过，是一对一，甚至n对一的服务，老觉着有点不自在～kaka环境不错，就是电梯粗来我找不到门...汗...','350','2011-11-15 15:34:00',NULL),
	('0380e2eca863a0ddcf9782865da0a7c0','1185a6d490b678251cf7f4b785444d92','Homura酱','5',3,3,3,'在望江阁吃的SET 定好的MENU 看了一遍 里面竟然没有牛排 不过算了 以后也可以再来尝试的两个人吃的东西都不尽相同 烹饪的味道没话说 味道可能更偏向中式的那种丰富鲜香的感觉 葡萄干面包和核桃面包也没传说中那么好吃吧 前菜 乍看不知道是什么 管家介绍了一下 可惜忘记了 都蛮好吃的他的香烤鹅肝 腌苹果和青柠 似乎有那么一点点老 终于吃到了黄金般珍贵的鱼子酱 口感很咸 鲜是肯定的 和鸡蛋在一起 他的是白煮蛋我的是煎蛋深海扇贝配金色花菜 上面的花菜煎得焦黄 扇贝新鲜入口有弹性 皇帝鱼刺身 配黑松露 大蒜吐司 他说一般性 煎牛蛙腿好好吃 口味蛮重的 不像西餐平时的清淡风格 配的香草汤还可以吧多宝鱼 法国黄酒汁 番茄 小胡瓜 这个菜给我印象不深刻味噌蘑菇烤银鳕鱼 黄小胡瓜 柚子 这个印象也不深 香扒羊排 蘑菇 红咖喱 我一向不爱吃 觉得西餐里的羊排都免不了有点膻味 他却很喜欢 香烤乳鸽配绘洋葱很不错 就是难切 然后今天我才发现我发现煎鹅肝和玉米饼好像没给我上啊……囧柠檬水煮龙虾 西米和琼瑶浆泡沫 这个泡沫很酸哦 头一次吃那么酸的龙虾 笑 甜品的话 那个熔岩么蛮好吃的 小个 其实这个甜品无需很大 味道和莫尔顿差不多吧那个芒果...还是百香果的冰霜好好吃啊 还有个巧克力饮品 上面有块棉花糖 他说很正宗 我不置可否本来这次吃饭都是人家用来求婚的地方 很可惜 这次没有求婚 但也同样终身难忘全文','0','2011-12-13 14:05:00',NULL),
	('05b1bf51914218b9e740c5aa1bef99b2','1185a6d490b678251cf7f4b785444d92','慕斯言','5',5,5,5,'我跟男朋友经常生活在国外，非常喜欢吃西餐啊什么的。这家餐厅一进去就感觉奢华，服务员也狠上档次。服务超级棒，也好好吃喔，也法国当地的味道。嘻嘻！狠开心','1000','2012-01-10 14:18:00',NULL),
	('047bd6a90b27e2a3b302de3365480f40','1185a6d490b678251cf7f4b785444d92','ukiey','4',3,4,5,'环境好的没话说 ，装修不是华丽璀璨的那种，有年代的西洋建筑配上老上海风情的古典家具，有种说不出的优雅稳妥，低调但是气场十足。开放式厨房里，看到了美食杂志上介绍的那个香港主厨，确实很有范儿。免费附赠的面包和巧克力都很好吃，头盘的开心果鹅肝酱更是大爱~','0','2012-01-24 18:31:00',NULL),
	('052f194763d25759f49fde7b2efcd161','1185a6d490b678251cf7f4b785444d92','saloin','3',3,5,4,'年初五去的,菜品的口味并没什么出彩的地方,比较中规中矩,但环境确实很不错,靠窗的位子看出去就是外滩的长廊,对面就是滨江大道。值得一提的是他家的甜品,真心好吃','500','2012-01-30 16:32:00',NULL),
	('07b2226b8918255010efe2078570cf96','1185a6d490b678251cf7f4b785444d92','0822Michelle','4',2,5,4,'第一次到这种地方来环境是绝对么话讲的啦老板来过一次他帮我们点了餐前菜他家的餐前面包很好吃的额吃完还可以问服务员再要主菜我们点了牛排口味感觉一般般甜品味道很好午餐时间来吃饭的人还真不少呢','0','2012-01-04 18:18:00',NULL),
	('0b006f4a4552637713edc1b12a5fc81b','1185a6d490b678251cf7f4b785444d92','kimi1987','3',2,4,3,'终于拔草了这家店，午市套餐218元不含15%服务费价格还能接受，前菜要了鹅肝但做的SOSO，焦糖烤得太焦了，主菜是鸡胸肉芝士，鸡胸肉非常多一盘下去非常非常饱，甜点是巧克力蛋糕，实在太甜，腻到了，还是芝士蛋糕相对来说好点哦。。。PS：他家的餐前面包很好吃。','265','2011-11-06 00:07:00',NULL),
	('0b5c530791808932355772721fe466dc','1185a6d490b678251cf7f4b785444d92','首衫','3',3,3,3,'这里的环境很不错的，法式的风味比较有吸引力的，总体很不错， 虽然价格小贵，却是顾客都很多的，巧克力蛋糕很不错的喔。','0','2012-02-14 19:08:00',NULL),
	('0dbe5bc63186635104a2ed11b19dc13e','1185a6d490b678251cf7f4b785444d92','heiha哈','5',4,5,5,'心心念念好久终于有空来了！中午的set很划算~238有一道前菜和主食，分别选了鹅肝酱，南瓜汤还有烤银鳕鱼和牛柳，最后是甜品，选了巧克力蛋糕，环境不错，去的那天正好碰上下大雪，情调了一把~','0','2012-02-13 15:36:00',NULL),
	('0ee965ce6e951ee71b0c9658facd3f3a','1185a6d490b678251cf7f4b785444d92','everyl','5',5,5,4,'环境真的不错，和老公心血来潮的腐败，中午的套餐还是不错的，连不太喜欢吃甜品的老公，针对巧克力和cheese cake也没啥抵抗力，都吃完了。核桃面包真心好吃，鳕鱼肉出乎意料的嫩，调味也很好，老公的黑松露pizza也很赞，吃的心满意足啊','350','2011-11-18 18:23:00',NULL),
	('1390ad51ed8033bbb2b2e81dfc6be399','1185a6d490b678251cf7f4b785444d92','teeth_99','5',5,5,3,'装修极富历史的沉淀感，跟朋友笑说，倘若穿一袭华丽的长裙，是不是就能找到做CICI公主的感觉。。 。 。食物确实很美味，特别是鹅肝，吃第一口便被惊艳到，入口即化，肥而不腻，功力可见一般~附送的餐前面包每款都不错，PAUL的也不过如此。听闻现在已经不是JC的鼎盛时期了，哎，意淫中。 。 。。 。','250','2011-12-23 15:50:00',NULL),
	('14bbcf0b154a75dbe5cec3226ffe5a8f','1185a6d490b678251cf7f4b785444d92','hippocjwd','4',3,3,3,'原本很期待的米其林三星，去过感觉没有惊喜；中规中矩的装修，窗外风景很一般，比茂悦的VUE差不是一点点啊；鹅肝、牛排、龙虾都还是不错的，至少不会吃完特别腻；甜品有点过甜了，几乎没怎么吃；龙虾剩了点没吃完，服务员会问是做的不好吃吗？15%的服务费貌似也就体现在这儿了','700','2011-12-04 13:14:00',NULL),
	('1819746c5b05228350a3b317aabe4abc','1185a6d490b678251cf7f4b785444d92','joannatoto','4',2,4,3,'如果有闲情，如果不赶时间，可以来这里吃一下午餐，中午套餐218元，配上这个景还是值得。牛排点了5分熟，但是有点小失望，竟然比7分的老。没有尝试这里的鹅肝，算是一种遗憾。最后的甜品，样子很没，但是真的好甜。第一次尝试樱桃味道的苏打水，颜色而且是红色的。干姜苏打水，就实在是难以下咽了！','218','2011-12-28 15:38:00',NULL),
	('1c760e09ef742c28ce6e35ff87d8b6b5','1185a6d490b678251cf7f4b785444d92','Barlis_水水','5',4,4,4,'吃法餐的第一选择。大爱这里的鹅肝，虽然量不大，小尝几口就没了，不过味道是真心赞啊。巧克力蛋糕也很好吃，搭配冰激凌超喜欢。牛排 说实话做的一般，不觉得特别好吃。','750','2012-01-12 14:24:00',NULL),
	('1ca94cd26410383a149b965afb808738','1185a6d490b678251cf7f4b785444d92','香蕉冰沙','5',4,5,4,'从昨晚11点开始开始纠结到今天中午，终于还是决定带老爸去Jean Georges，毕竟米其林3星，没让我失望过。法式鹅肝--鲜、香、嫩、滑，入口即化，无与伦比；三文鱼和煎海鲈鱼口感味道都很不错；煎肉眼排和煎牛柳中规中矩，还是喜欢莫尔顿的多些。','450','2011-12-17 15:47:00',NULL),
	('1cad34a9ff41bb5f5a6524fccf85ac3a','1185a6d490b678251cf7f4b785444d92','voltsmaxle','5',5,4,4,'事隔半个月再来点评，加上没有图片为证，除了记得真的很好吃，菜色和菜名真心的记不全了。总体环境还不错，地方比想象中大，坐到靠窗的江景位子，很happy~点的是1298+598的两份套餐，配鸡尾酒&红酒一小瓶。菜品很丰富，量也比想象中的足，足足吃了四个多钟头，撑到不行！餐前面包不得不提，核桃+葡萄干配合面包的香味恰到好处，热热的面包上涂抹上优质黄油味道更是出色。深海扇贝配金色花菜 扇贝个头大没话说，肉质丰蕴有弹性，不过味道普通并无亮点。皇帝鱼刺身 配黑松露 刺身新鲜肉质肥美，黑松露倒是头一遭，看在这最贵的身份上也值得一尝。香烤鹅肝 嫩~滑~鲜~入口即化，感觉无与伦比。为了它特地破了规矩开了戒，我认！银鳕鱼 老实说记忆模糊了，无功无过吧，肉质不差可其实个人更喜欢日料里的那种口感。鱼子酱 配什么吃的也想不起来了，只记得自己吃过鱼子酱了，这就够了吧。哈哈！牛柳 点了3分熟，口感正好~味道算不上惊艳不过也不比牛排差哪去~最后是甜点，两份套餐包含的甜点品种繁多，各有特色，样样美味~吃到忙不过来！最值得一提的是生日加赠的巧克力蛋糕，上面用法文写着生日快乐，插上蜡烛，即惊喜又开心~而且味道不是普通的好哦~一顿大餐，不止满足...口腹之欲，更加让心灵得到满足。人生真美好，大餐要常常吃~嘻嘻嘻嘻全文','1300','2011-12-16 16:16:00',NULL),
	('02579bd6662fcaeb770a8b6ba730ee7b','12c75bfb5067efd1ec13cc59c1b4e1f3','爱的物语love','4',5,4,2,'昨天晚上和老婆在这家店吃的。第一次到这家店吃饭，味口挺不错的！我们吃的那个豆鼓烤鱼特别的好吃。鱼被烤的特别的脆，加上豆鼓，那别提有多么好吃了!口水鸡也挺不错的。鸡特别的烂，特喜欢吃的！','100','2012-02-11 15:33:00',NULL),
	('034ad86b382559466f3ca31ba548cc10','12c75bfb5067efd1ec13cc59c1b4e1f3','焕然一辛','5',5,4,3,'在这家店还没有开张的时候就知道是北京那边很赞的一家烤鱼~~但一直没有机会去吃，上次去是高峰时段晚饭时间7点，好吧，看到排队那人的时候就慌了，但还是拿了号。。。。差100多号。。。。好吧果断打消这个念头！！这次去是2点，座位很空，不错，哈哈哈！！点了北京朋友推荐的怪味清江鱼，还不错有点甜甜辣辣的，其实主要是甜味啦，可能开在上海为了迎合这边的口味所以谝甜吧！！！总体还是不错的','80','2012-02-01 18:35:00',NULL),
	('053018eb7f27cab28f2637a1723b167f','12c75bfb5067efd1ec13cc59c1b4e1f3','yoyo_ruru','4',4,4,4,'每次去都感到外面等位的人比里面吃的人都多，不过因为“里面有人”所以每次都能随到随吃，在众目睽睽之下那感觉绝对是超级无比的爽啊哈哈哈!特别喜欢豆豉鲶鱼，鱼肉嫩滑，豆豉很香，里面配上蔬菜，嗲！唯一遗憾的是店里的菜品还略显单薄，除了少数的几个冷菜之外，基本没什么炒菜，在鱼瘾上来的时候其他菜式换不了花色。','60','2012-02-15 20:45:00',NULL),
	('0c971ad6c3ccf867ac0c3c60d677abf6','12c75bfb5067efd1ec13cc59c1b4e1f3','水瓶座的成成','3',2,3,2,'垂涎已久啊。。。有天正好看到了D币可以换代金券，赶紧行动，不过我只能换一张50的，两张就还差点，不过也挺好了，那天收到券有点小激动啊。。。后来和老妈选了中午去吃，我早就做好排N久队的准备，所以十点就到了，结果没看到什么人哪，难道我来太早。。。额。。也有可能是大家比较喜欢晚上吃。。。拿到了2号。排队的时候店家拿了瓜子出来，看到等位的地方还有跳棋玩。我们是一开始叫号就进去了，沙发座额，哈哈，店面的装修风格还蛮明亮的，温馨派的，墙上贴了很多客人写得小条子。叫了黑胡椒耗油烤鱼，要了清江鱼，48元一斤，有2.68斤，光这条鱼就129元。配菜8元，要了莴笋和土豆，味道真心不错，不过相当辣。。。鱼烤的很嫩。。。口水鸡，16元，味道还行，不过量很小，下面垫了好多辅料，性价比不高。。。。其实想吃鸡蛋糍粑、韭菜盒子啥的，但是那天锅坏了，这种油煎的全都点不了，悲催啊。。。特地去一趟居然还吃不上。。好吧，点个蓝莓黄豆糕，8元，一般水准吧。。。凉拌竹笋，6元。。。。居然不好吃。。额。。。俺好后悔。。。。稠酒，这个不错，甜甜的，后来走的时候又买了一瓶带走，16元一瓶，共32.。。原味奶茶，10元，不好喝啊不好喝。。。。...也就外面3块4块一杯的水准。。。。随便找个茶餐厅味道也不致于此。。。。继续后悔。。。。结账，209块，用了50元券，实付159.。。怎么说呢，作为烤鱼为主打的店，鱼确实不错，那个稠酒也好喝，其他都不怎么地。。。。可能我期待太高，反而有些失望，而且想点的点心当天因为锅子坏了没能吃到，将就着点了别的。。。心情有点郁闷。。。吃完至今有四个月了。。。。这当中居然没有再去吃一次的想法，虽然当时确实觉得鱼烤的不错。。。。额。。。我想，这意味着心里其实没有很中意这店吧。。。。全文','105','2012-02-13 22:17:00',NULL),
	('0cbf0df2f14dfdbd4f7380011112049a','12c75bfb5067efd1ec13cc59c1b4e1f3','onlyblue123','4',3,3,3,'提前一个多月预约的~点了怪味鲶鱼~味道很不错，吃完后不像别的烤鱼身上一股味道，服务也不错，等位的人很多，建议还是电话预约吧 就是要等个一个月','40','2012-02-15 13:18:00',NULL),
	('0f93afce775d8ff49a7d4f1f4d6a4120','12c75bfb5067efd1ec13cc59c1b4e1f3','shplmm','4',3,2,2,'五个姐妹，在唛歌唱完K，下午两点直接杀到江边吃鱼。选择这个时段是为了避免排队，没那个耐心，也伤不起，所以想尝尝烤鱼又不想排队的，可以考虑选择这个时间，只要在5点之前出来就行。来这里么总归是吃鱼的，点了两条，一条是豆豉清江鱼，一条是黑胡椒鲶鱼，个人比较喜欢鲶鱼，清江鱼的肉比较紧，显得有点老，没有鲶鱼滑嫩，豆豉味吃到后面会有点咸。还点了鱼皮，脆脆的蛮好吃，就是不会吃辣的考虑一下，那个有点辣的，老虎菜凉拌的酸酸的蛮开胃，水果色拉一般般，2月份生日全单88折，拿出身份证，这下来不到250，服务还行吧，只要你叫，总会有人来的。','50','2012-02-08 17:43:00',NULL),
	('10eff7fb5ee8159c72c6a1b3f3486a9a','12c75bfb5067efd1ec13cc59c1b4e1f3','嬭茶の佈丁','3',2,2,3,'【团购点评】两点领号5点开始叫号，么经验2点前就都开始排队了，我们还傻乎乎的玩电脑。。。领到个40多号，等到7点多才进去的。唯一的亮点就是他们家的厕所，说白了就是很普通的玻璃而已，学外国人的。。。点了一条豆豉的鲶鱼，鱼的确是全鱼一大条啊，但是真心咸，一般般，又点了条黑胡椒的清江鱼，肉质肥厚，外脆里嫩是我的菜！！！可惜上面的黑胡椒研磨的太粗，每一口都相当重口味。。。口水鸡：居然一盘鸡都是连刀块的，吃起来相当不方便，味道和辛香汇相比差远了，不推荐。鸡蛋糍粑：为什么叫鸡蛋？没有鸡蛋的成分啊，就是糍粑呀，上面撒了些粉末而已，但是真的很糯，QQ的量也很多，8块哟，这个不错。蕨根粉：依旧不推荐的一道菜，别家的蕨根粉是酸酸辣辣很爽口的，而他们家的就做成辣的了，配上重口味的烤鱼，更加不推荐了。他们家的性价比还是蛮高的，这应该是排队的重要原因吧，最后凭点评的短信送了一碗银耳羹，味道很清淡，适合重口味之后的调节，还有点评积分，蛮好','60','2012-02-07 15:38:00',NULL),
	('12499f462e36434c4c9d7ffb6fe0a566','12c75bfb5067efd1ec13cc59c1b4e1f3','丨_小米_丨','4',3,3,2,'上次老婆心血来潮想吃烤鱼，反正她排队，我乐得坐享其成啊。他们俩10点就到了，所以11点开门就准时进场了。我们是11点到的，反正门口已经人满为患咯。说实话，我已经很久没有来过那么人气的店吃饭了~4个人，点了2份鱼。豆豉鲶鱼我个人还是挺喜欢的，就是吃到后面，鲶鱼实在是太油了。怪味清江鱼的话，我比较喜欢清江鱼的肉质。不过酸的甜的之类，实在不是我的菜啊。店里有wifi的，这个不错。就是可能人太多了。速度不快。','0','2012-02-02 14:23:00',NULL),
	('1498fe0105a8daf6aaf46b1ae8d2a822','12c75bfb5067efd1ec13cc59c1b4e1f3','恋着多美丽','4',4,4,4,'人气超高的一家店，二点多先去拿号的，拿了14号，五点前赶到那里，第一批进去了，点了一条三斤多的清江鱼，做的是香辣味的，等烤鱼时上了点心，先吃吃，在磕磕瓜子聊聊天，烤鱼等了半个小时上来了，味道有点辣的，但是烤鱼很入味，好吃，里面的配菜时间长了都炖烂了。最后点了一份水果色拉来解辣，还看到一家子先老爸给老妈过生日，后来儿子求婚，很热闹，我们吃好都要九点了，外面还有人在等位，等几个小时我觉得不值得','60','2012-02-03 13:45:00',NULL),
	('1838cf1b912ec206840dd31f7fe1efa8','12c75bfb5067efd1ec13cc59c1b4e1f3','ellezhuya','5',5,4,3,'等了好久才有机会等到吃这个，为了减少排队时间，就选择中午来吃这个了，还好排了半个小时就进去了烤鱼什么的，重口味的什么都是我最喜欢了点了香辣烤鱼，选择的是鲶鱼，因为刺少嘛，而且自己也很喜欢吃鲶鱼果真料很多，满满一盘全是辣椒的踪影，鱼肉就很入味了，加了几种蔬菜，时间长了，超好吃口水鸡够辣，鸡肉很嫩，大爱啊蕨根粉酸酸辣辣，很爽口的，也能填饱肚子排队一个小时以下还能接受，那种排3,4个小时的，太盲目了，以后等分店开了以后，估计能分散点人流，哈哈哈可以积分啊，不要忘带会员卡啊','0','2012-02-01 01:15:00',NULL),
	('19d014641b23168431dd60e742fe4365','12c75bfb5067efd1ec13cc59c1b4e1f3','春日的雪','4',3,3,3,'这边的生意真的不是一般的好，就看到服务员忙的要命这边的鱼都是现做的，所以比较慢，但是鱼的种类蛮多的，也可以做成不同样子的就是要排队，真的郁闷','0','2012-02-07 16:08:00',NULL),
	('1ad174b26e38f013412a2d5269cb1867','12c75bfb5067efd1ec13cc59c1b4e1f3','永恒的主角','3',3,2,2,'吃过2次，都是排队等位的！一排就是几小时！还好有WIFI和电脑，不然无聊死！！瓜子和茶水也是免费提供，可以向服务员要。味道其实还算可以，口味的选择性也挺多，怪味的吃到后面可以甜到腻死你！豆豉和香辣的不错~~~不过烤鱼什么的还是少吃点比较好，毕竟不是什么健康食品~~~注重健康的人应该不会碰这些的。','60','2012-02-14 17:22:00',NULL),
	('1af2635db9463aecdf002e1c22a1a299','12c75bfb5067efd1ec13cc59c1b4e1f3','Joyce_0710','5',5,5,5,'江边城外，简直就成为了我的后厨房了啊，三不五时的就是那里烤一记。。。至于等位的痛苦我倒是还好，有时朋友提前去拿直接下班过去就可以了吃了无数次，各种味道的烤鱼也超不多都吃过了，但是我总结出了香辣烤鱼和黑胡椒蚝油烤鱼是最好吃的，其实黑胡椒蚝油更加好，香辣烤鱼主要突出了一个辣字，而黑胡椒蚝油烤鱼在辣的感觉的同时还有黑胡椒所特有的辛，所以我这边还是强烈推荐他们家的黑胡椒蚝油烤鱼哦。。。。至于鱼选择也比较多，但是个人比较偏爱鲶鱼，鲶鱼的肉质比较细腻，皮脆都是我喜爱它的原因。。。','50','2012-02-06 15:49:00',NULL),
	('0466b30128e377ea8bb134aaf44b837b','14c75077794a3544e796f65f605dd3e0','嘴巴很忙','3',2,2,2,'就是喜欢这种什么都有的小吃街，明知道不会很正宗，就是喜欢这种环境烤生蚝，还不错章鱼小丸子，有一户竟然卖的没章鱼，只有萝卜粒...汗菠萝蜜，很甜卷粉的DD，一般般，加肉末的好吃点马蹄糕，难吃鱼蛋饼？还不错的某老字号老友粉，酸辣的，一般般甘蔗汁，死甜啊！老妈说没加糖，广西甘蔗都很甜的还吃了不少，忘记了。。。。','0','2010-06-03 14:32:00',NULL),
	('054d373141c17c88585b9f86acdb8fab','14c75077794a3544e796f65f605dd3e0','suiget','5',4,1,2,'就算中山路再破再脏再乱再有什么安全隐患,可能如果有一天我听到他被拆了,我一定超级难过的!中山路根本就是南宁人的回忆吖!隔一段时间去就会有一些新花样了楼上很多人在喷中山路 是的 你们外地人可能不一定喜欢但是中山路是2中的食堂 是我们一周必去一次的地方是来南宁不得不去的小吃街是20块可以吃饱吃到撑是你在万达逛累了 过个马路就可以近距离品尝美食的地方还有就是美女帅哥还是蛮多的 哈哈哈~','20','2010-02-16 22:12:00',NULL),
	('07c21084cd3f28745567bf42c09459d7','14c75077794a3544e796f65f605dd3e0','hedy815','3',2,2,2,'觉得现在比以前差了好多，不知道什么时候会被拆掉。环境的话真的不能说是好的吧，总是会有很多揽客的人，有时会觉得很烦。不过还是有很多东西吃的，粉饺鸭血、鸡爪、牛巴粉、瓦煲饭、海螺、老友粉这些都是不错的~','0','2010-12-10 00:17:00',NULL),
	('0ac18765a039a1e19cb93107273c574d','14c75077794a3544e796f65f605dd3e0','霙姞麗','3',2,2,2,'几乎整条街都在卖烧烤啊，去的时候遇上拉客的很不习惯。虽然卫生条件差，可是南宁的吃的又比较不贵的应该都能从这里找到吧~','0','2009-12-02 13:57:00',NULL),
	('0914ab51e489dff7996e4f55ea63f27e','14c75077794a3544e796f65f605dd3e0','_子瓜_','4',5,2,3,'品尝了武汉的油条，油腻且不脆。很想念中山路的油条。随时能吃到时不觉得有什么特别，现在想来···酥脆的大油条，浸入豆香清甜或热或冰的豆浆，入口，轻轻一咬，豆浆从酥松的油条间溢出，在口中交融，太美妙了~中山路肥英老字号，除了油条，油饼也是不得不提的美味！本人之大爱！葱花香，豆沙甜，外皮脆~！其实，身在异乡，我最想念的不是老友粉，而是中山路的豆浆油条油饼。回家后为了减肥，忍了半个多月没去吃。想想在南宁时日无多，错过了岂不后悔，最终还是在晚上（中山路咋只有夜生活呢···）去大快朵颐。入口的瞬间，觉得头顶飘着一朵美妙的浮云——为君不悔！原菜市对面的那家印度飞饼也很赞~那家店尚无人识的时候我就去吃了，并且觉得很不错，皮薄，香脆，最爱花生酱的，很香浓的花生酱的香味~想当年（不到两年)是6元，一下涨到9元了···盒子的防潮开天窗设计很贴心~卷筒粉皮薄而韧，馅足而酱香，最爱豆角馅的，总之味道好，口感佳，价格低~粉饺嘛···小时候还有惊艳的感觉，现在觉得一般了，价格越来越高，馅却越来越少···阿里妈妈自然是烧烤第一品牌，只是进来价格日升，品质日降。个人现在偏爱它家的豆腐皮和鸡爪，茄子味道也不错（当然不...同的师傅水平还是有一定差距的···）。豆腐皮酱汁的调味不错，质感仍保持湿润、柔韧、有嚼劲。鸡爪我喜欢烤得比较干的，有些烧焦的韧性十足的皮，最好骨头都能嚼碎···其他的品种，哎，缺乏亮点！全文','30','2012-02-06 17:31:00',NULL),
	('0d04a0ffe1c3245f522582d3c8028e27','14c75077794a3544e796f65f605dd3e0','雪人橙','3',3,2,2,'推荐来的特色小吃街，哈哈~南宁满大街的凉茶店，这里还有现场弄水果的，一次性的透明小杯子里2、3块榴莲卖近30块~各种粉，应接不暇，还有烧烤。推荐一整条抹了蒜泥的烧茄子，还有烧韭菜，呵呵~可惜没肚子了，对了，转角遇到爱里的蚵仔煎也有哦，但要去挨着臭豆腐摊的台湾老头那家，边制作边给你讲这个东东名字的由来，惹的众路人驻足，生意很好~我有拍视频哦~太在意环境的就不要来了哈','0','2011-03-31 09:38:00',NULL),
	('0f38df5e1c88b58835affe3e347a03a1','14c75077794a3544e796f65f605dd3e0','止疼爿兒','3',2,1,2,'中山路并不像传闻中的那么美好从万达路口进去 一路上的螺丝粉混杂烧烤的烟熏的空气地上的脏乱以及周围人的吵吵让人实在没有心情烧烤的每个摊位几乎都差不多烤鱼 烤韭菜 烤扇贝 烤生蚝 烤虾 以及各种但我感觉这里的海鲜不是很新鲜 生蚝一碰就掉下来了 去了几次都是那样以前的大同和大通 现在已经没有了比较大的昌记就算不错的了很讨厌几个人喝一两瓶啤酒坐在那儿玩儿色子 到夜里的人 无法理解 算是当地特色之一 中山路的复记老友粉还是不错的 还有靠近万达路口这边的木瓜奶鲜木瓜和蒙牛打的 很好喝 好像是7块一杯路口卖水果的也很多 菠萝蜜也就吃两三块就够了','35','2010-09-09 08:46:00',NULL),
	('1270c28f702743f2fa06af7285bf4040','14c75077794a3544e796f65f605dd3e0','9i','4',3,2,2,'早就知道这地方有名，误打误撞走进去了，因为觉得城市里老房子周围才是真正的市井的味道，所以循着老街走了进去，发现居然就是中山路小吃街。可惜去得早，家家户户才开始摆摊，整条街才初见规模，但是好多家已经开始排队，桌子都做满了。。。天热啊，我又懒得排队。。。','0','2010-08-07 09:00:00',NULL),
	('14de6d66aabd4fb751d87ae6d733456b','14c75077794a3544e796f65f605dd3e0','宠愛有嘉','4',3,2,2,'那里有很多的小吃，也有很多的烧烤，要看看自己喜欢吃什么了。消费还算可以，那里有铁锅饭，沙包饭，老友粉，粉饺，烧烤，甜品...','20','2009-12-02 15:56:00',NULL),
	('1ba748b73bf31376911a83bee235e15b','14c75077794a3544e796f65f605dd3e0','xyzfd','3',3,3,3,'其实我并没有在这里吃饭，只是走路顺道看看。都是小吃，还有海鲜排挡，相比而言，我觉着比在北海看到的价钱还便宜一些。好多当地人都在这里吃，都晚上11点多了，还是熙熙攘攘。看来南宁人的夜生活还是蛮晚的。我看到了烤鳄鱼肉的，没敢吃。虽然5块一串，但是还是下不了手。在南宁，来这里随便吃吃应该还是不错的。','0','2011-09-27 13:44:00',NULL),
	('1bf1dfdee7a8874c17b79e108de9e6e3','14c75077794a3544e796f65f605dd3e0','潘省','5',5,2,2,'来南宁怎么能不来中山路，另一方面中山路也是南宁饮食的缩影！卷筒粉老友粉烤鱼凉茶海鲜各种，就是以前油腻腻的街道有点不舒服但是来的为的就是美食！','50','2011-10-12 20:40:00',NULL),
	('1df291fec3be1365efe76f78dfdc11f7','14c75077794a3544e796f65f605dd3e0','小妖貝爾','5',5,2,3,'各种美味*.*~~那家绍兴的招牌水煮臭豆腐果然名不虚传~还有各种甜品，最爱番薯小水圆~还有清补凉~~烤生蚝又便宜有新鲜味美~~还有叉烧也很有味~~','0','2012-02-06 15:54:00',NULL),
	('01802e40a02880feed1198423a0159dc','17c6a3d85806b009bae7d7a8b20bcd2c','lsyediehard','4',4,4,3,'过年在那里领了一个面食礼盒，晶沙酥和红莲酥超级好吃啊，皮薄馅大，而且不是很甜，吃多不会腻，太棒了，顺路买了一块沙架，价钱倒是不贵，11.5，巧克力也不少，就是蛋糕有些干，乳酪蛋糕卖的不便宜，不知道为什么，总体来说印象还不错，东西挺实在的','0','2011-01-29 22:52:00',NULL),
	('01a2c9b2007a972fa3db3833ade1dce4','17c6a3d85806b009bae7d7a8b20bcd2c','荭酒','0',3,2,2,'我这个是喜欢吃甜食，闻见面包奶油的味道就走不动了，来这个店买过几回小点心，味道很好，朋友过生日也是在这买的蛋糕，不过这些东西都不能吃太多，长胖，呵呵！','25','2008-10-31 16:10:00',NULL),
	('037e294be3c19978be9c6321bafcf0cd','17c6a3d85806b009bae7d7a8b20bcd2c','SH50','4',3,3,2,'国大旗下的店，一个字形容 “火”，高峰时段要排很长的队，一般都用面包储值卡消费 有熟食区 面包 蛋糕区 还有馒头豆包类 零食区 都供不应求 每次都必买红豆类的面包 还有椰蓉的 奶味很浓','20','2011-07-25 10:47:00',NULL),
	('03fdf75e0dcd13cb0cc377280c7440af','17c6a3d85806b009bae7d7a8b20bcd2c','proths','5',5,4,4,'国大旗下品牌，质量啊卫生啊什么都绝对有保证的。早些年的时候是在酒店里边的，后来才单独出来做店~以前给他家做糕点的包装，接触比较多，每年都会吃到朋友送来的月饼贵，如果自己花钱我应该不会买但东西真的很好吃哇。。。','0','2010-12-04 00:35:00',NULL),
	('07196ec86806937433bc0245624b1b4d','17c6a3d85806b009bae7d7a8b20bcd2c','某毛毛毛','0',2,3,2,'刚刚又专门查了下，国际大厦是四星级的hotel，８过鲜鲜坊，可绝对没有四星级酒店应有的西点房的水准。至少我试的两个如此，都是0.5分的水准。当然不排除我狗屎运：她们什么难吃我拿什么。墩墩的黑麦面包(4)，倚靠她可爱的外形俘获了我，却是完完全全的草包。没有谷香、干且硬、假粗粮。巧克力顺滑感十足的Sacher蛋糕(11.5)，很遗憾的：90％被海绵蛋糕占据着，唉～还是干干的那种。巧克力酱部分呢？果然是代可可脂。。。么有内涵的味道。。。环境倒是有星级酒店旗下应有的感觉，可是细看之下，无论面包、蛋糕还是其他小食，都只是一般水准吧。','0','2009-01-02 21:38:00',NULL),
	('07e7eadd29276e166117b2d868269980','17c6a3d85806b009bae7d7a8b20bcd2c','子桃甜甜','4',3,3,3,'鲜鲜坊很多年了吧，注重的就是他家的新鲜度--绝对不卖隔夜的产品以前哈根达斯也坐落在这 最近好像哈根达斯不卖了 鲜鲜坊店面扩大了而且小蛋糕也很特别也不贵 ，8元钱给小外甥女买了个小乌龟的甜点 ，让她喜出望外高兴极了。味道也很好吃，她打开了以后我也想尝尝，吃了一口就想吃第二口。面包也很不错。','8','2010-08-28 00:53:00',NULL),
	('080468efdd1ea0fc9e2b0f1df73f6e47','17c6a3d85806b009bae7d7a8b20bcd2c','破猫cair','0',4,3,3,'黑森林、提拉米苏、芝士蛋糕都是我超级喜欢的，不过价格有点贵，另外考虑到要注意身材不要太增肥，所以我现在很少去吃了。不过如果是到国际大厦吃自助的话就比较值了，蛋糕无限吃真是很爽的事情！','20','2009-09-28 11:44:00',NULL),
	('08647097f4da5c66a62e20e0613f16f1','17c6a3d85806b009bae7d7a8b20bcd2c','私享家xixi','0',5,4,5,'口味绝对好 价格绝对高 服务员热情有余 常常让我感到手足无措 有时候有冷言冷语 好像我们吃不起他家的东西 看不起人的感觉 门面都点小 停车不太方便 除非散步路过那 轻易不会去一趟','40','2009-04-08 16:22:00',NULL),
	('08ef78c7e310c1ce73141e713afde175','17c6a3d85806b009bae7d7a8b20bcd2c','giggledou','0',3,3,3,'确实如楼上评论的，水平和四星级的标准还是有很大差距的 劳工觉得很不细腻做的，偶也觉得挺失望的，黑森林做的好粗糙阿尤其是上面那层巧克力，口感真是。。。哎 不过，有一次在楼上吃自助，说甜点就是鲜鲜坊的，那次感觉还不错，都是一家，不知道为什么？','20','2009-02-05 15:00:00',NULL),
	('0a0008147227edf8c1daff4270be5807','17c6a3d85806b009bae7d7a8b20bcd2c','馋嘴猫猫85','5',4,3,3,'是朋友去吃哈根达斯，然后看了点评网后去的。去了果然挺好，就像那种燕凤楼和白楼宾馆一样，是国际大厦的外卖。价格和好利来差不多。除了西点面包还有些面食和肉制品的。要了一个鸡蛋形状的，忘记叫什么，好像彩蛋什么的。8块。说是橙子味，我吃着里面有菠萝的粒，然后是像奶油和芝士奶酪一样的口感，非常细腻，冰镇一会比较好吃，有些细腻的润滑口感，而且有些小气泡，不会让口感很浓，我太喜欢这个口味了。还买了块黑森林，吃起来也还可以啊。不过还是喜欢前面那款。','10','2010-06-11 10:43:00',NULL),
	('0ca5b7955372e8a23c18897c817b885b','17c6a3d85806b009bae7d7a8b20bcd2c','蝙蝠中队','0',4,4,3,'典型的蛋糕房的贵族，东西有特点，和好利来，五羊不是一个风格，每年8月15的月饼，都很不错，有个大铁盒子我很喜欢~每次的都留着呢，呵呵~','30','2008-11-15 17:11:00',NULL),
	('0ea3221a178042d96a7cf7ad983e20d8','17c6a3d85806b009bae7d7a8b20bcd2c','yuqian1004','3',3,2,2,'鲜鲜坊的月饼非常好，尤其是蛋黄月饼是大爱，他家的红肠也很不错。喜欢！下班后经常去吗一些面包当早点，尤其喜欢肉松的。','0','2011-10-12 21:44:00',NULL),
	('13fad2ddcc57aaaa87274a3784bdae2b','17c6a3d85806b009bae7d7a8b20bcd2c','愈','0',4,4,3,'鲜鲜坊的蛋糕比其他地方的略贵一点,但质量还是很好的.推荐麻子面包 沙架大地瓜 还有奶酪蛋糕.黑森林蛋糕虽然味道很好,但太贵了,反正我是有点接受不了.','0','2006-06-26 09:25:00',NULL),
	('150d0348008e336cd16c841c6fb612c1','17c6a3d85806b009bae7d7a8b20bcd2c','beikeyanlei','0',4,3,3,'这里的熟食还可以吧，最起码比较干净。蛋糕最喜欢吃黑森林，味道确实不错。还有一种里面带红豆的切片，更是棒！','20','2008-07-30 16:04:00',NULL),
	('15802c35d0184e4fa0ac34ab077ef209','17c6a3d85806b009bae7d7a8b20bcd2c','法娜娜','5',4,4,3,'这是我从始至终最爱的一家糕点店，最爱它家的莎架和芝士蛋糕，吃了N年了。口味只有几次改变，不过还好没有让我失望，又回到了开始最爱的味道。后来还发现北国三楼的咖啡店的蛋糕也是从这里出来的','20','2011-08-31 17:37:00',NULL),
	('1855abad9cabbdccabfa83b3eed1ffb2','17c6a3d85806b009bae7d7a8b20bcd2c','山万重','3',3,2,2,'鲜鲜坊走优质高价路线，红肠长盛不衰，看到它就想起刚毕业时几个好朋友聚在一起喝啤酒就红肠，不亦乐乎的情景，怀念啊！盐锔凤爪竟然卖到60一斤，不过颜色非常可疑，有使用色素的嫌疑，呵呵，只是猜测而已。面包水准一般而已，蛋黄酥月饼确实不错，每年销量雄居各大品牌月饼之首，佩服啊！店里从来不缺人气，不缺高消费。总之地段商圈、品牌积淀成就了鲜鲜坊的辉煌，盼它扬长避短，越来越好','30','2011-09-23 00:09:00',NULL),
	('18d6828d5d08b48ca0afd63d689e528f','17c6a3d85806b009bae7d7a8b20bcd2c','mshirin','5',4,3,3,'石家庄的芝士蛋糕果然还是他家的够味吖 连我家不爱吃甜点又挑剔的老妈都赞了一把就是东西太抢手了 每次路过都是晚上 东西基本卖光了 想吃好吃的还是要赶早去','18','2011-11-29 14:28:00',NULL),
	('07a3e3e6759d5e42e387ed1b0eaf8511','17eafc3d6647fd2da264a90ed4e0e9d5','Ruby小肥肥','3',2,1,2,'这家算是厦门最有名的土笋冻了，之前朋友一直说这家多好吃，里面的沙虫很新鲜，的确是这样，但是我不喜欢他们的佐料。我讨厌甜辣酱，对于我这种资深吃土笋冻的人，海沧的放了蒜头的酱油水佐料我更喜欢','10','2011-03-11 16:53:00',NULL),
	('118ef68e70c15b13feba9f338e47c186','17eafc3d6647fd2da264a90ed4e0e9d5','camille1123','4',3,2,2,'很喜欢土笋冻，QQ的口感，很像果冻。忽略掉其原材料，这道厦门的特色菜还是非常值得品尝的。Q滑的土笋冻蘸上一点芥末酱，非常美味，点了2份。','35','2011-05-06 11:48:00',NULL),
	('152088ebad62b160757c9c0a6e1f9f7b','17eafc3d6647fd2da264a90ed4e0e9d5','暴食的胭脂','5',5,1,2,'忘记了价格了，反正很便宜一大盘 好吃 好吃 有点酸 有点甜 和佳味再添家完全不一样，好吃多了这个地方好难找，我下车后步行了好一段时间 哈哈','15','2010-08-15 14:58:00',NULL),
	('15fb254b4ed5aea8eb54547773070ccc','17eafc3d6647fd2da264a90ed4e0e9d5','Joyce言言','4',4,2,2,'其实刚来厦门时,就听说这东西...只是一听说是虫虫,我就有点儿心惊!不过来厦门了,就得试试不是,所以朋友就带我到这家话说很有名儿的土笋店儿,一个字:棒~~ 看着其实也不像虫啊,吃进嘴里,特别爽口,好吃咩!!~','10','2011-02-26 15:20:00',NULL),
	('18651078a6da88a5095ffb04d7134deb','17eafc3d6647fd2da264a90ed4e0e9d5','分分分分','1',1,2,2,'【试吃/体验点评】不能单点， 小个的十块钱十个，一个就一块钱。里面有芥末， 吃的时候冲死我了T T 吃不出什么味道， 也没觉得有什么吓人的，就这样吃下去了..不过不爱吃。','10','2011-02-10 19:45:00',NULL),
	('1bda99da9d43f8351524c8dac431c2ed','17eafc3d6647fd2da264a90ed4e0e9d5','slimmilk','3',3,2,2,'土笋冻是比较出名的厦门小吃，这家是点评率最高的，吃完后发现，主要是酱比较好吃．土笋冻，１０元一份，我原来以为冻会是软软的那种，后来吃了才发觉，是很Ｑ的那种，配着冰冰酸酸的口感吃下去，还满好吃的．右边的鱿鱼１００块／斤，单只３０／只．我个人认为尝一下就可以了不用吃太多，章鱼是用黄芥末＋甜辣＋花生酱拌的，但我觉得口感上不够冰脆对不起这个酱','40','2011-08-09 00:35:00',NULL),
	('1bf05dded09c3b87637f3f5c15e45499','17eafc3d6647fd2da264a90ed4e0e9d5','小紫色','4',3,2,3,'慕名而去，位置挺好找的。中山公园西门正对的斗西路一个丁字口上，感觉门面翻新了，铺面比想象的大些。里面挂着厦门名小吃的牌子。土笋冻有大中小三种，一份都是10元，个数不同而已。配上酱汁、芥末和腌萝卜味道还不错，不过除非有特别喜好，吃一次尝个新鲜就可以了。感觉和北方的肉皮冻差别不是很大，只不过材料是猪皮和杀虫的区别罢了。大粒的杀虫大一些，口感会更好；吃小粒的估计就更像肉皮冻了:P味道比大中路上的味再添强多了。','10','2012-01-10 11:30:00',NULL),
	('052f35e7ab554e158bb681fb3246901d','1808cc1fc27033b02b5a4c75dcb29276','legend02s7v','4',3,3,2,'很有特色的一家小店，一进门一张大玻璃，里面一位印度主厨在忙活，所有过程都能看见，感觉还挺干净的，咖喱味道一般吧，但是芝士烤饼绝对值得一尝，牛奶大米浅浅的一小碗，10元，一般吧，去这里也就吃个新奇了！老外真的很多！','60','2010-11-15 13:36:00',NULL),
	('0b89c90b5d3d67715b24cd5c7f1f5c72','1808cc1fc27033b02b5a4c75dcb29276','关于鱼','4',3,2,2,'红绿黄咖喱都不错，白的有点腻。另外海鲜咖喱真心难吃，里边只有少的可怜的几个鱿鱼须，不如蔬菜，羊肉或者鸡肉的。芝士烤饼大爱，热的时候吃起来口感很rich，凉下来就不好吃了。酸奶一般，跟蒙牛似的。上次叫了印度红茶，太水，不推荐。环境很一般，服务员不是很机灵，比较适合跟朋友随便吃吃吧，人多了也不行，点不出太多东西。','80','2011-11-07 15:40:00',NULL),
	('0baad2d8c004a0a22e64fd7e03b04459','1808cc1fc27033b02b5a4c75dcb29276','360_ziwen090','4',4,3,3,'白咖喱，甜甜的，奶油味很浓，女生会喜欢黄咖喱，比白咖喱浓稠，很下饭，偏咸口自制酸奶，不加一点糖的酸奶，可以接受芝士烤饼，芝士很多还有一个什么海鲜小炒，口味一般，没啥特色，里面鱿鱼很多','65','2011-12-03 00:47:00',NULL),
	('0f8d36ddd1ba271e9e53ae6ec634245d','1808cc1fc27033b02b5a4c75dcb29276','水素','5',5,2,2,'门店大庆，所有的东西半价。咖喱很正宗，烤饼好吃，非常好吃。个人觉得从口味上来说，咖喱非常好，但饼更好吃。而且这里的咖喱还能外带，非常合适。','30','2010-05-18 20:59:00',NULL),
	('0fe2e968f39c5799f43ee48ecfd22692','1808cc1fc27033b02b5a4c75dcb29276','flowzsy','4',4,2,2,'也是在点评上看到，慕名而去，不够肉，老公不喜欢，咖喱确实比较纯正，只是印度餐的种类比较少，但烤饼很容易饱！酸奶不错，不知道是不是自制的。格调更适合情侣约会，男生还是点米饭。','70','2011-09-04 09:45:00',NULL),
	('1452e5969da7b7b21a747f9a8ba863cb','1808cc1fc27033b02b5a4c75dcb29276','永远是胖子','5',4,4,5,'虽然不知道什么样的咖喱才叫正宗吧，但是这家店还是让我挺喜欢的，起码这店对我自个儿算是有特点，再加上一进门儿就看到厨师的微笑还有接待的那个声音很轻略微娃娃音蛮亲切的女服务员，就让这次吃饭更舒心啦。1.炸蔬菜 26/份 有茄子和土豆两种，外皮脆脆的，趁热吃最好不过，放凉了就相差不少咯。数了数有个十三片左右吧，配着蔬菜沙拉还有一份番茄酱。外面那个外皮尝尝好像有点儿辣味，是不是也是咖喱酱什么什么的抹在上面炸的哦？？沙拉酱是红色哒。2.芝士烤饼 25/4块 这个是真没吃完，剩下的打包了，毕竟是一个人去的，服务员高估人均食量了是不。。沾着咖喱刚开始没觉得很棒，可是越嚼越喜欢。饼是软的不是偏脆的，松软有嚼劲，本身不厚，可夹得芝士不少呐。芝士貌似是咸的么？总之，我爱芝士！3.鸡肉洋葱咖喱 35/份 这个是新菜单上的，还不错。里面有四块鸡块吧，一块还不小，连皮带肉的，满嫩。可能我口味喜重吧，虽然觉得蛮香蛮好吃可还是觉得不够重，辣也只有一点点而已。4.自制风味酸奶 10/杯 这个我喜欢，好喝~~微甜，清爽，属于饮料类，还有另一款浓的作为甜品的。  来了几桌全是外国人，为啥呐。  环境也不错，里面还有包间的。  咖喱。。你果然...罪恶的把俺的牙套无情的染上了颜色。。。全文','96','2010-06-01 23:03:00',NULL),
	('17cfa0d8b5359ef86d3d234163931323','1808cc1fc27033b02b5a4c75dcb29276','水盼','3',2,2,2,'上菜非常之快的说，不过话又说回来，一共也没多少菜色，呵呵。感觉没有评价的那么好，还算可以，吃得很饱，因为感觉···都是主食，哈哈。咖喱嘛，没吃出来多正宗，我也不知道什么是正宗，就是觉得没有一些泰国菜馆的香浓。反正还算好吃吧，芝士饼也还好···但是只是普通而已。其他乱七八糟也点了些，全部普普通通，呵呵，不好不坏的一家店吧。','60','2011-01-27 21:31:00',NULL),
	('1a581b8d6502126b027a8599a4df304e','1808cc1fc27033b02b5a4c75dcb29276','0梦醒苡后0','5',5,4,4,'想尝试印度餐，在点评网查到这家，就和家人一起去了，点了一份烤饼，一份鸡肉咖喱，一份羊肉咖喱，感觉鸡肉咖喱比较好吃，羊肉的好像洋葱有点多，我不喜欢吃洋葱……烤饼的味道真是不错，香香的，很浓的芝士味~外国人挺多的，貌似厨师也是外国的（具体哪国就不知道了）。就是感觉这里消费高了点，如果钱包不鼓的话，不太会考虑这里的。','50','2011-11-07 20:11:00',NULL),
	('1a899bdd107d5cdc17cfc1ec904b0c96','1808cc1fc27033b02b5a4c75dcb29276','daylay1','3',3,3,3,'是被朋友拉去的，吃了他们家的套餐，不过点了就后悔了，因为套餐里的饼不是芝士饼，芝士饼确实好吃，只是之前吃的太多了，他们家的咖喱和新滋味不太一样，不是那种很纯的，而是加入了很多馅料，别有一番滋味','30','2010-12-11 21:14:00',NULL),
	('1b8c53d99f8bf0b431f5e33e6ef42033','1808cc1fc27033b02b5a4c75dcb29276','roquefort','4',3,2,2,'各种饼不错非常筋道，咖喱.....味道不够，没有咖喱特有的那种辛辣感觉这个最难接受。不过味道还可以，吃着也算舒心。吃咖喱一定要有那种辛辣味道（不是辣椒那种辣味）才好吃，才算是咖喱。外边卖的咖喱粉都不纯，里面掺合着姜黄粉etc...等其他配料。','65','2010-10-25 14:13:00',NULL),
	('1cfa9b8daa3eece920295af43d00618a','1808cc1fc27033b02b5a4c75dcb29276','o王小歪o','4',3,3,3,'老公最喜欢是这儿的馕，咖喱倒是其次了，可能我们已经适应了改良过的口味，这儿的咖喱显得不是那么香腻，至于是鸡肉咖喱还是海鲜咖喱，酱汁好像都没什么区别，只是里面的料不同而已，所以我推测做法是在料上浇同种咖喱酱~~馕沾着咖喱，绝配呀~~~~~一定要吃馕哦~~~~~','40','2011-01-10 18:13:00',NULL),
	('00919a06fb40e6e53180aceb4d97f35d','1a78ac0f1be52ab89daa4bfc7780ad5e','htjz','0',3,2,2,'也是在当地朋友的指点下才找到的老字号，擅长做面食，先点面，再点卤，面有很多种做法，我比较喜欢的是剔尖儿，卤是小炒肉的，分小中大，分别是6元、8元和10元，烧卖很一般，倒是不贵，一般2两起点，3.5元一两，另外还有凉菜和炒菜，价位适中，味道没什么特殊的，到这来一般都是吃面食为主，凉拌的平遥碗托也不错，就是偏咸了，总体感觉还不错，是个吃面的好地方，另外这里有特供的沙棘汁，与超市里卖的不是一个浓度的。','30','2009-10-13 22:14:00',NULL),
	('03b866608181ca7f55fdb3e17f7909de','1a78ac0f1be52ab89daa4bfc7780ad5e','Durango中粮','0',3,2,2,'临回北京前在这里吃的。门脸真不引人注目，差点错过，呵呵。上得楼来，发现人真多，基本都得拼桌。我们这桌三伙人。由于人多，店家只供应刀削面，剔尖两种面，烧卖也只有两种馅了。服务倒也干脆利落，因为好多都没有，取消还没开听证会，呵呵。过油肉味道是很不错地。在北京只吃过乔家大院的，这里的要更好吃些。跟吃鸡蛋差不多的感觉，呵呵。面条挺好，卤倒没啥特别。结账36，是我们这桌的冠军。旁边的一对点了凉面、拉皮、两笼烧卖，怎么才24啊，呵呵。可惜时间短，人多，要不得好好尝尝。一楼是外卖的柜台，卖传统糕点。','20','2009-05-30 07:49:00',NULL),
	('04cd4ff882c5729a5cd08229912fc042','1a78ac0f1be52ab89daa4bfc7780ad5e','tankettes','0',5,2,3,'老字号就是老字号，我非常喜欢他家的三鲜烧卖和过油肉，而且价格也很合适每次回家的时候，必去的地方好想你家乡的味道啊','20','2009-05-29 21:59:00',NULL),
	('07fb0cfb73cb79f6b7ba403385b49af7','1a78ac0f1be52ab89daa4bfc7780ad5e','海鲜至上','3',2,2,2,'中午随便吃点，看到这家面店有点特色就去了。二楼大厅人真多，服务员热情指点到三楼包房一坐下才知道包房收费30元，面等了时间较长，点了小排与面一起吃不错。','0','2011-04-16 19:34:00',NULL),
	('081d3682f6012e9e3ae5ff0805da0905','1a78ac0f1be52ab89daa4bfc7780ad5e','sasaki37','3',2,2,2,'出差路过特意安排尝尝，据说很有名，不是饭点儿不开业还……国字号的传统么……说真的味道一般般吧，没有评论里那么好','24','2011-01-09 14:25:00',NULL),
	('0ebc634b3df9ae67a0072ad38712b2d2','1a78ac0f1be52ab89daa4bfc7780ad5e','我爱老爷','4',5,2,2,'第一天到太原吃的店，应该是太原的老字号，点了羊肉浇头的揪片儿，真的很好吃哦，很浓郁的羊肉味道，冷盆点了一份平遥牛肉，比真空包装的好吃N倍，很有嚼头很香的牛肉，门口有他们的点心店，味道很好，价格也很亲民，去机场前，还和老公特地跑去买了他们家的点心带回来！','20','2011-06-08 13:10:00',NULL),
	('0f15e3a00087c9cd269d74951d1e41ec','1a78ac0f1be52ab89daa4bfc7780ad5e','rongrong0429','0',4,2,2,'这家店的味道算是山西饭店中味正的了，只要是路过我都会进去本人强烈主推烧卖，过油肉，烤姥姥，剔尖哈相对的服务真的是很烂，不过为了吃我忍了','20','2008-12-02 13:06:00',NULL),
	('150c90d3d0150d5a5dcfd9c1fab205d7','1a78ac0f1be52ab89daa4bfc7780ad5e','becky爱吃鸡丁','0',3,2,2,'国营的饭馆一般都是又贵又不好吃，可是这家例外——出乎意料的便宜！小炒肉的浇头很不错，烧卖没有什么特别惊艳的感觉，不过也很满意了。山西的面食果然名不虚传....','15','2009-10-08 13:01:00',NULL),
	('15eb94a8316c23754848a14844ba950c','1a78ac0f1be52ab89daa4bfc7780ad5e','流落辛','0',3,2,2,'哇，难得来吃面食，六种面这道很有意思，六种酱汁，但要吃快点，太慢了 面食容易冷（说明服务不到位，不然慢慢上六种面就很完美了）。还有就是过油肉，第1次吃，感觉挺棒的。','23','2009-04-21 14:54:00',NULL),
	('16b7b9f3f704c132d9a0a7d1569395b4','1a78ac0f1be52ab89daa4bfc7780ad5e','tianye816','4',3,3,2,'每次去都是烧麦+蛋汤标准组合经常还买回去烧麦吃除了烧麦，没吃过别的东西不过他们家的烧麦确实好吃！！就是服务比较有国营饭店的特色呀！很多年前的时候餐具是要自己拿的现在改变成了有一些快餐店的形式稍微提升了一些！旁边还有饼屋','20','2011-04-29 14:29:00',NULL),
	('179c065174ffd401d3c5c13a5fe051aa','1a78ac0f1be52ab89daa4bfc7780ad5e','璇子璇子璇子','0',3,2,2,'其实，我是想找山西面食大全的，，，跟司机描述了半天，，，就给我带来了这，，，一看也是老字号，，里面坐着的食客可不少呢。。。基本上都没位子了，，只能被服务员带到了一个大桌子跟人拼桌。。。。圆桌对面坐着两位典型的山西汉子，，很好玩的。。中途还跟我们开玩笑说服务员再不上菜，，就把我们的吃掉。。点了牛肉呛锅面，三鲜烧麦，剔尖，长山药炒木耳，灌肠。。。基本上那个灌肠是被我们全家一致枪毙掉了，，，荞麦面做的，，不喜欢那个口感。。。牛肉呛锅面就是牛肉刀削，，牛肉味道浓郁，，三鲜烧麦我尤其喜欢，，，人家太原的烧麦跟我们这边的做法不太一样，里面没有糯米啊啥的，，除了样子，，，其实吃起来跟吃汤包(没什么汤的汤包)没啥两样。。。呵呵。。。剔尖，，还行吧，，跟头天我吃的刀削又是一样的长相，，，山西果然是面食多种做法。。。长山药炒木耳，，是当地特色菜，，我还蛮喜欢的，，，很清淡的口感。。看着舒心，吃着舒服。。。呵呵。。对面的山西汉子对我们产生了浓厚的兴趣，，问爸爸，，我们是一家子吧，，，然后很开心的介绍，，说这个馆子绝对是老字号，，人很多的。。。然后我就问你们太原有啥好吃的呀。。。他豪爽的说，，那多了去...了。。。然后开始说，，，由于哪些馆子名我没给记住，，再次就不重复了，，然后我说，，刚才想点猫耳朵，，服务员说没有，，还有好多没吃过的名字新奇的都说没有了。。。他们又说老字号没经营好，，人多，，管理不到位，，，师傅忙了，，都懒得做了。。。所以尽挑些简单的做。。。没吃到猫耳朵，，小遗憾。。。不过，，这边服务员确实有点乱作一团的感觉，，，人太多了。。整体感觉还是不错的。。嘿嘿。。全文','18','2009-07-29 15:55:00',NULL),
	('1cafe04306be191c8f733b43c34dc2af','1a78ac0f1be52ab89daa4bfc7780ad5e','开忾','0',3,3,3,'四个人听别人介绍，去了太原面食店．哇人满满的．．．．．．叫刀削面 醋浇羊肉 肉丝呛锅面等东西．味道挺不错．与南方面食不同．别有风味．蛮好的．','0','2009-08-16 09:21:00',NULL),
	('1d0b628d800892742fd34ed0f6e7141f','1a78ac0f1be52ab89daa4bfc7780ad5e','SNAIL_xu','2',2,1,2,'慕名而去，失望而归。旅游的第一站就是太原，吃饭的第一选择，就是太原面食店。环境脏乱不说，服务的态度也很差。主要是我们点的主打菜，没一个好吃的，让我彻底对山西的刀削面，烧卖失去了兴趣。原以为山西的面食，就是这个平平的味道了。可到了大同，才发现原来不是山西的面食不出彩，是太原面食店的东西做的太差。一样的刀削面，烧卖，怎么人家就能把山西的口味发挥得如此淋漓精致呢？','20','2011-10-24 10:18:00',NULL),
	('00b1e7012e4f4eed5c61801fcf678d6d','1ce5842a6e37b25b51c1d9458093620c','lygyu','0',3,3,3,'第一次到苏州来，是和同事一起来的，这里的价格还算马马虎虎吧，还是比较能够接受的，黑鱼子酱小鹅肝炖蛋 这道菜印象比较深刻，其他还都不错了，以后有机会还会去光顾的。','0','2008-06-14 21:44:00',NULL),
	('00f5a89266b5ba330c711bc4730add11','1ce5842a6e37b25b51c1d9458093620c','艾薇快跑','5',4,3,4,'环境很好，都是包厢。说是个台湾人开的，还开个法式的。有小孩座椅。包厢可以根据人数选择，要提前预定的，座位一人一个，围成半圈。大厨一个桌台一个。就是电视上看到的那种，白色高帽，明晃晃的圆的厉害的不锈钢大锅盖的风格。鹅肝是现场制作的。牛排也是，想吃几分熟要和大厨说一声。炖蛋也是现场制作的。还有生菜啊都是在铁板上翻炒的，油烟机都备的妥妥的，声音很小不会打扰客人讲话，也没有油烟味道。感觉非常不错。菜是按顺序来的。各自选各自的汤，上一圈汤。各自选各自的甜品，上一圈。蛮有意思的。黑鱼子酱小鹅肝炖蛋，真的很小资啊，一口两口就没了。南极冰鱼可不是每次都能吃到的奥。点了两条，大家分了吃了。味道都不错，吃的流程还蛮长的，用了俩小时，算是极尽浪漫吧。就是每道菜都很少，吃完一道就消化完一道。最后还想来个炒饭充饥呢。','198','2011-12-01 10:54:00',NULL),
	('02a90ee89c47ca24dcd954ebb1c72f87','1ce5842a6e37b25b51c1d9458093620c','幽雅吃透透','0',4,4,5,'唯一的缺点是, 天花板隔音不好. 偏偏楼上是健身房, 因此要忍受在咚咚咚的健身音乐中享受美食. 不过大部分的时间应都是看大廚做菜, 听到的也是铁板声. 各方面都不错. 只是我认为价钱并不是很值得.','250','2008-06-19 17:50:00',NULL),
	('03200c56efa781ed3ff92f7b9a28e6c0','1ce5842a6e37b25b51c1d9458093620c','lovelysicy','0',4,5,4,'在偶减肥期间去的，是别人请客~~餐前小点，芝士蜗牛，味道很不错，之后就饱了。一直看厨师做菜，很专心，然后厨师一直鼓励我吃，可惜我吃不下，弄得厨师很郁闷，最后吃了一小块培根卷，味道很不错~','0','2008-07-28 14:44:00',NULL),
	('04162148e8314adb4c39c28ab031f5f5','1ce5842a6e37b25b51c1d9458093620c','大扁扁','0',4,4,4,'一个字贵，但是贵的的确有道理，点了一个黑毛牛肉，的确是我所吃过最好吃的牛肉了，入口即化的感觉，唯一缺点是实在太少了，那点肉根本不够填肚子的。其余的菜用料也很好，如果不是太贵了，真希望多来几次。','700','2009-08-17 20:39:00',NULL),
	('08aa3eddc29b23de595f0d00093f3c3e','1ce5842a6e37b25b51c1d9458093620c','小老虎来啦','5',3,3,4,'说实话，这家感觉和王品有点小像，都是走的情调路线。环境很不错，都是在包厢里吃，吃完被带到大厅去吃水果聊天，感觉还不错。其实我感觉就那样吧，每次和我来的某人感觉是很好的，就好浪漫这口，所以我没办法逼着自己也要变得有情调一点。我会觉得每次都没吃饱，唉。。女人嘛，浪漫能填肚子的，男人肚子只能填肉。','0','2011-11-08 22:43:00',NULL),
	('08eace794f6302d261cc641329695e5b','1ce5842a6e37b25b51c1d9458093620c','laracl','4',3,4,4,'【试吃/体验点评】中午吃的套餐，但食量算小的我也没吃饱……那个炖蛋真的很美味，鱼子非常鲜美，服务态度也很好，给人享受贵宾级待遇，只是要吃饱吃好，还是荷包鼓鼓的时候来吧，听说如果人均500，那就可以吃的很爽了','150','2011-07-22 20:24:00',NULL),
	('0e29d624ff760b34a83e8326a1a86d90','1ce5842a6e37b25b51c1d9458093620c','林木木同学','5',4,4,5,'开评之前先夸下他们家服务，之前预定的说今天中午12点去用餐，预定的时候就感觉不错，接线员的声音都好甜美，说话也很温柔，姐一向喜欢温柔的女生，今天早上10点打电话来确认订单，并询问是否能准时到，要是有事可以推迟什么什么的，同样温柔的声音，听着真是舒服。从印象城走过去，大概不到半小时的时间，电梯直接上5楼，上去就看到他们家。开吃：第一道：蘑菇汤，很鲜美，比王品略逊一筹，但也不差。第二道：蒜蓉面包，这可以算一道么，姑且算一道吧，拿上来的时候还是热乎的，不错。第三道：鱼子酱蒸蛋，大家极力推荐的，吃的时候能听到鱼籽在嘴里爆裂的声音，好刺激，鸡蛋很嫩，重点是里面有鹅肝，特意问了下，他们家鹅肝是先煎然后再蒸的，所以口感更嫩滑。赞第四道：鲜果沙拉，他们家沙拉做的很有创意，将各种水果装进番茄做成的容器里面，淋上果酱，好吃。第五道：比目鱼，这个好吃，很Q的口感，特意问了下，原来比目鱼是深海鱼，难怪好吃，哈哈。第六道：牛排，有人推荐说3分熟很嫩，想想我还是淡定的要了五分熟，嫩是嫩，就是味道有点怪异。旁边还有一堆煎过的大蒜，厨师说吃起来跟土豆差不多， 我相信他了，往嘴里一放我就后悔了，立马吐了。第七道：炒鲜...蔬，这个比牛排好吃，哈哈，估计厨师听到要气死了吧。第八道：送的萝卜糕，事实证明食材很重要，萝卜你再怎么做还是萝卜，我轻轻的咬了一口就没吃了。最后是甜点跟饮料，我要的是黑森林蛋卷跟咖啡，甜点做的真心不好，跟哪儿比都比不赢的，咖啡倒还好。总之，这顿吃的很开心，很满足。全文','0','2011-10-07 19:03:00',NULL),
	('09bcec3233d35eb9f258b8f626edf6d9','1ce5842a6e37b25b51c1d9458093620c','wujunchun','0',3,4,3,'就在我家附近，不过没去吃过，随便说说不过园区的新开的店很多，价格也蛮贵的，我想贵自有它的道理，下次去吃吃...','0','2009-10-15 21:59:00',NULL),
	('0a363b827fb361ec316073c1233db168','1ce5842a6e37b25b51c1d9458093620c','jjach','0',2,4,3,'非常有气氛的一个餐厅，鹅肝我很喜欢吃的，每次去都必点的一道～不过价格不便宜的，有点小巨，不过偶尔来享受一下还是不错滴：）','0','2009-05-18 08:17:00',NULL),
	('0a728bc2acd657d77e88471b004d2c06','1ce5842a6e37b25b51c1d9458093620c','A阿朱','0',4,3,4,'因为有人请客才得以吃了一次，点了一种套餐，厨师就在铁板对面给你一样一样摆开，介绍下一道菜，然后开始做，手法漂亮（香港来的师傅），不光好看，味道也极好！每一道菜都觉得好精致，不太够吃的感觉。吃完了还去音乐厅坐了会儿，环境是好的，服务员态度也挺殷勤。','400','2008-01-30 22:38:00',NULL),
	('0e1ba6e5f5a9f7e2a9da9e1b6d0317bb','1ce5842a6e37b25b51c1d9458093620c','那天Michelle','5',4,4,4,'好吃 很喜欢 想着哪天再去吃一次呢 但是好贵啊 很喜欢这样的感觉 氛围很好边吃边看师傅做菜 不错 很享受生活 做出来的美食好精致啊 都舍不得吃 就那么一点点 吃完后还可以换到别的地方 吃点心 不错 环境我喜欢','100','2009-11-19 16:43:00',NULL),
	('118fcdddc80d8344b8934903c081b528','1ce5842a6e37b25b51c1d9458093620c','钝钝的甜甜圈','5',4,5,5,'暗暗的灯光，七点之后还有琴师演奏钢琴，菜品味道都很不错，一分价钱一分货，人不多，服务不错。最难忘的就是黑鱼子酱小鹅肝炖蛋，回味有一股浓香~~','500','2011-07-24 09:49:00',NULL),
	('126038b64e42ad5492625cefdadc8901','1ce5842a6e37b25b51c1d9458093620c','大脑袋晃晃','5',5,5,4,'一个大厨负责一个菜，我印象蛮深的是南极冰鱼，很有韧性，超好吃。鹅肝也煎的非常好吃，就是吃了鹅肝有点饱腹感，牛排也很不错，有点甜的~炒饭炒的有点过，像爆炒米了，哈哈~','450','2010-02-07 12:09:00',NULL),
	('14434780fddfa44532a52b7cc07d7f11','1ce5842a6e37b25b51c1d9458093620c','キーちゃん','0',3,3,3,'上周六去了。一开始找到前面一幢去了。发现那幢的电梯居然是在外面按楼层的。我们进入就蒙了。好可怜。找到5层发现牌子。问了。才知道。要从后面那幢的观光电梯才能去。大概快2点了才去的。没怎么等。厨师是个台湾人。中午的套餐有99的，168的。后来各点了一份。发现分量正好。最爱是一开始的鱼籽酱蒸蛋。','200','2008-09-23 11:59:00',NULL),
	('158b22c8075ae98c764c5e3bef8b060b','1ce5842a6e37b25b51c1d9458093620c','SZ_Ruth','0',3,4,5,'全家一起去的,因为看了网上的推荐去的.星期日的中午还有98元的套餐,很划算,算是经济实惠了.菜的种类很多,服务也相当好,用餐整体的感觉和气氛都很好,但是,却没有想象中那么好,心里一直怀疑,是因为点的是98元的套餐,所以菜色不是很精致?最后,觉得抄饭也不是很好吃,总之,不是传说中的这么好?怎会这样?','98','2009-06-08 17:51:00',NULL),
	('1610eb0e5913e4ba8d77b8c84d361a41','1ce5842a6e37b25b51c1d9458093620c','撒日木','0',4,5,5,'非常好的法式烧烤。去过2次了，给我们料理的厨师貌似台湾人，服务好极了，味道好极了，当然价钱也好极了。鹅肝与黑猫牛排一定要尝试一下。','1200','2008-09-07 22:52:00',NULL),
	('16449e3f9c07b7ed62cf3d27fa877787','1ce5842a6e37b25b51c1d9458093620c','全免鹿','4',3,3,3,'在苏州绝对算人均很高的一家餐厅了，人均大约200+把，不过一份价钱一分货，他们家的牛排的确好吃，汁水很多的，现在还有优惠券配合使用，更合算了','0','2011-07-26 19:14:00',NULL),
	('1be6e80d04365850df8887840e582497','1ce5842a6e37b25b51c1d9458093620c','小猪熙熙','0',4,4,4,'口味还行，西餐也就是那么回事。只是主食是用铁板烧制的而已。环境挺不错，就是人数较少时可能会比较尴尬，前面一厨师，后面一服务员。。。鹅肝炖蛋去了2次都没吃到。餐后水果和咖啡可以选择在咖啡厅享用，貌似放着钢琴还有现场演奏。中午套餐98完全属于推广价，晚上298的套餐说实话和中午也就多一道主食而已。他家的充值卡是我看到的最贵的，好像是3万起充？','98','2008-11-12 12:17:00',NULL),
	('1d1777128962162cdb621bc4f0f046dd','1ce5842a6e37b25b51c1d9458093620c','milighost','5',5,4,4,'去这家店是一次偶然的机会，因为在附近找不到饭店，发现这里还有一家，所以就上去了。 服务员非常客气，每批客人一个包间，围坐在桌前，师傅就在你面前烹饪。口味非常好，吃到了我吃过的最好的鱼子酱。鹅肝也非常鲜嫩。价格是不便宜，不过一分价钱一分货。','300','2011-12-08 09:07:00',NULL),
	('1d1bd7b628b031172a0513a5409a44f9','1ce5842a6e37b25b51c1d9458093620c','吃不特兜着走','0',4,4,5,'名气很大的一家法式烧烤店，第一次去却找了好一会。牌子虽然很大，但附近好多家商家，银行、健身房等等等等，而他家却在二楼，还是从一个很小的门进去，好在门口有个接待台，但还是怪怪的，总有一种受骗的感觉。一出电楼，先是脚踏在很厚实的地毯上，眼前的环境也精致了很多，这才觉得似乎确实没有走错地方。人不多，走廊里很安静。不过他家都是包厢，也许隔音好，人在包厢也看不出来。装修没有王品奢华，简洁大方。食物几乎都是现场烹制的，餐桌紧挨着操作台，一位厨师，他会从主餐到配菜一道道有条不序的现场做大家，有什么要求也可以讲给他听。排风设施很好，一点都不会被油烟呛到。餐后甜点是要移架到另一间专门的咖啡厅，这里比刚才吃饭的地方舒服许多，有沙发，有音乐，还摆了一架钢琴，不过它只在晚上才会演奏。菜品的味道从前餐、主菜、配菜到甜点、饮料都很不错，但我更喜欢吃他家的布丁，很香绵，外面很少吃到这种感觉的。汤不错，牛排很嫩也很好吃。鹅肝、鱼籽酱蒸蛋就没什么感觉了，因为没在其它地方吃过，没有比较。总体来说还是很不错滴。还有一点，他家中午的商务套餐是99元一位，晚上去可是没有这种优惠套餐的，看过菜单，好象最便宜的也要三...五百，没准备好银子大家可要悠着点哟。我们去的时候还有办VIP卡，是当时办理，下次消费时取，持卡可享受9折优惠。不知现在还办不办了。全文','99','2008-08-03 02:31:00',NULL),
	('0117e07eeb6505086e9ccacb28ced53d','1cebed76f8841b128bf644f644f9f283','洛可可冰','4',4,4,4,'【团购点评】今天是一家三人行啦，五点二十分左右到的，不用排队诶，领位的姑娘会问有没有吸烟的，然后带到相应的区域~直接报上是团购的，然后加了面包诱惑（28元），京葱牛肉粒（39元）和一杯生啤（12元）三个人真心饱了~椒麻鸡其实量蛮足的，在盘子里挖挖又出来几块一刚，而且嘴唇真的麻了诶；包菜也不错，略优油一点点；牛肉粒比较嫩的，口感程度刚好；口水虾要赞一下的，虾肉弹牙的~土汉堡没惊喜，面包诱惑就用来填肚子，味道也还不错。总体而言，团购的性价比还是可以的，原价偏贵一点了。环境是比较惬意的，复古气氛没那么突出，靠搪瓷杯子挽回了一点，呵呵^o^PS店里可以上无线的，密码问侍应生要就可以了~','50','2012-02-15 23:39:00',NULL),
	('0159523ad41446162d6e891a7afeae64','1cebed76f8841b128bf644f644f9f283','lulu5425','5',4,5,3,'【点评团消费】晚上5点半到，前面已经有30个人在等位了，1小时后终于轮到我们。店里有WIFI，可以问服务生要密码，时间不会太难熬整个环境很小资，布置花了心思，搪瓷杯，陶土罐，小池塘金鱼团购的五个菜味道都不错，就是越吃越咸，喝了好多大麦茶上菜速度很快，量也足，两个人吃不完口水虾，已经去壳了，虾肉有弹性土汉堡，刀切配炼乳，绝配啊，一口气吃了4个这次是团购到现在，体验最好的一次。','30','2012-02-05 21:51:00',NULL),
	('032c7621c146e22305dbd2bc066d4c1c','1cebed76f8841b128bf644f644f9f283','Bellinsky87','4',3,3,3,'【点评团消费】- 口水虾（1份，价值58元）：还行- 椒麻鸡（1份，价值58元）：好麻，味道都吃不出来了。- 妈妈蛋蒸肉（1份，价值17元）：很有妈妈的蒸蛋味道哦。- 手撕包心菜（1份，价值14元）：这个味道还挺到位。- 70土汉堡（1份，价值18元）：中间夹着臭豆腐，一般。- 米饭（2份，价值4元）- 大麦茶（2位，赠送）团购网址：http://t.dianping.com/deal/10961','0','2012-02-06 09:09:00',NULL),
	('033da1e5b16f6bba67513322094185af','1cebed76f8841b128bf644f644f9f283','可可兔轩','4',4,5,4,'【团购点评】基于最近的热门餐厅，挑了一个周末的中午，和老爸2人过来尝尝鲜儿~~中午11点开门我们就到了，应该是来的早吧，一来就有位置了~很可惜的错过的团购，上次团购的时候还纠结了半天要不要团。。哎。。不过也还好，单点也不贵~比较划算的价格最近非常流行复古风，这家餐厅算是开得很是时候~新装修的店，看上去很不错，装修的风格也很独特，一进门就可以看见2层的餐厅，还有一面“书架”墙~很多复古的装饰很有意境。菜色的话，光看菜单是完全看不到菜色的，因为只有文字，米有图片，不过菜的味道都还不错，感觉算是家常菜吧，还有一切复古式进过改良的菜式~如果没有来吃过的朋友可以过来尝试一下！茶水和米饭是自助式的，一开始以为都是免费的。。结果结账的时候发现，米饭2元一碗。。好吧。。店内有无线~整个就餐过程还是很满意的！','51','2012-02-06 11:20:00',NULL),
	('03bf36c862c54336b54a77ea76a6da31','1cebed76f8841b128bf644f644f9f283','夕照北影','5',5,4,2,'【点评团消费】非常有特色的一家店，在电视上看了介绍，全是小时候的摆设。团购的菜也很不错，虾肉剥好的很嫩，鸡肉都是很好的部位，有好几个腿吧，不辣的。土汉堡蘸着炼乳非常好吃，香香的，其他的菜也不错，妈妈蛋甜味的，肉不肥，是一家性价比非常高的团购，两个人吃很满足。唯一有点不足的感觉灯光稍暗看不见。','30','2012-01-22 12:13:00',NULL),
	('04d05be4a29b0dc5b4ee78f9e0a067cb','1cebed76f8841b128bf644f644f9f283','Jennyjing1012','3',2,3,2,'这家店离公司不远， 所以同事聚会就选了这边。晚上6点左右到的，已经有很多人在等位了，拿到号，我们整整等了1个小时。乍看之下就推荐菜和招牌菜都有点小贵，其他东西价格还行。我们一行5人点了椒麻鸡、海鲜泡饭、王老汉臭豆腐、70后土豆泥、上酱肥牛，还有两个冷菜凉拌木耳和凉拌金针菇。吃下来感觉2个凉菜都蛮好吃的，椒麻鸡确实很麻，不过不辣；土豆泥味道有点清淡；臭豆腐我不吃的，不予评价。最让我们失望的就是海鲜泡饭和肥牛了，海鲜泡饭鲜倒满鲜的，可是量好少，最关健的是里面根本没有海鲜的，除了一点碎青菜，其实就是很普通的咸泡饭嘛，坑爹！上酱肥牛还要过分，中间一大坨居然是土豆泥，旁边一圈肥牛，我们5个人基本一人一片肥牛就没了，汗死，谁会想到上酱肥牛会和土豆泥一起，早知道的话，我们还点70后土豆泥干嘛，真是不爽！','0','2012-01-20 10:52:00',NULL),
	('053d0c9700d0b686a2a54515407f22e2','1cebed76f8841b128bf644f644f9f283','大懒堂','3',2,2,3,'搞不懂生意为何那么好来。。吃到9点半楼下还有人等位。。。好多款菜都很油很油，除了小排香干煲还稍微好点。。。最不爽的是吃完后身上一股油味。。。。我最恨这点。。。服务很不错，要不是朋友极力推荐我自己肯定不会来啦','100','2012-02-15 10:18:00',NULL),
	('06cdd7971de65604baf404f353e5d300','1cebed76f8841b128bf644f644f9f283','落雁碧月','4',3,2,3,'本帮菜是特色，部门的年夜饭在这里吃的，感觉挺让人怀旧的环境，服务也蛮到位的！烤玉米，口水虾，面包诱惑都是不错的菜，吃得挺开心的!','100','2012-01-26 22:40:00',NULL),
	('08f81198388e3720103d7d770af5091c','1cebed76f8841b128bf644f644f9f283','yea717','3',3,3,2,'【点评团消费】今天和2个姐妹去吃了~团购的又外点了2个菜~！中午人都很多了~有几个菜味道还是满好的~分量不算多。但吃饱了~环境真的很有感觉。满好~','0','2012-02-01 18:46:00',NULL),
	('094a94f1bcdae9c568057cacb3b1517e','1cebed76f8841b128bf644f644f9f283','yamaruan','4',4,4,2,'宝宝今天去拍周岁照，就在亚新附近，所以选择了亚新旁边的70后饭吧，一是想让爸妈回味一下过去的时光，二是老公就是70后。我们去的时候已经1点半了，吃饭的人不多，但是服务生感觉还是忙不过来，不知道是不是因为春节导致人手不够。我们进去的时候，门口都没有人领位，我们笑称这里是70后食堂，要自己找位子坐的。因为宝宝睡着了，所以我们选择的是沙发的位子，但是桌子还没有收。服务员硬要我们坐到椅子的座位，这里没时间收。很少有饭店的服务员那么指挥客人的~环境还是不错的，其实具有年代特色的东西不是那么多，但是每样东西都是哪个年代的样貌，让爸妈很是怀念呢。菜单也比较有特色，像是外面吃火锅的菜单，一张纸，喜欢什么自己用笔勾一下，很方便。每人拿到的不是圆碗，是个黑黑的长方形的盘子，特色是特色了，但要喝汤什么的就不方便了。点评一下我们点的菜：外婆煎年糕：16元 就是圆形的年糕，蘸料甜甜的，还算比较有味道。石锅海鲜泡饭：28元 很好吃，虽然没有看到海鲜的影子，但是真的很鲜，连我不爱吃泡饭的人都吃了好几碗呢。上酱肥牛：38元 一小碗倒扣的土豆泥，周围放了几片肥牛，不知道是什么酱，个人觉得这个菜不值。口水虾：58元 虾很嫩，...味道也不错，不是很辣，比较油。黄豆芽比虾多很多。手撕包心菜：14元 酸酸甜甜的，味道蛮好，就是炉火烧了没多久就灭了。滚豆腐：15元 味道很不错，非常鲜美。貌似是汤羹，有豆腐、香菇、鸡胗什么的，盛放的汤盅也很特别。我吃了好几碗呢。铁板鸡肉茄子： 28元 爸爸最喜欢吃这道菜，的确味道不错，就是鸡肉稍稍咸了点，量也不是很多。嘉士伯（扎）：35元 爸爸和老公都觉得味道不错。古越龙山（5年陈）：30元 老爸喝的。米饭（碗）：2元不知道是不是我们去得晚了，一点好菜就叫我们买单了，我们还点了碗米饭，结账的时候把钱一起付了。但是到我们真的要吃饭的时候，叫了好几次来碗米饭，都没有人理我们的，就是让我们等会，一转身就给忘了。环境、味道都还不错，这个服务真的不咋地~~全文','66','2012-01-30 23:35:00',NULL),
	('10525f019b234397fb1970b962f2f1ce','1cebed76f8841b128bf644f644f9f283','呼呼_','4',3,3,3,'【点评团消费】这家有点模仿外婆家的赶脚，虽然开的时间不久，但生意已经异常火爆了虽然是团购的，但不用预约，过去排队就可以了，我们因为六点不到到的，所以大概等了半小时左右等位的时候有茶水，零食，还有电脑可以玩里面的服务员大多是上海人，应该是年轻人自主创业吧70土汉堡：就是刀切馒头里面夹着臭豆腐，毕竟人家是绍兴开过来的，所以臭豆腐那是特色啊，杠杠的妈妈蛋蒸肉：小时候吃的肉饼子炖蛋有木有，就是这个感觉有木有！口水虾：不是连壳的虾哦是虾仁，其实吧我还是喜欢带壳的，嘿嘿有点小辣椒麻鸡：不得不感叹一下店家的实诚，应该有半只鸡吧，好好吃因为很麻的，所以LG不要吃我一个人夯子夯子吃了很多，还打包了一盒呢手撕包心菜：交给LG解决了，不知什么时候开始，他爱上了这个菜，当然我也喜欢吃的这里的大麦茶和米饭都是自给自足，不要浪费就可以了对这家店印象颇好，很满意的团购耶','0','2012-02-01 19:02:00',NULL),
	('1340a915d26925a878263aee5c39e93e','1cebed76f8841b128bf644f644f9f283','朴小猴','4',3,4,3,'特地去噶闹忙的~！运气好等到了沙发座的靠窗位子~so哈皮和老同学吃吃喝喝胡天海地讲讲话很开心的点了几个都是特色菜椒麻鸡很符合想吃点辣但又不想狠辣的人~王老汉臭豆腐真的很想很好吃。一盘我干掉很多~碳烤肉味道就是烟熏肉的香味其他菜没有记住~~下次想再去一次。选择大家点评认可较高的菜色','0','2012-01-22 15:03:00',NULL),
	('1375e7d03d651c1fa6401ad12397b0e6','1cebed76f8841b128bf644f644f9f283','我的尧尧','3',2,3,3,'【点评团消费】周五晚上去的，等了一个小时，人好多哦！环境是不错地，其他的感觉像是外婆家。整体感觉一个字：咸！- 口水虾（1份，价值58元）：里面是水晶虾仁，我和老公都不爱吃。- 椒麻鸡（1份，价值58元）：麻得得挺厉害，第一口吃觉得不错，后面就觉得好咸，喝茶也止不住。- 妈妈蛋蒸肉（1份，价值17元）：这个配饭吃很好吃，不错！- 手撕包心菜（1份，价值14元）：甜甜的，到底下有点酸，还不错。- 70土汉堡（1份，价值18元）：面包挺脆，加上臭豆腐算是有点特色，但是口味而言有点奇怪，我觉得配辣酱会比较好吃！- 米饭（2份，价值4元）- 大麦茶（2位，赠送）：杯子比较有特色。看点评说烤玉米不错，点了一份，感觉调料放了很多，稍微有点咸啦！总体而言，希望厨师下手不要这么重，要不吃的咸了满嘴都没有味道了！','29','2012-01-16 09:42:00',NULL),
	('137ef8ebf1b8b8ac309a560d29c98b92','1cebed76f8841b128bf644f644f9f283','阿俊青','1',2,2,1,'【点评团消费】团购的，2个人吃的周五晚上5点半的拿了号，小桌29号，等了2个半小时才坐下，没想法了...菜真没啥特别的，椒麻鸡量蛮多的，但是不怎么好吃，单菜端上来的卖相一般口水虾还能吃吃手撕包菜酸酸的，还行炖蛋就跟家里的差不多，没什么好吃的，就是咸...土汉堡不怎么好吃，面包里面放了臭豆腐，不好吃。。。服务态度也不怎么样，我们已经坐在位置上了，还让我换位置，我们不换，他们也会想办法的，说下单的时候下到另一桌了，说让我们换。真对他们无语了。。。走的时候大概9点15分了。不是团购真不会去。','0','2012-02-04 15:03:00',NULL),
	('13d819c46062da98334ff3a478464825','1cebed76f8841b128bf644f644f9f283','cynthia_lovingf','5',5,5,4,'等位等了很久，但是有茶水可以喝，餐厅环境不错。东西不错耶，特别喜欢妈妈肉糜炖蛋，装盆的青花碗也很舒服很喜欢酱汁肥牛没吃到，点了水煮肥牛，东西不错。三个人吃正好烤茶树菇味道很特别，第一次吃，还不错。海鲜泡饭我个人不太喜欢，特色是里面有饭糍做的泡饭，喜欢的旁友可以试试另外就是服务员很好啊！！！我掉在那个的白色石头店员帮我好心收好！非常感谢','70','2012-02-10 12:01:00',NULL),
	('150f20b19907a922b81e5b05c551b7fe','1cebed76f8841b128bf644f644f9f283','幸福的杯子','4',3,4,2,'【点评团消费】大众团购去的，大众的团购一直都挺靠谱的。环境很好，装修得很有感觉，安静的时候很像小酒吧。口水虾，味道不错，豆芽入味，虾是去壳的虾仁，不过质量不是很好，明显发过的。椒麻鸡量很足，很鲜很嫩，麻得很爽，很下饭，吃好了嘴唇还有麻麻的感觉。妈妈蛋蒸肉，确实有小时侯的味道，加了酱油，不是很厚实的那种，不错。手撕包菜，酸酸辣辣的，第一个上的菜，加热过后味道很好。土汉堡，就是炸刀切馒头加臭豆腐，臭豆腐臭味有余，吃着香味不足，馒头炸得正合适，加了炼乳，非常好吃，不过要乘热，冷了就不好吃了。橙子果冻另点的，某个小朋友对橙子有执念，点了以后发现很像小时候橘子棒冰的味道，更像以前家里果冻粉做的。西瓜汁不是那种死甜死甜的，但是一吃就非常新鲜。（他们家有些饮料的杯子满有特色的，让服务员推荐个可爱的杯子，不过拿上来的就是外面最普通装金橘柠檬茶的，有点小失望）总结一下就是他们家的菜都很下饭，饭自己打，不知不觉就吃了很多。门口停的车，首小时15块之后每半小时10块，但是大叔会问你大概多久，一般20左右就不会再收，时间太久就不清楚了。刚去的时候叫个服务员要很久，有点混乱，拿上来的餐具也没有洗干净，用纸巾一擦还一层油，...这个批评一下！全文','51','2012-01-16 01:03:00',NULL),
	('151a7fa602d18322e0f8c8b7267f50de','1cebed76f8841b128bf644f644f9f283','西班牙天使','4',4,4,3,'好朋友生日去的，最爱三楼的风景可惜那天无缘坐到，希望下次能坐到。点了王老汉臭豆腐、泡饭、面包诱惑、口水虾、馋嘴牛蛙和70后土豆泥还是80后？菜单上还有个90后土豆泥老搞笑的。面包诱惑：最爱上面脆脆的那层面包香香甜甜带着奶味，不过面包总统烤得不如港丽，冰淇淋球很复古，是小时候吃的那种哈密瓜味得，好怀念啊~~臭豆腐：很酥很香但是依然不能撼动我鲁迅故居门外那个臭豆腐得地位~~土豆泥：看上去像是橙汁得，但是一口上去，诶，Kfc的感觉，有鸡汁的Feel不错不错哦~~~土豆泥也磨得很细腻~~最爱口水虾~~对于俺们这种懒人这种拨了一半虾超方便，虽然有点油，但是虾肉弹性十足，味道也好~牛蛙：味道和口水虾有点像，但是这个更香，只是蛙肉还不够嫩~~泡饭：这个老神奇得，味道有种家里的感觉，很鲜很暖，比家里得味重一点，喜欢。餐厅整个环境很好，和闺蜜聊天很开心~~~生日小聚神马得最赞了~~','80','2012-02-13 09:56:00',NULL),
	('15bebafcc110f061030dc017cf0e8e78','1cebed76f8841b128bf644f644f9f283','放假最开心','3',3,2,3,'一开始听到这个餐厅名字我楞了一下，70后饭吧，我在想是不是这个老板70后呢？还是专门少70后朋友那个年代吃的菜呢？估计现在社会撑场面的基本都是70-80年代的人，所以据说这个饭店生意很好的。个么人都有好奇心的啊，当然么我也要打探打探的啊。不过没想到餐厅的菜也是与时俱进的闹，现在外面很流行的手撕包菜这里也有的，口味还是不很错的。大肠我很喜欢吃的，不过跟青椒一起烧倒是第一次吃。我这个人还很喜欢吃臭豆腐。他们家的王老汉臭豆腐还真不错。服务员跟我们对剑的碳烤肉，感觉还可以，说不上特别好吃，不过我感觉碳烤的基本都是这个味道吧。我们点心就点了海鲜饱饭，满好吃的，很香的，我喜欢这个味道。总体感觉下来还可以，我们点的菜不多，价格也不贵，不过你说吃完了下次特别想吃的话，也没什么想法，总体感觉这家菜味道还可以，就是菜品不是特别有特色，','0','2012-02-07 16:23:00',NULL),
	('16014ce8341f0819d7dc1094c0cb7ede','1cebed76f8841b128bf644f644f9f283','悠闲生活yoyo','4',3,3,3,'领导请客户，我沾光，哈哈哈，阿拉领导还蛮和时代接轨的，晓得70后现在蛮火额。本来商务宴请都不会去这种店额，现在也创新了么，咔咔。3个人点菜不是很好点额，领导先点了韭菜鸡蛋干跟上酱肥牛，还有个青椒大肠。。。这个我不吃额。我么点了推荐菜的碳烤肉，火焰虾，手撕包菜，王老汉臭豆腐。领导随便我点额，我就点自己想吃额，反正不是吃他的，大家懂额啊。。。鸡蛋干一般般啦，手撕包菜蛮好吃额，不过一上来烧的时候很明显是炒好一段时间了，上面都冷额，还好干锅烧烧再拌一下就很好吃了，这个才十几块钱哦，比外面很多店便宜了，也有不少肉。这个我吃掉最多了，两个男人就在那边探讨形势，个么我就闷头大吃呀O(∩_∩)O上酱肥牛倒是蛮特别额，当中一大坨土豆泥，很细腻额，好像有奶油还是奶粉成分，奶香味十足。那个酱料不知道怎么调的，蛮好吃的，加上肥牛肉，很饱足感啊，不过酱汁不够多的，今天人少，人多的话大家一起刮，不够沾的。臭豆腐没啥特别的，这个大小有点像绍兴出产的一种盒装臭豆腐，我在马路边的臭豆腐摊吃到过，味道八九不离十啊，而且没有甜面酱，呜呜。火焰虾就是个噱头嘛，拿酒精倒在锡纸下面烧，根本看不大出的好伐，就一层浅浅的火，我想看大火...窜一下额，么看到。。。而且里面不是很热，虾肉倒是蛮新鲜额。碳烤肉一般性啦一般性，不喜欢这个干巴巴的味道，配的韩国泡菜倒是不错，甜甜辣辣的。这家店的菜单有点像绿茶啊，啥冰镇桃浆和面包诱惑都有。。。有的菜很便宜的，朋友出去小聚一下很合算。全文','80','2012-02-07 13:24:00',NULL),
	('1857a9c9631a463ad97232b0802d665e','1cebed76f8841b128bf644f644f9f283','sherryxlf','3',2,3,2,'【点评团消费】大众点评的团购去的…这地方的团购不接受定位，只能自己下了班默默的去排队了…周五晚上6点半到的…小桌前面还有15桌…等吧…等位的人很多，可是等位的地方很小…等了一个小时终于能吃饭了…小店有三层，不过每层都不大…位子倒是挺宽敞的是我喜欢的…椒麻鸡，我是那种能吃辣但不能吃麻的人…这鸡真心麻是，吃的我嘴唇都发酸发麻了…挺下饭的…这个菜的量貌似没点评上说的多吗，两个吃正好…味道倒是挺香的，鸡肉又嫩又入味，要是没这么麻我想我会很爱的…口水虾，真心一般，不是我和BF好的那口…肉糜炖蛋，有妈妈的味道，喜欢，最喜欢用炖蛋拌饭了…下了两碗饭哦…对于我和BF这种饭桶来说，这样吃的真心爽…70后汉堡，烤过的刀切馒头加上臭豆腐沾炼乳，说不出的感觉，还是比较喜欢刀切馒头直接沾炼乳…臭豆腐就这样华丽丽的被我丢了…手撕包菜，因为是最后上的，我们都吃饱了，没怎么吃，貌似放了点醋…无功无过吧…饭和大麦茶都是自己倒的…希望下次这里的菜单能配上图片…小店的风格还是我比较喜欢的，适合朋友小聚…','30','2012-01-27 21:26:00',NULL),
	('00cc20d255fbe285fb25d2c4e6103295','223a557f261d418b73ff7ae3fd2a2b65','tyx121','3',3,3,3,'吃过太多次了，虽然现在已经涨到50一个人了，不过如果是去填肚子，或者要求不高吃点比萨啊小菜什么的，还是觉得挺划算的，何况还有什么男女是优惠日之类的','50','2011-05-15 22:57:00',NULL),
	('0134fde46d47db51432d24d2815bc746','223a557f261d418b73ff7ae3fd2a2b65','饭米穗','4',4,3,3,'室友请客的，因为是周六吧，生意蛮不错的，很多人围在烤翅那里抢，披萨吃了实在太饱没有吃很多，倒是沙拉蛮好吃的，蛋糕点心什么的比较少，更新速度也挺快，酸奶竟然是优酸乳~冰激凌吃吃还可以的~就是坐的位子很里面热死我们了！服务员换盘子的速度不是很给力，情侣家人聚餐吃吃都不错','49','2011-04-16 22:02:00',NULL),
	('01f2b94e1fea1a48ef878e4be87b78ad','223a557f261d418b73ff7ae3fd2a2b65','我也不想注册','4',4,3,3,'个人觉得比金汉斯的好吃 哈哈 价格也都差不多 而且味道还好 总觉得不错 他家得披萨真的不错 而且里面的环境也挺不错的','0','2011-07-27 09:11:00',NULL),
	('03f350a32862c472af785fdcde1cee0c','223a557f261d418b73ff7ae3fd2a2b65','钧麟多乐','4',2,2,2,'不晓得是不是因为是优惠日去的缘故，菜品好少哟，还没得金汉斯花样多得多。鳕鱼，估计是没选好？那个肉总共没吃到手心大，全是些面面，凉菜，热菜，都少。','49','2011-02-05 18:28:00',NULL),
	('0fa846f18921847dedf471fe5d0d3546','223a557f261d418b73ff7ae3fd2a2b65','大骨干','4',3,4,3,'我很喜欢吃披萨，但是老婆不是很喜欢，去必胜客和这里的味道都差不多，老婆喜欢吃冰激凌蛋挞，我就喜欢吃肉，羊肉串特好，价格不贵，比较划算','0','2012-01-27 22:22:00',NULL),
	('1015fcaef4e870885022a5d684647fa1','223a557f261d418b73ff7ae3fd2a2b65','錵︶鎕紙','3',3,3,3,'吃的是自助餐、供应还是比较快的、但是也要抢的快准狠啊同学佩服死我了、每次都能拿一堆鸡翅或披萨回来价格小贵、总的来说还行','50','2012-02-11 18:08:00',NULL),
	('116845ccbe65f499793832f79964d2ce','223a557f261d418b73ff7ae3fd2a2b65','zz0402','5',4,4,2,'【试吃/体验点评】比格我是相当的喜欢，吃了一次想二次。蛋挞是最爱了然后就是他家的奶油蘑菇汤。虽然还是吃不回来，每次去吃全家都很开心。','49','2011-07-25 10:08:00',NULL),
	('160f6982a2b902d32d46ea77a67d36d5','223a557f261d418b73ff7ae3fd2a2b65','爱上吃果冻的夏天','4',2,3,3,'可能是因为比格是沙坪坝第一家自助披萨店，一遇到需要大口喝酒的聚会时，我们比较喜欢去比格男生痛快喝酒，女生随意吃水果，美美容，都很好O(∩_∩)O哈哈~','49','2011-09-06 09:36:00',NULL),
	('185dca21b442090f28cb5f816195cd20','223a557f261d418b73ff7ae3fd2a2b65','logolx3','4',4,4,3,'在三峡广场，比格披萨还是算不错的自助了……就是人有点多，要早点去哦……想吃披萨的朋友可以考虑下，比较比必胜客便宜太多了','0','2011-09-08 11:01:00',NULL),
	('1a0baef12cdf5bce1f021d85e2a3c800','223a557f261d418b73ff7ae3fd2a2b65','SheepStar','3',2,3,3,'还素那不错的披萨自助了，环境还不错，里面的肉串和鸡翅最热卖，看到了一定要多拿一些（如果你喜欢的话），因为下次去拿的话，基本就没有了。披萨还可以吧。会员卡有优惠，办卡要钱，如果觉得会经常去的话，还是办一张会员卡吧，吃几次会免费得送一次的优惠的。','49','2011-07-19 11:31:00',NULL),
	('1a3fae6975a78ffba78e5dda14e1b83c','223a557f261d418b73ff7ae3fd2a2b65','小廖12','4',3,3,2,'去过好几次，环境算不错了。基本上每次去都会吃好多鸡翅膀（特别喜欢他们家鸡翅膀，而且随便吃最安逸了），其它就没什么感觉了，都差不多嘛，美味也说不上，反正不难吃。','50','2011-07-18 17:43:00',NULL),
	('1be1233497a3c699ea66fd315df17e5c','223a557f261d418b73ff7ae3fd2a2b65','luolidias','3',1,2,1,'吃过一次 就没有想去第二次的欲望了 东西看着挺多 好吃的没几样。只有不停的啃鸡翅膀，有些菜抢得厉害 都没迟到过，味道不是很好，pizza吃了就亏死了！','60','2011-07-20 09:14:00',NULL),
	('02ae05e97fd14cd96a9b6a59fabe3ee3','23880c40bcb8e7ed1276f01dd140408f','leleyaa','5',5,5,5,'很喜欢吃日本料理，很喜欢的口味，海鲜非常新鲜。特别喜欢吃那里的梅子酒，特别的好喝。每次都要好多。个人觉得价钱不算贵了。','168','2011-06-05 11:58:00',NULL),
	('04e2d73c0270fb529d9952fcef7d8c42','23880c40bcb8e7ed1276f01dd140408f','cecimelie','3',3,2,2,'涨价之前去的 有一段时间了 但至今仍记得北极贝的美味去的时候一楼的位子都定出去了 于是到了二楼 虽然看不到师傅操作过程 但也落得吃得专心很喜欢沙律虾 还有鳗鱼真不该点牛肉 别的吃多了 这个到最后都有点吃不下了另外有一款鹅肝的东西 忘记叫什么 很软 不错不知道是不是晚餐时间人太多 服务员有点忙不过来的样子','150','2011-04-14 21:12:00',NULL),
	('0d6e9581dd5bb9e9e2b0023df5f6a61a','23880c40bcb8e7ed1276f01dd140408f','lycwaz','5',5,3,4,'好久没来这里了。以前是150元一人的，现在168元了。不过现在菜的种类随便吃，没有限制了！这点比较好！还是最喜欢他的蜗牛，口感很棒啊！跟厨师聊天，发现是同龄人，真是巧合。遂问了下哪个菜品的成本最高，他说是那些刺身，都是新鲜的，成本是最高的，嘿嘿嘿，大家懂了吧！','168','2011-05-28 08:46:00',NULL),
	('1024712b27f74beb22d7d81065b8d8dc','23880c40bcb8e7ed1276f01dd140408f','lain74','5',5,4,5,'周三半价去的，9:30就去排队了，终于吃上了半价的大渔，菜品很新鲜、分量也十足，关键是烧烤师傅很亲切，给我们推荐菜，还和我们聊天，整体很享受，我觉得我们绝对吃回本了，太超值了','84','2011-12-06 09:26:00',NULL),
	('14797909b32e61d02538bfe54f4c4ba7','23880c40bcb8e7ed1276f01dd140408f','易水寒03144130','4',4,3,2,'以前150一位的大渔现在也涨价了 不过所幸添了几道新菜 让人觉得价涨的有道理 超爱他家的刺身 每次都是吃很多 比较新鲜 味道也不错 鳗鱼也超好吃 甜甜的又不腻 牛肉卷是必点 各种虾也是 其实这种铁板烧 每次吃点的都是差不多的 毕竟一个人的口味不会在短时间内发生很大的变化 就是服务不太好 第一轮总是上的最好最快的 然后第二轮 就会有些菜点了没有上 第三轮。。。第四轮。。。最后索性不上了 让你自己觉得没意思 又觉得饱了 也就交钱走人了 出去一溜达发现 其实没吃饱。。。','168','2011-05-31 21:23:00',NULL),
	('15714620a3f27a8d50cee65c747cf679','23880c40bcb8e7ed1276f01dd140408f','senmiao','2',2,2,2,'年头久了，餐厅显得非常陈旧，卫生状况也不好。点的东西总会漏掉，值得圈点的菜品也越来越少，比刚开业那会儿差很远。为我们服务的那位铁板师傅技术还不错，也很有礼貌。酒水质量严重下降。总的来说，不值得推荐了。','168','2011-06-29 22:31:00',NULL),
	('1976d6fa2949634188cab1932cb5ffed','23880c40bcb8e7ed1276f01dd140408f','糖块77','4',3,3,3,'自助多吃也不会担心再都花钱了，所以就尽量吃个够本，不到吃顶都不放手，真是扶墙而进，扶墙而出啊，到家才感觉到身上这个油烟味啊，服了','150','2011-09-08 13:07:00',NULL),
	('1b8f67340861851c345d49a644b65e72','23880c40bcb8e7ed1276f01dd140408f','唐宋美人','5',5,4,4,'新张的价格，但是东东比原来的150多了，喜欢鹅肝蒸蛋，可以一个人要了两个，果汁是鲜榨的，木瓜汁味道超好，女士喝它很多好处，美白，丰胸，还减减肥，老公喜欢他的青梅酒，','168','2011-04-12 15:29:00',NULL),
	('1bea87b6850e223ca6742b115bb543ef','23880c40bcb8e7ed1276f01dd140408f','爱上爵士乐','2',2,2,1,'【团购点评】服务员的态度很怠慢。。。虽然我们是团购去的吧。要么就是点了的东西没上，要么就是点了的东西没给做。。。不知道是不是因为太期待了，所以，这次去了很失望。三文鱼还是很新鲜的。梅子酒也比较好喝。其他的真的很一般。许多东西，还有其他的做法，但是 统统都是一种做法给我们做。。。太失望了。。。','150','2011-07-03 22:11:00',NULL),
	('1bf1aaf39b9721a43f927cb23167d986','23880c40bcb8e7ed1276f01dd140408f','570503065','3',3,3,2,'【试吃/体验点评】还算是有特色吧，属于高消费的地方，有人请客才去吃过一回，吃的不太习惯，感觉不太消化似的，而且服务员效率有点低，你需要多次催促~价格高！','150','2011-06-06 23:01:00',NULL),
	('05139a88bd41b4dfb7660e2827195ae2','24d373e4dd16235e50dc68095dbc775e','lxs0422_cns…',NULL,3,3,3,'价格比较实惠，烤鸡翅可以和肯德基媲美，其它的一般，蓝莓果醋挺好喝的，披萨料不多，沙拉还可以，适合朋友小聚，环境尚可','40','2009-09-24 22:52:00',NULL),
	('0dce91098d64ac75147cbca64f858148','24d373e4dd16235e50dc68095dbc775e','冰糖宝宝',NULL,4,3,3,'性价比很高的一家店主打西餐很便宜味道也是不错的环境一般吧服务不是很热情总体不错的说喜欢','20','2010-01-23 22:00:34',NULL),
	('0e8393294fe8456c32da98771ea49232','24d373e4dd16235e50dc68095dbc775e','洗洗睡吧q',NULL,3,3,3,'甜品比较好吃，推荐提拉米苏和绿茶布。海鲜意面也不错，面比较劲道，前天刚去又喝了必点的蓝莓果醋，口味大变，太酸太稀，需要注意下了。','35','2009-09-24 14:49:39',NULL),
	('0fb8ac6b23b8a5770f8199603041bd05','24d373e4dd16235e50dc68095dbc775e','小耽',NULL,4,3,3,'比较好吃又实惠的披萨店~！经常在附近找朋友玩，所以经常过去吃。尤其是新年的时候送了一年的优惠券就更喜欢去了。东西做的干净好吃。味道当然不能说最好，但绝对不会失望，每一种都比较不错。披萨吃过好几种，味道都不错。培根意大利面，还有其他意面也很好吃，但有点少。每次都要点蓝莓果醋，很好喝，也大杯。奶茶也做的挺好的。焗饭也不错，不会太腻，还有烤出的金黄色的皮，喜欢~！','40','2009-11-17 17:27:07',NULL),
	('158248a0898eb44fcd5babf4752ab85e','24d373e4dd16235e50dc68095dbc775e','百果香春春',NULL,4,5,4,'客户请客去的,以前在其他店吃过,感觉他家皮萨没石景山店烤的好吃,其他都差不多吧,人很多,去晚了还要等位,总体算是实惠的,本人有会员卡,可以积分推荐菜: 巴贝拉特色烤鸡翅 提拉米苏 肉酱焗饭 奶油蘑菇汤 咖啡冻布丁 巴氏至尊比萨餐厅氛围: 情侣约会 朋友聚餐 休闲小憩餐厅特色: 可以刷卡','50','2009-12-15 19:30:48',NULL),
	('15b388999cf0125029689538adb9f2e7','24d373e4dd16235e50dc68095dbc775e','redsnow',NULL,4,4,3,'太喜欢炬饭了，好多的芝士~其实芝士多的东西我基本上都喜欢哈。还有咖啡冻布丁，淡淡的咖啡味，口感很好。沙拉一般般，蟹斗局螃蟹也很好吃，还不贵。披萨还可以吧，饼不算硬。','45','2009-12-29 10:18:03',NULL),
	('1be1c8f6597c3b51b3707b4eb5b606a7','24d373e4dd16235e50dc68095dbc775e','lao_xians_d…',NULL,3,3,3,'头一次去的就是巴贝拉西直门店。好多人啊，价格看起来都好诱人。在一上位，一看，果然价格和价值真是对应。只能是中规中矩。','40','2010-04-20 20:26:03',NULL),
	('1d7f4c53f5eafd451c335bf0a2ad2143','24d373e4dd16235e50dc68095dbc775e','kirby13220',NULL,3,3,3,'整体的感觉还算可以，性价比也还行，不过相比刚进入北京时候就差的有点远了，那时候不仅价格便宜，味道也好，现在分店开多了，有些缩水。','50','2009-12-15 22:24:19',NULL),
	('03a2da4ddbd839876f23847e6f1cae1a','25d134bf4c651fc5fd0fd1ddf6c0713c','waterfly333','1',2,1,1,'服务员记不住客人点的菜，点了3遍还是点落了一个菜。先上主食，等主食凉了再端菜上来。这还不郁闷，更郁闷和令人费解的是，大中午一共2桌客人，服务员比客人多的情况下，店内竟然有小偷偷了同伴挂在椅子上的背包。通过监控录像看出，小偷在店内徘徊许久，最终在服务台正对面1.5米的位置，以店内柱子挡住我们的视野作案得手。而服务台一直保持2-3名服务员待岗的状态。饭店的态度就是只会配合公安看监控，经理杨磊坚持说饭店在失窃事件中没有任何责任，客人在他们的店内丢东西和他们没任何关系，即便在前台眼皮底下被偷也是客人自己的责任，饭店没有任何监管和保护客人财物的义务，也不会对客人的损失做任何赔偿。任何闲人都可以在他们的店内溜达半小时，在服务员和经理的保护下，对客人下手，这样的店实在令人发指。这是本人第一次在点评给人恶评，实在是气不过、看不惯，和各地的同事一起出差，作为东北人，在自己家的地盘上，我感受到了羞辱和难堪，甚至觉得发生的事情影响到了地域人民形象。奉劝大家，去这家店，先想好吧。我没有说他们勾结什么势力，也没有说他们没有责任心，更没有说他们在发生意外事故后推诿耍无赖，没有，都没有，只是奉劝大家，小心再小心！~同事...女孩子丢了现金银行卡身份证+回去的火车票，可怜又无奈！~而饭店经理所代表的商家的经营态度，更让人深深的感受到了心寒和战栗！~大家多加防范，避免悲剧重演！~全文','80','2012-02-10 22:46:00',NULL),
	('08c33a05dbfee7fb1c5f6c5059fe20eb','25d134bf4c651fc5fd0fd1ddf6c0713c','桃桃妞儿','4',5,4,1,'到店，进入贵宾厅（就是小包间而已，比较适合情侣，设计的像咖啡店的包房）。说实在的服务员啊，都有点楞呵呵的，要个啥都得嘱咐超过两遍，愁死我了！在这里还要谢谢该店的店长，因为我牙疼，特意给我找了一个新牙刷，以解我牙疼之苦啊！为了锅包肉，我拼了，刷好牙，不疼了，等着上菜！  一会儿，菜上齐了，锅包肉还是一如既往的好吃，裹得hu那个酥啊，汤汁那个正啊！报销了一盘子，一块都没剩，这是真的！！！（29元）水煮肉也还不错（32元，小涨），这家的水煮肉和酸菜鱼是沈城做得非常好的，虽然不是纯真的川菜馆，但我建议爱吃这两个菜的人可以试试，真的不错！还有四川小炒（18元），今天有点微辣加麻，原本味道不这么重的，今天可能是大厨高兴，做得太过川味了！  总之，在我忍受着牙的极度疼痛下，没有削减战斗力，主要是为了我的锅包肉，我真的觉得他家的这道菜太好吃了！为了不后悔来一次，决定打包一份锅包肉，嘿嘿嘿，给我老妈带回去吃，这也是她的最爱最爱啊！孝顺必为先！呵呵，见笑了！  收！  吃的很满意，看在他家菜的味道上，服务我忍了！','50','2011-03-08 07:38:00',NULL),
	('0b7dc4eb5783210f6cafbb553713518e','25d134bf4c651fc5fd0fd1ddf6c0713c','改变与坚持','3',3,1,2,'到现在我也没搞清楚到底是叫红樱桃还是叫满堂红。亲戚一大帮人元旦在这聚餐。20多个人要了个最大的包房，点了10多个菜。  感觉最好吃还是锅包肉，老式做法，糖醋汁的，肉嫩香脆。由于孩子多，这个点了2盘，都造了。印象比较深的还有一个什么麻辣虾，炸的酥酥脆脆的，也很入味。还有一个什么大排，一个大盘子里摆着一个象座桥似的大排，肉很嫩也很有味道。（由于不是我点菜，所以具体菜名真不知道）。    补充一点：菜味道都不错，就是房间普遍都很冷，不知道是客人少还是因为什么，我把空调开到26度，房间还是很冷。','0','2011-01-02 18:17:00',NULL),
	('0e32d88b5e849682fb409a9fe8681745','25d134bf4c651fc5fd0fd1ddf6c0713c','geminixyz','4',4,3,3,'吉林做法的锅包肉是最吸引我的地方，经典老式做法，大爱，其余的炒菜就没有太大的特色了，大花卷也算特色了~菜量还是蛮大的，价钱适中，算是经济实惠型的~一定要点锅包肉哦~','0','2011-06-23 15:23:00',NULL),
	('0e5a6497369f532c1a51d7cfd82a8dc8','25d134bf4c651fc5fd0fd1ddf6c0713c','抬起头亲迩','4',3,3,2,'就在家门口 逢年过节就去他家了 家人很喜欢他家的锅包肉 吉林的做法 有陈醋的味道 不错 其他的都是一些东北家常的菜 味道做的中规中矩 门面也比较大 还算是够档次的饭点','50','2011-07-07 00:51:00',NULL),
	('1015aba215c1eb3421a66a083ba44ffa','25d134bf4c651fc5fd0fd1ddf6c0713c','浮生若梦4978','4',3,3,3,'他家的装潢很好哦，我很喜欢，很有情调呢，这里很适合朋友聚会和约情侣会，呵呵，相亲在这里也挺适合哦，菜的味道也不错呢','0','2011-07-06 13:33:00',NULL),
