	('14811b3630d4ff250c6466d6d382d423','25d134bf4c651fc5fd0fd1ddf6c0713c','蘑菇小乖','4',4,4,4,'【试吃/体验点评】红樱桃青菜馆，现在叫满堂红，市政府招待所楼下，大堂环境一般，如果说是饭口，很吵杂，包房和隔断里面不错，东西味道不错~~去过多次，虽然吃的一些大众菜，不过味道还是不错的有情侣的隔断，挺有感觉的，楼上也有包房，提前预约不然很难有地方锅包肉是老式的，不是裹番茄酱的那种，吉林做法，很好吃，漂香土豆泥，上面一层肉酱，土豆泥也很细腻，奶香大花卷，非常软，很大切成四份，功夫鱼味道很棒，味道进入鱼肉内~~蒸猪血蒸的很嫩，口感不错，有排毒养颜之功效还有很多菜不能一一介绍，如果朋友聚会，家庭聚会，不想吃火锅，烤肉可以试试他家','50','2011-03-29 19:14:00',NULL),
	('14562dd831a7ad6b03a2562b757c3467','25d134bf4c651fc5fd0fd1ddf6c0713c','于朵朵','5',4,3,4,'很传统的沈阳菜馆。最地道的是锅包肉。必点。整体感觉就是价位合算。很大盘，很家常。很适合15人左右或以下的小聚会。包房里还比较安静。','35','2011-06-17 20:01:00',NULL),
	('15cd4c6a9400d44e4797697db1ac593e','25d134bf4c651fc5fd0fd1ddf6c0713c','zou1124','3',2,2,2,'曾经听说他家的锅包肉那是很有特色的，对于偶尔想吃锅包肉的我来说未尝不是种勾引~哇哈哈，于是我就去尝尝看了，确实很好吃，那天还点了一个炒鲜蘑之类的，还有个凉菜，还可以吧。','40','2011-09-09 15:01:00',NULL),
	('185418397ea2f1ab02513daef96be63f','25d134bf4c651fc5fd0fd1ddf6c0713c','泡沫蜗牛','5',4,5,3,'啥也别说了，最爱的一家，和北行的红樱桃是一家的。最爱他们家的吉林锅包肉，上次吃了土豆泥，太好吃了，还不贵。油麦菜是我吃炒菜必点的菜，他们做的很好吃，嘿嘿！经常和朋友去，大爱~~~就是上次上菜把我忘了，都吃完了，锅包肉才上，打包回家吃的。','45','2011-06-14 10:00:00',NULL),
	('1bf186fedc224e3bb803f029c0ecc7a5','25d134bf4c651fc5fd0fd1ddf6c0713c','389593370','5',4,3,2,'满堂红的锅包肉很好吃，每次去都点，他们家的熏酱拼盘也很好吃，尤其是他们家的几样主食我也很爱吃，他们家的菜的味道很好，很适合家庭聚会，价钱也还算公道。','50','2011-09-06 11:26:00',NULL),
	('1c43e2680a0cdabd9af938de22e71b98','25d134bf4c651fc5fd0fd1ddf6c0713c','花心小男人','4',4,4,4,'跟同事还有老总去的,吃的还不错，就是感觉内个锅包肉特好吃，还有内个大花卷也很好吃。。。菜量没有传说中的嫩么大，只是一般而已，但是一人一个菜的话肯定是够吃的。','0','2011-12-18 13:36:00',NULL),
	('00ca7a6b8d4bf60e2d36422a43afcad1','2a27f8be857526063adc1f4c8f23be67','pjy798','3',3,2,2,'今天在洛阳旅游，洛阳的一个同学就带我去吃水席，找了好久才找到这家管记水席，门面很小，里面也没怎么装修，不过餐具都很干净。我们点了四个菜，当然有著名的牡丹燕菜，酸酸的，我很喜欢吃。','30','2010-02-23 22:03:00',NULL),
	('0144732464fe029fb71bf3355e5abbef','2a27f8be857526063adc1f4c8f23be67','rain921','0',3,3,4,'价格实惠，服务热情的老店。第一次吃水席，一个人点了四份菜，结果每种都只吃了一点，不过味道确实不错！最后结账，发现才花了30块。喜欢假海参这道菜，很有创意！服务非常热情，来洛阳旅游的朋友一定来这里坐坐！','30','2009-09-29 12:10:00',NULL),
	('037586e14482295ecd7487931a0dbcc8','2a27f8be857526063adc1f4c8f23be67','marshalfei','3',2,2,2,'洛阳水席啊。绝对是心中永远的痛。。。之前耳闻，似乎还好，不想这一餐吃得那眼泪汪汪。。。难怪便宜。。。首先上来的10元一盆的燕菜，嗯，什么事燕菜呢，就是一盘水煮萝卜丝加个位数的鱿鱼须，想起了赵丽蓉“就是一盘大萝卜”的小品，一天没好好吃饭，大冬天的。。。哎，能不这么伤我的心么。。。很重的黑椒，不习惯。。。连汤肉片和熬货基本上就是乱炖的意思，汤汤水水一大堆东西煮吧煮吧，比起萝卜，好在还有点能吃的东西，虽然不甚好吃吧，什么平菇，猪皮，猪大肠，不知道什么肉的肉片啥的，一坨汤水。。。蜜汁红薯，额的神啊。。。黑乎乎的所谓蜜汁，飘着几粒烤焦的红薯，真不知道洛阳是缺食物还是怎地。。。这一碗东西果然水。。。总结，洛阳水席很水，看看就好，千万不要当成主要的一餐~~~~最后，KFC真好吃！！','0','2011-01-15 02:08:00',NULL),
	('081572dd1aa1aacf0cd3d7a503212980','2a27f8be857526063adc1f4c8f23be67','黄桃味蛋挞','3',3,2,2,'两年前牡丹节去的啦，有套餐的，比较便宜，来了洛阳总要吃水席的，下午时段没什么人，口味比较清淡的算，没啥特别的，都吃得下去的汤汤水水，由于还要吃晚饭就只点了水席套餐三人吃的','20','2011-10-25 12:04:00',NULL),
	('098fc85c46e990619f27e340759bed91','2a27f8be857526063adc1f4c8f23be67','再来一碗米','2',2,2,2,'真是见鬼了！我是看着点评过去的，吃了大家推荐的菜，老公一脸苦色。所有的菜都是一种汤，除了料不一样，其他的都一样。我们俩吃了几口就不吃了，好吧，水席这个东西不适合我。环境脏乱差可以概括了。对水系过于失望，后来我们的注意力直接转到不翻汤+2*烧饼，居然吃了三天。。。。。。。','30','2011-05-01 22:43:00',NULL),
	('17889e98db1188072229ad4bb6676844','2a27f8be857526063adc1f4c8f23be67','爱喝牛奶的芒果','3',2,2,3,'平价的水席老店，因为没吃过真不同，所以不知道到底区别在哪里，这还是第一次去洛阳时，我家哥哥带我去吃的，就在老城区，很好找，老集那一站下车，进去一条旧旧的巷子就看到了。我们当时不知天高地厚的点了4种，当然有燕菜啦，连汤肉片啦，果然是便宜又大碗，是一个小女孩帮我们点的，菜都上来以后，老板娘说，不知道你们只有两个人，那小姑娘不会点菜，给你们点了这么多~呵呵，这让我对这家店的好感大增呢~我们就是想多吃几个品种呀~ 就是酸酸辣辣的，我蛮喜欢的~洛阳真的是我非常喜欢的城市','25','2011-04-11 20:08:00',NULL),
	('0067dbc92b9b44c09195a08320bde1bb','2a390015241e956587ea505d29566929','断翅蝴蝶儿','4',2,3,2,'跟朋友来这里happy，一周紧张的工作需要释放一下，这里就是个不错的地方，美眉唱歌灰常棒，舞蹈节目也都可以，就是人多没有凳子，一直站着脚后跟真疼啊！','100','2011-11-08 11:39:00',NULL),
	('0169275dc8e7a5fc958a096ddad85e6d','2a390015241e956587ea505d29566929','热牛奶的燕麦片','4',4,4,4,'一群新认识的朋友一起去的，一个VIP包座，位置挺好的。具体花多少钱就不清楚了。环境还可以，10点甚至11点前都挺“文明”的，咚咚的音乐，男男女女四处观望，不知是不是在寻找猎物，呵呵。感觉上和陌生人搭讪的挺少的，大家都守在自己的小圈子里，偶尔拥肩附耳大吼着聊天。表演还好吧，没到让人激动喜欢的份上。大概由于频次太低，很久才有一个表演，所以有新表演者出场的时候，大家还是挺high的。卫生间，额，其实挺多的，但还是不够，人太多了。唉。90后们是主流了。80后都在家带孩子了……作为80后的剩女，情何以堪啊！对面是一家烧烤，这样的搭配真不错。累了，乏了，饿了，还能出来吃吃东西。酒吧、烧烤，够味儿没营养，不正符合了无聊夜生活的追求嘛。12点半多离开的。在门口等出租车的时候发现，刚来的人比要走的人啊！还是走早了？不过打车仍旧不太容易呢。拚车比较多。单独的女生注意安全吧。不懂酒，所以酒水怎么样就不乱评了。最后，情侣就别来这玩了，乱糟糟的反而没了气氛。两人要的是情调，自己买好酒在家里/酒店里浪漫吧。','100','2011-08-31 16:38:00',NULL),
	('02280dfa5e5f515fa40829ecd4cd4c76','2a390015241e956587ea505d29566929','魔蹄','0',4,3,3,'只去过一回，虽然不是我花的钱，但看那消费实在是太贵了！一共5个人，花了近2000元！哎，不常去这样的地方，让我花钱我是不舍得呀～～！外观就很宏伟了，听说这里原来就是一个迪吧，而且那时在沈阳也是最有名的。那回去有几个外国人在台上唱唱跳跳的，感觉像是非利宾人，有一个短胖短胖的人好像是队长，看起来人也挺和气的，常到台下和熟客打招呼！洗手间在楼下这还让我找了半天，而且洗手间边上就是舞蹈演员休息的地方，可以看到好多大美女。嘻嘻～～！地方很大，这里的常客大都年纪稍大一些，估计得有一定的经济实力吧！','0','2009-05-06 10:50:00',NULL),
	('0228229fbf34ceba5de77e2af263549c','2a390015241e956587ea505d29566929','绿雪','0',2,3,2,'如果说在沈阳能找到外国人最多的地方是哪里，那午夜阳光一定是其中之一。不过要找老外一定要等到晚上12以后，或者1点以后吧。我没去早过，不知道早是什么样的。不过1点以后是挺热闹的。整体感觉还行，就是有点闹。','150','2008-02-18 18:43:00',NULL),
	('09d79e9091bb91a9cefbd03089b75ba5','2a390015241e956587ea505d29566929','lijing414','5',4,5,5,'我喜欢每次去的早一点 因为喜欢安静点的环境 那时还没开始演艺什么的 记得有一次一个人去喝了少半瓶纯洋酒 等到放曲儿的时候 就嗨的不行了 哈哈 曲子还挺好的','0','2011-06-23 09:07:00',NULL),
	('09dc2457251cc836bebc8c42bc441028','2a390015241e956587ea505d29566929','甜嘴抹舌','3',2,2,3,'这个，我真的不知道怎么给打分。我是超级不喜欢这种场合的。。太吵了。有那钱我宁可去吃几顿好的。朋友从外国回来，请他来的，给他找了个小妹妹，本来是想给他当女朋友的，没想到，人家哥们很纯情的觉得小妹妹年龄太小，容易伤着人家，就真的认下当妹妹了。还送人一电话。。真不知道说啥了。总之适合喜欢夜场的人来。但相比我还是比较喜欢已经消失的KISS。。我喜欢那大薯条。。说到底我只是一吃货。唉，可怜的KISS','500','2011-01-14 19:31:00',NULL),
	('09e1f0e1c01d221431a86d9e1a770961','2a390015241e956587ea505d29566929','ikki45','4',2,2,3,'我们是去唱歌的，直接上了2楼，一楼好像有蹦迪的所以感觉比较吵 ，但是也只是能听见而已，隔音相对来说还是可以的，服务员的态度很好，当然价位在那呢 要是这个价位服务还不好的话 估计也很少有人能去了吧 哈哈 里面有很多老外，感觉他们看起来挺有趣的 ktv的歌曲不是很新，但是无线麦克很给力 哈哈 可以去试试','100','2011-06-18 17:44:00',NULL),
	('0e0bf7be4f17b102ab0609dfd2d9fe09','2a390015241e956587ea505d29566929','sonya1984','4',3,3,3,'环境还不错，但是属于慢摇吧，如果你喜欢快节奏的，建议选择迪吧，那节奏我觉得不适合我。算是比较老的一家了。消费属于中档略偏上一些吧','50','2011-07-02 22:54:00',NULL),
	('11700c15cb2ca953a089911732d174be','2a390015241e956587ea505d29566929','宇荻','0',3,3,3,'昨天是我生平第一次来这里！虽然酒吧也曾经去过！不过感觉这里在我的定义看来说这里是慢摇吧更合适！一进门便领教了一下机场级别的安保！存上外套和手提包进场，刚开始觉得里面的等光很是昏暗！慢慢适应下来发现DJ在放曲子，酒保在吧台里忙忙碌碌的！没过多久表演开始了，一首歌过后发现了传说中的小白！歌唱的很好，难得我能认同！乐队的水平明显高了一个层次！外籍演员也很卖力的表演！慢慢的带动着全场的人跟着一起舞动起来！气氛的确好得不得了！自己也情不自禁的随着音乐开始舞动！跳钢管舞的MM身材不错！舞跳的也是相当的妩媚动人！在这里坐下喝点酒的确是可是让心情放松下来很好的地方！','0','2008-11-13 09:17:00',NULL),
	('162af346a3c37c9c9b41da3a5f43851b','2a390015241e956587ea505d29566929','cz070304','4',4,4,4,'其实只去过一次 是大一的时候 沈阳音乐学院的一个学姐在这里开演唱会 觉得场子是我喜欢的类型 不是很大 门口还有卖哈根达斯的冰激凌 下次同学聚会 要来这里消费 体验一下 不错的酒吧 慢摇吧 这里适合20多岁的年轻人','0','2011-07-11 23:23:00',NULL),
	('1cf9598f860a4b3177ad7a0738af732c','2a390015241e956587ea505d29566929','欠宝贝','4',3,3,3,'【试吃/体验点评】以前里面的空间还蛮大的，现在加那么多桌子里面很挤呢，而且貌似里面70后的较多，里面驻唱的歌手唱的很好听，想放松去去还不错','100','2011-07-04 10:43:00',NULL),
	('0447b604c58b706fe9a0238cce968818','2cec150282698e071eea9b15564446d2','右点点','0',4,4,3,'前2天刚吃的周五晚的自助餐 相对的更贵了不过觉得还蛮值得 我个人就认为比香格里拉（太偏甜点了）的自助要好饱腹了一顿生鱼片 羊棒骨还有各种的意大利感觉的热菜每个人一份的木瓜雪蛤可能是周末的特别吧很不错的鱼翅 不过这很容易饱肚子就是了还有蛇段 嫩嫩的鹿肉鲍鱼捞饭（可惜饭会被浪费）最后把每种甜点都吃了一遍 也蛮好的','180','2009-01-18 23:39:00',NULL),
	('05b7461456ddf84b49858a0ff6a2e1d1','2cec150282698e071eea9b15564446d2','wwmlu','0',3,4,3,'环境优雅,停车方便,中午的自助餐物超所值,生鱼片很新鲜,甜点做的比香格里拉好,就是分生鱼片的waiter小气了点,每盘只给一点点,不过相对这个价钱来说已经是不错了.所以现在人满为患,中午经常都得预定才有位子.','68','2007-05-26 11:00:00',NULL),
	('06e107a0302270e14d4487041dac173b','2cec150282698e071eea9b15564446d2','rabbit1119','0',4,4,3,'早餐 38 午餐58 晚餐78 五星级加15%的服务费。具体见我图片[标记标累死我..]｛图片评价按 好吃＞不错＞还可以＞一般＞不好吃｝酒水方面觉得算多的了，除了一般的各味汽水、咖啡、茶和啤酒，还供应　冰水，热水，冰块。咖啡貌似是碳烧咖啡，口味不错。甜点都挺精致的，口感没得挑。海鲜都挺新鲜，不错。有大海蛎呀～［忘记吃了ＴＡＴ听说很好吃....］','66','2007-02-26 21:46:00',NULL),
	('09e6aa7ea59d08c796122bce0e86de11','2cec150282698e071eea9b15564446d2','无敌小灰机','0',3,3,3,'烤肉好多，味道很不错里面的甜品.品种多，环境也舒适带朋友到里面约会很不错的呀还有很好吃的鲍鱼捞饭....这个是算福州不错的自助了,而且价钱也算实惠的了.值得推荐','0','2008-11-21 12:57:00',NULL),
	('0b6a0d039cc9b7f656cc007f48bef7b6','2cec150282698e071eea9b15564446d2','小璐璐璐璐','3',2,3,3,'住店送的免费早餐 吃了三天 菜色好像是每天都会变的 喜欢的肉松和皮蛋瘦肉粥三天里只吃到了一次现煮的米线什么的还不错 水果也挺新鲜的','0','2011-06-13 16:19:00',NULL),
	('0c8ab1040ef4372461a109c2e61797fc','2cec150282698e071eea9b15564446d2','檰花呗','0',3,3,2,'感觉还是挺不错的.至少每次都是吃到扶墙出来的.最喜欢那的甜点.味道不错.还有火锅.用海鲜做汤底味道好极了','90','2007-04-18 12:35:00',NULL),
	('0fc1457101281a75d893367369508232','2cec150282698e071eea9b15564446d2','蓝天自由鸟','0',3,3,3,'菜肴很精致，甜点很好吃。服务也不错，价格不便宜。人挺多的。跟朋友坐着边吃边聊还是蛮好的，落地玻璃也能看到四周的风景，还不错。','100','2009-01-02 20:00:00',NULL),
	('11211f74130f4e7d75d88bdb89b0bf9d','2cec150282698e071eea9b15564446d2','terryyoder','0',3,4,3,'这里最大的特色就是甜点了口味很多，慕司，黑森林等，品种是福州自助餐中最多的。其他的东西倒是做的很一般，没什么感觉。','100','2007-12-07 21:43:00',NULL),
	('12589589c198e721bad2d3e346583a8d','2cec150282698e071eea9b15564446d2','茉希','0',3,3,3,'福建这边的阿姨请客，自助餐很实在阿，什么海鲜都有。就是我长在内陆，吃不惯这些东西，不过还是品尝了一遍，有营养就多吃点呗。呵呵，鲍鱼捞饭和佛跳墙都很不错，对于我都是新鲜玩意了。点心也做得很精致，在北京这样一顿海鲜自助，估计就不只这个价格了，很值。','198','2009-01-03 19:08:00',NULL),
	('16c402da069af4b32d1056785a3f4b30','2cec150282698e071eea9b15564446d2','随笔云荒','4',3,4,4,'东西很多的自助餐，但是价格也不低，去吃的晚点，东西还是有一直在上来刺身和沙拉什么的味道都很不错~心水~不过烤鳗鱼不怎么好吃……是蜜加太多了吗？好甜！','0','2010-09-14 21:55:00',NULL),
	('175270ae20795d75b50715089f70fefb','2cec150282698e071eea9b15564446d2','地面乔丹','0',4,4,2,'环境很不错，能激起人的食欲。生鱼片、三文鱼、手撕蛇肉都是很赞的美味。价格贵点但物有所值，去吃前最好电话订位','118','2009-01-16 09:26:00',NULL),
	('17f94ab7ddd20b63336f4d11e5b7e35a','2cec150282698e071eea9b15564446d2','HENNY777','4',4,4,3,'海鲜的种类很多，有龙虾、小象蚌、三文鱼等，味道做得很不错，上菜换菜的速度还挺快的。果汁是鲜榨的，青瓜汁很好，就是甜点不够精致','0','2010-06-06 10:59:00',NULL),
	('19297527e860fa6d549202431a1a677a','2cec150282698e071eea9b15564446d2','燕燕燕燕1984','0',3,3,4,'当年好像受金源拖累不少，在福州自助里性价比较低的一家。不过价格很合适，其他一无是处。改造后的价格贵了，但可吃的也多了，总体说来还算不错哦。','0','2008-10-20 11:36:00',NULL),
	('1da978b3127c254c4089024805c93e0a','2cec150282698e071eea9b15564446d2','kukutata','3',2,2,3,'不是对他家的东西有什么意见，主要是那天老头说去吃自助餐，可是我早上11才吃的早饭，于是，饱饱去自助餐，谁知道，我们才开始吃，（我就喝了杯西瓜汁--不掺水真好喝）老头电话响了，有急事，出差，走人，就剩我一个人，闷得要死！于是我又喝了第二杯西瓜汁，还是感觉不饿，所以看点评里，大家吃的什么鲍鱼啊！刺身什么的，我是一个都没有吃，最后就吃了两只螃蟹跟一只虾菇（新鲜饱满~哇哈哈）。。。。餐后送了一盅木瓜炖雪蛤，木瓜都烂了。。。大概是因为周末，人很多，感觉很吵！一人139加15%手续费，这餐对于我们来说确实是贵！哎。。。生气中！臭老头！我讨厌你！PS：吃饭很关键的是环境跟心情！','139','2010-01-20 20:44:00',NULL),
	('05b1cab9580232d08f47684ac2faca4b','2e1201788c94cba2dcb2d4ef542c64f3','世纪末的面包','5',5,2,3,'感觉不错！上菜速度非常快！小鲍鱼很推荐，很鲜美，很新鲜，性价比高的。椒盐虾菇还不错吃～冷热风味不同～我妈很喜欢，炒得很香经不住吮指呢。海苔角很惊艳！很脆的海苔，里面的肉和地梨很多。感觉这边上海人很多，都是吃货啊！下午一两点去的，没等位，但是再晚厨师要下班。厦门和上海不一样啊，上海到是除了半夜一整天营业的。我不喜欢等位，都喜欢错开饭点吃。','70','2011-08-20 21:49:00',NULL),
	('0599451e9cd7994eda25f7b2fda45e0e','2e1201788c94cba2dcb2d4ef542c64f3','毛毛要给力','4',3,2,2,'记得那次是晚上7-8点的光景。路过这里。看见有一对情侣在那里吃排档。。。我也不知道为什么。。。突然很想哭。。。有时候觉得。。这样。。也是。。一种。。。幸福。虽然平淡。却很真实的幸福。','0','2011-04-07 18:46:00',NULL),
	('0825b2f585545f40b01a2a970b892564','2e1201788c94cba2dcb2d4ef542c64f3','癡迷好味道','3',3,2,2,'价格一般。不算特别经济实惠那种。只是个正常水平吧。口儿比较重，比较油。卫生条件一般。海苔饺算特色吧。椒盐鳗鱼苗要趁热吃。','100','2011-10-07 21:20:00',NULL),
	('08ff91df8fa011d278e622728cf9f0a0','2e1201788c94cba2dcb2d4ef542c64f3','火花LZ','4',4,2,3,'到的比较晚，都快饿晕了，住的天马海景公寓，老板推荐这家吃饭实惠好味，而且离的又近所以就去了。发现这家店的人气挺旺的，看了一下菜单，东西都二三十块，便宜，所以点了好多，口味真的很好，绝对不是饿的原因，海鲜都很新鲜，所以说越往南走，东西越好吃，越北面再好的食材也烧不出好味来。','40','2011-05-27 10:00:00',NULL),
	('0963cdb41e6b0e74a500d9af388e95c6','2e1201788c94cba2dcb2d4ef542c64f3','张东君','4',5,2,3,'在厦大读书的师嫂带我们去的。去的时候打的，还被司机坑了一把，明明发票上是9块，师姐给了15他愣是没找钱。我们这三个人，一个数学系的，两个数学系家属，居然这个帐都没算好，囧。。。话说回来，海蛎煎真的很好吃。清蒸的墨鱼圈，相当不错。其他的海鲜我不是很喜欢呀。清炒的蔬菜也很对我胃口，不过那应该是因为我本来喜欢吃蔬菜吧。想想流口水呀~~~','40','2011-05-12 10:58:00',NULL),
	('0b932ebd69e87493f4dad4a9ee23ebfc','2e1201788c94cba2dcb2d4ef542c64f3','焦下客','4',5,2,4,'冲着网上的评价去的，还不错。吃着海鲜，喝着啤酒，吃到肚子涨的不行为止。满意的不行，价格也不贵。尤其是老公满意。下回去厦门再去','56','2010-08-05 16:00:00',NULL),
	('10640b2c09f53b0f7374477974e16da1','2e1201788c94cba2dcb2d4ef542c64f3','F的N次方','4',3,2,3,'还不错吧，挺有特色，推荐海苔饺，赞，便宜又好吃，一份10个10元，叫了2次，还有酸笋炒鸭珍也不错，和公园小学对面的鸭肉摊比起来，各有千秋吧。但这边有个缺点，分量不多，是按份，不是按人头计量。。。','40','2010-10-08 11:47:00',NULL),
	('109f718c8e4ff6c91e6cfc7df653f231','2e1201788c94cba2dcb2d4ef542c64f3','danyingliu','4',3,2,2,'会觉得有点贵，3个人340啊。。还是因为我们点多了。。。点了：3个小螃蟹，1个什么鱼，2盘虾爬子，1个鱿鱼，1个蛏子，1个炒花蛤螃蟹还行，忒小，帮助四分五裂了，吃起来比较方便那个鱼前面吃还行，后面就腻了虾爬子我没吃。。。那东西看着就慎得慌，在家也基本不吃那个鱿鱼还行蛏子我得说说，怎么那么大个啊！吓人都，像是催起来的炒花蛤才搞笑，服务员上菜时说超辣，弄得我试都不想试但后来被怂恿一吃。。。我都能接受，这个服务肯定在恶搞我们。。老板推荐的海苔饺，和一个有竹叶还是什么叶包的鸡肉，不错，我就记住这两个了，哈哈好像就这些味道，说实话，没有觉得特别好当时看点评去的，期待蛮大的，期待越大失望越大吧，咳不过总体还不错，但是太贵了，应该不会再去吧。。','100','2011-06-15 09:10:00',NULL),
	('17e50b73ab42e79263d564368d57375e','2e1201788c94cba2dcb2d4ef542c64f3','西兰花椰菜','4',3,1,2,'号称厕所大排档位于厦大医院对面主打海鲜、新鲜、便宜、没有那次去人不多的旁边的小山东、照强什么的人都不及他家酱油水做的不错，竹蛏好吃','80','2011-03-26 19:03:00',NULL),
	('190086a90ff1022b5569864e07ad17e6','2e1201788c94cba2dcb2d4ef542c64f3','aki_na','4',5,2,2,'酱油小鲍鱼务必要点，好吃！不过品种太少！海苔角太油了，吃两个就腻了！人很多，一定要提早去！！！！！！','50','2011-10-31 13:54:00',NULL),
	('1ba18e221f95f1e407256d6b78b6bd90','2e1201788c94cba2dcb2d4ef542c64f3','都一样','4',4,2,3,'大学路上众多拍档中的一个，就在美好时光的旁边。盐水虾蛄不够老，没有嚼劲。酱油水蛏子比较好。冬蟹是清蒸，还行，反正不是很壮。另外要了一个蔬菜。','100','2011-02-28 21:34:00',NULL),
	('01930262e9b41c30f320da6f931a2e8b','2e43f7d0fd0e3152c0f3a3feef344142','avissh550','4',4,3,3,'拿了很多很多棒棒糖。。。是门口的妹子硬塞的~随后90度直角鞠躬送电梯海胆有些许沙子不过影响不大甜虾的个头真的好大，过瘾啊蟹脚明虾都不错呐可以吃吃嗒','300','2012-02-10 09:29:00',NULL),
	('0642349f33386c981998b0476dd07078','2e43f7d0fd0e3152c0f3a3feef344142','kittywwgly','4',4,3,5,'心血来潮想到的，于是一边打电话一边往虹桥进发，结果直到到了初花，电话都没有打通过。。暴汗中2号线下来，雨中走了20分钟。。。卑鄙的百度地图4点半到了初花，已经有人在等着了，问了服务员，说是只有吧台的位置了，幸亏来得早，哈哈，不然就白来了啊，事实证明我们吃完7点半走的时候外面还有无数人等位啊虽然坐的是吧台，但位子也是很宽敞的，不会像元绿那样，围着一排很嘈杂对面就是做刺身的厨师，带着塑料的口罩，专心的整理刺身，偶尔很小声的交流下，真的很小声啊，我们隔着也就1米左右，只能隐约听到他们在说什么服务非常好，唯恐你吃的太少，没吃饱，呵呵，经常跑来问，要加菜嘛，要加饮料吗？一不小心又吃撑了，羡慕旁边一对小女生，那个胃口叫好啊，放题还能吃手卷。。。300块，其实环境占了很大一块，值得的说说实在的，考银鳕鱼的确赞，肉肉嫩有汁水，不过太垫饱，只吃了2块生鱼片都还行，没有很特别的可惜生蚝刺身么有，不过前一天在小黑吃的够本了，哈哈海胆很好，新鲜，不限量，看到很多桌都是10份点的，服务员一拿一堆焦糖布丁很赞，软软滑滑一股加仑的味道，怀念临走拿了4跟棒棒糖，哈哈，布丁味的，初中时的记忆哦','300','2012-01-16 10:23:00',NULL),
	('0dec4174898fc864b9bcd2a4d2ea73eb','2e43f7d0fd0e3152c0f3a3feef344142','Karine516','5',5,5,4,'因为没有预定过的关系，很早就去排队了，还是坐到吧台上面，不过可以看到食物的新鲜过去服务员说没有海胆了，真是可惜了~3人吃了四轮，性价比肯定是没有之前200多的时候那么高，但是量还是很足的刺身都是很大只的那种蟹脚是盐焗过的 味道很鲜甜烤银鳕鱼和海鳗都不错的，很入味值得一提的是他们家的甜点，焦糖布丁，很棉糯，和细软，一口气吃了3杯','300','2012-02-09 12:38:00',NULL),
	('0ec7f6f484fb55f731e8ae1a4150884d','2e43f7d0fd0e3152c0f3a3feef344142','丁丁爱哈士奇','3',3,2,2,'这样的菜品和素质，便宜的也有很多，不见得初花就那么的与众不同。刺身都蛮新鲜。甜虾有几个很腥，。三文鱼有的部位不太好，肉很干，有些还带筋的，还有些连刀块，汗呐！醋物都不好吃，不够酸。醋物黄瓜也是连刀块。寿喜锅太甜，肉煮一会就老了。烤银鳕鱼蛮肥的，调味有点怪，似乎某种调料过量了，有点发潇的感觉！海鲜火锅和芝士焗扇贝味精过量，扇贝很小，不过芝士很多，可以拉丝。烤三文鱼头和金枪鱼下巴蛮嫩蛮好吃。焦糖牛奶冻很浓郁，很好吃。烤明虾很大只，肉多，口感很好。烤鳗鱼很小一块，味道不错。海胆蛮大，入口即化，但味道不浓郁，没有那种鲜香。北极贝很大，吃起来很爽。据说寿司的米饭不错，酸酸甜甜的。天妇罗无功无过。蔬菜沙拉和炒素都一般。生烤三文鱼刺身一般般，还不如吃刺身。甜品只有焦糖牛奶冻，没有冰激凌。等待的时间实在太久太久。第一批17点开始限时3小时，事实证明，8点也走不了，是因为菜没上齐。第二批刺身上得还算快，之后的菜很悲剧，起码等半个小时。有的甚至需要1个半小时以上，有段时间处于没有东西可吃，甘等的状态。炸生蚝味道怪怪的。鳕蟹脚很淡。饮料也要等半个多小时。其实这里品种并不多，好在日料最重要是刺身新鲜，这点还不错，...就是部位不灵。以后也不大会来了，没有什么惊艳之处，也没有特别好吃的菜，还不如吃168元一位的放题，质量差不错。全文','300','2012-02-10 20:09:00',NULL),
	('0eddaae56b8d22f1bd51c341facea4b0','2e43f7d0fd0e3152c0f3a3feef344142','阿呜阿呜大口吃','3',3,2,3,'和王鼎相比确实要差一点,贵出20块没有一点道理.生鱼片里目鱼和北极贝非常不错,海胆可能还是要看运气的,这次不能说非常新鲜.焦糖布丁挺香的.烤明虾很大.同等档次的放题来说,还是比较倾向于王鼎的,较环境较食物都要略胜一筹.初花则对于如此响亮地名气来说,有些小失望了','300','2012-01-29 15:21:00',NULL),
	('1260ceefa25a3da9d8c93a2562694b82','2e43f7d0fd0e3152c0f3a3feef344142','akinoss','5',5,4,4,'朋友们说一直很想过来吃，然后提前了2-3个星期预定的，算是朋友之间的年夜饭吧，甜虾和北极背真的很大个，海螺的口感很不错！蛮Q的！焦糖布丁很好吃，一口气吃了3个还想再吃，哈哈，初花贵是贵，还是物有所值的','300','2012-01-16 12:05:00',NULL),
	('141f6f7158f8142d05ae7f83746a7eb2','2e43f7d0fd0e3152c0f3a3feef344142','floodbud','1',2,2,2,'天啊，好差的一家店，我也是昨天去的，竟然说没有海胆！！点评上的评论还能信吗？饮料催了好久，人多可以理解，但是自助时这样太浪费时间，不知道其他店会怎样','300','2012-01-31 17:05:00',NULL),
	('1686b41ad085249eda7c150b1c8dc938','2e43f7d0fd0e3152c0f3a3feef344142','QQ爱号','5',4,5,5,'这边是自助的，价格也不是很便宜哦！不过味道真的很不错哦，我们是上午去的，刚开始人还不是很多到中午的时候就比较忙了。不过这边服务还是跟的上的没有要等很久，他们男生真的很能吃，不过吃这些不会特别的饱，因为份量真的很少。像银雪鱼还有虾都很好吃哦！最后还有甜点味道也很好。','0','2012-02-12 00:13:00',NULL),
	('19376cdf2ac8dbfb851293d6b37670a1','2e43f7d0fd0e3152c0f3a3feef344142','安分的猫','5',5,4,4,'可能是最好吃的日式自助！海胆无限不说还很新鲜。不但有日料，还有很多烧烤类和寿喜锅。烤牛舌超赞！还有剥好的盐烤白果。美中不足是tuna里面暗藏冰渣。','300','2012-01-13 20:34:00',NULL),
	('1df52bc16d19451d149f83fde1cb973f','2e43f7d0fd0e3152c0f3a3feef344142','o0可可0o','5',5,5,4,'提前预定的，知道后面上菜速度会慢，于是一开始就点了很多最喜欢烤银鳕鱼，甜虾了服务员态度也不错，由于是最后一场，吃到最后服务员还特地会过来问有什么需要的提醒师傅要下班了，没有错过最后点单的机会这个性价比还是可以的，下次还会和同事一起去的~','300','2012-02-07 20:57:00',NULL),
	('034c296818ca0a46d2de0c56acffbfbe','2ea7d1a13ae2b66af46c9555eddc35e1','蓝枫晓月',NULL,3,3,4,'每次去都看见很多人在等位，确实性价比很高，价格很实在，东西也还可以，跟价格比已经比较值了，披萨啊鸡翅味道也还可以，也就去过一次因为人多，服务也不是很好，但是想省钱又吃的可以来这里还是挺划算的','45','2010-02-05 13:53:09',NULL),
	('04f5d81f9ab32424dcd3cbc0056afee9','2ea7d1a13ae2b66af46c9555eddc35e1','小羊001',NULL,3,3,2,'环境挺好，价格便宜，味道嘛，比起必家的差远了，看看价格，也就忍了，披萨的馅料是在是少了点，芝士土豆泥还可以','40','2009-12-20 09:24:42',NULL),
	('05e6a38511391c0e4ec62009a329b725','2ea7d1a13ae2b66af46c9555eddc35e1','美丽世界',NULL,4,3,3,'经典意式休闲餐厅，其中以巴式特色至尊比萨，大虾菠萝?h饭等最为出名。还有由专业面点师设计研发的中国茶火烧蛋乳糕等。冰淇淋是从新西兰空运进口的，绝对保证新鲜的口感与品质。','50','2010-05-06 16:11:10',NULL),
	('0dfa157a274c5cf2b5126f6172ce9fdd','2ea7d1a13ae2b66af46c9555eddc35e1','Q宝宝',NULL,3,2,2,'比较实惠的西餐店。金枪鱼的意面是热的，味道不佳。牛肉的饭味道还凑合。甜品比较精致。整个环境偏差（因为太过嘈杂），服务员态度不是很热情。遇到饭店时，需要等很久的位子。','30','2010-01-22 13:13:58',NULL),
	('1566cd6d50c142220bd5902c71d4caea','2ea7d1a13ae2b66af46c9555eddc35e1','VVMO',NULL,4,4,4,'环境不错，味道也很OK，人很多经常要排队等位，很中意这里的披萨，夏威夷披萨，巴贝拉特色烤鸡翅、酥皮披萨都特别好吃，巴贝拉特色烤鸡翅也可以。特色冰咖啡12元量挺大的。香浓巧克力15元口感还好。特色至尊32元，香酥薯格，12元价格不算贵，巴贝拉一直是性价比比较高的餐厅，很喜欢！','50','2012-01-29 11:10:59',NULL),
	('15d1faaac67fba177c486d7dde6c28da','2ea7d1a13ae2b66af46c9555eddc35e1','freeguoyan',NULL,3,3,3,'人满为患。没有免费的温水。客人多服务员少，自然服务水平比较差。两个人点了特色烤鸡翅，大虾菠萝焗饭,和风比萨，焗生蚝，绿茶慕斯特色烤鸡翅，15元，没吃出什么特色，4个小小的鸡翅，但味道还不错；大虾菠萝焗饭，26元，甜甜的，不知道那天吃的时候是不是赶上了一个烂菠萝，有股水果腐烂的味道，里面有虾仁和腰果；和风比萨，39元，感觉一般。焗生蚝，生蚝还不错很干净不会有沙子绿茶慕斯，不好吃','50','2009-09-06 19:52:58',NULL),
	('19a8410057faf78a8e4276b574226ee2','2ea7d1a13ae2b66af46c9555eddc35e1','rita905',NULL,3,1,2,'之前没去过，前几天请人吃饭去的那，本来想图个比必胜客便宜，但3个人没怎么吃就吃了170多，我们三每次去必胜客吃的很饱很滋润才200左右。很很很失望。味道除了蜗牛的味道和必胜客差不多外，但量怎么那么少呢，有的蜗牛才一点点。。。一分钱一分货啊，别的更不用比味道了，PIZZA做的很不专业，还不如猫眼好。要我说啊，现在的巴贝拉已经不能说是必胜客价格的一般就能吃到的水准了，下次不贪小便宜了 注，环境也不是一般的吵杂，根本听不到对面得人说话~~~','60','2009-11-10 12:17:23',NULL),
	('1e254745d1ca68e012424aed4bddee77','2ea7d1a13ae2b66af46c9555eddc35e1','liukai861221',NULL,4,2,3,'久闻的巴贝拉，昨天终于去了，竟然给我了很大的惊喜。披萨的味道很好，而且足够软，即便凉了之后还是，这让我很高兴。个人认为比必胜客的好吃。哈哈。点了一杯蓝色诱惑，有点香槟的味道。而且价格不贵，12元。味道很赞。鱿鱼圈虽然卖相一般，而且和菜单上的照片有很大区别，但是味道还是不错的，鱿鱼的肉也是软软的。拿着优惠券赠送了一个咖喱饭，味道比较一般，但毕竟是赠送的，哈哈。总之，大悦城店面很大，但是人多比较吵。不介意周围气氛的可以去哦，而且真的好吃！！！！','50','2010-09-09 13:43:36',NULL),
	('016ac5a23b9644727cf12266ec793455','35a3ac7a1a3b86893c9f7a278c057d60','苏州无聊','5',4,5,4,'他家是我吃的最满意的自助餐了，不管是外面，还是室内，环境都很好，让人感觉很舒服。他家最大特色就是海鲜，海鲜是我吃的自助餐里最新鲜的，而且量足，甜点也做的很好吃，有机会还要去次。','200','2011-09-13 15:05:00',NULL),
	('02ac832776f0f3b96a8759d10cb79e10','35a3ac7a1a3b86893c9f7a278c057d60','炫紫鎏郢','3',3,3,4,'环境和服务还是不错的，毕竟星级放着呢不得不说凯宾斯基的自助是越做越令人失望本来来这里吃饭的人比较少，挺清净的现在生意好了，反而菜色变一般面包布丁做得也没有往常的水准，泪流满面','200','2010-09-29 20:47:00',NULL),
	('02ed0aeafef706a8985fb4f48771284b','35a3ac7a1a3b86893c9f7a278c057d60','barbara21','3',2,4,3,'哈根达斯 小鲍鱼 甜品 烤龙虾都是不错的选择啊！希望下次有团购可以多去吃几次！不然钱包也吃干了！还有就是投诉大众点评！！！非得规定写多少字的点评！太离谱了！！侵犯***！！！','180','2011-12-28 22:51:00',NULL),
	('067538072921e00d50734860d7d02bb9','35a3ac7a1a3b86893c9f7a278c057d60','風丫头','5',4,4,4,'餐厅边上就是漂亮的湖面，环境优雅。食物品种还是蛮丰富的，菜品还行，很够味道，海鲜相对是比较多的，这里是我经常光顾的场所，喜欢。','0','2011-12-31 13:19:00',NULL),
	('06cd9aa86a6ce54ed4ed5083fce77808','35a3ac7a1a3b86893c9f7a278c057d60','jeanne满地打滚','4',4,4,3,'好了，专业buffet评价出场（太不要脸了哈，不过我真的衬得上半个专业）。首先：好得不得了的风景，苏州没有哪个五星酒店可以与之PK的，看到独墅湖，还可以看到山。作为一个苏州人我很不厚道的说一句：面临大湖，目看远山，有一种在西湖的感觉~~关于buffet,主要看海鲜和dessert。海鲜提升档次，dessert表现品味。那里海鲜品种不多而且成本不是很高：三文鱼，扇贝北极贝蛏子甜虾。。。而我要的是：生蚝！！！小青龙！！！理论上凯宾斯基不缺钱，只要成本核算的过来，就来点别的酒店不敢拿的吧，牛气一点，展现政府定点宾馆的风范呢。。。dessert的话，做的水平一般。其实dessert的摆放是buffer中的一个亮点。如果你酒店dessert放得有艺术感，琳琅满目的话，客人一走进去就自然而然有一种食欲，同时也会感觉buffer东西很多。味道在新城花园之下，如果想有所提高，请跟尼盛万丽和喜来登学习。至于dessert的摆放，可以向香格里拉讨教。关于这一块，不仅要求饼房的人要做好的甜点，同时也要是一个有艺术细胞的人。一方面是经验，一方面也是创意。虎头蛇尾的总结：风景好过buffet。','200','2009-12-09 10:16:00',NULL),
	('077657720fb7d99cbfb36c40d2221020','35a3ac7a1a3b86893c9f7a278c057d60','szlrx','3',2,3,3,'酒店距离金鸡湖大道太远了。那天有大闸蟹活动，大闸蟹也不是本地太湖蟹或者阳澄湖蟹，蟹的个头小而且好像比较脏。总体价格偏贵，没吃到啥。感觉就是糕点比较好吃一些。','270','2010-11-07 00:17:00',NULL),
	('07b70c464b26edd00f5a887105d37522','35a3ac7a1a3b86893c9f7a278c057d60','fairysz','0',3,5,4,'在这么个环境当中吃这样的自助餐算比较便宜的,尤其是买了它家的套券更划算.环境十分漂亮,可以看到独墅湖.这家酒店从独墅湖大道上开过时也十分醒目,地理位置相当好.食物挺好吃的,就是自助餐再怎么做也没多大特色,相比较而言,还是甜点最出色,这似乎也是各大酒店自助餐的统一问题,甜点最容易出彩.环境相当舒适,很适合喜欢小资的人来','200','2009-09-18 13:46:00',NULL),
	('0850c78819833be67dc7f0d781104bdc','35a3ac7a1a3b86893c9f7a278c057d60','JillT','0',5,5,5,'绝对OK的,环境没话说,东西也好吃的三文鱼,TUNA都非常的新鲜,还有各种小蛋糕灵的了~每个都吃到了~人撑爆了要~唯一的问题就是贵~如果没人请客不是过生日之类的就不考虑啦~','200','2009-06-16 14:37:00',NULL),
	('08ac6ca48d52a6d312976deeda9fabc3','35a3ac7a1a3b86893c9f7a278c057d60','洁洁无敌','5',5,5,5,'跟BF一周年纪念，吃自助嘛，奔着海鲜去的苏州大大小小的酒店的自助自问我吃的也不算少的了，凯宾的海鲜是我吃到现在最新鲜的厨师现切，三文鱼，金枪鱼每一片都很薄，刀工不错噢什么螺（具体名字我一直喊不出来，见谅），处理的很干净。我不得不说有些人的素质，吃就吃嘛，光拿肉，壳就扔在那。还有各类虾，扇贝，口感都很好，很新鲜甜点，BF是觉得很好吃，我是觉得种类有点少，连提拉米苏都没，慕斯太甜了，反而倒觉得没有中茵皇冠的好吃了牛排是牛小排，煎的有点老了，羊排反而比牛排好吃了，羊肉味很重，但是我蛮喜欢的色拉和水果，光看就知道很新鲜了，玉米也很甜，果汁都是鲜榨的冰激凌也有很多选择，就是味道不是很浓，脆皮也是现做的反正吃到后面都好撑好撑...','160','2012-01-05 16:13:00',NULL),
	('0b9c2fd436ed3130a4100d3f8a9429c1','35a3ac7a1a3b86893c9f7a278c057d60','李奇奇NJ','0',3,4,4,'环境不错,有一边都能看到独墅湖,非常好的湖景,吃的东西选择比较多,口味也比较好,基本是我吃过的最好的自助早餐之一了.','0','2009-10-16 11:01:00',NULL),
	('0f2e07ff879461f5951c2db7ccff8ec7','35a3ac7a1a3b86893c9f7a278c057d60','fishingshenfan','2',1,3,3,'住那边提供的早午餐·不灵的·关键一个字·少·吃也吃不饱·感觉可能都准备给外国人吃的吧·面包为主·中餐少的可怜·找到一个做面的·味道还淡得无奇·每天一个景像就是大家抢着要粥·哎·反正我都是没吃饱·午餐可选择的也少·海鲜·冷饮·饮料都没的·我吃的最多还是炒饭·只为填饱肚子·哎·失望的·','50','2010-07-08 12:19:00',NULL),
	('0f7584ceddca70ddef7b5b898cb2ba99','35a3ac7a1a3b86893c9f7a278c057d60','泡沫momo','4',3,3,3,'吃的种类其实还算多，有铁板，烧烤，冰激淋，煲汤，热菜，健康煮，甜点，刺身，沙拉，水果，另外还可以现点炒菜，这些都是包括在餐费里的。甜点很爱，做的也很精致。冰激淋很赞，味道有拉姆酒，抹茶，芒果，牛奶红豆，巧克力，草莓，另外有碧根果仁，杏仁片，葡萄干等等可以自由搭配在冰激淋上。听到旁边的人说是哈根达斯的。健康煮，其实我不知道它的具体名字，就是有点点像麻辣烫的东东，汤很鲜的，东西是自己自由选择，再让他帮你煮。现炒菜的话，它大概有6，7种选择吧，我点了个虾仁炒鸡头米，虾仁很大个，也很嫩，就是稍稍有点咸。觉得当时蔬菜吃的少，就又点了个金花菜，还可以吧，就是有点点油。刺身还是很爱啦，很新鲜，不过品种不是非常多，但也够吃啦。热菜上来看，不是非常多。那天去吃的时候，觉得人比我想象中要多。不过服务员为什么觉得有点少，不能很及时地来收盘子，有点点欠缺啦，觉得对不起出的那个服务费~','0','2011-02-03 19:31:00',NULL),
	('0fef4d222b5c6f3c706266eafebc293c','35a3ac7a1a3b86893c9f7a278c057d60','天堂里的毒','0',3,5,4,'价格先不论，环境和菜都相当的不错，甜点好多种类，比香格里拉自助里的甜点还多，还有羊排牛排都是很不错的，刺身很多而且都很新鲜。饮料畅饮，都是新鲜的果汁。服务人员态度超级好，而且很多都是养眼的帅哥~~~酒店很气派，据说吊顶都是施华洛世奇的水晶,以这样的环境和服务来说， 价格并不算贵','200','2009-06-29 09:52:00',NULL),
	('1039548cde6934ac992b32c5d3e8c829','35a3ac7a1a3b86893c9f7a278c057d60','CindyWang1710','4',3,4,3,'中午去吃饭，没有自助餐了，于是就点餐吃。价格真是不便宜，点了馄饨面，三明治，海南鸡饭，主食都在85元左右。不过味道么就一般般了，在这里主要是吃环境吧。餐前面包倒是很不错的。不过服务有点慢。','100','2010-08-27 10:19:00',NULL),
	('11dd07767dd6ac5fa4ee7c414f740f35','35a3ac7a1a3b86893c9f7a278c057d60','黄小果儿','3',2,4,4,'菜地味道实在不行啊，品种也不丰富面包了什么的挺多的，但是，不配我们的胃口饮料的选择面也不广唯一不错的就是那边的环境，金鸡湖边风景不错，灵','100','2011-07-22 13:01:00',NULL),
	('16a1327243eb470196bf72369ca863e8','35a3ac7a1a3b86893c9f7a278c057d60','肚皮糖','4',3,4,3,'朋友送的券，不知道多少钱一位，反正用券不用服务费，提前预定的，所以有靠窗的位置，环境很好，但是因为是自助餐，所以难免会吃得有点浪费，所以服务员都忙着收吃完的餐具，难免心情不好，但是素质还是都好的，没有太不耐烦，还是很耐心帮忙满足需要。至于菜品，还行，没有吃到觉得特别好吃的，但是也没有特别不好吃的，甜品吃到有一种还挺好吃的，里面有米饭，味道很独特。没有热饮，只有汤。这个挺郁闷。','200','2010-08-23 16:22:00',NULL),
	('00672140ba917d29ebd4f5c7cdf19b28','35b0c906e84f988250f97186da81ef07','深紫','3',3,3,3,'We went there for new year eve dinner. Only set menu was offerred. No choice. The first course was soup, then came goose liver, cod, steak and the final desert and Madeleine. The bread was disappointing. I like souffle, i do.','1000','2012-01-28 22:26:00',NULL),
	('0280e10e567673bc3ea594dbd40a482e','35b0c906e84f988250f97186da81ef07','0hai','4',4,4,4,'早就耳闻大名的地方，环境布置得很高雅奢华！服务也是热情到位，给人宾客至上的感觉！虽然价格有点不菲，但是绝对超值！食物做得很精致也很美味！鹅肝的口感细腻，有入口即化的感觉，还有淡淡的鱼香，很让人陶醉！牛排，鳕鱼也让人称赞！甜点更加惊艳，好看，好吃！','0','2011-07-09 20:25:00',NULL),
	('042c2377c6264134a318f46056aed537','35b0c906e84f988250f97186da81ef07','苹果小猫','3',2,2,3,'口味真的不怎么样啊。之前听了好多，结果试了发现真的不如马克西姆。挺亮堂是真的，但里面的食客大声说话就跟小饭馆里面没什么区别，更可怕的是居然还有穿着家居的拖鞋就来吃饭的。惊悚啊','540','2011-03-24 10:52:00',NULL),
	('0b6277546ca27872d1efad39409ab8a0','35b0c906e84f988250f97186da81ef07','北京超级奶爸','3',3,3,3,'他家的牛排相当的好吃，真是不错。服务也是很好，刚来就给我们上了水果，后来还给我们送喝的饮料。真是不错的去处下次还来一定。','86','2011-09-15 17:11:00',NULL),
	('0bc9f3769cc4b6b31834bd6063d76b8e','35b0c906e84f988250f97186da81ef07','ttbaileys','3',2,5,5,'很霸气的餐厅，快走到的时候居然马路上有蓝色路标提示，正阳门的东边就是，提前预约的位子，结果去的时候周末，只有套餐，不能单点，不过还是吃上了传说中鳕鱼的说。环境：非常敞亮，二楼中间的包间不错，最低消费3w起服务：5星，非常的好，不会让你感觉特别殷勤，很顺其自然鳕鱼cod：很鲜美，但是配菜不是我喜欢的那种三文鱼katafi salmon：不是很喜欢带腥味的，说实话感觉和自己做的差不多。。。－－！洋葱汤onion soup：喝的我想死。。。我绝对绝对不会再点这道汤品，嘴太j了，k！nnd，太咸，基本没有洋葱味，面包泡的很烂，芝士为毛一驮一驮的？？想死啊，法国人果然是重口味，消受不起啊。。。。泪奔ing。。。凯撒沙拉caesar salad：你娘的坑人啊，这味道太一般了吧，还不如王府井的小***，也许个人口味不同，自我安慰ing。。。烤鸭腿duck confit：传说不错，皮很好吃，不吃鸭子木有尝试的说，说实话卖相非常好巧克力蛋糕dark chocolate：不是我的菜too，传说还好evian：问我们喝带气的还是不带气的，我说不带，结果你娘给我上一瓶矿泉水，nnd，丁点不想骂人橙汁：唯一鲜榨的，味道还好，不过远不如bangkok大街上的好喝什么莓汁：酸，酸死我了！！...k 我突然想念DQ了餐前面包：味道很一般很一般很一般。。。。泡孚：我靠！坑爹啊！！！味道太一般了！为毛这个味道啊，很不能接受啊，突然觉得少的快没馅儿的贝儿多非常好吃餐后蛋糕：非常非常GOOD！！太完美了！！！改行吧！这太你娘完美了，无论是卖相还是口味，免费的做那么好吃让我很纠结啊，一个个很秀气，每一小口都浸透着柠檬的香味，甜甜的，小热腾腾的，那么让人怜惜，外形Q到家啦餐后甜品：其中形似马凯龙的那个最好吃，白色的让人想死吃完了跑到前门步行街溜了一圈，之后回来取车的时候发现只有我们一辆了，这感觉真好这家的餐后蛋糕是我唯一喜欢的，值得为他再来一趟全文','552','2012-01-30 17:06:00',NULL),
	('0f5373a1ed627d0fad86866800d4cfdb','35b0c906e84f988250f97186da81ef07','Se7en丨','5',5,5,5,'单位请客户，因为客户是个法国佬所以就选择了这里，不管怎么说我觉得布鲁宫在北京还是比较知名的，价位也是不菲啊，还好可以报销，店面装修很到位客户一直点头，餐前会送些面包，小点心之类，酒水要了一瓶波尔多，口感还可以，出品也还不错，冰淇淋造型很赞','600','2011-10-24 13:34:00',NULL),
	('1026917c2dde631878fe13b2c9184bf2','35b0c906e84f988250f97186da81ef07','李奇奇NJ','4',4,4,3,'很好的一家法国餐厅,基本上每一个吃得都不错。圣诞节喝了南瓜汤,吃了火鸡。还吃了他们家的牛排。依旧是一样的感觉,甜品有特色,吃的还行,中午比较嘈杂。环境不错,停车也应该比较方便','0','2011-12-25 14:59:00',NULL),
	('122ef101488dd99cc8591bd17f5cb6b5','35b0c906e84f988250f97186da81ef07','schnuppi','5',5,4,5,'上两周跟老公去吃的周末brunch，点了四道和两道的套餐。 无论是服务，或者是菜色，环境，都很到位。 对得起这个价格。以后还会再去的。','400','2011-02-06 18:14:00',NULL),
	('14d7f3753b0c32eaa63b571eaa072e9f','35b0c906e84f988250f97186da81ef07','crystal142','5',5,5,5,'老板请客跟着去的，不知道吃了多少钱。餐厅总经理给我的印象很深刻，服务极其的好，有礼而周到，现在到Temple Restaurant做了。环境非常好，很有情调。菜也没的说，烤乳猪尤其的赞。红酒也很好。就餐的人着装都挺正式的，交谈的声音也非常轻，虽然坐的是大堂的正中间，一点都不觉得吵。有机会还会再去的','0','2011-12-03 11:20:00',NULL),
	('19459ad2d79cf7a8b802f7c250b4a7e2','35b0c906e84f988250f97186da81ef07','lelelee','3',2,3,2,'看了很多介绍来了，门口泊车的人就很热情，但是进去后感觉服务员都很高傲，符合这个地方的气场，我们没有预定，诺大的餐厅空无机桌也不让我们去，这就是范，改天心情好了再定吧','0','2010-08-25 13:56:00',NULL),
	('1a52d1b5da315a58a4f7f68e4120a066','35b0c906e84f988250f97186da81ef07','purplelilian','4',4,5,5,'忙了一天，晚上十点才去吃的，还能下单，不错：）环境确实不错，氛围很好。服务也不错，比较细心和周到。菜品的话，还可以吧，没有很惊喜。','600','2011-01-28 09:34:00',NULL),
	('1c918575e79b6b9d9550f2f168cdf2ba','35b0c906e84f988250f97186da81ef07','肉嘟嘟的小熊','4',4,5,5,'同学生日去的~环境很不错，晚上前门23号里很幽静，竟然可以看见很多星星。服务没的说，里面还有一个美女服务员，长得特别的甜（我是女的）。餐前面包很好吃，洋葱汤的味道很正，沙拉也很够味！生蚝很新鲜也很肥~餐后的甜点都很精致，就是这次吃多了是在是吃不动啦~下次我得生日也要去那里！','600','2010-12-08 12:26:00',NULL),
	('1ceaefc42cccccdce9d6fa96ee9d469f','35b0c906e84f988250f97186da81ef07','低眉','4',3,3,3,'这里的环境很好,属于很有情调的那种,适合情侣来坐坐,服务没的说,我觉得15%服务费花的很值,黄油还剩四分之一的时候就来给换新的,水还剩四分之一的时候就会再上一杯,上菜的时候会详细的解释每道菜里有什么.点的帝王蟹特别好吃,牛油果的味道特别配合,蜗牛也很喜欢,乳猪个人觉得有点腻,羊肉味道也有点重,但三文鱼非常好,一点也不干,口感很好,甜点点的黑森林,好吃极了,配合着有着浓浓白兰地口味的黑樱桃,真不错.','800','2010-12-15 23:32:00',NULL),
	('02e77ce17b7fd79317c019f39a9b6d72','379fd063154556506227d711a2c8c782','neuty','4',3,2,3,'【试吃/体验点评】牛排味道不错，环境么，装修味比较重。服务也挺好。但是有一点强烈表示不满，为什么没有发票？涉嫌偷税漏税。这么大的饭店，竟然不上税，很不满意。','0','2011-07-24 10:11:00',NULL),
	('0b7795f32ee21402e8ba142a1304645e','379fd063154556506227d711a2c8c782','xujiaru','4',3,4,4,'万象城目前是免费停车 而且他的发展速度出乎我的意料 王品是我一直期待开业的品牌 开业后去了 觉得环境和服务确实不错 值300以上的人均不像俏江南 收服务费还没有服务菜品方面 一直很期待的巧克力瓦拉 么有想象中的好吃 感觉里面的浓浆不够弄甜品方面 和西堤一样的不够给力 但是牛排的品质的比西堤的好不少 台塑牛排 是少有的即时吃全熟也能入口的牛排 而且量很足 沙拉方面一直做得都很不错 蘑菇沙拉 排盘精美 菜品精致 汤 依旧的马马虎虎 面包 我还是喜欢西堤的 觉得这两种酱 不是很给力 饮品 我觉得 至少外观上给人一种赏心悦目感  虽然口味一般 但是绝对对得起花出去的钱 冰滴咖啡 还可以 最起码能入口还是推荐大家有机会尝试下王品 不错哦','300','2011-08-05 23:24:00',NULL),
	('10fca7a5d97fc27b67947ad37ffa1301','379fd063154556506227d711a2c8c782','yoyohot','5',4,3,4,'【试吃/体验点评】真是太幸福啦,加入点评4年了,第一次参加试吃活动就抽中了,真是幸福加幸运呀.又抽中的是王品那更是棒呀.去之前看了好多食友的点评,早就选择好了自己向往的美食,现在就向大家介绍当天我的套餐吧.〈餐前面包〉:烤过的士多,香甜松软，非常的好吃,不过酱一般了,跟食友的评价一样,还是干吃面包的好.〈餐前香槟〉:很好的,有淡淡的香气,可是服务员说是2度,可是喝下去后感觉不止这个度数呀,有点晕晕的呢, 哈哈,可能是我的反映有点快吧,不过还是要推荐的.〈鹅肝沙拉〉:鹅肝细腻滑润，第一口并不苦,但是吃几口后就感觉有点苦了,特别爱吃配的蘑菇，很有嚼劲。〈法式蘑菇浓汤〉:真的是浓汤呀,很香但是不腻,不过有一点点的咸,可能是我上个菜是鹅肝的原因吧,不过也是经典之作了.主菜来了〈海陆大餐〉:我是用台塑牛排配的雪鱼,牛排很熟但又非常的嫩,好下刀呀,真不愧为当家主菜呀,非常推荐,但是雪鱼就让我有些失望了,虽然也是鲜嫩可是有些腥味,不太合我的口味,配菜雪梨跟南瓜都好好吃呀,特别是南瓜了,是那种软硬适中的感觉;下次有机会就点台塑配其它的试一试,光是一个台塑太大了.猪排也好大呀,可爱的小米将她分给大家试了,真的烤到全熟,香而不腻.饮品〈玫瑰露〉:都是大家推荐的,好...多食友都点了,外型首先取胜,吸引眼球;口感也不错,有淡淡的玫瑰香,适合女士的.〈梅子冰沙〉我的最爱了,是用来解腻的,酸酸甜甜，冰冰冷冷的,可好喝了呢.我都喝光了甜品〈热浓浆巧克力拉瓦〉:这也是做过功课后决定选择的,造型很美,其中的冰淇淋,不错,可是巧克力有些咸了,可能我大部分的时候都是分开吃的原因吧,有食友是混在一起吃的,听说也不错的.还有就是大品牌的服务就是好,中间去了一次卫生间,服务员好负责跟热情,我问了位置后一定要将我送到门口,真是让我感受到了贵客的待遇呀,还有就是卫生间很有私密性,是单人的,一个房间只有你一个人呀,哈哈,在这里讲这个希望不影响各位,只是强调一下物超所值的感觉啦.总之:强烈推荐海陆大餐,一定要选一个台塑,再选一个自己爱的,当然了如果食量大的朋友还是要点台塑跟猪排吧.建议:是一个求婚的好地方呀,各类纪念日也可的,一定好难忘.全文','300','2011-09-15 18:18:00',NULL),
	('10fe80c931ffd7023646bccf910e1fc7','379fd063154556506227d711a2c8c782','我当然是小美了','4',4,5,5,'【试吃/体验点评】周五中午接到试吃的电话，一顿狂喜后，一直等到周日，连早餐吃与不吃都纠结了半天呢，因为这一顿等了太久了，呵呵，看到大家都说不太好找，其实到了4楼前行不远就到了，在张生记的斜对面就是，也就是说和ONLY在一面，这样说是不是就不难找了。其实来之前就已经各种搜索，初步已经在心里选好了点什么了，所以点餐并不纠结，鹅肝沙拉、玉米浓汤、海陆大餐（台塑+龙鳕）、焦糖羊羹抹茶冰淇淋、芦荟葡萄柚汁，一下就都选好了。餐品一一端上来…………餐前面包的确很好吃，热呼呼的，香喷喷的，银鳕鱼酱和番茄丁，配起来吃很不错，因为大家都说后面还有好戏呢，所以没敢多吃--只吃了一块。鹅肝沙拉吃第一口有点苦，但是我还是比较喜欢，味道浓郁。玉米浓汤，卖相很好，但是感觉点的很失败，虽然知道是浓汤，但是味道不太喜欢，太甜太腻，not my cup of tea,只喝了两口，把旁边美女的蘑菇汤喝光了，呵呵，推荐大家点这个。主餐牛排，非常不错，尤其是我的海陆大餐，龙鳕很合我的口味，虽然平时不喜欢吃鱼，但这个真的很棒，而且也同时尝到了主推的牛排，建议大家来这个，而且配茶也很好吃，红酒浸雪梨，地瓜块，都被我吃光光了。另外小米同学的猪排，被我们瓜分了，哈哈，只...有好吃的东西才会这样不是，不是很腻，粘上酱更美味。甜点我点的焦糖羊羹抹茶冰淇淋，这个看起来很漂亮，邻桌美女点的巧克力瓦拉也很不错，这两个都很推荐的，都是各有各自的滋味，一个清淡，一个香浓。饮料还是推荐大家试试玫瑰香颂吧，我点的芦荟葡萄柚汁虽然葡萄柚的喝道很纯正，但卖相和味道都不如玫瑰香颂，呵呵。总体来说这顿午餐大大饱了我的口福。另外，店方在店内布局方面也很不错，椅子很舒适，有靠垫，如果带小BB来的话，还有婴儿座椅，餐具也非常精致，采光也很好，非常适合拍照。美中不足的是，上菜间隔的时间有些长了，也许是我们人多的缘故？？希望店家能改进哈！全文','0','2011-08-21 17:58:00',NULL),
	('13d3670d945913d1fef2306ea683e441','379fd063154556506227d711a2c8c782','pipi831','5',5,5,5,'万象城给人的感觉很舒服，虽然都是大牌子，东西都死贵的！但是档次就在那里不争不也抢！我是馋，但是不是专业吃货，不是专业点评，写不出，出彩的文章，我只能把我的感觉尽可能的描述给大家！288元一客，+10%的服务费 ，服务非常的好，细致、周到、贴心，且不会觉得烦开胃酒：雪碧的口感加小小的酒味，另外还有一种香味！英式水果沙拉：切了块的水果丁，配上百香果沙拉，味道清淡，口里留香，十分喜欢装饰用的烤苹果片，脆脆的有点焦香的蘑菇浓汤：口感很好，香浓，顺滑，但是对我来说有点小咸，可以另外加研磨黑胡椒面包：烤面包块，另配两种口味的蘸酱，某家伙很喜欢那个酱，我喜欢面包的口感小羊排：超级赞啊！很入味，一根一根的吃起来也方便！小牛肋眼佐松露酱：这个吗，一共两块，我剩了一半，有点没味道，沾了松露酱以后，满嘴都是里面的香料              的味道，掩盖了肉的香味。底下有点酸菜，没尝啥味道的！酸梅沙冰：小小的一杯，还不错酸甜清凉可口，解腻！巧克力沙瓦：这个说白了就是巧克力岩浆蛋糕+香草味冰激凌+柠檬口味的小果冻类物质，搭配很贴心，不会          因为吃了过多的巧克力蛋糕而觉得甜腻，用巧克力浆拌...香草冰激凌，一冷一热的搭配，别有一          番风味哦！水果盘：切的规规矩矩的西瓜上面放着火龙果，焦糖，薄荷叶子，没啥出彩的地方！这个时候我基本快要到撑      死的边缘了，啥也吃不出来了!玫瑰露：带有玫瑰花瓣的冰块，+底下放了干冰上面放着粉色玫瑰花（摆设），+玫瑰露      把三倒入一里，颜色上是淡粉色的上面漂着玫瑰花瓣，闻起来挺香滴！另外开了一瓶长城的小红酒！本身就不是爱酒的人，喝起来酸了吧唧的！不爱！临走的时候送了女士的首饰盒，+男士用的卡夹，离远看还是很高档的！环境很好！氛围也很好！不抱着挑剔的眼光去看，服务还相当不错的！小贵！全文','320','2011-05-23 14:08:00',NULL),
	('140d3b86142664c126fb6ff966835930','379fd063154556506227d711a2c8c782','夜声','5',5,5,2,'先前过生日朋友请客去过，还赠送的红酒，和生日蛋糕，生日蛋糕超级好吃，服务员还给唱了生日歌；后来有和家人去过两次，不知道是不是我们点子背，服务员两次都将餐前赠送的饮料打翻在我们的身上，所以服务给了一般，真的没法评价。女儿非常喜欢巧克力拉瓦，所以每次带孩子都是吃过晚餐单点甜品，属实小贵哦，一人份就要78元，实在是无语，不过没办法孩子喜欢吃，希望单点是否可以考虑甜品的价格呢，别高的离谱就好。','307','2011-12-14 19:39:00',NULL),
	('1a7a17f6651a76acecf1e71774756524','379fd063154556506227d711a2c8c782','AIR1789','5',4,4,5,'和父母一起去的，他俩都不太喜欢吃带血的牛排，台塑的招牌牛排是全熟的，正好适合，呵呵。菜量很大啊，我们三人点了两份套餐，还挺撑得慌，甜点都没吃完。牛排确实不错，全熟了，却很嫩，吃起来很满足。服务很棒，不讨厌也不冷淡，可以帮顾客在汤里加现磨的白胡椒。环境挺暗的，安静，让人比较放松，哈哈，喜欢。','300','2011-09-17 22:47:00',NULL),
	('1d14e293fdd5ab1efa5015d74756ccf0','379fd063154556506227d711a2c8c782','麟淳心宽体胖因为吃','4',3,3,3,'沈阳第一家店，以前就听人说过，王品台塑超棒，看了价格，相信了。288元套餐，另外加10%的服务费，一般选手应该是消费不起了。套餐有九道精致餐点。蜜桃甜酒、面包、沙拉、汤、酸梅汁、主餐、水果盘、甜点、饮料。真的比西堤又高一档了。','320','2011-05-15 20:40:00',NULL),
	('1d476169438ca211f9354e1f02fed105','379fd063154556506227d711a2c8c782','kneilhan','4',4,2,4,'菜色就不多说了，王品的品质摆在那里，没说的。服务也挺到位，足够热情。台面服务员很负责任，技术也过得去。说的不够理想的吧，桌子太小几乎放不下盘子和杯子，座位太重不方面移动。也许是我没有坐到那样的位子，不过没有放包包和衣服的空间，不知道冬季客人们是不是要穿着大衣抱着包包吃牛排。这很没办法理解。PS：还是要谢谢店面赠送的小礼品，和得知是结婚周年纪念而给予的对待。还是会继续去吃的。呵呵，希望座位旁边能有个衣架。','316','2011-10-04 22:01:00',NULL),
	('1e1e1701012c4297ea41f90f381906bd','379fd063154556506227d711a2c8c782','小南丫丫','4',4,4,4,'【试吃/体验点评】没想到能这么幸运，嘿嘿，回头忘记买彩票了~~第一次来万象城，刚开业，人还不是很多，王品位于万象城4楼，位置在一侧把角，不难找到~~跟服务员说明了来意，被带到里面的大包房，环境很不错，很优雅，长长的桌面，柔和的灯光，用心的装饰，整体感觉很好~~服务也没的说，很细心，在点餐的时候会简单介绍菜品，同时也会询问顾客的口味，方便推荐，餐具撤的也挺及时的，总是环境跟服务都没啥说的价位：菜牌比西堤的简单些，因为只有一个价位的套餐，288套餐，外加10%服务费，所以相当于每个人人均300多，印象中单点一份主餐是170餐前面包：烤的非常好，配上银鳕鱼酱和小番茄很好吃，要不是考虑到后面还有很多吃的，吃这个就吃饱了，因为真的很像，而且小面包被放在盘子中用餐布包裹，还挺用心汤：我点的玉米的浓汤，甜甜的，我挺喜欢的，明虾的是酸的，所以在服务员跟我说的时候，我就放弃了，嘿嘿沙拉：本来想点皇家鲑鱼沙拉，但是被告知有很多芥末，所以放弃了，点了鹅肝，这是我第二次吃鹅肝，第一次给我感觉我就不喜欢，这次再试试吧，经过验证，我对鹅肝还是无爱啊，以后估计不会再尝试了~~主菜：我点的是海陆大餐，这样可以一份主食，享受到两种美味，我点的...台塑牛排+鳕鱼，个人认为女生点这个比较好，相对光吃一块大肉，这个不会太腻～～台塑牛排很美味，而且全熟的牛肉特别适合我，我吃不了生的或者带血的，鱼也很好吃，而且还不会发胖哦～～甜点：巧克力瓦夫，冰激淋和在巧克力制品里面，混合后一起吃，巧克力味道很浓，混合冰凉的冷饮，很不错～～饮品：点了个玫瑰的，味道嘛，很清谈，不过做的非常美貌哦～～真的特别美貌，哈哈主餐后有餐后水果，是几片西瓜+泥猴桃+火龙果，佐餐有酸梅饮品，很解腻，我都吧梅子吃掉了～～很不错的一家店，适合商务宴请，结婚或者相识纪念，情人节等，唯一美中不足就是就餐环境比较热，可能是没到季节，空调开的不足吧，其他都非常不错滴～～全文','0','2011-06-20 22:05:00',NULL),
	('0e2a3acc245525353c6ac92f60cc69fa','390feaa1e1f4f7c699d218da684041ee','蓝旗儿','2',2,2,3,'【试吃/体验点评】个人感觉石锅拌饭里的配菜很多，数了下有9种，香菇也蛮多的。不过说实话，味道很普通，算不上好吃，下面也没有锅巴。还点了一个明太鱼汤，鱼肉还蛮好吃的，不过也挺少的，就4段肉，其中2段很小是尾巴和头那的一块，鱼汤里的配菜比较少。地热还是不错，不过店面很陈旧，最后结账喊了很久都没人来。','35','2012-01-10 17:13:00',NULL),
	('0c0769c70204f54a1a88934888a61b9e','390feaa1e1f4f7c699d218da684041ee','hydeist','3',2,2,2,'其实所有的韩国料理都差不多——菜色、味道、甚至服务这家店的量确实不错，性价比超级高，其他的烧烤类一般。有个鸡蛋羹好吃的，黄瓜拌牛肉的黄瓜和胡萝卜好吃但是他家的海鲜饼这类的和光华门差了不是一个等级','0','2010-05-27 23:26:00',NULL),
	('0c82fe6d4c2cea376697281b5a94b3ca','390feaa1e1f4f7c699d218da684041ee','S土狗S','3',2,2,2,'看了网上的点评说还不错，就来这里吃，感觉韩式风情还是蛮浓重的，要脱鞋进包厢里吃饭，里面的五花肉还是蛮好吃的，但是辣五花肉不怎么样，还贵10块钱。这里牛舌挺好吃的，但我带的几个朋友都不吃，不知道为什么。炒年糕里的海鲜条很好吃。另外饭前送小菜，饭后送水果，真的很不错呢。价格挺实惠的，不开票可以给你便宜点。','60','2011-05-29 19:24:00',NULL),
	('0ee85b7a6a31b4106ab97f189bc7f3ee','390feaa1e1f4f7c699d218da684041ee','kikiluck','4',5,2,4,'还是蛮喜欢到这里来，就是装修旧了一点，免费的小菜、蒸鸡蛋都很好吃。炒年糕、大酱汤、泡菜汤啊，味道还是不错的，最最最主要的是，它的烤肉量足而且价格也不贵，味道也是很不错的。不过最好还是带女生来吧，不然会给男生的脚臭死的，还有回去的时候，满身的烤肉味，呃，还是不怎么爽啊~~','50','2011-09-14 14:47:00',NULL),
	('112a46bac18b7a13a02b3d45320319d6','390feaa1e1f4f7c699d218da684041ee','粥粥TLL','0',3,3,2,'这里的菜的味道感觉都很像，上次吃的牛肉锅，干锅包菜什么的味道挺重的，盘着坐很不舒服，后来找了个桌下凹进去的地方，脚放在下面，感觉怪怪的。。。','50','2009-09-28 09:24:00',NULL),
	('1520bb7f601cc1b10a1edf7bdf2d5a86','390feaa1e1f4f7c699d218da684041ee','zj西米','4',3,2,2,'一直去吃的烤肉店，原来一直送炖蛋的，可能现在物价涨了，老板生意也好了，都不送了！炒年糕甜蜜蜜的，很糯~泡菜饼非常好吃~炒粉丝很入味！喜欢用炒鱿鱼的汁+泡菜+饭=拌饭，可以吃很多，价钱也不是很贵，以后会一直去的！','50','2011-06-10 20:58:00',NULL),
	('161869c297525446e5feb69ca191b650','390feaa1e1f4f7c699d218da684041ee','Ellie_zhang','4',4,3,3,'【试吃/体验点评】不错的一家韩国料理店，每次去都是生意很好的样子，地方没有特别大，晚上去吃的要早点，不然容易没包厢或桌子，他们家的好吃的招牌菜会贴在他们包厢的墙上，哈~','60','2011-06-13 22:33:00',NULL),
	('1ce29e462a21c771d861b5e0ec37211e','390feaa1e1f4f7c699d218da684041ee','candyair','4',3,2,3,'下班去的时候人特别多，因为就两个人就没点烤肉，吃了石锅拌饭，炒年糕，培根卷金针菇，土豆饼。但土豆饼是甜的，而且一上来烤的是有点焦了，就让店员重烤了盘，服务态度倒是蛮好，分量也可以，下次还想去吃吃烤五花肉的，希望能吃到有些网友说的赠送的鸡蛋糕哎说口味吧，也不知道正宗的韩国料理是啥味道，所以吃吃么都一样的，大家说好就好了呗，呵呵','60','2012-02-13 16:55:00',NULL),
	('1d042a9082126ae43339de9e23cd09f4','390feaa1e1f4f7c699d218da684041ee','jill_ding','3',2,2,2,'【试吃/体验点评】朋友一直推荐我去，后来有人请客就提议去了，很简单的餐厅，不是很习惯韩国人的口味，烤肉还不错，就是那个酱太咸了，炒年糕味道不错，强烈推荐。其它都觉得不是很出色，朋友喜欢吃他家的炒粉丝，我不吃粉丝的，所以不知道怎么样。不是自己喜欢的菜系。','40','2011-09-09 08:45:00',NULL),
	('09144d2836f7799e51704daf6e7e0628','39957decec6bafd3a7c3f705e9527424','大嘴chichi','3',3,2,3,'服务态度挺好，但是服务员的业务似乎不太熟练，都不知道自己上的是什么菜！加完咖啡都不知道把滴在杯边的痕迹擦掉！食物的味道一般！感觉不太值！','60','2011-04-28 22:06:00',NULL),
	('0e91ce9179acee05ab7ef449899392a2','39957decec6bafd3a7c3f705e9527424','花苦茶','3',3,4,3,'套餐里的牛排很不错，慕斯杯感觉就是奶油加了草莓酱太一般了，有点像罗宋汤的汤（名字忘了）还好，沙拉觉得哪的都差不多，咖啡和别的地方比也没喝出来特别好喝。另点了个烤鳗鱼饭，一般般吧，稍微有一点点的腥。还点了个特价的冰糖木瓜炖雪蛤，感觉就是椰奶的味道。东西总体感觉还好，但也没有说太好吃怎样的。环境很优雅，服务还行。','80','2011-05-08 14:06:00',NULL),
	('11231cab453f4ea061da7b59e8db39c5','39957decec6bafd3a7c3f705e9527424','water555cn','0',2,2,2,'对于口味和环境都忽视了，去了几次都是专心的听钢琴演奏，琴声营造了更好的环境。价格还是有些高，而且飞机的摆设也应该更换了。','100','2008-12-11 22:00:00',NULL),
	('19187520ffa84b565dd94b664632fc2a','39957decec6bafd3a7c3f705e9527424','giggledou','0',4,4,5,'有一次某人搞到一瓶品质很好的葡萄酒，那个年份的法国酒据说是不错 所以我们都觉得配牛排肯定美味，就来他家了，感觉在庄里可能还不错吧 偶点的菲力，要5分熟，我喜欢这样的，老妈说她可吃不了这样的，不过还是老了一点啊 还要了某人喜欢的蜗牛，老爸喜欢的鳗鱼，还有一个芝士焗的大虾，配的火龙果和菠萝，老妈说很好吃，水果入菜，酸酸甜甜很清口 还有一个海鲜披萨也还可以，沙拉调的汁爽口不腻 这里的服务员都挺机灵，服务意识也是超级到位 只是环境有些旧','100','2009-04-07 10:17:00',NULL),
	('19e5bbd84afc8f71b5bb3149d5b2c8c5','39957decec6bafd3a7c3f705e9527424','donghao2008','0',3,3,3,'燕春花园绿茵阁西餐厅位于中山东路195号燕春花园酒店2楼 ，建设大街口附近，应该算是石家庄比较厉害的地方了好多 单位或者代表团都是在这住宿呢！我其实也只有来过一次v 但是 给我的印象确实终身难忘啊！记得是我一个朋友在这里开会 他是在美国医药企业 辉瑞公司上班 说白了就是医药代表了 在这里开一个年中峰会 结果同学就把我也叫来了 真实安逸啊 其实我也不图什么就是吃顿饭 想改善一下生活 顺便也 见见世面呢!!!!真实别无所求啊！这里的西餐厅总体来说还是从不错的呢！但是我自己感觉还是有很多特别住处啊！首先觉得这里的环境特别的安静 没有一点嘈杂声，还有这里的地方很多可以同时几百人一起就餐呢 还有好多外国人在这里吃饭呢 叽里咕噜的说些英语也听不懂啊！呵呵！我最爱吃的就是这里的烤肉了 鲜嫩的很！','0','2009-06-04 21:34:00',NULL),
	('1df0f3dcd0f0bdb4ef7c24f0c9b7084e','39957decec6bafd3a7c3f705e9527424','吃饭就是正义','4',3,3,3,'整理抽屉的时候，发现了压在最里面的燕春花园酒店的金卡。就像很多桥东的饭店一样，绿茵阁也有很多年没去过了。生活中的一个小小改变，会带动很多其它小的改变，继而成为一个大的改变。我们可能因此放弃很多东西，不管是愿意放弃的，还是不愿放弃的。有此感慨，是因为看到这张金卡，想起当年一些经常光顾的饭店，现在已经很多年没有去过了（瞧，这个人，多没出息）。2003年，因为要陪一个长期客人，所以经常到绿茵阁就餐。在此之前，很少去西餐厅。这位客人长住在燕春花园酒店，把绿茵阁当食堂，只要不外出就餐，就在这里吃饭。当时的我对西餐的了解少的可怜，又不能失礼于客人，所以自己那份都不会点得太“复杂”，不是面条，就是米饭。好在那位客人也是吃便饭，因此我整天变着花样地吃面条、米饭，似乎也没露出什么破绽。当年同学、朋友们都刚毕业，大都在热恋中。听说我把绿茵阁当食堂，很多人向我请教西餐之道，方便带女朋友去吃西餐的时候，不会太丢脸。当我告诉他们，我整天在绿茵阁吃面条、米饭的时候，自己都觉得滑稽，听起来和学校外边的小饭馆没什么两样，只是少了炒饼而已。绿茵阁的迎宾妹妹们，不但漂亮，而且气质好。穿着质感似乎是棉质的长裙，双手在身...前拎着个小篮子，笑靥如花。我经常琢磨，如果能娶这样的妹妹当媳妇……还有那位弹钢琴的长发妹妹，一袭黑色丝质的长裙，弹着我完全听不懂，却听起来很好听的曲子……我偶尔会在昏暗的角落里，托着下巴，看着她的背影装深沉……至于那架飞机，我觉得放在那里是有些别扭……不知道现在还有没有。决定最近重温一下当年经常去的饭店，找到当年的饭伴，重温一下当年的感觉。但有些感觉是永远也找不回来的，那些迎宾妹妹和那位钢琴妹妹，现在都成孩子的妈了吧……秋风落叶……附注：文中之所以反复提到面条、米饭，是因为当年没有心思去记西餐的名字；现在能记住了，却忘了当年吃的是什么了……全文','0','2010-10-09 13:11:00',NULL),
	('00a72c78d27dba9fcd2e3606446852b9','39aca2130f49f6d8f9d2ed45548fe118','梦游apple','4',3,2,2,'大大的一个泡芙吃下去满满的幸福感~中间的馅儿吃起来凉凉的~有种冰激凌的感觉~最喜欢香草味的和卡布奇诺的~味道很好~','10','2010-07-11 14:19:00',NULL),
	('05076d6ad1583ec417ae58cc6bfb6dd8','39aca2130f49f6d8f9d2ed45548fe118','晒月亮的1一','4',3,2,2,'他们家泡芙很棒的 基本上路过就会买 不路过的话 绕远到过去买 比起其他家的泡芙 有一点贵 但是味道肯定也是比其他家的好的','0','2011-02-25 18:28:00',NULL),
	('053121205942a4af993ee4fc8e5acb75','39aca2130f49f6d8f9d2ed45548fe118','心茧2011','3',3,3,2,'给老妈和家里小朋友买的，去的时候没有客人，但是两个冰淇淋的泡芙加两个抹茶的，从制作到结账怎么也有5分钟了，服务员态度还可以，就是散漫点，慢悠悠的一边聊着天一边干活，以至于什么口味的都记不清还要反复问。','18','2011-02-17 13:28:00',NULL),
	('0827b582dcb7ff5e4c876639e4d21a8c','39aca2130f49f6d8f9d2ed45548fe118','零食_控','3',2,3,3,'味道还好 香草味的有点腻面很好 抹茶的味很浓 而且有点淡淡的苦味不是很喜欢 也许是各有所爱把 感觉这个泡芙有点大有点腻','0','2010-05-29 18:51:00',NULL),
	('0b9bd054fbb650c87d9f5f8421ce2d63','39aca2130f49f6d8f9d2ed45548fe118','杨夏至','4',3,4,3,'贝儿多爸爸吃泡芙很好的一家专卖店，我这种泡芙控一见如故，就是有点贵，但是泡芙也好大啊 O(∩_∩)O哈哈~。推荐抹茶和巧克力的泡芙，很好的吃哦，一家外带店，很干净。久光的这家一到晚上服务员就有点懒散了，不怎么搭理顾客了就。','10','2010-10-15 15:01:00',NULL),
	('0bd73816842827ac0ced27539ea076ff','39aca2130f49f6d8f9d2ed45548fe118','出走的向日葵zz','4',4,4,4,'当时看到大连有贝尔多巴兴奋了半天，每到一个城市，我看到有他家就会尝尝，北京，上海，天津，大连，沈阳。吃来吃去还是北京的最好吃。其他的都差一大截。可能因为人气不那么旺，很难吃到刚出锅的泡芙的原因吧。但是比别家的泡芙是好吃多了','10','2011-11-07 13:55:00',NULL),
	('0e4ec83b05ee0230b51a856d18b68a47','39aca2130f49f6d8f9d2ed45548fe118','EthanB','1',5,4,1,'【团购点评】好吃是很好吃，但是服务员实在太伤人了。之前去吃过，女朋友很喜欢，看见有团购果断买了。昨天去被告知没提前预约不可以使用，好吧，是我们不对，于是开始说软话，服务员还是不同意，问了原因，说一天就能做那么多，现在太忙了，好吧，当时只有我们两个站在那里，忙你妹啊！然后我们问不团购是不是就可以买了，回答是肯定的。很伤人，我认为搞团购就是为了招揽顾客，增加知名度，这样的态度实在让人无法苟同。','10','2012-01-16 11:28:00',NULL),
	('0eb1a836537daab1f17df9ebc6b75998','39aca2130f49f6d8f9d2ed45548fe118','stella23','4',4,3,3,'比一般蛋糕店里卖的泡芙要大很多，里面料很足，一次一个人吃一个就够了。要的抹茶口味，口味比较醇和，感觉冰冰的，挺好吃的。','10','2011-11-09 12:44:00',NULL),
	('0ee5df9919120629ad7bbb9cbb66d134','39aca2130f49f6d8f9d2ed45548fe118','nana99990','5',5,4,4,'最爱抹茶泡芙，用的日本的宇治抹茶粉，很正宗很美味，卡布奇诺也不错，不是很甜，但咖啡味十足，吃的时候要碰运气，有时候内陷很多，有时候就超级少，总体来说还是不错的','10','2011-12-31 17:56:00',NULL),
	('0f53428152b2fbc8addbd2604e867cc1','39aca2130f49f6d8f9d2ed45548fe118','蝈蝈吃糖','4',4,4,4,'一般来说，一个月吃上个五六次这里的泡芙，我比较喜欢吃糖食，有时工作累了，神经太紧张了，就需要来这里消费一个泡芙来缓解一下压力。香草泡芙、原味泡芙、抹茶泡芙、黑曲奇泡芙、可可泡芙统统吃过，最爱的还是香草口味儿的，抹茶的觉得不够甜','0','2010-06-24 15:19:00',NULL),
	('0feddbe075eb2527619a0600e5a2022b','39aca2130f49f6d8f9d2ed45548fe118','ZHANGSIFAN','3',2,2,1,'貌似是大连地区第一家啊，服务员老牛B了，鼻孔都朝了天了，刚开的时候人不多给的卡仕达酱还蛮多，现在基本处于一口没咬到馅儿，再一口咬过头了的情况。黑曲奇皮烤的巨小，就跟得了肝硬化一样。巧克力蛋糕泡芙就是把泡芙切一半加个卖不出去的熔岩蛋糕，糊弄鬼呢简直。','10','2010-10-30 20:06:00',NULL),
	('10acf458c3d45095bb41e41795d1457f','39aca2130f49f6d8f9d2ed45548fe118','杰西卡的猫','5',5,4,3,'看韩剧的时候知道的这个牌子的泡芙,刚知道在大连有店的时候就去小试了一下.价格比一般泡芙贵些.泡芙皮很酥脆,内陷冰冰凉凉的,甜而不腻,吃得出原料是有质感的.喜欢原味和抹茶口味.特别提一下朱古力熔浆蛋糕,是我吃过的最浓郁的巧克力味之一,下次还愿意再吃,赞!','18','2010-09-24 15:48:00',NULL),
	('10b6d5ce6d1c8922657631470f2d0d4e','39aca2130f49f6d8f9d2ed45548fe118','刘小彤2337684646671','5',5,3,4,'特别喜欢贝尔多爸爸的泡芙。一大颗，很多种口味可以选择。每次路过多尝尝不同的口味。每次咬下去，馅料就要喷出来的感觉。他们家的冰淇淋泡芙非常不错。酥松的外壳包着冰凉的冰淇淋，甜甜的也不腻人，吃泡芙的新感受。','0','2011-07-01 12:03:00',NULL),
	('10c75287f88d931ce2d44eec73ca19be','39aca2130f49f6d8f9d2ed45548fe118','天边ying','4',4,3,3,'大爱甜食 这家很对味觉得可可味的冰冰凉 味也很正反而大受好评的香草味不怎么对口冰淇淋的只顾着着急吃了觉得没可可的好吃反正就觉得可可的好吃拉~布丁就不怎么纯了这个不推荐~吃过最纯的 是在沈阳伊势丹楼下一家推荐那里的布丁~！','15','2010-07-18 17:01:00',NULL),
	('12665c3a0bc5287eb839e0ab6ae534aa','39aca2130f49f6d8f9d2ed45548fe118','flowzsy','2',2,3,3,'每次去北京，都要去西单的大悦城吃这个泡芙，后来发现大连也有了，就兴奋的买了一个香草的，发现跟西单的差距很大啊，又甜又腻，从此以后再不涉足，555','15','2010-08-09 12:05:00',NULL),
	('12df748797132d2e25810c11aeb5cff0','39aca2130f49f6d8f9d2ed45548fe118','Ondulation','4',4,3,3,'这几泡芙店关注好久了，上周终于去尝啦！挺好吃的，皮子挺脆的，芯子味道也挺浓郁的，而且还不腻，很喜欢。希望大家都去尝尝啦！','0','2010-08-22 07:38:00',NULL),
	('18828c3f56a56b4c45029e632ff3d1cd','39aca2130f49f6d8f9d2ed45548fe118','Roxiew','5',5,5,5,'【点评团消费】爱吃甜食的我怎能错过这美味的泡芙啊~个人觉得是大连最好吃的泡芙 料足而且好吃 服务很好的~团购了一次没预约 店长还是给我了~(*^__^*) 嘻嘻…… 大爱抹茶！香草的最经典！冰淇淋的也很好吃 黑曲奇的我也喜欢~总之口味很多总会你喜欢哒~','10','2012-01-17 15:28:00',NULL),
	('03991cdcb49104a39f2c856db8aa8acb','3be2bb1ae3c88152a1e97058db2943bb','童枝鸟','3',3,2,3,'来这儿参加四姨的生日宴，第一次来，大厅里意外的火爆，好像大食堂，食客都是高谈阔论，撸胳膊挽袖子的。服务员脚不沾地的跑老跑去，生意很好。因为吃中药，几乎啥都不能吃，还好表妹做了非常好吃的生日蛋糕，水果馅儿的，靠这个填饱的肚子。挑了能吃的炒杂蘑、炸鲜奶尝了尝，没什么惊喜，其他的菜看大家吃的兴致缺缺，应该是点菜的人点的不对路子了，突然想起了某人的话：点菜真是门学问，点什么，怎么点都得动动脑子啊。希望再来的时候能点对菜。','50','2011-12-12 19:06:00',NULL),
	('073985f414c857a3518327854e1b61e0','3be2bb1ae3c88152a1e97058db2943bb','蝈蝈吃糖','4',4,4,3,'和同学聚会，来到了东海明珠美食城一聚，多年不见的老同学。。。。。点了这里的海蟹，海螺，和龙须菜，真新鲜，海鲜就是吃的一个鲜劲儿，龙须菜做得爽口，好吃.特别要提到的是自酿啤酒，多喝点儿这个行，生啤还消食减肥','0','2010-06-24 14:17:00',NULL),
	('08fc621afa37c40102752337987e7f09','3be2bb1ae3c88152a1e97058db2943bb','神SE菜菜籽','4',5,5,5,'气氛很好，东西很新鲜，出了新鲜，菜样也很有特殊推荐菜: 东海凉菜 龙须菜 炸棒鱼 飞蟹 核桃芝麻露 面条餐厅氛围: 朋友聚餐 家庭聚会餐厅特色: 可以刷卡','100','2011-01-21 17:47:00',NULL),
	('0f41ab3034a0c7d896563c46844cd719','3be2bb1ae3c88152a1e97058db2943bb','8294750','4',3,3,3,'很久前去的，记得价钱好像不贵，大厅的自酿啤酒很便宜，但是在大厅坐着感觉很吵很乱，菜味记不住了，中规矩中吧…………','0','2010-11-02 21:28:00',NULL),
	('13d4c62e5821fc599d8b5ff993b43179','3be2bb1ae3c88152a1e97058db2943bb','紫璇飝羽','4',3,2,3,'经常去的一家，总体不错，价格合理，晚上必须提前预定，鲍鱼捞饭捞饭汁香浓重点推荐一下，唯一不足的就是菜量稍微少一些。','0','2011-09-10 22:35:00',NULL),
	('14015422b811ebaca05e8f4112a3c82f','3be2bb1ae3c88152a1e97058db2943bb','马略卡的阳光','4',4,4,4,'别人请客，不知道花了多少，应该不少吧。点的都是很好的海鲜。炸蚝皇，螃蟹，粉丝扇贝。。挺新鲜的，还有自酿的啤酒。不过我没喝。','0','2010-05-16 17:08:00',NULL),
	('156b4ec3eb58fcc4c5524f89bd61f9da','3be2bb1ae3c88152a1e97058db2943bb','耀天使楠','4',3,2,5,'提到他家 不得不说两大经典 海鲜的新鲜 和 啤酒的便宜 ：）据传他家有自己的船 但从大连街 若干海鲜酒店得到的消息综合来看 能到黑嘴子 或者 三八广场早市 优先挑鱼 那就算是很大的面子了 ：）故这个先存疑 呵呵公道的说 鱼生贝类 确实很新鲜 从这个角度讲 只要原汁原味做出来 保持住那份鲜香 就很赞 他家新鲜度这一点 可以打4分半；包间 设置最低消费 在一些知名酒店还是有的 但是不免有些店大欺客的味道啊 ：） 现在这世道 10几个人定包间吃不上1000 未免太小看大连人民的消费力了（尽管挣得确实不多）自酿的啤酒 是个亮点 分黑黄两种 大厅周一到周日晚上五块 中午2.5元貌似 周六周日 包间点的话38 一扎 周一到周五包间反倒便宜 ... 泡沫很细腻 夏天的时候 三五好友 弄上几扎 消暑凉夏 不亦乐乎 ：） 初尝的朋友少来点 那东西多少有点上头 ...p.s 他家5：30之后大厅就不给留座了 要去的话要早点','60','2010-04-12 13:13:00',NULL),
	('170231c5d54f5fc5c3a8a99a0908ea0c','3be2bb1ae3c88152a1e97058db2943bb','cookie163','5',4,3,4,'中午去的，自酿啤酒满满一大杯，喝着还挺爽，呵呵~~海鲜做的味道还不错呢，价位也比较合适，挺适合人多过来吃的~~客好像一直都挺多，我们去的早，到了饭店基本也都满了，需要等位~~','65','2011-07-24 10:12:00',NULL),
	('1b08e0ea2dd32e348d048a24ccd6d659','3be2bb1ae3c88152a1e97058db2943bb','小懒猫儿儿','3',2,2,2,'看了其他人的点评才去的。不过昨天去吃的，没那么神乎。不是我吃过什么好吃的，是物没有所值。点了瑶柱鲍鱼，这个不错。大丰收里面的海参可以，其他的都不太鲜，口感不怎么好。清蒸海胆，海胆不肥。自酿的啤酒不错。金针肥牛，这是我的失误，把其他菜品的味道都压过去了。小汤圆玉米，不错。2人花了316元，菜大部分还可以，但要是在我家留下的菜馆，点这些菜撑死了200多。排场挺好，适合商务宴客。自己的话就算了，不实惠','158','2011-11-03 12:28:00',NULL),
	('02158511a3feda46c4e6b788e129e136','3cd1b95ac457f323a977a6c527875b17','browning1314','4',3,3,2,'去过几次，菜品口味不错，广式尤为可以，另外一些中餐适合老年人，其他自助餐这方便比较缺。刺身台几乎都在排队，不喜欢这种，后来蟹也限量了，就更不回去了。甜品不错，奶茶不错，海鲜台也不错，不过人一多就混乱，我点去加工的不知上了谁的桌，给我拿来的不知道是谁的菜，还有如果坐2楼要很跑几趟，因为盘子都特别重，好累哦。吃个饭干吗那么辛苦啊','0','2011-01-16 23:16:00',NULL),
	('03d8031d9c8086d8ea29d35f564e049c','3cd1b95ac457f323a977a6c527875b17','xxjsw','4',4,5,4,'菜品很多，堂子也很大，中午11点去的，人还很少，没有一会就基本坐满了。说说菜吧，我觉得很新鲜，毕竟人多嘛，而且选择很多','128','2011-07-26 22:33:00',NULL),
	('0baa846ff8bb6d421929925e4af60833','3cd1b95ac457f323a977a6c527875b17','Alocasia53','4',2,2,3,'朋友给的评价很好 于是就和她一起来了 在沿海地区长大的小朋友对于仁和的海鲜吃的表示毫无压力 为什么你们会觉得好吃！！！！！！美味点在哪里！！！！！！！哈根达斯冰激凌味道选错了 所以也不好吃 平常很爱的刺身在这里也....但是烤的小面包 不错 甜点也有很多','98','2011-03-29 08:12:00',NULL),
	('14d9ae3c486a470df33471edb228ffb0','3cd1b95ac457f323a977a6c527875b17','tim8301','4',3,4,4,'仁和春天啊，高档地方啊，买不起衣服，还是吃得起自助哈种类相当多，相当多，但是海鲜比较少啊比较少，没法现做的牛排很好吃，可能是自助里面最好吃的，呵呵，羊排也不错。三文鱼要排队啊，不厚道，每次几片，打发要饭的。中餐中规中矩，没啥特色哈根达斯只能取一杯，不厚道啊不厚道总的来说，环境一流，菜品很多，好的没啥，海鲜不够。','0','2011-07-18 16:43:00',NULL),
	('18ee99377a39500bacce7767fb9261ec','3cd1b95ac457f323a977a6c527875b17','电风扇啊电风扇','3',2,3,2,'朋友给了一张美食荟的卡。说可以去吃下午茶                                                                                   中午，我没有吃饭，想到我曾经在春熙路的伊势丹8楼吃的下午茶那么饱。我要总结经验，争取扶墙进，扶墙出。                                                                                             下午茶是58元一个人。                                                                                             地点在6楼                                                                                            时间是：2点到5点                                            ...环境：  确实不错哈，大厅很大，有2层楼。中间的中岛位置空间很大。搞晚会气氛很好滴  吃滴：  说实话，好少哦。和圣悦庭西餐厅同价格，的下午茶比较起来。。。真的逊色太多了。。。。  水果只有3种。橘子、西瓜、金桔。。。金桔咋个吃嘛。。。。唉             只有慕斯的小小蛋糕还可以吃。。  这个58元的下午茶。。。我觉得我自己花钱来。。。绝对不得来哈  环境很好。居高临下，可以看到草堂路的大堵车。。。。全文','58','2010-12-31 17:49:00',NULL),
	('1d230f0abd3bb58c85ff3030a9717915','3cd1b95ac457f323a977a6c527875b17','我爱冬至','3',2,3,3,'【试吃/体验点评】这里的环境挺不错的。但是三文鱼每次都是限量，拍长队，等很久，吃着老是断气。虾比较多，还算比较新鲜的。甜点的种类比较多，感觉不是很精致，味道一般。拿哈根达斯也是人很多，而且只能拿一个，唉~~~~感觉性价比没有银鲨高。','98','2011-06-08 00:05:00',NULL),
	('02cd5ee9998d49774decb6253df168b9','3d4567ff5d5ec222465cd0bf09ceefb2','瞄子','4',2,2,2,'我觉得这里还是蛮好玩的，里面各种奇形怪状的瓜果蔬菜，还有大棚里面的蔬菜也很好玩啊没在里吃东西，不知道怎么样。不过挺有意思的','50','2011-09-09 14:58:00',NULL),
	('088611c013de55f4ad8e5da172f832d1','3d4567ff5d5ec222465cd0bf09ceefb2','fairyeva','4',3,3,2,'单位组织活动来参观，是冬天出来玩的好地方，吃饭的地方也很好，菜量大，好吃还实惠。就是采摘很贵，草莓虽然好吃，40块钱一斤的价格让人不太能接受','0','2009-12-20 23:11:00',NULL),
	('121acacc3ea6714664f8c9555433bfd2','3d4567ff5d5ec222465cd0bf09ceefb2','闪亮2010','4',2,3,3,'门票三十，托当地店老板买优惠价24元。停车免费，面积较大，采摘瓜果区的价格很便宜，小西红柿一角钱一个，真值！游玩的设施比较多，民俗大院里的展览值得一看。总之，还是很值得一去的！','30','2011-07-25 13:06:00',NULL),
	('10a4bf80d436b529805abe6cffb3fa65','3d4567ff5d5ec222465cd0bf09ceefb2','cici_不怕不怕','4',3,3,2,'黄金海岸的第一天是相当的无聊，所以我们决定，第二天无论如何要找个地方玩上一玩集发观光园还算是个景点吧，17个人雇车花上200元也OK啦汽车向北行驶，过了戴河基本就到了。经司机讲解我们才弄清楚，就是这条河划分出了鼎鼎大名的北戴河和南戴河进入观光园，先是一些植物大棚。参观、拍照都是允许的，凭票每人还能获赠根黄瓜啥的，采摘可是不划算额....对于我们这些四体不勤五谷不分的农盲，黄瓜、小西红柿、香蕉还认得出，火龙果之类的如果没有说明，肯定误以为是什么新鲜玩意啦....o(∩_∩)o 哈哈有个收费的蝴蝶馆，参观为辅购物为主。我们这里的两个小男孩每人买了一盒，蝴蝶在太阳光照射下受热翅膀会扑扇舞动。为了给两只蝴蝶的生命力比个高下，一路上两个孩子时时拿出来在太阳下照，可怜的蝴蝶没坚持到午饭时间就双双OVER了。。。。接下来是个游乐区，娱乐和运动设施都不少~~~~这里蹦极的安全系数比较高，吊索设计的长度刚刚好，不会离水面和跳台太近。不知道是不是这个缘故，那天蹦极的人踊跃着呢，一个接一个（而且不乏女中豪杰！），人们的惊呼一阵接一阵，最为勇敢淡定的那位在空中还不忘摆pose呢~~~当然，安全第一的理念下挽起裤腿下池塘去摸摸鱼、玩个...电瓶车、走趟吊桥、看看狗狗的表演或者只是静静的坐在湖边赏荷，同样乐趣无穷的哈~~~~再接下来....约定的两个半小时到了，没有到农家院、没看到几米长号称世界之最的丝瓜、没有买到现磨的香油和麻酱....据来过这里的人讲我们仅仅游览了生态园的1/5值得一提的是生态园里的物价比较便宜，黄金海岸街边要10块钱一斤的黄桃这里只要5块钱，袋装的紫薯干圣女果甚至比天津市里散装的还要便宜，观光园外的饭馆卫生、服务、口味、价位也都好过黄金海岸的。。。总的来说，来这里的话对景色的要求不能太高，作为亲近自然、放松休闲则是个不错的选择全文','0','2010-11-07 22:02:00',NULL),
	('136eb641979ae264243aa7f111035cfe','3d4567ff5d5ec222465cd0bf09ceefb2','小小寄居蟹','0',3,2,2,'一般去集发玩的时候，中午就在里边吃饭了去了几次都要点那个大菜团子，外边玉米面的，里边萝卜馅，很养生小鸡炖蘑菇什么的家常菜也都比较好，因为还是上学时期去的，所以点的都是价位不是很高的菜，口味都还可以里边有两头驴在那拉磨，现场制酒，曾经小尝了一口，很香的粮食味集发倒很值得一逛，尤其是春秋季节，可以边吃边玩','0','2008-12-26 14:24:00',NULL),
	('1bfd0a1454126024ff82fd35961c68e6','3d4567ff5d5ec222465cd0bf09ceefb2','一起美好','4',4,4,3,'去过n趟了  好像每个同学来都是去那里玩的  大概去了4、5趟了呢  还没玩够呢  里面的东西差不多都玩过了也 可就是觉得看不够 还可以在里面吃饭  农家饭 老好吃了 还有窝头玉米饼  蔬菜大丰收 都有家乡的味道  为什么好多同学来都去这里呢  因为这里不但便宜还超值  地挺多的  还有好多好玩的东西 有一次我们班一块出游 不过我没去 我都去过这么多趟了 再说他们都是十一之后去的呢  你知道不 去秦皇岛过了十一就是冬天了 而且那年下雪下的比较早  大冷天的 植物啥的都连叶子都没有了 你说去有个啥用  一次很好的跟班里人沟通的机会我就这么错过了  不过听他们去过的都说不好玩 因为毕竟是冬天 建议大家要是去的话就五一去  或者十一还行  里面还有个小动物园呢  见到了孔雀骆驼 还有小狗拉磨 很有意思的  还玩了摩天飞轮 特刺激 还有疯狂老鼠更好玩  吓得我同学直叫呢  嘿嘿  大家没事了可以去下嘛  又不贵 还有时候免费呢  看点得','15','2011-09-23 15:24:00',NULL),
	('0390895f062b0004dd904adaabc31fd0','3f7e6f3680cc4fbbaf496fa2d2c50fcd','南宝贝55','1',2,1,1,'开业第一天去的，吃的东西先不说。环境和卫生就让人没有了一半食欲，再加上服务员好像没有什么工作热情，态度就是应付差事。点餐时是个好像接待员的女生，摸样挺漂亮，妆画的也精致，就是那个态度实在令人讨厌。多要了一张餐巾纸，居然非常生气并且很用力地放进我的外卖袋子里。总之，对汉堡王十分失望，无论从食物的味道、就餐环境以及服务人员的态度都远不及其他快餐厅。','30','2012-01-03 16:56:00',NULL),
	('04032a3a65daa974b5509767dca050ab','3f7e6f3680cc4fbbaf496fa2d2c50fcd','思古乐','3',2,2,2,'人很多,很杂乱.主要是味道跟我想的差距有些大.汉堡是比别家要大一些,但是除了大一些,真没别的特点了.味道平平,我想以后都不会去了.','35','2012-02-04 23:08:00',NULL),
	('0acb55730ddbc5eecdc32f612897be83','3f7e6f3680cc4fbbaf496fa2d2c50fcd','kathywng','4',3,2,3,'大悦城刚开业的时候去的 天津终于有了Burger King 人非常多当天的超值套餐:五寸汉堡皇+可乐+薯条+一对翅+额外一对翅=37元','0','2012-01-15 12:57:00',NULL),
	('0a0f6e3015c846f4e9bf716ec324f8ec','3f7e6f3680cc4fbbaf496fa2d2c50fcd','网络上的虫子','4',3,2,2,'大皇堡确实不错，配菜很丰富、特别是洋葱圈很提气，牛肉也是经过腌制的，味道的确高于M&K，另一个是什么鸡腿堡，也不错，类似于麦当劳的板烧，只是口味偏咸，还要了一些薯格、心地、布朗尼、蔬菜沙拉，都没什么特色，服务员点餐配餐都挺慢，室内温度也低，穿着外套还有点凉。','40','2012-02-02 17:13:00',NULL),
	('0b230e479cf466538b7321951981edbc','3f7e6f3680cc4fbbaf496fa2d2c50fcd','BOBO艾','2',1,2,2,'期待了半天的汉堡王居然是这样的 真的挺失望的 那么一个小汉堡 那薯条 难吃死了 价格比M KFC 贵点 口味真是不如这两家 甚至不如学校门口小卖部的好吃~~~以后不回去了~','30','2012-01-04 19:22:00',NULL),
	('1094e996da8a0507a6e57603861fff4f','3f7e6f3680cc4fbbaf496fa2d2c50fcd','SY窝窝头','3',2,2,2,'以前在其他城市吃过，天津第一次有就好奇的想尝尝，中午排队人很多，皇堡是特色，我觉得一般。听说蘑菇芝士好吃，不过个子好小啊，味道还可以吧。要薯格没了，要巧克力奶没了，真是只剩下汉堡了。真觉得什么吃的一到天津，就都会缩水呢！','30','2012-01-04 18:02:00',NULL),
	('135d1505fc4701cb1fd86b6e3f269b99','3f7e6f3680cc4fbbaf496fa2d2c50fcd','VINO29','4',4,2,2,'LG之前就吵着要吃汉堡王，这次大悦城开业，正好圆了他的心愿哦。店面不是很大，也或许是人太多了，买了套餐之后才发现根本没有地方店内就餐，还好店外面有几个餐桌。LG一直是汉堡包的忠实拥护者，他评论味道的确很赞，我自己还真没吃出来。','40','2012-01-30 12:57:00',NULL),
	('183da4f0f0fdace0e3423cd17cd9fee6','3f7e6f3680cc4fbbaf496fa2d2c50fcd','欧若拉_1983','2',2,1,1,'本来挺开心天津也开汉堡王了，但是第一次在里面吃薯条吃出了一根铁丝，还直接扎在了上牙膛上，还好扎在嘴里面了，要是直接咽下去了。。。。。里面很脏，很冷，服务差。拿出了铁丝叫来了服务生第一句就是“不可能从我们的食物里吃出来的”。不过还是在我马上发火之前免单了，送了张贵宾卡，不想再用了。再说食物，点了好几种饮料，都回复了两个字“没有”','50','2012-02-06 16:07:00',NULL),
	('1a4669fe238f4a53bdc891f8488a0d99','3f7e6f3680cc4fbbaf496fa2d2c50fcd','小懒Jelly','4',4,4,4,'点的经典的套餐  大汉堡鸡翅薯条可乐  汉堡料很足  比麦当劳的巨无霸要好吃（我喜欢里面的酸黄瓜西红柿还有芝士）而且一般女生吃吃不了一个大汉堡的  鸡翅很辣很辣  我不喜欢辣的-_-!  薯条味道也不错  现炸的拿过来还烫呢  下次再来尝尝其他汉堡≧﹏≦','37','2012-01-30 00:18:00',NULL),
