	('07537930af825eba03276da648073cca','41ffdc459f871d12bfa532134ad6675b','昭原','0',2,2,2,'去过两次，都是吃的火锅。因为同学有那会员卡，所以老被拖着去。其实对这个地方不是很感冒，觉得其实要吃火锅还不如去翠峰苑自己点着吃，这里吃，人一多就不划算了，5个人去就得200+了，自己点还能吃得挺好。服务员简直就在放空，要叫好几次。麻酱给我的感觉也不好，还有饮料什么的，没有一点大家风范。总之印象不好啦！除非被拖着去，不然肯定是不会去的。','39','2009-10-07 10:43:00',NULL),
