	('16a31d10459a79708f271447534c4fc7','41ffdc459f871d12bfa532134ad6675b','李小珀','0',2,2,2,'团委活动去的，前一节的内容是滨海路徒步和小型拓展，可想而知，大家的声势有多浩大、战斗力有多强！火锅/烧烤二选一，当时选的是火锅。结果我们桌四位姐姐愣是把火锅吃成了麻辣烫，他家的火力不够旺，感觉肉很难熟的，又怕不新鲜，所以吃的大都是青菜和丸子，嘿嘿，他家的饮料好像有点掺水哦~服务嘛，还可以吧。自助要啥服务哇？ 唯一称道的是他家的蘸料还是很丰富的。','0','2009-09-13 19:26:00',NULL),
	('189e112693a31c11a71dcaf076e6e594','41ffdc459f871d12bfa532134ad6675b','卡哇伊*圆~~','3',2,2,2,'好久没有去过了，以前的去的时候还没有现在这么贵，味道一般，主要是肉太次了！这也是很过自助火锅的通病啊！比较适合男生去，女生不如去吃一般点的就可以了，平均下来价钱差不多1','39','2010-05-04 21:03:00',NULL),
	('18c73342f81b87b0fcf05b9f5ab95ba3','41ffdc459f871d12bfa532134ad6675b','绿皮辣椒红','0',2,3,2,'川江号子不再经营后这便是同学聚会去吃最多的地方 环境说的过去 味道一般 但大盘大盘的吃肉真的是过瘾 其他配菜种类不少味道优于锅底 尤其喜爱水煮鱼和锅贴 水果沙拉再放些玉米粒绝对和火锅是黄金搭档','0','2009-08-21 20:54:00',NULL),
	('196fd4385f8f97656e5515757509f49b','41ffdc459f871d12bfa532134ad6675b','mycarvolvo','4',3,2,2,'个人感觉挺好的，有烤肉还有火锅，随便挑，嘿嘿而且位置也很多，不过饭时的时候，还是要排队，生意很火的自选的东西样式也挺多的，填充的也挺快的没有什么特别好吃的，但是吃的很实惠','50','2010-11-22 23:28:00',NULL),
	('1b8ab14a596a8541543609f31d886ef7','41ffdc459f871d12bfa532134ad6675b','wzx207709','0',3,2,3,'有点类似于韩式自助烤肉拿生菜叶卷着肉吃桃罐头，冷面，很好吃肉的份量也好足忘记具体多少钱一位了现在每次路过都看到门口摆着一排椅子','35','2008-12-22 15:08:00',NULL),
	('1c3f62540c6bc6fd00ab0596badc5630','41ffdc459f871d12bfa532134ad6675b','daylay1','3',2,2,2,'都说他们家的海鲜比较新鲜，人流也挺多的，也算是大连比较有名的一家自助了，不过我是因为吃他们家的自助之后才决定以后再也不吃自助了，所以比较痛苦，但总体来说还行吧。','40','2010-12-11 21:24:00',NULL),
	('1d6f5f90b49f0bcb3ed0746c4767775e','41ffdc459f871d12bfa532134ad6675b','和壮壮的幸福生活','4',4,2,2,'喜欢偏辣口味又喜欢自助的朋友。这里是个挺好的选择。虽然说价钱一直在涨。味道还是一如既往的好。我很没出息的一直喜欢它家的黄桃罐头（汗！）。我去的几次都是吃的烧烤。因为朋友都说它家火锅不好吃。所以根本不敢尝试。烤肉的肉很实惠。每次都吃到撑。时间不同有不同的海鲜。有段时间的虾和蟹子。还有虾爬还是很划算的。。自选的品种不多但是味道挺好的。冷面不错。有一次因为BF拿冷面拿少了还吵了一架。哈哈。。饮料水对的挺多的。不喜欢！办会员卡十元。然后又优惠的。。也有日期限制好像。。','45','2010-03-01 16:15:00',NULL),
	('0216577af6e6f9eb5b11d4037d317a8b','425e6c17848322324521aa3ddf6e3bf6','wsylm','3',3,2,2,'因为就在单位附近，常去。口味吓比较有名，生意也一直不错，价格是长沙市的大行市，个人认为比南门口的几家更好一些。老板赚了钱应该装修一下了，环境一般。','30','2010-07-12 14:01:00',NULL),
	('0b2e3204173a17d2562f4ff133303aa7','425e6c17848322324521aa3ddf6e3bf6','莎莎和小暴吃遍天下','3',2,2,2,'离开长沙最后的一站美食点，也是点评网找过来，一路GPS导过来，连的士师傅都不知道这个位置，只能说口味虾在长沙很普遍，可能已经过了吃饭的点，饭店里没有那么多人吃饭 点了个口味虾，还有个花菜，老板不停的推荐啥海鲜汤，感觉有点忽悠的感觉。虾子很小，但是味道很重，真的很重，因为汤汁是鸡汤，所以很鲜就是这个道理，没有狠辣，估计不想太辣盖过龙虾本事的鲜味把，这点还不错。很可惜不是在龙虾的黄金季节来这吃饭，很希望看到长沙本地市民蜂拥来这吃虾的盛大场面，这才是美食的吸引力，也是寻找美食中想看到的！呵呵','50','2010-07-09 22:05:00',NULL),
	('0c173dc85f4f5523361486835fe41cee','425e6c17848322324521aa3ddf6e3bf6','无所谓有所为','0',3,2,1,'我住在江边，所以没有去河西的梅园总店还是偏远，所以就选择这一家了；午夜了，要了一份口味虾、一份口味蟹，其实就是麻辣小龙虾和香辣蟹，味道做的很不错，小龙虾都是先去了头的，蟹也是给壳子去了的，这样更容易入味，所以味道非常不错，辣，是那种湖南式的香辣，和其他地方的“麻小”还是有些不同；生意特别好，午夜了还是满满的人，很多人是露天位；服务很差，上菜很慢；环境马马虎虎，就是热闹呀。','40','2006-05-09 16:29:00',NULL),
	('0c5e6bd212432a0b5a8071d8c097de06','425e6c17848322324521aa3ddf6e3bf6','羽姐爱吃','1',1,2,1,'走的时候特地来吃长沙的口味虾，本来想去辣不怕的，司机不知道，这家司机也不知道（不知道长沙司机怎么回事，吃饭娱乐场所都不知道），不过想着离五一大道啥的近点，所以叫他开到八一桥这里我们自己找。   点了招牌的口味虾，什么老板力荐的蟹子粉丝煲，干锅花菜。先说口味虾吧，真的另我们很失望很失望，不辣，很油腻很油腻。吃得同伴说头晕。粉丝煲，没味道，量倒是挺足，不过全是粉丝，价钱比口味虾还贵！干锅花菜，唯一能吃的菜了，里面有腊肉，还比较入味。   由于这两天在长沙吃得太不爽了，同伴叫厨师把口味虾和粉丝去弄辣点，这样真的吃不下去。结果旁边的连伴娘不同意，在旁边摆张臭脸！什么服务态度，真是！！！在同伴的强烈要求下，厨师还是回去重新弄了下，不过没啥区别，还是很难吃。   反正在这里吃得很不爽！','50','2011-05-18 22:03:00',NULL),
	('11343e20fe3c1ecb25a16d4356e39e40','425e6c17848322324521aa3ddf6e3bf6','cartfield','0',2,2,2,'不便宜,建议要小份的多要几个,比大份的少点几个要划算.不觉得滋味有多么好,不如四嫒颉和杨眼镜的口味,炒菜的速度比较快,空心菜比较好吃','50','2008-07-14 09:34:00',NULL),
	('1297d6a60c84e4bbf63939f493e0f365','425e6c17848322324521aa3ddf6e3bf6','其实没有什么','0',2,2,2,'味道真的一般啊！不知道哪里那么多人喜欢去吃。反正我是不喜欢吃。朋友们也不喜欢吃的。价格也很不实在！','35','2008-09-29 21:52:00',NULL),
	('137bcff627d554f363bc13315797eaf1','425e6c17848322324521aa3ddf6e3bf6','shirley2028','4',4,2,2,'在长沙比较喜欢的一家口味虾店虾子比较入味锅子下面有韭菜垫底凉拌菜做得很不错夏天吃宵夜的好地方呢有个比较个性的下岗班臭干子叔叔会进来送外卖~臭干子还行就是酱汁感觉不够~','40','2010-08-12 12:53:00',NULL),
	('16baf840c0ab20d49bde6db2a6e74a3f','425e6c17848322324521aa3ddf6e3bf6','赤橙麒麟','0',3,1,1,'对于老梅园虾城芙蓉路店也个人点评哈！店面太小，出乎我的意料！服务员素质有待提高！口味虾味道还可以，小份30元的分量也还可观，只是可能不够卫生！我朋友吃啦后有点不适反映！田螺味道和分量都还可以！口味蛇的分量一般，吃来还可以！只是味精加的比较多。我觉得玉米羹的味道还不错，喝拉两碗！茄子豆角也还不错，比较清爽！','30','2007-07-08 17:08:00',NULL),
	('1ab1513ee0fb543f944987080fa8dae2','425e6c17848322324521aa3ddf6e3bf6','cherish.m','4',4,2,2,'其实那天找宾馆已经累得够呛了，又找这家店。然后发现，在找不到宾馆的时候，其实我离这家店非常近。崩溃掉了。一个人要了一盘扇贝一盘口味虾。然后奋战了大概两个多小时吧。。其间发现对面桌下一只劫后余生的小龙虾再爬。。之后一直阴影般地不停看自己桌下。吃小龙虾原来是件很累的活。。但是你会上瘾。然后话说回来，这还是我头一次无师自通地自己拨自己吃。之间想了很多事，很多很多。连公车都不坐地走了回去，买了好几瓶水，看书睡觉。很疲惫。','80','2009-12-30 18:41:00',NULL),
	('01602610dc1d1292d151c9227f9563e0','44438e9f244fe1f5d8858d993baa8a5d','Miss翟','3',3,2,2,'灰常好吃。芝麻酱的锅底非常浓郁。串串很干净。店里环境也不错。三个人大概消费50元左右就已经很撑了。口味很独特。推荐魔芋。很好吃。','0','2010-11-23 18:56:00',NULL),
	('054a923e7d9bf0165917fd07a1ce0b3e','44438e9f244fe1f5d8858d993baa8a5d','小脸烫烫','5',4,4,2,'老爸说很好吃，我很欣慰，希望家人永远开心幸福的在一起。豆皮跟牛肚是必点，喜欢吃粉丝的童鞋就不要点了，会浓成一锅稠的，嘿嘿。','50','2011-09-01 09:31:00',NULL),
	('0d0e9ead2e568f47884d2c45d0144a91','44438e9f244fe1f5d8858d993baa8a5d','Hello强强','4',2,2,2,'锅底是芝麻酱汤。香菜丸子非常不错，一人一杯酸梅汤，没有豆浆，而且不续杯。吃多了会觉得有些腻。牛肚吃着没什么感觉。整体还不行。适合三四个人，两人去吃总觉得口味单一。','30','2011-09-07 23:48:00',NULL),
	('15007f26537b6ba76e65cbee20b33d79','44438e9f244fe1f5d8858d993baa8a5d','凉怜木','3',2,2,2,'对这家店一直很好奇，某个中午，跟老公过来尝试。进店，有股很奇怪的味道，小小的臭味，呵呵。后来分析应该是芝麻酱的缘故。点了小锅，豆皮牛肚不可少，加了小份的甜不辣、鱼豆腐、还有大家都推荐的香菜丸子。生菜一份，川粉一份，土豆一份。送豆浆，比较淡，甜口味。很快，我们的小盆子就端上来了。先装了一碗汤，喝一口，浓浓的芝麻酱香味。这个锅底儿汁儿可是够浓的。哈。牛肚，厚厚片的那种，吃起来不错。豆皮很薄。香菜丸子有香菜的清香，肉也不少。我喜欢吃鱼豆腐甜不辣，哈哈。土豆川粉生菜都没有签子，在锅底。土豆煮的面面的，配着这个麻酱汤，吃起来很香的说。不过总是感觉，所有的东西都在这一个锅子里面，所有的东西也都成了一个味道。哈。看隔壁桌，几个叔叔阿姨点了两个大份，吃的畅快淋漓，最后还加了面。面是煮好了过来加在汤里面的。借着汤味儿，应该也不错吧。整个店面不小，有两层楼，客人也很多。不过我很奇怪，难道只有我觉得这个店内的味道是有点臭臭的么。^^|||','40','2011-02-26 09:44:00',NULL),
	('15d779ec4da2f39d7dca058306f4fdfb','44438e9f244fe1f5d8858d993baa8a5d','万物皆可抹茶','4',4,2,4,'我跟绿坝娘都是在西安呆了四年的人了，可是都没有吃过垂涎已久的西安名吃，豆皮涮牛肚，绿坝娘在建文上课的时候我们用点评一查，居然附近就有一家杨翔豆皮涮牛肚，于是俩人就兴高采烈的跑去吃了。这里的味道确实很独特，牛肚很不错，而且还有很多其他搭配的涮菜，吃的时候也没有吃火锅时身上那种味道，让我很欣慰。此外，这里还每人赠送一杯酸梅汤或者果汁，我和绿坝娘喝着酸梅汤的味道瞬间就想起来学校食堂了，还是很正宗的~','25','2010-09-07 13:09:00',NULL),
	('168730229991ab47b3a1ab1690eb5a6b','44438e9f244fe1f5d8858d993baa8a5d','qxrr','4',3,3,3,'好喜欢他家的底料，很浓的芝麻和花生的味道很特别，牛肚值得一吃，选好材料直接煮好端上来，配上红豆米饭，挺实惠，就是现在的优惠少了，要是能团购一下就好了','0','2011-07-04 17:14:00',NULL),
	('177cc4b17ed819fc2b4d3090200a1018','44438e9f244fe1f5d8858d993baa8a5d','王支支','4',5,4,4,'以前经常路过，但都没进去尝试。后来在DP上看到了评价不错就去试了几次。环境一般，有楼上楼下都可以就餐。一大锅子串串，直接在厨房做好了端出来就能吃的形式。底料是芝麻酱的黄黄的~~推荐甜不辣和豆皮。牛肚我个人不太喜欢吃，还有油麦菜貌似没洗干净，吃着有些沙沙的= =.!!红豆米饭还挺特别的，但没想象中好吃，米饭硬硬的也不糯。五谷薯条看着挺彩一盘，像彩色小糖豆似的，不过吃多了会腻，毕竟是油炸的。总体感觉很适合几个朋友没事去吃吃。','40','2012-01-09 08:09:00',NULL),
	('1b796e59113c71909a2da12bc53d350c','44438e9f244fe1f5d8858d993baa8a5d','若歆Mandy','3',3,3,3,'看到点评上很多人赞不绝口，所以一直想来尝尝~今天晚上就和老公来这解决晚饭了，一进店环境还是比较干净的，这点还不错~由于我们就两个人，便要了小锅，以及推荐的牛肚、豆皮、香菜丸子、金针菇、甜不辣等~刚开始吃好不错，不过越吃越感觉有点腻，感觉好像关东煮~可能是我的期望太高了，说实话多少有点失望，而且我们俩个人就吃了70多，真的不便宜啊~服务还可以，上来就送了酸梅汤，由于我们取得比较早，上菜还是比较快的~感觉送的黄豆和萝卜小菜还不错，挺解腻的~分量不小，我和老公都吃得很饱，感觉就是一般好吃的关东煮，没有特别惊艳的感觉~','40','2011-09-02 21:41:00',NULL),
	('0e0bdb5788752386c77b71374e9466fe','45799149f4f8fee368d1c23e6a131c36','白小乖吃苹果','5',4,4,3,'早就想和老公来了，终于这次老公来看我我们去了。六点多到的，等了大概20多分钟吧。本来想和老公拿了号去下面的苹果体验一下，结果一看等位的地方有西瓜有果汁还有虾片啥的小零食，我俩瞬间走不动了哈哈。坐那里下了三盘五子棋了！老公玩不过我哈哈哈~~~言归正传说吃的，服务态度还好吧，环境是中间有个紫色台子里面感觉很梦幻，可惜我们木有坐进去。。。。我俩要了小米椒爱上小公鸡，蟹黄豆腐，蓝莓山药，还有冰菊茶。老公吃了两碗米饭呢。小米椒爱上小公鸡，果然比我家那边的麻辣新语好呀！嫩嫩的小公鸡，越炖越焦香，酸酸辣辣很美味，而且配菜有杏鲍菇，恩，很给力！蟹黄豆腐也是我的最爱！配米饭超级好吃！且比其他地方感觉蟹黄用的多鸭蛋黄用的少~我还是觉得辣，所以蓝莓山药是我的救星！像冰激凌样的漂亮，只是，我实在不太喜欢他下面垫的水果，要么太酸要么太甜，还是上面的山药好吃！冰菊茶淡淡的，不怎么解辣，但是，杯子很有赶脚，老公爱不释手~嘿嘿嘿~点评卡说已经不能打折了~算了~下回想尝尝素香锅和麻香牛肉~嘿嘿嘿','60','2011-10-13 20:22:00',NULL),
	('1049cd934dc738033bb14e33901630fa','45799149f4f8fee368d1c23e6a131c36','karl6545','4',3,4,4,'服务很到位也很贴心，而且对自己的上菜时间很有把握。菜品味道也还可以。等座的时间也还算不长。总体来说不错，虽然有点小贵，但是还算值得','87','2011-11-20 23:24:00',NULL),
	('109d0ed643288491c60e03ba574868ad','45799149f4f8fee368d1c23e6a131c36','小色兔兔','5',4,5,5,'缺点就是每次去都要等上一段时间。川菜不是很地道，但是对于爱吃川菜的人，这里的菜很合口味不过我吃着还是不够辣最喜欢吃蟹黄豆腐和干锅土豆片，每次必点的两道菜酸梅汤很大一盅，4个人也够了是常来很喜欢的一家','100','2012-02-08 16:26:00',NULL),
	('129381ad6a5c6f2ca0b678e2c396da33','45799149f4f8fee368d1c23e6a131c36','turenshen','4',3,3,3,'以前在上海吃，觉得就是味道不错，环境优雅，服务还行的地方，天津也差不多，蜗牛依然很咸，其他菜辣的比较够味。服务我觉得一般，说是春节缺人手，哎','80','2012-02-06 23:24:00',NULL),
	('138fc7030d7f83e1b8d5111304910586','45799149f4f8fee368d1c23e6a131c36','食客大家谈1166','3',2,3,2,'【试吃/体验点评】总体还可以，有点小贵，这样的地方偶尔去一下还可以，味道做的感觉一般。总体感觉辣的味道比较浓，口感全部遮住了，不过爱吃辣的童鞋们估计一定过瘾了。','40','2011-09-25 12:48:00',NULL),
	('13cee122bec55ea6a6f2e1bd5e0500ec','45799149f4f8fee368d1c23e6a131c36','猫妮1007','4',3,3,3,'喜欢吃辣的同学们真是有口福啊，各种川菜湘菜馆都有，现在又有这种创新菜的饭馆。可惜本人不是特别爱吃辣啊，主要是吃不了太辣的...','0','2011-11-14 11:01:00',NULL),
	('1497d9bf3197cd2e99264af94a56c25b','45799149f4f8fee368d1c23e6a131c36','菜菜22','4',5,2,3,'周四约三五好友慕名而去，首先要说的是麻辣诱惑给人的第一感觉是进了海底捞，然后去找了座位，座位比较窄，不算很宽敞，感觉不好。点了酸梅汤、大拌菜、蓝莓山药、水煮鱼、麻辣诱惑蛙、小米椒爱上小公鸡、蟹黄豆腐和菠萝炒饭。水煮鱼味道可以的，蓝莓山药量小，大拌菜里有种奇怪的菜，味道有点奇怪，麻辣诱惑蛙里蛙不算很多，但笋很好吃，米椒炒公鸡可能因为是公鸡所以肉比较硬，蟹黄豆腐口味OK就是量小，小份的用小碗刚好分四碗，不如新煮意的豆捞量大。酸梅汤单喝味道还是不错的，不过配合辣味菜来饮用，总是觉得有欠缺，还是冰镇可乐比较般配。菠萝炒饭，饭粒较干较硬，不太顺口。总体来说没有传说中优秀，菜品味道还是不错的，但也未出新煮意之右；服务态度还不错，但感觉有点混乱，总不比海底捞来的殷勤积极（要点儿醋喊了三遍）；菜品走单一麻辣路线，没有什么特色，且价格偏贵……所以总体来说就给个四星吧，希望日后能继续提升。','100','2011-11-26 23:35:00',NULL),
	('1866dba7e811e012fe67989e5a5122ac','45799149f4f8fee368d1c23e6a131c36','salinely','5',4,3,3,'麻辣诱惑，确实很诱惑啊~~~~我们是已经听闻这家的大名了，只是一直没凑到合适的时间来大吃一顿，终于机会来了，我们拿着银子就过去了，点了个水煮鱼，我的最爱，味道很不错，后来觉得有点太辣了，点了个酸梅汤，不过吃的很过瘾啊~~~','0','2011-11-06 20:50:00',NULL),
	('1bf3bd89ad41e67cd65c4eeeb7894648','45799149f4f8fee368d1c23e6a131c36','fengwei0831','4',4,5,5,'开始：中午和朋友下载了优惠券就去了，到的时候拿号拿到10号，有象棋什么的，等了一小会儿就到我们了，环境不错，有点像海底捞的感觉，挺舒服的~点菜：点的水煮鲶鱼，服务小姐说只有二斤多的了，上来才发现我们根本吃不了啊；还要了个蟹黄豆腐，朋友说有点像上海菜，不过挺实惠的，我们要的是小份的；主食是泰国香米饭，这个是五块一碗，普通米饭两块，自然吃这个了，酱油炒饭看着卖相不好，就算了吧；饮料喝的酸梅汤，感觉还可以吧~口味：朋友不能吃辣，水煮鱼没要太辣的，不过觉得挺好的；蟹黄豆腐单吃有点咸，可能我最近口味有点淡吧；米饭很瓷实的感觉~价位：优惠券满一百减40，可不知道是不是满二百减80，所以结账是二百多一点，优惠完是190多，觉得有点小贵吧，看了看酒单，比一般餐厅贵多了，希望能改进一下吧~服务：服务没的说，上菜很麻利，给了个沙漏说是漏完还不上全菜就给礼物，哈哈，蛮新颖的~总体而言不错，分享一下，吃了很多水煮鱼，建议大家不要要豆芽，大家想想，一旦有了豆芽，鱼的分量自然打折扣了啊~','100','2011-11-25 19:10:00',NULL),
	('07ea74ce98581156bedc97a22372feb7','48fa81d00008eaa94196ea28ae766b3c','swowo','5',4,5,4,'久仰大名的西餐厅，皮尔卡丹旗下的。据说党政要人、国外领导都来这家店用过餐。虽然我也曾在蓝色港湾那家用过餐，但总比不上来总店见识一番。点的都是比较经典的：牛排、鹅肝、蜗牛。牛排点了五分熟，可是上来好像稍微火候多了一些；鹅肝非常经典，细细滑滑的感觉；蜗牛盘子好大，就是小了些，吃得不爽！不过再大可能就会变成田螺了，哈哈。服务很国企，服务员没事就在旁边聊天，影响了用餐环境；有人弹奏曲子，feeling很棒！装修很古典，很欧式，是我喜欢的风格！','400','2010-11-23 12:38:00',NULL),
	('0af0b616bbe6a5e9eac7b049bbb394cb','48fa81d00008eaa94196ea28ae766b3c','liulianmei','2',2,2,2,'贵~~但不好吃。。。。。。比我童年印象里的马克西姆差远了。。。。挺好得西餐馆居然谈着流行歌曲的钢琴曲。。。。：（失望。。。。。','450','2011-03-04 19:22:00',NULL),
	('0ed6bb87149387f9f01b4da7cc45c79e','48fa81d00008eaa94196ea28ae766b3c','寂静如烟','5',5,5,5,'环境好，幽静，浪漫的地方。我点的牛排，味道很好。非常喜欢他家的一种法国餐前红酒，是我喝过的红酒感觉最好的。炬蜗牛看着也不错。有机会还会再去。','500','2010-11-18 09:18:00',NULL),
	('115353b6c83da9c2dd41b82f568cd562','48fa81d00008eaa94196ea28ae766b3c','ankeenya','3',2,2,2,'和多年前去的那次相比感觉有了很多的变化。第一、或许是因为多年未装修的缘故吧，显得很旧，无论是房间还是桌椅，灯光也暗了不少。第二、服务员没有以前热情了。没变化的是客人还是那样的少。口味各有不同，这里不赘述了。','240','2010-12-09 15:32:00',NULL),
	('12ab2379465e662988eb70e8a8b89305','48fa81d00008eaa94196ea28ae766b3c','醉看云起','4',2,3,3,'马克西姆很早就在北京有店了，在崇文门路口西南角，新侨饭店马路对面。那时还很小，感觉它很西式，因为那时候北京的西餐厅很少，所以感觉很神秘。西餐很少吃，偶尔吃次，味道方面没啥感觉。','600','2011-03-07 10:15:00',NULL),
	('12b14f2ab43db7ec5c7d0c48f3b3dd03','48fa81d00008eaa94196ea28ae766b3c','jocelyngz','3',2,4,2,'不太明白它为什么这么有名， 菜做得是相当凑合，除了鹅肝比较滑腻，有种入口即化的感觉，其他菜品真的没打算尝试第二次。尤其是它最近推荐的小牛肉系列，用男朋友的话说，不如他在新世界超市买了半成品自己烤给我的好吃。。。一开始只有两桌人，除了服务员的聊天声音基本算安静，后来来了一队爪哇国的客人，噼里啪啦持续猛侃，我们就郁闷的退席了很变扭的一顿饭，价钱不菲，而且15%的服务费付的很不心甘。。。','497','2010-11-24 11:38:00',NULL),
	('18534819de1396bdb7f1d79a729469ca','48fa81d00008eaa94196ea28ae766b3c','牛牛_先吃后减','4',4,5,5,'过生日的时候爸爸请的，菜量蛮小的(还是我太能吃了...)，印象比较深的就是鹅肝和面包了，还有一个烤土豆片一类的东西不错，别的就没什么特别爱吃的了环境非常的好，适合重要场合~','430','2011-04-23 21:22:00',NULL),
	('00517f57d355671db73d99f97c4b00e1','49b10b3bfa3416e1d858f75dbbaef688','超级月亮最拉风','4',2,3,2,'跟女友去的，点的奇石咕噜鱼番茄锅觉得一般，没有鱼酷的好吃。不过有买一斤送一斤的活动，打算下次去尝尝烤鱼！','50','2011-12-24 23:22:00',NULL),
