	('0114fac12842a44f1248683728d5cadd','49b10b3bfa3416e1d858f75dbbaef688','椛蝴蝶','3',3,2,2,'【团购点评】怎么说呢，总体还是可以的，就是服务一般，环境也不是很好、不觉得对的起这个价位。口味还是可以的。团购的话还算合适。我们是正价去的。以后要稍做考虑了','66','2011-10-16 01:03:00',NULL),
