	('18aac8b03401f4821422561f774f7493','49b10b3bfa3416e1d858f75dbbaef688','佩漪','3',3,2,2,'在乐宾突然想吃鱼，结果进去这家店，烤的黑鱼，因为不想吃辣，结果点的那种过于甜腻了，恐怕不爱吃甜的朋友受不了。大拌菜也很甜，不知道是不是糖精的哦？！好在我个人比较喜欢甜的食物。','70','2011-10-05 14:31:00',NULL),
