	('1b0fd4653adb02af861dfcc5e01da4f8','49b10b3bfa3416e1d858f75dbbaef688','聿修桑','4',3,3,3,'【团购点评】由于是团购去的，所以只能吃麻辣鲶鱼，由于不能吃辣，所以要的微辣，但是还是把我们两人辣的够呛，要的A套餐，豆皮和娃娃菜太少了，米饭也太少了，根本不够吃。','25','2011-11-12 23:44:00',NULL),
