	('02306098cb274f2e00ca60ee48ff1b26','4b52c8d9ffe5afbf59ddc65b143375f3','馋嘴王子','0',3,2,4,'馅饼很好吃,建议你吃牛肉的.量大,便宜是宗旨``就因为这样,牺牲了很多菜的美味.我爱吃他家的玉米,做的很棒','0','2007-03-14 03:43:00',NULL),
	('049797a69d74c0978dbbe155fe1fe81a','4b52c8d9ffe5afbf59ddc65b143375f3','麦兜小武','5',5,4,3,'馅饼是一大特色 皮薄馅大 汤汁浓厚家常炒菜也还不错 价格依然适中 环境也不错 菜量大 服务也很好 锦州比较有名的几家特色饭点之一还是赞','35','2010-05-05 19:41:00',NULL),
	('09e93822fda5a776a7c15402ee088fd5','4b52c8d9ffe5afbf59ddc65b143375f3','郑小猴','0',3,3,3,'好像就吃过一次人民街的饭店总体都差不多比的就是各家店的特色香满楼就是馅饼吧啊~还有虾球，也还可以，但是吃多了不好吃','30','2009-10-15 17:03:00',NULL),
	('169a003134e20cf67ff81dbdb9e0b03f','4b52c8d9ffe5afbf59ddc65b143375f3','好梦rr','4',4,2,3,'馅饼做的真是好吃啊，罗卜馅，白菜馅，酸菜馅，糖馅，豆沙馅等等好多种，有时家里不做饭，就来这买馅饼，最喜欢吃的是三鲜馅，一块饼里放一只大大的虾仁，好吃啊。','20','2010-06-25 08:01:00',NULL),
	('1b8181cd775c2cb18ade039de3130f49','4b52c8d9ffe5afbf59ddc65b143375f3','starshipsea','4',3,3,3,'开车路过锦州住一天，去了宾馆附近的这家饭馆。两个人点了馅饼、奇味虾和胖头鱼，菜量很大，口味还可以，鱼炖的非常好吃，撑坏了。','40','2010-10-20 19:12:00',NULL),
	('1c043d2cba2dd65af6ac9bdf627cd0cc','4b52c8d9ffe5afbf59ddc65b143375f3','cactuszero','0',2,2,1,'貌似整个锦州的服务都不怎么样，所以也就不强求了。馅饼确实不错，个头不大。里面肉汁很多，感觉像在北京吃门钉肉饼，当然这里的馅饼不是清真的。涮锅就一般了。酸菜很不地道，基本上没什么酸味。','0','2008-11-19 11:20:00',NULL),
	('02a5f8665feda2175e9b494580e8b903','4eb63b090afda31d3b3faa8324013e35','yuhyc','4',4,4,4,'真的很有气派，之前来过好几次，都是同学聚会或是喝喜酒之类，基本是单独行动。上两个月，看广州报，介绍平洲一个什么地方的，是一条渔村，于是，开车走一环，去看看。经过兴业渔村。女儿在车窗指着说，是什么来的，像一座航空大厅，是不是什么体育馆之类啊？搞得全车人都笑了！姐夫说，回头带你去坐飞机！渔村实在是很小，但真的有几分古朴！回来时，姐夫真的把车开进了兴业，我说，好贵哦！他说，贵有贵吃，我们就吃些家常的吧！反正都要解决肚子问题！最高兴是女儿，说，原来是吃饭的地方，怎么那么有气派呢？干吗我们不多点了！里面真的金碧辉煌哦！五个人，四菜一汤，三百多块（姐夫买的单，哈哈！）感觉最好的是清蒸边鱼，真的把鲜味蒸出来了，而且很滑！这里的海鲜都不错！此外，真的对这里的服务很满意。服务员的工作很到位！','80','2010-11-06 09:14:00',NULL),
	('08543a67de2e2695a1a96247018c64a8','4eb63b090afda31d3b3faa8324013e35','jiljil','0',2,4,2,'系我爸爸以前既老细开既，经过过好多次，不过无入去试过听讲好贵，电视都经常卖广告，都好似好多活动搞，咩食神大赛吖果D。','0','2008-10-19 17:05:00',NULL),
	('09b2288592683cd3c8ca28972c58eaf8','4eb63b090afda31d3b3faa8324013e35','pjw66574','0',3,4,3,'装修真系无得弹！！！简直系金碧辉煌啊！～内外都甘靓 D野食都唔错既 不过拿来结婚就最岩········','0','2008-07-27 17:18:00',NULL),
	('0baeec60d88da463e48ff5af082ceea4','4eb63b090afda31d3b3faa8324013e35','Xmas_Candy','0',3,4,3,'呢间嘢，由佢开业食到而家，都有几年了，第一次去，就觉得好大规模，好似会展中心咁，然后，个设计又好似鳌鱼张大口，所以，我地全家都叫佢：大口扒。从广州过去，其实都唔系好远，过咗个收费站转右就到了，不过，最好自己开车，如果唔系就无谓啦！因为附近唔多见公交车。环境：呢个的环境真系一流，无论请客食饭，定系亲友聚餐，都唔会失礼人，够晒气派，D房又够大，提前预订，可以有十几二十人的大台添，呢样比较难得啊！食物：呢度的出品样样都唔错，水平比较稳定，个个菜都好味，而且卖相唔错，分量不会太细，但又感觉几精致！价钱：同广州比，呢度的价钱算中等啦，但系出品就算上等，所以，性价比好高，平均小炒类的都系20-30左右。如果有车的话，呢度食饭真系一个唔错的选择！','0','2008-11-05 21:08:00',NULL),
	('13bb36d323e01929cbf3735fd1b8537b','4eb63b090afda31d3b3faa8324013e35','flyhao','4',3,5,3,'举办宴会既好去处之一啦，地方够大，要排场有排场吖...D嘢出品都5错，味道还算系咁，比较5错架喇...有机会可以去试下架...','120','2010-01-01 17:35:00',NULL),
	('1439357532f9258c0e567949a13031ed','4eb63b090afda31d3b3faa8324013e35','lyachen','0',2,3,2,'兴业真系劲大，大得很夸张。作为公司年夜饭的选择非常合适，哈哈！房间装修不错，客人坐得都会几舒服。但是海鲜有大厅价和房间价，就因为坐房间而要俾多成一倍的价钱，感觉很不爽！从广州过去要经过平州的收费站，无形中也增加了吃饭的成本！','50','2008-05-11 17:02:00',NULL),
	('1bd78d64b4188c6446b2799426caf0ba','4eb63b090afda31d3b3faa8324013e35','2hand','0',3,3,3,'面前有个大型停车场,停车非常方便.我最喜欢的是特价水蛇,焖粉葛比较好吃,不过坐大厅才可享受.座位比较多.','80','2009-07-21 23:31:00',NULL),
	('1871869cb14706aef576dfc0c1b84c15','4eb63b090afda31d3b3faa8324013e35','doureimi','0',2,3,3,'会议结束到这里就餐，环境很不错，外观就像会展中心一样，一点也不像食肆啊……里面挺宽敞的，食物就一般般吧，服务OK。除了装修，没有什么特别可以称赞的地方。就自己私人用餐不会去，挺偏僻的。适合商务宴客。','85','2009-04-14 08:33:00',NULL),
	('1dda5f8dd5b66e07d4165c3b6516dc27','4eb63b090afda31d3b3faa8324013e35','二千年之恋','0',4,3,3,'在南海是好有规模的,最喜欢坐房间,海鲜和家常小炒都不贵,停车场超大,值得推荐一下,如果有朋友是广州的,来也方便哦,从芳村过来就可以了','0','2008-12-03 12:55:00',NULL),
	('0043ce51267de611361e9e77cc06931e','4f52000429912a01a2ba7950885da0aa','龍哈','2',2,2,3,'循众要求无得吃自助餐单点D出品比较一般pizza 意粉 汤全部都比较唔正宗D炸鸡翼炸到癃晒不过有另外一个原因令我以后都唔会再来就系黑人 中东人太多啦！！！','70','2010-11-27 21:24:00',NULL),
	('02a825713bc0cff8e3e94c0dde699b54','4f52000429912a01a2ba7950885da0aa','kitkite','4',4,3,3,'【点评团消费】这个自助餐还不错，团购的……口味都是比较西化的我比较喜欢沙律那一块，有我喜欢的油醋酱……还有那个番茄上面放了一块芝士的……烟熏三文鱼一般，北极贝还可以……薯条很好吃，就是盐太多了……菜式方面相对逊色，红酒羊排挺好的，咸猪手还可以……千层面是少见的菠菜面做的，牛肉很多，可以参考OGGI的千层面……pizza不够新鲜，饼底也一般……焦糖炖蛋还不错，我喜欢那种味道……雪糕就不要吃了……吃到很晚还是各种品种供应，这个很好但是原价118有点贵……','89','2011-09-15 22:03:00',NULL),
	('02e69d6a5e0812074525cd7da4819c4a','4f52000429912a01a2ba7950885da0aa','EspresSong','4',3,4,3,'每年两次广交会，都会特意跑到这里去吃下，虽然比平时的价格稍高，毕竟那多时间人真的很多，尤其是住在附件酒店的老外多，但菜的味道一直都保持的很好。即是意大利餐厅，又是自助餐的形式，很少见，价格超级实惠，性价比高。沙拉和甜品的种类都很多，味道也很好，沙拉里的海鲜很新鲜，每一种甜品我都喜欢，但主食的味道差了些，不过就这个价格来讲已经很好了。','98','2010-08-04 10:30:00',NULL),
	('08e33c031b502980491135bf2901b18e','4f52000429912a01a2ba7950885da0aa','哈T_T哈','3',3,3,3,'冲者广发卡的活动去的，周一人真是好多啊，不过尚算有位置，不用等很久。环境很有外国餐厅的情调，就是空调不是很够，可能人真的有点多啦。食物味道方面，可能我还是不习惯外国人的口味，那种酸酸甜甜，不是很对胃口，所以没有觉得什么东西特别好吃，网上推荐的烟熏三文鱼，个人觉得好咸啊，千层面就是番茄酱的味道嘛，没什么特别啊，至于是否正中，很难评判了。服务生的态度不错的，人这么多，可以收盘子也是挺及时的。不过这里的啤酒是随便喝的，而且是嘉士伯的。个人觉得挺适合朋友小聚的。喝酒，看球可以选择这里哦。','98','2010-09-26 22:07:00',NULL),
	('09266341b2f56adfc1070d6669dfbc50','4f52000429912a01a2ba7950885da0aa','dsides65','4',4,4,4,'那里环境挺好的，音乐也挺优雅，自助餐挺实惠的，还有甜品，我最爱吃了，下次去一定带家人朋友去尝一下，真的不错，服务也都挺好的，上次是跟同事一起，吃的比较匆促，下次一定要好好品尝。','0','2011-06-14 21:53:00',NULL),
	('0d0c66d4c120d9c6d6818069880eea67','4f52000429912a01a2ba7950885da0aa','priscillako','3',2,2,2,'今晚平安夜去.之前以为係98一位.去到坐低先知168一位....食嘅嘢无多到.品种都同点评上讲嘅差唔多.味道都係差唔多.但贵咗足足70蚊!!!唔知为乜!!!所有肉类.包括咩红酒羊排,牛仔骨,烤羊腿,鸡扒,鲈鱼扒等趴类的肉都又韧又&quot;鞋&quot;唔通意大利人钟意好似纸皮咁嘅肉?!其中有个人外国人着T恤+牛仔裤在bar台附近走来走去.我谂佢就係店主.大家都话好嘅芝士薯蓉係唔错.但食得多会好馏...烟熏北极贝也不错,至于三文鱼刺身没有冰镇着,显得肉好霉,而且切得都好碎..姜葱炒蟹D蟹无肉嘅,圣子又係得壳嘅.沙律种类好多.至于甜品,种类都几多.味道都过得去.抹茶蛋糕不错雪糕有四种口味,哈密瓜,芒果,香草,朱古力.都是明治的.其中芒果味的很正水果又柚子.橘子,火龙果,菠萝,仲有睇落去好似芒果嘅木瓜-_-...总之我觉得336蚊两个人.无论去附近便间法国或意大利餐厅都可以食得好好兼好饱,但系...我觉得今次真系好唔抵...至于气氛...係好多外国人,但唔关我事,毕竟都好多中国人...而且个投幕播嘅係CBA.之前都有播中文版嘅圣诞歌,到后来又停了...tips:我今晚去的时候,自助餐是每位有一杯红酒/白葡萄酒/(仲有一种,听唔清)...总之三种酒任选一杯,另外嘉士伯啤酒每人也只可以要一杯.两种酒都...要主动同服务员讲,不然她不会拿给你的.由于今晚是平安夜,所以没有大家所讲清净的感觉,好多人,好嘈...另外服务员大多数讲普通话的,也不是个个会说英文,我攞北极贝的时候就听到有个鬼佬问个waitress:where is the salmon.个服务员就答:还在厨房,还没做好.跟住个鬼佬Keep asking,两个都唔识点沟通,后来个服务员就嗌另外一个话:我不会说英文,你告诉他那个三文鱼还在厨房.我顺路经过讲咗句:wait a second.哈哈.tips:没车的搭地铁去的同学,五号线淘金站出A,沿着花园酒店方向,过咗建设六马路,往前行10米就见到个招牌嘎了.离地铁站好近的.全文','168','2010-12-25 00:51:00',NULL),
	('13aa87b8524dbd99361437109675381e','4f52000429912a01a2ba7950885da0aa','Colin_Xu','5',4,5,5,'【点评团消费】团购去的，有意外惊喜！菜的款式很多，而且做得也比较精，做法比较传统，很适合外国人的口味，但不一定每个中国人都吃得习惯！不过，我喜欢！推荐一些喜欢传统西式口味的朋友去尝试一下！就算是原价118，我也觉得值得！','89','2011-09-19 10:46:00',NULL),
	('1470fef5bf8ab05639702c39df5997ff','4f52000429912a01a2ba7950885da0aa','christiepang','5',4,5,5,'【团购点评】绝对对得住价钱，虽然系团购，但一d都不那股。。品种不算太多，算做得几精，tiramisu 好吃，朋友话蛋糕无之前的多。。呢餐算西我的今年的圣诞大餐啦，提早庆祝，嘻嘻。。下次会再帮衬','89','2011-12-18 19:07:00',NULL),
	('1790a3fdeba818b758cc94ea743fd7c7','4f52000429912a01a2ba7950885da0aa','绯紅蓝天','5',5,4,3,'【团购点评】这家的自助餐一直保持在水准之上。出品完全对得起个价钱。当然如果单点的話其实都不便宜的。但是肉类的品质还是相当好的。最爱这里的PIZZA和提拉米苏，有空还是想多点过来的。还有，以前的服务员都很漂亮的说，现在退步鸟。。这里气氛很好，而且都是外国人消费。不会太吵。牛肉很不错。。羊肉有点骚，但是烤得很香。鱼扒是非常推荐的肉类，有加了香草煎的。挑到嫩嫩的就满口肉汁沙拉的种类也很多。我觉得是比较正宗的外国口味。但是由于用料新鲜，口感很不错。冬天的話可能会冷一点。','86','2011-12-09 12:03:00',NULL),
	('18446af4959e3a70a5ceb1c5a1486513','4f52000429912a01a2ba7950885da0aa','有钱人真烧','4',3,3,4,'小街风情的装潢挺别致的，看着有味道，品位还是不错的，就是价格有点小贵了，烟熏三文鱼很鲜嫩，口感很细腻好吃。蘑菇忌廉汤味道比较嗲了。芝士蛋糕很甜，吃上一块刚刚好，两块会觉得有点腻的。','0','2010-07-03 12:38:00',NULL),
	('18c03441a4d32576309dc6d6fa23811f','4f52000429912a01a2ba7950885da0aa','doltun','3',2,2,2,'【点评团消费】团购去的，周一都很多人，顾客像八国联军，想像得出的颜色都有...环境喧闹，食物素质一般，沙拉都不是很新鲜，肉都被夹光了也很久才换，传说重的千层面，面是绿色的...比FG差多了，唯一可以吃的是炭烧生蚝和羊扒，但都说不上味道好...蚊子很多，服务态度一般，性价比超低，不会再去。还有旁边桌一个服务员没干活一直对个外国人flirting...','0','2011-11-09 14:23:00',NULL),
	('1c04c022faea52dd0ee5b6a4126972c1','4f52000429912a01a2ba7950885da0aa','jojo5156','5',5,4,5,'非常意外的好吃。赞一个。喜欢这样不是快餐式的自助，出品都很用心，所以很好吃，遇到的服务员很NICE啊。很多菜品之前没见过，都要看菜牌才知道是什么东西，很喜欢尝新东西，特别是奶油重的东西','98','2010-07-26 23:58:00',NULL),
	('1c661c34393a88aa347fa5a0eaaa255c','4f52000429912a01a2ba7950885da0aa','ckkkkkkk','4',3,3,3,'PIZZA同意粉最好食！其他就麻麻啦，而且相比附近噶餐厅黎讲唔算贵唔算便啦，同F可以去食下噶，都可以倾下计，唔会吵','0','2010-12-26 23:20:00',NULL),
	('1dd0ba4e1c80ce6d687faacfec721a78','4f52000429912a01a2ba7950885da0aa','379466154','4',4,3,2,'【点评团消费】在点评团团购了自助餐，元旦去消费，提前了几天订位，到场后发现并不是满座，外国人比较多，还有一些位置的空的，估计是有人预订了吧。自助的食品以西餐为主，味道不错，服务有待改进。最喜欢红酒烩羊排和焗蜗牛。热菜供应很及时，品种也不少，就是甜品少了点，水果和雪糕都有，沙拉和生的比较多。团购价89元值得买，但是原价128元就有点不值得了。还有就是服务有待改进一下，换碟不主动，结账后，服务员竟然以为我们没有结账，晕，这个都搞不清楚，怎么做的服务员？','89','2012-01-02 08:30:00',NULL),
	('0404bd86cd42d8872759b18790d60007','500617c4604b74f4920aef54c280e022','athena63','4',4,3,3,'去年我生日的时候我们家人去的，因为那段时间我们家疯狂爱上泰国菜，而且大学路这里离我家也不是很远，TAXI就起步费，所以就选这家了点了猪颈肉，这个当然不能少啊，没有失望，就是喜欢吃有点肥肥的肉，还点了芒果炒牛柳，芒果很好吃啊，牛柳也很嫩，我爸牙不太好，但爸也说不错吃的，还点了条鱼，忘记叫什么名字了，可以看下图，鱼不是很好吃，有点老，可能因为炸过的缘故，最后点了咖喱蟹，那天点的之前被告知蟹可能肉质会有点苦，因为当天有其他客户点的蟹有出现这个情况，他们家服务员还特地提醒，不过我们还是点了，肉质不苦，还算幸运，我点了奶茶，名字叫什么忘了，味道好极了，是我爱的口味。嗯嗯，总体吃下来觉得不错。。满喜欢的今年的情人节准备和老公去这家。真期待啊。','157','2012-01-08 17:35:00',NULL),
	('066c0fc7cf80242ad2eec9c51f8c929b','500617c4604b74f4920aef54c280e022','乖乖悠宝贝','4',4,3,3,'觉得很不错的泰式餐厅，人气很旺，尽早预定的好，晚了就订满了，八点多的时候还有蛮多人等位的。。。地方有点不好找，可能是对五角场真心不熟。。。环境很不错，光线小暗，可以理解为情调不错。。。。看餐单，很多事午市特供，价钱也比较实惠，有机会可以来试试的。。。猪颈肉还是蛮肥嫩的，火候很不错而且口感不油。。。金针菇沙拉里面好多香菜，有点小不喜欢，但是酸酸辣辣的口感友人很爱。。。大荐黄咖喱蔬菜，价钱实惠而且咖喱拌饭绝对赞爆了。。。菠萝饭也不错，就是里面的青豆实在很硬很不好吃，影响整体的存在啊。。。点心拼盘有三种，一个是椰汁西米糕，一个南瓜还不是芒果椰丝糕，还有个像煎蛋的点心。味道都很不错，喜欢点心的可以来个拼盘都能尝到。。。总的来说是挺有爱的一家店，比迈泰好吃，就似乎地段稍远，有机会还会去的哈。。。。','107','2012-01-14 20:11:00',NULL),
	('075ebd9c1814cf72f03dcb2a2a3baecd','500617c4604b74f4920aef54c280e022','一一','4',3,3,3,'杨浦少有好饭店 这家一直慕名 可惜他家座位难订 都要提前很多天预定 恰巧我是个随性的人 不喜欢太早定下计划 所以一直没机会尝试 昨天生日 没有订到初花 于是lg提议四点去塔顶排队 难得不愿意排队的lg自愿提出 马上出发去大学路 四点到达 服务生建议我们四点半再来 说是太早了 在车上坐了半小时 这下没人和我抢了吧 楼上都是提前定位的留坐 一楼一共16个座位 如果恰巧都是两人同行 那么当天你只要前八位进入餐厅就ok了 如果你前面是大桌 那么你要前三名进入 个人觉得4点半到三刻左右到达 只要不碰到大桌 应该能第一批进店 不过建议大家多穿点 一楼大门透风 坐着怪冷的 罗嗦了半天 切入正题 说说菜式 可能之前期望太高 没有感觉这家有什么特别之处 味道和蕉叶也差不多嘛 没必要搞得那么紧张酸辣泰式凤爪 是去骨的 凤爪是硬硬的那种 味道比较辣柚子大虾沙律 不好吃 虾肉木木的 柚子用酸辣的汁拌着 不欣赏这样的做法椰香红咖喱牛肉 椰香味盖过了红咖喱的味道 失败啊 冬阴功汤 这个真的可以 味道和泰国的相差无几了 不过好辣啊 味道好重招牌咖喱青蟹 说实话 这个味道还没有蕉叶好啦 里面的青蟹肉质松 真的没啥好推荐的金钱虾饼 本想点的 看了邻座上的虾饼 不知为啥 就没...了食欲 最后还是没点 洛神花汁 这个味道还可以就这点菜 最后买单450元 人均二百多的消费也谈不上什么性价比吧 这样的店充其量也就普通的水准 吃完后老公对我说 跟你说了很多次了 别迷信网上的评价 看看不过如此吧 我还真没好还嘴的 就这样的店 个人觉得不排队随便吃吃差不多 排队预约到这份上 实在没必要 补充一句 店里有wifi 问服务生要密码即可 这点不错全文','230','2012-02-12 16:44:00',NULL),
	('09de25abe441c7bc933e3cd5838c1251','500617c4604b74f4920aef54c280e022','charmente','4',3,3,2,'当天预约只有二楼雅座，设最低消费，不过我们超了很多。4个人带1个小孩吃掉600，很饱。虾仁炒芦笋其实很好吃，泰式春卷一般般。招牌咖喱蟹不错，咖喱是甜咖喱，沾面包片真香。居然没有泰式奶茶，就点了两种奇怪名字的饮料，味道也很奇怪。总体还不错，但是说特色也说不上来，适合情侣约会吧。人很多不预约的话就要排队了','150','2012-02-07 07:59:00',NULL),
	('0aa35e7399dbc9501d3a07df4397ab52','500617c4604b74f4920aef54c280e022','觅食吃','5',5,5,5,'一直推荐给朋友的好吃泰国菜，环境很不错哦，午餐光线会更好更有闲暇心情。木瓜沙律，冬阴功汤，咖喱蟹的味道都很不错。','150','2012-02-01 18:35:00',NULL),
	('0d7c792c83ffef7ea64681cfa00701c2','500617c4604b74f4920aef54c280e022','阿浓','4',4,3,3,'口味不错,比蕉叶好。位子少了些，服务员误把一个空调关了，导致本人吹了半小时冷风。总体来说还是不错的，价格略偏贵，量也略少。','270','2012-01-18 17:36:00',NULL),
	('11809184cff5a840a1b5e7ca75bc2a59','500617c4604b74f4920aef54c280e022','若葉丶','4',4,4,3,'看了DP说这里环境不错，就预定了5点半的位置，过去一看2楼全部都是预定掉的。2个人点了金钱虾饼，味道很不错，个头也蛮大的，一共5块，每次吃泰国菜虾饼是必点的猪颈肉也是必点之一啊，量比我想的多，沾的料味道也蛮好的招牌柠檬鸡肉满嫩的，浸在汁水里的还挺辣的，量也可以的招牌咖喱皇炒青蟹，咖喱味道不错，青蟹蟹钳难咬的来，女服务员也不主动说帮我们敲碎点，朋友很没形象的啃完一个蟹钳，听到隔壁桌的男服务员主动问人家要不要敲了碎点方便吃，当场无语了..哈哈朋友还点了班南叶汁- -说实话蛮难喝的，估计我们都喝不惯的关系。每人喝了一口剩下的全部浪费掉总体来说环境还行，灯光满幽暗的适合情侣来劈劈情操的','200','2011-12-15 18:17:00',NULL),
	('1452665593908b31e850059dd2053a8d','500617c4604b74f4920aef54c280e022','桑季','4',3,3,3,'【团购点评】老婆生日，和她朋友们一起去庆祝，那里环境不错，服务态度也好，就是人有点多。拿了瓶红酒过去，还要开瓶费50，哎。不过东西是蛮不错的，最后也放了生日歌。总体来说还算可以。','100','2012-01-06 10:28:00',NULL),
	('15d1f8d94bb17c5d3a80ea084c1434c5','500617c4604b74f4920aef54c280e022','prm晨','4',4,4,2,'味道老好的 价钱小贵 环境弄得也蛮灵的 经常要等位 生意不错 从来没有优惠的闹 虾饼很实在 老虎蟹不错 菠萝饭倒一般般 卖相好看 吃口干巴巴的','0','2012-01-15 14:38:00',NULL),
	('1b4f9c11f039b13085d3b68e2d3a8f2e','500617c4604b74f4920aef54c280e022','外面下雪了','4',4,3,3,'挺不错的，我们五个人吃了差不多快六百块，还行把，主要是我觉的这个菜的口味还是挺正的，所以吃的还比较开心。那个冬阴功汤，喝着蛮浓的，也很鲜哦。菠萝饭是我比较喜欢吃的，每到泰式店里面都是要必点的哦','0','2012-02-09 20:09:00',NULL),
	('003ac6eb6c95ddbf3f4a90f0e04eba79','536b758b6c3ab8236611ac548ea8a7f8','cattyly','3',4,3,3,'什锦披萨很好吃，奶油意面太咸了，卡布奇诺难喝，酸奶很好喝，像是自己做的，无添加。空调不太足。店员说有wifi，却怎么都搜不到，真奇怪。','60','2011-09-08 12:30:00',NULL),
	('005c7ca4daeb2a4264d194f0b1cbbf81','536b758b6c3ab8236611ac548ea8a7f8','刀刀与小宝','4',4,2,2,'说实话，在西街要找这家PIZZA店，不是件容易的事情，但值得你去找到他，PIZZA味道没的说，据说是用材火烤的，比之必胜客要胜上好几倍。用料很足，上面的cheese有厚厚的一层，两个人点一个6寸的，外加两杯饮料可以吃到撑。','40','2011-08-28 14:11:00',NULL),
	('0140126bd40a42a7b0dbe254ce26553f','536b758b6c3ab8236611ac548ea8a7f8','伊芙林Evelyn','4',4,3,2,'特别喜欢这家店的黑椒牛排，连续吃了两天，都要了5成熟，竟然做的刚刚好，性价比很高。那个牛奶土豆汤，特别恶心，喝一口差点没吐了。什锦披萨还不错，中规中矩，馅儿足。炸玉米片，趁热吃特别香脆。冰柠檬茶比热柠檬茶好喝。','50','2011-11-28 17:36:00',NULL),
	('0269f4b656a3e9c9a2725ef47fc018ec','536b758b6c3ab8236611ac548ea8a7f8','angel emily','4',4,5,2,'慕名而去，逛西街时去吃了夜宵。夏威夷皮萨芝士十分浓郁，价格实惠。有露天座位，店里装修挺有感觉的，小憩不错。饮料一般般了，餐点选择不算太多，很美式。另，阳朔那边的服务员态度都不怎么样……','50','2011-08-18 15:15:00',NULL),
	('0490db96b5889747329f8a94b9e5cf1d','536b758b6c3ab8236611ac548ea8a7f8','secret_cindy','4',3,4,2,'作为留学生 这里的菜整体还是差多了 不过在山区小镇能坐成这样 已经没什么怨言了 披萨不错 底很酥脆 是现烤的 但其他食材选料一般 价格不贵 我们点多了 才人均55','55','2011-09-10 11:05:00',NULL),
	('0721a3832f4567ce63cf637410024f8c','536b758b6c3ab8236611ac548ea8a7f8','我是小蛮蛮','5',4,4,3,'在其他攻略上见过的，在阳朔几天老是吃米粉终于有点腻了，谢大姐啤酒鱼之类的又实在很坑爹，所以就去了这家。点的水果披萨，很好吃，面很脆，上面的料也很丰富，没有让人失望。','50','2011-09-29 15:01:00',NULL),
	('0aabd2918ac4ce6954fdd1e681d7a7d0','536b758b6c3ab8236611ac548ea8a7f8','bbccat','4',3,3,4,'在阳朔吃了几天啤酒鱼，就想去吃pizza换换口味。点了大热的杂锦pizza,黑椒牛排，酸奶。pizza料很足，但个人觉得没有广州oggi的好吃，可能我比较喜欢薄底。牛排分量够大，2大块，做得也很嫩，但觉得黑椒不够重。酸奶很纯，汤配的蒜蓉面包很不错。','50','2011-07-18 21:56:00',NULL),
	('0dfdbcb959bb7a6b99a134a5ee28bd25','536b758b6c3ab8236611ac548ea8a7f8','sayonala','4',3,3,2,'还是2009年去的阳朔，这家店就在最繁华的那条西街的隔壁一条巷子，很好找~~环境很好，给人感觉非常舒服~~我点了份汉堡，好大块汉堡肉，还有煎蛋，芝士，薯条，非常美味多汁~~好像是30几一份~~朋友们有点杂扒，鸡扒等等~~但是我觉得还是我的大汉堡好吃！哈哈哈如果有机会，还真想再去一趟阳朔~~','0','2011-04-03 17:30:00',NULL),
	('0ec82ad164af782a88e9664a10c8386c','536b758b6c3ab8236611ac548ea8a7f8','九级天使','5',5,5,4,'非常好吃哇，本来以为就是找点必胜客的感觉，没想到味道这么好，薄脆的金枪鱼披萨，黑椒牛排一定要试！还有淡季的西街哪里都空，悠闲的感觉真好哦。','50','2012-02-13 18:23:00',NULL),
	('122b078564de4c30cbf96f4cd7b025bc','536b758b6c3ab8236611ac548ea8a7f8','allanayufan','5',4,4,3,'一开始是晚上来吃.红星汉堡的分量超足.28元一份真是物有所值.沙拉几乎都是20元一份.分量也不骗人.pizza味道好.所以导致一行众人第二天早上兴致勃勃来尝试早餐.红星早餐也是很超值的餐.培根味道好.分量也相当于一个人午餐的分量了.不过估计是按照外国人的分量来制作的吧.总的来说.我是会一来再来的.','40','2011-05-10 17:33:00',NULL),
	('13989d6cd293c8cce0ad5567fabb1e3b','536b758b6c3ab8236611ac548ea8a7f8','lkaya','4',3,3,3,'还不错啦，从老班长青旅出去直走就看得到收银台很有意思，用各国纸币装饰的，就是不晓得是不是真的哈哈哈墨西哥鸡肉卷不错吃，酸奶也很好，牛肉卷就有点硬了配的炒饭一般般可惜没有点pizza。。。','40','2011-09-13 13:01:00',NULL),
	('1466cd334cd30f1183662e256838117f','536b758b6c3ab8236611ac548ea8a7f8','林拉拉拉','4',4,4,2,'同亲爱的去阳朔的时候，冒着喉咙痛去吃pizza....什锦pizza的底很薄，脆倒不是特别脆。其实只要不是厚底的pizza都觉得可以吃得下去，平时去pizzahut只吃一块的我，在这里吃了2块的说。还有那个青面，味道很浓郁，肉桂很多，很好吃，反正我是重口味的。对了咖啡奶昔不好喝，但是果汁是鲜榨的，还不错','52','2011-11-30 15:28:00',NULL),
	('16f8e9b7d7a76aa4519d215177432f2e','536b758b6c3ab8236611ac548ea8a7f8','好吃鬼的妈妈','3',2,2,1,'没想像中好，环境闹，服务也不热情，不知道是不是过节的缘故 ......不过什锦PiZZa味道还不错的','40','2011-04-04 20:44:00',NULL),
	('172fd9ee2ed2d29065373b51ced016fd','536b758b6c3ab8236611ac548ea8a7f8','ZhengRene','3',2,4,2,'大运期间去阳朔玩了两天，慕名去的红星特快。感觉很一般，非常失望…披萨没有必胜客的好吃，香煎鸡胸一点味道都没有。苹果煎饼很酸。点的水果酸奶服务员忘记上了。两个人点了很多东西只有香蕉船还过得去…-_-#','50','2011-09-29 22:06:00',NULL),
	('18178962d1a8625d1de3632980d2fad1','536b758b6c3ab8236611ac548ea8a7f8','食神helen','4',2,3,2,'西式简餐，墨西哥餐好辣好辣，店里老外成群。主推PIZZA，不过没有北京的好，在那条街上算是比较好的PIZZA了。','50','2011-08-11 13:45:00',NULL),
	('1825753960e2961713ad32f9669b3423','536b758b6c3ab8236611ac548ea8a7f8','ddcx','5',5,3,3,'有一个是上来一个大盘子，有料和面皮包的！分量很足，超级好吃！~~比一般我们这边的西餐厅料足多了！~~~回来后还是一直怀念啊！','60','2011-10-25 15:41:00',NULL),
	('1a5bda5067d8c012ad31e26dbd1f06c5','536b758b6c3ab8236611ac548ea8a7f8','飘飘_悠悠','3',2,3,3,'要我说对这里的映像，最深的不是这里的PIZZA，而是这里的氛围，以及门口那颗闪闪的红星，让我不免开始瞎想是否和当年的历史有关。。朴实的木质桌椅，昏暗的灯光，没有喧哗的音乐，没有嘈杂的聊天声，很静。意面和披萨实在没啥特别的，随便吃吃吧。','0','2010-12-27 15:07:00',NULL),
	('027b6808ac892f86b4128c1b78ada38a','57fd029a720570b314e953c05408c8ec','小花花12','0',3,4,4,'这家店生意不错，以前去挺冷清的，现在几乎总是满的，管理上提高了，距说去了一个女经理挺招客的，人不错，谈吐气质都挺雅的，服务也提高了，我几个哥们总都给捧场。新来了不少厨师，去过不少次了，一直想找点毛病，但现在还没发现，如果喜欢吃日本料理就来这里，真不错，上菜的盘都挺讲究的。前几天带老妈去，就是没有电梯。','200','2008-11-03 14:55:00',NULL),
	('0b35cc830df106acacbae2c1f05f6a0c','57fd029a720570b314e953c05408c8ec','cavell3300','5',4,4,4,'中山区里最喜欢的一家日本料理。菜品的质量和味道都很好。个人感觉比菊好很多。环境更不用说了。雅座和包间都有。推荐他家的定食，作为中午的工作餐，每个都很经典。自助餐吃过几次，最近涨到了258。谁让物价上涨呢？','258','2010-12-19 09:49:00',NULL),
	('11014f14a719986ddf2acce57b4f49dc','57fd029a720570b314e953c05408c8ec','lemonwen','3',2,2,2,'This restaurant is recommended by local colleague, however seafood are not as good as I expected.Service is ok at the beginning, while if you order too much, they&apos;ll get unpatient!','200','2010-09-30 15:55:00',NULL),
	('129bf015d7f9f8907285c708ff739254','57fd029a720570b314e953c05408c8ec','heiyideng','4',4,4,3,'沾老板的光逮了两次自助环境当属大连数一数二的出品也不错尤其是烤海螺 绝对给力现场的铁板也逮过 看的享受比逮的享受要好一些最爱的当属鹅肝 香醇办事请客的好地方朋友小聚不大合适费钱ps。比银座和菊的自助要值很多','200','2010-12-17 12:40:00',NULL),
	('14b57b030a95a0fc6942f9a6060a7813','57fd029a720570b314e953c05408c8ec','可敬','0',3,3,3,'今儿个中午刚在那吃的午饭，感觉不错！装修的很好我非常喜欢它家的椅子比起其他店里的木桌木椅我更喜欢这里的！三楼312小包间，主理的是位来自南方的叫玲玲的漂亮的女师傅！边制作还边给我们讲解一些食材的特性以及如何烹制比较好吃！嗯，很喜欢，以后去还会找这个师傅帮我们料理的！赠送的鲍鱼，海参，海参里面有一种来自日本的叫秋葵的东西，师傅说这个东西很有营养的，我还是第一次见到；铁板大虾配上他们秘制的酱汁口感好到爆，赞一个！小羊排，牛排烤的也很不错！而且我发现海之乡非常讲究摆盘，而且餐盘也是每菜都有不同的，这在其他的自助料理店里是很难遇到的！总之这一餐我吃的非常开心，而且还学到了不少知识，满意！','200','2009-07-06 15:54:00',NULL),
	('1b487b29f4b5dba93cfe1504daaffa59','57fd029a720570b314e953c05408c8ec','雄英','0',4,4,4,'宴请北京来的客户评价不错生食的海鲜尤其好京妞特别喜欢烤海螺就是定量的海参、海胆、鲍鱼小了点再要就算单点了200元的自助可以再大些嘛价内的清酒是不是品质不高喝了3壶便大醉环境很好安静舒适适合商务宴请','200','2008-12-03 14:09:00',NULL),
	('00a8047b195855a970522eb679a84ec3','58d697249d09438658cf43026cc7c3af','rainalroy','4',4,3,3,'突然间就很想吃这一类的食物，感觉是蛮好吃的，特别是以前的时候家里每一天都会出现这一类的食物，只是因为妈妈说我们喜欢吃。呵呵南普陀寺买的，一包22，两包32所以每一次妈妈去这个地方都会买上很多的东西回来，以至于每一次都是我去接她，哎……不过，我貌似蛮喜欢这一类的工作的，特别是这里的香芋味的饼一直都深得我心，蛮好吃的，而且香芋是紫色的，以至于每一次我都会吃好多。这里还有一些别的饼，虽说我蛮喜欢吃这个，但是还没有到这个地方去买过呢，呵呵，只是到那里的寺里去逛过！','30','2011-10-19 09:48:00',NULL),
	('01618c259cdd8dda3f3ec179de3be118','58d697249d09438658cf43026cc7c3af','南晴之墨','5',5,3,3,'细腻，入口即化，口有余香。南普陀寺的斋菜也相当出色。南瓜素饼最为清淡，非常适合老年人进食。尝过了这里的素饼，其他的就再不想吃了。','0','2011-09-20 15:28:00',NULL),
	('06d4b641acea864a6557ef4f1b2b4465','58d697249d09438658cf43026cc7c3af','我又肥了','4',4,2,2,'买了绿豆素饼和椰子素饼 椰子的好吃 比金兰饼店的好吃 金兰饼店的椰子饼稍微油腻了点儿绿豆饼就比不过金兰的了 味道素了一点 外皮也没那么细腻松软','20','2011-07-11 18:08:00',NULL),
	('07efe72c15585dbda589b823483699fb','58d697249d09438658cf43026cc7c3af','七月份续Love_SH','3',2,2,2,'主要是寺庙里面的，所以生意很好的送人不错，都是单独包装的，性价比么相对于其他的店就不是那么高的自己就吃了吉祥饼，味道还可以，价格也拉手的，6个222元，讨个口彩普陀寺人茫茫多啊，南方比较相信这个吧还好我很明智的下山再来买，看到很多人领着爬山真心痛苦啊','0','2011-11-25 15:34:00',NULL),
	('0dc86cec5841fddbda15c2a705d3b80c','58d697249d09438658cf43026cc7c3af','飒翊','5',4,2,2,'去南普陀寺,随便带两盒素饼,店员一直再推销20多元的吉祥饼,一盒也是六个,但我们还是自己发现了10元的普通素饼,回家吃了下,才发现非常好吃,外面酥酥,里面甜甜的,后悔啊,为什么没有多买几盒啊.........','10','2011-10-25 21:59:00',NULL),
	('0f8ef49efbec27d69f14e8187b0f26a5','58d697249d09438658cf43026cc7c3af','sunxujia','3',4,1,2,'在厦门旅游的时候顺道去了一下南普陀寺，那个人真叫是多啊，所以基本就没有进去，买了一盒素饼，绿茶口味的，很酥很甜，就是略微有一点点干，还算是不错吧。','22','2011-08-21 10:14:00',NULL),
	('1265ebafdd80c98767c8e92bdfb37571','58d697249d09438658cf43026cc7c3af','莹莹猫','4',4,2,1,'口感非常酥软，馅料比较新鲜，吃多了就是有些腻旺财酥就是凤梨酥，奶香十足，酥香软糯，这种比较贵28一盒绿豆、玉米、南瓜、香芋这些酥饼是酥皮的也很香糯~这种便宜12一盒由于去的时候是春节，所以只有三种口味了，麦芽糖，凤梨和绿豆的而且绿豆只有和凤梨酥绑在一起卖，真是强买强卖，这服务真差还好在飞机场也有卖的，所以才能把口味尝全~~价格公益，又吉利','30','2012-02-09 14:07:00',NULL),
	('154075ce2095263ed2977186d0650611','58d697249d09438658cf43026cc7c3af','jessielily','4',3,2,3,'基本来的游客都要买的，我也不例外，只是在后面的路程中，觉得越拎越重，回到家分分还不够，吃了南瓜馅的，觉得味道蛮好的，主要皮酥酥的，馅不是很甜的~~~','10','2011-09-08 14:27:00',NULL),
	('189f11f63d107373c75cc7300f17375d','58d697249d09438658cf43026cc7c3af','小心意大感情','4',3,2,2,'来厦门必带的特色食品，素饼和黄胜记肉铺。10元一盒，有好几种口味。蛮好吃的，皮很酥，不甜不腻也不是很油。个人感觉比其他牌子的馅饼好吃。就是保质期不长，十几天，带回来就要尽早吃掉。','0','2011-09-07 12:38:00',NULL),
	('18c85d2777abd9c2d1ccaaebdb4e6dc7','58d697249d09438658cf43026cc7c3af','aelainei','4',3,3,3,'一包22，两包32很明显我们都会选择性的去买两包了呀有的时候真的感觉他们很商业头脑。这个都可以想得到……说真的，每一次到这个地方来都会来买上很多呢，特别是我记得第一次来是我还要庆幸开车来的，要不那一些东西，不会太重了吧椰子素饼一直都是我们家中最喜欢吃的一种了，以至于每一次都是把这个要买得多很多，不过，我比较喜欢吃玉米味的，蛮有感觉，也是蛮香的。','22','2011-10-14 13:08:00',NULL),
	('19fae3fc0702c17ab3abdc310575cd0b','58d697249d09438658cf43026cc7c3af','zhenzhengirl','4',3,2,2,'貌似只在南普陀寺里边有找到，去了两次，第一次买了绿豆和南瓜的试吃，口味不错，甜而不腻，第二天也就是周五入寺，那个人山人海啊，恐怖至极，千辛万苦进去，居然绿豆没了，椰子没了，南瓜也差点没了，就剩一对玉米的，真是有点头疼。不管怎么说，去厦门还是捎几盒给亲友吧。','10','2011-07-04 08:38:00',NULL),
	('1adda63504f704b32d194970481c8d44','58d697249d09438658cf43026cc7c3af','冻顶红茶_囡囡','3',3,2,2,'到了南普陀山嘛总是要买点饼回去的咯下了山之后再买的里面都是独立包装的，这个不错，送人很体面，哈哈咬上去酥酥的吉祥饼要22元，才6个，这个贵了总体说来，南普陀馅饼没有其他家的性价比高','0','2011-11-27 17:55:00',NULL),
	('1cdd3a0ef8849cabf7f278f6bb245004','58d697249d09438658cf43026cc7c3af','雪堡小妖','4',3,3,3,'老妈指明这家店的素饼好吃，反正离住的地方不远就去了。蛮好找的位置，人家说这两天经常有检查所以素饼做得比较少，只好买了四盒归来，结果还没分到老妈的份儿。。。唉。。。吃的真的是买不够啊。。。','20','2011-07-03 21:56:00',NULL),
	('013bd7f6b47e14a00dad574c4f0a2edf','58e24754249294b9ac5b05a6133736f7','nbroc','0',3,3,3,'跟女朋友去太原玩，打听到这家店不错，晚上去了，有表演，面食表演很有地方特色，但是还不够商业化，可以再深度包装一下。饭菜量很大，几个菜都吃了一点点，感觉很浪费。','100','2009-06-08 11:46:00',NULL),
	('0515a2a87350ed50f724222312762753','58e24754249294b9ac5b05a6133736f7','小乖乖宝宝_好运如虹','0',3,4,2,'公司组织活动去山西，当天的晚饭就由导游带来了这里，菜价真是贵啊，相信楼下说的有两种菜单这回事了。先说饮料，没有酒水单，估计是故意的，且还说只有现榨果汁，木瓜汁120一扎，玉米汁90一扎，真不是一般的贵啊，北京的俏江南也就才98一扎。菜品还可以，说不上多好，也说不上不好，口味适中，但没什么特点。点了很多种山西的面食，还有就是鸡鸭鱼肉的一顿狂点，几乎把好吃的菜都点齐了，大家低头猛吃了起来，哈哈~~~~~中途去了趟卫生间还差点迷了路，这家餐馆简直是太大了，去卫生间要走5分钟，不过装修的真的不错，卫生间都古香古色的，回包间的时候怎么也分不清是从哪间出来的，从外面看每个包间装修的都是一样的，呵呵，问过服务员才得以顺利回去。大家酒足饭饱之后，叫来服务员结帐，一看账单，晕，10多个人花了2000多，不过来到太原为当地经济发展做点贡献也是应该的，吃的挺高兴就好，呵呵~~~~~餐毕准备离场，发现后面有一大舞台，正有表演，是太原市某建行在搞集体活动，包场，真是厉害，银行果然有钱。以后若是自己来太原，我可再也不会踏进他家的门槛了，实在是太高了~~~~','120','2008-05-05 12:22:00',NULL),
	('0b2e6d45109a8f054df73ec549d1387e','58e24754249294b9ac5b05a6133736f7','cathily','0',2,3,2,'朋友结婚在这里吃过几次，婚宴的饭大家都知道不怎么样的，平时没有去过，我不知道平时什么口味，反正是我吃的几次都不好吃，没什么特色，面食表演还可以，外地来的朋友可以看看。停车不方便，每天车多的都停到路上去了，占了人行道和大道的最里侧，很不好！！','100','2008-11-07 15:46:00',NULL),
	('0e363b11e128b42e8e2e2fc518146873','58e24754249294b9ac5b05a6133736f7','kaylajiali','4',3,3,3,'是山西特色的很高档的饭店 装修不错 进去就知道这地方价格不菲 是和家人请人办事在这里吃的 当然不能点便宜了 五个人吃了三千多包括三盒店里做的月饼 好心疼啊 味道不错','500','2011-01-12 17:12:00',NULL),
	('0f65ee6c87acb52c90b938625bebb67c','58e24754249294b9ac5b05a6133736f7','吃遍中国无敌手','0',3,3,3,'挺好的一个餐厅，出品不错，服务也不错。演出（此处删除若干字）后半部分的面食表演很精彩，保留这一部分的节目就足以展示山西的特色，前面的歌舞器乐表演有点画蛇添足了。','100','2008-08-04 16:55:00',NULL),
	('1a0d7b41619b83e60729befb23fa6993','58e24754249294b9ac5b05a6133736f7','wlf78','0',4,5,3,'和单位一块出去疗休养，当地接待单位安排了晚餐。个人觉得除了停车还有待改良外实在是不错的一家饭馆。吃了近十种山西的面，还看了大师傅的表演（最深刻的是曾上过CCTV的拉面师傅最后拉的面比上CCTV的那次都细）。饭前还有养身醋（东湖10ml装）蛮可爱。生平第一次喝了竹叶青和汾酒，觉得也蛮不错。作为我们一个南方（上海）来的觉得在吃上没有任何障碍。','150','2009-09-09 12:46:00',NULL),
	('1c7449608ec86790a6f33635fdd4547a','58e24754249294b9ac5b05a6133736f7','美味爱恋','0',4,4,4,'店面装修似山西晋中的大院，门口还有马车。内部也是古色古香的大院特色。菜样很多，做的很精致，还赠送小袋食醋，可以直接喝，有利于身体健康有个小窑洞造型的舞台，偶尔会有表演。卫生间也很有特色，值得参观一下哦。','80','2008-12-13 22:46:00',NULL),
	('1d07279b9d7f27195e58d4f3370cfec6','58e24754249294b9ac5b05a6133736f7','谗老猫','0',3,4,4,'一行人旅游到此，导游介绍的。门口不显山水，一进大门，好大的展览厅，好大的气派哟！二楼餐厅富丽堂皇，我们人多，闲挤，就下到一楼餐厅。一楼餐厅古色古香，服务也很好。冷菜象南方一样，比较细腻。热菜量很足，有北方的豪爽，味道也不错。印象最深的是：黄金窝窝头，确实有特色。吃饭时，边上伊伊呀呀唱了起来，皮影开始了。表演时间不短，也不知道唱了些啥。不过，很有味道。如果有机会再来太原，一定光顾！','150','2008-01-21 12:20:00',NULL),
	('0441aecaf4432c01afc8e41179518753','59d1db8dc6870ffcad7b34d4d1472d74','mirrorzj922','5',4,3,3,'汤很好喝，只要1块5毛钱。要自己打鸡蛋进去，是徐州的特色。每天排队的人特别多~包子也很好吃，物美价廉，一大笼很便宜','20','2010-02-11 19:53:00',NULL),
	('063d7dcd6357c23eb77b3f238da87531','59d1db8dc6870ffcad7b34d4d1472d74','jmjmjm2009','3',4,2,2,'汤是很好喝的，略加一点醋就更好喝八股油条新出锅的脆香煎包味道一般，油大最喜欢吃豆腐蒸饺  不喜欢在汤里打鸡蛋','0','2010-02-06 10:04:00',NULL),
	('084cb570a35a3d078112f8328c9389af','59d1db8dc6870ffcad7b34d4d1472d74','彭城小摇臂','4',4,2,3,'很喜欢啥汤 还有蒸饺 每次去都会吃  啥汤特别好喝~不过女朋友不喜欢~那个蒸饺非常不错 很有特色~谈不上和粤式早餐的蒸饺比~但是个人觉得很好吃很朴实~喜欢的就是徐州美食朴实的一面~','10','2010-05-24 17:00:00',NULL),
	('0c95c13dace4796680430d8a8c2484f0','59d1db8dc6870ffcad7b34d4d1472d74','茜茜猫123','0',2,2,2,'早就听人说又名 有机会去品过一次 由于时间紧也没太仔细 没放鸡蛋 感觉有点稀 包子只吃过青菜香菇的 还行 也许不常吃 也没感觉有什么特别的','5','2008-07-15 21:05:00',NULL),
	('11f239c63b43d8ee5a3865cc847513fb','59d1db8dc6870ffcad7b34d4d1472d74','happy120','0',3,2,2,'这家算是徐州的老字号了，在徐州也有好几家分店，以早点闻名，早上的生意特好，包子和汤卖的很快，中午还有外卖不过不是包子和汤了，是盒饭口味也不错，价格适中，我们单位一直都在那边订餐','5','2007-08-13 13:51:00',NULL),
	('1311fe6f4053a9b20c0fb9e641a5805c','59d1db8dc6870ffcad7b34d4d1472d74','吃俚勿煞','0',1,1,1,'一大早就去果然很多人排队，排队买票，排队拿汤，排队拿煎包，排队拿油条，等全都拿到半个小时都过去了，奇怪就不能开一个窗口全都一次性拿全嘛，非要一次次分开排队，搞不懂，而且店里买票和吃，但拿吃的却要绕到店外弄堂里去，太莫名其妙了。好不容易坐定下来品尝，却是真的没有味道，一碗糊糊汤，汤里啥也没有，不鲜也不辣，煎包淡而无味，蟹黄小笼除了咸味没吃出味道，还干干的没汤汁的，油条还行，但也并不比其它地方的好吃，形状奇特而已。吃完直摇头，太失望了，这和在徐州以后几天的早餐没法比了，真的不能看牌子的，老字号要做好不容易阿。','0','2009-10-09 10:04:00',NULL),
	('14601da60b9e661aa551415ee1d50b95','59d1db8dc6870ffcad7b34d4d1472d74','bianfuzhou','0',2,2,2,'说实话，我很不喜欢吃，但LG是徐州人，，每次回去都要去。。。不适合我的口味。。虽然GP和LG觉得很好吃。。。每次去勉强吃点。。','10','2007-11-18 22:20:00',NULL),
	('1df7aa950bf533269767f03c905dcf09','59d1db8dc6870ffcad7b34d4d1472d74','l0_0l','0',4,1,2,'有些怀念，所以来点评一下，：D徐州饣它 汤和山东米参 汤虽然同名却不同字，做法和味道也不太一样这边的饣它 汤辅料很丰富，鸡丝和麦仁是不可缺少的，浓稠度有点像辣汤，应该是骨头汤熬制的，很香马市街的饣它 汤名气最响，每次去总要排队，当然不会如上海那种蜿蜒的样子，可也要一碗碗的等着，有些人拿了鸡蛋来冲，味道也不错主食一般是包子，油条类，这边的八股油条很有特色，不大，却很宽，因为是8股，外形有些饼状了，吃起来却还是根根分明的，现做的，偶喜欢古老的木头桌椅，油光四溅，以前汤、包子要分别排队，不太方便，不知道现在什么状态有些怀念，很久没有辣汤配油条，饣它 汤配煎包了','0','2008-03-01 11:05:00',NULL),
	('0083a8b98898482766d370f960aa210e','5e29c736ac1faacab6340c1d0cf710ab','雨伦','5',4,4,5,'去过两次，都是提前预约的，不用等位。环境幽静，服务正宗。虽然说价格昂贵，但是高消费带来的是优品质的服务。在这里，吃的不是牛排，是享受，连服务员也长得特别标志。每道菜都给你介绍得很详细，给你充足的时间细嚼慢咽，然后再换下一份，有章有法。尝过牛排和羊小排，口感都不错。这里的点心也做得十分精致，可以看出制作人的用心，品尝起来也特别有滋味。一个字，赞！','260','2011-08-30 16:08:00',NULL),
	('00a706e6c07a520c451510597891f37e','5e29c736ac1faacab6340c1d0cf710ab','无欣','3',2,3,4,'色拉让我惊艳  台塑老板娘的招牌菜 偶不是很喜欢。。。。。。环境一般般，以一个讲究情调的餐厅而言，位子和位子之间太近了 。近的隔壁一桌女人在PK谁的老公好，在讨伐谁的婆婆恶都听到一清二楚。。。。。。结果。。。。结果就是没有任何情调而言应该不会再去了','280','2011-05-21 19:47:00',NULL),
	('00f194b01c8d11a74f7e050742dbdf7d','5e29c736ac1faacab6340c1d0cf710ab','小切切','4',3,4,5,'台塑牛排最好吃，不过它家每次去的感觉都是点一客两人不够吃，点两客两人吃不下看来下次要三个人去点两客另外最满意的还是他家的服务，超级棒','0','2011-06-22 16:39:00',NULL),
	('0669825f80f90852edf9c3bd62da6272','5e29c736ac1faacab6340c1d0cf710ab','苍_Q','4',4,4,4,'本來不想寫了…偶爾會去吃吃…這次因為老媽不愛牛肉點了豬排…套餐價格都一樣一開始還想著肯定不划算…沒想到上來是好大條的豬肋骨分兩次烤…肥瘦正好…骨頭部分也烤得很誘人…味道很是不錯…一般去王品我一定是點牛肉…沒想到這次豬肉讓我有些驚喜…所以就來點評下…','286','2011-08-30 07:02:00',NULL),
	('0be8b69879188c6e30e609c4604d42c1','5e29c736ac1faacab6340c1d0cf710ab','cfpp819','3',3,4,3,'环境非常好，服务也超好的。只是不大习惯这么慢的上餐速度。台塑牛排真的非常好吃，口味、嫩度都很棒。好喜欢他家的酸梅汁，我把妈妈那杯也喝了，有些位置环境好，有些间隔太近最喜欢的是酸梅冰沙，虽然只是开胃的一小杯，但是很喜欢，还多要了一杯。这里的凯撒沙拉也超级好吃','0','2011-06-13 10:16:00',NULL),
	('0ff8a42d5342e3d1ff83bf9abd3caa94','5e29c736ac1faacab6340c1d0cf710ab','繁华拢叶','4',3,3,3,'王品的牛排续西提之后，名气也不错了，以前西提吃的还不错，平时对牛排没有太多的研究，跟随着姐姐吃过的不少次数后对牛排也开始讲究，第一次到一个牛排餐厅先不要和服务员说要几分熟。看看服务员会不会自己问你，屡试不爽，本来以为在王品成功的服务员点单的时候没有问，没想到服务员点完单子没有问后，一会又回来问，额..点了一份7分熟的 牛排，牛排做的还不错，但还是觉得西提的稍好吃一点环境之类的也还可以，服务也还不错，餐厅的人气不错滴，有些东西和西提的差不多啊，这2家店不知道谁抄袭谁，反正感觉不相上下的，价格都不便宜。','150','2011-12-30 14:30:00',NULL),
	('1362a89fced567abd4906096783ad599','5e29c736ac1faacab6340c1d0cf710ab','咗祐勼迣','4',3,3,3,'上周三去王品台塑牛排吃了一顿 呵呵 还是挺享受那种小资生活的~如果点评网上多搞一搞这种团购的话就好了 团购的话价格应该都能消费的起','0','2011-06-17 21:16:00',NULL),
	('1492d80d8707235aa118a7135d08339b','5e29c736ac1faacab6340c1d0cf710ab','欢雅','4',4,4,4,'朋友请的客，带我七拐八拐来到餐厅，迎宾的小伙子小帅。台塑牛排名不虚传，真当是一分钱一分货。酥嫩可口。为回请朋友吃什么发愁。。','280','2011-08-26 15:02:00',NULL),
	('19f08e10c8b89142fd2d752201a2fed7','5e29c736ac1faacab6340c1d0cf710ab','瞳香','4',4,4,5,'久闻王品大名，周六中午去了，没想到人很多，还等了十分钟才能进去，下次去要订位．整个餐厅环境不错，服务很好，很合适情侣聚会，第一次来当然当了台塑套餐，物有所值，特别是局烤蘑菇又好看又好吃，那个牛排份量太大，最后没吃完．最不满意的是餐厅没有独立卫生间，而且门口（指电梯出口到餐厅）空空荡荡，印象较差．可能是选址的问题．','316','2011-05-21 15:15:00',NULL),
