	('1b85e5c7a8461fd1710b3b7997561e4f','5e29c736ac1faacab6340c1d0cf710ab','很久很久以后的今天','4',4,4,3,'环境真的很不错，那天和男友一块去了，点了台塑牛排，很合我的口味，男友也很满意，吃的挺开心的啊，以后还会去的，希望一直都是这么','0','2011-04-12 21:02:00',NULL),
	('01430ef2167efe784b44405d35900c7b','60e10f7ba46c6cbadf2c024cbeb26656','Iambigeater','1',2,1,1,'好唔好吃就唔知了，不过真系无起错名，D服务员真系够晒‘串’！今时今日甘ge服务态度，个个好似死老窦甘，真系唔俾个服字你都唔得！！','0','2011-12-02 14:03:00',NULL),
	('04dd4889958994864b51b8496535015a','60e10f7ba46c6cbadf2c024cbeb26656','雪后太阳','2',2,4,3,'【点评团消费】团购的生奶油巧克力蛋糕,59元,本来生奶油也比芝士成本要便宜很多,没想到店家还是要整个迷你版的蛋糕出来,巧克力也就是面上三朵小花,6寸肯定是没到了,连女儿的同学来吃蛋糕就直说你们怎么买这么小的蛋糕呀,蛋糕的口感直觉太甜,奶油还是比较滑,店的环境倒是比好多蛋糕店都来的大,之前看大家反应不错,看来店家用团购打开市场后就虎头蛇尾了.','0','2011-11-17 22:13:00',NULL),
	('055ba2b685784dbe10be60a267a368f4','60e10f7ba46c6cbadf2c024cbeb26656','安小刀','1',2,2,1,'【团购点评】团购了巧克力蛋糕，先不论蛋糕的质量怎样，接预约电话那位女性——不客气的话讲，放下电话真的想骂人。因为在珠江新城工作，之前光顾过这家店很多次，看到团购，雀跃购买。但是：预约电话过去，态度傲慢不说，时间上还挑三挑四的，让人无法忍受！串屋珠江新城这家店陆续的用团购来赚人气，但是，不客气的说，这样子的服务反而是伤害了老客户的。不会再去这家点了。真是后悔这次团购。','0','2012-01-14 14:46:00',NULL),
	('07565c33e0a676f51b478907d2d5cb4e','60e10f7ba46c6cbadf2c024cbeb26656','wtkh','3',2,4,4,'【团购点评】其实我觉得佢D蛋糕一般表哥生日堂姐买咗个蛋糕同佢庆祝正常芝士蛋糕一个咯口感几软滑，芝士味都够香浓不过铺喺面既朱古力味道乖乖呢食得出喺类似金币朱古力既味（我认知金币朱古力=廉价朱古力）所以觉得一般般呐…就算喺团购我都觉得佢少贵…','0','2011-09-12 23:11:00',NULL),
	('0a18381ca298cf39d5fd3727d16373d6','60e10f7ba46c6cbadf2c024cbeb26656','J26_虎','4',5,4,4,'朱古力品种几多价钱按克算几贵下, 买了一小盒5小粒就40元了. 食了牛奶朱古力味, 的确是纯正的朱古力而且几新鲜. 其它几粒都是加了不同的果仁, 纯度差不多.','20','2011-11-04 17:57:00',NULL),
	('0d0750eb1f8858761918d06ca9d83c2b','60e10f7ba46c6cbadf2c024cbeb26656','jesxu','4',3,3,3,'【团购点评】已经团左两个朱古力芝士蛋糕啦。真系好好吃，特别系上面一层好浓咯朱古力，中间重芝士，底下系饼干碎。太好吃啦。下次仲会继续买。不过就系提货有D麻烦，要提前预约，预约果个系手机NO.，经常唔听电话咯。','0','2011-11-19 19:38:00',NULL),
	('0d359fdd6193fcccf8c2978e6388a7f6','60e10f7ba46c6cbadf2c024cbeb26656','包子_beta','3',3,4,2,'【点评团消费】团购了巧克力芝士蛋糕,6寸蛋糕的分量十分的小巧，最多也就3-4个人吃，其实要是2个人也能全部吃完，味道嘛，还过得去，巧克力味道还挺香浓的，不会太甜。芝士味道过得去，没有天使简约的滑。饼底不错，比一般饼店的好吃。不过那么去到，装蛋糕的一次性盘子居然没有了，服务跟不上，服务员也是爱理不理的。要是原价138买一个6寸的，我是绝对不会去买的。团购的性价比就还是OK的。','59','2011-11-06 23:49:00',NULL),
	('0e12c32166ebe72b115a1400ff963ba5','60e10f7ba46c6cbadf2c024cbeb26656','ella_oct','5',4,5,3,'【点评团消费】很喜欢店内的风格，宽敞明亮，简约大方，有足够的空间提供给堂食的顾客点评团的59元6寸巧克力生奶油蛋糕，预约很顺利，提前2天网上预约，第二天店员就电话确认，然后去店内自提，服务态度也很好雪白的蛋糕点缀着3朵黑色的玫瑰花，出品很精致，巧克力很柔软，生奶油感觉有些太甜了，总体感觉还挺不错以后订蛋糕会考虑继续来这里订第二次过来取蛋糕，6寸焦糖巧克力蛋糕，蛋糕出品非常好，打5分，共6层，3层的巧克力蛋糕和3层巧克力奶油，巧克力很纯很浓，比巧克力生奶油蛋糕好吃这次的店员态度一般，那天下暴雨去取的，担心被淋湿，问店员有没有塑料的外包装袋，说没有，勉强才给了一个纸质的外包装手提袋，还说一般都不会给的，最后那个纸质的手提袋在雨中完全不堪一击','60','2011-10-15 16:35:00',NULL),
	('0efa0eb76fed7f785fa8d6784082b43d','60e10f7ba46c6cbadf2c024cbeb26656','xuanxi1','3',3,3,2,'【团购点评】是一家主推巧克力的店，装潢很漂亮，感觉不错，服务也还可以。商品确实比较贵，看着很漂亮，但是价钱都好贵。即使团购了还是觉得贵。不过巧克力很正，芝士蛋糕也很好味。可能出粮时可以吃吃，平时就不会去了。','45','2011-11-18 15:28:00',NULL),
	('11ea686e003334bd4b1db9a45c3b3900','60e10f7ba46c6cbadf2c024cbeb26656','naldowu','4',3,3,3,'【点评团消费】环境很好，很舒服，适合饭后散步或者休闲小憩到那小坐一会，有WIFI，蛋糕出品不过不失吧~喜欢甜品的朋友不妨过去试试~','50','2011-11-12 17:35:00',NULL),
	('1302f5ad54979bca22fe959e59e8827b','60e10f7ba46c6cbadf2c024cbeb26656','ginnice','1',5,3,1,'【点评团消费】名副其实的串，打电话去订蛋糕，似乎团购的不用钱买似的，第一次如此生气，我问是不是明天订隔两天也可以提蛋糕，居然挂我电话，我好声好气的打去咨询换来对客人的这么不礼貌，改变了我对这家店的好感，失望啊。','0','2011-11-05 19:32:00',NULL),
	('150cdd13e0ca7513fc682aee947e3f41','60e10f7ba46c6cbadf2c024cbeb26656','無腦','3',2,3,2,'【团购点评】之前在点评团购的蛋糕.快到期了.所以就趁住呢几日去换埋佢..环境：高档系列.服务：今次去比上次去感觉好好多..唔知服务态度系咪同工作忙碌有关系呢..上次系下午5点时去的..店内买切件的人比较多..令我感觉到啲服务都好似系有点睇人而言的感觉..不同层次有不同的对待态度咯..当时有一贵妇一次数了多切件.应该打包佐4盒以上.顿时蛋糕柜的蛋糕消失了一半左右..甘我见到甘就去问店员：“蛋糕等会还会出新一批么”店员冷冷的说：“买完就没有了”【或许没有那么冷.不过跟对待刚才那位贵妇是有明显的区别的】而这次我出门居然还有人帮忙推门.推门的是一个第一天来上班的热情经理【应该是这个职位吧】【昨天】为了和爸爸分享下午茶时段怕雨天的人冒雨去拿蛋糕来回步行9个字真系不得了啦~团购价59.因为之前有写点评累积的35蚊现金券.再没有选择.而又不想浪费的情况下.决定用24元买个蛋糕来试下咯..讲真个外表真的不吸引.而且从外表上看.仲有啲似普通蛋糕添.要切开先感受到佢似只是蛋糕铺系上面既朱古力同蛋糕镂空~切开后.甘先似芝士蛋糕个样嘛..芝士蛋糕就好大众化啦.唔会话食完觉得同其他既有咩大区别.同百成的比就实少少咯.因为用叉食蛋糕果时会整到啲蛋糕...出来.证明唔够软滑么..铺系下面的消化饼碎饼底.应该系家佐好多油既..食落有啲似乐家杏仁糖既味道啵..最特别啲既应该系铺系上面果层朱古力啦.因为食落系好似下面果只瑞士莲朱古力中间软心的味道同质感...不是标题党..有小故事噶话说刚才串屋那边打电话来了..话我琴日定既蛋糕仲未来领取..我好诚实甘回应：“昨天已经去领取了..”原来系领取后都会签名确认的..而琴日我系无做到呢一步【Ps：是店员没有叫我做咋】是店员的疏忽么..因为其实我都唔知琴日个店员有无真系稳到我个资料..因为我提供手机佢又无稳到.提供姓氏佢又搵佐一轮..之后就话ok了.帮我打包个蛋糕..只有当时有一歪念.甘就等于厄多餐食啦..全文','0','2011-11-11 15:21:00',NULL),
	('164504fc10dba5c039a57a87c8d6efe2','60e10f7ba46c6cbadf2c024cbeb26656','decのsue','4',3,3,3,'很喜欢这里的蛋糕，虽然真系有点小贵，但是味道不错的，这里的环境又唔错，下午茶点个蛋糕仔，一杯饮品就可以同三五知己叹一个下午了！','30','2011-09-14 11:18:00',NULL),
	('17522f80ed77798a1bef6ffb14c899a5','60e10f7ba46c6cbadf2c024cbeb26656','小肥豬雲妮','5',5,5,5,'环境唔错，装修特别，透明式朱古力制作工场，令人赏心悦目。芝士蛋糕香浓幼滑。。。朱古力唔会太甜太腻。。。正吖服务态度好好，好贴心周到。','30','2011-11-02 21:07:00',NULL),
	('1bd7210449c7fe6fcdf1a54eee2bb445','60e10f7ba46c6cbadf2c024cbeb26656','catjiujiujiu','4',3,3,2,'专门做巧克力的店子，据闻做巧克力的可可，牛奶都是纯外国货不是偶崇洋，不过它家的巧克力确实做得好吃，特别是巧克力蛋糕巧克力很香浓，很滑，但是不会太甜最近推出了下午茶套餐，当然不能放过啦香蕉巧克力蛋糕+巧克力手指曲奇+抹茶巧克力香蕉巧克力蛋糕，做得像花花一样可爱，超香浓巧克力蛋糕表面上有层滑滑的浓忌廉，上面还有两片厚焦糖香蕉片，香蕉味和巧克力味超配，吃起来不会腻口，还有脆脆的焦糖口感巧克力手指曲奇，香脆，不过觉得有点太甜了抹茶巧克力，很香的抹茶味，超多忌廉超滑超满足','0','2012-02-12 15:06:00',NULL),
	('1930bbed611c681374a5e51845c8b165','60e10f7ba46c6cbadf2c024cbeb26656','wang3_','4',3,3,3,'装修不错，蛋糕也好好看，好吃，特别是我这种喜欢吃甜食的，真是幸福，服务好~嘻嘻。巧克力蛋糕~~就是太贵了点，下次会再去的','0','2011-09-12 10:38:00',NULL),
	('1b5cc5b08090a731f957fa3201fa5261','60e10f7ba46c6cbadf2c024cbeb26656','微微哀','3',3,3,3,'【团购点评】滑而不腻，很好吃哟，团购是不错，原价就太贵了。环境和服务都很棒。不过就只有甜点吃，选择少让人有点纠结，我们吃了蛋糕之后再出去吃饭=。=','40','2011-11-02 13:35:00',NULL),
	('1e1c5471e01f6d5ae81f3fe2f7a1f392','60e10f7ba46c6cbadf2c024cbeb26656','cocoaning','3',2,3,2,'【点评团消费】串屋一直在出蛋糕的团购，九月三十号去下午去拿蛋糕，发现全是团的蛋糕，不过个头真是小，两个人就当餐后甜点吃掉了。服务员没什么表情，团的是巧克力芝士蛋糕，味道也还行，不过不想再买它家的了。','30','2011-10-06 01:49:00',NULL),
	('043dfc43925224eb18933396c354b7e0','6593649c28132acf030bb4702856b19e','chenlin_girl','3',2,5,4,'【试吃/体验点评】刚刚开业不久的时候好像还半价，全价去吃的有点小贵。海鲜自助，品种还是比较丰富的，特别是喜欢三文鱼、北极贝的朋友有口服了，但是蟹不敢恭维，个头实在是太小了。现做的海鲜味道也不是很好，普遍太咸。总的来说，158这个价格偏贵了。','158','2011-03-28 20:42:00',NULL),
	('070921694d08964fe86a97dc9be00194','6593649c28132acf030bb4702856b19e','黑噬','5',5,5,5,'哈根达斯无限吃，而且拂去远看你的冰激凌融化了就给你收走建议你重新拿，各种生鱼片不错，最喜欢北极贝裙边；寿司做得很好玩，各种图案，感觉橙色的鸡尾酒比粉色的好喝；我拿了很多次榴莲酥。感觉和悦中23一份3个榴莲酥差不多，所以就狠狠的吃…反正各种都吃得很爽…各种菜品都不错…觉得相对不足的是甜点一般哈','138','2011-05-18 19:55:00',NULL),
	('0559cfda8827b77952949e62e299f1eb','6593649c28132acf030bb4702856b19e','ddcc007','4',3,4,4,'【试吃/体验点评】【团购点评】某此团购去的，中午还没开门就排了N多人，我跟老妈差点没座位，后来坐上了一个加座。。。冲进去之后狂拿。。刺身就是三文鱼青口还可以，但是我对刺身不太感兴趣，所以这个没提起胃口。好一点的菜都要用桌牌点，每个桌2牌，扔到对应菜的篮子里面，要是牌子多那个菜就做的快，很快上，要是只有你一个牌子。。那就等得久啦。。我吃的最多的佛跳墙和花蟹粥。。囧。。抱了很大希望的碳烤生蚝。很失望，又小又不新鲜，比深圳的路边摊都差远了。。粤式虾饺一直是我的最爱，去了3趟才拿到了一份。。鲜榨果汁开始还多，但貌似水果用完就不榨了，所以后来就没用了，鸡尾酒也一样。。总的来说菜还算满意，一定要从开门的时候就冲进去狂拿，但是口味还是有待提高啊，高级食材做的难吃是暴殄天物呢','0','2011-07-23 10:00:00',NULL),
	('079b750f27bae89afd70db22cad06371','6593649c28132acf030bb4702856b19e','葵香酱酱酱酱','3',2,4,4,'团购去的。明明星期一中午，但是坐满了人。人多了，自然好吃的就被抢很快。烤生蚝就一直没有补盘的感觉，或者一补就被抢光了。甜品相比其他的自助餐来说比较不好。。','0','2012-01-27 16:57:00',NULL),
	('0ae12aef4036638c2e832e1eec1d3239','6593649c28132acf030bb4702856b19e','TT西瓜','4',3,4,3,'【团购点评】团购加上消费券抵用，168的晚餐我们人均113就解决了~环境还不错，都是水晶球的装潢，然后堂子也挺大菜品的话，最爱的当然是他的哈根达斯不限量，虽然一次只能取两个球，但是人少，我起码来回取了不下5次，爽啊！只是有点味道比如抹茶味，完了之后就不补货了，里面最爱的味道当然是太妃味~其他菜品比较爱的就是粤式点心那块了，榴莲酥，木瓜酥，虾饺，蒸凤爪都做得不错，还有叉烧也不错生鱼片方面，三文鱼质量一般，不够肥美，还有象牙蚌，鲍鱼片，北极贝裙边，都一般，害得我一般主攻生鱼的都没吃多少一些需要现做的菜都有点餐牌，只要把他投在要要的菜前面就可以直接送过来了，不过现做的菜里面没有什么我爱的再说他家点心做得真的不咋样，我看着就没食欲了，好在有飞饼，洋葱圈，鱿鱼圈这些小吃可以吃吃玩。话说服务员换盘子也很勤快，鸡尾酒虽然是买点之一，但是不是我的爱，倒是红酒还可以总的来说算是比较满意的一次自助。','128','2011-05-05 11:15:00',NULL),
	('0c1dbf3fd07d0a03dbb5bcc0ef024b54','6593649c28132acf030bb4702856b19e','cz950','4',4,4,4,'【试吃/体验点评】【团购点评】感觉银鲨的生意真是不错，本想着是下着小雨的周一晚上人应该不太多吧，结果相反。很喜欢银鲨的装修风格，水晶泡泡球悬于空中，很梦幻，白色的玻璃墙印着蓝色的光，仿佛置身海底，并且有美女现场演奏钢琴，气氛还不错。个人比较喜欢三文鱼、生蚝和扇贝类的海鲜，海鲜还算是比较新鲜的；港式小吃区的榴莲酥比较好吃，虾饺做的很大，但个人觉得口感一般。烧烤区的东西除了烤生蚝还不错，其它像是“骨肉相连”做的就很一般了。法式区基本上没光顾，大鱼大肉看着都腻。日式区还行，寿司做的蛮漂亮的。水果和糕点供应都比较足。饮料和酒水种类也还行，但感觉整个餐区的面积不是特别大，一眼就望穿了。服务态度和效率都蛮高的，点的餐五分钟之内肯定会到，整个用餐感觉还是比较愉快的。','168','2011-05-31 10:45:00',NULL),
	('0d59cb94dbceede80bea52ac4af3ba29','6593649c28132acf030bb4702856b19e','西瓜香水','3',2,3,2,'【试吃/体验点评】【团购点评】牛排不是一般的老。。啃都啃不动。。其他还可以。。。东西比较多，但是有点茫然，无从下手~~~环境可以，人很多。。。。大厅中央还有弹钢琴的小妹儿。。。。不错~~','158','2011-09-09 21:44:00',NULL),
	('10683eee0b5b3d42119b231714b5414a','6593649c28132acf030bb4702856b19e','tonytung','4',4,4,4,'菜品比较丰富，尤其是炖品比较出色。佛跳墙、燕窝雪蛤、鲍汁捞饭神马都很不错。哈根达斯是无限量供应的。总体上来说还是不错的','168','2011-02-04 20:53:00',NULL),
	('1198af4aa6dad7570ac2bc2c4d1c47d7','6593649c28132acf030bb4702856b19e','猪猫吃成都','4',4,2,1,'【团购点评】团购的中午场99一个人，周日中午去的。先说下服务，我们11点30到，门口等了很多人，门口的迎宾小姐说要我们在门口等着安排座位，于是给了我们一个号牌，于是我们就等着，结果发现好多号在我们后面的都进去了，一句话，管理乱，不专业，这个档次的餐厅怎么也不该是这个档次的服务啊。再说食物。总体来说很满意了，至少对得起团购价了，呵呵。刺身不错，不停地有切片补充，三文鱼也不会空盘，很好。水果就在我们旁边，但是都不怎么新鲜的样子，没怎么吃。汤品种类丰富，什么鱼翅啊，佛跳墙啊，椰汁炖官燕啊、、、噱头十足，不过内容不够丰富哦~考品需要排很长的队等，我们都没什么耐心，所以都等到后来人少了之后才去拿了一点，牛排一般，不过银鳕鱼还不错.酱烤生蚝味道可以，就是每次只烤那么几只出来，10秒不到就被抢完了，要吃到实在是需要一点战斗力的。热菜种类的确不少，不过没吃到什么让我印象深刻的味道。粤式叉烧啊那些味道不错，可惜当我尝到时已经吃饱了，所以几乎都没怎么吃。再说一下扇贝，进场就点了，结果直到我们要走了才送来，味道不错不过有点开始凉了，遗憾。哈根达斯我去那天只有4种味道，不过哈根达斯本来也就是打肿脸充胖子骗人民币的，所以...也就罢了，但是排队的人那叫一个多啊。。。茶的种类倒是很多，就是等烧水等的我鬼火冒。呵呵。甜品还算不是以次充好，不过也并不值得一提。还有很多没有尝到的菜品，总之还是值得一吃。最后说下环境。实在是人多，有点嘈杂了，环境一般。全文','99','2011-01-24 20:09:00',NULL),
	('12ccf31814e199eea1ac7969924ee0be','6593649c28132acf030bb4702856b19e','守门人','4',3,2,2,'【团购点评】刚开业的时候优惠去的，难道很偏远吗，跟大排档一样，去的时候居然要等位，那么大的场子，人满为患，好的菜品绝对很难等到，三文鱼和哈根达斯要排好长好长的队啊，太夸张了，味道很一般，胜在菜品丰富，撒子都有','98','2011-09-07 20:48:00',NULL),
	('13826c0139fa90241072d38243bd10c0','6593649c28132acf030bb4702856b19e','摩小亚','4',3,2,3,'周末去的，之前打电话问需要预定不，前台小姐说，不需要。结果12：30到的。 那才郁闷额，已经排到20几号了。没办法专门过去吃，只好拿号等啊 。在那纠结哦，最不喜欢吃东西还排队了。真想走了。还好很多人等不住就先走了。所以我们等了40几分钟终于到了。真艰辛啊。迎宾小姐把我们带带位置是去，先发餐具然后发餐卡。然后有人过来叫交费。还真怕人吃到中途跑了啊？饿得我赶紧去扫吃的了。先从我最喜欢的糕点开始哦。品种还是多，但饼干类的都不好吃。 核桃布朗尼还行，和一般的咖啡店的差不多。 慕斯蛋糕这些也还是可以。 不是什么劣质产品来充数的。紫菜卷还是多不错的，里面的肉松蛮多的。吃了很多粤式小吃，像叉烧，蒸凤爪，蒸排骨这些我都很喜欢。叉烧酥里面的叉烧肥了些，不然还是多还吃的。榴莲酥很不错，里面的榴莲吃起来很过瘾。里面的饮品我基本上都不喜欢，鲜榨果汁味道很淡，我放了些水果在里面，结果水果都不甜。 鸡尾酒没劲，完全就是很劣质的感觉。生鱼片这些还是有几样。只是我对这些没兴趣。鱼片冰镇得不够，吃起来不脆了。飞饼味道都可以。只是不是太酥脆。坚果比较少，腰果都不脆，软趴趴的。水果品种不多，都没我喜欢的。...最大噱头的哈根达斯，我就只吃了一个小球。因为排队的人很多，每人一次只能一个球。真是没意思。 看着舀冰激凌的2个男服务员，我觉得他们手应该很酸吧。几桶都舀光了，并且那么硬。里面的椰子炖官燕那，木瓜炖雪蛤那就是水啊。完全看不到内容。佛跳墙里面料还是有，只是味道一般嘛。西冷牛排这些都不咋地。 自助餐就是以数量来取胜，这质量方面还是不太高。但也就这个价嘛。最近很红的四海一家什么时候得去试试。全文','128','2011-01-17 22:19:00',NULL),
	('15078a04d8396843da698299f59d9e5b','6593649c28132acf030bb4702856b19e','jsyxf','3',2,3,2,'觉得还算okay，成都的自助餐在我看来都没什么吃的，没什么特色，实在想吃自助了，进去吃了下，打个70分的及格吧，有哈根达斯甜点','158','2010-12-27 12:03:00',NULL),
	('1550ed8956c9a322d40ceec0b571bb25','6593649c28132acf030bb4702856b19e','yummy猫','4',4,5,3,'七夕节被请客来的~(至于为什么是七夕...喵也不太清楚...)比起北京的金钱豹，这家性价比算很高的咯。同意lx，哈根达斯是重点！喵的妹子吃了七个哈根达斯，七个！！！有木有！！！喵喜欢虾和三文鱼，非常新鲜呢~蟹很难等，拿过一次之后就没拿到过了...没有吃到传说中的大闸蟹，可能是人太多了吧...七点过的时候，广播说，由于等位客人太多，凡已用餐客户在七点半前离场，每桌送红酒一瓶...哗啦啦，走了好一批人...不过偶们十二三个人，想想还是继续吃算了...木瓜椰汁味道还行，酥皮奶油汤很隐蔽，在西餐那边，没有牌子提示，但其实不好喝...东南亚风味熟食太少，想吃泰式咖喱蟹（金钱豹有的...怨念...）...鱼翅捞饭不推荐，第一次上来的那份米饭都是生的...好像中餐不错，但是喵没有吃，不划算...于是喵吃了什么捏？好像就是虾，哈根达斯...（还真是简单...）以后挣到钱了也许还会去的，环境很不错~','170','2011-09-04 14:24:00',NULL),
	('0035a8fbc196d86f70956ff3dfcf2c88','65ba10a7a2c648956322816b5e47390e','conney720','4',3,3,3,'幸好是工作日去的 一到就有位子了 而且还安排在一个比较安静的地方 而不是正对舞台挨得近的位子 服务员收盘子挺利索的 而且铁板的东西来的很快 味道也不错  那儿的东西真心蛮多的 只是甜点和冰激凌的品种少了点 其余该有也有的 我们去吃也就图个新鲜 分不清类似生鱼片的部位好坏 至少他切的都很厚 看到有很多带着小孩子的或者一大家子的 最然贵 不过在吃上似乎都舍得下本钱的','238','2012-02-01 16:04:00',NULL),
	('031e93bf4c6ba99d05b08951ee4d337a','65ba10a7a2c648956322816b5e47390e','晨曦1112','4',4,5,4,'参加婚礼去的，环境很不错的一个宴会厅，婚礼的休息室也很贴心，酒店都有配备小秘书跟随新人，休息室里有各式各样的点心，还有化妆间和卫生间，很周到的服务宴会厅现场环境也不错，就是有点挤菜式方面海鲜不错','0','2012-02-07 12:58:00',NULL),
	('03fc0bae5ad709be182efc1a8259f934','65ba10a7a2c648956322816b5e47390e','毛拾巴','2',2,1,2,'一进门我就惊了……那凳子都是80年代食堂的铁脚凳好吗！那桌子各种脏兮兮排列地密密麻麻好吗！那地板，大理石全是裂缝好吗！（顺便说一句厕所因为我一直认为厕所是很能反映一个餐厅的真实态度的——水！流！满！地！）我知道金钱豹已经今非昔比了要不是因为想不出比较通俗的请客吃饭的地方也不会去那里，但……这你妹也太差劲了吧！！！我理解这年头通货膨胀物价飞涨如今的200块肯定和很多年前的200块不能比，但200块吃食堂你也太看得起魔都人民的消费水平了吧！！！好想飙脏话……唯一能安慰自己的就是吃了点碳烤生蚝反正横竖不值200块以后再去金钱豹我是冲头。再。见。','200','2012-01-13 16:57:00',NULL),
	('046817d246c3527de578278584840c28','65ba10a7a2c648956322816b5e47390e','草莓汤','4',4,3,4,'好霸气，好可爱的名字哈，话说我最近刚买了个金钱豹的耳套子，太可爱了把。去过这里好几次的，可供挑选的美食种类还是蛮多的呢，不错哈，就是人有点多，有的我喜欢的，','0','2012-01-09 11:44:00',NULL),
	('05d31e801104df831e1ac4afae8b17b7','65ba10a7a2c648956322816b5e47390e','准噶尔的骆驼','3',2,2,2,'1月16日中午去的，两家6个人。本来赶到周一去，想着能少点人。但是一家公司年会放在这里，人多闹哄哄的，还带表演节目，我家女儿倒是看得开心。菜的品种很多，主要吃了生鱼片、海参等海鲜类。这类东西只要新鲜就好。别的没怎么尝也就不知道了，女儿手指起了一个大水泡，吃了一点点儿东西就不想吃了，可惜了。。。','0','2012-01-21 09:26:00',NULL),
	('073285c6cfe6c88a36af0907a4eebbd0','65ba10a7a2c648956322816b5e47390e','湖泊水漫','2',2,2,2,'太一般了！菜越来越难吃了！海鲜基本不新鲜，放夹子的菜也没啥味道了！以前吃金钱豹还有期待感，现在吃到他们家的菜，没特色，口味一般就越来越觉得他们家生意在走下坡路！','230','2012-01-17 16:47:00',NULL),
	('0817d4dde3a7d85abc84f3beeede5562','65ba10a7a2c648956322816b5e47390e','轻松熊行大运','4',4,4,4,'一直不太愿意吃自助餐就是因为一个价格比较高，吃的不一定好吃，然后就是我胃口不大。我觉得吃自助餐一定是要大胃王去才划算那，但是我属于吃两口就不吃了，所以绝对不划算。但是老公说要吃自助餐，想来想去还是选择了这家。当时正好有VLC的优惠券，一般晚上的价格要两百多，有优惠券好像是200.00，所以两个人手牵手就去啦。场地比较大的自助餐了，一般都是小小的，或是宾馆的宴会厅之类的。这里整个一楼都是自助餐区域那。去的时候门口还有米奇做迎宾，挺可爱的，吸引很多小朋友去合照。感觉如果是一个人来这里吃自助餐就不太合适了，如果自己去拿东西了，就没人看位置了。我们打算先兜一圈，看看都有些什么好吃的。品种挺多，从色拉，到牛肉，然后中餐，粤菜，鱼翅，小吃，日料，东南亚菜等等。据说吃自助餐有定程序的那，所以我们先来点色拉，做开胃菜。然后吃点中式小食，再来个茶壶汤，暖暖肚子垫垫底。茶壶汤吸引人，茶壶挺漂亮的，汤的味道已经不那么重要了。有了基础之后就可以放开去吃生鱼片啦，生鱼片排的很密集，显得没有那么有食欲了。那个寿司不灵，卖相挺好的，不过一方面寿司容易吃饱，关键是那个寿司味道不好，醋饭非常的生硬，...切忌。炸虾天妇罗味道还是不错的，很多日料里面天妇罗是炸蔬菜居多，虾只有一点点。这里能很豪爽的大口吃着炸虾天妇罗曾爽。烤生蚝一定要吃的，营养价值比较高。喜欢喝冬阴功汤，有个冬阴功的砂锅可以尝试一下。还有一个海鲜酥皮汤特别抢手，要守在旁边等烤箱出炉那。然后来点港式小吃，再喝个鱼翅汤。饭后来点水果和饮料，橙子切的特别贴心，造型很可爱那。最后来点精致的小甜点，看着就很SWEET啦。哈根达斯是必吃的哦，一次是两个球，我吃了五六个那，喜欢喜欢。全文','0','2012-02-08 13:37:00',NULL),
	('121e36ba6a8ccf3e44dbc7e022deb1d8','65ba10a7a2c648956322816b5e47390e','美KAY','3',2,2,2,'公司选择的年会午餐地点，进去感觉就像个高级一点的大食堂，闹哄哄的~菜品实在是毫无亮点，味道都很普通~随便吃吃啦~反正到最后我还没吃饱~','200','2012-01-18 14:04:00',NULL),
	('113837c443823785d4a79411689bb419','65ba10a7a2c648956322816b5e47390e','neawing','3',2,2,2,'表哥表嫂请吃饭，表嫂选择了这边，没想到当天有公司吃尾牙，人好多~~还要等位- -（平时不用等的~）不过也挺快的，等了20分钟就进场了，地方比汇金的大很多。菜品也很多，中西都有，我挺佩服日料师傅的，可以把三文鱼切成正方形的。。。你能再大方点不~大概是因为实在是人多太吵了，没有吃饭的气氛- -自助餐的味道也就这样了，不过与酒店的自助餐相比是胜在量上面的~~','238','2012-01-02 23:47:00',NULL),
	('14ef72349a6d005268c7c6c6af3bcf34','65ba10a7a2c648956322816b5e47390e','js20111212','3',3,4,3,'公司年会在这里，自助餐的形式，大冬天的就算是热菜也冷的很快~~菜品蛮好的，刺身系列很新鲜，考羊排，明虾都还不错~~服务员蛮周到的，一看到你盘子里有一半吃好就问你要不要换，饮料加的很起劲。环境蛮好的，很多的满月酒啦，结婚的，人气还是很旺的。大厅里面烟雾缭绕不是很喜欢，不过结婚发的喜烟吧应该是。。。要禁也很难','300','2012-02-15 10:41:00',NULL),
	('1947de43b0256d3afeb975b5a34019cd','65ba10a7a2c648956322816b5e47390e','bayala618','3',2,2,2,'人很多，像大型食堂，有的东西要抢着吃，因为个人不爱挤，热门东西常常抢不上。铁板烧不好吃，浪费了食材，不过食材也不新鲜。日料区的三文鱼还算新鲜。鱼翅基本数的出来，看到的只有笋丝。蛋糕区基本没有好吃的，还没外面面包店的好吃，面包区的酥皮奶油汤没有必胜客的好吃。饮料区种类还算可以，茶，咖啡，饮料，酸乳，酒。总之，这个价位基本是四五星酒店水平，但东西质量与口味还是有差的。如果你从未吃过自助，这里是一个选择。如果你吃过五星的自助，这里完全可以不来。','170','2012-01-26 14:30:00',NULL),
	('1c2ac5bc3c56abe8c144f21c4e904502','65ba10a7a2c648956322816b5e47390e','maggiem_522','3',2,2,2,'周末过去的，可能是节前年夜饭旺季，所以整场乌压压都是人。总体环境还不错，特别是演艺区晚上还有表演。说到食物，那真的是非常非常一般，种类不是很多，口味更是很多不尽如人意，生蚝咪咪一点点小、传说中的帝王蟹更是跑了几趟都没见着影子，冰淇淋倒吃了个饱。','238','2012-02-03 14:50:00',NULL),
	('1c8a7a05696adf006ff52ac5205fca53','65ba10a7a2c648956322816b5e47390e','易碎的水晶鞋','3',4,4,4,'因为是工作原因，所以能经常到不同的酒店吃不同的酒席。那次是帮新娘化妆，她的酒店是定在那里的。里面的环境是不错的，装修的很豪华。酒席开始来了，菜也陆续的上来。可能是酒席上的菜吃的太多了，我觉得都差不多。但我听新娘说，她跟朋友经常到这里来吃饭，点的菜要比酒席上的菜好吃多','0','2011-12-29 14:49:00',NULL),
	('1dfdc05d768b095d77aef4f5278b66cc','65ba10a7a2c648956322816b5e47390e','will_ian','4',4,3,4,'领导升职请客吃饭洗澡，未免被宰选择自助，真狡猾啊！！环境比徐家汇那家好很多，可能徐家汇那天我比较倒霉。。。这次是10人同行，不用经常跑去拿东西，人多力量大啊但是个人觉得这种菜色，这种环境238/人，性价比极低。唱歌MM也温温的觉得烤羊腿、鱼翅、抹茶味的哈根达斯好吃，啊哈~','238','2012-01-02 21:24:00',NULL),
	('006e6916270e2d08eeebc84729ea4544','6823f6d2b73ccb6321cd6024196ea53c','小三猫','3',3,2,2,'吃了2次，都是在第一市场买海鲜时候吃的6-8元好像，记不清了就选了人均7元，第一次见觉得挺新鲜的第二次买好才想起来说要不要拍个视频回去给爸妈看，于是和老公2个人边吃边等在摊位前，想着下面随便来个人买我们就能拍了。结果不知道怎么了等了10分钟居然没有来买，郁闷，最后不高兴等就回酒店了','7','2011-05-15 12:40:00',NULL),
	('012f96707d23710e4ab13f427182b84d','6823f6d2b73ccb6321cd6024196ea53c','jingyi1027','1',2,1,1,'晕死，本来觉得还不错，结果后来开始狂拉肚子，还是要注意卫生啊！一个晚上六趟厕所，伤不起啊！！！！！！','0','2012-01-26 23:03:00',NULL),
	('04ecf7ee166efe5999274d4f6a198560','6823f6d2b73ccb6321cd6024196ea53c','无聊的小猪','4',3,2,2,'这里的炒冰和我们这的做法不一样的，他们是先榨汁然后把汁水放在冰箱上炒，炒着炒着就会结冰的，超级好吃的。吃了2次呢！以后还要来吃！','5','2010-05-31 20:49:00',NULL),
	('055552f3bae8772c635f080b5931393e','6823f6d2b73ccb6321cd6024196ea53c','猪缘欲润','4',4,3,4,'去海南之前锁定了这里的“冰沙”还有“清补凉”两样东西，下决心如果不吃到绝不抬着头回上海做人，^_^。在海南没有电脑好上网，每天就捧着手机上网，拉拉拉，搞定路线，晚上杀过来，顺便一起兜兜久违的夜市。我们到达的时候大约7点多，找到了第一市场入口处的“第一个摊位”，不晓得是不是就是所谓的“第一滩”，最胸闷的是等我们逛好出来，竟然发现它前面有摆了一个冰沙滩出来，嘿嘿，无语，不过这是后话，反正我就认为我们吃的这家就是口味26的这家了。老板听说我们特地坐了飞机来光顾他，那个鸡冻哦，虽然嘴巴不说，但竟然自做主张先给我们做了，哈哈哈哈，实在对不起来的比我们早的那两位小姐，人家在旁边穷抱怨了，搞的老板很尴尬，嘿嘿。【芒果＋菠罗】（5元）：按照网上的介绍，这个口味搭配最嗲，所以我们毫不犹豫要了这个。和上海的水果炒冰相比，这里更加料足，水果更加多，而且绝对当着你的面开芒果，切菠罗，绝对新鲜。制做的是老板的女儿，新手，所以速度很忙，我们等的急死了，吊足胃口。份量比上海的多一点点，也就那么一点点，毕竟盛炒冰的塑料碗尺寸大概全国小贩私下统一过的，嘿嘿。冰沙非常细腻，水果的味道浓郁，酸酸甜甜的，夏日吃起来特别...特别爽口。一边逛一边吃，人生得意，需尽欢^_^。走过路过，真的不要错过。不走过不路过，来三亚的姐妹也不要错过，哈哈。全文','5','2010-06-05 15:52:00',NULL),
	('09e2a0cb4c91da3f7b72c0d917abed55','6823f6d2b73ccb6321cd6024196ea53c','伊波拉','4',3,1,1,'炒冰实在是简单的美味，选2种水果，跟糖水一起打成浆，跟炼乳一起在速冰机上翻炒翻炒就成品了。一份的量很大，很大，2人吃光也很勉强，不过真是很美味，推荐芒果+菠萝的组合～','5','2011-01-14 18:51:00',NULL),
	('0a08d42ef9966eddfa5efe2a34a9a5af','6823f6d2b73ccb6321cd6024196ea53c','周小窪','3',3,2,2,'第一市场门口周围有很多家 晚上各个大排档也有摊位供应 毕竟天气在那摆着 呵呵 口味自己选择 可以单点一种口味 也可以混搭 现场制作 有添加别的东西 很不爽','5','2011-01-14 06:45:00',NULL),
	('0a0e8b5c8a74edc4ac48591890d709dc','6823f6d2b73ccb6321cd6024196ea53c','lovelylouisa','4',5,2,3,'超级超级喜欢芒果炒饼，新鲜的芒果打成泥，炒成冰，简直太好吃了，是其他地方其他城市的炒冰完全没法比的，来三亚一定要吃的。','10','2011-12-06 19:36:00',NULL),
	('0c27f29e04f8a2a4bc8bb5406cde2128','6823f6d2b73ccb6321cd6024196ea53c','金小锦','5',5,1,1,'芒果炒冰好吃又大碗！在炎熱的海南是一定要吃的，尤其是逛夜市的時候一定要來一杯呢！5圓的價格好合算，，吃到最後胃一直涼。在第一市場有好多攤，隨便找一攤咯！','5','2011-04-17 19:48:00',NULL),
	('0db910f017202893cdea3dde7f725568','6823f6d2b73ccb6321cd6024196ea53c','北京大文子','4',3,2,3,'第一市场的炒冰，价格不一样，第一次，随便选了一家，8块，以后，都是六块。新鲜水果做的，有点像北京味多美的绵绵冰，只是没有那么甜，很好。喜欢。只有海南这个地方，才可以这么惬意的边逛街，边享受一大碗冰吧。','6','2011-08-10 20:03:00',NULL),
	('0e45fef7098853de428dfce2a6f65b77','6823f6d2b73ccb6321cd6024196ea53c','Nelly','3',2,2,2,'一般一般很一般。。。。虽然水果是好的， 但是那个做法=。=那个粉碎机为什么不能 洗洗干净再渣呢。还是比较喜欢上海每日新鲜的鲜果汁，干干静静的看着就舒服','5','2010-05-23 16:23:00',NULL),
	('174d6a98698f40a7d05ffa72dfefe895','6823f6d2b73ccb6321cd6024196ea53c','娜娜830122','3',3,1,1,'很有特色的炒冰 因为都是鲜果的 把水果和水放到榨汁机里炸成果汁 然后在放在炒冰机上抄 不过卫生就不敢恭维了 我要了一个不知是什么名字的水果的炒冰 结果连洗都没洗就放进去了 不过味道还是不错的','5','2010-07-31 17:25:00',NULL),
	('181319d54bdad23f0ae021e11a131004','6823f6d2b73ccb6321cd6024196ea53c','pi皮儿','4',4,1,2,'我不知道和大家找的是不是一摊~反正我去了2次，很好吃啊！就在第一市场斜对面的街~旁边有个卖陵水酸粉和印度抛饼的~炒冰是用新鲜水果做的~放了水和炼乳~口味很多~可以自由搭配~我觉得芒果菠萝的最好吃！西瓜的也不错~但是芒果香蕉的就差了点~三亚买炒冰的地方很多~价格是这里最便宜啦~值得一吃~还能顺便把清补凉和酸粉吃了~多超值啊！哈哈~口水都要流啦~可惜啊~北京的雪凝都是果汁勾兑的~色素加糖精~悲剧！','5','2010-07-14 22:30:00',NULL),
	('1ad1aec1b4e50ea341e3e5b39b9018e2','6823f6d2b73ccb6321cd6024196ea53c','mikewowayu','5',5,3,3,'超级好吃的炒冰。口感细腻。而且是当着你的面拿水果榨汁的，不用担心掉包。可惜只吃了一次，还想尝尝别的口味。不要吃太猛啊，会头疼的，呵呵。','5','2011-07-01 09:37:00',NULL),
	('1b92b158caf2c7113a8cea2072319250','6823f6d2b73ccb6321cd6024196ea53c','eric20080808','5',4,2,3,'第一次吃炒冰，感觉很新鲜。制作的方法很有意思。用的是纯水果制作的，很不错，量很大，都吃不了，买了两杯。芒果味道很浓，超值！','6','2011-09-26 11:19:00',NULL),
	('1dca8b7a57212d5fe6bf056d48e16fb0','6823f6d2b73ccb6321cd6024196ea53c','风起叶儿飞','4',4,2,3,'海南特色，必须尝尝，已经星星叨叨n久了相比之下，还是喜欢芒果的菠萝的口感比较粗糙小外甥女很喜欢，这让我很高兴','6','2011-03-11 01:47:00',NULL),
	('00753d1f547cc7a07a2121740b189e2b','6888da052837c0ea7a86f140d72ba279','番茄大棚','0',2,2,2,'和别家口味有点不太一样 但是大同小异特别喜欢口水鸡和鱼鱼呵呵呵','20','2009-07-14 21:01:00',NULL),
	('04579bcfc251d183a70a5fc638669e57','6888da052837c0ea7a86f140d72ba279','猫G','0',2,3,2,'很大一个饭店，看电梯有六层楼。今天老板请我们在当地的主管吃晚饭，根据东北朋友的提议，来到这里。包房不小，装饰也不错。服务员有点傻傻的，培训显然不够。问了一下，既非本邦以非广帮，什么菜都做。正应了上海人的说法，猪头肉三不精。点了好多好多的菜，鸡鸭鱼肉，各地做法果然都有。味道都不出彩，但也没特别难吃的。除了菜码很大，口味非常的一般般。以上海人的角度来看价格还是比较实惠的。不是我买的单，所以不太清楚十几个人花了多少钱。要求不高的话，可以来吃吃。譬如家庭聚会、朋友聚会等。饭店的名称有点小家子气，一开始还以为是个农家菜小馆。正阳街一带有几年没来了，不知不觉也开出了不少饭店。说明长春这里的生活水平也越来越高了','0','2008-04-16 22:35:00',NULL),
	('04b3bb6e116e212d36c9904dff0c3a3e','6888da052837c0ea7a86f140d72ba279','25栋','4',4,3,2,'【试吃/体验点评】菜品的味道没得挑，大部分还是很合口味的，价位也算公道。吃的很满意，去哪里的几个外地的朋友直呼很赞。。。。。。。觉得真的很不错','50','2011-03-06 12:22:00',NULL),
	('0679bbe2036cc5a190f23afc3ffa6aa3','6888da052837c0ea7a86f140d72ba279','飞火S','0',3,3,4,'装修后第一次去，以前没装修前，价格比较实惠，我和老婆那时经常去。这次是同学聚餐，选的这里，去5楼吃的，感觉像是进了宾馆，一个过道，两旁都是包房，营业面积真是不小，包房内有洗手间，还有个专门服务员服务，呵呵，点了一桌子的菜，基本剩了一半，不是味道不好，大家几乎都在忆往昔，喝酒，再说现在到饭店大鱼大肉的基本上没人爱吃了，整个桌子好像就是青菜类的受欢迎，肉菜剩了一大半。这里的菜品很丰富，烤鸭的味道不比全聚德的差，全聚德的烤鸭皮太油了，这里的还不错，而且量要比全聚德的大好多，整整一盘子，最后还省了半盘子，其他像鲑鱼什么的，一面都没吃完，我只尝了一口，我不喜欢吃鱼，不过这条鱼味道还不错。还有些印象的是茶水，我不懂茶，尝不出是什么茶，不过真的很香，很好喝，剩下的就是喝酒聊天了，旁边的服务员一直默默的服务着，很好，很和谐，很喜欢。','60','2008-08-28 19:05:00',NULL),
	('08d95ee1bd829918fbf8d6063bf12656','6888da052837c0ea7a86f140d72ba279','wenzhou_1980','0',3,3,2,'总的来说这里的味道是很不错的，不过我尤其喜欢的是这里的牛奶手撕饼，味道很棒的，有一种香香甜甜，很是诱人的味道。','70','2008-05-21 08:33:00',NULL),
	('0c50bb5b3ec8ca493dc4849caa539346','6888da052837c0ea7a86f140d72ba279','young々の意','0',3,3,2,'老妈菜馆就在我家路口，看着他成长的……装修前：菜码还行，口味还行，价钱也适中，缺点就是上菜慢点，后来也算改进了，总体来说是一个大众的菜馆，我家聚会也经常会去，妈妈不想做饭时候也会去吃，开始它刚开一位开不久，因为那个地点都倒闭了好几拨饭店了，后来因为家常，火了起来，算喜欢……历时好久的装修后：用朋友的话讲，装修得像个骨灰盒，黑黑的很压抑，但不得不说，上了档次，大厅都有隔断了，包房也很华丽。说说菜：口味还是不错的，但是不再是家常了，菜谱上海鲜鲍鱼好几篇，感觉合口的轻松的菜也不多了，而且价钱很贵，动不动就二三十块，上来菜盘子非常大菜却不多，不成比例啊，桌子放不下换了好几次小盘装。服务：感觉很不好，感觉特别不拿事，像小地痞，什么都要提醒才明白，饭店的档次上来了，服务却不靠谱，很别扭。感受：以前感觉老妈菜馆很温馨，点很合口味的菜，不贵但好吃，感觉不拘束，就是家常，和老妈手擀面，东方饺子王什么的一样。但是变成旗舰店以后，我一共去了两次，每次去过都不想再去了，三个人吃了二百多，五个人吃了四百多，说高档不高档，说家常不家常，有点bs这种变化，但是路过看见人还是挺多的，可能还是有优点我没...有发现过于主观了，各位去尝尝就知道了。ps.虾饺的馅不鲜，蛋挞等甜点很难吃，汤包不错，耳片的汤调的很好。全文','70','2008-01-06 15:56:00',NULL),
	('14e24079f79a556ff62f5acf017c51f4','6888da052837c0ea7a86f140d72ba279','weilai5656','0',3,3,3,'新装修了，环境好呀~~最佩服的就是他们什么菜都能做，燕鲍翅、海鲜、川菜、吉菜，绝对佩服后厨大师傅~~味道也都不错。','50','2008-10-12 09:27:00',NULL),
	('1951052c0c7c5fe64fb16f6949c9c644','6888da052837c0ea7a86f140d72ba279','西安华金','1',1,3,1,'去过红旗街那家感觉还行，真没想到这家店这么差还旗舰店呢，真是奇贱店啊，不在网上说说真难出我这口气，不是因为请朋友吃饭，早就和他们吵起来了。三个人点了干煸豆角、锅包肉、和剁椒鱼头，除头干煸四季豆上的挺快 后两个菜就杳无音讯了，催了半天服务员那脸那拉的比老猪腰子还长，好像包房里的才是顾客，大厅的都是要饭的，后两个菜终于上来了，尝了一下剁椒鱼头好像没做熟，还有血丝，里边的肉还发苦，叫他们重新处理一下，又等了半小时菜上来，这道菜已经面目全非了好像只是拿微波炉加热了一下，六七十块钱的剁椒鱼头就这水平？再也没有食欲了，打算结账走人，服务员马上拉个老脸面无表情过来说：“150！” ，饭店里的服务员无论岁数大小都跟步入更年期了似的，面无表情那股劲儿好像瞅谁都不顺眼。口味+服务这么给力的餐馆，我是无从消受了，以后应该不会再来了。','50','2011-02-15 18:55:00',NULL),
	('1a5e416416f48349d0ac31f0b2f42262','6888da052837c0ea7a86f140d72ba279','sglfsrt','4',3,4,5,'环境很好，干净卫生，包房不太容易订，菜呢，中规中矩，烤鸭的好坏不稳定，有的时候特好吃，有的时候一般，海鲜类的还算新鲜，就是价格挺高，小鸡榛磨粉是特色，但也是时好时坏，请客和家人聚餐还可以，服务很不错，换了菜牌之后去了两次，发现这个厨师做传统的熘肉段，特别特别的好吃，见照片，全家人都一致推荐，一盘子一会就没了，外酥里嫩，汁儿也调的好，唉，说着又馋了，跟大厅经理问了厨师的名字，可大厅经理说不知道，她们和后厨联系少，只跟厨师长说，但是她说一般这个菜系就是一个人做，不错，还有一个传统炒木耳，肯定加蚝油了，特别好吃，川菜里的宫保鸡丁，味道很好，和三俞竹苑的不相上下，很嫩，很入味，','40','2012-02-06 21:13:00',NULL),
	('1d835c8158d2084663405f1a36f3e90d','6888da052837c0ea7a86f140d72ba279','destiny_xj','0',3,3,3,'餐位很多，装修的很宽敞，要了茄子、烤鸭、莴笋、锅包肉、梅菜扣肉和海鲜大拌菜，没有期望的那么好吃，倒是感觉不在计划之内的莴笋还不错，清淡可口，总之还是不错的~','50','2009-01-02 21:01:00',NULL),
	('1d9d1a73565a399a2873823f4b48575f','6888da052837c0ea7a86f140d72ba279','卡纳里斯','4',3,4,4,'店面很大气，东北菜为主。朋友请客我和lp第一次吃到了老妈菜馆的菜。记得住菜还真不多呵呵，有茄子，烤鸭、蚬子还有啥青菜记不得了，反正吃的不是很饱，米饭是小碗的挺好看。提醒就是这里很火，饭口来的同学基本要排队了，如果请客最好预定了再来。不能跟帖是点评的一个特色哈原帖是11.1发的，现在09.12.21再修订一下12.20家里聚会再次来到这里，这次定的20人包房，由于头一次上4楼，才知道步行到2楼才能坐电梯。这个很囧哈，趁还没开始喝前吃了几个菜，味道还不错的记得住的有虾球、鸽子炖的汤、剁椒鱼、茶树菇，其他太多了一直在转桌子，哥没记住哈。这次发现饭口期间排队是避免不了的，而且车位也很紧张。 如果喝酒了就不要开车了，真的很危险~12分全部没收哈~','60','2009-12-21 13:35:00',NULL),
	('03cc804994d114894a656ab047135b1e','6ad47a54799cc8c05ebd2a6ed07593e0','倾雨晴晴','4',4,2,3,'【试吃/体验点评】不管你信不信，反正我是信了 ，这里的吃的真的好贵，来一次就大出血啊。如果不是刚好拿了奖金，如果不是已经答应了地方随朋友挑，我绝对不会吃这么奢侈的大餐。倍感安慰的是物有所值，还算能够接受这样的结局。下次敲别人的时候来这里。','400','2011-12-27 16:39:00',NULL),
	('05f7a7fd7ec755b9b8728daaa3375c06','6ad47a54799cc8c05ebd2a6ed07593e0','小资猫猫','4',4,3,3,'分数这么高，加上朋友极力推荐，当然要去尝试下了地方够偏，周围环境不咋的，进去倒是别有洞天，很日式居酒屋的感觉～海胆，平时都不太吃，今天尝试了下，还不错，感觉不要蘸芥末原味，牡丹虾，很大一个，味道不错，让服务员烤了虾头，倒感觉一般，中午的定食性价相对还可以的，要了银鳕鱼和牛肉的定食，送的东西蛮多的，色拉和汤都很不错PS:吃饭就在院子里停车免费','0','2011-12-29 09:15:00',NULL),
	('07ad9b8d1940222d136252eeb3a2af9a','6ad47a54799cc8c05ebd2a6ed07593e0','wkey','4',4,4,4,'耳闻很久的一家店，很难找，空旷的停车场里居然有家那么温暖的店，这个价格食材果然新鲜，尤其是干贝第一次吃，甘甜清脆，都好吃。','380','2011-12-20 21:21:00',NULL),
	('0b28a5a95f2e0892ec45572d0be579e5','6ad47a54799cc8c05ebd2a6ed07593e0','枫叶提督','5',5,3,4,'刺身很不错,绝对新鲜,就是价格贵了点,四片要600多大元,地方很难找,是朋友带过去的,停车时感觉一般,进去后别有洞天,不错,应该是上海最好的几家之一了,一定要订位的','400','2012-01-05 14:28:00',NULL),
	('0ef42605f343a18fa9519c9eeeba1ce7','6ad47a54799cc8c05ebd2a6ed07593e0','shiaiyue','4',4,2,1,'三文鱼不错，但价格也太贵了，175元／份都赶上可以吃自助餐了，牡丹虾200元5个，个头也没想像地大，冬天吃还真不舒服，都是冷冷地，我和lg两人消费808，总体觉得要算上海数一数二的曰式料理，那对日料的期望大打折扣了，推荐大家还是去正大吃喜多屋吧','400','2012-01-29 21:56:00',NULL),
	('10bc40ed9d3b8c0ecc8caa5a1fb80166','6ad47a54799cc8c05ebd2a6ed07593e0','ScottMoney','4',3,3,3,'圣诞大餐.牛油果太生,所以当天都不供应了.于是很遗憾没有吃到盛名的牛油果手卷.三文鱼刺身: 98元8片.&quot;厚切&quot;,大片.性价比很高.牡丹虾:200元5个.不贵.虾头处理得很用心.去壳后里面有不少料.最美味的就是以上这两个了.海胆:ms130元左右吧.老婆对其偏暗的颜色很不满,她还是喜欢东京和食的海胆.烤鳕鱼:58元.价格不高,味道也一般...黑鲔鱼拌饭:150元.鱼肉很多,饭很少.价格很贵,我宁可吃天家的拌饭......牛肉:88元.老婆大赞里面的蔬菜很好吃.牛肉么也不错...鲑鱼蒸饭:38元.也就一般啦......最后,这里的移动信号好差,点评签到居然定位到了嘉定.出门后才定位准了.刷卡也没信号,刷了5,6次才成功...总体来说口味30分有点太高了...','400','2011-12-26 11:43:00',NULL),
	('12eade500eb0445a90f4befe4f1243c9','6ad47a54799cc8c05ebd2a6ed07593e0','小番薯0731','5',5,5,4,'老公前不久去吃过了，味道赞！食材新鲜，价格贵是一定的。不过是的别人请客啦！下次也让老公请我去尝尝鲜。呵呵！','0','2012-01-09 17:51:00',NULL),
	('150789ce22257979faee242bbb743b2e','6ad47a54799cc8c05ebd2a6ed07593e0','桃儿小曼','5',4,3,4,'朋友一直推荐说他家的刺身特别棒，尤其是海胆，老实说俺一般不大吃海胆的，因为不是最新鲜的话就会比较腥气，而他家的海胆真心新鲜哦，而且个头特别的大，配上海苔片吃口感更丰富些。牡丹虾很新鲜，头建议烧味曾汤哦，很鲜美。牛油果色拉超赞的，富含维C，对皮肤特别的好。烧酒和冷温酒的选择都很多，一不小心就三瓶下肚了，微醉，状态刚刚好。餐后赠送的车厘子也超大哦。','0','2012-01-18 12:03:00',NULL),
	('1707e50718d9f707bc8e3bdae42d851f','6ad47a54799cc8c05ebd2a6ed07593e0','Jude_樱','5',4,2,3,'第一次去,一开始没有找到走过头了,其实只要在先锋路上看见吴记麻辣烫和圣澜酒店拐进去就可以了.没有定位,等了半小时做了吧台,也不错.三文魚肚很肥,每人吃2塊足矣,可以按块点的.他们家的牡丹虾,牛肉真的很嗲!下次去一定要订位,比较方便.','419','2012-01-30 21:49:00',NULL),
	('19ca83ee8cfbde7695a7d40b3f3c7031','6ad47a54799cc8c05ebd2a6ed07593e0','hahajumping','4',4,4,4,'其实很难找，像在一个工地一样，错过了又倒回来才发现的，挺贵的，不过环境和服务都很好，十分正式的日式料理，厕所很温馨，像一个日本家庭的厕所，什么都备好了。三文鱼很好吃诶，不管是刺身还是寿司，牛油果手卷我不是很喜欢，总体还不错啦，一分价钱一份货吧~','0','2012-01-05 13:33:00',NULL),
	('1ae5d4ad9434ac4239faca4a55088e7d','6ad47a54799cc8c05ebd2a6ed07593e0','樱花茱莉亚','4',4,4,4,'中午去吃的，二大二小点了银鳕鱼和牛排两份定食，比起单点的菜来，这个定食真是性价比奇高的鱼生点了招牌牡丹虾，果然非常甜且糯，虾头油炸一下很脆，连虾须也可能吃海胆是我吃过最新鲜的，没有裹紫菜三文鱼刺身非常一般，因为我吃出了冰渣子牛油果手卷很特别，味道不错还有一个烧炙鲑鱼肚寿司，也是入口即化单看那些价格要发心脏病了，寿司牡丹虾之类的都要５０元一个，还没点最贵的环境不错，进去要脱鞋，不过上卫生间时光着脚有点不适应','250','2012-01-20 16:29:00',NULL),
	('1de98896987721903e0260d18bdcc5a5','6ad47a54799cc8c05ebd2a6ed07593e0','hanksyxq','5',4,5,4,'【试吃/体验点评】【团购点评】公司聚会去的酒吞，位子很难定，要提前一个星期才能订到。我们要了20人的大包厢。装修的很日式风。生鱼片很新鲜，影响最深的还是牡丹虾，虾吃完了，虾头可以做天妇罗，太好吃了，就是价钱不便宜','300','2011-12-22 11:44:00',NULL),
	('046e40e4bdb35415ce906086264bd7f3','6adf609c174d8cd3f332e36a7be1d2a9','Ivy蚪','4',4,4,4,'【团购点评】糯米珍珠丸子一份 28元 巴别塔秘制烤翅一份 36元 摘春三味蔬一份 28元 原价合计92元，团购39元很有特色的餐厅，西餐式的中餐，价位、菜量也像西餐，有图为证环境不错，有舒服的沙发，比较安静适合约会、谈话','20','2011-06-29 09:46:00',NULL),
	('0ec224004def3e02da5be6a9e7da57fb','6adf609c174d8cd3f332e36a7be1d2a9','粉娜拉','3',2,3,3,'【团购点评】团购去的，吃不惯这里菜的味道觉得怪怪的，如果不是团购，自己是不会再去吃了。环境很小资。适合在里面上网休憩。要是为了吃，分量 有点小会吃不饱。不适合东北的风情，这店在东北开不长。认可度不高。','50','2011-07-15 10:22:00',NULL),
	('11947faf9d7cf8bd71a30a84b4a693ab','6adf609c174d8cd3f332e36a7be1d2a9','滴水流','3',2,4,4,'【团购点评】去华辰看电影的时候 常去那坐坐 价位不菲 据说有团购的时候还可以 点过意面 色拉 和甜品 味道都很对不起他家的价格 环境嘛 有种宜家的感觉 看着舒服 简约时尚','0','2011-09-11 14:49:00',NULL),
	('18f9e92d346604c0cb396d5da82c2281','6adf609c174d8cd3f332e36a7be1d2a9','吃吃一家亲','3',2,4,3,'团的59双人餐，口味一般，性价比还是很好地。环境很好，适合聊天。如果不是团的话，应该不会去。菜量小，4个菜两个人吃不觉得多，真是正常点就贵了','30','2012-01-10 18:24:00',NULL),
	('19f565b8c90a868398710b5ea0e9a309','6adf609c174d8cd3f332e36a7be1d2a9','haishi_1984','4',3,4,3,'环境真的不错啊，清净加上小音乐，特有感觉，聊天都不敢大声说话。吃的东西口味还可以吧，毕竟这种地方注重的环境，东西性价比不是很高，每个菜品量不多，点少了吃不饱，想吃饱也不能来这里了。','0','2011-06-14 21:55:00',NULL),
	('1c470af0155e92816112b01a6f53c31a','6adf609c174d8cd3f332e36a7be1d2a9','syhlr','3',2,3,2,'【团购点评】网上团购的,为了不浪费,还是去了.老婆很不喜欢他家菜的味道.我觉得还凑合.不过要是原价的话,估计在沈阳没什么市场.或许在沈阳这样的偏远地区跟不上北京上海的潮流.价格相对沈阳的消费水平,以及口味的问题,估计在沈阳立足的难度是很大的.','0','2010-10-19 21:39:00',NULL),
	('01e3538fc2c5caeb4a08363b97dc3a66','6d074b86250480ed534824a145a63eae','HERO001','3',2,2,2,'【团购点评】同样是受到团购的诱惑,忍不住买了5张券,一帮人浩浩荡荡杀进去,这期间团的人还真多,看着可怜的菜盘以及排队的人群,感到无比的后悔,但是既然来了,就加入他们吧!吃过不少自助的,价格在这个档次的有很多很多很好吃的,在这里丝毫没觉得,总体感觉很一般.很多细节我看其他朋友也都说了,我也不一一罗列.以后慎重选择.','75','2010-12-10 12:03:00',NULL),
	('00c2ce862b9a7f79e52908c725220f8a','6d074b86250480ed534824a145a63eae','丫头少吃点','4',3,3,3,'在搞活动，78一个人，但是没有哈根达斯吃了。很多人都说很好，但是自己去了，却发现也就这样，什么鱼翅汤啊，我们只拿了一碗，再也没有去吃第二碗。铁板烧还是挺好吃的，对于吃肉的我来说，还是很欢喜的。生蚝味道也一般~很不好意思的说，我挺喜欢喝那里的热巧克力，喝了N杯，是不是太不划算了？~嘿嘿还有，灯光昏暗的，我两次认错了人，那个丢脸啊！','78','2010-05-17 15:16:00',NULL),
	('05bbf1798cef0ff95159584ce46e7889','6d074b86250480ed534824a145a63eae','撒旦的牙齿','4',3,4,3,'活动期间，中午是58，晚上是78，哈根达斯25元要另外掏钱，无所谓，反正旁边的雀巢也很好吃，我吃了2盆哈哈~环境很好，地方很大，自助的选择很多，我都转晕了，那边的水蜜桃汁跟奶茶什么的都很淡，估计掺了不少的水，推荐乌梅汁，居然有气的哈哈，像汽水生蚝很失望，很瘦，味道很差，还没有青石路的好吃，失败有个酥皮鱼翅汤，同事很喜欢，我吃吃像酸辣汤还有生鱼片，鱼子片，那些都不赖烧烤区的有排骨、牛肉、烤香蕉，还有梅花肉，烤鸡翅是我的最爱哈哈','78','2010-05-20 13:48:00',NULL),
	('060f41dbed67232464045b9496a14b3e','6d074b86250480ed534824a145a63eae','cathy83917','4',3,3,3,'毕业餐去的那里，虽说价格比亚马逊贵，但是菜品比亚马逊好多，有很多寿司，最重要是还有鱼翅吃，不限量的哦，还有很多烧烤，烤鱼之类的都不错。','60','2011-06-18 20:14:00',NULL),
	('07cf241f1fc33f13388fe50f82824e3e','6d074b86250480ed534824a145a63eae','毛毛LOVE囡囡','3',2,3,2,'【点评团消费】团购去的，53一位晚餐。感觉环境不错，但是口味一般。菜种类不多，好吃的就只有生蚝和三文鱼，而且是不限量的，这点比较好。其他的真没有什么好吃的。连水果都没有什么，甜品蛋糕什么也看着没什么食欲。','55','2011-05-31 11:42:00',NULL),
	('11d323843b59438358335aac1f4de57f','6d074b86250480ed534824a145a63eae','囧囧的囧','0',3,3,2,'论坛活动 凑热闹和朋友一起去了地方很大 不错一开始战略失误 没看布置图导致拿了螃蟹回头扇贝全没了铁板烧那边真像个战场 刚做出来点放到盘子里 一眨眼就没了完全考验人的厚脸皮。。。叉烧不错 肉串最抢手当中的寿司台寿司都是新鲜制作 生鱼片要向厨师要 旋转台上基本没见到过碳烤生蚝 一次拿两 这里就考验人多力量大，拿了继续排 那个生蚝肥啊。。但是有点地方还是要改进 突然人流大增 服务有点跟不上，首先是饮料区的杯子 几次过去都不见有杯子。。拿酥皮鱼翅汤的地方还有铁板烧的地方 地上有点油腻腻总的来说 菜的品种不少 没有吃全一些东西都是放开吃的 考验个人脸皮了  哈根达斯一人一个球 凭券酒不好喝，但是看到有玻璃柜里很多酒 不知是不是拿出来卖的热饮还可以 虽然是速溶的 但是味道不是那种泡的很淡的 一杯子要按2小才能满大半杯 累啊 要排队...下次有经验了。。起码要4人同行 进场后 立马分头行动 扫螃蟹 扫扇贝 扫叉烧。。','0','2009-09-14 10:25:00',NULL),
	('1494d0436996a0016d6be8782d231b39','6d074b86250480ed534824a145a63eae','四木的猫猫','3',2,3,1,'朋友请客的，但是一般不会再来第二次了。三文鱼刺身每次都是舔着脸去要，每次只能要一盘，一盘就3小片。秋刀鱼、生蚝等都要排队，还每次只能领一点点，鱼是半条、生蚝是一个。一点都没有自助的味道！','138','2010-05-25 13:41:00',NULL),
	('163e8edc2503f28df7117c33b71e9030','6d074b86250480ed534824a145a63eae','Yue0707','3',2,2,2,'【团购点评】同事在点评上团购的券，一行4人中午同去，刚出电梯就是满满的人头，挤在外面排队等验证。好不容易等了10几分钟后，终于能进去了，看着环境还可以，转了一圈发现食物很少。很多空盘子没有添加，只有蛋糕区域还有些东西，拿个生蚝排队又是10分钟，每次限拿2个。烤肉区域更是可怜，压根就没人在烤，有很多是原价来吃的，都在惊呼上当。是我吃过最失败的自助餐，同事吃过后还拉肚子了。想挖个冰激凌都困难，冻的很厉害。明显商家不愿意搞活动','48','2011-09-07 14:19:00',NULL),
	('018f14a4412b5e45654ef95e0b750078','6e426036ee29fd970ace131bd2f0c79a','CuteOscar','3',4,1,1,'两个人花了100出头，第一次来，地址不讨好找，在一个胡同的宾馆里面，有点像食堂的感觉，服务非常之差，员工都特别***的感觉，点菜时候服务员离我有五六米远让我说，为的就是他能站在机器边上直接输进去，我很崩溃，我去的时候还好后来人渐渐开始多了，说实话这里的菜价不便宜，但是菜量不大，口味算不上最优，我也是慕名而来，对菜品还是满意的，但是有时候吃饭毕竟不仅仅是为了吃，换言之吃的不仅是口味，还是服务，是环境，是氛围，是心情所以以后应该不会再来了。。。','50','2011-11-15 18:44:00',NULL),
	('01b012e88eecc5fa7e15a7df87e76a09','6e426036ee29fd970ace131bd2f0c79a','蜜蛋YOYO','4',4,2,1,'【团购点评】去晚了等位是必然的，回回排队，预约告知要提前两三天。服务员都铞的要命，真是生意兴隆不愁没客人！味道确实不赖，点的口水鸡（这个料超足，份量绝对有）宫保鸡丁、水煮牛肉、干锅茶树菇（我吃过的比较不错的）还有个香蕉饼也不赖，香蕉的清香很勾人，不过毕竟是炸的，吃多了有点腻','60','2011-09-09 21:20:00',NULL),
	('04a9787379c9c34c097fde2ab34f4fcb','6e426036ee29fd970ace131bd2f0c79a','丿相随一生','5',5,5,5,'(*^__^*) 嘻嘻……，服务好O(∩_∩)O，才好吃。有机会还和朋友一起去，他家的装修很有特色。很时尚。适合青年人品尝~(@^_^@)~','90','2011-10-30 22:07:00',NULL),
	('0bfc612501481a1ada462bc1bc44448c','6e426036ee29fd970ace131bd2f0c79a','ovel','3',3,2,2,'每次去必等位，以前是可以打个九五折，不知道现在怎么样了。口水鸡是经典中的经典，那个佐料拌什么都好吃。麻婆豆腐味道不错，喜欢拌着米饭吃。要是人能少点，停车便宜点，就完美了！服务不是很热情吧，叫好几声能应一声就不错了！门口有个卖四川特产的小卖部，很受欢迎！','40','2011-09-06 14:22:00',NULL),
	('10cb548134f636fa506ed9bddfd3ffde','6e426036ee29fd970ace131bd2f0c79a','蓝色chrisdon','3',3,2,2,'川办餐厅，我一共去过三四次了。第一次去大概六年前，我还在读本科的时候，印象中的川办给我的感觉就是惊艳：原来北京也有这么正宗的家乡味道啊！尤其是口水鸡，每次去我都必点，次次不失望！后来的老乡聚会也多选在这里，不过因为川办在网上的名气越来越大，来的人越来越多，等位的时间越来越久了，服务越来越不好了。所以后来渐渐去得少了。最近一次去是11年的九月份，点了口水鸡，干煸泥鳅，宫保鸡丁等几个菜。口水鸡味道还是很正，不过别的几个菜就很一般了，价格也涨了不少。以后应该会很少去川办了吧。','50','2011-11-14 15:43:00',NULL),
	('14be7bc8f3cf9c834f1fccdcbee44857','6e426036ee29fd970ace131bd2f0c79a','迷死晶','3',3,3,3,'还是很怀念以前的川办，盛米饭都要自助那会儿。现在退步好多啊，装修之后好像厨子走了不少，菜单换了，口味也改良了许多，再也找不到以前的味儿了。硬菜发挥极其不稳定，唯一让我留恋的只剩下川北凉粉和土豆泥了。。。','0','2012-02-14 02:45:00',NULL),
	('15ffa51bbea527978c6b0d4099be89c9','6e426036ee29fd970ace131bd2f0c79a','糯米糍hoffenlee','4',4,3,3,'慕名而来~地方还算好找，门脸不大，外面看起来冷冷清清的，里面却火的人头攒动~【口水鸡】28米~还没端上桌，就已经闻到了香味，看到红油，以为会很辣，但是尝了一下，并不辣，鸡肉很嫩，没有骨头，可以放心大口地吃，底下有一些豆芽垫底~【宫爆鸡丁】22米~鸡肉果然有些少，味道不错，花生米很脆，很入味，酱汁调理的很到位~【鱼香肉丝】22米~也是看到推荐点的，感觉反而挺一般的，不甜偏酸~【酸辣粉】8米~最后又加的，感觉一般~','41','2012-01-15 18:29:00',NULL),
	('184127b2380815133136d72fbc32b2c6','6e426036ee29fd970ace131bd2f0c79a','小卡01','3',3,2,2,'好像提到川办大家都是“慕名而来”，这大概也算是不去终身后悔去了后悔终身的餐厅代表。去之前跟四川重庆的朋友打听了半天，评价不甚高，但是也有很多朋友喜欢吃的。今天去一上来就点了点评上排名最高的那七道菜，一一吃下来，夫妻肺片不错，口水鸡非常好，微甜的味道很合胃口，宫保鸡丁实在是杯具，担担面几乎没什么味道，水煮鱼也普通，毛血旺获得一致好评，说食材还挺新鲜。最后算下来六个人一共271，要了张发票，居然刮出个50块钱，立刻感觉这顿饭值了，哈哈。另外服务态度确实不敢恭维，感觉上永远找不到服务员，或者要了什么说了什么服务员也都没记住，只有结账的时候才麻利儿的。餐厅的位置也确实隐蔽，从协和这儿过去倒是很近，不过餐厅外面停的车牌号很彪悍，看来还是能吸引不少四川人民来吃的啊。我们去的时间比较早，4点半开门，我们5点到的，吃出来大概6点半，外面已经坐了一屋人。干什么都得趁早啊！','45','2011-12-30 12:09:00',NULL),
	('1a9317beb32aa0ec03eb2364f4235b86','6e426036ee29fd970ace131bd2f0c79a','大果粒a','5',5,3,3,'最爱川菜，跟几个爱吃川菜的朋友来这里吃。这的口水鸡不错，看见它感觉真的要留口水了，很好吃，毛血旺也很正宗也很辣，主食要的担担面，面很筋道，作料也挺 齐全的','0','2012-01-05 11:35:00',NULL),
	('1e004a741ab3cf630e3328a48868c312','6e426036ee29fd970ace131bd2f0c79a','希尔维亚','4',4,2,3,'很心水的地方 很难忘的一餐 四个女人的友谊 要了水煮鱼 毛血旺 宫爆鸡丁 馋嘴蛙 其实最爱还是馋嘴蛙 但肉肉实在太少了水煮鱼最后上的 有些饱再吃 略显油腻是个还会再去的地方','63','2011-08-05 21:09:00',NULL),
	('016328c35cfc006fcfb8423d9020e590','6e578db2c4a2aa66ab0bf2001a83b5a1','某三','3',3,4,4,'本来想去勇志的，觉得太远，就先来试试cha cha。用了点评网的券吃自助餐。对于肉量大的人而言自助餐是很划算的，但估计大多数人都容易腻。因为点了很多种肉，一起上之后很难分清哪个是哪个。坛子卡鲁比不错，牛肋条也可以。但千万别点虾，不新鲜。其他的，环境还不错，我们下午去的，人不多。服务也很好。一般情况下建议吃98元的二人套餐足矣','93','2011-12-18 18:36:00',NULL),
	('0251c538f358ad8a836cdfeb4a512cbe','6e578db2c4a2aa66ab0bf2001a83b5a1','心有灵析','3',2,2,2,'来这里只能证明你是不是个吃货。晚上的自助烧烤涮98一位，限2个钟，菜品是菜牌上两页多两行的内容。点评的优惠短信不用看，说一声就可以。93一位，另加5元送饮料畅饮。还是98。鸡肉只吃了鸡翅膀。主要烤牛肉，卡鲁比大概没人都吃了5条以上，标价38。肉质和口感应该是所有烤肉里最好的吧。西冷牛扒比较干，口感不好。牛舌也不错，就是太薄了，容易粘在烤盘上。五花肉也行，吃多了会腻。香蕉和金针菇都挺好吃。总体过于油腻。没有排烟系统，乌烟瘴气，一身一头烧烤味。','98','2012-01-13 20:58:00',NULL),
	('051722f8d5a7465b2f225a1376283f73','6e578db2c4a2aa66ab0bf2001a83b5a1','keyand','3',4,2,5,'【点评团消费】是团购餐，都不错的美食，就是没有抽烟系统，满个大堂都是烧烤的烟味，好难受的呀我看见其他烤肉店都有好的抽烟系统的，唉失望！','50','2011-09-10 06:46:00',NULL),
	('06767743b53ca70b9d6ba5651e93cbbc','6e578db2c4a2aa66ab0bf2001a83b5a1','百合阿姨','4',4,3,4,'【团购点评】东西都很好吃，服务员态度也蛮好，我和朋友足足吃够两个小时，才饱得扶墙脚软从里面出来，哈哈哈不过就是烟火气实在很大啊。。。','90','2011-08-08 23:11:00',NULL),
	('088b1f79626ddd0edd732ceac770f2ad','6e578db2c4a2aa66ab0bf2001a83b5a1','gatto阿卡','3',2,1,2,'【点评团消费】整间店的抽风不行，全店满的时候是烟雾弥漫，人离开都浑身烤肉焦味。网烤黑了不叫他不换，叫了也不一定能给你换，竟然说网还没洗好没有存货……真无语。说说吃的，肉的量太少了，团购的就预了肯定会缩水，没想到另外点的也很少，最有印象的是我们叫了一份牛仔骨，20多元，来了就只有6块麻雀大小连骨头的肉，拼起来一小碟……吃的都不知道有什么了，等烤肉的时间太久了，调大就外面焦里面不熟，调适中就等好久好久，都没得吃。最好吃的是我们叫服务员要来一些牛油，加玉米……那就根本跟店的出品无关哎，以后都不会去的了，还是去汉X山吃更好，起码料足空气好','42','2011-08-16 10:31:00',NULL),
	('098512ec670dfd7ed4d6e30844ae43d1','6e578db2c4a2aa66ab0bf2001a83b5a1','huzhirui','3',3,3,3,'日式烤肉店，都有挺多东西吃的。卡鲁比不错，牛舌也可以。肉吃多了还可以烤香蕉，烤苹果。不过就是油烟味太重了，吃完出来全身都是一股味。','0','2011-09-07 11:36:00',NULL),
	('0a59e2934dd3d80951303fad3c2cbdf0','6e578db2c4a2aa66ab0bf2001a83b5a1','liverbird','3',2,2,2,'用点评网的优惠劵，88元/人+5元指定饮料免费续杯。每道菜的原料都很一般，价钱比较贵的，必须催一、两次才会上菜。整个烤的过程，服务员不会帮你换网，所以店里烟雾弥漫不会再去了……','93','2011-08-13 22:44:00',NULL),
	('0adfea22db6f61a79cde10e4b3b8858e','6e578db2c4a2aa66ab0bf2001a83b5a1','laiyxxx','5',4,3,3,'【点评团消费】团购了88元的双人套餐，有以下菜色：- 肥牛盖饭————肥牛分量挺足的，跟吉野家的差不多（我觉得）- 坛子猪五花肉————听说是招牌菜，真的很好吃，烤完的五花肉不肥不腻很香- 特选卡鲁比- 上等牛舌————很爽- 鸡胗————很爽- 香菇————很原味，好吃！- 苹果————这个很特别鸡中翅、鸡腿肉、培根、鸭胸肉、鱿鱼足、大葱、菜椒、 饮料自己动手烤肉很有趣而且食物很好吃呢！虽然每份肉都只是几片，但是品种多而且有盖饭，所以总的来说分量挺足够的，我跟男友都吃得饱饱的！','0','2012-02-02 16:20:00',NULL),
	('0d93dc2b50a2f3aed3470cee6fe33169','6e578db2c4a2aa66ab0bf2001a83b5a1','一旧雲','4',4,3,3,'【团购点评】仅售116元！原价156元的CHACHA日式烤肉涮涮锅滋味火热午市烤肉双人自助餐1份：坛子卡鲁比、坛子五花肉、卡鲁比、猪颈肉、鸡中翅、鸡腿肉、培根、鸭胸肉等15款肉类任吃+鱿鱼、鱿鱼足、带头大虾3款海鲜类任吃+菜椒、红薯、椰菜、洋葱、香菇、香芋等13款蔬菜任吃+雪碧/可乐/橙汁（任选2杯）+米饭任吃！吃过真系物超所值，啖啖肉，成口油，都几济。不过，还好有些蔬菜落肚。吃烧烤，肉同洋葱、大葱真系绝配，缺一不可。我见其它台的客人，净系斋放肉落去烧，烧到着火，甚至成舊碳咁，变成“炭烧卡鲁比”，我真噔他地悲哀！如果抽气效果好D就好啦，满意今日的午餐！','58','2011-12-04 14:35:00',NULL),
	('14f1d648ddb9eb24ced1be0a076f6ab3','6e578db2c4a2aa66ab0bf2001a83b5a1','riokwok','3',2,1,2,'有自助餐，可以同时食火锅同埋烤肉，肥牛任食好正，不过生蚝非常细只，而且用柠檬浸左好耐，非常酸，完全食唔出肉味，应该系放左好耐唔新鲜嘅。排气非常差，一烤肉就全场都系，食完由头到脚全身都系烧烤味，建议去之前换上方便更换且准备换洗嘅衫裤，女士们绝对要翻去洗头，仲唔包洗得走喔。','98','2012-02-06 21:46:00',NULL),
	('18377be6200d540fc62e66db68f18c61','6e578db2c4a2aa66ab0bf2001a83b5a1','wing330911','4',4,2,4,'系点评网见到中午78蚊位，专登过嚟试下！星期日中午过咗12点到，都唔系好多人！我同老公两个净喺要咗78蚊位嘅自助烤肉（火锅加10蚊位，汽水加12蚊位！）因为本身有水提供，所以无点汽水，而且饮汽水只会加速饱肚！我哋将各款牛肉都上咗一次，然后最好食嘅几款再不停点！最好食就系坛子XX，唔记得个名，总之喺坛子嘅，都可以点多几次！我哋系极度肚饿嘅情况下疯狂砌咗一个钟，已经投降了！呵呵……除咗同各位讲嘅油烟问题，食完真喺一身都油烟味！基本满意！服务都几好，如果有优惠会再嚟噶！','78','2011-07-31 18:07:00',NULL),
	('197e8d196556e6d16afd983aedbdd5cb','6e578db2c4a2aa66ab0bf2001a83b5a1','肥NEL','4',4,3,3,'【点评团消费】即将过期噶团购餐！依然系大众点评团噶产物！呢度地方5系咁就脚！虽然靠近地铁！但系行嚟中石化大厦之后！仲要落楼下负一层！兜咗好几圈先稳到具体所在地！店内装修简洁！台与台之间布置分层分区！但间隔不大！人多就吵了！烤炉系电热噶铁网烤炉！而唯一问题系排风5好！D油烟四围转！一般吃饱之后！就带住成身油味同烤肉味离开！不过呢度员工服务态度比较好！且日语水平较高！  坛子特选卡鲁比！特选卡鲁比！卡鲁比系提取自第七至第九节脊骨部，含丰富大理石纹脂肪！当然自己眼力5系咁好！根本无法区分！不过坛子噶卡鲁比就更大块！不过呢度牛肉经过烤制！加上胡椒粉！响8-9成熟果阵醮上少许酱汁！味道确实很好！浓郁而甘香！绝无杂质噶口感~~不过千祈5好烤得太耐~~  上等牛舌！一直喜爱噶肉类！！轻烤则熟！！爽脆鲜味！！  坛子猪五花肉！！同坛子卡鲁比一样系大块噶五花肉！！肥肉甘香！瘦肉清爽！  鸡腿肉！！同样系烧烤入面最喜爱噶食物！特别由于鸡腿肉久烤而不容易烤焦！腌制得味道适中！  带头大虾！！大虾就夸张了！细虾就真！  香菇！干身噶鲜菇！适合烤煮！！  大葱！5太习惯食大葱！而且感觉太粗了~  菜椒！！烤干身后好爽脆！！  ...苹果片！！放响锡纸上面烤！吸收蜂蜜同黄油噶味道！不过感觉怪怪地！  迷你牛肉盖饭！！系我最喜爱噶肥牛盖饭！肥牛鲜嫩！将老婆果碗都食了！  饮料！咁热噶地方！冻饮好关键！  蔬菜汤！自己另外叫噶汤水！！清一清烤肉噶热火！！味道清新！！  总体嚟讲味道较好！！而且自娱自乐！！希望入面空气可以改善一下！全文','50','2011-11-06 21:15:00',NULL),
	('1a22acebf78e513ae82eaeb8dfecb858','6e578db2c4a2aa66ab0bf2001a83b5a1','小伯伯','4',4,3,3,'【团购点评】团购的两人餐，环境还可以，肉的品质也可以，食物的味道很不错，尤其是肥牛盖饭，就是油烟味太重，希望以后能改进。','40','2011-09-18 13:15:00',NULL),
	('1b9a678873fcc724a8fbee48c4eae191','6e578db2c4a2aa66ab0bf2001a83b5a1','rosaceae','3',3,1,2,'环境简直可以用恶劣形容，太可怕了，作为日式烤肉店，简直像火灾现场，到处蒙查查桌上全是油烤肉味道还可以，看得出腌制是花了番功夫，烤肉汁的味道也不错，但其他东西就非常一般一般一般了。墙上挂的牌子显示，这里的卫生质量是C级，确实有些问题','60','2011-08-22 09:55:00',NULL),
	('1d9da384dcb9d1d8567a6d47b3bda3f5','6e578db2c4a2aa66ab0bf2001a83b5a1','游乐籽','3',2,3,4,'【点评团消费】团购了个双人套餐特意选个人不太多的时间去所以油烟味不浓，衣服上也没有留味看着每盘奉上来一丁点的肉虽然之前有了心理准备，但还是有点失望要不收贵点，加大量嘛，这样到喉不到肺，还好是两个女孩子吃，勉强够了地方还是很宽敞的，坐位也很舒服柔和的灯光，还一直播着歌，蘸料有点少菇更是少，','0','2011-10-17 09:25:00',NULL),
	('00b67a2f4165eee64fef26138f4b68d4','71b826beca9253aa2140e162a6280646','stacy007','4',4,2,2,'听名字像个小店，没想到是个大酒楼，中午去的时候还有人摆喜酒，超级热闹。印象最深的是鱼头薄饼，上面的饼超好吃，山西的面食很吃的惯，做的都不错。这里菜量都蛮大的，2个人都没法点，因为看酒店地图以为就差2条马路，没想到这个迎泽大街那么长，我走了1小时，所以很激动的点了一桌菜，怎么也要弥补一下对这个饭店的期望。','80','2010-07-16 19:13:00',NULL),
	('0abbcd0c73fa17ce9c8c0149acf7606d','71b826beca9253aa2140e162a6280646','dzb999','4',3,3,3,'点菜方式比较有意思，没菜谱，直接把成品或者备品放在大展台上，客人过去自己看，非常直观。做面食的都是现场展示，观感很好。熬鱼味道不错，朋友推荐的，所以点了两条全吃完了。主食“拨烂子”（音译）拌上些作料，非常好吃。凉菜感觉一般，“碗托儿”（音译）倒是味道不错。总体感觉能够在这里吃到晋菜的神韵。','0','2009-12-18 15:40:00',NULL),
	('0cc5c6dc9e40e1c811a732ae82883d9a','71b826beca9253aa2140e162a6280646','s_fr','4',4,3,3,'这饭店真的不错 第一次去可能会找不到 因为要进院子里 不过在街边上有他们的迎宾员 停车位充足 菜比较有特色 味道也很好 难得有去了一次还想再去的饭店','50','2010-08-15 14:45:00',NULL),
	('0e8694bc1bdf4b5798422d261c8b2406','71b826beca9253aa2140e162a6280646','lby0511','4',5,5,2,'首先说说环境，二楼非常不错较安静，但是二楼客人也得在一楼点餐，较麻烦不够人性化，一楼有点乱。点了过油肉，味道还好没有特别喜欢也没有特别不喜欢，just soso！环境比菜品有可圈可点之处！','44','2010-09-17 14:01:00',NULL),
	('0ece03cfc01587ca81b4880fb0a01d53','71b826beca9253aa2140e162a6280646','海鲜至上','4',3,3,2,'店在楼后面，不过离政府挺进的，生意不错。价格比较适中。看样品点菜。服务不好。川味佛跳墙以及鱼唇价格与其他地方相比不贵，随便吃点还有栲栳栳、石锅豆腐、过油肉，牛肉锅仔都不错。值得去吃一次。','95','2011-04-19 01:06:00',NULL),
	('1044a789303aab65415ccda0c7ad507f','71b826beca9253aa2140e162a6280646','alexbo','4',4,3,3,'老爸过生日时来的，饭菜和某些饭店一样，是自己看着样品去点的，比较直观，赞下。喜欢这儿的面食，炒的莜面很不错。农家炖菜也是可以的。','45','2010-12-08 00:14:00',NULL),
	('1572b94f782f5ce467663c4366debf85','71b826beca9253aa2140e162a6280646','小白回来了','4',4,3,3,'喜欢他家的羊排和烤鱼，觉得超好吃！菜量比较大，很实惠，有点东北的风格。适合商务宴请，和朋友聚会。不掉档次，而且味道也好。','0','2010-05-31 23:27:00',NULL),
	('1639e6033e060fb066f3e8c2d488f958','71b826beca9253aa2140e162a6280646','huabeizhiyao','0',4,3,2,'这个地方的评价居然这么少？这个地方值得一去啊！特别同意木木的宝宝！！我3天之内去了两次，嘿嘿，第三次也不远了！菜品都挺特别的，而且味道也不差。第一次特别搞笑，3人去的，我跟其中一个朋友去一楼点菜，一气点了7个，两个汤，打算不要饮料了。后来菜上齐了，都快吃完了才发现，没点肉菜！3人都有点傻眼了。那时候就暗暗打算过两天要再来吃过！！呵呵果然，第二次比较成功呢！第三次也不远啦！不过价格是有点嫌贵，适合偶尔奢侈一次。','66','2008-03-19 10:05:00',NULL),
	('19d2634c355d6b01c246dad9b720f8bc','71b826beca9253aa2140e162a6280646','馋死人不偿命','0',3,3,2,'每次来太原都住在迎泽大街的酒店,同事为了方便,午餐也都是安排在&quot;风味大王&quot;.虽然我更想出去走走,边走边吃...城市和去年没有什么太多的变化,新的飞机场建好了,天空污染依旧.就好像上海现在为了迎接世博,把市中心的居民楼面楼粉刷一新,遮掩住的是房屋内部的悲惨世界.山西人真是把面做到了极致,面可以炒,蒸,煮,炝锅儿,造型也是层出不穷...我吃饭喜欢蘸醋,尤其是吃面,在这里有一种如鱼得水的感觉.炒烙烙配着大葱,还有看不见的蒜末儿,面十分筋道,就是用塑料筷子夹着有点困难,三两片就着醋,其他食品我可以几乎无视. 猫耳朵是我在很小时就会做的面食,搓啊搓,然后扔进滚烫的水里煮,好玩又好吃,端起碗的那刹那,儿童时代的香气,习惯,味道一下子扑面而来.还好,我们明天就可以去陕西了,虽然离家还有段路,至少乡音能拉近距离. 每当汽车驶入陕西境内,心情就莫名其妙的开朗,家里没有什么人留在那里,清明的时候更没能过来看看...本想可以在这里吃上一碗真正的沁州黄熬的小米粥作为结束,这样的话,也许我会微微感到甜蜜.','0','2009-05-12 23:10:00',NULL),
	('054a0c3a405d04f8696c23d8b647b6ed','7250acc49322bd090706dcddfc8d8f4f','o美食达人o','4',3,3,3,'要的烤五花肉，石锅拌饭，寿司，饮料是免费的挺好喝的。餐巾纸也是免费的，很人性化。烤五花肉确实不错，比别的地方都好吃，算是特色了，关键也要会烤，一面烤五分熟另一面稍微靠一下就行，沾上料很爽口。和朋友两个人去的，花了70左右吧。后来朋友又和对象去了！地点很不错，位于金安的“顶楼”，因为商场“透明的穹顶”，仿佛一伸手就可以“触摸到天空”，加上店内空间“宽敞”、布置“清新”，座位“私密性好”，整体环境非常“适合聊天”。','35','2011-06-10 10:18:00',NULL),
	('0945a236286e7ccadf1957d23df9c4e6','7250acc49322bd090706dcddfc8d8f4f','开开心心鲁西西','0',5,5,5,'一直以为很贵，其实不贵，火锅面很好，一份足够2个人吃啦，拌饭也很正宗。小菜也精致可口。建议大家都尝尝牛肉火锅面，虽然很像辛辣面，但是料还是很足的，服务员态度也好哦~~','30','2009-04-25 19:59:00',NULL),
	('09641047fd4311d6d1ff9da2db1bd18b','7250acc49322bd090706dcddfc8d8f4f','天空中架起的桥','0',3,3,2,'朋友推荐给我的这家店，说是他们家的石锅拌饭特别的好吃，所以我就来这里尝试了一下，但是给我的感觉也还好，呵。他们家的烤肉味道不错，但是相对来说我更喜欢去阿妈妮。','0','2009-07-16 10:55:00',NULL),
	('0b5b3aed4119c9def7357de932462577','7250acc49322bd090706dcddfc8d8f4f','东林土木','1',1,2,4,'这家吃饭是我的一个噩梦。我记忆中，一般得韩餐都是给烤好了上来。这家全凭借自己来烤，掌握火候，我看根本不用雇佣厨师，有人给切肉就好。问服务员，也是态度恶劣，无人给烤。后来遇到一个好心人，他其实就是送炭火的人，帮我们烤了一下肉，教了一下怎么烤，真的很感谢他。以后啊，不会再去了。自己烤得东西，味道真的不怎么样的。哈哈。','50','2011-08-24 15:02:00',NULL),
	('0cccfbfb7861931ca5bdd3e8dc0652bb','7250acc49322bd090706dcddfc8d8f4f','bunny贪吃兔','0',5,5,4,'在点评上看好了去吃的倒是中央大街都没怎么好好逛一直走到这里 就冲进去因为当时确实也是饿了啊哈直奔到顶楼大爱那里的环境人也不算太多 很舒服 点了一个鳕鱼锅里面的料太丰富了吃了半天感觉也还有好多不错呀~如果以后还有机会去哈尔滨一定要再去一次这里~','30','2009-09-23 11:41:00',NULL),
	('0e90364c0b0b32e7f6bb2f2505950dec','7250acc49322bd090706dcddfc8d8f4f','嘟嘟小蘑菇','4',5,5,2,'环境很好，望望楼下的商场，挺美的。牛肉面火锅很好吃，烤五花肉不错，不怎么肥。两个人去的，也点不了太多东西吃。感觉她们家服务员很怪，让人不舒服的感觉。','40','2010-06-24 10:41:00',NULL),
	('0f5ec56995be15bd052d67c77809a734','7250acc49322bd090706dcddfc8d8f4f','烟花三月下米粥','1',2,3,1,'服务员不停地推荐88元鲑鱼火锅，说是最好吃的，点了，结果特别特别腥，鲑鱼还没有入味，好像没有煮开锅就端上来了，难道韩国人这么不会做鱼吗？在我们的再三要求下，服务员才把底炉打开继续加热，底炉里面好多垃圾没有清理很影响食欲。加热了好久还是依然腥。只有石锅拌饭还可以，不过很少有韩国馆能把石锅拌饭也做得难吃的。居高临下看欧罗巴的大堂感觉还不错，欧罗巴人依然那么少。','55','2010-04-01 22:18:00',NULL),
	('0fdfdbbac75b1541efb072f716459513','7250acc49322bd090706dcddfc8d8f4f','云芊','4',2,3,1,'果然每个人对食物的选择口味都不相同诶~不过它家是我来哈尔滨之后吃过最不爽的一顿!再也不会去了!!!口味实在不是一般差!!!因为去的时候不是饭点儿(1点半)，那服务员一个个的屁股都黏在椅子上不起来要不就埋头睡觉...也不知道老板是怎么想雇佣了这么一帮人点菜的时候服务态度还没差到极点我们烤肉进行到一半的时候让服务员换个篦子那女的居然说还能用~肉都糊在上面了叫还能用估计是看我和宝贝都是学生好欺负~我真想把那东西甩她脸上去不过我还是没跟她吵,只是态度强硬的换了篦子反正同样在金安的五楼,王将跟它截然不同~还是多跟别家学一学吧这种店怎么能开到现在呢,疑惑疑惑','45','2009-07-22 13:32:00',NULL),
	('10a61ed7254a7ef163f715036b957fda','7250acc49322bd090706dcddfc8d8f4f','就好这一小口','0',3,4,2,'和朋友两个人去的 ，当时看到别的桌都在吃火锅，我们就点了烤肉，肥牛很是厚道，大片，切得厚，肉也嫩还点了一盘秘制肥羊，是已经腌制好的条状羊肉，非常美味烤肉还赠蔬菜，就是上的有点晚，都快吃完了才上来，再点了一盘磨菇，上面涂了黄油，烤的时候非常香。中间还有一次上错菜的，幸好我们问了一句，不然那鳕鱼就要进我肚子里了冷面煮的不硬，我这种肠胃不好但又非常喜爱冷面的人来说吃这个刚好。赠的小菜碟送的太晚了，我们都快吃完了才上来服务员态度有待改进','38','2008-10-19 00:36:00',NULL),
	('12f312f898a8281f3ba3034da18b88a3','7250acc49322bd090706dcddfc8d8f4f','野原不二家','0',3,3,3,'总和朋友来吃，为此还请妈妈来尝过，味道很不错，肉都是人家帮你考，我很喜欢吃那个新西兰羊排，不腻还有口感，拌饭也很赞~','50','2009-09-21 16:04:00',NULL),
	('1635a39525a410584a0883fee81fe0bb','7250acc49322bd090706dcddfc8d8f4f','酸甜苦辣咸丫头','3',3,4,3,'韩式烤牛肉，这可不是普通的烤肉，居然是带汤的，第一回吃这样的。用了个锡盘烤的，等一会就能吃了，烤完你猜像什么？像涮羊肉，呵呵，味道还不错，盘子里不光有牛肉，还有金针蘑，木耳什么的，搭配得很好，得趁热吃，凉了就凝油了~~28元钱，不便宜阿，当吃个新鲜了~~炒年糕，味道很不错，里面还加了木耳，颜色看着就喜欢，就是盘子有点小哦，呵呵，记得是16元吧~~年糕很有嚼劲，喜欢~~土豆饼，12元，做得倒是蛮精致的，就是味道差了点，吃第一个的时候感觉还可以，后来就不愿吃了，因为实在没什么特色，可惜了~~总体来说，这里的环境是很好的，服务也很好，我很喜欢，毕竟是在中央大街上~~但价格也真是贵哦，和口味比起来实在不怎么样，不如去吃一些韩国的小店呢~~————————————————————————————————————————————这次再来，改观不少，环境还是那么的好，点了牛肉面火锅，超级好吃的，很有味道，里面菜菜也不少，自己很喜欢~干豆腐丝，蛮有味道的，稍稍有点硬~','30','2012-01-09 21:37:00',NULL),
	('19429d81c15901aaf86e6ce5c968b80b','7250acc49322bd090706dcddfc8d8f4f','臭妞猪黑','3',3,3,3,'记得当时为了就近去过一次，还是前年去的，没有留下太多印象，只记得每桌都是隔开的有点像将军牛排的隔断，肉还嫩嫩的，当时吃的还蛮舒服的，感觉比在萨拉伯尔吃的舒服些！但我对这类韩餐实在无好感，而且这里又没有萨拉伯尔高丽园有名气再未光顾过！每次去萨拉伯尔高丽园都是姐姐张罗的，韩餐不是我和我老公的菜，那里好像姐姐满钟爱的！不过这些店确实都还蛮安静的！','0','2011-01-15 11:41:00',NULL),
	('1b5dda995973702439902c653b54d4d0','7250acc49322bd090706dcddfc8d8f4f','董豆豆','0',3,4,3,'感觉他家的环境还是不错我很喜欢逛金安 所以总去那吃冷面的味道不错 火锅面也还好 感觉烤肉有点小贵 有个鱼子酱石锅拌饭其实和普通的石锅拌饭没什么区别 根本吃不出来鱼子酱...烤香菇好香好香 推荐','40','2009-04-19 19:30:00',NULL),
	('01a3832d37ca390ec54f7eff1174b89f','72a62fc98705a6523bae387461c7101d','餂飠達秂','4',3,3,3,'和朋友一起来的 环境一般 服务态度 还好他们家服务员穿的狠夏威夷 呵呵 推荐一下蜜汁叉烧 鲜虾云吞 港式奶茶下次常常蛋挞','30','2010-10-18 20:50:00',NULL),
	('03eea2984b5e86ca4f3989369730bd0b','72a62fc98705a6523bae387461c7101d','kathryn3','5',3,4,2,'最早店去的时候还是很乱的，但是那是头一次去吃干炒牛河、鸡翅煲，味道是真的很好。以至于以后到别家吃干炒牛河都觉得味道不对。装修以后的店是比较好看了，但发现味道也变了不少。觉得梅菜排骨饭、特色炒饭不错。','30','2010-08-27 14:46:00',NULL),
	('03f6e9a039e20aa6ff25bab1b91482fb','72a62fc98705a6523bae387461c7101d','_由依喵','5',4,2,3,'去的时候刚好是中午，人比较多，等了大概20分钟吧，可以去对面屈臣氏逛一下。。非常喜欢蜜汁叉烧，光是看着就很有食欲了~菜量是刚刚好。另外推荐芒果西米露，味道好，量也很足，性价比很高~服务态度很不错，就是餐厅人多，吵是没有办法的了~','50','2011-08-11 13:32:00',NULL),
	('06b18cafa6e1a5b507e86f0fbb90e40d','72a62fc98705a6523bae387461c7101d','不吃葱花','4',4,3,4,'没去店里吃过，每次都是吃的饱饱的，路过的时候去买甜点。榴莲酥不是多层酥皮的那种，内馅不是很饱满。蛋挞当然没话说。紫薯酥真是很出乎意料，外皮酥软，内里不是很甜，刚刚好。南瓜挞还是什么的味道也不错，上面还撒了桂花蜜，不过有点甜，吃点点还觉得不错。','8','2011-09-08 21:08:00',NULL),
	('0859f1288f50b745a8050dd3664bf1f7','72a62fc98705a6523bae387461c7101d','cccc96','4',3,3,3,'味道确实接近香港的尖沙嘴的餐厅----注意不是褒奖，面条也是那样的特色，不太符合北方人的口感。蛋挞是大连市做得比较好的，不妨试试。','40','2010-12-10 13:59:00',NULL),
	('08e913c63ac2a3b539f75ca2db0323b3','72a62fc98705a6523bae387461c7101d','rabbit2213','4',4,3,3,'上次放假回家时去吃，发现他们家重新装修了，还是喜欢他家以前的装修，虽然没现在的好，但是挺有香港茶餐厅的味道。店面装修后，菜品也有改善，比以前的菜品种类多，味道也不错。最主要的是上菜快了，以前去吃个饭要等好久。。。依旧爱他的蛋挞，只是价钱在一直飙升。强烈介意能刷卡，都什么年代了，竟然不能刷卡。。。','40','2011-01-11 11:54:00',NULL),
	('0efe2f41b4d8c0c29d3203114f2639bf','72a62fc98705a6523bae387461c7101d','tsccq','4',3,2,2,'【试吃/体验点评】都快成食堂了，是一家口味环境都还不错的餐厅。青泥洼便宜又好吃的东西不多，尖沙咀很突出了。。。。东西差不多都吃过，除了新出的那个什么XO酱炒什么什么菜还没尝过，几乎都吃遍了。。。他们家一般只留下好吃的菜，前几年那个新打的什么炸排骨现在都没有了。。所以留下的应该都是是相当不错的东西。。总之，菜牌上的菜点什么都可以了，就看个人口味啦。。总之还是不错了','60','2011-06-18 10:39:00',NULL),
	('1614cb69fe083d2304d62afbedf36eab','72a62fc98705a6523bae387461c7101d','杰西卡的猫','5',5,3,3,'我是这家店的忠实顾客,常和闺蜜来吃饭,它家不管什么时刻都门庭若市,还是有原因的,毕竟大连正宗的港式茶餐厅数得过来.小不足是经常等座,跟以前比涨价还蛮多.蜜汁叉烧香甜有咬劲,肉质很好,不肥不瘦,没有肉的异味.难得! 配饭和咸蛋很搭!鲜虾云吞真的鲜,没有肉的油腻感,让不爱吃云吞的我也能整碗吃完.港式奶茶一直很爱,和其他店的味道就是不同.虽然崇尚健康的我深知奶茶不是健康饮品,平时几乎不喝,但喝的话一定是喝这家的.干炒牛河虽然看起来油腻,但吃起来不太会,而且河粉非常入味,吃了几次还没厌倦.梅菜系列不多说了,本身就够味,一直都保持水准.只是不要再涨价了,已经在茶餐厅领域偏高了.','50','2011-11-14 16:24:00',NULL),
	('17adad061ac9f53856392e30bcef450d','72a62fc98705a6523bae387461c7101d','小水水的私房菜','4',4,4,3,'上学的时候就喜欢的茶餐厅重新装修以后东西变贵了啊T T 喜欢他家的各种甜品和点心，蛋挞奶茶叉烧包什么的。奶茶很香很滑，蛋挞甩肯德基的N条街，叉烧包很香很“叉烧”下午茶套餐很不错，如果不着急吃饭的话，下午来，点个下午茶套餐，再来上一碗香滑QQ的鲜虾云吞。很美味而且不用等位哦~','50','2012-02-13 17:22:00',NULL),
	('1a42b61b5f8d44d33b7f947abc8d4753','72a62fc98705a6523bae387461c7101d','短暂的短暂','4',4,3,3,'去的时候已经是13：00了，但是里面却依旧坐满了人，服务员很热情，带我们到了一个空座后，又接着端上水和菜单，一会功夫就来了至少3个服务员问我们是否看好菜单需要点菜。。。我要的蛋挞和榴莲酥，妈妈要的蜜汁叉烧饭~蛋挞不愧是这里的招牌，的确好吃，比KFc的强，软软的酥酥的，口感非常棒~榴莲酥我觉得很一般，有点小腻。至于蜜汁叉烧么，倒是不错，很地道的味道~','30','2010-07-22 08:38:00',NULL),
	('1d8a11f6c198ea67527b1e2771f7a14c','72a62fc98705a6523bae387461c7101d','TANEI','3',3,2,2,'咖喱牛腩饭味道还可以，就是比较淡一些。酱油鸡饭就很一般,味道不浓，而且鸡块给得很少。。。还都是些边边角角。。。顾名思义鲜虾云吞，怎么能拿瘦肉来滥竽充数呢？虾肉少得可怜。。。干炒牛河味道不错。腊味萝卜糕也还可以。奶茶的话，不够香滑，不过还算可以接受。可能是常听说这家店爆满，期望值有点高了。','80','2011-05-01 07:04:00',NULL),
	('008596083a5ed6141ad4e509041ce1e0','72d3ba29b99e10ba4629985de59849d9','Betty85','4',3,3,3,'公司请客吃饭时候去的，整体环境不错，也都挺整洁干净的，服务员的服务中等水准吧。点了很多菜，比较有印象的就是刺身类，材料都算挺新鲜的了。除了刺身外，天妇罗就是大家的挚爱了。嘿嘿。寿司都不错，可是当天吃的时候对寿司的饭团不是很满意...感觉粘度和口感都不是太近人意。','50','2011-06-12 10:43:00',NULL),
	('007b3ecec503862aadbb148d845a5634','72d3ba29b99e10ba4629985de59849d9','zhonghongjk','3',3,3,3,'那里的寿司不算正宗，但志在够经济，而且用餐环境也比较舒适。海鲜粥比较可口，两个人一锅都可以吃完。一个装载美好回忆的地方','50','2012-01-06 13:17:00',NULL),
	('01899ddcecb3616c3e189cfad8b69ed4','72d3ba29b99e10ba4629985de59849d9','为食傻猫','4',3,4,3,'【团购点评】哈哈，现在，连偶妈妈也会团了，完全拜她的朋友所指点，团了两张50元的中森名菜券，可以50元当100元用，结果没有问清楚就团了两份~！不过就是要加收10%的服务费，除了这个，其实没有什么的~！还是挺满意的~!只能晚上用，当然，因为这店中午做优惠商务套餐~！打电话，原来可以订房间，哈哈，当然要房了，因为可以慢慢享受与拍照嘛，哈哈~！听说这里不给拍的~~~经过一番研究，决定点了以下东东，因为那个100元内还有6元是茶位，所以一共只能点188元的菜~！吞拿鱼刺身，38元，这个是妈妈指定要的，偶不吃生的，但她说三文鱼经常吃，要试试吞拿鱼的~！吃完四块，她说：“没有有三文鱼那么香，这个也不错，但还是三文鱼正~！”造型还是很吸引的~！吞拿鱼棒烧寿司，这是28元~！也是偶妈妈点的，说看图片就觉得可爱，要试~！果然很好吃，虽然吞拿鱼少了一些，但那寿司的饭很不错，连妈妈与觉得好吃，很想知道是什么牌子的米，要买些自己做~！这个寿司外面是炸了一下的，吃起来有些脆，口感很不错，看到有很多人也点这个~！牛肉汁铁板炒面，偶点的，38元，很香，不会很干，像湿炒，面挺爽的，内有牛肉碎，还有些小咸菜，一起吃很不错，很喜欢~！这个炒面别有一番风味，挺不...错~！三文鱼鱼头汤，因为是原价98元，特价38元，妈妈说要试，其实历史已经在教训我们，在外最好不要点汤，这个果然是真理，这个汤很失败，虽然大，料多，但是汤煲的火候还不够，所以没有汤味，不过实践是检验真理的唯一标准~！是有很大一个鱼头，但是汤不够火候~！料还算多~！算了~~~，汤料打包，给家那三只小可爱~！田京烤黄花鱼，38元，这个真是看到都流口水，本来妈妈说自家也可以做，不用点，但我坚持，自家做不出这样的味道~！我们两只爱鱼的猫吃了一口就已经觉得停了不手了，太美味了~！黄花鱼没有什么骨，肉也嫩，烤得刚好，烧汁很美味，越吃越想吃~！有机会要试花涧鱼~~~！很不错的一道菜，试过一些日式店的烧黄花鱼，但这里的最满意~~~！服务不错，环境很好，最后多给了24元~！很满足的回家了~！猫妈妈的第一次团购还算成功的~！给力~！她后来还对偶说“如果再看到，再帮我团两份啊~！”哈哈~！全文','60','2011-06-04 14:28:00',NULL),
	('07152d8e5400f0732d2700d304cd72f1','72d3ba29b99e10ba4629985de59849d9','jethyliang','3',3,3,3,'我就最喜欢吃刺身了，点上那芥末真的很好吃。这里的刺身不错，就是价位有点高，不过在这个地段也不算贵。天妇罗中规中矩啦，还是不错的。鳗鱼饭也是我的最爱，那汁恰到好处，呵呵呵，而且这鳗鱼饭也不贵，每次来一定会点的。这里的份量ok既，不算多不不会很少，就是等位有点烦，名气大，慕名而来的人多，如果不是提前订了位，真的不会来，等太久也是一种折磨。','60','2011-06-13 16:22:00',NULL),
	('087c2b401f1c0f790de53136e055df91','72d3ba29b99e10ba4629985de59849d9','kangtakari','4',4,4,3,'【团购点评】跟朋友来过一次，环境唔错，坐得几舒服，刺身都算新鲜，但菜式唔系好特别，价钱比较贵，附近嘅交通尚算方便，邻近有地铁站','0','2011-09-09 22:29:00',NULL),
	('0966b3bbd040c4d9197aaaf204014003','72d3ba29b99e10ba4629985de59849d9','聪明花','4',3,3,3,'同男朋友去吃 两个人去其实唔多抵 因为好多都好想吃 但系两个人吃唔到d咩叫个霸王粥 有dd失望 其实我无觉得几好吃反而我比较中意个盐烧银鳕鱼扒 好香口好好味可能因为冬天吃寿司唔多岩时间 所以我觉得怪怪地 但系比我之前吃过嘅要好味芝士焗生蚝都可以 酸酸甜甜 其实中森名菜有贵有唔贵 环境都可以 但系建议多d人去会员卡要直接300蚊买一张 但系有一张就会平好多','75','2011-01-05 18:24:00',NULL),
	('0da69d0c84424cfb513572f636b65b37','72d3ba29b99e10ba4629985de59849d9','一只猪唔系猪','3',2,2,2,'地方是很大的，都会坐的很满。环境偏暗，没有什么光，灯很暗，座位不算舒适。食物的味道不均匀，时淡时浓，价格比较高。服务人员不够，服务质量不太好','0','2011-06-16 10:44:00',NULL),
	('0e12b37e47ee4e4030efa7ae46b71039','72d3ba29b99e10ba4629985de59849d9','sweetpea','3',2,3,2,'无推荐,粥超大,但没什么鲜味,管饱不管好店员介绍的烤鲭鱼味道不错,但就只是加点盐烤一烤,不需要到这里吃海胆是我吃不习惯还是什么原因.粘粘的..腥腥的..难吃死了,寿司很一般,环境昏昏暗暗的看不出好在哪里如果中午经过可以试一下快餐,可能会好些','50','2011-09-06 16:12:00',NULL),
	('0eafc0a3bb5307ba24000b84aca5103c','72d3ba29b99e10ba4629985de59849d9','gzxiaoguaiwu','4',4,4,4,'环境不错，喜欢入门处的小桥流水，一进去就很清凉的感觉；这里风俭由人，既有很贵的，也有一些还比较平价的，有个粥才10来块，很大份，晚餐也能点，中午有商务套餐，比较实惠，很多周围写字楼的把这里当午餐食堂；刺身不错，另鹅肝也不错，有个小面包作底，上有鹅肝的做法很好吃，真是入口即化，美味；还有种生蚝的做法也不错，好象是芝士焗的，挺好吃。','100','2011-06-18 11:43:00',NULL),
	('100de12082b59dc60414ee4fc1c3c732','72d3ba29b99e10ba4629985de59849d9','秦俑东东','3',2,3,2,'交通非常的便利，地方很好找，环境也不错，很大的一个厅，据说是广州最大的一个日本料理店，里面的环境很舒服。每次去人都很多，但基本都不需要等位的，除非是特别的节假日之类的。霸王粥是我们每次去必点的，这里的寿司出品好像和其他的寿司有不同，中森的寿司口感总感觉要Q好多，好有弹性，我中意O(∩_∩)O哈哈~就是希望价格再平民一些，过段时间去就发现很多东西又涨价了⊙﹏⊙b汗','0','2011-06-20 17:15:00',NULL),
	('15560ae08b73c6b5691c13c1b46754b4','72d3ba29b99e10ba4629985de59849d9','lcclcllc','3',3,3,3,'中森明菜这家店已经是听过好久了，可是离家远一直没有机会去，终于狠下心来去了次。先说价格，算是贵的一家日本料理，口味还过得去。一直都喜欢吃三文鱼，当然要点三文鱼刺身，挺新鲜份量挺足的，口感真的不错，有第一次吃上瘾时的感觉，值得推荐。','75','2011-06-21 11:42:00',NULL),
	('17363aa182059f558f7b3c837403eb59','72d3ba29b99e10ba4629985de59849d9','SINGSING熊猫','4',4,5,4,'最中意吃天妇罗，炸得岩岩好！！味道都5错，去过一次，所以吃过的菜5多！寿司同三文鱼都几好！呢度环境都好鬼舒服，不过有时劲多人','80','2011-06-16 23:59:00',NULL),
	('1c22e89d18bc88a5a8c783928199f2b7','72d3ba29b99e10ba4629985de59849d9','鹌鹑仔','4',3,3,3,'好好彩，被我发现左中森名菜的省钱之道第一，唔使排位，它这里排队很快就能拿到号码了第二，认真看看菜牌，原来有好多款式的菜系同出品不同价钱噶，相差居然有20+元第三，主辅食加起来也不贵，一家人或者一群朋友就可以饱餐一顿第四，蟹黄粥必点！因为我喜欢吃粥！','30','2011-03-07 22:37:00',NULL),
	('188a47f4b442b32bfc4b5154ffaa742a','72d3ba29b99e10ba4629985de59849d9','EMILY_HUI','4',4,3,2,'【团购点评】团购去的。团购4人套餐，我地加左一个人，所以加左一位茶同一个新野霸王粥，仲有一碟唔知是送的静是要收钱的前菜。团购149+29现金，5个人先用左178，好抵！味道唔错，但如果唔是团购，可能无几何去：一来离我屋企远，二来中意食的价格都唔平。食完之后又有网站有团购，菜式差唔多，已经要179了！','36','2011-06-03 02:29:00',NULL),
	('1b8110e8c007c0136e7d608dc91f1528','72d3ba29b99e10ba4629985de59849d9','8年','2',2,3,3,'多年无来，唉，出品真系差咗好多！可能日本地震后，D人怕食物辐射又少来咗吧！我坐房间既，大厅台数吃饭时候都唔多。除咗D煎鳗鱼过得去之外，其余真系唔掂当。个花之恋细到死，包边既三文鱼切到薄一薄；鹅肝炒饭唔够热，冻冰冰；寿司呢，D饭团散既，上面材料严重缩水。睇来再帮衬机会都好渺茫啦……不过服务，估计系坐房间，仲几好既。','0','2011-05-11 16:24:00',NULL),
	('1ba641f4f383f12c8cc4548c1750fa7e','72d3ba29b99e10ba4629985de59849d9','猪头三文鱼','4',3,3,3,'中森明菜可能不是广州吃刺身最好的地方，可是小房间里面的情调确实不错。刺身，寿司都够新鲜，价格来说在体育东路不算贵，如果要宴请也算一个好地方。','100','2011-06-15 11:29:00',NULL),
	('08116b103ae2031a0b45105398275100','740078abe1a22baa0bc52e16344d80bc','clljwang','3',2,3,2,'环境还不错，张贴着许多韩国明星的海报，很养眼。常年有赠送的小菜。儿子很喜欢去，因为有赠送的冰激凌。口味倒没什么特别的。','50','2011-02-16 10:54:00',NULL),
	('057a12ab5d727a312ff9e5eee3bd22ba','740078abe1a22baa0bc52e16344d80bc','stdsean','4',3,4,3,'朋友请客 一直听过他们家的名字 原来就在单位附近特色牛肉和五花肉很赞 比起其他的烤肉店 他们家的棒鱼、鱿鱼、海虾都很新鲜，喜欢海鲜的也可以放心吃啦昨天正好是正月十五 他们还赠送了元宵，餐后还有奶茶 虽然很少 但感觉很有特色再一个他们家的墙上都是韩剧的海报 适合哈韩一族最近还有抽奖 昨天抽了一个蔬菜色拉 可能是别人请客的原因 我觉得比华乐广场附近的本家性价比高很多','0','2011-02-18 10:10:00',NULL),
	('05e63c87c1531c1db40acba1e8e5de2c','740078abe1a22baa0bc52e16344d80bc','一只戴鼠','5',4,5,4,'每次从北京回来必去的韩式烤肉。味道感觉不像千手予那么好，但是也算不错。主要是环境很好，搞成韩剧的风格。服务也还行，算是我去过的韩式烤肉里态度相当不错的了。','70','2011-04-01 22:13:00',NULL),
	('076d752efa37cbc4cbb4eec1af66bfd6','740078abe1a22baa0bc52e16344d80bc','Arielyangy','4',4,5,4,'环境很好，晚上6点后还有歌手，可以免费上网。很适合情侣约会和朋友小聚。煨汁卡鲁比很不错，消费满200还可以转盘抽取免费菜。','40','2010-11-08 11:03:00',NULL),
	('08dd48bb5e77cd67265a21787eabcaee','740078abe1a22baa0bc52e16344d80bc','辉映洁心','3',3,3,2,'初五的春节聚会第一次到了韩雅烤肉.总体感觉还不错.肉的味道不错,赠送的东西很多,不过可能是因为过年的原因,服务员好象不太多,而且不专业,我们点了腌渍羊肉,都过了近一个小时了，而且是再我们一再问的情况下,才告诉我们说没有了,挺令人失望的.','0','2010-02-22 11:06:00',NULL),
	('0cb4de20fd8dc8bbefe3a1cc73b08b27','740078abe1a22baa0bc52e16344d80bc','_村姑_','0',4,3,4,'环境很好，，味道也不错，，性价比高啦就去过一次，，，点了个拼盘，，哈哈~~~，，，送了瓶红酒，','60','2009-06-21 23:11:00',NULL),
	('0d8b11db09f99d1fd8fa574c18ed72e7','740078abe1a22baa0bc52e16344d80bc','缘木求鱼0','4',3,3,3,'一个环境很好的烤肉店，菜品味道也不错就是菜上的太慢了据说因为当天后厨打印机坏了。一款炸打糕的点心很好吃，荞麦冷面也很正宗，位置稍偏点。','0','2011-03-29 13:25:00',NULL),
	('151386372672985809811437a99f6be4','740078abe1a22baa0bc52e16344d80bc','cjp521','3',2,2,1,'俺是1月31号去的，特意上网查过后才去的，优惠券也带着，但没用上（稍后解释）。下面具体说一下感受吧环境：给个一般已经不错了，因为是在大厅，没去那种包间，所以没感觉环境哪里好，也挺吵得，但桌子不错，烤架也可以，但毕竟是韩式烤肉，这种环境给一般也就不错了。口味：这个也和一般环境的韩国烤肉的口味差不多，而且自己烤，难免考得不咋地，要是赖自己吧，毕竟服务员没帮着弄过，就是换架子挺勤。服务：实在不好意思，没看到极差，这个应该给负分了，先说说刚开始要点菜时，叫了个服务员，人家告诉等等，那得了，在叫一个吧，因为太饿来了没法等，叫这个服务员真是把吃饭的兴致完全弄没了，态度不蛮横，但就是爱搭不西理的，菜要多了也没有说（这个自己也有原因，因为超过150有活动），但菜肴重了就不会赖我自己了吧？难道服务员只管点菜？那你叫点菜员得了！后来上来菜那叫一个气，当然也没啥胃口了，剩了一半左右的肉，所以真就40一个人就能吃饱！我多花了一倍！那个蔬菜也没怎么吃，关键是来气啊！总体：现在先说一下为什么没用优惠券，因为过了150有很多活动，所以我也有凑钱的嫌疑，后来算算到了150，就问是不是可以参加活动了，那个&apos;点菜员&apos;说优惠的东西不...算在内，就是29的那个牛肉便宜一半，我一想那不算就不用优惠券了吧，毕竟活动很多，应该比便宜14.5元合适很多吧？现在想想真是亏大了！为啥亏大了？咱在算算，那些活动之一有一个58元的红酒，成本价6元都可能说高了，不信自己查查红酒内幕，人家不可能给你上好的红酒吧？送两张啤酒卷，也就是两瓶，要4点以后去吃的，抽奖送的菜呢，是要4点以前去吃才给，这么弄什么意思?那就是你得再去吃两次才能给用了了。个人认为最好的就是那赠送的冰镇木耳了，不是他家做的好，而是本身好吃，毕竟肉吃多了刷刷肠子么。如果自己不要那些满150的优惠，就不会要那么多东西，浪费那么多money，所以大家去还是不要贪小便宜啦，只会赔得更多哈！全文','78','2010-02-02 09:22:00',NULL),
	('03bb6ef67777b5c6bcbacfda122b4eeb','751af2eb6252740f95ddebcd974559a8','ZZS0083','5',5,2,3,'怎么说呢 吃完了别人家的 才觉得凯宾斯基的才是真的好新出的大理石杯子的那个慕斯 超级好吃呢~~~哈哈哈很大一个呢·物有所值 真的偶遇明星的几率非常高','50','2011-11-24 00:04:00',NULL),
	('07aaefeca26e795c53fb98b172448cbc','751af2eb6252740f95ddebcd974559a8','酷儿小怪','4',5,2,2,'是赶着寒假的尾声头一回光顾，挺不容易找的，大厅的地图上都米有标~>_<~硕大的门敞着...米有排队的，倒是座位都被老外占满了...正观摩着各种甜品，服务员好像有点催，偶就忐忑地要了点热门的蛋糕，问我要袋子?要的话还要收5角...结账还得去另一边，我就先去简餐柜前look look，那里的服务员把我当空气，背着身忙她的...一老外过来了，她就赶紧转过来问&quot;您需要点什么&quot;...@_@切入主题~拎着蛋糕回家一路飘香啊~╯▽╰【黑森林】：第一口真的惊艳了！亮的就在于奶油~我其实一直对奶油有点抵触的，但这是我长这么大吃过最好吃的奶油了...(之前以为贝甜的奶油已经是极限了...)他家奶油有灰常香甜浓郁的奶味~入口即化没有油腻感~整块蛋糕十分蓬松，不一会儿就消灭完了.海绵蛋糕很湿润啊，唯一失败点是里面的樱桃，太酸了，放得又多，吃到那里时有种吃腐烂蛋糕的幻觉@_@【烤乳酪】：五星酒店的乳酪蛋糕果然都很赞么~湿润浓郁不粘嗓子~这款蛋糕里面也藏有水果，方块状的像椰果粒似的有点假的感觉.蛋糕底怎马是海绵蛋糕?!缺少feel啦!...整体来讲还是很不错的~再能有那么点淡淡的咸味就更好了!','105','2012-02-11 15:11:00',NULL),
	('07c11d129641950f41929fb589438d7b','751af2eb6252740f95ddebcd974559a8','喵er小小','4',4,3,3,'对凯宾斯基的面包房挺有感情呢 妈妈以前总是买蛋糕回家给我吃 最喜欢法芙娜巧克力蛋糕 口感细腻 不过怎么觉得蛋糕比以前的小一点呢？。。不知道是不是个人感觉的偏差。。','60','2011-09-11 00:31:00',NULL),
	('0d13d1dd6b334687e2cc8757af6684d1','751af2eb6252740f95ddebcd974559a8','筱baby','5',5,5,5,'很喜欢这里，尤其是黑森林蛋糕，做的太好吃了，呵呵，甜而不腻！来这里喝咖啡也是一件很不错的享受，他们家的咖啡很出名，有好多都是专门来买咖啡喝的！','45','2012-02-13 20:03:00',NULL),
	('0f91a7dac1fcfde33cdb72aafa0f3764','751af2eb6252740f95ddebcd974559a8','tottal','5',4,4,4,'记得以前专门有文章写过如何去买KEMPI DELI的打折面包……那攻略写的真的是很有才……不过我可没那么多时间去耗着……东西比一般的地方，价格是高多了，但是这味道，除了这里就再也品尝不到了……至少目前是这么个状况。吃着如此昂贵的慕斯，一小口不过瘾，一大口怕很快就吃没了……纠结啊 纠结啊……','50','2012-02-11 23:01:00',NULL),
	('13a8a076f1782925d780de6f4998de56','751af2eb6252740f95ddebcd974559a8','tenny赵','4',4,4,3,'很多次路过，却不知跟友谊商城相连。后来终于在世纪剧院看过妈妈咪呀之后绕啊绕啊找到了这里。第一次，很保守的点了芝士蛋糕和法芙娜，但是送给同学了，只吃上了一口。总的来说，并未让味蕾有任何新鲜的接触，这一年，吃了很多的甜品，大概论芝士蛋糕的口感稠度来讲，应该是21cake的Jerry最强吧。第二次去，白姐买了一个自认为特别成功的蛋糕，但是我却忘了名字。自己想突破性的点了梨酪蛋糕，口感很稀，让人觉得像喝奶油稀粥。但是面包19一个，味道还是不错的。原本想点白巧克力蛋糕，因为本人对黑巧不感冒，偏偏吃那些最让巧克力专业人士唾弃的加糖白巧。但是就在我准备出手之时，边上的及我腰高的孩子对妈妈说，妈妈我想吃白巧克力蛋糕，妈妈说：“白巧克力最难吃了，吃别的吧。”孩子：“好！”我顿时被那种乖乖的感觉融化，也在心里听了妈妈的话...人生很奇妙，也许是老天爷在这个时候作了祟...除了巧克力，这里还有北欧的各种生鱼类，老外很多，从友谊商场传过去，路过小桥流水时，内心顿时从商场的喧闹中超脱而处出，安静了下来，尽管小桥流水配西餐有点怪，但是也算是混搭的成功范例吧~','35','2011-10-29 16:15:00',NULL),
	('18b30b1a851707343d0227cd6ca26912','751af2eb6252740f95ddebcd974559a8','金鱼一只','4',3,2,2,'慕名而去....在酒店的一层,去的时候刚好是下午茶时间,人挺多的.有点像国营店的风范,先点东西,然后开票交钱,再回来拿吃的，谈不上什么服务。这里的黑森林很出名，但是真正吃到，觉得一般好吃而已，没有惊艳的感觉。cheese cake 味道很浓郁，也还不错。','50','2011-10-19 16:00:00',NULL),
	('1a56fd611e7872eaa42bddb7ebc4940f','751af2eb6252740f95ddebcd974559a8','绿薄荷29','4',4,3,2,'孙同学生日，到这边来买单块儿的每种口味都尝尝，超级喜欢的是法芙娜，绝对的巧克力控喜欢的蛋糕啊！巧克力软软的，又不是假甜的那种！超级喜欢！榛子巧克力也不错，如果不是特别喜欢巧克力，又想尝尝的榛子这款合适，巧克力味道没有那么冲，里面混合了榛子的香味，黑森林没吃，给了朋友，朋友吃了一口就说好吃，嘿嘿，估计应该不差呢！烤乳酪相对逊色了一些，就是一般的乳酪蛋糕的味道，最不好的应该是买的凤梨的那款慕斯了，没有什么味道，梨味不浓，过甜，这款最不喜欢，下次去打算买苦巧克力试试，应该不会让我失望，看到好多老顾客上来就直接点面包，但是五点多面包差不多都没了，打算下次我也买面包试试~','175','2011-11-08 07:22:00',NULL),
	('1ad9bf95ba58b3e6a26820e6258cc72f','751af2eb6252740f95ddebcd974559a8','妖精鱼儿楠楠','5',5,4,3,'黑森林啊 黑森林 凯宾斯基的黑森林 果然名不虚传！何谓“入口即化”？！凯宾斯基的黑森林 诠释了这四个字味道相当不错！不甜不腻 味道适中非常喜欢！推荐！以后有机会 再试试其他款哈！','35','2011-09-12 15:44:00',NULL),
	('1ddf29ce6769a7abe4cb9144f0abf555','751af2eb6252740f95ddebcd974559a8','贪吃的杜小胖','5',5,2,4,'经过燕莎一层穿过去，非常好找。虽然环境有些小，如果中午时分去的话，基本上都要外卖。但是味道真是很赞。法芙娜巧克力蛋糕绝对推荐给喜爱巧克力的FANS们，甜而不腻，顺滑入口。还有芒果CHEESE CAKE，真是芒果味十足，外表是新鲜的芒果包围。喜欢的不得了。。。凯撒沙拉也是可圈可点，生菜非常新鲜，意大利CHEESE的味道绝对超正，熏肉我没有尝试，不过妹妹说不错，很有特色的SESAR SALAD。。。这么多年，口味一直没变，而且越来越好！！','96','2011-10-12 14:11:00',NULL),
	('1df214070c276d3ee140ac54254ea896','751af2eb6252740f95ddebcd974559a8','辛苦的心','4',4,2,2,'法芙娜巧克力蛋糕不错，有种吃黑松露巧克力的赶脚， 焦糖梨蛋糕虽然没人提过，但是味道真的很好，清新不腻！只是屋里人好多，不像是个五星酒店的样子','60','2011-09-25 22:19:00',NULL),
	('005cf7639a85d2382ea55226c2b0e606','7588bbda2b7368fd40f4fce3b02a2316','甜甜小白','4',5,5,4,'一直被老公拖去吃面，他特别喜欢，从初中开始吃到现在了，居然还吃不厌。这家汤不错，现炒的浇头也很好吃，是苏州比较正宗的老字号了。当然现在有了琼林阁，觉得别家面店的浇头都是浮云了。。。','20','2012-01-12 23:55:00',NULL),
	('013684f535dedbb1f45218a3304fa219','7588bbda2b7368fd40f4fce3b02a2316','hotinxu','3',2,2,2,'看点评是家物美价廉的优质店。于是，下着雨，继续撑着雨伞推着童车，觅了小会慕名而来。但很遗憾啊，这店休假到下月六号…','0','2012-01-28 22:04:00',NULL),
	('03394facb9370b13e8c4ccd464f36578','7588bbda2b7368fd40f4fce3b02a2316','执红落寂','4',4,4,4,'从高中时代吃到现在了,他们的面还是很好吃,尤其是红汤焖肉面和白汤焖肉面,两种口味各有滋味,白的里面放点青菜,很清爽的感觉,红的味道很鲜美,个人比较喜欢白汤的','0','2012-01-06 09:46:00',NULL),
	('0712d0b2aac9d128678d1046d85941fd','7588bbda2b7368fd40f4fce3b02a2316','nuolw1023','5',5,4,4,'枫镇大肉面是一定季节才有的，看上去白白的一块五花肉，吃上去去口感很丰富，肉事前已经处理过，滋味已经融在肉里，吃起来不油腻。炸的小鱼很脆，中午1点多去吃的，鱼还是热热的，个人喜欢沾点醋。面的分量很足，个人认为普通女生一般都吃不了一整碗小份的。店的装修很有特色，符合苏州的气质。','15','2011-10-15 22:04:00',NULL),
	('09bba49e1e6bed3b9df2c2177bdd5478','7588bbda2b7368fd40f4fce3b02a2316','CCtsai','4',4,3,3,'【团购点评】这家面店可了不得，虽然是新生品牌但却毅然扛起了新苏式汤面的大旗，同得兴的汤面重在汤里面，纯正的红汤和白汤各有风味。','80','2011-09-11 23:40:00',NULL),
	('098e33e8b9aba1cb659b0362a455a83b','7588bbda2b7368fd40f4fce3b02a2316','匪1','5',5,2,2,'看过点评，从木渎骑单车长途跋涉慕名而来。到的时候已经快过午餐时间了，饿的不行，还能吃到这样的美味，感觉值了。面肉汤全部干掉，坐对面的奶奶爷爷还在慢慢悠悠的吃呢。焖肉真好吃','10','2011-12-11 21:40:00',NULL),
	('0a445f5a0310683aeb3349de45765f0f','7588bbda2b7368fd40f4fce3b02a2316','lala524','4',4,3,2,'从观前街出来绕了好大一个圈子才找到，其实在大洋百货那，还是蛮好找的，主要一开始方向没找对。味道还不错 ，老年人很多，估计都是老食客了，去了2次，第二次点了冬令面冬笋雪菜，不好吃 ，而且还要12块，一点不划算 ，喜欢红汤焖肉面，很好吃，还便宜，才9块钱！','10','2011-12-26 16:05:00',NULL),
	('0b1c9c9d1b80026a10bc6615dcd62366','7588bbda2b7368fd40f4fce3b02a2316','barbara21','1',2,1,1,'爆鳝面 红汤焖肉面 卤鸭面 鳝糊面 焖蹄面 虾仁面 辣酱面，这些我都u有尝过，还是不错的说啊!价格也不是很贵，汤很鲜，觉得还不错！','15','2011-12-21 22:31:00',NULL),
	('0c69deb0cfb39fba96dc632798d1019a','7588bbda2b7368fd40f4fce3b02a2316','吃心妄想小分队','4',4,3,3,'不懂行的上海人去苏州吃面，不吃门道，只吃味道。非常不错的面馆，还是老字号，面汤很鲜美，爆鱼肉也大，10块一碗真正划算。环境古色古香，木质桌椅有一定年份了很怀旧，背景乐是苏州评弹。','10','2011-12-13 12:02:00',NULL),
	('0da3b2ceb60ccf0e8e01931b8f2eb035','7588bbda2b7368fd40f4fce3b02a2316','FJerusalem','5',5,4,4,'超级喜欢的一家苏式面馆！！老好次额！！特别是吃了南京难吃的面之后！面条硬度是我喜欢的，浇头都蛮不错的~最喜欢爆鳝面啦啦啦~','15','2012-01-13 09:28:00',NULL),
	('117486a9db534ad40a452206a6b112f4','7588bbda2b7368fd40f4fce3b02a2316','sb1981bing','5',5,4,3,'住在街对面的乐乡，乐乡早餐真的不咋地，我就在外面逛了一大圈，突然发现了这家店。苏州吃面一定要吃红汤的，点了奥油爆鱼面，好吃啊！真开心','10','2011-10-24 21:31:00',NULL),
	('190b418e90a629145ca47f1151a12f1f','7588bbda2b7368fd40f4fce3b02a2316','那年的记忆','4',3,2,2,'最近一段时间超级爱吃面，几乎每天都会吃一次面。他家的面感觉是满苏式的，是我喜欢的口味，红汤白汤都有，总的来说我更喜欢白汤的。','15','2011-09-08 14:07:00',NULL),
	('029d66a3bbc828cd4d05c1d1e18b0e5b','765c9988825d7889587967970372f2da','小爱Q','2',2,2,1,'我的个妈呀， 我们三个人去的，消费￥690，我晕！ 贵死！ 而且服务很差！　尤其是那里有一个管事的女经理，很差劲！　再也不去了！ 当时我们点了玛格丽特调酒，上面好想写着是50 结果收了我们55元，一看账单怎么多了5元，他说是调酒里的酒给你用的是贵点的酒调的！什么道理嘛，　太不像话，账单写的是这么多钱，怎么能不声不响的多了５元，　还找借口，　也不承认错误，奶奶的！　','200','2011-06-22 08:48:00',NULL),
	('02a18e038d517b99cbdc7adbae02dcff','765c9988825d7889587967970372f2da','a芒果街a','4',3,4,3,'【试吃/体验点评】一直想来这家餐厅，但因为小贵的价格纠结，最后终于没能人住还是来了，推荐的烤猪排，分量确实很大，点了半份吃的还觉得有点撑，但是味道嘛，可能期待太高，没觉得太过出彩，黑椒烤牛排倒觉得还不错，恩恩，下次再也不点猪排了！有件事情很气愤，他家使用大众点评卡要先出示，我们结账时出示被告知不能使用，真是气愤，一般餐厅都是最后用的啊，别人家都没事，所以要去的朋友一定注意哈！','160','2011-04-16 16:12:00',NULL),
	('049be965f4c943de4d04ba657ff2dc8d','765c9988825d7889587967970372f2da','爱吃虾的牛牛','4',3,2,3,'环境比较像美国小镇，餐也是美式西餐，不是那种很正式的西餐，与这个价位不是很符合。服务态度还算不错。甜品很好吃，鲑鱼饭很一般，鲑鱼很腥。分量超级大','140','2011-06-09 11:34:00',NULL),
	('0575c866d31527bd451a0ea75a64149b','765c9988825d7889587967970372f2da','caoxuan1986','3',3,3,4,'老公同事介绍去的，没期待中的那么好！我们怀着期待的心情去的，留下的印象太一般了。我们点的平安夜优惠套餐499元，不知道是不是服务员太忙了，店里的人太多了，嘈杂，没有想象中的优雅环境。肋眼牛排完全不给力啊，单点200多一份，7成熟竟然拿刀切不动，最后让他弄成全熟吃掉。我觉得口味还不如绿茵阁了，在这里我没有贬低他的意思，只是品质和价格不成正比！两杯特调酒，没什么味道，我自己有点了一杯奶茶。出示大众点评卡，送个摩卡冰激凌，真好吃，现在就这个味道值得回味。套餐中的三拼 土豆皮，没多大味道。炸芝士条，有点凉了。沙拉份比较大，味道比较大众！','259','2012-01-08 20:43:00',NULL),
	('05f2381f41235fc5523eab256dc8c45e','765c9988825d7889587967970372f2da','落花无言人淡如菊wpj','3',2,2,1,'环境还可以，服务不是很好，上菜很慢，服务员给我餐巾纸时是扔过来的，很没礼貌。菜的卖相不是很好。喜欢帕米森鸡肉酥饼，美式烤猪排，饮料觉得草莓酥饼好喝，不知饮品为什么叫这个名字，还有摩卡冰淇淋派很好吃，量都很大','180','2011-07-03 23:30:00',NULL),
	('0d7cc4fcb5924a52bc1630c8178ff86b','765c9988825d7889587967970372f2da','球啊球','4',4,5,4,'环境真是不错的说~ 几年前去了传说中的星期五，之前是学生一直没舍得去。话说已经忘记点过什么了。。我们4个人点了2个人的餐，就够吃了。真的是不少。拉沙都是超级多的那种。还是挺有情调的，几个人说说话也是不错的选择。','100','2011-04-19 21:35:00',NULL),
	('0f6d2c88f24ac9ad55c7a709c9117a43','765c9988825d7889587967970372f2da','郭兔兔c','4',3,4,4,'去过几次，喜欢里面的美式风格，红白条相间的桌布，木制桌椅，很有感觉。酒精软饮很喜欢和，每次尝不同口味。起司砖也是保留菜，浓浓的起司超级好吃！','160','2011-10-08 15:14:00',NULL),
	('10e1d9a489f5fcaa58381b9ce91183a6','765c9988825d7889587967970372f2da','熊猫晶晶姐姐','4',3,3,4,'星期五餐厅  绝对地道的一家西餐厅 炭烤牛排肉很香很嫩 摩卡冰激淋口味很丝滑 鸡肉沙拉也很地道 就是这家西餐厅价格相对有些高  人也需要偶尔奢侈一把满足一下自己','0','2011-12-14 16:46:00',NULL),
	('11c87911d3172d0e52be7c9a35ef3606','765c9988825d7889587967970372f2da','magic156','4',4,4,4,'和朋友去的。进去后感觉像是在一个小镇上，很舒服。菜品的分量也非常足，半分就够！我点的是蜜汁猪排，很好吃。当然，好吃和舒服都是和价格成正比的。和其他西餐店比起来，他算是比较贵的！','150','2011-06-05 11:28:00',NULL),
	('14f869e55ef8a266d363d6370ddc0c01','765c9988825d7889587967970372f2da','天津和平爱婴岛','5',5,5,5,'这家的摩卡冰激凌超好吃的！咖啡味道好香好正。方方正正的好像蛋糕。肋眼牛排口感也不错。环境很好很有气氛。哈哈哈哈','0','2011-12-04 15:04:00',NULL),
	('154d9e8cc593924c8e6dd1fbb41e241a','765c9988825d7889587967970372f2da','钺儿儿','4',3,4,3,'上周的时候同学从英国回来一起去吃的星期五！第一次去那，感觉氛围真的很好！进门之后分成了有烟区和无烟区，很适合对烟味介意的人过去！就是价格稍贵，偶尔吃吃也不为过！','100','2011-06-01 20:23:00',NULL),
	('161cd8d8074f220d55f8bef3e263198b','765c9988825d7889587967970372f2da','yolim','3',3,2,2,'我们去的时候有单人套餐，98和128两种。包括碳酸饮料，小吃，主菜和甜点。选了红茶：立顿加水……是个小壶，自己倒的碳酸饮料是可乐，超级大杯……小吃是鸡肉沙拉，蛮好吃……主菜是烤半鸡：挺大，特咸，搭配了点小生菜和红薯泥；杰克丹尼猪排？忘了具体的，招牌的。也是很大一块，配了生菜沙拉和薯泥之类。就觉得口味太重，又咸又酸的……甜点是香草球+布朗尼，这个是最好吃的……香甜软糯……环境不太好，都是一家人来的，挺乱的，小孩子跑来跑去，服务员叫半天才过来，不太周到。一次管够吧就算','200','2011-03-24 22:04:00',NULL),
	('17d9ce338ac5f8a75bd0bc3ad171d6eb','765c9988825d7889587967970372f2da','xuxuxuxu805','4',3,5,5,'我们公司香港籍经理经常光顾，今年6月份有幸随陪RIM客户造访一把，环境、服务没得挑，优越感十足，但却是小贵了点。看在摩卡冰激淋、冰淇淋、BBQ猪排、炭烤牛排都是我的最爱的份儿上，偶尔high一把，岂不快哉！','200','2011-09-08 22:57:00',NULL),
	('002d05b1e5c92bf2c70aa11f3291b190','7876b2d8bd3cace6fb62a46a997669f1','shsa2009',NULL,5,5,5,'凡情帝诺的巧克力外观非常的漂亮，口感细腻，这间店布置简单，但是很时尚除了巧克力还有一些饮品什么的，价格有点小高','50','2010-01-28 15:13:10',NULL),
	('010b9f00ac951491d2e815aff4e3a245','7876b2d8bd3cace6fb62a46a997669f1','ilovetiger',NULL,4,3,4,'高端巧克力啊，我觉得牌子应该在做的响一点，我买了几个送我朋友，人家都不知道这个牌子也不知道我花的钱绝对比买超市那些假大牌贵不少呢，觉得有点亏。所以一般自己吃吃，送人怕人家不知道，反倒弄巧成拙。','50','2010-01-22 09:10:07',NULL),
	('06a853ec9f0be4bc5936e0c6e17876cc','7876b2d8bd3cace6fb62a46a997669f1','公主2009',NULL,5,4,5,'好品牌，高品质！一直信赖其好口碑，经常光顾，也推荐朋友去品尝，大家都赞不绝口！价格不菲，但是性价比很好，值得推荐啊','60','2010-01-24 12:35:57',NULL),
	('0af7b63150b26a1bd2ce73af3cbb53b3','7876b2d8bd3cace6fb62a46a997669f1','lilycm219',NULL,3,3,3,'去这家店买的冰淇淋，朗姆酒和咖啡杏仁口味的，味道还不错，价格9元一个球，比之前在新光天地买的12元一个球的价格便宜，味道一样。','50','2010-04-20 18:04:38',NULL),
	('0b6ec142cefd8b27a4ad8e36a181dfea','7876b2d8bd3cace6fb62a46a997669f1','乖宝儿',NULL,4,4,4,'经常买他家的冰淇淋，虽然它主打的是巧克力。每次经过看到那些诱人的巧克力都迈不动步子，买冰淇淋就买了几个球吃吃，9块钱一个球，吃起来跟DQ差不多的，价味道还不错～有机会想尝尝它家的巧克力～','100','2010-02-03 02:15:59',NULL),
	('0f6d6b3483211c6bcca232c20cb2a261','7876b2d8bd3cace6fb62a46a997669f1','liukai861221',NULL,3,3,3,'如今的大悦城越来越火，亚洲第一的飞天梯，和各种品牌的相继入住，各种活动的举办，是大悦城成为了最有活力的商场各种巧克力也来了，凡情-蒂诺当然不会错过这种赚钱的机会在饭点儿，人山人海的地方，凡情-蒂诺就开在了这里在前几年，比利时巧克力还不是很流行，如今已经遍布各地，尤其是这个牌子，哪儿都有，变成了尽人皆知的品牌我一度怀疑这个牌子的来历，现在也依然如此人均50？人均60？只够塞塞牙缝儿，牙缝儿大点儿的人，塞牙缝儿都不够最大的特点就是不值四百多块钱一斤，吃金子呢各种口味，华而不实白颜色的，里面有酱，难吃黑颜色的，里面有奶油巧克力酱，凑合，太甜了黑颜色的，里面是榛子，这个还行，榛子很碎，口感不错我的主打，黑巧克力，可可含量80%的，甜，含量85%的，稍甜，这是最高的了，很是可悲如果没有价钱的因素，口味还是好的，人均200，勉勉强强而已如无特殊需要，将不再食用此类物质，改革开放，改了半天革，开了半天放，都是这些骗人的东西进来了','200','2010-09-08 16:04:02',NULL),
	('17257ceec5b28ed86bca39b598f1be11','7876b2d8bd3cace6fb62a46a997669f1','yxfsnowy',NULL,5,5,5,'凡情帝诺的巧克力包装非常精美漂亮，我很喜欢！看起来就好有食欲！口感细滑香浓，让人心情愉悦！纯手工巧克力味道也很好 ，很快就能被我吃光！！ 真是怎么吃都吃不够！贵店看起来简约时尚，独特又别有一番风情，挺不错！','60','2010-02-02 14:14:12',NULL),
	('1ac45535b6dca203ff20bc7951f7e39c','7876b2d8bd3cace6fb62a46a997669f1','力力125',NULL,4,4,4,'很喜欢吃巧克力，这家店里面的巧克力都很精致，包装也很漂亮，都是纯手工制作的，服务员很热情，也很细心的讲解都是什么口味的，冰激凌也很好吃，，总之都很喜欢呢','60','2010-02-03 18:46:05',NULL),
