	('02aef16b88ce7824b711fc5d4fe0d7ea','7973758f3c4c2c7940778992de9eefd6','lingling8101','4',4,3,3,'去九寨沟游玩，途径成都，据说这家店的菜式不错于是驱车前往。点了椒麻鸡，鸡肉嫩嫩的，不过花椒的味道实在是不习惯哦。水煮鱼、毛血旺一定是必点的哦，当地特色嘛，不过味道真的可以，又麻又辣，虽然嘴都麻了，但还是停不了手，因为味道真的太好了，一个字“爽”。凉粉酸酸辣辣还行。特别要推荐的还是他们家的合家欢真的是鲜得眉毛也要掉了，小鲍鱼，鱼翅，裙边等等炖在一起，汤汁稠愁的，很浓郁，到那里一定要试试这道菜，给我们第二天的黄龙行添了不少能量哦，哈哈哈哈。。。。。。','150','2010-09-14 16:16:00',NULL),
	('04a66df0a23b9d6b418778195a742759','7973758f3c4c2c7940778992de9eefd6','水榭舞飞','4',3,5,5,'现在叫映象的东西越来越多了，但是看了或者吃了映象过后我都没得啥子深刻的印象。咋个说喃，菜的味道我觉得比较中规中矩，还是比较好吃的。环境和服务超级好！菜端上来看起也非常精美！非常有卖相，引人食欲。看得出来是下了很大的功夫的。也许最主要的一点到这儿就是吃个环境吃个档次。','100','2010-11-25 16:33:00',NULL),
	('04eca941b36b63413d06e0602fc643e9','7973758f3c4c2c7940778992de9eefd6','里昂小米','4',2,5,4,'离我家很近，喜欢他家的装修感觉也是我老爸喜欢的风格估计大家都爱这种感觉吧一到晚上，整条路堵得密密麻麻的口味还行主要喜欢他家的环境','100','2011-05-30 21:40:00',NULL),
	('0546c482e3556534f6de3635e739aadd','7973758f3c4c2c7940778992de9eefd6','newmoonl','0',3,4,3,'实习结束时跟manager和同事们去吃的上海人冲着水煮鱼去的，我却对这家水煮鱼没啥印象只记得有个小干锅挺好吃，还有个什么虾好像也不错其他就完全没什么印象了装修很好，环境很舒服','80','2009-08-20 00:36:00',NULL),
	('091e0c0fe74b2e9336670e82da2c5d1c','7973758f3c4c2c7940778992de9eefd6','那个公园','4',5,4,5,'很喜欢到这里吃饭，经常和老公到这里来吃红烧肉，感觉他们家的红烧肉做的真不错，肥瘦适中，像我这样从来不碰肥肉的人都可以吃上几块哦，蛮下饭的。','0','2010-05-25 10:52:00',NULL),
	('0daf88f0ce4b3ea6999fbd19419143fc','7973758f3c4c2c7940778992de9eefd6','美味莲蓉','4',4,2,2,'去过几次，环境和服务什么的一般般，不是很到位。我们每次来都会点毛血旺的，麻辣鲜香，汁浓味足，很好吃的说，还有川北凉粉也很好吃','0','2011-06-02 15:08:00',NULL),
	('0ded999fdc0645179d6dc7c2be9586d0','7973758f3c4c2c7940778992de9eefd6','haojinbaby','4',3,3,3,'就吃一个感觉，一个环境，停车很不方便，幸好还有泊车员。包间都是用成都的街道名字，算一个特色吧，不晓得是我吃刁了还是这家的菜没有特色，吃完了，想不起有特别让人印象深刻的菜，真是没有印象！','300','2011-01-08 17:52:00',NULL),
	('102cd64944a9468d6a5d2b3c418c4fb6','7973758f3c4c2c7940778992de9eefd6','merylzhang','4',4,4,4,'非常有特色的装修，古色古香，灰墙黑瓦，不知道是不是符合老成都的感觉。反正个人是蛮喜欢的。因为是公司一起吃饭。个人光顾着说话去了，吃过些什么，实在不好意思，谈笑风生间都忘记了。只记得，有个什么鸡，看上去白花花的，其实非常辣，可不是一般的口水鸡，一层红油，其实一点儿也不辣，传说是用野山椒烹制而成水煮鱼、毛血旺确实不错，上海最好吃的和成都本地的也是没得拼，倒底是原汁原味的。还有来成都爱上的一样素菜，名叫碗豆尖。呵呵。超嫩，超香，令我这个肉食动物也赞叹不已。','100','2009-12-29 10:48:00',NULL),
	('10527f00c1e635f92faea5d2470f0940','7973758f3c4c2c7940778992de9eefd6','MSCD','3',3,5,4,'环境相当不错，古香古色的，很有特点！喜欢安静的人，可以去试试！特色菜，水煮鱼！味道很不错，请外地客人很不错的！不过地方稍微有点儿难找！','70','2010-12-03 16:57:00',NULL),
	('10bf3c34d40531a8835fa5bba99a58e4','7973758f3c4c2c7940778992de9eefd6','rachel1981','0',5,4,3,'坐落在住宅区了，走了好久才找到，环境确实不错，很古色古香，又幽静。点了水煮鱼 椒麻鸡 茶树菇 锅巴那个菜不知道叫什么名字椒麻鸡很香的，吃了2块，就感觉舌头麻掉了，水煮鱼也很香，鱼肉嫩嫩的，到底是招牌菜。总体来说，菜都不是很辣，对于我这种不太能吃辣的来说都能接受。','70','2009-09-11 11:05:00',NULL),
	('115ee74b495c1f954c5bd25d7e768f08','7973758f3c4c2c7940778992de9eefd6','sarui','0',3,3,3,'价格比较高，适合请客，外表很有老成都的感觉，大概比较适合请外地人吧。菜品没什么特别的感觉，就是一家川菜，定位不同罢了。','0','2009-07-21 12:31:00',NULL),
	('16918004bd11af17e35945ad74bbb7c9','7973758f3c4c2c7940778992de9eefd6','jiaolong1234','3',2,3,3,'凉粉还不错，但是其他的菜都很一般很一般，没有什么记得住的，店里还有特色的豆浆，但居然没加糖，有很淡，装修的还是很不错的，庭院深深的感觉，要不是聚餐我自己估计不得去那里的。','90','2012-01-02 12:42:00',NULL),
	('12f88755a215fb86c024266caeda096a','7973758f3c4c2c7940778992de9eefd6','choicer','4',4,3,3,'前天刚去过，朋友定的地方，她住在附近，她说是品味是非常特别的一家川菜店，虽有改良，但创新居多。味道是不错，环境自然有特色，仿古。因为第一次去，菜是朋友们点的，所以居多也叫不出名。','100','2011-04-18 15:56:00',NULL),
	('14fa5749608eded5f8c492248bd1ee78','7973758f3c4c2c7940778992de9eefd6','xxyy_51','4',4,4,4,'经营创新川菜的餐馆。虽然楼层不多，但是还配备有电梯，真不赖！他家的包间名字比较有特色，都是以老成都的街名去命名每一个包间的名字，进去以后看到仿古装修，听到老成都的街名，很有“老成都”的怀旧味，有特色。最喜欢沸腾鱼，鱼肉细嫰、爽滑，不辣不淡，','100','2011-05-12 16:47:00',NULL),
	('16de057685add5f358779caeca89f64c','7973758f3c4c2c7940778992de9eefd6','火爆小麒麟','0',5,4,3,'地方很偏僻~~真的不好找~~~不过环境很好，古色古香的~~~菜的分量蛮多的，我们几个人依然吃了个底朝天~~~还不停说味道好~~最后再看价钱觉得真的很不错~~~3个冷菜，外加3个热菜，152~~~走的时候还送了瓶辣椒酱~~~可惜不小心被我忘在足浴那里了5555555','55','2009-10-09 14:53:00',NULL),
	('172f5eafc5aef436cb2a8b87552f3f97','7973758f3c4c2c7940778992de9eefd6','那布','4',3,4,3,'最大的印象就是性价比较高的一家店.推荐水煮鱼,端上来红红的一层辣子,服务员随后就会把辣子分离出去,里边的油清凉见底,让人吃得很是放心毛血旺也是.变种川菜也有,传统川菜也很地道三五朋友相聚可以选择一个包间,感觉不错.','65','2009-12-17 10:18:00',NULL),
	('1b34caa848b62952b7163e70781f0247','7973758f3c4c2c7940778992de9eefd6','戒糖小蓓','0',3,2,2,'晚饭和两个大学同学在别处吃的火锅，再赶到这里的时候大家都已经吃完了。据称，水煮鱼，椒麻鸡还有全家福好吃，尤其是那全家福，听着众人的回忆加描述，害我又是一堆口水啊，只恨自己胃不够大，时间不够多，小小一成都，有多少好吃的啊，，，店装修的很成都，能体现本地人爱吃重吃的特点。打车从宽窄巷子过去，刚过了元华一巷我就看见这馆子了，可师傅还照直开呢，昏，谁熟啊到底。下车进屋直接上了四层喝茶。位子一般。屋内还有可怕的蚊子。灯光照明也比较昏暗。不过一票人聊的很是欢。。。茶要的普洱，主要是下午的竹叶青喝的我想吐，有点怕了。味道一般，很可能是晚上的火锅吃多了也。总的感觉是这里很适合请客，下面吃完上面喝，饭加聊天，一地方全搞定。','0','2009-08-09 17:26:00',NULL),
	('01f55426c06327022b6b610d96e1e96f','7a9736fe190156460e6867fe400e213c','xiang7399','3',2,2,3,'【点评团消费】菜色环境比起其他的泰国菜算是地道了。只是很浓的香料味混着很复杂的臭味(咖喱等)...快受不鸟了。木瓜汁如果加冰沙，应该会比较好喝；冬荫功汤，用料很足，口味比较酸，咽下去时比较辣；虾饼好吃，口感也有嚼劲；椰汁西米露，不太符合我的口味；蜜汁鱼还可以～老板和服务员的服务都很亲切。老板后面摆满了酒，样子很像小时候的那种供销社，呵呵。','150','2012-02-06 08:19:00',NULL),
	('096ea5e2266a42b3e5324cf87cdb9d3a','7a9736fe190156460e6867fe400e213c','kjz','5',5,4,3,'【团购点评】和闺蜜去的，因为喜欢泰国菜而且又想去逛逛风情街所以就选择了这一家。。环境是没得说，好的很哈~服务差一些，不过由于人家是泰国人，语言方面不是很好，所以表示理解。菜品吗。。汤比较好喝 属于回味无穷型的。不过菠萝饭稍微差一些。。','80','2011-10-22 23:12:00',NULL),
	('0b08dcd1f739591742ad424c0c330b2c','7a9736fe190156460e6867fe400e213c','ivytan8217','4',4,4,4,'【点评团消费】泰餐永远离不开咖喱，黄咖喱金针肥牛锅和蜜汁鲈鱼都太好吃了。菜价不算便宜，不过坐落在意式风情街里，档次是绝对有的。本次是团购去的，价位很合适，有露天座位，但是因为当时外面飘柳絮，遗憾就没享受夕照露天就餐的惬意。体验一次正宗的异国美味，值了','50','2011-06-01 16:33:00',NULL),
	('0ee5bbb394c058200dd1613f8fac7c5f','7a9736fe190156460e6867fe400e213c','dragon7eva','3',2,4,5,'【团购点评】团购去的，选的B套餐，蜜汁鲈鱼比较好吃，感觉跟中国菜没什么区别。黄咖喱肥牛锅尝起来不错，唯一的就是喝几口会腻，后劲儿太甜。木瓜虾沙拉味道比较特殊，只有两只虾，不过我还挺喜欢吃的，尤其里面的西红柿。饮料拉茶和木瓜汁都不错。米饭确实很香。主要是在新意街，要换个地方这些东西和味道性价比肯定不高。','0','2011-04-18 18:35:00',NULL),
	('0f6ef32126d535db27dc002c8c8affff','7a9736fe190156460e6867fe400e213c','SY窝窝头','4',3,3,4,'【团购点评】团购去的，地方很小啊，不过很安静，味道嘛，也没吃过正宗的泰国菜，也不好说正宗否。吃个新鲜劲吧，不过菠萝饭不喜欢吃。冬阴功汤还行。服务很好。还有卖纪念品的。','0','2011-03-15 10:31:00',NULL),
	('1033a894d15fb0883a3a7623839c1650','7a9736fe190156460e6867fe400e213c','爱小熊09','4',3,2,2,'因为是周末的晚上，吃饭的人很多，环境有些嘈杂。看菜单第一页推荐点了些特色菜：猪颈肉、黄咖喱金针菇肥牛锅、虾饼、菠萝饭、奶酪咖喱等，饮品中觉得果汁和拉茶还不错，不推荐柠檬茶（尤其是常温的），中药味很浓。吃下来总体感觉有些腻，不过餐厅的布置很不错。','100','2011-10-16 22:15:00',NULL),
	('110764288014c199fb453a5ef164bb31','7a9736fe190156460e6867fe400e213c','ruru_111','4',3,3,3,'【点评团消费】在意式风情街里环境还不错吧，之前吃过别家的泰国菜一直不敢尝试冬荫功汤，这次试了一下，觉得酸酸的味道还是不错的，喜欢喝木瓜汁，菠萝饭有点硬，青木瓜丝很辣，脆脆的，黄咖喱感觉一般吧','0','2011-11-14 10:21:00',NULL),
	('112247cb3ad428c27cfaccf3e46829f4','7a9736fe190156460e6867fe400e213c','奶昔巨无霸','4',3,3,3,'【点评团消费】团购去的，由于有旁边普罗旺斯那超极难吃的团购打底，本没太大的期，尝了发现比预计的好多了。咖喱锅确实椰奶比咖喱重，吃过了有点腻。泰式木瓜汁甜了点，拉茶正好。','50','2011-03-21 19:10:00',NULL),
	('11246d5e995349fbc8fad3addfe1f3d0','7a9736fe190156460e6867fe400e213c','persis','3',3,3,3,'我们是平安夜去的，本来想去隔壁的成桂，但成桂只有套餐，一人498.。。。。= =第一次在国内吃泰餐，感觉还是不错的，金针肥牛锅真的很赞，汤很好喝！芒果汁也超棒的！很纯正！！~但是。。。我们点的时候木有问价格啊。。。因为那个真心好贵！好像是一扎150+不过实话，这是我喝过的最纯的芒果汁啦~其实我觉得单点比较划算，尤其是人不太多的情况下！~那个咖喱什么丸子。。。。相比之下就很一般啦！有一股。。。气球味！所以喷油就把它命名为咖喱气球小丸子。。。好囧啊！！~总的来说不错啦~给我们天津一日游留下了美好的小回忆~','123','2011-12-25 12:05:00',NULL),
	('12ba3346da74b6177cdc24137db2c883','7a9736fe190156460e6867fe400e213c','沙鹰','4',5,4,4,'【点评团消费】这家是团购最成功的一次，服务员的态度都非常的好，还有两个小童工帮忙点菜，整个餐厅从里到外都很泰国，还卖各种泰国的产品，菜的味道很地道，老婆超级喜欢他家的密制鲈鱼，一个人干了一条鱼，儿子狂爱拉茶一个人把着没让别人分享，菠萝饭也很好吃','0','2011-05-29 03:00:00',NULL),
	('1432805e54b44b16a18541cf2f15cca5','7a9736fe190156460e6867fe400e213c','阿熊熊889','2',2,2,1,'菜色一般，鱼不新鲜。而且要注意服务员点菜时会误导你，结账时500多，我请她再算一遍，她竟然说我们白水也收费的又给我加了4块，什么玩意。绝不再会去第二次的。因为请朋友吃饭懒得和她理论。穷抠的老板一说刷卡800个不乐意，找她要发票马上变脸，恨不得让你马上走。太恶略了。','120','2011-08-06 14:45:00',NULL),
	('160fab9501eeefad3a74b9cdad8db14a','7a9736fe190156460e6867fe400e213c','我0725','4',3,3,3,'喜欢咖喱金针肥牛锅，应该放了奶油吧，所以咖喱不是那么冲。可以拌着米饭吃，当然她家的米饭是泰国香米咯。可是这个锅和东阳贡汤（就是冬荫功汤）都是汤类，于是我们两个女生就一人一锅汤了~也是各取所需啊。还吃了烧猪颈肉和青木瓜丝沙拉，烧猪颈肉很小份，味道不错，蘸料很有特点，缺点就是量小，蘸料偏咸，肉是凉的。青木瓜沙拉我不是很喜欢，总脚着有股六神花露水味儿。。不过同去的JM却满喜欢的，她说应该是放了鱼露。两个人四个菜吃了220吧，不便宜，但是值得去感受一下异域风情。此外提醒，大部分菜都是辣的，而且不能刷卡！','110','2011-08-16 13:32:00',NULL),
	('16b3c0e2fad8e6ba5077a446b85190ea','7a9736fe190156460e6867fe400e213c','w欢','4',4,5,3,'【点评团消费】团购去的，环境非常好，泰国人开的店。装修很好，很浪漫。靠窗的座位可以看到规划馆。菜的味道太专业了，木瓜沙拉吃着有点不习惯。不过总体感觉很满意。','49','2011-04-01 11:51:00',NULL),
	('1b3cc1aca16f52e01a143cc0ba817f70','7a9736fe190156460e6867fe400e213c','钢子yyyyyy','3',2,4,2,'泰国菜主要以咖喱为主，有咖喱鸡，咖喱蟹等等，咖喱又分黄咖喱，红咖喱，绿咖喱，我在泰国住了半年多，挺喜欢泰国菜，这家店把菜改良了，但是还保留泰国菜的特点，还行吧，还会在去的。','150','2012-02-03 21:19:00',NULL),
	('05632da437b2bf5755964fc51b9e4043','7ac113a64225d265f91585933aa131dc','天天小公主','1',2,3,1,'【团购点评】团购去的，两个人9.9元，包括：现压冷面2碗（小碗，价值24元）；牛肉串2串（价值3元）；羊肉串2串（价值3.6元） ；干豆腐香菜2串（价值3元） ；调料2份（价值4元） 说句实话，这个价格还是比较给力的，但是去了真是让我生了一肚子气！我和老公中午12点左右进的饭店，比较宽敞，环境还可以。进去以后前台服务员说让我们直接在右边找座位，我和老公坐下以后就开始等，大概五分钟左右，过来个人找我们要验证码，要去以后就又开始等。十五分钟 后，旁边桌来了一对情侣，我们还在等。又大概五分钟吧，上冷面的来了，直接给我们对面桌上。我看他手里还有两碗，以为是我的吧，绕过我们又给别人上了。我等了半个小时没吃上饭，人家来五分钟就吃到嘴了！给我气的，这是什么管理啊！在我气愤的一催再催下，终于上来了。肉串不大，吃起来也真没觉得怎么好吃。本来开始的时候老公还说，来一回咱就吃饱饱的，不够吃咱就再点东西。我这一看，还真是不给我机会。冷面味道一般，没有酸味，也不算凉。用老公的话说：媳妇，这冷面还没有你做的好吃。真是一次失败的团购经历。以后再也不会去！','5','2011-08-27 16:18:00',NULL),
	('05f96ba6eee888ecbcf0c220f477b283','7ac113a64225d265f91585933aa131dc','62fl73','4',3,3,3,'去过几次,感觉很好,月牙骨好吃,新疆串好吃,冰川霸道啤酒很好喝,自己烤动手烤,很有感觉,环境也很好,多晚去都能吃,我喜欢.','50','2010-09-11 21:52:00',NULL),
	('0f0ba3aaf835f6f021ed5dfe33898fb9','7ac113a64225d265f91585933aa131dc','wjpmark','5',5,4,5,'【试吃/体验点评】在延吉市的丰茂吃了很多很多次，长春这个丰茂的味道也非常正宗。反正不喜欢长春的烧烤，总觉得还是丰茂好吃，但需要自己烤。推荐羊肉串、烧烤串、羊肉大片、麻辣月牙骨、掌中宝、心管、干珍鱼。不推荐烤蔬菜。重要的，丰茂的冷面是长春市最好吃、最正宗的冷面。蘸料有很多，板筋料非常好，可以配很多串。还推荐不辣的料，能吃出肉串的原香。','50','2011-04-20 10:54:00',NULL),
	('11d2d258c6d296f5186c8072067d63d7','7ac113a64225d265f91585933aa131dc','xiao道xiao息','5',5,5,5,'非常好的也非常火的延边串城，串非常好吃，服务态度那绝对的好啊，尤其碰到延边人非常有礼貌。只要回长春就会和朋友去吃。冷面和炒饭也很地道。','50','2010-06-01 20:37:00',NULL),
	('160e0b2afc84442c31b71364d90eee25','7ac113a64225d265f91585933aa131dc','bluemoon0204','3',3,2,2,'周末的晚上晚饭感觉吃的没什么滋味，于是8点钟左右出门溜达兼找肉串吃。走出文化广场上到西民主大街上又走到南昌路前往建设街，最后终于走了一大圈后决定上他家看看。虽然天气已经凉爽可是屋里还是因为烤炉而有点热，虽然坐到窗边可最后还是汗流浃背了。由于吃过晚饭了，纯当夜宵，没点多少，10个牛肉串，5个筋皮子5个牛腩斤，1个鸡翅，4个鱼丸，2串蒜薹一串菜卷，最后要了个酱汤。事实证明只有便宜的牛肉串最好吃，筋皮子和牛腩斤差不多根本咬不动，鱼丸和鸡翅因为刚开始火大上来就烤糊，只有最后炭烧的差不多后再烤牛肉串才火候正好，加点咸盐和混合调料，味道喷香。他家的酱料不好吃，甜，因此考蒜薹菜卷都不好吃。酱汤的味道很奇怪，而且里面放了切成块的猪肉很恶心。下次去还是点基本的肉串吃好了。','45','2010-08-30 19:25:00',NULL),
	('1638fa6214bd4d88d1d29ca1f9a8a9fc','7ac113a64225d265f91585933aa131dc','橙CC','4',3,4,4,'我们9个人花了900整，真不便宜啊青岛纯生12一瓶，算贵的了剩下的各种串，好吃的有蜜汁小排，五花肉卷金针菇，卷辣白菜，烤马面鱼，蒜蓉扇贝，蚕蛹，蒜薹，有人还觉得香菇好吃～～不推荐板筋，没什么味道，鸡翅，里边没熟；茄子，就是不好吃别的也不知道吃啥了，咋那么贵','100','2011-02-02 10:53:00',NULL),
	('16bc67617548cf5db4cad84b069c1146','7ac113a64225d265f91585933aa131dc','李锦瑟','5',4,2,3,'和某人第一顿饭现在想想真是不浪漫可当时的确是我在听见牛排的提议后，选的这个好像也不够淑女肉串没什么印象了记得五花肉金针菇，记得辛拉面还记得当时说好夏天的时候再去，一定要在柱子旁边的空隙走，看会不会被卡住','40','2011-04-07 11:27:00',NULL),
	('1d386f0766d60fa05525ddd511dcf5cf','7ac113a64225d265f91585933aa131dc','moneybaby','4',3,3,3,'这种烤串真是很不错的，用炭火可以自己烤串，热乎乎的，真是非常有乐趣，当然了，你可以要求后面给烤完了再拿上来，这里面的肉串、面包、鱼丸什么的狠不错，值得一吃。','40','2010-12-10 17:11:00',NULL),
	('03fc42327bbb5e17aadb917649f97949','7c5302d772a0b11aa384db95a4fb92e3','moonmn','4',3,3,3,'一贯幸运楼水准。不能说是太好，但是牛杂汤很好饮。呢间比其它幸运楼的环境要好。算比较实惠环境也不错的一个饮茶地方。','50','2011-10-17 18:39:00',NULL),
	('06f87500c9f427082e8c5eea034af838','7c5302d772a0b11aa384db95a4fb92e3','小缘丸','3',2,3,2,'都去过几次啦，但好似越吃味道就越差，特别下午茶人非常多，排队都要等好耐，我多数都系饮下午茶多，觉得特别便宜，但现在升价了和平时喝早茶的差不多价钱~~~~~~~~','50','2011-09-07 11:20:00',NULL),
	('0b49539fa8ae160c3f79bcdf95c744e4','7c5302d772a0b11aa384db95a4fb92e3','maomaowindy','4',3,4,2,'【试吃/体验点评】空间比较宽敞，天花板好高，装修得有D辉煌。普遍比出边既早茶要贵，但口味都可以，虾饺、凤爪好食，仲有D糕点比较精致爽口。上菜速度都几慢下。适合同学聚会、家庭聚会','35','2011-08-26 19:57:00',NULL),
	('0e0cfe7b78af3d11e7f623e53cdcc863','7c5302d772a0b11aa384db95a4fb92e3','婺雨沙海','4',4,4,4,'周末一大早就带朋友过来一起喝早茶了，在北京路的天河城八楼。大厅装潢的实在是大气，我们八点钟左右到的，其中一个厅已经差不多坐满了，另外一个厅也坐了很多桌。最喜欢他家的凤爪，连里面作为点缀的花生都非常好吃；虾饺，真的是料足，粘点醋，非常好吃；奶黄包，里面的馅像流沙一样，味道很好，超市里买的那种真的是没法比……四个人花了170左右，吃的很饱了。','45','2011-12-06 10:33:00',NULL),
	('131a924e54bb232e8f341bd5e2bbd7bc','7c5302d772a0b11aa384db95a4fb92e3','cyj6859165','4',4,3,2,'虽然等位了，搭台了，价钱小贵了，但是出品真的不错。推荐奶黄包，榴莲酥和凤爪。尤其是奶黄包，里面流心的奶黄口感非常饱满，榴莲酥同理。虾饺也不错。不过萝卜糕和牛肉肠就一般，普通水准吧。总的来说还是挺不错值得推荐。','50','2011-09-25 13:45:00',NULL),
	('15613f5a0707ebe0441962b31d0c1abe','7c5302d772a0b11aa384db95a4fb92e3','jason1989_','4',3,3,3,'哈哈，自从海珠果个幸运楼无左之后，就转场嚟北京路呢间了，主要就喺睇重距D点心好食咯，但喺如果好似以前咁有夜茶饮，咁就正啦，哎。一句讲晒，广州人都应该会去过嘅茶楼。','0','2011-09-14 09:39:00',NULL),
	('19589ef487efc7ce7f58a2c6af03ee73','7c5302d772a0b11aa384db95a4fb92e3','lilyjiu1985','5',5,5,4,'经常会来呢间幸运楼饮茶，D出品的确无错，不过如果预着饭市高峰期，等位就比较麻烦，所以只能够避开高峰期，而且呢度饮茶，如果你坐细台，仲唔可以搭台，呢个我超中意，仲要分开吸烟区同非吸烟区，简直very good 啦！支持....','50','2011-09-08 09:45:00',NULL),
	('1bca486f7e94966ea0d167235afb2cb6','7c5302d772a0b11aa384db95a4fb92e3','may507','4',4,4,3,'有次去喝早茶的时候想点虾饺的，不过那个服务人员推荐了那个类似虾饺的（忘了叫什么了）一个二十多块，口味也没虾饺好吃咯，有点坑 其他出品都不错的，特别是鲍鱼花胶鸡粥，很赞的。老人家比较多，有事要等位呢','50','2011-12-04 16:23:00',NULL),
	('1d42c18646f8dd785feb9f1459e99c62','7c5302d772a0b11aa384db95a4fb92e3','rhyme_lin','4',3,3,3,'好老牌子既一间广州特色酒楼。。基本上因为泰康路果间无左之后呢度就更多人喇。。出品仲系好吾错嘎~~不过等位就真系好麻烦哦。。','0','2011-09-14 22:59:00',NULL),
	('01615ce9a0b1dc9aeb6ac46f4e5f7f4c','7dc7f165a29bf5bead50b9a5886da90b','西安女娃爱美食','4',4,2,2,'太嗲了 味道够重够辣 麻辣烫串都是大众常见的菜样儿 主要是胜在汤味儿 老板很牛气 吃饭的人也非常多哦','12','2011-08-27 13:26:00',NULL),
	('03b8d6532b4c0e1d6bd6f779d838ab60','7dc7f165a29bf5bead50b9a5886da90b','fjjfu','3',3,2,2,'按说本人也是走过南闯过北的，爱吃辣也挺能吃辣的一个人，但是在它家确实让我体会了一次什么叫辣劲十足了。刚开始吃麻辣串和火锅粉的时候，只觉得的挺香，等过了一会儿，麻劲和辣劲都上来了以后，只觉得舌头和嘴都不是自己的，真的挺过瘾的。','25','2011-01-16 21:18:00',NULL),
	('06d64c6643ec07e55ac1d18d0e488349','7dc7f165a29bf5bead50b9a5886da90b','清水之波','0',4,2,2,'他给我的感觉就是一个字辣！！！两个字太辣！！！我不知道为什么有怎么多的女孩子喜欢吃这种东西。第一次吃也是最后一次吃是跟着女友她喜欢吃所有我就配着她，强忍剧辣吃完了一碗以后就再也没有去了。','10','2008-09-20 16:40:00',NULL),
	('07175fc8d8b4bc0ff4e23fb7e11b4b77','7dc7f165a29bf5bead50b9a5886da90b','200820122008','4',4,3,2,'味道很正宗``就是有点小贵``爱吃辣的亲们可以去试试``吃不了的还是别试的好``不然一瓶饮料都不够解辣...','0','2010-02-02 21:44:00',NULL),
	('073164e08cddc528411740fe32b09ba4','7dc7f165a29bf5bead50b9a5886da90b','hanyixin','0',2,2,2,'辣辣辣，没什么别的感觉了。好辣啊，没想到太原人民这么能吃辣的，是我吃过最辣的粉。环境很乱，到处是垃圾。。。','0','2009-09-03 09:59:00',NULL),
	('0a36de3faab211f7044318094e66d9f4','7dc7f165a29bf5bead50b9a5886da90b','蓝黄红肤','4',3,2,2,'最出名的是火锅粉，红红的一层辣椒油，妹妹看着特别刺激，而且吃着特别想。反正是老牌子，品种也不少，不过不爱吃辣椒的趁早别去','15','2011-03-06 16:44:00',NULL),
	('0eb09bf93b5dffa5e9b5614f2aeeab1a','7dc7f165a29bf5bead50b9a5886da90b','草头蔡','0',3,2,2,'他家的小吃吃过的种类不多，但是印象深刻的只有火锅粉。还真是好吃，一想起来就口水四溢，的确不是一般的辣。我算是个能吃辣的人，但是吃他家的火锅粉还得一直喝水才行，但是真的很香很爽，偶尔吃一次还是很不错的。','10','2009-03-25 22:51:00',NULL),
	('16f44733667d3ed18326f54d2ea4a6f2','7dc7f165a29bf5bead50b9a5886da90b','拱食物','4',4,1,1,'冲着口味去的一家小吃店，以辣味为主。它家的火锅粉，叫人吃一次想一次，辣的可以。但是环境嘛，到处都是油油的。每次的分量也不一定，还要自己举着油油的托盘等着，不过为了口味到时可以一吃。','0','2010-09-17 16:39:00',NULL),
	('1429c3cd2be01f3a871ae84a9b6c341e','7dc7f165a29bf5bead50b9a5886da90b','爱吃不吃','0',3,2,2,'这家的辣椒好像不要钱的一样，太辣了。东西倒是蛮好吃的，火锅粉里面土豆，藕片，冬瓜量很足，有点吃麻辣烫的感觉。夫妻肺片里面的牛肉挺多的，不过20块对于小吃店来说是贵了。卤肉夹饼可能是唯一一个不辣的食物了，味道不错。油醋面也是很辣，但是味道也很好。','15','2008-12-14 00:54:00',NULL),
	('14c8d9c50d5d4319efa4bddc9611a446','7dc7f165a29bf5bead50b9a5886da90b','柠檬不爱酸','4',4,2,2,'也是老店了，麻辣串做的真地道，估计太原市没有几家有这种小吃。火锅粉是最爱，巨辣型的，爽！但是现在质量明显下降了，原来有血块现在没有，原来有很多莲菜蘑菇，现在放很少，里面净是些便宜的菜什么土豆片粉条之类的，而且一碗也没有几筷子。有一次火锅粉咸的都发苦了唉。老板还牛气的很，但是我们还是经常去经常去，无法割舍的爱啊。','12','2011-09-06 16:00:00',NULL),
	('19e815feede33d0ea07341b0af52b22c','7dc7f165a29bf5bead50b9a5886da90b','娜山山','4',3,3,2,'几乎每次去柳巷都要去那里的。最喜欢他家的火锅粉了！够辣够味！我男朋友最喜欢他家麻辣串，不过我觉得一般了，主要是太凉了，嘻嘻','15','2011-12-02 10:05:00',NULL),
	('1ae1665869f0bd1132dacd02153b5182','7dc7f165a29bf5bead50b9a5886da90b','吗乌子脸','3',3,2,2,'原来好爱吃他家的火锅粉和串串 上大学的时候 礼拜五常和同学去吃 现在几乎不去了 感觉那辣椒油不太对劲吧 价格现在也不合理了 东西没多少价格倒是不便宜 不如三姐妹的','0','2010-04-10 12:29:00',NULL),
	('1bd092e774e97d18ac8d172e91927178','7dc7f165a29bf5bead50b9a5886da90b','注册太晚','4',4,2,2,'他们家的火锅粉算是很经典的了吧，每到夏天的时候就能看到很多清凉美女坐在里面吃得大汗淋漓火锅粉辣得没的说，麻辣串也还不错，就是有点咸，1.5/串至于环境嘛，在这种小店吃东西，还是别计较了','10','2009-12-29 22:47:00',NULL),
	('0056b25f1e14c4379c53447b0bdd3693','8103eabe629fdd682eb85d6de5838ea5','古艾','0',3,3,3,'找到她们家店的时候，已经是晚上八点半，结果，打烊了....他家的营业时间是早上7点半到8点，不要去晚了...','0','2008-09-28 17:02:00',NULL),
	('077a2ad554bf46b5a4ec734bfb9d3fd4','8103eabe629fdd682eb85d6de5838ea5','甘当维尼熊','4',4,2,2,'到他家的豆腐圆子,在贵阳还是很有名气的.很喜欢吃他家的豆腐圆子,真的做的不错.他家的蘸水也很好吃,和豆腐圆子真的是绝配.','10','2010-11-15 22:46:00',NULL),
	('0a0e485fde1a120be02d2350e4293998','8103eabe629fdd682eb85d6de5838ea5','jing7909','0',2,2,2,'已经远远不如当初在中华北路没改造前在一个小黑巷子里的生意好了，自从那拆了以后就再也没吃过','0','2006-11-22 10:38:00',NULL),
	('0e7e93dad591dae55684e2b89bb4ace8','8103eabe629fdd682eb85d6de5838ea5','闷小熊','3',3,2,2,'大家都在推荐他家的豆腐圆子，我就不重复了，这里向大家推荐下他家的另一个特色——冰粉。去他家吃小吃，冰粉一定要点一份。他家的冰粉甜味适中，甜汤有淡淡的“冰果露”味道，算是贵阳少有的风味。可口之余，还能让80后的童鞋们对童年产生无限的回忆。最后，友情提示一下，他家的粉类最好别点，因为味道实在糟糕。','10','2010-10-10 01:31:00',NULL),
	('10190b8c11a288fbdd1e435b9948b78c','8103eabe629fdd682eb85d6de5838ea5','yolanda430','4',4,2,3,'8月在贵州的最后一天 直接拿着之前的美食攻略一家家找 大名鼎鼎的雷家豆腐圆子自是不能错过圆子真的很美味 至今想起来都会流口水 炸得脆脆的外层包裹着里面嫩嫩的豆腐 顾不上烫 一口下去 怎一个美味了得 不过因为实在受不了折耳根的腥味 没有蘸料 也许蘸点料吃味道更好 本来还想打包带点 不过这应该是热的才好吃 所以最后未付诸实践除了圆子还点了春卷和粉 这两样的味道都不怎么样了','0','2009-12-07 18:23:00',NULL),
	('10cdd7d7763b0c074039a7e3a0b71f87','8103eabe629fdd682eb85d6de5838ea5','米苏_饭团饭团','3',2,2,2,'原来是以豆腐圆子文明的，不过现在豆腐圆子不及以前好吃了。中午过去吃饭，点了个素粉，不好吃，而且分量老少额。加了豆腐圆子，圆子外皮已经不那么脆了，沾水也非常非常一般。越来越杂壳哦。','0','2010-07-01 17:45:00',NULL),
	('13854029ae014b077a37079e7fe8836c','8103eabe629fdd682eb85d6de5838ea5','托耳师妹','0',2,2,2,'1块一个豆腐园子 点好就坐下开吃 还挺不好意思的 一桌子人只花了3块钱我同事喜欢它的味儿 我不喜欢 不太喜欢臭豆腐而且晚上还要吃晚饭 所以就只吃了一个 不过确实很特别 还有蘸料 值得一试','1','2008-10-09 21:06:00',NULL),
	('1459d18a4fe03fcb4f105752242b49a2','8103eabe629fdd682eb85d6de5838ea5','zxy033','4',4,2,4,'作为一个外地的人到贵阳，就听说了这家小吃的名气，就专程尝尝味道。豆腐圆子听名字想到的这个东西应该是圆的吧，其实不然，呵呵，和我们开了个玩笑，基本上是长条型的，味道还不错挺香的，在沾上小店的特色调料,更是一绝。还有炸春卷，除了香，还有一个感觉脆脆的。本人热烈推荐豆腐圆子、炸春卷。','10','2010-10-28 23:15:00',NULL),
	('14be640e78328682b122c1f1f0ac3dc6','8103eabe629fdd682eb85d6de5838ea5','讨厌蛋黄派_派派派','0',4,2,2,'这个是没得说啦。。。。极品。。。只是因为市场需要，所以加了很多其他经营的食物。。。就要本来经营的主要食物没有原来那么好了。。。上次朋友去深圳，陪他去雷家。买了50个豆腐圆子。还担心他带不上飞机呢。。。4.10更新今天去了 点了八个 这个数字是挺奇怪的主要是一开始要了五个 因为同行的MM不爱吃就我吃得多 点了一份酸菜二块耙 味道不错圆子还是很脆 不过一开始真的好烫 我一咬下去 就被热气喷到舌头上很烫  不过味道还是好的 人很多 看到人家一端就是十个 还觉得自己挺小气的 呵呵','0','2009-04-10 19:18:00',NULL),
	('1870dbb9b20c5764d115c4993d28e404','8103eabe629fdd682eb85d6de5838ea5','Ares悦','4',3,2,2,'一说到豆腐圆子，贵阳就没有人不知道雷家的。豆腐圆子是椭圆形的，外面炸得“脆脆的”，里面豆腐非常的水嫩，再配上贵州人最喜欢吃的折耳根酸萝卜蘸水，味道真的极好。','0','2011-07-06 16:52:00',NULL),
	('189b07cc22da1ac9295096069c1cc8fb','8103eabe629fdd682eb85d6de5838ea5','Angel_coco','0',2,2,2,'好特别的小吃,来贵阳之前做了功课,在其他城市没有见过豆腐这样做的,只是有点吃不习惯折耳根(应该是这三个字吧)的味道~~~~','0','2009-08-07 00:29:00',NULL),
	('18db746b3ccac9489f8a0b991e0dc6fa','8103eabe629fdd682eb85d6de5838ea5','蝎子84','0',3,2,2,'好吃是好吃，就是贵了点。有时候都不去他家了，去其他味道不错价格也合适的','10','2006-10-25 19:30:00',NULL),
	('1ca21a81774db04b5d4644a2be010d53','8103eabe629fdd682eb85d6de5838ea5','洛卡其','0',3,3,3,'传统老字号每次回来都吃就是油炸的有点腻吃不了多少春卷也挺好吃得旁边还有几家小吃一路吃过来就是享受啊','10','2008-07-13 12:05:00',NULL),
	('1df2401e2b726700eeee7f8b4cabc297','8103eabe629fdd682eb85d6de5838ea5','VIP亞','3',2,2,2,'开始看到这个网站上排名很前，特意去了一次，但是如贵阳的朋友所说不是很好，豆腐圆子是2.5两颗，外焦里嫩的中间空心，也许是对豆腐不感冒吧，没觉得多特别。还点了烫饭，原来就是汤泡饭啊，浪费钱了呀！值得一说的是玫瑰冰粉，消暑良品啊，4元，据说买白凉粉可以自己做，像果冻一样的而且两三块做一脸盆，so以后不会去啦，没觉得那么惊艳','20','2011-05-24 09:03:00',NULL),
	('03b64a0c09e3f843958bad5542086e53','821e5f406d9ca1d1618545182f59b6ec','爱吃辣椒的重庆人','0',5,1,2,'之所以环境差消费还20块，完全是因为真的黑好吃，我们都莽起整。大龙火锅是没有招牌的。但是人多得不得了。我在他们店的楼上住，每天都在大龙火锅的烟熏缭绕中惶惶不得终日。一般来说，你们想吃大龙火锅，请你4点钟给你大龙来个预约，不然到了地方再去吃，不出所料的话，应该是在两个小时以后了。味道是老火锅的味道，一顿吃完，你面前的桌子已经是油腻腻的一大片。火锅的味道是越吃越辣，虽然肚皮经很胀很胀了，但是筷子却不由自主的伸到锅里，你想缩手，绝对不可能！大龙在召唤你。','20','2007-12-26 17:30:00',NULL),
	('06b3834ff4da2e55d86ca6ec0140f498','821e5f406d9ca1d1618545182f59b6ec','蜗牛奄列','5',5,2,2,'去吃的时候就抱着被辣死的决心，小料里没放醋、没放耗油，就是为了吃出那种辣翻的豪气来，但是没克制住喝了两瓶饮料。。。。据说5点开门，5点准时到达，服务员都还在吃饭，5点半开始点餐，半小时间，屋里已全部坐满，菜单上的菜并不多，但是都是经典，常点的，吃的非常痛快，吃火锅就是要吃出酣畅淋漓的感觉才算是到位了！！！！老气的房子，居然还有阁楼，江湖火锅，就是要有这种气派！点了一份绿叶菜，没人敢吃，看到人家点的黄瓜片，垂涎三尺，但是实在太撑了，给自己留点念头吧！作为江湖火锅，还是实至名归的，没吃过其他家，所以不敢说算不算排第一，有待考证！','60','2011-07-14 14:35:00',NULL),
	('0765dbb54203ceed2f69422ab288fa73','821e5f406d9ca1d1618545182f59b6ec','花落无深','0',4,3,3,'山城重庆山出名，美女出名，辣食也出名。重庆人都爱辣食，火锅是必不可少的，这的老板开得这家店很绝呀，风味很好呀！      喜欢这的风格口味的啥人都有，开跑车的老板，穿着亮丽的漂亮MM，还有些打工朋友也来关顾，看不不是只有我好这一口呀~','35','2009-07-17 14:07:00',NULL),
	('0b6a2478c127542e2c054ca00ba0fd75','821e5f406d9ca1d1618545182f59b6ec','flyzw999','5',5,2,2,'这是我吃过的最好吃的火锅了~~~非常非常想念啊~~~~想念嫩肉片、豆芽、海蜇丝~~~~~连海白菜也很好吃啊。。。。。非常想念。。。。亲爱的大龙。。。。。。我要回来啦~~~~·哈哈~~~~','30','2010-01-30 14:20:00',NULL),
	('0b7ac1303cff9b609a27d3628b5a6c87','821e5f406d9ca1d1618545182f59b6ec','zmdream','4',4,1,2,'红红亮亮的汤料，一看就超有食欲，味道醇厚，辣而不燥特色菜：好评如潮的嫩肉片，嫩滑糯香，味道新鲜！不像有的嫩肉片，要么嫩得一包渣，要么棉得不消化，还有的，能吃出用碱一类的东西泡过，吃得不放心吃完都8点过了，出来一看，外面还排着几轮呢','35','2011-09-07 11:56:00',NULL),
	('0c23def56d5f78486662c552afc33d40','821e5f406d9ca1d1618545182f59b6ec','江上风清','0',3,1,2,'大龙因其老板名字而得名。老板戴着只眼镜，不大不小的岁数。以前因店面很小，每次都有很多人等着翻台。后来在对面又租了一个门面，才稍稍缓解了局面。','20','2006-11-29 12:43:00',NULL),
	('0f63138ac52de76fa4a57e784d54e1ae','821e5f406d9ca1d1618545182f59b6ec','哪男飘雪','4',4,2,2,'据说这家火锅居于重庆江湖火锅的榜首，从外表看还真看不出来——难找、没招牌，我们都是在问了几个人之后才找到的。里边也又破又旧，去的时候都已经是满堂了。不过火锅就霸道了，锅底香味浓郁，而且越煮越辣，绝对让你回想到当年码头船工吃火锅的场景。环境确实不敢恭维，但是服务态度没得大家说的这么差，我觉得还是多随和的，火锅味道是越烫越辣，嫩肉片真的很滑嫩，菜品最喜欢嫩肉片和火锅饺子。','0','2011-03-03 15:26:00',NULL),
	('12b1472a48c7e85ce7de7501bd0390b4','821e5f406d9ca1d1618545182f59b6ec','123456hm','5',5,2,5,'这家火锅店环境很差，但是不得不承认味道很好，特别是那个嫩肉片，很好吃，一个人都可以吃几份，价钱有一点贵，但总体来说还是很不错的。','0','2011-11-13 13:17:00',NULL),
	('159ee85b875b93d5273a09466398ec40','821e5f406d9ca1d1618545182f59b6ec','alex_huang','4',4,2,2,'这家店是早有耳闻，去过三次，每次都要排除。味道确实不错，辣得很爽，算是不错的一家重庆特色的火锅。但环境着实有点差哦。','0','2010-10-01 19:17:00',NULL),
	('1605b1c77213864c22e2568e5093e2c3','821e5f406d9ca1d1618545182f59b6ec','小西瓜小小','4',5,1,2,'成都到重庆玩,看到这家点评很好专门去找的~很不好找,大概位置在小龙坎正街的蓝天医院过街,往右第二还是第三个小巷子口进去...店铺旁边还在炒火锅底料,隔着一条街都找得到...店面非常烂没有招牌,最后结账的菜单上面才有&quot;大龙火锅&quot;几个标题字...中午貌似不营业~下午5点半到了等了进40分钟...老板在烟盒上撕一块写个号,排队喊号...霸气惨了...还有就是盘子都非常烂,像压烂的铁皮和全是缺口的瓷碗....好不容易进去,闻着就非常香,口水都滴下来了,口味又麻又辣,非常地道的火锅,这几天上火有点遭不住,就放了点醋,跟成都火锅不同,这调料都没有耗油和香菜黄鳝剐的非常干净又新鲜,老肉片口感十足,腰片新鲜分量很足,耗儿鱼也很入味,可惜跟朋友才2个人,只要了6个荤菜,素菜完全吃不下了,还想尝尝肥肠和牛肉的,下次再去吧,强烈推荐','50','2011-07-24 18:24:00',NULL),
	('165529fd14a2dda241f8a6d5d2dc0e50','821e5f406d9ca1d1618545182f59b6ec','喝茶的素食饕餮','3',3,1,2,'作为外地人我真的伤不起啊…真心觉得应该20分钟内吃完，超过这个时间辣的真是难以忍受，最后一口肉下肚我喝了整整一瓶豆奶才压住，太辣了！推荐毛肚，嫩肉片，香菜丸子。','90','2011-10-08 02:04:00',NULL),
	('1789ce617f16c1839d588621f9705090','821e5f406d9ca1d1618545182f59b6ec','饕餮的小呆','0',3,1,2,'朋友带我们去的，事先在点评网上看过的，都说很辣，可是我们都觉得可以承受哦，或许是馋劲盖过了味觉的灵敏度，不过油碟子帮了很大的忙，很解辣的。红红的一锅子，在上海的话，没吃就要晕倒了，这里就是有这种神奇氛围，虽然排档环境很差，不过这个忽略。。。吃的涮料有：老肉片，毛肚，鸭肠，酥肉，嫩肉片等，都算上海吃不大到的正宗的东西咯。朋友教我们烫鸭肠，毛肚，然后放在油碟子里滚一遍，人家应该是稍微蘸下，入口，香－辣－鲜，是这样的口感哦，因为事先让店家少放点花椒，所以麻的还算可以。不过吃到后来，一来战斗力不强了，二来油碟子变成辣油碟子，滚烫的，三来牙口都不行了，烫的东西，又都有嚼劲，毛肚吃不下了。但是老肉片和酥肉都很好吃，酥肉跟西安的味道挺像的。写到这里，咽了口水。实在是吃不动了。火锅味道很重，看着就有食欲，下次还要去。店没有招牌，就是这么低调。','0','2008-10-14 12:06:00',NULL),
	('18fff784398828420ef1ae60e86e7980','821e5f406d9ca1d1618545182f59b6ec','花心鳄鱼','3',2,2,2,'大龙火锅味道确实不错，经常和朋友去聚餐，环境一般，服务还可以，价格方面稍贵，不过整体来说确实在火锅业中算不错的了。给一个好评！！','0','2011-09-22 10:29:00',NULL),
	('1a80789987117d15d0db9a7dccfc5b02','821e5f406d9ca1d1618545182f59b6ec','wly1985910','5',5,1,1,'跟赵二不一样 那边的老肉片好吃 这边是嫩肉片好吃 超级好吃啊 一般都是两份两份的点 还有香菜原子 就是一个字形容 辣啊 越吃到后头越辣 感觉每个毛孔都可以流汗老 安逸 老火锅','50','2011-07-21 08:55:00',NULL),
	('1c58148309e47a442eea5e4c1e97e6a4','821e5f406d9ca1d1618545182f59b6ec','Van姣','4',4,2,2,'真想不到这个地方的火锅也上了点评网的 因为它确实“又旧又难找”。虽说环境就像是大排档，不过味道确实不错。我也是听朋友介绍说很好吃才去的。个人觉得有点辣，适合口味重的人。','40','2011-07-20 20:23:00',NULL),
	('1da4614becbe032886bcdae303a6553c','821e5f406d9ca1d1618545182f59b6ec','我有一只哈猪','0',3,1,1,'首先从服务说起，因为我们是下午5点的样子就去了，两个铺面一个客人都没得，不过店员说：预约没有嘛，没有就问老板还有没得位子，态度暴差，我们问老板，老板说，那只有坐“巴壁桌”（挨到墙壁的桌子），其他全部都预约满了，坐下后，服务员在每个空桌子摆了菜单，就是不给我们，我盯旷了，完全卡夫卡的世界了，最后菜单拿来我们点完菜后，小弟娃不冷不热地甩了句：要等得久哦。一句话，服务简直是差得夸张了。环境当然实在是恶劣了点，我反正就抱着一定要尝尝这个传说中的老火锅的心态忍受了，如果好吃，我就不计较那么多了，虽然我本来就是不太看重吃饭环境的，不过这个都确实有点过了。味道嘛，第一口鸭肠下去我忍不住大呼：好吃！辣得很正，又香，不过越往后面吃，就只剩辣了，满锅全是海椒！特别是点的那个麻辣牛肉，确实带劲，不过要多煮一哈好吃些。到最后除了辣已经没得其他味道了。。。我现在胃都还在痛。','30','2008-04-21 21:53:00',NULL),
	('01dd25bd0736f5845a24533a2a41eb14','822cf402a05eedc0013f6fa300ce7e26','koom','4',5,2,2,'招牌凉粉、蒜泥白肉和夫妻肺片很好吃。沸腾鱼的味道和分量都很一般。建议大家以后先吃热菜，再吃凉菜，不然凉菜味道那么重，就会显得热菜没什么口感了。下次准备尝尝串串兔和福寿螺。','40','2011-04-17 20:06:00',NULL),
	('04bf5d1c8bcf1c377e276e6359499b77','822cf402a05eedc0013f6fa300ce7e26','powertao','3',3,2,2,'朋友请吃饭去过2次，味道还可以，比较正宗的川菜，我记得去的时候感觉里面很深，像在走迷宫，因为那2次一起吃饭的人比较多说实话没有吃到什么东西。','50','2011-09-16 15:37:00',NULL),
	('0791d6b2b0f007efe88e8a33dbe4b04e','822cf402a05eedc0013f6fa300ce7e26','Sunny1717','4',3,2,2,'都是又辣又麻的。夫妻肺片真是美味啊，蒜泥白肉很极品，抄手、凉面、汤圆都是手工现做的，鱼香肉丝这么大众的菜都被他们做的不一般，推荐这家，价格不高不低，上班族应该都可以接受','50','2011-03-28 18:37:00',NULL),
	('08ca5f2d9a5aa426f575313bedf167ff','822cf402a05eedc0013f6fa300ce7e26','宝O','4',4,3,3,'不知道大家知不知道台北一路的小城故事，就在那个附近，招牌很小，很容易一不小心忽略了。看外表更像是茶馆，一进门，四川小哥就会用纯正的四川话招呼你，非常亲切！纯木质的各种桌椅，坐上去非常安逸有感觉~麻绳、印花蓝布，还有服务员的红棉袄，都仿佛让人一下就到了四川一坐下来服务员就给上了他们家的泡菜，味道很不错，酸酸辣辣的，还带点微甜~除了泡菜里面还有泡萝卜~不知道大家有没有吃过徐东的成都安逸小吃，这个泡菜很像是那里的味道~（PS：成都安逸小吃也很好吃！）点了几个非常典型的四川菜：麻婆豆腐、夫妻肺片、酸菜鱼。还有两个小食：担担面和米酒蛋花汤上菜咯~~先上凉菜，夫妻肺片，好像是38一份，不算便宜的。看起来就非常过瘾！和我们一般吃的紫燕廖记都不一样，配菜有黄豆和花生两种，都是亮点，非常好吃！酱料的味道有点点像老房子的味道，不过比他们家更浓郁~吃到嘴里没有觉得非常麻，够辣够过瘾，酱料很香！真的让人欲罢不能但是这个辣酱有点怪，辣嘴不辣胃。不会像很多地方的川菜，吃完了胃里火辣辣的很难受。而且当下吃了很辣，但是休息几分钟就好了，可以接着吃~第二个，麻婆豆腐因为这是某人拍的，技术不行。。手抖。。都糊了。。...就剩这两张了。。麻婆豆腐的味道和夫妻肺片的酱料味道有点像，也是麻麻辣辣的。值得一提的是，他们家麻婆豆腐的酱料不是用的普通猪肉，而是用的牛肉粒，有很香的牛油的味道，非常赞！上大菜咯~~~酸菜鱼片！~很大一盘，好像是68一盘，一般价格~打底的除了鱼片就是酸菜，挺实在~鱼片很嫩很大片，但是酸菜非常好吃~~在吃了前面两个辣菜之后，再吃酸菜鱼片真的是觉得这是我们今天点的唯一一个不辣的菜了！！好感动。。。总体来说，比一般小馆子的好吃，但是不是我吃过最好吃的酸菜鱼吃过最好吃的酸菜鱼是在巴适，酸菜鱼用的鸡汤做的，很鲜，不辣。比起来的话金色雾都略逊一筹。两个小食，好像都是6块担担面的味道和夫妻肺片很像，面条很滑，但是最后没吃完，因为太辣了。。。。米酒蛋花汤无功无过，就是普通的味道，甜甜的，化解一下已经麻辣的舌头。。最后总结，三个菜两个小食，四钵米饭（米饭好像不要钱），一共花了120多，对比味道来说，这个价钱很划算！~最后没吃完，麻婆豆腐打包带走了~看到还有好多人都打包带走，估计是因为被辣得吃不完吧！可是如果就这么浪费了又会觉得好可惜。。。。喜欢吃辣的不要错过了哦~全文','60','2011-03-05 23:34:00',NULL),
	('09a4af922645bfff6159b51c2484a21a','822cf402a05eedc0013f6fa300ce7e26','JULIAZ11','3',3,2,2,'他家属于特色还蛮重的一家，经常如果在周围办事就会过去吃，蒜泥白肉还不错，是个凉菜，鱼香肉丝也很特别，和一般用番茄酱炒得不一样，吃起来有甜味，适合不太吃辣的人。菜的分量都很足','50','2011-07-20 13:30:00',NULL),
	('0c25e61b254391653adb6cf7a64d3d5e','822cf402a05eedc0013f6fa300ce7e26','花开花谢wj','4',3,3,3,'麻婆豆腐，鱼香肉丝，凉粉都挺好吃的，里面的东西总体来说还是挺好吃的，去过一次，还是有一点点小贵把，学生麻，也没啥收入，服务态度有点不让我不太满意，有待于进一步提高呢呵呵','0','2011-07-22 16:28:00',NULL),
	('0c82b3c2f07b58209be5c1c9fb85cc06','822cf402a05eedc0013f6fa300ce7e26','清风猫','4',4,2,4,'这附近的人都知道这个好地方的！环境一般，人多较吵。菜都是又辣又麻的。里面的经典菜太多了。这次也是点了几个特色菜。夫妻肺片好吃啊，就是感觉里面的肉没有以前的好了。凉面，一直是我喜欢吃的，但是在这种不到夏天吃凉面还是第一次。还有鱼香肉丝比较有特色的，相比较而言没有那么辣。吃到最后，可能是辣的麻的吃多了，嘴里感觉有点苦了。这里也不适合经常来吧，要隔段时间。','45','2011-03-20 19:46:00',NULL),
	('0dc407ea6670ecde4b371cab5e31ca7b','822cf402a05eedc0013f6fa300ce7e26','yixiuge11','4',5,2,2,'在武汉算是比较正宗的川菜，老板是重庆人，所以重庆麻辣味道多一点，凉拌菜都很好，蒜泥白肉、川北凉粉、夫妻肺片、凉拌马齿苋等等用料足，很入味，热菜一般化，抄手、凉面、汤圆都是手工现做的，相当不错！分量还可以，价格不算便宜，虽然是街边小店但是价格和一般中档酒店差不多。店里装修有点老四川茶馆味道，但是光线有点暗，隔断不好，有点吵。服务员都是重庆四川来的中年大姐和阿姨，服务很一般。餐前送一碗粥，以前是黑米粥、最近好像是小米粥，甜甜的，比较能中和菜的辣味。','50','2010-12-30 02:52:00',NULL),
	('0e38fd281d2547b5449d8bae03d76398','822cf402a05eedc0013f6fa300ce7e26','愛了就知道','2',3,2,1,'4分 一般。推薦：乾煸藕絲、福壽螺、川味涼粉。是比較正宗的川味，夠辣夠勁！但這裡的服務態度是極度的差勁…完全不把客人放在眼裡。','40','2011-09-05 00:55:00',NULL),
