	('16bf1458332dfb316d2d3f88ecf6c68b','822cf402a05eedc0013f6fa300ce7e26','黛苏菲','4',3,3,3,'昨天休息跟老公去他们家吃的午饭，不知道是不是饿的原因，感觉他们家的菜好好吃麻婆豆腐辣辣的很好吃很够味，鱼香肉丝一向我都是很喜欢的，川北凉粉不是很好吃，凉粉有点硬感觉不是新作的，干煸藕丝很好吃的，他们家的鱼做的很不错喔 ，还有水晶虾仁','0','2011-10-21 15:17:00',NULL),
