	('01c88f47aa13e408c7f2703d499c1ea9','84ffecba3b118b5f89708cb85633dfc2','wutonghua','5',5,5,4,'紫色的房子充满浪漫情调。很适合情侣约会。店面有点小，但氛围很好，装修很有感觉。三杯鸡味道不错。有个榴莲什么的菜不太推荐。','50','2011-06-17 20:29:00',NULL),
	('06398c1a1020ad88eca8c04d336b180c','84ffecba3b118b5f89708cb85633dfc2','s20029701','4',4,3,3,'去过很多次，很温馨的一家小店。不过一般晚餐要提前预约的。东西做的很好吃，比某些大饭店要精致。特别喜欢三杯鸡和蓝莓土豆泥，还有酸辣鲤鱼。尤其是酸辣鲤鱼，鱼很新鲜，也很大，虽然上次酸辣鲤鱼是团购去的，但是分量和口味一点没减，现在想起还想留口水呢。最近蓝莓土豆泥涨钱了，原来12元，现在16了，数量没变。还有一个菜，名字忘了，炸的面包片中间加的牛肉片，很好吃，也很有饱足感。但是里面的味道不是很好，可能太潮湿的原因，楼梯有点抖，座位有点脏脏的，希望店家装修装修整理整理会更好。不错的小店，像大家推荐。','50','2011-08-31 13:17:00',NULL),
	('06fba3430b052add2104fa701997d86b','84ffecba3b118b5f89708cb85633dfc2','大米花88','4',4,5,4,'在台东道口路上的一家很有情调的饭店，台东很难得有环境这么好的餐厅。单独的一栋小楼，看上去很美，味道也不错，手撕大头菜是特色菜，很多人都点。每个单间都有自己的名字什么2046，花样年华，感觉很不错~价格也不高适合情侣约会~','50','2011-03-30 13:26:00',NULL),
	('0976f9c2b189a32f41a15d7000b51473','84ffecba3b118b5f89708cb85633dfc2','vvme','5',4,4,4,'【试吃/体验点评】【团购点评】生日的时候去过这家店，从网上查到的，比较浪漫的餐厅，不错。还查了一些特色的菜，（当然也都点了，尝试过了）所以就奔过去了。白天没去过，晚上房间里感觉不错，我们点了好几个菜，（手撕大头菜，挺够味的）（蓝莓土豆泥，我的大爱，去过好几家餐厅，都点过，特别是蓝莓酱）（茶树菇，俺家小宝同志爱吃，所以就点喽，也不错，还有几个忘记了，还有个鱼，叫什么法国红鱼了还是美国红鱼了，做的一般吧，感觉有点老，不嫩，不知道怎么烧的，，，饮品的话，还行，因为不喜欢喝凉品，喜欢常温的，当天我这个大寿星还被餐厅获赠一份长寿面，咯咯，，吃人家嘴短，嘎嘎，，必须说好！！！当然建议大家去尝尝，环境真的不错哦。就是唯一美中不足的是，单间也太小了，每次去都要预约，还预约不上，','80','2011-06-24 10:27:00',NULL),
	('09f964bcc6516960234e83fb8d2bf4e8','84ffecba3b118b5f89708cb85633dfc2','jllmlye','4',3,3,3,'经常有他家的活动在搞，感觉他家的菜品还是不错的，用料还算公道，但口味不太适合，去过1次，环境还算不错，三杯鸡还可以，来这可以点一下常常','0','2011-09-07 07:33:00',NULL),
	('0a76b01fdf8f8e4ee3e4f23f21e01688','84ffecba3b118b5f89708cb85633dfc2','SantaWilliam','5',3,4,4,'挺有调调的一个地儿，就是总共也没有多大。价格其实挺实惠的，因为菜码都挺足。像三杯鸡，蓝莓土豆泥，好像去的人都比较爱点。个人挺喜欢菠萝虾球，三杯鸡也挺好，','50','2012-02-07 15:58:00',NULL),
	('0fd53332628b2d7b5eeb172ed92f0c24','84ffecba3b118b5f89708cb85633dfc2','上官雪雪','4',3,4,3,'【试吃/体验点评】甜甜的味道挺好，我是跟朋友一起去的，那里的东西都还不错！有很多甜食，反正我们是四个人吃得挺好！感兴趣的可以去试一下！','50','2011-08-10 09:57:00',NULL),
	('10100bb15db11a78f28edde7534a69a4','84ffecba3b118b5f89708cb85633dfc2','star97','3',2,2,2,'在原来的小城故事，好多年了，环境也没有太大的变化，唯一变化的就是菜金越来越贵，而且服务也不是特别的好，人均消费太高，不能刷卡。。。给发票也不痛快。。。','100','2011-06-23 23:11:00',NULL),
	('10a8dcb3db02332753d48bfc9b002a7c','84ffecba3b118b5f89708cb85633dfc2','忍者神龙','4',3,3,3,'【点评团消费】一直在网上团券，看到云中漫步名字起得不错，和夫人一起去的，菜的口味不错，因为是团的，感到确实是物有所值。餐厅不大，适合情侣约会，但设施有点陈旧。人气挺旺，我们定的房间不大，摆了4桌，气氛有点暧昧。只是停车位不足，一个大爷在门口收停车费。','0','2011-06-14 16:02:00',NULL),
	('10fb02860b365320148e87ee27134124','84ffecba3b118b5f89708cb85633dfc2','曲小兔','4',3,3,3,'我觉得我像个托 这几次都给大家当白鼠了 巧合 小兔都是自掏腰包的 别墅改造的餐厅，没去二楼，一楼是卡座，昏暗的灯光 小资 很有情调 ，很早就想来的店，就是下大雨没阻碍小兔吃货，点菜没控制住 点多了，蓝莓土豆泥 还不错，蓝莓酱有点甜，手撕大头菜 虾仁很少味道还好， 霸王蹄花 是得奖的哦，很好吃 配菜是西兰花和金针菇 猪蹄美容养颜的哦，蒜蓉西兰花 觉得点这个真多余 不怎样 不推荐 服务员推荐了新菜 什么双丝 粉丝和蕨菜丝 热菜 挺好吃都消灭了 ，鹅肝炒饭 本来不起眼 吃起来发现还不错，还有榴莲酥 这个就真的很一般了 总体感觉不错 价位不便宜 也不太贵，适合约会 聊天','80','2011-09-20 08:37:00',NULL),
	('1205bb75c12d8aabc3468de906e7efbb','84ffecba3b118b5f89708cb85633dfc2','事事的草莓','3',2,3,2,'慕名而去，只是听说里面有梁朝伟，哈哈，环境还好吧，但不如想象中的那样，菜的味道非常一般，就连盛传的手撕大头菜我也没吃出啥特别来，期待值与实际不太相符的一次经历~','65','2011-07-01 14:50:00',NULL),
	('16c405ca673c95ca67cfae60c683a8eb','84ffecba3b118b5f89708cb85633dfc2','KathyXinxin','4',4,4,3,'云中漫步里面的环境很好，适合情侣，二楼氛围特别好，灯光，室内设计都有欧洲风格。去吃饭的时候是第一次去，都是服务员给推荐的，都不错，就是要多了，没吃了，特色菜价格有些小贵，但是环境好，也值了~','45','2011-06-17 12:21:00',NULL),
	('1b07a4747f0d562f1348b296311d11a8','84ffecba3b118b5f89708cb85633dfc2','旋转木妮','4',3,4,2,'跟闺蜜一起去的，在道口路上还比较好找。午餐时间，不过好像是工作日所以人很少，点了网上推荐的手撕大头菜，海肠控的闺蜜点了个茶树菇炒海肠，还点了个什么什么鸡脆骨之类的好像~记不得了~菜的口味还好~比较喜欢那个茶树菇炒海肠。菜量也成，大胃的我们俩这仨菜最后还打了两个包。服务一般吧，上了菜之后就再没见过人来，包括最后打包也是我们自己去拿的袋子，结账也得去柜台……不过闺蜜那个假小资对这的环境很有爱，一直吵着要再去','50','2011-06-19 21:59:00',NULL),
	('00aa48101c83166678cb62e8d89d4bd2','87f01fe23a51397c825388e79b5251ce','小象有翅膀','4',4,3,4,'布朗尼果然很好吃 巧克力的味道很浓 上面还有核桃 很重的一块湿湿的 热量肯定很高大阪蛋糕好软啊，没有普通蛋糕那种很香很腻的味道，蛮清淡的 同样很湿 感觉很健康','20','2011-10-15 13:47:00',NULL),
	('04e0adcaef629d80010ab7f17aef2072','87f01fe23a51397c825388e79b5251ce','kissygb','5',5,3,3,'【团购点评】昨天，是我一周以来最高兴的一天~或者说，昨天那半个小时~我发现了青岛最美好的甜品店~也许我有些夸张~可是，那半个小时，以及随后的时间，让我忘掉了以前的不快，失败、欺骗、痛苦……让我觉得，我有自己的小小的幸福，即使我自己一个人，我依然可以过得很快乐~最爱的cheese，香浓的芝士味，稍有些软，入口很滑嫩，相比比艾蜜儿的有些硬有点涩了~从来美式的我换成了拿铁，小小一杯，不像美式那般苦涩，也许我真的应该换种心情了……今天早上美好的早餐，店主姐姐说是用比利时进口的巧克力做的布朗尼~虽然不如90%的黑巧一般浓郁，可是也足以让我惊喜和难忘~回味很久~也许我真的夸张了~心情，真的不一样了~————————————————HLL的分割线——————————————————早就看到isobella姐姐的DP了~正盘算着找一天去探店呢~恰好看到团购，6.6的咖啡，9.9的cheese~心想这家店的团购应该很有保障~打电话时候姐姐的态度也很好~其实很好找，就在招行的旁边，还是很显眼的~店面不大，右边有三张桌子可以堂食~种类不是很多，cheese有4种~主打曲奇还有蛋糕吧，没有看到面包~轻乳酪很大一块才58，去的时候看到好几个人买~要的拿铁+蓝莓che...ese~拿铁也是现做的，以前总是喝美式，我以后，会改变自己，不要那么苦涩了~美式10元，其他咖啡都是15元~味道不错的，价格也低~cheese真的很好吃~店主姐姐说材料胜在新鲜~里面还有柠檬条提味，可以吃出来，也会比较清爽~cheese入口软软的，味道很足很浓，觉得胜过艾蜜儿很多~下面是布朗尼的底吧~ 比在厦门吃的班沙客还好吃~以后放弃艾蜜儿了~店主姐姐在旁边看电脑，我还打开了我的点评主页让她看，嘿嘿~然后姐姐给我试吃了轻乳酪~虽然我喜欢重乳酪，可是轻乳酪很湿润，味道淡淡的香，吃起来负担比较小~看到布朗尼还有大阪蛋糕不错，问姐姐那个比较特色~姐姐说如果我喜欢巧克力的话会很喜欢布朗尼~然后给我试吃了它家的比利时进口巧克力~虽然不如很90%的那种醇，可是还是蛮回味的~布朗尼一块15，性价比很好~里面的核桃也不少~很新鲜，很湿润，很巧克力，嘿嘿~第二天吃的，心想如果加热下会怎么样，不过觉得还是冷着吃好~配着咖啡当做早餐，不会腻到~我对于曲奇倒没有很大的兴趣，但是一定要去店里吃吃别的，比如大阪蛋糕~美好的生活，我自己的幸福~对了，昨天吃的时候店里有苍蝇，这点不太好~店主姐姐态度很好，可是收银的哥哥有点冷冷的哦~还有莎莱雅，我给姐姐提起来，她说就是她同学开的。。。然后晚上我去香港花园，本想继续拔草，结果，莎莱雅，关门休整。。。不过我会再去的~~全文','0','2011-06-04 09:46:00',NULL),
	('07563170c83584790db6efcf33f93645','87f01fe23a51397c825388e79b5251ce','卤那肠肠','3',2,3,3,'可能我对甜点比较挑剔吧。吃过太多的芝士蛋糕，所以觉得叔叔家的芝士没有太突出。和爱弥儿同学家芝士口感差不多。位置比较适合附近白领。早点或者下午茶犒劳一下自己都是个不错的注意。环境不错。是我喜欢的风格，但是感觉只要稍微人一多就会略显拥挤了。干干净净的。','20','2011-08-16 15:38:00',NULL),
	('0908136d4feb30c01b023c4e868cf6c6','87f01fe23a51397c825388e79b5251ce','郁金香_品味','4',5,3,3,'朋友一直推荐的蛋糕店，路过家乐福无数次，因为是路盲的缘故，总是找不到，趁着元旦休息就抓着朋友带路，各位DPER对于西村的评价也是非常高，芝士蛋糕也确实比市场价格高一些，选择了一款里面加奥利奥的芝士蛋糕，打包带到咖啡店去，蛋糕的味道非常细腻加上奥利奥的酥脆，口感让人感觉满足，但对于蛋糕的卖相来讲还是有待提高的，下次准备过来尝尝布朗尼。','25','2012-01-13 09:26:00',NULL),
	('0a70b091858dabc3acceb0358f4a8e4a','87f01fe23a51397c825388e79b5251ce','isobella','4',4,5,4,'原来这叫西村叔叔的店，学习了。店门头是＂西村...店＂，日文不认得。在阳光百货旁边的招行旁边的凹陷处。汗～这个描述。日本人总爱把店开得这么隐蔽。我只买了一合曲奇饼，我觉得没有莎莱雅的好吃，但我妈很赞赏。曲奇和奶油蛋糕是我验甜品店常爱选则的两样。店家的特色是宣称不使用人工香料色素防腐剂，理念我很喜欢，也很欣赏原味的东西，所以下次不匆忙的话一定会尝试多几种的蛋糕，店内环境也很整洁清新，有日式小店的风格。','30','2011-05-18 21:40:00',NULL),
	('0aa43f843599884f4a6b7a3c2daa7681','87f01fe23a51397c825388e79b5251ce','孙阿沃','5',4,4,4,'奶油卷真的很好吃，奶油与普通奶油不同，非常新鲜，香气宜人，觉得是她家的特色，布朗尼蛋糕也推荐，15块钱就能吃到这种大小和口味的布朗尼我内牛满面TT 不过够硬的布朗尼相比硬的就弱掉了 她家软硬度掌握的不是很稳定。这是不是跟神马时候卖出去的有关？哈哈','40','2011-11-06 20:24:00',NULL),
	('106da18f09e10b1d9074204514554777','87f01fe23a51397c825388e79b5251ce','李小跳_______','5',5,5,5,'推荐布朗尼。口感着实惊艳，黑巧克力的香浓厚重配上核桃恰如其分的松脆，不同于其他家布朗尼水分的粘腻，西村家的布朗尼咬下去十分松软，入口却是绵密的香甜化开，完全满足幸福。佐咖啡或红茶都十分完美。','25','2012-01-18 16:17:00',NULL),
	('1901ed078c64edf049a87e46813cf224','87f01fe23a51397c825388e79b5251ce','summer42','4',4,5,3,'在香港的时候就爱吃甜品，放假回来却总是找不到满意的甜品店，总是感觉缺点什么。这家西村叔叔的店是日本人开的，总算是比较满意。一进门就是浓浓的香味，非常吸引人，店面非常干净，让人有食欲。和同学一起在那里坐了整整一个lunch break，特别喜欢。芝士蛋糕很香，但又有淡淡的果香，很清新，这是我从来没有吃到过的味道。但是稍微有点硬了，不知道是不是摆得太久，有些影响口感，不够爽滑。日式轻芝士蛋糕很不错，很松软，且没有那么甜，是我喜欢的甜度。同学喝的美式咖啡，不知道味道咋样。我要的柠檬红茶很失望，就给我半片柠檬。。。你是有多抠。。。红茶味道也不浓郁。但是总的来说，甜品还是不错的，会再去。','30','2011-07-13 19:28:00',NULL),
	('033b9a457a9cabce14df03aeb12d37eb','883c44274e691b4e12751e6106840643','Carolec','1',2,2,1,'这间餐厅去过好几次了, 每次的感觉都几好,但系上星期六同老公又去左一次, 感觉都同之前的完全吾同, 将我对呢间餐厅嘎好印象分扣到近乎系零分了.话说上个星期早早就同老公商量好星期六去橄榄园吃翻餐好味嘎西餐, 而且喜欢距嘎小院子嘎宁静, 所以早早地系上星期四就订好小院子的座位, 要求系晚上7点前到店. 星期六我地同老公系晚上6:55就到达餐厅了, 但系距地竟然话搞错,我地订好嘎位置给人坐了, 所以安排我地系小院子嘎另外一张加位度坐, 好明显系因为多人而隔硬系两张台之间放多张台,手伸长都可以拿到隔离台嘎野吃了, 更唔好话讲话拉, 大声D都给人听到拉..真系无瘾, 又系一种西餐大排挡嘎FEEL, 后来, 我同老公决定放弃小院子了, 坐入去室内咯, 经过距地安排, 我地坐左系一个卡座, 原以为都OK拉, 点知到开始上菜嘎时候又发现有新问题了, 用餐刀切食物嘎时候,个台不停系度摇动, 叫服务员来看, 距先话张脚烂左了, 要听日先有师傅来修理, 叫我地将就下, 真系好扫兴啊.. 不过当时已经上左野吃了, 而且餐厅几乎已经坐满, 剩低嘎都系一D通道位同近厕所嘎位置, 对于我呢个孕妇来讲真系吾想换了, 所以算拉, 我地就摇摇晃晃甘开始我地餐饭. 主菜都OK拉, 但系果个普罗旺斯局菜就真系好难...吃啊.. 不过呢D吾怪得人地, 话吾定人地本土嘎味道就系甘..只可以话自己唔识欣赏, 最多下次吾点咪系咯(当时我仲心存希望, 希望下次再次帮衬可以吃到其它喜欢嘎食物), 当晚上菜都上得好慢, 几乎上每到菜间隔的时间都要20-25分钟左右, 好彩我同老公都系SHARE来吃, 如果唔系就得我吃无距吃了, 好吾容易等到吃晒D菜,平时距地都会有服务员来问我地系咪需要上我地之前点嘎甜品了,但系等左成30分钟了, 我地已经有D唔系好耐烦了, 我终于忍吾住问服务员了, 距地先至恍然大悟甘上左我地嘎甜品~苹果崩溃, 唉~呢个真系令我崩溃了, 呢个甜品已经系凉晒, 好明显距地整做有半个钟以上,已经全部冻晒了, 吃到我真系条气顶住顶住啊..跟住本来凭点评网嘎短信可以送精漏咖啡的, 平时我来的时候都要求服务员咖啡转柠檬水,因为大肚婆唔好饮咖啡,对个BB唔好,平时距地都好识做甘可以帮我换, 但系呢次距地好决绝甘拒绝左我, 不过算啦,送嘎野你吾可以要求人甘多,只不过我觉得小小嘎一杯柠檬水可以留住一个客人的心,我作为老板的话绝对唔会吝惜嘎. 所以 吃完个甜品我已经急不及待要埋单了,点知我地不停甘同服务员,老板娘讲我地要埋单,讲左不下5次, 足足等左成15分钟都无人来埋单, 气得我呢个大肚婆顶住个7个月嘎肚去到前台直接要求距地同我埋单.总之呢餐饭吃到我背脊骨落, 仲谂住吃餐开心嘎西餐,点知搞成甘, 我临走嘎时候,仲同老公讲, 如果出门口见到老板娘,距问我吃得点(因为每次吃完,距地都好有礼貌甘问问我地嘎意见) ,我一定会同距讲出我嘎不满, 点知系门口见到老板娘, 距见到我地望左一眼,招呼都无打就入左餐厅了,使我对呢间餐厅彻底失望了,我已经将呢间餐厅列为永不录用的餐厅了. 本人认为一间餐厅如果不能将服务以及食物水准保持一致的话, 它是留不住客人的全文','105','2011-04-30 11:14:00',NULL),
	('070925c335163d5c00373ec82e191ec4','883c44274e691b4e12751e6106840643','嘎嘎荟','4',3,4,3,'环境很好很舒适， 有种家庭的感觉。前菜味道可以，pizza一般，还是必胜客做得好很多（ 个人觉得）。性价比不高。很多的西餐厅都能达到的水准。','150','2011-06-23 11:14:00',NULL),
	('04de5cc324da0c4c90417e8fcc33574a','883c44274e691b4e12751e6106840643','coffex','3',3,4,4,'这一代这种小店特别多，很适合喝东西。凉风习习的晚上，点杯咖啡和闺蜜聊天，看叼着烟斗的老板赶猫追狗。（话说这里10点半就关门了……）','0','2011-04-16 23:15:00',NULL),
	('06b6d28b66fadbbeb2665591dd8183b2','883c44274e691b4e12751e6106840643','阳江花果山','5',5,3,4,'和老婆来广州办事，一直都想来这家店，但每次都因为这样那样原因使得我对其真是望穿秋水终于这次没有被其他闲事缠身，可是在找这家店的时候却费了一点周折，按理说是很好找的，但是因为搞错了方向，站在体育西路的另一边愣是找了十几分钟都没看到，不过最后都是如愿了，很少看见广州的食店能像这里装修，在一楼餐厅门前居然能腾出一块小地圈起来做露天餐厅的，当晚也是在露天吃的饭，真的是做到闹中带静，大隐隐于市呀。说说出品的各种食品吧确实这里的服务很腻人，让人很舒服，让人很舒心，详细的推荐和介绍后让客人自行决定，而且推荐的东西事后证明都非常不错，而且老板娘（我也不敢确认是否就是）更是体贴关心，如果服务员也能做到和法国留学生一样亲切的笑容，那就满分了。当晚听了推荐吃了以下几个菜品：法式牛扒158元，按分量来说只是一般的小贵，还能接受，最重要的是这是我吃过口感最丰富的牛扒之一，因为他的腌制的汁水很美味，煎煮的时间拿捏刚刚好，隆重推荐的一道菜。第二道是法式烤青口，同样是上面的配料和奶酪都非常好吃，只是老婆说稍微有一点的不新鲜，不过总体而言已是非常美味。第三道是大家都推荐的无花果薄冰，是很好吃，但没有感觉到特别的惊喜，...算是值得品尝吧最后就是一道青菜，有点老，上面的芝士很好吃。总之算是一家我在广州非常认可的一家店，以后也会过来尝尝其他的菜品。打折是打了，不过最后没上咖啡，因为都很饱了所以也没问，建议以后还是自己把承诺的东西做到位更好。全文','150','2011-03-14 18:41:00',NULL),
	('096f5d933894cd0bc8da51ddb574e39d','883c44274e691b4e12751e6106840643','mishelliang','5',4,5,5,'座落于烦嚣的天河城商圈，却独辟一角，幽静而有情调。有两桌是外国人，应该是法国人，老板娘在跟他们以不是英文的语言在沟通。有外国人光顾，应该也是比较正宗的法国菜。点菜时老板娘提醒够吃了，真是很为顾客着相，我们吃得光光的，很饱。最喜欢它的无花果Pizza,还有吐司，超级好吃的吐司！苹果崩溃也不错，就是有点偏甜。一个中午才四桌人吃饭，我真担心这样的客流它能坚持多久。其实这样用心的餐厅我们应该多多支持，等它关门营业了，就再也很难找到这样又便宜又好吃环境又好的餐厅了。继续捧场！','80','2010-11-29 17:13:00',NULL),
	('0a3986d39936515643dbead558dd685e','883c44274e691b4e12751e6106840643','rr2good4u','4',3,3,3,'与朋友聚餐，来到这里，只顾着说话，差不多忘记吃了什么了。南瓜汤不错，PIZZA忘记是那一款了，出品很好。焗生蚝推荐，红酒烩烟熏鸭胸肉 推荐。环境很好，安静，服务好。','0','2011-04-21 23:05:00',NULL),
	('0aa191aa8bfd355f843ed7d44022231b','883c44274e691b4e12751e6106840643','大口九O','4',3,3,3,'装修是田园风格的，格子的地砖，白色的窗纱，明亮的杯子和新鲜的玫瑰。环境不错，给人很舒服的感觉。食物方面，沙律不贵，也很清淡，南瓜汤口感细腻，配上面包丁很喜欢；无花果加吞拿鱼双拼披萨，饼很薄，嚼起来很香，芝士挺多。煎鹅肝分量好小，感觉一般白汁海鲜意粉很有韧性，有点像拉面，虾仁很脆，白汁不会很腻。总的来说，出品用心，只是有点贵了。','90','2010-11-18 13:42:00',NULL),
	('0f4dbe1d4fd1453781d7a867e5e13615','883c44274e691b4e12751e6106840643','多喝咖啡少喝茶','3',3,2,2,'和朋友约了在天河一带吃饭，在点评网上搜索天河城和正佳的美食，结果分数都太低，比如正佳，最好吃的不过是涮涮锅而已，所以改搜索体育西，找到这家分数较高的法国菜。没想到在体育西的民居里，我10年前就在那里住，在民居里吃法国菜，感觉不是很和谐。味道中规中矩，没有什么惊喜。服务生不太负责人，2个女人，又是晚餐，推荐多了，吃不完。价格不便宜。以上的意见并不表示不喜欢，总体感觉还可以。这年头该吃的想吃的都吃过了，所以自然比较挑剔。以后还会去的，因为那一带也确实没有其他更喜欢的了。补充一句，很多人推荐的红酒烩鸭胸，其实并不好吃，因为是冷冻鸭胸做的，处理的不太好，味道不够新鲜，有点腥。','150','2011-05-10 09:34:00',NULL),
	('10cce9849172faebd53f4714af3a5753','883c44274e691b4e12751e6106840643','卷毛兔子1299','3',2,4,4,'其实也不能一并的说这家店不好，只是它吸引人的地方跟我想象的不大一样而已。从环境到服务无一不透露着法国餐特有的悠闲和情调，然而如果将其硬件与软件相比，前者将会一败涂地。餐厅本身其实最应当细心调制的是食物本身，这次来因为只是两个人，并不能吃太多的种类，只是点了招牌的无花果PIZZA、红酒鸭胸肉、还有洋葱汤和南瓜汤以及开胃小吃。在这几样食物中，只有PIZZA能够与这家小店的预设水平相提并论，食材的充足，PIZZA地步面粉的酥脆的确是让人印象深刻。洋葱汤和南瓜汤口感清淡，还有不同形状的餐包漂浮在浓浓的汤汁之上，也算是比较成功的点缀。可是鸭胸肉口感枯燥，肉的弹性与香味全无，感觉这样98元的一盘食物实际上身价跟自助餐的差不多，让人感到毫无诚意。不过，或许这个地方最初的目的只是希望给别人一个印象，有这样的一个高消费的地点，地处于市中心闹中取静的花园中，有着所有国人向往的欧式餐厅的风格，还有外国面孔的美丽服务员，操着一口带着欧美口音的流利中文为您服务。因为其实在这个地方，价格和服务有时候甚至会超越食物本身来决定一家店是否好吃。虽然我一直知道，好吃的食物一定是价值不菲的，但是价值不菲的却不一定都是美食。','156','2012-01-20 00:33:00',NULL),
	('13f82dc445bd237d4f40fa5cf2bc17b9','883c44274e691b4e12751e6106840643','爽b','5',4,5,5,'【试吃/体验点评】有点不好找~係係人家小区内的环境不错，很适合节日去。那个烟熏鸭胸肉、浪漫巴黎都很不错~烧鸡就麻麻地了...总体黎讲都可以的','120','2011-03-01 18:08:00',NULL),
	('143e641f436f3cd29d9097498ab0926e','883c44274e691b4e12751e6106840643','Xindy41','5',5,4,2,'去了好多次了，第一次是中午去的感觉很好，服务超好的。 有一个沙拉是我最爱。法国蜗牛做得很地道。 第二次，第三次，第四次 去都是晚上。找不到停车位，郁闷。 最后一次去 我们没有点前菜，点了3个主菜，甜品和酒。等了足足45分钟，超生气的。下单时还等了10几分钟没有人来。但里面的东西的确很好吃，每次有送优惠卷都只有1个月，次次都白白浪费，强烈建意商家把优惠卷的时间延长到45天。有2个饮品很特别，但我都没记住名字。气氛很好，以后还会经常光顾。','145','2011-02-25 21:02:00',NULL),
	('16405a05df03db4ec28e1ecae392165c','883c44274e691b4e12751e6106840643','isaac1987','4',3,3,3,'【试吃/体验点评】偶而发现，一间非常有个性的餐厅（过年竟然因东主回法国度假5开）终于尝试到，点了意粉、鸭胸、沙拉和火焰饼味道很好，特别欣赏意粉，自家制的果然和外面买到的不一样，好吃N多。其他的味道也不错，很有个性。甜品火焰饼果然是有火的。很浓烈的酒香外加雪糕的搭配。环境也很好，适合两个人去轻松一下。大众点评卡还有餐酒和咖啡送。价格稍贵，但值得。下次去尝试无花果PIZZA','100','2011-04-02 13:25:00',NULL),
	('19b37aa4712096d0ea69f788a8695525','883c44274e691b4e12751e6106840643','妲尔维斯蒂','4',4,4,4,'又是因为lolita聚会去的。圣诞节那天到达的。店员里面有美女外国姐姐啊~口水~打开餐单，感觉那里的价格是有点偏贵的，一个汤也差不多50元了因为是圣诞节，所以一定要我们点一个圣诞套餐，价格很贵，贵到我现在忘记了……里面有餐前酒，龙虾汤等等，其实挺丰富的，但是因为圣诞就一定要点，感觉有点不舒服……自己点了一个pizza。很特别很特别很特别的pizza，在外面是吃不到这种pizza的不同其他地方的厚底或者薄底pizza，这里的pizza的皮很薄很薄，像一块布似地，边则是很脆很脆，像吃饼干一样。不过料子很足，也很香，就是切起来有点麻烦~两个人吃的话，刚刚好够饱~老板娘很好人的，一直在问我们好不好吃，还跟我们讲解一下菜的用料~吃完后大家都在店里拍照，感觉有点阻碍人家的生意了，对老板娘说声对不起呢~','100','2011-01-28 10:58:00',NULL),
	('1ae1688ddf01811ad23c2a87afcbc8c9','883c44274e691b4e12751e6106840643','anonlqf','4',3,3,4,'吃了340，用优惠省了30.鸭胸，鹅肝苹果崩溃一般位置就在天河城南边，门口路上停的车，免费。地方不大，布置不错，服务不错','160','2011-01-24 21:42:00',NULL),
	('0825b9ae658e83994fb65e7860426669','8917e73069ad7bb0a4f0a93c2894d4cf','VIKGW','5',4,4,3,'这里川菜很地道，水煮鱼也不错，各种小吃很多，包间很明亮，经常搞活动返券之类的，来过好多次了，口味保持的不错，川菜在太原也越来越受欢迎了。','80','2010-11-25 12:56:00',NULL),
	('098e947b40decbc57f1841edc6fefc7e','8917e73069ad7bb0a4f0a93c2894d4cf','chenghyun','4',4,3,4,'在装修，据说要华丽转身为沸腾四季，6点钟到还没营业，汗一个啊，大概太原的饭店都比较晚营业吧。被带上4楼，一个狭长的走廊分布着一个个的包间，我们4个人，去的包间还有2张桌子，小小的落地窗可以看到停车的地方，服务还不错，就是不规范。拿到菜谱才发现太原的川菜卖的真心贵。【水煮清江鱼】居然是按分量来做的，一斤68块，配菜免费的只有大白菜，真的是第一次听说，其余的配菜任选三种16块/份，其实就一点点，一份水煮鱼下来156块，真的是吃过最贵的一次水煮鱼了；【荷叶牛柳】牛柳很嫩，分量很实在，全是牛肉，吃到后面很腻；【毛血旺】味道不错，够麻够辣够油腻，材料丰富；【蔬菜汁饺子】饺子皮是绿色的，第一次见到，吃很来很健康的感觉，28块/盘，贵呀！【酸梅汤】杯底一层厚厚的粉状物，不知道是不是冲泡出来的，味道够浓。吃饭的时候服务员会拿一片土司面包铺到餐盘上，用来吸油，其实川菜真的本来追求的就是大油，这个做法有点过了。','90','2011-06-13 13:15:00',NULL),
	('0aa5210b819148935cea14330220ef3d','8917e73069ad7bb0a4f0a93c2894d4cf','lovelyrouyan','0',2,3,2,'实话是有点失望啊 也许是爱吃辣的过 每次点要超多辣椒可是估计是不到位 那鱼就根本不辣 后来有一次带走 第二天热了下 经过一天入味才发现味道不错 看来厨师太着急 那个味道在店里实在是一般 带回家反而不错','80','2009-07-11 00:08:00',NULL),
	('0b9a98e035a8c601200eac20641f7bc1','8917e73069ad7bb0a4f0a93c2894d4cf','farf646','4',4,3,3,'很喜欢吃辣的我是从大众点评上看到这家川菜馆的，就约几个朋友一起去尝尝。去的那次人不是很多，点了几个四川菜味道跟一前几家比不是很突出，就是他们的水煮鱼还不错，沸腾着，热气呼呼的向外冒，口味很好，朋友几个也都很喜欢吃这家的水煮鱼，老板也很热情的！','0','2010-08-19 12:00:00',NULL),
	('145244f671d35f572914f8501ae8120b','8917e73069ad7bb0a4f0a93c2894d4cf','新麻辣诱惑','0',3,3,2,'带家人去尝水煮鱼，菜品还是停留在一代水煮鱼口味上，现在都有3代了，或许还是麻辣口味比较受欢迎吧，停车方便，开了不到3年吧，感觉就餐环境不错，菜品还可以，服务员水平一般','0','2009-03-20 08:40:00',NULL),
	('19e0f68d1b1cfaef0f25ca4a1a630b27','8917e73069ad7bb0a4f0a93c2894d4cf','紫艳半开105','4',3,3,3,'同学聚会来的，还是两年前了，后来没怎么去过，最近一直想再去吃，可又一直没有行动，记忆中饭菜还行，也是一样，想不起吃了什么，除了水煮鱼','70','2011-06-09 16:16:00',NULL),
	('1ba3eed8227444847c58befdb056e1c7','8917e73069ad7bb0a4f0a93c2894d4cf','猫小醉','3',2,3,3,'貌似没有北京的店做得好吃，不过每次饭点路过闻得都很香，特别有食欲~他家的糯米球很香。遇到的服务员都还不错，态度挺好。','0','2010-10-26 19:35:00',NULL),
	('1c1fb9594300838e095ab4341a9fe246','8917e73069ad7bb0a4f0a93c2894d4cf','thicker','0',2,3,2,'味道很一般啦，比北京的差远了！也是不便宜的，性价比比较低。环境到是不错。那个什么银耳雪梨汤很不错，每次去必点。','60','2008-01-01 10:31:00',NULL);
INSERT INTO `shopcomment` (`CommentID`, `ShopID`, `Author`, `CommentMagnitude`, `CommentTaste`, `CommentEnvironment`, `CommentService`, `Review`, `AvgPrice`, `CommentDate`, `UpdateDate`)
VALUES
	('0117e1468915f1062bef2ef918b9c7f1','8c72c2c2d4680285736e7f58518f5504','大愚_若智','4',4,3,3,'10.11.10尽管早有耳闻说鲍鱼先生是高档火锅，到底多高档，一翻菜单就能明白了。各式各样的海鲜都有，只要你想的到这里基本都有，生意还挺好，地上地下停车场全停满。我们仨没预定，没小桌了，给安排了个大圆桌，有些夸张的。锅子是全铜的，上面有自己的品牌LOGO。一人一个小火锅的形式。调料，有海鲜汁，wasabi，辣酱，葱花，香菜，辣椒末，虾米，蒜头，炒过的蒜末。海鲜汁是收费的，5元。最喜欢海鲜汁里放点香菜和虾米，简单又好吃。辣椒末挺辣的。自助凉菜三种，豆干丝。四季豆。萝卜干。免费的。很清爽很清淡的口味。黑米汁一扎，88元。热的，很好喝。红酒杯大概6杯左右的量。清汤锅，8元。名副其实的清汤，没味道的，里面就几片姜，一个圣女果。主要吃海鲜，所以还是希望原汁原味点，不希望破坏海鲜本身的味道。活海参薄切，小份，168元。生吃或者烫煮都可以。脆脆的，口感类似海蜇。这里的芥末酱很冲，生吃受不了。还是放锅里烫个三秒钟蘸海鲜汁好吃。原壳鲍鱼，18元/个。很新鲜的鲍鱼哦，还能看着它在动呢。煮多长时间服务员都会算好的，还会帮每人去壳，切块分好。真的很好吃哦，比在其他店的都要新鲜大只，肉肉很厚实。里面的那个绿色的好像是胆吧，...太大了吃在嘴巴里有些肉麻。斑节虾姿造，198一斤，三两59元。大概每人5-6只。很新鲜的在容器里游泳。虽说看着虾在锅里挣扎着慢慢弯腰挺残忍的，但真的比上次在一尊吃的冰冻虾好呢。洁一直大赞的肥牛来了，点的大份，208元。她一直说的小份不够她一人呢。肉肉口感是很好，有嚼劲又不老。不是冻了很长时间的那种，基本每桌都会点。说是听着音乐按摩长大的牛牛，估计也是个噱头吧，炒作，但还是值得一试。左口鱼姿造，68元一斤，1.7斤，116元。很大一盘，造型做的很漂亮。不带皮的鱼肉是直接蘸芥末吃的，上面浅黄色的是鱼籽，有些腥。带皮的切的稍厚点，煮的吃。鱼头鱼尾和鱼骨架，这个可以烧泡饭。就是米饭太硬了没煮透，汤倒是蛮鲜的。蔬菜蔬菜，三个蔬菜，撑着了，都没怎么动。点心是洁一直要点的花卷。8元。奶油味的。个造型有些囧。。。肚子放不下还是尝了一小块，挺奶香的，淡淡的甜。觉得面粉的质量很好。吃饱喝足，仨女人都撑着了。人均260元的价格只能偶尔小奢侈一把。但不得不说，这里的海鲜确实新鲜干净，可能生意好的缘故吧走量比较快。看的出来很多都是回头客，非周末的中午竟然全部满座，很让我惊讶。包厢和卡座居多，散台较少，估计是适合商务宴请性质的多点吧。全文','260','2010-11-15 16:26:00',NULL),
	('0e59bdedb8d8b25c0bbdc32898a51ddc','8c72c2c2d4680285736e7f58518f5504','showing_100','4',4,4,4,'朋友请客的，环境不错，食物也很新鲜，料理都是透明化的,味道还是很不错的。8个人吃了4K,就是价格有那么小贵。不过吃得很饱。','500','2012-01-02 18:24:00',NULL),
	('0ea2841ce4e6aaddefaecbacfcf353d8','8c72c2c2d4680285736e7f58518f5504','仔仔猫','5',5,5,5,'一分价钱一分货，超级值的，我是很少说吃了贵的说值！一般是贵而不值哈哈哈，这里服务绝对没话说，东西新鲜可见，一般都移到你附近再处理，生鲜放心吃。够自信吧。吃了贵还想来哈哈牛吧','0','2011-12-10 17:04:00',NULL),
	('0f0d45aba031d9d254d50cd864cbfe00','8c72c2c2d4680285736e7f58518f5504','爱喝可乐的兔','4',4,4,4,'开张不久的一家店，几乎全部都是海鲜，价格当然不菲，但是服务环境各方面都很不错，鱼生拼盘都做的非常有特色，每人有一个小火锅，会介绍给你哪些适合烫着吃哪些适合生吃，当然不适应生吃的都能涮下，特别赞的还有一个雪花肥牛，牛肉真的不错。昨天晚上又路过发现门口停满车子了，生意真好啊。不过价格太贵，不适合家庭小酌。','200','2009-12-31 15:53:00',NULL),
	('10ac9f20c804a18cb0aceb1b6d902197','8c72c2c2d4680285736e7f58518f5504','JackieYW','5',5,4,4,'结婚纪念日，LG大出血，请客吃鲍鱼先生。酱料，5元一位。海鲜汁用的是海天的酱油，加上虾米、辣椒、香菜等调料以后，鲜得不得了啊！20元一杯的号称的“武夷大红袍”，喝喝还凑活，可是和家里的大红袍差远了。锅底有很多种，要了最普通的“巴马水海味清汤”，果然是清汤啊！不过，9元一位的价钱还不是太杀就是了！毫不客气的点了中鲍，虽然要68元一个，价钱比小鲍贵很多，可是质量很有保证啊！大约有8cm长，最宽处有6cm，很大个啊！而且，放到汤里烫的时候，还能看到鲍鱼在痛苦的扭曲，鲜活啊！超级无敌好吃的河牛，每桌必点。为了省钱，点了128元的小份。事后，LG万分后悔的表示，这个钱就不应该省。左口鱼姿造，68元1斤，一条1斤6两，一共109元。这个菜点的有点失败，不是说不好吃，只是没有其他的那么好吃。生蚝，28一个，再次毫不客气的点了4个，这绝对是我在无锡吃过的最好吃的生蚝，也是这里的生蚝才让我知道原来好的生蚝真的是鲜甜的。吃过这里的生蚝，其他的都是浮云。带子姿造，这个不贵，10元一个，味道普通。最后还点了一个蔬菜组合和一份小份的五谷杂粮七彩面，清清嘴，很不错。总体来说，是吃得很满意的一顿，就是有点贵，不能太常光顾，不然...会破产的。全文','350','2011-03-10 11:53:00',NULL),
	('13befb9af29fb1d9751ef156aed1109c','8c72c2c2d4680285736e7f58518f5504','久世薰','4',4,4,5,'有些东西还是可能吃不惯 朋友请客的 不然还真舍不得自己来吃 蘸酱的味道不是特别的浓厚 有些淡 大虾的肉很鲜嫩 喜欢 有机会还想再去','500','2011-08-02 00:53:00',NULL),
	('163ea9239a362a5f5f0e5716f1d3b11b','8c72c2c2d4680285736e7f58518f5504','丢下我流浪','5',3,4,4,'难得去了次、还是别人请客的、价格什么的不清楚、就是环境一般般、不过服务倒是满到位、很馋他们家的牛肉的、还点了两次的、下次还想自己去次的呢','0','2011-10-19 19:29:00',NULL),
	('00161ff206ddea3716a80e12f1c265b2','8d4c289c495cb2d4d6698e093431a529','summer_19','4',3,3,4,'在上班附近开了家 人还是一如既往的多 外婆红烧肉 有机花菜都是必点的 泡椒肥牛味道还可以 但是量不多 有个鸡毛菜蘑菇的 很清爽 同事不吃鸡 就点了个茶香鸭 端上来感觉好大一盆啊 其实还好 都是茶叶应该 有点淡 但是慢嫩的 糖醋里脊外面的面粉包的有点厚。。。排骨豆方煲 趁热的时候吃 豆腐很好吃 里面是老豆腐 总之是家性价比不错的店~','40','2012-01-29 19:01:00',NULL),
	('0493fceb4baf4876c82cda9379a764ef','8d4c289c495cb2d4d6698e093431a529','冷血奏','5',4,4,5,'今天元宵节，和妈妈去的，虽然下雨但是人还是超多的，终于等到位进去了，点了茶香鸡、铁板烤虾、石锅牛蛙、梳乎厘等等，味道很不错，吃的超开心。值得一提的是为我们服务的小姑娘很可爱，态度很亲切，不错！以后还去！','85','2012-02-06 22:33:00',NULL),
	('051e9112a51c474559198dd0d12db3c1','8d4c289c495cb2d4d6698e093431a529','捷棋','3',3,3,3,'四点四十等到八点三十都还没吃到饭。。一家人等得饿得脚飘。。。外婆都没有喊我们吃饭翻台不是很快。可能刚过年上来人服务员实在少。收台子也比较慢。','50','2012-02-03 20:32:00',NULL),
	('0aeb24bac3e3491faa4505c220b587a4','8d4c289c495cb2d4d6698e093431a529','yummyforever','3',3,2,2,'N久不写 心情好来码字有机花菜 第一次在杭州吃惊艳 第二次吃就如此的普通 没有香味石锅泡饭 有点咸 味道尚可绿茶饼 其实就是半成品 不过有芋泥在 总是容易出彩有头有脸 猪脸肉 满嫩的 就是有腌制过的味道 还有点咸 火焰冰淇淋 我说 那个火焰 也太迷你了吧 基本点不着 连视觉观感都没有其实论味道 完全比不上港丽但是论性价比还是OK的 毕竟港丽一个大菜至少要80','0','2012-02-12 23:36:00',NULL),
	('0b80e983044ef58445f7d86c1ab3e917','8d4c289c495cb2d4d6698e093431a529','zhoulu99','5',4,4,4,'下午4点到的，在门口的排队机上输入手机号和人数后，已经排到C59，5个人被安排大桌，问了接待大概什么时候，被告知至少6点半以后，就去美罗城K歌了！6点半打电话问了叫号情况排到C33,等一行人晃到那里快7点了才动了2号，门口都是等位的人。看了一下整个楼里就他家在排队,可见外婆家的号召力了。没办法都领了号了继续等。到了8点40终于轮到我们了,5个人点了糖藕、色拉、外婆红烧肉、茶香鸡、铁板烤虾、糖年糕、西湖牛肉羹、柚子汁、还送了清远鸡,一共200出头,吃的实惠！','43','2012-01-29 09:44:00',NULL),
	('0f051df3293bb52fb8018d7713c5a3ae','8d4c289c495cb2d4d6698e093431a529','酷酷の小新','3',3,4,4,'这家店真是疯特勒，天天爆满。4点15分拿号已经是170号了，等了4个小时才能吃饭了。真的不知道为什么这么火，味道也没传说中的那么的入味。整体感觉忒一般了，估计就是个价格吸引人才这么火的。','68','2012-02-15 13:32:00',NULL),
	('11e97514fd467c91619ddebcdd98af73','8d4c289c495cb2d4d6698e093431a529','Cyusisi','4',4,4,4,'之前是在杭州吃的 人也超多 上海更不用说 人超多 一定要很早去排号 价格的话感觉没杭州那么便宜 不过味道 装盘 环境什么的是要比杭州好以后还是会去的 毕竟开在徐家汇地段不错','85','2012-02-05 21:19:00',NULL),
	('159ab76c4fb6ee1af97847ca9a4211dd','8d4c289c495cb2d4d6698e093431a529','yuletee','4',3,3,2,'和朋友约了吃饭朋友5点钟到那里拿号排队，一直等到晚上7点钟才进去他家的人绝对是多哦。大家肯定是因为他物美价廉才光顾这么多次的3个人点了7个菜，才吃掉180块，其中还有一扎西瓜汁呢（30多RMB）2个字：实惠','60','2012-02-09 20:57:00',NULL),
	('1935792ff59ed406ecf53fd6a43dc3af','8d4c289c495cb2d4d6698e093431a529','龙猫1101','4',4,4,4,'10点40拿号的，等到大概12:15总算进去了。新开的店环境不错，就是有点闷热。3个人点了一堆菜，最喜欢铁板烤虾，有机花菜，绿茶饼，外婆红烧肉味道也不错就是完全没有切开来，整个一大块没法吃。朋友超喜欢他们家的糖年糕，年糕很糯，喜欢甜食的朋友可以尝试一下。麻婆豆腐性价比很高，才3块钱。还打了优惠券送了一盆白切清远鸡，味道还行。 总的来说味道还是不错的，下次可以再去尝试一下其它菜。','60','2012-01-29 15:24:00',NULL),
	('03ef0ec2f55ad1a2130f67d8e8207dd9','8f185038db5e33dd47bc04a0a50afa9f','yoyo奥利弗','2',3,3,3,'环境不错，服务员也很亲善，面带笑容的，第一次去也不怎么会点，饮品点的胡萝卜汁，虽然是鲜榨的，但是味道和颜色上都不怎么样，主食还可以，厨师沙拉值得一尝，奶油杂拌味道也不错，比较适合情侣约会和朋友小聚~~','60','2010-08-20 19:08:00',NULL),
	('07e396a90470d10381c002782f889ecb','8f185038db5e33dd47bc04a0a50afa9f','ququsongying','4',4,3,3,'这个真的是唯一喜欢的西餐厅，尤其是厨师沙拉，简直是百吃不厌的。曾经狂迷奶油烤杂拌，不过后来真的吃不动了，如果人多，建议尝试。两个人的话就免了，吃不了浪费。意面我朋友很喜欢，个人不吃任何种类的面条，所以不评价。牛排就没办法了，中国的牛肉不能烤成3成或5成，所以怎么吃都不对味儿的。建议吃过正宗法国牛排的同志不要尝试，否则必会后悔。最后要说，个人感觉综合评价比必胜客之类的高，包括质价比什么的。如果只有两个人，点一个烤杂拌，一个厨师沙拉，再加一个蒜茸面包，每人也就30几块，可以吃的很好。当然，如果要点红酒什么的，那就另算了。','40','2011-06-21 16:25:00',NULL),
	('0b0b7a3292710973020f4dac60017a36','8f185038db5e33dd47bc04a0a50afa9f','MISSSIM','4',4,3,5,'分量很足很足，开始还说小食不是很多，开吃才发现点的主食都吃不完，分量真的很实在，味道也是挺好的，环境可以，老板娘美丽又亲切，有需要的话还可以帮忙给布置','115','2011-11-12 18:42:00',NULL),
	('100f9156fc080c12ff3f5fbdf7afa6a7','8f185038db5e33dd47bc04a0a50afa9f','醉影冰凌','4',3,4,2,'我们是三个女生一起去的，很适合情侣约会和朋友小聚，很安静有情调，房间很温馨，沙拉类都很好吃，东西也很便宜，厨师沙拉很棒，奶油烤杂拌还是多点人吃比较好，因为会腻，牛排还不错。','60','2011-03-17 20:58:00',NULL),
	('1608a64f96a7bb15d2fa2377d81d2a2f','8f185038db5e33dd47bc04a0a50afa9f','宾果黄昏','3',2,2,3,'因为苏黎世没有地方了，就向前走来到了这家店，点是半地下的，装修的挺不错的，有点英式田园的意思，呵呵，可能是伦敦郊区吧。家庭式餐厅，老板娘很热情，介绍了几样特色菜，厨师沙拉和奶油蘑菇汤挺好的，牛排说要4分熟，结果端来足有7分，都看不见血了。。推荐的芥末猪排不是很好吃，应该坚持自己的原则吃吉利猪排。。。总体感觉还是不错的。。','65','2010-11-20 00:39:00',NULL),
	('19b14090be22ebae3fe8f46171052912','8f185038db5e33dd47bc04a0a50afa9f','Ms蜜娅','5',5,5,5,'应该是晚上10点关门，我们晚上9点多才到！老板人很好！装修得很有格调，纯木的墙上贴满了便条，桌上还有小花桌布！厨师沙拉味道超级赞！菜量非常大！老板劝我们少点一些，我们还是点了很多东西，最后吃得很撑，还剩下了一些……算是很值得去尝一尝的店！','135','2011-12-09 16:57:00',NULL),
	('178300cd6a5b8138736d7f88f7d4400b','8f185038db5e33dd47bc04a0a50afa9f','蔚风龙跃','4',4,4,3,'地方应该是不算难找，五大道上基本都是这种小地方~进去之后色调很暗，不过感觉不错，很有感觉，适合情侣和朋友聊天，而且得是安静的说话墙上都是小便条，可以随手写写画画~奶油杂拌味道不错，不是那么腻~厨师沙拉觉得一般啊，没有想象中的那么好吃~奶油汤味道还不错，朋友觉得腻，我觉得还可以啊，不是很甜~黑胡椒牛排味道确实不错，根据自己的情况，选好了几成熟，超级好吃的！意面量不小，味道跟必胜客我觉得差不多，呵呵~罐焖牛肉量少点了，味道一般，不像服务员推荐的那么好吃~','60','2010-12-28 22:15:00',NULL),
	('19787fefd2587941928185166b315a95','8f185038db5e33dd47bc04a0a50afa9f','伊熙逸诺','4',4,5,4,'【试吃/体验点评】听说这家店的西餐是天津最早的，特别有名，就慕名而去了~~~感觉环境超级好，很小资的感觉，人也不是很多~~~味道嘛，感觉厨师沙拉不错，别的觉得就那么回事','0','2012-01-28 19:47:00',NULL),
	('1a12f258424b3302231ca11db35b996f','8f185038db5e33dd47bc04a0a50afa9f','sherry_ayt','5',4,3,4,'罐焖牛肉真的很好吃，肉烂还不失嚼劲，很赞。意大利肉酱面还有个黑椒牛柳面吧味道也都很好。老公说黑椒牛排味道一般吧。服务灰常好！','70','2011-07-18 11:08:00',NULL),
	('1b47026e2ab070ee78fa016340d7cea2','8f185038db5e33dd47bc04a0a50afa9f','kalarrd','4',4,4,4,'奶油杂拌不错味道很足，最赞的是罐焖牛肉，肉非常的烂入口即化，要是配点米饭就更好了。厨师沙拉用料足。红菜汤有点偏甜口。','50','2010-09-12 21:30:00',NULL),
	('1c03ec33ffaebd77d314edf8863226a9','8f185038db5e33dd47bc04a0a50afa9f','Ivy_Joevane','3',2,2,2,'和同学来吃的，感觉挺一般的。首先因为房子是在半地下的，所以里面的小单间感觉非常潮湿。其次，菜品也就那么回事。奶油杂拌味道很淡，要的一个什么鹅肝牛排，鹅肝的味道挺奇怪，开始还以为是猪肝了，而且竟然是泥状的，根本不是块块的...牛排倒还可以，但是分量不大。里面最好吃的感觉就是厨师沙拉了，确实不错。','70','2010-08-08 18:24:00',NULL),
	('1ccf00b18e0ab835a9b6f77998a820f5','8f185038db5e33dd47bc04a0a50afa9f','家有小熊ddung','5',4,5,5,'可能是期望值太高了，觉得厨师沙拉和烤杂拌一般啦，后者太腻了，大部分都是奶油。如果单点的话可能是个不错的选择。若选择太多的菜，可能到最后会感觉很腻。粗薯条不错，法式炸猪排也不错哦。不过老公说厨师沙拉很好吃的啦。','70','2012-02-11 21:31:00',NULL),
	('010bd59379c702401c9f7c12b42b82eb','9800cf9ddc35e5e18fa436eb68e521d9','呆大宝','5',3,5,5,'在一幢小洋房里 环境非常的好 很有情调 适合情侣约会 里面的冬阴功汤很正宗 太阳虾饼脆脆的 酱也很美味','160','2012-01-21 21:51:00',NULL),
	('06e5a58a98228cfccf0d259ec341ba2f','9800cf9ddc35e5e18fa436eb68e521d9','猫浓','4',3,3,3,'【试吃/体验点评】环境还蛮适合情侣去吃的。暗暗的。取得时候是中午。点了个汤。点了份饭。因为下午还有事。所以吃的有点急。味道还不错。酸酸辣辣的。应该很合女生的口味。','200','2012-01-27 18:17:00',NULL),
	('075cff8958371070302b1bfabae8b0b7','9800cf9ddc35e5e18fa436eb68e521d9','kongdama','5',4,3,4,'太阳虾饼是最好吃的，之前也没有在别的店里吃到过，绿咖喱鸡配饭很好吃，不过饭挺贵的，两位要18元，可以随便续虾酱空心菜连我这个不太喜欢吃空心菜的人也吃了好几口冬阴功汤没有附近新开的泰籽的好吃，中午打九折，老外还挺多的，地段也是一个原因吧','137','2012-01-15 11:28:00',NULL),
	('0cccf9d7fe033c0654679bdd34d7e073','9800cf9ddc35e5e18fa436eb68e521d9','heiha哈','4',4,3,3,'其实味道和天泰，藏珑泰极这些不相上下，感觉泰国菜的水准都一样哈~环境晚上应该会更好，中午去的，暗暗的气氛，劈情操的地方。。。','150','2012-01-26 18:29:00',NULL),
	('0f6da0814c836070c99dd66fd8a0b7f4','9800cf9ddc35e5e18fa436eb68e521d9','三元啊','4',3,3,3,'这里很适合我们小情侣去，露天位置很适合看风景，但是美中不足的就是，有时候有点暗性比价比较高，呵呵，值得推荐的哦，','150','2012-01-11 22:42:00',NULL),
	('10e627045b6b13e540d0cdf6c4f028b8','9800cf9ddc35e5e18fa436eb68e521d9','sosowonone','5',3,5,4,'环境很好的一家店，装修很有用心，饭菜的味道也不错但和环境比稍有逊色，绝对是约会的好地方，推荐推荐！不过晚上要等位，记得早点去','300','2012-02-09 16:12:00',NULL),
	('138cb7bc603f255fc9370a23454b6569','9800cf9ddc35e5e18fa436eb68e521d9','松狮大侠','4',3,4,3,'其实吧，泰国菜也就吃着几样东西，大概我有时候不愿意尝试新产品吧～冬阴功汤确实不错，好地道。其他也就这样吧，饮料不好喝，价格小贵。这家主要胜在环境好，适合劈情操哈哈','0','2012-02-02 13:16:00',NULL),
	('16884009f6e3d4bf7546f067a9bc3b07','9800cf9ddc35e5e18fa436eb68e521d9','轩辕小小','5',5,5,4,'朋友聚会去的，环境很好，很适合情侣去冬阴功汤很不错，其他东西觉得一般晚上出门的时候还有很多人在外面排队，真是够厉害的，一定要提前3天订位','150','2012-01-17 20:50:00',NULL),
	('1ab696c79cee011aa2c276c167245a43','9800cf9ddc35e5e18fa436eb68e521d9','凹凸ＸＩＡＯ曼','3',3,3,2,'【单字第459号】个姘头额地方咯？！ACC的，门口池塘，小天井。。。菜的量都很小据说红咖喱牛肉不乍地黄咖喱鸡我吃了一块就被两男人夯掉了，等我还要吃的时候只有土豆。。。绿咖喱蔬菜倒是不错，爽口点了份椰香海鲜汤，也就这样了虾酱空心菜也很普通菠萝饭可以吃吃感觉没有MI THAI好吃，价格差不多和花马据说一个老板适合情侣来，但性价比不高地方比较搓可，富民路靠近延安路隧道，一个小门口~~停车。。。我硬是让某人反向开到巨鹿路，哈ENJOY卡9折','153','2012-02-04 22:54:00',NULL),
	('1bc1bc946c5a4fedae682abb8fd2900c','9800cf9ddc35e5e18fa436eb68e521d9','piggy_mbh','4',4,5,4,'很不错~味道相当好，但冬阴功汤不是很喜欢，最爱空心菜~~就是没预订等了一个多小时！环境和服务都相当好，下次白天去~感受下不一样的~','250','2012-02-15 11:45:00',NULL),
	('1c6bfcbb8c8e8a70bf3db5a8e2114a46','9800cf9ddc35e5e18fa436eb68e521d9','白色恋人爱美食','4',4,4,4,'不得不说这是个很有情调的地方，距离静安寺并不是很远，交通比较便捷。总过小桥流水，下面还有很多活泼的鱼，还有漂亮的荷花。再经过一个小酒吧，晚上这里肯定很热闹。里面有一间间隔开的，也有不隔开的，外面还有一个花园，可以露天吃饭的。晚上很昏暗，基本上不开光线很足的灯。虽然这样比较有情调，但是还是走路或者找座位还是会有点不方便。菜式是泰国菜，味道是相当不错的。特别喜欢冬阴功汤，酸酸辣辣的，里面的料也很多。蔬菜非常爽口，还有个鱼味道很棒，其他菜味道都挺浓郁的，很棒。菜的卖相有点看不清楚，有一些做的还是挺精致的。印象挺深的是，几乎每个菜都要放点腰果，我最爱吃腰果啦，这个腰果催催，还有点甜甜的，很好吃。乡毛竹根水，里面真的有一根香茅哦，很有意思。有个吃饭的勺子很有意思，挺大一个的，非常霸气。绝对是个劈情操的好地方。','0','2012-02-03 16:42:00',NULL),
	('03863915bb27bc73c2d9ae466409a04f','9848739a6d6b51614164a6a50f7d7aa3','sophia730','5',5,5,5,'作为游客感觉这里的环境真是非常棒，老板很用心的设计让人感觉自己仿佛正处在晚清时期的欧式豪华别墅中。四周装饰用的古董看似简单陈旧，经经理一一讲解之后真是每样都会让人发出惊叹，很喜欢那个看似首饰盒的木质盒子，打开来看里面竟然是用来存放雪茄烟的。  四个人在这里点的2份88的，2份136的套餐，沙拉和汤类味道都非常好，主菜口味上感觉有些偏咸了些，餐后的小甜品是我的最爱非常好吃~~   姜姓的经理人非常的好，非常耐心的给我们讲解各种家具的历史，还送了我们鼓浪屿的地图和老板写的书。总之是非常值得一去的餐厅，下次还回去~~','100','2010-11-11 21:36:00',NULL),
	('08212e29b1a5a1390ba1f2c239a1d3c3','9848739a6d6b51614164a6a50f7d7aa3','寻找Claire','3',4,3,3,'来到鼓浪屿第一个吃的就是他家的黑猫香肠，他家的香肠很有特点，要就着切好的蒜片吃，不知道里面都放了什么，能吃出来的有腊肉，总之很好吃。','30','2011-01-01 13:24:00',NULL),
	('088857a1a4a9a17bbae2d7ef98a4ffe4','9848739a6d6b51614164a6a50f7d7aa3','亦如云','4',4,3,3,'餐厅的名字挺特别的，容易让人记住。里面西餐的口味还是很不错的，下午在这做了很长时间，在这里环境不错，挺惬意的。喜欢。。。。','30','2011-12-21 15:02:00',NULL),
	('0975019461855c5c38f7dc4650e4f320','9848739a6d6b51614164a6a50f7d7aa3','Rossana','4',3,3,3,'黑猫香肠果然名不虚传，走过他家就能闻到香肠的香味，非常赞。餐厅的布置是古色古香的，喜欢这种感觉，待在这里就不想走了。','0','2011-06-03 13:21:00',NULL),
	('0d55db8f901d3280bdf106e26250ae17','9848739a6d6b51614164a6a50f7d7aa3','主电瓶','2',1,3,2,'说实话他们的著名香肠不像想象中好吃，还有墨鱼香肠，试吃了一点，在这热闹的龙头路，这样的货色竞争力可以有待考量哦','6','2011-05-14 09:49:00',NULL),
	('0ed1a79c195948058c164082c188c9ca','9848739a6d6b51614164a6a50f7d7aa3','yaya1028','5',5,5,5,'三大一小吃得很满意，套餐很超值，牛仔骨不是特别嫩的那种很有口感，黑猫香肠比较不错加了一份，鸡尾酒比较大杯，像饮料，主要我们买了中街卤味的鸡爪子来，很不客气的先吃了一通，服务员很可爱，不是特别制式的那种，号称老板在岛上有八家店，佩服啊！以后还会再来！','0','2011-08-10 18:59:00',NULL),
	('1166ca3c28fc377a9a2b8450e4689b02','9848739a6d6b51614164a6a50f7d7aa3','louiseyang','4',4,5,4,'兜兜转转才找到这家店，但是品尝过他们家的美食后我觉得还是值得的餐厅是个三层楼的小洋房。层高很高。很安静。我很喜欢这样的环境的点了英国领事套餐。128 三道菜加甜品。饮料需要单点，不便宜觉得很好吃的。。。真的很推荐各位去厦门的朋友去吃吃看。。。。','158','2011-01-02 21:38:00',NULL),
	('117cbe36f46b6e6f436e376560eb4f90','9848739a6d6b51614164a6a50f7d7aa3','不是在吃就是在去吃的路上','4',3,4,3,'清早起来闲逛路过这里，觉得大门顶上的石狮蛮有特色拍了几张照，正巧一个阿姨开门进去，就让我进去了。进门左边里面一个小老鹰，被拴着，歪着脑袋看看你。进门右边有一条陨石，也在那不声不响地看着你，摸摸他晃晃尾巴。给他们都拍了照，结果照片导出来却没了。大概去的太早了，楼里的门都还关着，只好拍了几张照就走了。下次再去的话一定要进去坐坐。','0','2010-11-18 11:10:00',NULL),
	('134b5534c873762fa489d5f75dc26c31','9848739a6d6b51614164a6a50f7d7aa3','evelynlaw','4',3,4,3,'【团购点评】去厦门玩之前看到这是厦门十大特色餐馆之一，还听说是鼓浪屿最贵的餐厅，刚好看到拉手有团购，团了两份和某人一次去试一下。下午探路的时候碰巧撞到经理PETER，聊了一下，这上百年的古宅的历史在经理的解说中，有点了解了。晚餐时候过去，刚开始挺喜欢外面的风景，后来太冷了，叫服务员帮我们转回室内。那时才发现二楼全是我们包场。伴着音乐，还偷偷地和某人跳了一下舞，嘻嘻嘻！前菜沙拉，感觉还可以，某人不喜欢自己的那一份，偏要抢我来吃。汤，感觉一般，可能是吃不惯熟了的北极贝。主菜，我的是美式烧春鸡配薯蓉，卖相挺好，味道也不错，某人的是牛仔骨配龙俐，我超爱他那里的龙俐鱼，很嫩，味道不错，我几乎偷吃了一半。甜品，不是配套的，所以没吃那个法式炖奶，给的芝士蛋糕不太喜欢，太腻了；某人的原本是芒果布丁，结果换了巧克力蛋糕，挺不错的，全吃光了。剩下的就只有那招牌的黑猫香肠，本人不太爱吃香肠，加了蒜的觉得特辣。最后除了团购的68和88的套餐之外，就这香肠要收钱，37，算是鼓浪屿中吃得最贵的一顿。','0','2011-01-07 14:59:00',NULL),
	('14fa2571c2d97d2139e9f3ef9ef93877','9848739a6d6b51614164a6a50f7d7aa3','长颈小鹿','3',2,3,3,'在网上看攻略说黑猫还算岛上比较有特色的饭店，抱着满满的希望去，却有点小失望，是一家西餐店，没有筷子，点了他们特色的饭还有鸡排，味道非常一般，没有给我惊喜的感觉。但是黑猫香肠确实不错，值得推荐，可以在岛上走累了，去里面点份香肠，点杯饮料，感觉会不错吧~坏境蛮好的，蛮有历史感~','0','2011-06-30 15:58:00',NULL),
	('1a213f94e3bfd067fdc89d36e8b4d9c1','9848739a6d6b51614164a6a50f7d7aa3','kikihe0318','5',3,4,2,'鼓浪屿最特别的餐厅之一，老板养了两只隼在花园；整栋别墅充满了古董，包房内的牌匾是嘉庆年间的，有格调；牛排口感极佳，千万记得点188的套餐！不要点便宜的英国领事套餐。此外，他家BOSS偏爱的法国领事咖啡很赞！咖啡师还会现场调配。餐厅最大的问题是网络，WIFI很不给力！','220','2011-07-04 14:35:00',NULL),
	('1bcd1c9908ebc0bc45f45166f8914949','9848739a6d6b51614164a6a50f7d7aa3','lulumaka','4',2,4,3,'地方真的很难找，路牌14号却和15号相隔2个岔口，问了一个小学生才找到这家黑猫餐厅价格自然不便宜，东西没有想象中难吃，但绝对称不上好，一般点了法国套餐，四道菜，男生估计会吃不饱，选鱼可能会感到有些腥味，推荐选鸡排~环境是很小资，适合朋友聊天的地方其实鼓浪屿都是这种格调的店，如果特意去找可能没什么意思如果路过，可以喝杯咖啡，坐个半小时，拍拍照片休息休息还不错非常不方便的是岛上不能刷卡，全岛几乎都不能刷卡，建议带好现金，不然就尴尬了','90','2011-03-13 13:42:00',NULL),
	('01cf140191e45311f14a6516cab4dfc7','a0ba615b6d6979c6cb0dec71b545cc40','沉默的价值','0',2,2,2,'与蔡记蒸饺、合记烩面合称郑州三记，但现在名气比其它两家就小了不少。总店以前在大同路上，中原路上曾经开了一家分店，几乎每周都会和同学一起去。点几个凉菜，弄几盘肉焖饼，吃的满嘴流油，不亦乐乎。印象最深的还是那里的凉菜，做的真是地道，喜欢的不得了。后来那家分店搬走了以后就再也没有去吃过，前些日子路过伏牛路见到这家老店就进去坐坐。可是不知怎么，吃过以后却再也找不到以前那种美好的感觉了。地方比中原路的时候大了一些，中午人很多，要等一些时间才能找到位子，但环境和服务并没有什么长进，属于拨拨动动一类的，饭店里的凉菜种类基本上同其他饭店的凉菜品种差不多，平庸不堪，很多以前具有饭店特色的凉菜的品种都没有了（包括我超级喜欢的干煸酸甜辣豆干），焖饼分大小份，份量都挺足，饼焖的有一些老，也许是我饿了的原故，满满的一大盘都被我干掉了，也没觉得油腻。感觉做法也比以前简单，好象饼焖好以后直接将红烧肉放到饼上的，同事吃了以后非说是炒饼（其实全名应该叫坛子肉焖饼。做法是将肉与饼及辅料一起放在坛子里焖的）。饭后要的红豆粥却是味道极好，米煮的糯糯的，红豆却粒粒清爽饱满，一吃就知道是费了工夫的。饭店消费很实惠，适宜一般的工...薪阶层，只是需要先买单后消费，这种方式在郑州已经很少了，感觉有一些不适应。全文','20','2008-01-14 17:25:00',NULL),
	('036c65ce12017311bd13cccb575a55ad','a0ba615b6d6979c6cb0dec71b545cc40','HaroChien','4',3,3,2,'葛记的焖饼是主打，当然味道不一般了，好吃。人叫一个多啊，我坐着挨门了，要了一份焖饼和一份什么肉，忘了，两份粥，还有一份凉菜，就这我和媳妇就没吃完。量足啊，撑啊，哈哈！！价格也实惠，一份饼好像是18，我忘了，不过好大一盘的。','20','2010-08-27 02:30:00',NULL),
	('05c65c500a7ab48e29c3b923d756ad6a','a0ba615b6d6979c6cb0dec71b545cc40','青龙山小笛子','0',5,3,2,'比较有特色,吃的很扎实,一份饼2个女孩子吃,逛一天街都不饿,嘿嘿,红豆粥不错~不过似乎去的人不是很多~不晓得是不是大家还是比较怀念以前的老店~','20','2008-01-16 12:49:00',NULL),
	('0d5fbb455d294173680a99938c3ff8e6','a0ba615b6d6979c6cb0dec71b545cc40','小楚的凡宝贝','4',3,3,3,'这家的焖饼味道有点重，不喜欢吃油腻的朋友可能会觉得不怎么样，不过我吃起来还好，还有素锅贴也很好吃，我还特喜欢吃他们的红豆粥，糯糯的，很好喝。','0','2010-12-26 15:00:00',NULL),
	('10f8c6c46f970676863fbd566fc9f85c','a0ba615b6d6979c6cb0dec71b545cc40','cici039','3',3,2,2,'小时候很喜欢吃葛记焖饼，后来家周围的店都搬了，终于不久前找到了这里。焖饼还是挺好吃的，不给肉比以前少了。红豆粥不错。凉菜像糖醋小排太甜了，','0','2010-12-01 16:54:00',NULL),
	('1579ef839bd57a8cc9d7f59d710c9f79','a0ba615b6d6979c6cb0dec71b545cc40','白兔斯基','4',3,3,3,'终于了却多年的心愿这个地方有点偏 所以一直想不起来这中午不到十二点到的 两层全部坐满桌子摆得的确很省空间犄角旮旯都是桌子凳子服务员动作利索 态度还行就是很着急 因为人多的原因吧素的凉菜都是20元以下菜的分量不小 是盛盖浇饭的大圆盘点了份红豆粥 绿豆沙都很甜 我更喜欢绿豆沙要的坛子肉焖饼分量也很大 够两个人吃不过肉有点少 而且看似都是最后摆上去的焖饼跟北京炒饼丝还是不太一样的焖饼更软烂 更好消化一些 不是很咸 可能我口味比较重焖饼的油度也在我能接受范围之内没有觉得很油以后有机会回来尝尝伊府面和素锅贴','0','2011-04-24 11:00:00',NULL),
	('1658e45277830ce67934d92bc97d8d83','a0ba615b6d6979c6cb0dec71b545cc40','hnjzlili','4',4,2,2,'很喜欢吃他家的焖饼，喜欢清淡的可能会觉得油腻，我还是比较喜欢吃重口味的，所以觉得不错。红豆粥很好喝，软软糯糯的，特意买了点红豆自己回家煮了，可惜家里没高压锅，煮了很久，豆子还是硬的，哎，这家店距离住的地方很近，可是每次路过，里面都是满满的，只好找别的吃的了','15','2010-12-21 09:37:00',NULL),
	('1669bbeb1ee6c9ece0549c4a437bdede','a0ba615b6d6979c6cb0dec71b545cc40','melon1120','0',3,2,2,'上学的时候吃过几次 吃的什么菜差不多都忘了 好象有水煮肉片 很大一盆...焖饼挺油的 虽然味道凑合但是当特色小吃貌似还差点..红豆粥很好..最有印象的了 老妈能喝两碗..','20','2009-08-26 01:08:00',NULL),
	('1781a631e146a717899d57eefb7abb26','a0ba615b6d6979c6cb0dec71b545cc40','dolphinson','0',4,2,2,'葛记焖饼，在没有来郑州之前就已经听说。郑州以面出名，葛记焖饼是其一。国庆那天中午到这里，是提前定了位的。坐满了人。属于大众面馆，只有大堂，没有包间。很多凉菜卤菜供选择，推荐有特色的三道菜：如日中天：蛋清，干贝，番茄，生蛋黄，调味汁。相当相当地爽口好吃；鱼：这道菜由三个瓦罐组成，分别是鱼汤，鱼肉和鱼子酱。喝鱼汤，鱼肉蘸着鱼子酱吃。尤赞鱼子酱，太美味了。鱼子酱没吃完还打包了。稻草肉：北方人大碗喝酒，大块吃肉。粗稻草外包地这块肉足有2，3斤中，红烧酱汁裹着瘦肉，香喷喷，就着酒真有梁山好汉的感觉。对于喜欢吃肉的朋友推荐。不过如果没有喝酒就会觉得有点腻。另外，招牌葛记焖饼是后来菜上的，之前的那三道特色菜已经让我饱了，所以觉得没有什么特别。还上了伊什么面，海鲜面，味道很鲜。面食都比较便宜，只要6元一份，还是挺实惠的。','20','2007-10-02 07:48:00',NULL),
	('18a4ca9192b4440255f25659b344086c','a0ba615b6d6979c6cb0dec71b545cc40','susan1943','2',2,2,2,'听男友说他家的红豆粥和焖饼好吃，特意去品尝。和男友两人，就要了红豆粥两碗，绿豆沙一碗，牛肉焖饼两份，共计32元.绿豆沙最先端上来，尝了一下，味道很好，但有些偏甜。一会红豆粥上来，更甜，喝一会就腻的不行，觉得肯定放什么糖精之类的了。焖饼上来，第一口还不错，后来也是越吃越腻，最后焖饼只吃了一小半，好浪费。','16','2011-01-24 09:28:00',NULL),
	('1aeb7f0e74f3a4730c3fab1978f4f14d','a0ba615b6d6979c6cb0dec71b545cc40','zanglu','3',3,2,2,'名气挺大的，慕名而来，点了炒菜和焖饼，还有粥，焖饼刚吃的时候味道不错，吃多了有些腻，炒菜味道一般。红豆粥，绿豆粥很不错，赞一个。','40','2009-11-02 19:55:00',NULL),
	('05e3bd91403ae5c08198941e15247ab2','a273488207f73c1a6e5b4b56aed3140e','由幻','5',5,2,5,'来这个店吃的都是剁椒鱼头了，但是那个人实在是爆满 你无法承受的  之前下午五点半去的 一直拍到八点半的队 我勒个去的 你无法想像啊。  每天都排队   那味道还是很给力的。最喜欢吃那里的鱼头了','0','2011-05-23 15:03:00',NULL),
	('0773289f1d3f2f9f511a849987f7fd12','a273488207f73c1a6e5b4b56aed3140e','馋嘴小猫毛毛','4',3,1,3,'看见网上的评价特地去找，第一次找不到，第二次在小区附近问了周围的居民才知道，记得要问年轻人。在菜场附近，有人排队等就是了，他家的鱼头非常不错，其他菜一般，不过分量很足的，只是环境实在是太差了，讲究环境的人请绕行。','40','2010-05-13 22:24:00',NULL),
	('08068aa1281138acf02d0a4194c7a770','a273488207f73c1a6e5b4b56aed3140e','小叶子花','0',3,1,2,'店面上没有名字，就玻璃门上写了“川菜”“欢迎光临”几个字，旁边是一家鸭血粉丝店，以此为标志找啊找，估计能找到。乡巴佬鱼头，35元一份，每个去的人都要点的菜，很好吃，店面狂小，人非常挤，不要想在吃饭时间直接去就有座位，基本上要等30~40分钟，很恐怖的，每次去那里吃都能碰到熟人，然后跟人拼桌，呵呵。老板娘很厉害，一个人在前面忙，记性很好，谁先来后来，排队顺序记的清清楚楚， 个人认为豆花鱼和乡巴佬鱼头都是必点之菜，包菜炒什么的不要点，因为包菜是腌过的，非常咸。总之，菜好吃，正宗，辣，环境差，人挤','25','2009-09-16 08:41:00',NULL),
	('0cf8d60a92dfb014372946810b406da0','a273488207f73c1a6e5b4b56aed3140e','DP小清新','5',5,2,3,'太意外了，因为足足让我排了3个小时的队，5点半下班去的，8点40吃上老板娘一个人太辛苦了，包揽所有事务，搞笑的是，顾客为了抢位置，都帮忙收拾餐具了。要去吃的话提前预约外加自己提前3个小时左右排队。建议打包。鱼头是重点。','40','2011-03-22 16:42:00',NULL),
	('17216404d5c1db54b8f2007f40652f80','a273488207f73c1a6e5b4b56aed3140e','岭南之惑','0',3,1,2,'没找到！！！！！不过仔细看了一下，好像我们看到的那家没有什么牌匾的就是它了，我们还特定跑到人家屋檐下面看看是不是叫三峡格格，结果上面只写着欢迎惠顾，郁闷。问了入口那个卖香烟的，结果人家说根本不知道有这么一家店。我都跑到2村去找过一圈了，郁闷啊！点评靠观察啦！','0','2008-12-01 15:58:00',NULL),
	('1872420df6b5ede889a753c8d5ee2392','a273488207f73c1a6e5b4b56aed3140e','香樟的尊','3',4,1,1,'朋友推荐去的 晚上19：45 还有人排队 味道确实很好 生意的火爆 带动了他周边的2家其他店 后来发现那两家也做鱼头 吃的人也很多 想来 是效应 下次还去','45','2011-11-30 14:48:00',NULL),
	('18fe0729874376bced34fb87a733da73','a273488207f73c1a6e5b4b56aed3140e','flowerchild','3',3,1,2,'听朋友盛赞很久，某日家里没饭吃，护士姐姐就带我来了。在门口等了很久，里面不过10张台子，满座，还有直接在边上等位的。鱼头是推荐菜，我不好这口，只能说性价比高点，味道么算还好，辣，嫩，没有鱼的鲜味，回锅肉不推荐，多是大蒜。','25','2010-06-10 21:51:00',NULL),
	('19068f325204e1388f4869d2d5f94d24','a273488207f73c1a6e5b4b56aed3140e','seasons66','4',3,2,2,'味道真心不错，就是等的时间太长。。。饥肠辘辘的来店必备隔壁小铺的馒头若干，就可以省略米饭了 ，还可以在等待期间填个肚子。。。饮料可自带。。总之，好评店！','30','2011-11-29 21:38:00',NULL),
	('1a65cf34a2a03965fcaa254c850ab238','a273488207f73c1a6e5b4b56aed3140e','yiyiqu','4',5,2,4,'无意间在点评上看到这家店，其实经过好多次了，之前从来没有注意过。晚上8点多，突然馋虫上来，非要拉着LG去吃，其实已经很饱了。走到美佳倍顺超市，看到一个小店面，外面有人排队，肯定就是它啦！运气不错，进去等了2分钟，就有位置了，而且吃到了最后一只鱼头，老板娘直说我运气好，就点了个鱼头，就着啤酒，味道真不错！鱼肉很嫩，又鲜又辣，LG进门之前先申明他是陪吃的，只看，进去后也忍不住吃了不少。就是客人实在太多了，店里比较拥挤，下次带个锅去打回家吃。','0','2010-03-28 21:12:00',NULL),
	('1a97e5f33b3cb179548eb3784dd9a3a1','a273488207f73c1a6e5b4b56aed3140e','sanyuanyin','4',3,1,2,'去吃过两次，人 太多了，要排队好久。环境也脏兮兮的，但是大家就是冲着鱼头去了呀。价廉物美。夏天去真是遭罪，不过老板娘早关门避暑去了','40','2011-07-27 22:36:00',NULL),
	('1d5b5331c31cd8f8720543817ace1518','a273488207f73c1a6e5b4b56aed3140e','zhengqianwan','0',4,2,2,'我虽然是苏州人，但很讨厌吃甜食，很喜欢吃辣味。每次去都点两份鱼头，一份野山青椒的乡巴佬鱼头，很香很入味，也不算太辣。一份红椒鱼头，相对就比较辣了；我还是喜欢乡巴佬味。朋友三两小聚，比较随意的话，还是可以去吃吃的，其他辣味菜的味道也都不错','30','2009-09-30 09:06:00',NULL),
	('1de340d9c2c9dd56ed82bdd4edfe91b9','a273488207f73c1a6e5b4b56aed3140e','koandysun','3',4,3,3,'找了N久才找到她。。。久闻大名。鱼头和酸菜鱼十分得不错。就是有一点点辣。去晚了就没有位子了。给我的总体感觉就是好吃又便宜。童鞋们赶紧去试试吧','30','2011-07-24 16:36:00',NULL),
	('09c9ae99cad030db61dd4d723cf39b4a','a3ccfe36eb6a0c3e517b910028a8d1ab','福尔萝卜丝','4',3,5,5,'的确是华丽的装潢，环境非常的优雅，适合情侣约会，灯光也很昏暗，烘托了气氛。只是取餐区的东西种类比较少，尤其是熟食。需要称赞的是甜点，真的个个都好吃，慕斯蛋糕是我的最爱，也是我隆重推荐的。有一个叫做布丁的蛋糕，以为是布丁，其实就是一小块儿蛋糕而已，个人很是喜欢呢。牛排很好吃，其他的肉类有点儿干的感觉。奶油焗土豆是我的最爱，可惜没有奶油浓汤。中途还会赠送热鸡尾酒，有点儿奶茶的味道，喝起来还不错，开车的朋友也可以享用。客流量很多，还可以吃自助火锅。冰淇淋里有冰沙，苹果和香橙口味的，巧克力球很好吃。我最爱的','130','2010-11-28 09:01:00',NULL),
	('0da7632cc1828b33baa682cc36436519','a3ccfe36eb6a0c3e517b910028a8d1ab','_maou','5',4,4,5,'最近最喜欢的酒店自助，感觉完全可以击败海景称得上青岛最好的自助，食材很新鲜种类也很丰富据说全进口。特别是蛋糕很惊艳，我对甜食很挑剔，元祖艾蜜儿这种属于看都不愿意看的，艾美的蛋糕我恨不得一大盘一大盘的吃...推荐一种烤奶酪布丁，组织非常细嫩，味道比加淡奶油的布丁更浓重点，上面浇了焦糖，和烤前焦糖垫底的是两种截然不同的风格周二去应该会有番茄罗勒汤，配小法棍吃非常销魂另外免费供应的红茶是罗纳菲特，很好喝环境也不错，可以拼长桌，适合家庭聚会目前两个人去免一个人的单，不知道这个优惠活动搞到什么时候','103','2010-02-23 03:25:00',NULL),
	('15fc7e06fa8cf8e14944f3779d826160','a3ccfe36eb6a0c3e517b910028a8d1ab','glover103','3',3,4,4,'去之前看点评真的不怎么样，所以没有抱太大期望，但其实不错啊，环境，菜品比起青岛另外一家超五星InterContinental来说，好很多了。 延吉路万达广场，作为市北区强推的CBD中的一颗“钻石”，应该说从开业就赚了很多人气，倒是建在旁边的Le Meridien却好像有点默默无闻的样子。毕竟是青岛的第二家超五星酒店，总是要去体验一下的。要说建筑本身，没什么特别的，和万达广场，39克拉外部结构差不多，也没有什么特别的装饰，但进到里面还是觉得和其他五星及超五星有所不同的，大厅里天花板上的银河般的灯饰，到前台大气而且相当中式的背景屏风很吸引眼球。应该说是既相当现代又很具中式风格。说吃吧，青岛万达艾美把Le Meridien的三家明星餐厅都带到了青岛，吃自助的自然是Latest Recipe,据说开业初期还请米其林三星厨师Jean George来助阵，不知道真假。不过貌似主厨都是老外。餐厅里的服务员和助理厨师英语都不错，都可以给不懂中文的老外们流利介绍菜品。把服务说前面吧，不知道为什么那么多筒子们狂批他们家服务，我体验到的服务是很专业而且都是微笑的，虽然有些服务员不太灵光，倒水不是很及时，但在介绍菜品，服务态度和速度，及时度上都是不错的。去取菜品的时候如果你...在某个菜品边上稍作停留就会有助理厨师过来给你介绍菜品，很不错。再说环境，进门觉得他们家主色调就是绿色，地毯上的绿色装饰，座椅是绿色，沙发椅上的靠背是绿色，蛋糕台后面墙上的装饰是绿色，加上柔和的灯光，感觉很舒服。座椅有点硬，不过是那种根据人体工程学设计的，坐着很舒服。刀叉应该是万达自己定制的，上面有万达的标志，桌上的pepper mill和salt mill用的都是不锈钢材质的，很有手感。餐布有点硬。。。说吃吧，首先说他们家今晚是salmon night,菜品里有很多都是和三文鱼有关的，由于我不喜欢三文鱼，所以会影响到一些我今晚的一些体验。其实今晚吃的一半的东西我都觉得不错，起码食材上觉得都是很高质量的，排类还可以，就吃了一块羊排，火候掌握的不错，其他中式菜品，泰式，及西式菜品大部分都还不错。我想提两样土豆有关的菜品，一个是什么起司焗土豆，一个是土豆沙拉，前者奶味浓重，很香，很好吃，后者用小蓝杯盛着，味道很清新，十分不错。喜欢。其他的就不一一提了，给2是因为他们家还是超出了我的期望度的。最后想提一下酒店的电梯，很舒服，三菱的，有小电视，音乐也很柔和，报层数的声音也很好听（对不起，俺比较土，对这种体验很珍惜。：-）全文','0','2010-03-13 00:37:00',NULL),
	('1974a680603059d4c1a528bb6ba24431','a3ccfe36eb6a0c3e517b910028a8d1ab','TerryGu','5',5,5,5,'经常在西餐厅吃工作午餐，特别喜欢午后阳光从西侧玻璃幕墙照进来的感觉。菜品丰富，海鲜也新鲜。illy咖啡味道很纯正，其他地方喝不到。','120','2011-05-12 19:38:00',NULL),
	('1a53679e05a37ce0f24832e2e234a697','a3ccfe36eb6a0c3e517b910028a8d1ab','仙果娃娃','3',2,3,2,'朋友请客去吃的，看了一圈除了了刺身居然没有太想吃的东西，不过蛋糕的种类还蛮多，对我这个蛋糕达人来说肯定是不会放过的，拿了一盘子的小蛋糕，除了芝士蛋糕的味道不算太浓郁外，其他糕点都还算不错，果汁不是鲜榨的，服务也一般，不叫服务员都没人换盘子和倒水的，这方便比海景差远了，估计没人请客不会再去了','0','2011-10-10 09:17:00',NULL),
	('1a8f9ffd9b97a426f3b97fad85966e3d','a3ccfe36eb6a0c3e517b910028a8d1ab','bula123','4',3,3,3,'中规中矩的，就是一个大酒店的自助，什么都有，没有什么特别出彩的地方，但是让人吃得也挺舒服。唯一不足的是点心好的被拿走以后，再上的就不怎么精致了','150','2011-07-03 01:00:00',NULL),
	('00b9b039fff3da0a8737ea43e34104c6','a42dae82b4ca8fb215cfec0506d1bb4a','小静小静','5',5,5,5,'【试吃/体验点评】早就听说不错 今天和男友去尝尝 我们吃的自助餐 分108元 138元 188元三个档次 我主要爱吃三文鱼 就选了最便宜的108元的 秋刀鱼味道不错 我第一次吃这么大条的 总之下次还去','108','2011-06-09 22:47:00',NULL),
	('011e5c64f7e9caba5eb48fcad85d2776','a42dae82b4ca8fb215cfec0506d1bb4a','cf就爱吃吃吃','3',2,3,3,'【团购点评】团购去的，两人99元，之前看点评还是可以的，但是吃的时候发现口味不佳。特别是跟大众点评网的另一个团购：通天阁150元代金券相比，后者只需花130块钱就可以拿到300元代金券，实际上加上点评网的返券，我自己只花了100元出头。300块钱可以在通天阁吃到饱了，而这个茂吉的团购，99元虽然也吃饱了，但是吃的东西实在不怎么样。这个店的女老板和服务员都很nice，但是凭借我吃吃吃的经验，这家店其实是比较山寨的，虽然鱼生还算细腻，但不是放在日料碟碗里就能当日料吃的。可能是我要求比较高，总之99元这个价格吃的这些东西，我觉得量够了，质不够，更不要说那些花正价吃饭的人。简单总结就是： 名字很高档，服务环境很像那意思，实际最重要的吃的东西不是那个档次。','45','2011-06-12 13:10:00',NULL),
