	('11c6a10aa70447d41b5328e3fde4ca97','a5411e64ce50522d97b557e32430fe1e','bimozhishi','3',3,2,2,'逛街太累，找地方喝茶歇脚。必胜客居然还在排长队。去了百盛地下的爱西西里喝茶吃冰激凌。吃完出来，朋友指着非要去买，于是第一次见识了感觉昂贵的猪肉脯。味道还可以，居然还有点甜甜的。但毕竟是新鲜出炉的，买回去了会怎样呢？也跟着买了点。今天带到办公室给同事品尝。说真的，冷了后的猪肉脯，看着就让人难受，油腻腻的，一点胃口都没有了。而且，感觉比现场品尝的甜味更重，为虾米呢？？','90','2011-03-09 13:14:00',NULL),
