	('170728fbe2af5587401c84989feb33a3','a5411e64ce50522d97b557e32430fe1e','pop corn','4',4,3,2,'每次到百盛地下总会被一股香味所吸引，就是他-美珍香！现烤现卖，绝对得给力！在上海，店员会很主动很积极的给试吃，无锡的就好像有点小气了，不过也难怪，近100元一斤的肉干是不敢多尝啊，每次尝的时候觉得很好吃，买回家吃几块就不行了，太甜，不过实实在在的肉看着叫人放心，还有一种类似蛋卷的也很好吃','100','2011-02-15 17:28:00',NULL),
