	('0ad8682e84fecfb7269ee3569ff34621','a589598d2f0017b402a8cc92ba5a6aef','陌詺杞訬','0',5,3,3,'傣味中的经典就是酸笋鱼、撒撇、香茅草烤鱼、烤五花肉。尤其酸笋是经典中的经典，纯属个人偏好。傣味不错。。。','30','2008-07-19 15:59:00',NULL),
	('10be2101c363a164fb513b300af2fb08','a589598d2f0017b402a8cc92ba5a6aef','chuvanky','0',2,2,2,'那天去，生意还可以，什么都不说，先来一盘鬼鸡，烤肉皮，菠萝饭，生菜辣咪，本来想吃酸笋煮鱼的，但是味道太重了，朋友不会吃，火烧干巴是下酒的不错选择！','0','2007-10-30 17:04:00',NULL),
	('14784613ea6712b36cdfed31dce94378','a589598d2f0017b402a8cc92ba5a6aef','蜗牛小乖','0',3,2,2,'来昆明一般来说几种美食不应错过，地道的滇味，爽口的民族风味，老昆明的小吃以及东南亚国家的一些菜品。小草的第三次昆明之行给了蜗牛一个难题，倘若是第一次来也罢，随便糊弄下就可以不是？嘿嘿，偏偏已经是半个昆明通的样子，给了蜗牛的艰巨任务。蜗牛一直自责的觉得没有尽到地主的义务，没有把最好吃的昆明味道介绍给小草，真是汗颜。傣味在昆明有不少的FANS，不仅是因为大多数昆明人如性格一样都喜欢鲜明的口味，更因为傣味的酸辣口感符合了昆明人的味蕾需求吧。反正，在昆明随便一数就可以罗列不下5家叫得出名字的傣味来。傣家竹楼是昆都附近口碑比较好的一家傣味，较之旁边的阮家傣味真是好过太多，只是相较之下蜗牛不识趣的更喜欢金星小区傣佳楼的地道和师大龙泉小区内不记得名字小小傣味的家常。按惯例，依旧先说他家环境。昆都附近地价飞涨，他家的排场已经算大，估计夏天更多的客人喜欢坐在店外的走廊用餐吧，不好的地方在于他家的地板太滑，穿高跟鞋的MM们绝对要注意了，人前摔得四仰八叉的，再优雅也有限不是？另外，他家的卫生间令人汗颜，蜗牛的确向来不喜欢男女共用的，更别说是小小的厨房旁边的一格……接着是服务，他家的小姑娘听口音都知...道是来自于德宏或者景洪的，普通话也说得可以，令人遗憾的是接待我们的那个小姑娘不知道是不是头天和男朋友吵架的关系，一张臭脸……小草虚心的问她为什么那个鸡要叫鬼鸡时，她不耐烦的甩出句：凉拌的鸡就叫鬼鸡……郁闷，那我们不是天天可以到菜市场买鬼鸡？牛牛嘛。关于菜品，老实说，他家菜品并没有蜗牛期待中那样惊艳。由于小草坚持请客，价格不详。香茅草烤鱼：没看到香茅草，后来才发现香茅草是塞到鱼肚子里去了。尤记得在版纳吃到的是包在外面的哈？这一点，让远道而来的小草也乱失望一把的，更是打消了要空运回家的念头。鬼鸡：卖相还可以，但是味道就欠缺那么点了，没有景颇人家的好吃，不够入味，平平淡淡的感觉，没什么大印象。菠萝饭：他家的菠萝饭是紫米的，这个是当天蜗牛最喜欢的了，如果能够在米饭里加入几个切碎的菠萝丁就堪称完美了。包烧黄笋：傣味另一种烹调特色就是包烧，点黄笋不怕小草吃不惯。他家的黄笋食材不错，都是嫩嫩的，没有把老的放进去凑数，只是味道稍微偏辣了点。能吃点辣的朋友，依旧推荐。稀豆粉米线：他家上菜的时候米线就已经是与稀豆粉混合在一起的了，个人而言，更喜欢稀豆粉和米线分开放的，这样的感觉貌似更好哈。总体来说，他家算是蜗牛吃过的傣味各餐馆中中等偏上的感觉吧，但个人认为不是最念念不忘的，只是在地理位置上来讲，他家的确是有优势。全文','40','2008-11-21 09:48:00',NULL),
	('15ad342b8cb020f979ec544ae6bc65ef','a589598d2f0017b402a8cc92ba5a6aef','希戈','0',3,2,2,'去的时候已经是下午了，居然还有客人。菜的价格不贵，尤其是素菜。香茅草烤鱼8元一条，很小，但是鱼和香草、韭菜的香味烤得非常到位，也不咸，非常好吃！各种菌类没有，真奇怪，这可是在雨季的云南啊！汽锅鸡也没有。点了个黄焖鸡，味道还行，但不如在大理的那顿好吃。奇怪的是黑三剁这种家常菜为什么很多馆子都做不好，这家也不例外，还贵，因为是肉菜（在北京只要是家常菜无论肉菜素菜都便宜这一规律在云南似乎行不通）。苦菜汤的蘸水调得很棒！菠萝饭和我在北京的傣家菜馆吃的不太相同。以前吃的是白糯米，菠萝肉很多；而这里用的是黑糯米，里边还放了大芸豆等别的东西，菠萝蒸的时间估计很长，已经发黑了，也没在里头找到菠萝肉，是蒸化了还是被贪污掉了？米酒不错，但5元一杯，不便宜。','35','2008-07-24 13:15:00',NULL),
	('17ae67fd7775ec247d665c98e1eb9464','a589598d2f0017b402a8cc92ba5a6aef','pangdou1986','5',5,4,3,'和女友出差慕名而来，味道不错，点了烤鱼，小米椒炒牛肉，菠萝饭，傣家辣子鸡，牛肉很下饭，菠萝饭里面紫米很Q不腻，最爱，对于外省子弟昆明最后一餐很值得怀念','50','2010-12-06 18:54:00',NULL),
	('17be608200e85534d0890223ddb8694a','a589598d2f0017b402a8cc92ba5a6aef','B_tony','3',3,3,3,'菠萝饭是将一个菠萝掏空，将米放里面，然后蒸熟而成的，味道有点菠萝的香味，甜中带点酸，做法很是新颖。烤五花肉很带劲，样子虽然看是有点焦，但蛮好吃的。很有傣家风味，去那边玩时，值得一品。','0','2011-08-03 20:19:00',NULL),
	('1a13ee3038fb94d19624e909589e6440','a589598d2f0017b402a8cc92ba5a6aef','野精灵','3',3,2,2,'过去还是常去7的，离我家近嘛~~~那个酸菜膏~~实在酸得太过瘾了~~~~那个酸啊~~~用来蘸五花肉，天作之合之后任何地方的酸菜膏，都找不到这种感觉了~~~其他的就没印象了~环境么，很一般~~~排挡类型的~~','50','2010-08-04 14:44:00',NULL),
	('1d830162f9f3fdff3115d35f27c5d416','a589598d2f0017b402a8cc92ba5a6aef','七月-安生','0',4,4,3,'上个月去云南旅游时，导游带我们去的，印象中离酒吧一条街挺近的。外表装修很朴实，竹子的外墙，里面环境严格来说也只是一般，看上去还蛮干净。人挺多的，MS大家都挺喜欢傣味的。因为从来没吃过，所以由导游来点菜。点了香茅烤鱼、炸牛皮、烤五花肉、柠檬撒撇、泡路达（音译是这样），菠萝饭因为去晚了，卖光了。服务员都是傣族的，长得很漂亮，身材苗条（羡慕ing）。杨导说傣家MM都很苗条，我突然发现众位服务员MM中有一身材略显丰腴，结果杨导说那是在昆明呆久了，回版纳一个月就会瘦了。想来那地方水土有助瘦身啊。香茅烤鱼：鱼肚子里塞了好多香茅草和不知名的香料，鱼肉浸透了香料，非常香。鱼骨也烤得很脆，不过我还是没勇气吞下去。炸牛皮：端上来的时候我们都怀疑这是牛皮否，因为都膨胀开，更像上海的油面筋之类。嚼上去香香脆脆，一点没有牛肉那种味道，蘸料酸酸的，非常开胃。烤五花肉：名字听起来很韩国。端上来的肉不像是韩式那种大块的肉片，肉片都比较小，而且烤的黑黑的，沾点蘸料，焦香中透着酸味，好吃！柠檬撒撇：端上来才发现是类似于米粉的东东。里面放了柠檬汁和N多香菜、辣椒末，还有类似于牛肉的东西。味道酸辣，还带着柠檬的清香...，是我喜欢的味。基本上2/3都是我解决的（挺不好意思的）。导游等我们吃完后才说那像牛肉的东西，是牛吃下去经过反刍后留在胃里的食物，当时怕我们恶心，没说。个人感觉还好，没啥怪味，在石林都吃过竹虫了，还怕这个东东？不过第二天司机说，苦撒里放的才是那个玩意，柠檬撒里放的是真的牛肉。泡路达：导游介绍是一种从泰国传来的饮料。上来才发现就像是西米露，用椰汁混合西米、凉粉，还有烤过的法式面包块。看似很简单的东西，但我们几个尝了第一口以后就停不下来了，感觉比西米露好吃一百倍，尤其是那面包块，泡过以后仍然很香脆。吃完后每个人又要了一份，临走前又在昆明城外的一家傣家饭店吃了一回，不过没这里的好吃，他家用的面包是类似于别司忌，泡一会儿就酥掉不脆了。饭毕结账，人均25元左右，我们都惊呼便宜，好像在云南这几天，去饭店吃饭从来没有超过人均30元。另外，我终于知道为啥傣族MM不会胖了，傣族的饮食以酸辣为主，用油非常少，柠檬撒几乎无油。云南真是个好地方，风景好，美女多，又有这么多好吃的小吃。什么时候才能再看到那么蓝的天空啊？全文','25','2008-12-05 15:34:00',NULL),
	('01cf7e5932177734771a05b22e75404c','a5c488b8bb26a26cbb4f4e2571ed961b','yiexiaoyi','0',3,3,3,'在西湖宫，我们点的是最便宜的菜，因为口味不同，菜是没什么吃，只记得堂面很气派，纸巾是盒装的，很精致~','20','2009-07-14 18:05:00',NULL),
	('0237ef79367a6afaa82cbb29e69d6a03','a5c488b8bb26a26cbb4f4e2571ed961b','食神大人','3',2,4,3,'可能是菜没点好，没吃到什么好吃的，加了一个蛇肉，号称是1斤的，感觉也就半斤的分量，主食偏贵，包子什么的都是5块钱一个。好像主要是接待一些旅行团，有歌舞表演，节目一般般。有一个在桌位上先做得铁板牛肉类的菜，名字不记得了，味道不错。','100','2010-03-25 13:33:00',NULL),
	('0294fa4f17ecb76106280a1de579d1cb','a5c488b8bb26a26cbb4f4e2571ed961b','皮9','3',2,4,3,'剁椒鱼头还算不错，不过后来我们要加面竟然加的是普通挂面，这种面搅拌了不好吃羊肉汤还行吧，我们老板请客，点了太多蔬菜，无语','90','2010-07-20 15:57:00',NULL),
	('032d631c1367b94d8acb8bde0570bd5c','a5c488b8bb26a26cbb4f4e2571ed961b','jamc_2001','2',1,3,3,'门口的气势很大，挂了很多老板和名人的合影，进去后主楼又大幅宣传着：西湖楼经过吉尼斯认证是亚洲最大的酒楼。。。我们在西湖厅吃的，味道简直是太一般了。一个什么扣肉之类的，全都是肥肉，而且油腻，完全没有做出该有的感觉。汤不鲜，辣椒不辣，跺椒鱼头的鱼肉很老，鱼皮都撕不下来。包厢里面的厕所也很不周到。总之我是不会再去了。。','0','2011-03-29 13:00:00',NULL),
	('098a180e525f1a417b215b40f2daa11d','a5c488b8bb26a26cbb4f4e2571ed961b','白玫瑰','4',4,3,4,'出差到长沙，外地同事带我们来这里吃午饭。开车穿过城墙，很大的地方，迎面的横幅写着吉尼斯记录亚洲最大的餐厅，可同时容纳5000人用餐，卖场很壮观。中午就主楼里有人用餐，进去的时候正在表演歌舞，我们坐在了最靠近舞台的地方，吵了一点。虽然我是南方人，还算能吃辣，菜蛮合胃口，味道偏浓。','0','2010-03-11 21:50:00',NULL),
	('0b807781a5d978d59a6a8d850d6dc728','a5c488b8bb26a26cbb4f4e2571ed961b','创业侠女','0',2,3,2,'走进去像走到皇宫一样，环境很豪华，也可以看到很多的表演，真的是人生一个很好放松和享受的地方。这里的菜还是很丰富，服务员向我们推荐剁辣椒鱼。味道还可以，但是和别的店子口味差不多，就是辣椒的酸味程度不同，上次辣椒太酸咯点。但是在这里消费一次，那红色的毛爷爷就要丢几张啊............','90','2009-07-31 23:07:00',NULL),
	('0b9866d81f80c4b9119f1dae3cc16fb1','a5c488b8bb26a26cbb4f4e2571ed961b','zyajiushiwo','0',2,4,3,'实话说要是所有餐馆都是这个样子也就算社会主义社会了，因为确实是宏伟啊，湖南的饮食业之发达由此可见一斑，公款吃喝贪污腐败的据点','90','2008-12-30 03:42:00',NULL),
	('0bbb416bce5510b4faffc6be653e250d','a5c488b8bb26a26cbb4f4e2571ed961b','瓢瓢儿','5',3,3,3,'在大冬天里能找到那么一个暖和的地方真是幸福啊！一伙人冻惨后围在炉子边吃饭，好享受啊！服务真是不错，服务员不停的加水，换盘。东西味道很好，湘菜不如川菜那么油，但很入味，好吃！','0','2009-12-09 23:31:00',NULL),
	('14ea4996d5a3d94e42985808f46f6248','a5c488b8bb26a26cbb4f4e2571ed961b','wdb五点半','4',2,3,3,'应为别人请客，不知道价钱。地方真是大，服务员一看就知道是训练有素，态度不错，也很有眼力见。菜点的都应该是湘菜特色，菜名就不能强求记清了，我能吃辣的人还是觉得合口。','0','2009-12-24 20:37:00',NULL),
	('169832b3d978511f28bf26fea21c921c','a5c488b8bb26a26cbb4f4e2571ed961b','453454','0',3,2,2,'到这里吃的比较多。口味还是比较地道。尤其是到了过节比较热闹。坐在大厅吃饭。台上在进行精彩的节目，小孩在台前跑来跑去的，外面不时的放烟花，小孩子就跑到外面看，跳呀笑呀，有点在乡里办喜事时请戏班的味道。气氛非常热闹。菜上的比较快，特色菜有剁椒鱼头，有爆炒田鸡。有一次，带儿子去吃爆炒田鸡，他吃得好快，不一会而桌前就有一大堆骨头。等他再去拿时，碗里已经没有了。这时，他看到骨头上还有些肉没有吃干净，竟然把骨头拿起来又咬，我们笑着又给他点了一份。','100','2008-11-09 13:29:00',NULL),
	('1b30e7c68a547af1e5f43d8d86a7860b','a5c488b8bb26a26cbb4f4e2571ed961b','leypansy','5',4,3,3,'特别喜欢这里的环境，，古色古香的外观，，而且场地特别的大，，嘻嘻，，结婚的人都还可以到这里摆酒哦特别的有意义哦，，对于饭店来说确实挺宏观的哦大爱剁椒鱼头不错哦','100','2012-02-15 15:24:00',NULL),
	('1bf4282e2ab3edb6f846ef7a9dde0d56','a5c488b8bb26a26cbb4f4e2571ed961b','cslcxd','5',5,5,4,'环境不错，菜也好吃，不过贵噢，，商务人事适合别人请客去过一次，觉得很多菜都好吃，不知道是不是 点菜的人有水平鱼好吃，，其他菜都说不出名字了。。忘记了 哈哈很好吃','0','2011-01-15 21:04:00',NULL),
	('1cdaf42a6b4107d30da8c5e2da868647','a5c488b8bb26a26cbb4f4e2571ed961b','next1','4',3,4,3,'听说是亚州最大的酒楼，味道还行吧，里面真的超级大，环境不错，感觉象去到了故宫一样，前面有一个很大的酒鬼的雕像，口味也行，嘻。','0','2010-10-08 22:52:00',NULL),
	('0a119a868c38bb10fba6ae479e749ab7','a97cdbcaa4d1d8277b90894830db5c29','千叶惠津子','0',3,4,2,'这是我在太原吃的唯一一家自助，东西可以选择的多，这家店的位置也不错，后来成了我们宿舍集体常来之处了。  店里装修很舒服，我们都是秋冬季节去的，里面很暖和，一进门，就是阵阵的见食物飘香。烤鸡翅，炸鱼排我个人比较喜欢的，冰激凌都是掺水的，不纯。虽然，他家的酸奶是当地的牌子，但是很醇厚，一定要试试。  这里不得不说说啊，都是连锁，怎么天津的河东店这么差啊，冬天呢就能没有冷饮冷食，甚至我去的那天，没有热饮也。也许是消费结构不同吧。','41','2009-03-19 21:58:00',NULL),
	('0b9b9af1ab457646440a082201d85d45','a97cdbcaa4d1d8277b90894830db5c29','dkshop','0',2,2,2,'说真的我真不知道为什么那么多人都喜欢在吃这东西 可能我欣赏不了把 去了1次 感觉好多东西都比较的难吃','0','2008-08-24 22:33:00',NULL),
	('1203c86566d22254db3cefdcc62c758d','a97cdbcaa4d1d8277b90894830db5c29','s_fr','4',3,3,2,'去好伦哥一定要尝试一下咖啡加冰激凌 和肯德基老爷爷的雪顶咖啡一样一样的 鸡翅要多多吃 披萨就别吃了 挺难吃的 那里的意大利面不错','40','2010-08-15 14:48:00',NULL),
