	('1a64f940d3a1be619f895e2aba9bf869','a97cdbcaa4d1d8277b90894830db5c29','哇哇的','5',4,3,4,'很好的西式自助餐厅,种类繁多,味道上佳,&quot;疯狂&quot;的环境带动人们&quot;疯狂&quot;的食量,本人在选餐过程中有被人群挤得东倒西歪的情况出现,刚开业那两年吃的很频繁,年轻气盛,呵呵,现在时不时也去,还是很不错哦','40','2011-03-23 16:32:00',NULL),
	('1c5b2154a5804fd7c624b991a39425b1','a97cdbcaa4d1d8277b90894830db5c29','醋娃儿','5',4,3,3,'去过2次这边的好伦哥，其实没什么特别的感觉，好伦哥我就爱吃个水果披萨...现在都不太爱去吃了，一般也想不起来去吃披萨自助..','45','2010-02-23 12:59:00',NULL),
	('0525088dae39c1e1466249a56615992f','ab3bcf109f3891760f40ba4629dbd93d','Oh_Michelle','3',2,2,2,'忘记是什么时候开始火起来的。。。。。就见专卖店一家一家得开，一个比一个盖得夸张。。。。。东西呢感觉真的还是很一般。。。。找不到喜欢吃的。。。哎。。。可能是我要求高。。。孤僻吧','0','2010-07-05 22:47:00',NULL),
	('06fdcbc2667e27c722ba1d1781c76481','ab3bcf109f3891760f40ba4629dbd93d','Dragonbreath','0',5,5,4,'从小到大，几乎是吃着麦趣尔的面包，喝着麦趣尔的牛奶长大的。作为新疆人，相信这个品牌我们永远不会忘记。面包的种类非常齐全，牛奶的口味也在日益丰富，鲜奶油蛋糕永远是我的最爱。身边的亲戚朋友，不管谁过生日，蛋糕永远只选择麦趣尔的。如今在外地上学，也买过一些本地品牌的西点。但始终觉得牛奶没有麦趣尔的香醇，面包没有麦趣尔的好吃，奶油蛋糕当然就更没法比了。回家以后，一定要去麦趣尔！','20','2008-12-21 21:35:00',NULL),
	('101456b1b493f2a5fe62ee47d16df10d','ab3bcf109f3891760f40ba4629dbd93d','雪燕燕','4',3,2,2,'去过多家连锁店了，有坐那里和朋友吃蛋糕，喝牛奶的经历，更多是买回家第二天作为早餐吧。因为麦趣尔总是没有一个宽敞专门供我坐的地方，总有来去的买面包、定蛋糕的人，小孩子。。。更没有什么服务了，自己端东西。上学时候比较贫寒，哈，这里算是一个不错的选择，两个人，每人一份蛋糕一盒牛奶……20多块钱。说实话，很久不吃还比较想它纯正的奶香，不过有点油腻。。尤其他的月饼！太油了','0','2008-07-21 11:50:00',NULL),
	('110680380c41c115b549fa2817dac540','ab3bcf109f3891760f40ba4629dbd93d','caocao_mdj','0',4,2,3,'第一感觉就是贵！可能别的奶制品店去的少，但是感觉与乌鲁木齐当地的薪酬相比，还是贵的！味道没的说，尤其是那的奶油，据朋友们说当地的奶制品都是由当地的鲜奶制成的。味道好极了！听说要在北京开分店，喜欢的可以留意一下啊`~','50','2008-12-11 10:34:00',NULL),
	('133d385b0dda27786cd169e7da07acea','ab3bcf109f3891760f40ba4629dbd93d','于贝儿','4',3,3,3,'新疆品牌乳制品 从小恨不得把牛奶当水喝现在也转向高钙低脂了 第一次喝到麦趣尔的牛奶很惊异 很浓很香但久了就觉得有点过了 纳闷为什么不出巴斯灭菌的 糕点还行质量不错但特色的很少 冰淇淋最近吃了雪果子还可以想当年的美登高 月饼不说了这东西早变了 什么国饼面好些馅不同罢了 专卖店很多装修也不错但新品太少','10','2010-07-27 16:58:00',NULL),
	('161eeba9e8e855235f9821a71d1da17f','ab3bcf109f3891760f40ba4629dbd93d','ritalovenp','0',4,3,3,'麦趣尔的面包超赞的哦。。。。。喜欢他家的天使杏仁，味道很纯正。。。但现在已经涨价到6元了。。。。纯牛奶也很不错。。。','10','2009-04-04 10:19:00',NULL),
	('1ae476a28a6d4d09060ebda82ce99373','ab3bcf109f3891760f40ba4629dbd93d','猪猪爱喝茶','0',4,4,3,'作为新疆本土的西点烘焙企业，麦趣尔当之无愧的是老大，虽然曾经遭到“麦利来”、“华美都”等企业的激烈竞争，但是最终凭借自己的质量和服务牢牢站稳脚跟，并且定位高端消费市场。我还记得95年开业的时候（不是记得很清楚了）电台还进行了直播，非常热闹的。之后几年里，由罗林（就是现在声名显赫的歌手“刀郎”）演唱的电台广告歌曲脍炙人口，这么多年以来，麦趣尔的品牌已经深入百姓心中，无论是自己消费还是走亲访友，麦趣尔烘焙以及奶制品甚至速冻食品都是人们的上佳选择。他们的店铺遍布主要街道，而且用餐区装饰的氛围也不错。说实话，近几年我已经不太在这里买东西了，因为他的高端定价让我选择了放弃，我不是那种“宁吃鲜桃一口，不吃烂杏一筐”的人，只有在探望亲友的时候我会到这里买些精致的甜点送去，如果是自己吃的话我就在家附件的糕点屋选一些。但是由于“麦趣尔”是咱们新疆自己的优质品牌，我还是要鼎立支持，在网上好好宣传宣传，让大家多了解新疆。','30','2009-04-22 17:17:00',NULL),
	('1b69e39a2a2fb91dcca4f1daa485cfbf','ab3bcf109f3891760f40ba4629dbd93d','UhaLei','4',3,3,3,'传说过的麦趣，新疆本土品牌，看了旗舰店感觉作的蛮大的，帮上海克里斯汀差不多。味道当然比克里好很多啦。去的时候9点多了。已经打样了要，小姐要锁门 ，我们说买了东西直接就走。之后买了炭烧咖啡冰激凌，买了小蛋糕什么的。味道不错。还有什么特产的红豆牛奶。很补的说~！蛋糕包装盒子不错。呵呵。蛋糕么。奶味很重，很好。就是肥了点。','0','2010-10-08 14:02:00',NULL),
	('1da204a4f85b1241fa838ce5e2452c63','ab3bcf109f3891760f40ba4629dbd93d','小野草','0',3,3,3,'喜欢喜欢！因为在外地上学，所以回家都会去吃！很喜欢！支持麦趣尔！里面的冰激淋下次准备试试！不过就要等到放寒假了','15','2007-10-23 13:07:00',NULL),
	('1dd68ea25083c4fb3014a145c06fe7a1','ab3bcf109f3891760f40ba4629dbd93d','c__c_2000','0',2,2,1,'那天早上去他家，想做个蛋糕带给父母。一地的脏脚印，印象很不好。服务员不知在想什么，有一句没一句的，只说“自己看”。种类那么少，而且竟然要等一个小时，于是立马出来去几十米外的A千里了。','0','2008-02-01 23:23:00',NULL),
	('014091c499559283e8e1634fd4b3f40b','abeba4642580b2ac9e4ad16baa70047e','夜舞银霜','3',2,2,2,'越来越不咋地了，这是去的第六次，经常有台盘是空着的。推荐菜里的帝王蟹可以忽略了。为嘛？因为已经木有了，他家一向晚餐一人一客鱼翅羹、一人一客帝王蟹的，现在鱼翅羹照旧，帝王蟹无踪。大概6点半的样子听隔壁桌一女的问服务员，帝王蟹还有没有啊？答曰：送完了。哦~。因为前一次来也说帝王蟹送完了，我不死心，晚餐六点开市六点多就送完了？于是另外捉了一个服务员问，因为我们那桌连鱼翅羹也忘记上了，顺道问帝王蟹，回答现在不送了（？不是说送完了），又追问是平日不送周末送，还是都不送了？很肯定的回答，都不送了。哦。。。原来是酱紫。回想了一下，第一次来的时候午餐都送帝王蟹，真心赞啊！第二次来午餐就不送了，说晚餐送；第三次来晚餐送了；第四次来回答平日不送周末送；第五次来说送完了；这次终于问出了实话，就是没有帝王蟹了嘛！直接说不就好了。。。而且有的服务生真的相当怠惰，8点多的时候去要哈根达斯，服务员在里面冲洗地面，我喊他，回答等一下，我就等了，他继续冲地……我又喊，他装没听见！最后是另外一个服务生进来对他说，人家等你半天了你干嘛呢？那服务生非常经典的一句”俏皮话“让我以后再也不想去喜多屋：”这叫扒台~“。各位看...官笑了没？PS：建议各位食客按量拿取，就算是自助餐也不要浪费食物！隔壁那桌女的，拿了很多很多三文鱼腩，结果一整盘子都没吃，走的时候居然还说&quot;三文鱼都是生的，反正洗洗还能卖“。擦~全文','158','2012-01-04 18:17:00',NULL),
	('03a799c4f7751a335ca0d5c9db834b7c','abeba4642580b2ac9e4ad16baa70047e','巴乔forever','5',5,3,4,'惦记这家店好久了，今天终于有时间去了。11：25准时到达前台，感觉非常冷清，服务员很热情带我们到相应座位。当时人很少，估计全场不足10人。先去要了20个碳烤生蚝（朋友超爱吃），要了个清汤锅。上菜很快的，当我们转了一圈回来，生蚝已经上来了。下面对推荐的食材逐一评价：碳烤生蚝：感觉大部分比较新鲜，汁水很足，就是味道稍显清淡，蒜蓉比较适口。金枪鱼沙拉：鱼肉稍显不足，沙拉有些过量，但味道很是鲜美。三文鱼： 个人感觉是我在南京吃过的三文鱼里最新鲜美味的了。肉质非常嫩，入口后鲜香无比，后味十足，有种入口即化的感觉。美中不足就是切得有点厚，卖相不是很好。帝王蟹沙拉： 虽然沙拉很是厚重，但是依然挡不住帝王蟹鲜美的味道，口味极佳。其他一些鱼类做的也不错，但是清蒸类的比较少。最后说一下蟹。蟹是我的最爱，但这里的蟹虽然品种不算少，但基本上都不新鲜，尽管是真材实料，但品质很低。唯一感觉还行的应该算是旭蟹，还有些味道。总体感觉喜多屋具有较高性价比，基本能满足海鲜爱好者所需。','113','2011-12-29 16:47:00',NULL),
	('03abdb6d1bcbed5720fcf81685254e1e','abeba4642580b2ac9e4ad16baa70047e','hotowj','4',4,4,5,'下了大众的券去的，打了折，觉得很值得，不过帝王蟹是服务人员一份一份给的，有限制不过瘾，哈根达斯我吃了5杯，满足呀！其他品质都还行，就是地方小了点，装修环境一般，没有华丽的感觉，虾饺也没吃到，可惜！','180','2011-12-08 12:55:00',NULL),
	('04dbbfda8aeb2ac3a44dc5b868256631','abeba4642580b2ac9e4ad16baa70047e','挑剔走江湖','3',2,2,2,'优点是哈根达斯随便吃，各类海鲜生吃熟吃各种做法。缺点是熟菜的口味一般般。种类也不是特别多，我唯一印象深刻的就是：咸。好像吃什么都是酱油味。带小孩可以打折，记不得是140还是150以下可以打折的。中餐比晚餐便宜。','158','2012-01-01 20:02:00',NULL),
	('0548bdd271686aa2c58f91d340457a11','abeba4642580b2ac9e4ad16baa70047e','我爱jjl','4',3,3,3,'么有帝王蟹，只有帝王蟹沙拉，不过还不错，下面的土豆泥蛮好吃的，价格降了呢，晚上158，不贵.哈根达斯一般吧，觉得还没八喜好吃呢，生蚝还行，一般化，总的来说可以去吃吃。','158','2011-12-26 18:23:00',NULL),
	('06c7da39020cf04b3f07a008312013cc','abeba4642580b2ac9e4ad16baa70047e','bourn13','4',4,4,4,'还不错的 不过新店服务员比较不专业~还算满意吧 主要菜比较好。希望不要和多佐一样，一开始好，后面变烂了。不过螃蟹有点不是很新鲜感觉。','180','2011-09-05 12:12:00',NULL),
	('074260fc11a831e84f4962a18cb8d2cf','abeba4642580b2ac9e4ad16baa70047e','kmarks107','5',5,5,4,'环境很好 反正老听说有帝王蟹我是一直没找到 只有帝王蟹沙拉 不过也不错 看时厨师拿了很多螃蟹在那边用刀刮下来的 味道不错 然后比较推荐虾饺 虾饺非常饱满 里面的虾肉很多 甜品非常丰富 抹茶慕斯味道不错 然后这边就是海鲜为主 各种鱼 觉得鱼翅捞饭比较水 鱼翅很少就一点点 不过三文鱼补的很快 挺新鲜的 海鲜品种也比较丰富 贝类海参 同种海鲜生的熟的都有 不喜欢吃生的人也可以大快朵颐了~ 不过我最想说的是那个哈根达斯。。。一开始觉得自助一次两个球很赚啊 就不停的拿 后来那个香芋的冰激凌筒被挖的差不多了 那个服务员就把筒拎起来挖 然后我就看着筒侧面写着 八喜冰激凌。。。是不是感觉很坑爹。。。','13','2012-01-02 20:26:00',NULL),
	('100b558268e45ccda22c8bbbb6786769','abeba4642580b2ac9e4ad16baa70047e','susanlts','5',4,4,4,'吃自助吃多了真的比较无感了 这家是新开的就来尝尝 说是主打海鲜 三文鱼很一般！！但是蟹腿很棒虾饺不错 其他港点都一般有些菜可以 鳕鱼不错 鲍鱼扇贝不错 大多数无感尝了。。。。。。。哈根达斯永远是我的最爱 就是冲着这个来滴 甜品很一般很一般！！！！总的来说我觉得口味比金钱豹好 不喜欢那个暴发户一样的地方 当然跟我最爱的多佐相比还是有差距 多佐的致命伤就是没有哈根达斯啊。。。。。','178','2011-08-24 10:22:00',NULL),
	('119aaaaa024c90c79eeb59716b33c755','abeba4642580b2ac9e4ad16baa70047e','carriezyy','3',3,3,3,'中午去的，人不多，话说是不是年纪大了。。吃不动自助了。。没有以前能吃咯~不过三文鱼，鹅肝什嘛的还不错~种类挺多的，适合聚餐，满足个人需要么~','128','2011-08-18 20:47:00',NULL),
	('13b829098a3f8cb8deb9fa9dcbc45ca6','abeba4642580b2ac9e4ad16baa70047e','思宇16','5',5,5,4,'最好吃的当属帝王蟹，蟹肉里的汤汁很美味别的拿了好多杂七杂八的东西，味道真的一般般三文鱼还是嫩的，吃的还是开心的哈根达斯也算OK，提拉米苏也很好吃，靠窗的风景真的不错，推荐菜:哈根达斯帝，王蟹三文鱼 就是东西有点贵，一般人可吃不起，像我们这些小职员，只有老板请客时，才会进这行高档的餐厅。。。','218','2011-10-06 20:42:00',NULL),
	('14e9e12b494fcf114542ebd2388f7502','abeba4642580b2ac9e4ad16baa70047e','火苗火苗','1',2,3,1,'以前因为离家近经常会去，没有多跟服务人员打过太多交道，结果某次银行搞活动定位子，居然被忘了登记，结果就是相互推诿，经理连个面都不出，让消费者自认倒霉！！！菜品别家也有相同水平，上次去帝王蟹也不提供，这次又如此差的服务态度，看样子以后还是少去！吃个饭弄的一肚子火！！！','0','2011-11-22 13:22:00',NULL),
	('15a3cac0859bc3e090a742522e867da8','abeba4642580b2ac9e4ad16baa70047e','有水的彩虹','5',4,4,4,'是和朋友聚餐的好地方，环境好，中午人不太多。不管是中式还是日式，口味都不错，还货真价实。就是我们的肚子不能吃那么多。','0','2011-11-06 11:37:00',NULL),
	('19b4cdfcfd8b04b868ca0963c6a4ed3d','abeba4642580b2ac9e4ad16baa70047e','粉红拖鞋','2',2,4,2,'海鲜很多~但基本都是生的~也不太新鲜~熟的不好吃~~反正高级的菜很多~什么海胆~生蚝~鹅肝酱的~~但真的不好吃~~可能是我吃不惯~~最好吃的是哪个芝士南瓜~~喜欢吃海鲜的应该不错！反正我不爱吃！2个人350块~还是搞活动优惠了100块钱~这么贵不如去吃臻尚品~','168','2011-07-27 16:35:00',NULL),
	('1a056315cba5d3bdbb7ed69f7250b114','abeba4642580b2ac9e4ad16baa70047e','seraph_zt','4',3,4,3,'总体是不错的海鲜自助。三文鱼供应的很足，很新鲜。甜虾也很好吃。鱼的种类也多，不过是在是吃不下了。提拉米苏很好吃，是甜点里最好吃的。鸡尾酒也挺好喝的。','160','2011-11-13 10:35:00',NULL),
	('1a34f5a6b5952eb608d0b3c5c77fb851','abeba4642580b2ac9e4ad16baa70047e','Cherylxc','4',3,3,3,'和朋友中午去吃的，价格还可以，晚餐好像还有优惠活动，可惜晚上就要离开南京了。无意中知道南京开了家喜多屋，在上海没机会去品尝，终于如愿。我们吃的最多的还是刺身，甜虾真的不错，但是三文鱼有点奇怪，像是没带肥，都是一种颜色，口感就欠缺了，生蚝是特色，看上去很肥美，我还点了银鳕鱼，可惜最后上来的是油炸过的，鱼肉其实不多。里面还有些粤式的小点心，哈根达斯经典味道都有的。基本上什么菜式都有的，不过还是没太达到我的期望，所以下次准备换到四海一家看看','173','2011-10-10 22:13:00',NULL),
	('1c07ce54030493d87e751a8a11488448','abeba4642580b2ac9e4ad16baa70047e','feeling87','5',5,5,5,'非常喜欢的一家店喜欢他家的鲍鱼鱼翅各种各样的螃蟹提拉米苏做的非常好哈根达斯随便吃！现榨果汁很新鲜虾饺皇经常一抢而空总之我目前最喜欢的一家自助！！！','0','2012-01-09 16:43:00',NULL),
	('1e1b3e9592fd20a088025c81eaee1553','abeba4642580b2ac9e4ad16baa70047e','njzh3330','5',4,4,4,'开业时去过一次，这次是第二次去。四海一家去了太多次，审美疲劳。昨天中午和老婆突然想腐败就想到这家了，去了发现平时的午餐才128，性价比很高啊。店内人不算很多，店堂不是很开阔但是感觉氛围还不错，不会太嘈杂。食材偏向海鲜，我们虽然不不怎么吃但是其他菜品也还可以，特别是碳烤生蚝，比四海的鲜美多了，后者寡是蒜泥味。还有佛跳墙，爆炒海参，牛鞭汤等等都是四海没有的。中午虽然才128，但是哈根达斯还是不限量的，而且一次可取两个球，这点不错。看来后面一段时间我们定点自助餐就非它莫属了。感觉喜多屋没啥广告也没啥促销活动，但是如此低调应该是不缺粉丝的，下次继续支持。','128','2011-10-29 22:21:00',NULL),
	('020e5c5ca277453695f50e584e26bddc','acbcc25837383d2d975a4713170b67b5','ww.wenjing','0',3,2,2,'小时候就知道的酒楼，那时候代表高档，现在的价格早已飞入寻常百姓家，每次回太原必去喝早茶或吃夜宵，狂喜欢他家的凤爪，总也吃不够，总被同学笑话没出息，约地儿吃饭就是唐都，有过一人吃5笼凤爪的记录。不过吃来吃去，总是那几样菜，凤爪、皮蛋瘦肉粥（多放脆皮少放葱），','0','2007-04-22 11:44:00',NULL),
	('0249cfe9cb7c4d936bf1ff4390b69011','acbcc25837383d2d975a4713170b67b5','麦唛兜兜糖','4',3,2,2,'去吃过一次夜宵虾饺和烧麦还不错皮蛋瘦肉粥一般般人不少，服务员忙，服务不是很周到，不过可以接受啊！！！！！！！！！！！！！！！！！！！！！！！！！凑字数啊凑字数','0','2011-03-26 09:38:00',NULL),
	('02b7b45379473a649cd2bc0510b8fb57','acbcc25837383d2d975a4713170b67b5','momo1984','0',3,3,2,'我喜欢这里的早茶，那么多好吃的，比北京的广式酒楼做得要好吃，没去过广州，正不正宗就不知道了。最爱吃凤爪，虾饺和排骨','35','2006-10-04 15:54:00',NULL),
	('03cafc627676c1f5a72aa3478f89feeb','acbcc25837383d2d975a4713170b67b5','BathingAPE','4',4,3,3,'吃宵夜和早点非常不错的地方。尤其是宵夜。远近闻名。在太原没一个不知道的。至于中饭的话应该和其他饭店大同小异吧。','50','2010-01-19 02:54:00',NULL),
	('0d5284d0e89e6df46b66d8433948939d','acbcc25837383d2d975a4713170b67b5','行吃','0',2,2,2,'太原老字号了吧,吃早晚茶的前辈. 不过东西说实话真的一般,人又多乱的很,已经很久不去了. 还是推荐到太原的朋友去试一试,说不定有适合你的东西.','50','2007-10-02 10:58:00',NULL),
	('10a6bc51fb8038f9743c918b9486255c','acbcc25837383d2d975a4713170b67b5','lovelyrouyan','0',3,2,3,'这里能说什么呢 简直就是童年记忆嘛 小时候妈妈爸爸经常带我吃早茶夜宵 那时候估计也算奢侈了吧 吃一次就得100多 正餐贵的离谱 导致这么多年过去我姥姥还惦记贵巴巴的一盘饺子 那时候笼车分为超点 大点 中点 小点 小时候我们爱来一壶菊花加糖 然后点上凤爪 奶黄包 莲蓉包 炸馍馍沾上炼乳 再来碗皮蛋粥 那时候觉得那个粥特别香尤其是那个脆皮 现在没人陪我吃了 晚上一人溜达去 东西还是那些 味道也没变 但是却不香了 那个兴奋的感觉也没了 变成简单的满足口腹之欲 爱喝的茶也从一大壶随便喝（但是收茶位费） 到两元一杯（那种喝茶的杯子 啥也有 不单纯有菊花和糖） 到现在几十一壶 大点也从以前5元 变到现在8元了 但是变得很平民了 旁边的小唐都也拆了 真是时间飞逝人不是当时的人 物也不是当时的物了 顺便说下 想吃正经的正餐 这里就算了吧 没惊喜没特点 还贵','0','2009-08-14 16:27:00',NULL),
	('16810d512453fc54b0acdfa5860391e2','acbcc25837383d2d975a4713170b67b5','Iceicy','0',3,2,2,'老饭店了，从我有记忆以来就有这家饭店。正餐水平一般，早茶远近闻名，从小的早茶几乎全在这里吃的。小笼凤爪，皮蛋粥，素包子和叉烧包是每次必点的。','0','2006-06-08 13:03:00',NULL),
	('1828425dbb1c3521c933a422c3c7bc61','acbcc25837383d2d975a4713170b67b5','爱吃章鱼的猫','0',4,4,4,'看来我真的是老了！连唐都都变成了“老店”……记得以前中学时吃一次唐都的早茶都觉得很奢侈。后来每年回家都和老妈来吃，吃饱了还要点很多很多打包回去当早餐，从来不觉得腻。最令我感叹的是这里的桌布从来都是现洗现干的棉布，温馨多了，不像别的酒店在上面铺一层讨厌的塑料膜。为什么会有人说唐都的小点不好吃呢？我觉得应该是南方人不习惯这里的口味吧，因为我后来也在广东吃了很多家“正宗早茶”，倒是觉得不如唐都。再说了，吃东西也要看性价比不是？唐都现在绝对是百姓消费。','30','2007-07-10 13:13:00',NULL),
	('018184dfea91047767964a66a7a215b8','adde0152d6ed4468167ed3f7658cd028','CUICICI','0',4,5,5,'我非常喜欢的解馋的地方。结合了中餐，日餐，西餐的精华。尤其是河蟹可以吃个过瘾，还有就是生鱼片种类很多，现煎得牛排味道好极了，总之是很好了，就是价位也比较高了。','133','2007-09-05 15:32:00',NULL),
	('08e7fc89a73b6bc94c0810226ec85c64','adde0152d6ed4468167ed3f7658cd028','momoz','0',4,5,4,'吃得是自助,口味环境都很好,面包味道很正,鱼生也很新鲜.','150','2006-02-21 11:41:00',NULL),
	('0aa1d68c34ab883eb5fa51c2b3a8b51b','adde0152d6ed4468167ed3f7658cd028','勇敢的鱿鱼','0',4,4,5,'明月加美酒，在这里吃西餐，价格不贵，物超所值，五星级酒店的用餐环境也比其他地方要好的多','128','2006-10-25 20:37:00',NULL),
	('0da7c705569f17f87cd89aa1dd7e560f','adde0152d6ed4468167ed3f7658cd028','fatyue','4',4,4,4,'感觉不错 最重要的是环境好 吃的开心最喜欢的就是甜品了 蛋糕 小点心 总之很好吃冰激凌是我的最爱 每次都会吃好多的','0','2010-08-25 19:38:00',NULL),
	('0dbc73228434b886bfd1e47324808231','adde0152d6ed4468167ed3f7658cd028','糖兔兔','0',4,4,5,'去吃了很多次了，一直都没来得及上来点评，昨天晚上又去了一次，今天趁有空就写一下了，呵呵……三文鱼很新鲜，每次去都会吃蛮多的；烤羊排比烤牛排好吃；三文鱼也能让他们烤；还有很多油炸的东西，不过就骨肉相连和玉米芝士饼好吃；另外那里的水果、点心很是丰富，可以吃到不少好东西。而且现在又新增了鲜榨蔬果汁的服务，可以尝到的饮料就更多了。那里的冰激淋也不错，除了可以直接取食外，通常我还会要一杯咖啡，然后把冰激淋放进咖啡里慢慢享受，呵呵……好喜欢那里的气氛，让人感觉很舒服，也不会像其他高级西餐厅给人拘束感，这里的服务让人感觉很亲切。','0','2008-07-06 13:13:00',NULL),
	('0dd60a95c6dc56a5754db6eb584d4cfa','adde0152d6ed4468167ed3f7658cd028','大连老宋','5',5,5,5,'这里可以说是大连最好的自助了~~~~转两张优惠券晚餐的，两张450~有意思的联系15940861072 QQ54214941','340','2011-08-15 10:03:00',NULL),
	('10caf6138d330a86fbb3753f3e6771f0','adde0152d6ed4468167ed3f7658cd028','yingtaomeimei','0',3,3,3,'在那开会有幸吃了一顿，让我自己花钱肯定是不去。太贵了。环境真是没得说，不是硬件环境，软件环境也好。一般的自助餐都是闹哄哄的，这里环境很好，特别安静。吃的也很有档次，推荐牛羊排，生鱼片','0','2008-10-13 10:33:00',NULL),
	('1145b879dd643894bab1834e11119844','adde0152d6ed4468167ed3f7658cd028','缘在天下','5',3,4,5,'这里环境是星级的待遇,有一定的格调和气氛在里面,吃起东西有也胃口.自助方式适合胃口大的朋友好去处.食物味道还是比较不错的.','0','2011-09-11 11:16:00',NULL),
	('164e8d7087edf88c074fb91bb1aca9bd','adde0152d6ed4468167ed3f7658cd028','精灵滔滔','0',2,2,2,'没有香格里拉的自助好，性价比不高，档次也不高，甜点算不上五星级的标准，冰淇淋里带冰粒不够纯。还要收取15%的服务费','150','2008-01-01 11:55:00',NULL),
	('18ef6d1614211b9160b620eb1e078407','adde0152d6ed4468167ed3f7658cd028','想吃问我','4',3,3,2,'最近每次来大连，总要来这里。主人有点小资，喜欢这里，我认为也不错。中午和晚上各有各的感觉。环境嘛不错，堂皇典雅，在酒店的二楼，通透中略显奢华，临窗而坐，感受城市的繁华、梧桐很美（想当初还在大连读书的时候，就非常喜欢高尔基路两旁的梧桐树）品种还算丰富。刺身依旧是我的最爱，虽然品种不多、三文鱼、金枪鱼、北极贝、象拔蚌、鲷鱼、赤贝，还有寿司。隔壁是一些日式煮物等的吃法，营养可以尝试，更多的海鲜白灼，虾、蟹、扇贝、虾爬、海螺、。。。。。等等，凉菜小吃，也挺特别。热菜一般。不过各类的面食、烧烤，倒也说的过去，有洋厨师，替你现场制作加工，尤其是现场烹制的牛扒，味道不敢恭维，但过程确实值得享受。甜点的品种尚可，制作也算精美，值得享受，尤其是麦包，外脆里松，去掉内瓤，加一点果酱，很爽口。的确，果汁、茶和咖啡等饮品，可以让就餐的感觉瞬间升华。','240','2010-05-31 13:39:00',NULL),
	('1e027a25527e2367b681483bebee0ba3','adde0152d6ed4468167ed3f7658cd028','红楠','4',3,2,3,'冰淇淋有一种是开心果口味的，还有各种果仁、巧克力、糖浆可以撒在上面甜品区有五颜六色的橡皮糖，吃饱了可以抓一把坐着慢慢嚼','0','2010-03-02 12:30:00',NULL),
	('021e4392f97df6dffb5e72df680f02ae','b21dbc400a73347e57d1af9e686157f7','满盘肉肉','0',3,5,3,'住在亚龙湾就是吃饭不太方便，这家应该算还能接受的了，环境、价位、服务都算上乘，看点评上也是褒奖多过批评。亚龙湾这半区跟五星级饭店云集的那半条街相比，由于有景点儿，团队多，总体价格还算便宜。仙人掌又是二线海景酒店，要真再卖个高价也不会有太多人光顾了吧。要了清炒五指山野菜、红烧海鲤鱼、菠萝加积鸭，榄菜炒饭，抱罗粉，三个人居然还没吃完、加积鸭肉和菠萝的比例差不多一半一半吧，感觉还行，也没什么土腥味儿。鲤鱼挺实惠，一斤多一条，肉质鲜美，好吃。炒饭是一个类似小砂锅似的容器，正好仨人吃。总结一下这家的性价比应该能上90分吧\\(^o^)/','100','2009-09-20 20:37:00',NULL),
	('045d7782ce2d5fcb641659024de0a5b4','b21dbc400a73347e57d1af9e686157f7','yaya4093','0',4,5,4,'在这里吃了早饭和BBQ早饭么，还算好，就是人太多，有时要和别人拼桌很喜欢他们的红茶加红糖晚饭的BBQ，很不错~~~环境超级美：大厅外是泳池灯光加音乐喷泉，还有乐队的演出。菜的质量和味道都不错，三文鱼吃了很多，还有好吃的烧烤~~就是烧烤的人太多了，比较慢水果尤其好吃：木瓜杨桃芒果~~菜稍微一少就会有人添加，而且服务生比较勤快，很快的收盘子这个价格的BBQ很不错了~~~很喜欢','148','2009-04-24 18:46:00',NULL),
	('061d0d0aaf77ca1e250772d7b4e613b5','b21dbc400a73347e57d1af9e686157f7','积极YY','0',4,4,4,'天天上午的自助早餐在那里吃的，品种和味道还是可以的，在亚龙湾算价廉物美的了。在那里吃了顿自助游套餐里送的一顿免费晚餐，两人份的量，绝对够饱和好吃，价值应该在250左右吧，合算！露天餐位周围就是号称亚洲最大的游泳池，外加彩色喷泉和歌手演唱，用餐的感觉还是不错的。','0','2006-11-07 10:16:00',NULL),
	('0ac4f57bbb023aeee538ec68b95e8a11','b21dbc400a73347e57d1af9e686157f7','咔咪','3',3,4,2,'如果只是住酒店送的早餐的话,或许我会给满分,自助早餐的种类很多,量也补充的很快但是自己消费吃东西的话实在是性价比太低了,东西不怎么好吃,而且超贵,还要加收总消费12%的服务费,如果你不介意每一顿饭在200左右的话,可以无视','100','2011-04-12 16:38:00',NULL),
	('095a19eec94701fe2d915ca6172c1eeb','b21dbc400a73347e57d1af9e686157f7','减肥的小肉包','4',3,3,2,'住酒店送的早餐，这顿早餐是我在三亚最满意的一顿早餐。食物品种又多，味道又好，环境也好，很满意。下次去三亚还会光顾这里。','88','2010-01-26 16:40:00',NULL),
	('0dfacf08a2fc9a8e61aab68116d06ad8','b21dbc400a73347e57d1af9e686157f7','月色江声','2',3,3,1,'这个餐厅其实菜味不错，但服务实在太差，收12%服务费，一次也没来续水，也一次没换过骨碟，倒是我老得催菜。我们两个人吃完了，第三个人菜还没来。价格嘛，有点脸皮厚，青椒土豆丝48元+12%，小羊肉串14元+12%，其它就不用说了，主要是仗着周围没竞争吧。','90','2012-02-09 20:49:00',NULL),
	('11c978d0c0a2f30af44dc171b4ce61d8','b21dbc400a73347e57d1af9e686157f7','szhow','0',3,3,3,'看网上的点评不错，特意从天域打车到仙人掌，环境不错，门窗都敞开着，很舒服：两个人点了一份福州炒饭38元，料蛮多的，好吃；菠菜炸酱面，一小碗22元，咸了点；著名的冬瓜海螺汤36元，汤很浓，味道还行；蔬菜是油麦菜。吃完了要了一份水果拼盘28块，是西瓜、哈蜜瓜和火龙果三种拼成的，西瓜最甜。服务也不错，换骨盆很勤，说起话来细声细语的，表扬一个：）','80','2007-11-16 16:02:00',NULL),
	('128801f1d33c4557210883fed2769c6a','b21dbc400a73347e57d1af9e686157f7','冷笑话小姐','4',3,3,3,'从蜈支洲回来后来太累了，就在酒店吃了。点了两个菜，一荤一素，本以为不够吃，结果一上来，份量太足了，最后我和老公吃了两碗饭都没把菜全部吃完。价钱有点小高，但是也能接收，没酒店送餐服务的菜品便宜。烧烤中的玉米很好吃，连续三天夜宵都吃了烤玉米。味道还不错，椒盐凤尾虾很不错。服务员态度很好，可以刷卡和挂账。','100','2010-08-13 18:51:00',NULL),
	('169629c90b62c720f7729667b6729f42','b21dbc400a73347e57d1af9e686157f7','珀琳','0',3,4,3,'亚龙湾性价比很高的一家早午餐厅 入住客户加订早餐是60/位 早上到10点会收餐 但如果你愿意 10点以前拿好足够的食物 一直吃到中午也没问题 没有服务员会给脸色你看哦 早餐品种较丰富 喜欢酸奶、煎鸡蛋、黄油烤面包、炒面 坐在外面靠近喷泉旁的露天位 早上微风徐徐吹过 非常惬意啊','60','2009-04-03 00:04:00',NULL),
	('1c25191def41baa722dde7404e9f0d0a','b21dbc400a73347e57d1af9e686157f7','璇宝宝_Elaine','4',4,4,4,'在飞机上看夕阳，迤逦惊叹！昨天“纪念日”到达亚龙湾！入住“仙人掌”酒店的玛雅风格夜景，浪漫令人陶醉~~ 当晚在畔湖餐厅随便吃了一点之后每天都在畔湖餐厅吃早餐，住的房间就在对面，几步路就到了，真的太方便了！','0','2010-10-28 18:25:00',NULL),
	('1ac618235a8f7108ecc927a868e6fb3b','b21dbc400a73347e57d1af9e686157f7','雪褥织影','4',4,4,5,'特色的那个白切鸭子肉非常瘦 沾酱很香 海南鸡饭和想象的不一样 味道也还不错 五指山野菜汤比较鲜 抱罗粉感觉一般','0','2012-01-01 18:57:00',NULL),
	('1d843a700c843af0a5e6c7ad750feacc','b21dbc400a73347e57d1af9e686157f7','lilian_zhu72','0',2,3,2,'口味实在是一般，因为住在这个酒店，没有什么其他选择，菜价很贵，服务人员服务迟缓，买个单也要半天，下次不会去那里去吃饭了，一次就已经足够了。','100','2009-10-06 08:05:00',NULL),
	('0313722acbbd13539d5c38a636858df3','b4b8ed3e5915dce57645b89528a6dcac','轻松熊轻松','3',3,3,4,'这是朋友请客去的，而且用的券不知道多少钱。环境还可以挺好，但是吃的种类很少，就那么几排，三文鱼挺好，要和厨师要，河蟹我吃挺多很新鲜，还要了好评的芝士小蛋糕，很浓很好吃。但总体来说根本吃不回来，用优惠券还可以去尝尝。','0','2011-12-24 23:02:00',NULL),
	('0d0894af50e791cc21431d6ceea8dba4','b4b8ed3e5915dce57645b89528a6dcac','huanyuxun','3',2,3,4,'五星级酒店里很一般的 自助 菜品少的可怜 客人也不多 也许是大连消费 还是不理想 菜品质量还可以 不精致 味道~也就一般 不会再去 服务很好~','200','2010-04-22 17:11:00',NULL),
	('128ed7c9bf41f9a9c81f9a88e0b2de4f','b4b8ed3e5915dce57645b89528a6dcac','大风车转呀转','3',2,3,3,'他家的东西原材料都挺好的。哈哈~至于好不好吃就见仁见智啦~我感觉还行，花多少钱忘了，因为不是我付钱···其实我挺喜欢吃他家的意面的，酸酸的感觉不错呢','0','2011-09-26 19:32:00',NULL),
	('183a1e15a39baab104b29e32b7f0d33f','b4b8ed3e5915dce57645b89528a6dcac','天下萌','4',3,3,3,'不知道现在价格多少了，开始没觉得特别，但是各家酒店的自助吃一圈，发现香格里拉到底还是有点底蕴的。餐品和服务在大连还是数得上的。','200','2012-01-16 13:56:00',NULL),
	('189a3aa1d7017ac39d3cd2fce1b04589','b4b8ed3e5915dce57645b89528a6dcac','全能选手','5',5,5,5,'还是大连最好的五星啊，情人节价格888，菜品还算可以吧，稍微贵点，菜品和平时差不多，座位离的太近了。','888','2012-02-14 18:57:00',NULL),
	('1af824aff67f9b5f12cbbc81d5dd1f23','b4b8ed3e5915dce57645b89528a6dcac','心随佛愿','4',3,3,2,'【试吃/体验点评】朋友请客去的,感觉环境一般,服务也一般,服务生的表情非常丰富,喜怒全在脸上,没吃到网友们热评的提拉米苏,也没有吃到螃蟹,三文鱼的新鲜度也是一般般,咖啡味道纯正.','0','2011-12-22 13:54:00',NULL),
	('1e1fb997ccc19db145d3115f2345cd15','b4b8ed3e5915dce57645b89528a6dcac','我是王猫猫','4',3,3,3,'一般去吃自助，吃不了什么东西炒菜类几乎一点儿不动主要会吃点儿日式生食再就是大连海鲜俺在吃这上面有个很大的怪处女人都非常爱吃的甜点俺反倒很一般 以前几乎一口不吃，现在有点儿进步了，可以吃上几口就这样，日航自助的哈根达斯俺也只是就吃了一小杯哦，跑题了，怎么到日航了~~~~晚上的自助我还是很喜欢哒首先，环境就还好，吃的，日料还不错而且，这里的牛排我觉得很好吃啊~~~~竟然吃了两大块再其他的，我就不记得了','0','2010-12-06 19:02:00',NULL),
	('076687435444e4f22bdf58f8dfb28781','b4cd747fc76030d0ef29d2b8a24d1d05','宜人冬季','3',3,2,3,'有机会去的亲一定要尝尝蜜汁鲈鱼，做的没有腥味挺有特色，糖醋小排一般般啦，和别的地方的都差不多，弯弯鸡就好像自己清炖土鸡，如果懒得食客们倒是可以偶尔来吃一下补一补，尤其是住在附近的刚刚有小孩的妈妈们，可以每天点一锅回去，很滋补滴，那个鹅肝炒竹笋，除非是非常非常喜欢鹅肝的亲可以尝试一下，否则一般口味的还是不要挑战了，感觉受众面还是比较小的，鹅肝的腥味实在是受不鸟，哎，几乎这个菜就没怎么下口，浪费哦。','80','2011-06-15 12:23:00',NULL),
	('0908ed573b3103ec43382291802e0a6a','b4cd747fc76030d0ef29d2b8a24d1d05','呜哩哇啦嘟嘟','4',3,2,2,'国庆节加班的时候，同事一起来吃的门脸很小的样子，里面环境简单菜品味道不错弯弯鸡肉质鲜嫩，鸡毛菜调节肉香蟹粉豆腐、糖醋小排味道很好下次再去吃吃别的','30','2011-11-12 16:48:00',NULL),
	('0aaab490b65604a9338cb75f0223e52d','b4cd747fc76030d0ef29d2b8a24d1d05','吉日甜品','4',4,3,3,'鲈鱼，鸡，鸡毛菜是每桌必点的．很奇怪，无论几个人吃饭每桌都有这三道菜．我们本来也点了糖醋小排，但吃到一半退了（原因是每次遇到都会退菜的原因）．不过这个菜确实很一般．后来又加了个山药卷，倒是很好吃．还有看到另外一桌点了木瓜什么的．就是木瓜里面酿了如果冻般的东西，然后再将木瓜切角，就跟2色木瓜一样．下次要试试．鸡汤很好喝，很大一个砂锅炖鸡价格38．最喜欢的是鲈鱼，酸甜口，烧完用锡纸垫着在酒精托盘上烤着，所以皮很脆．价格不贵48','50','2011-07-25 16:59:00',NULL),
	('0d5e4b255d9c8195828bdc7efe809f88','b4cd747fc76030d0ef29d2b8a24d1d05','MO小茄','4',4,2,4,'江浙口味，那个鹅肝竹笋还是挺好吃的，还有糖醋小排，就是分量不是很大。水煮鱼一般般啦，这种菜不应该出现在这种店吧，没几片鱼啊。。猪手炖的很入味。。总之很不错哒。价格比较公道。','60','2011-06-30 00:18:00',NULL),
	('0ebd2cddba92adcdc13fcc5e8d32260d','b4cd747fc76030d0ef29d2b8a24d1d05','yaourtcc','4',4,2,2,'单位就在附近，经常过来吃，价格还可以接受口味比较清淡，很喜欢，是江浙菜系，菜量不大，口味有点偏甜服务员都很酷，脸很僵，不喜欢','60','2011-10-16 19:34:00',NULL),
	('1145b34a77b4627a2b034863d0fbf402','b4cd747fc76030d0ef29d2b8a24d1d05','日光之霜','4',3,2,2,'典型的江浙菜吧~~ 因为在杭州呆得时间久，经常大伙儿一块出去吃。。所以看见菜单觉得有点儿乏味啊。。传说中的鲈鱼味道还可以吧。。感觉加了很多白醋和番茄酱~ 鸡毛菜还比较嫩，在北方能吃到这个程度不错鸟。。。菌菇汤一般，比较素，应该加了不少味精调味。。据说还挺火的，大家可以提前订位。。','50','2011-11-05 16:18:00',NULL),
	('181fc7d3a1db29e440e49381303cc4f5','b4cd747fc76030d0ef29d2b8a24d1d05','fccalex','4',4,3,4,'老公单位在那附近，经常路过却一直没去吃，正好有机会去试试，第一次是中午去的，人挺多的，有的是附近上班的，有的是学生。弯弯鸡是主打，两个人去挺不合适，有好几道推荐的菜都吃不全。  第二次和朋友一起去的，五人，感觉菜量小，我们点了两次菜，如果都是男的，估计还得再点啊！而且到了晚上，糖醋小排这样的“名菜”就断货了，有点遗憾呀~  看来以后得早点去，不然好多菜都卖没了呢！','50','2011-01-27 15:43:00',NULL),
	('1878b0e81ca53ae91bbce93f6011a22b','b4cd747fc76030d0ef29d2b8a24d1d05','sofie84','5',4,3,3,'【试吃/体验点评】就在单位附近，上海菜，味道不错的南方菜，秘制鲈鱼一般般，用大众卡还可以打折的呢，屋子很小的，需要预约，上海菜上海菜','50','2011-06-04 13:34:00',NULL),
	('19c3b3ab015a2d7a434dfd92f064ead7','b4cd747fc76030d0ef29d2b8a24d1d05','wind_002166','4',4,3,2,'鸡毛菜很爽口很好吃，对于吃多了大鱼大肉的，点一道鸡毛菜还是不错的。糖醋小排味道还可以，外婆红烧肉比较腻。弯弯鸡很嫩，味道淡淡的一点都不油腻，手剥笋建议不要点，一般人吃不惯的。每次必点的上海酱鸭，非常非常好吃~','60','2011-10-19 12:06:00',NULL),
	('1a60912ff69f35a2d2443a472f680a8d','b4cd747fc76030d0ef29d2b8a24d1d05','醇香','2',2,3,1,'换厨子了，那秘制鲈鱼都成了鲈鱼干，弯弯鸡也不够烂，鸡毛菜看着像是细油菜，比鸡毛菜粗多了（也可能是杂交品种）。上菜速度奇慢，旁边两桌都是没等菜上全就走了，我们要不是因为带着孩子了，也不等了。问服务员，说厨子是刚招来的，以前的厨子不来了。哎.....','50','2011-03-18 22:54:00',NULL),
	('01d79e086014f939128735d56e94ab14','b4d056d5be8443367061a76df2bd5a9e','雁妞','4',5,4,4,'还真是蛮奢侈的感觉，享受吃三文鱼吃到吐乐，哈哈上星期六中午去的，享受特别优惠价，到的有点晚，吃的赶了点。。。刺身非常新鲜，最爱三文鱼，点了无数份，也吃了不少，最后太贪心 布丁非常嫩，美味啊美，总之就是吃的非常满意。','0','2011-12-22 15:19:00',NULL),
	('02d5fd471fea0a315af8687ce34ff8e7','b4d056d5be8443367061a76df2bd5a9e','踏莎美人','2',3,2,2,'看到他家，就有故事说来，首先在一个特别的日子（情人节），因为功课没做好所以初花和王鼎就没约到位置，网上搜了下就来到了他家，进了门看看人倒是不太多所以等了，期间看到一个做小生意模样的中年人走来走去忙着招呼客人（不多时听到中年人对服务员说送朵玫瑰花给靠窗那队情侣让他们赶紧走把位置空出来）哪有用玫瑰花棒打鸳鸯的（过分，人家谈谈情容易嘛）。点菜还算顺当，上菜时我又领略了老板的经营哲学，一般的菜品正常，稍贵些的（等就一个字我任你催一万次）。之后嘛，你懂的、、、','188','2011-10-17 21:45:00',NULL),
	('03494a5639194baa500325603c886cf1','b4d056d5be8443367061a76df2bd5a9e','歪几歪几','4',4,5,5,'【点评团消费】团购买的 买好了发现dper的评价都不高 说是会换菜但是今天中午去吃的还蛮好的呀 人不多 菜基本没换只有小鱼干没了 换了一份薯条 无所谓的反正海胆什么都吃到了 刺身拼盘的材料都很新鲜','79','2012-02-13 16:29:00',NULL),
	('045a5f4dabb48127a3937ad08ccbad91','b4d056d5be8443367061a76df2bd5a9e','karen37588','5',5,4,4,'下载了优惠券原价188元/位优惠价168元/位比较实惠，原料特别新鲜，这就是我比较喜欢他家的原因，环境也很清清爽爽，卫生整洁，寿司，甜虾，都做很赞，味道上可以，也许是因为对料理不是很陌生了，环境很优雅，这里特别要说的就是它家的蹲式服务很让人有亲切感，个个面带微笑，下次一定会再去的。','168','2011-12-21 13:56:00',NULL),
	('058c3aee1bab5b4c7b7b46d72e380f34','b4d056d5be8443367061a76df2bd5a9e','marmelade825','3',3,2,2,'网上看到环境照片还挺不错的就和公司同事一起来了，到了才发现其实环境很一般。菜色其实一般，没有王鼎那么的丰富。服务员态度还可以，上菜速度也还可以。不过设施实在是太差了，空调就是个装饰品，不吹冷风的，吃火锅吃烤肉吃的热死了。最后开发票的时候，分开开了2张，说是因为开发票的机器有限额，最高只能开1000元，也不早说。总之，真的很一般，可以随便吃吃，但是商务宴请什么的就算了。','188','2011-10-09 08:17:00',NULL),
	('069be69b105f1882881bb3d6afe2145e','b4d056d5be8443367061a76df2bd5a9e','苜蓿叶子','4',4,3,3,'本着晚餐不宜多吃的原则，没有开日料，没有开自助，就是随便点了一些烤肉。牛仔骨，上等小牛排，猪颈肉和五花猪肉。最喜欢的还是牛仔骨和五花肉。猪颈肉很嫩，但是有点厚，不太好烤。牛排就那样吧。肉不多不过吃得很欢快。还想再去一次喏~','100','2011-12-08 23:31:00',NULL),
	('07da5d440e9a23528722c8baf629aed3','b4d056d5be8443367061a76df2bd5a9e','yuuki88','4',4,5,4,'原本是冲着他又优惠券，点评也不错去的，谁知到了那，服务员说，午市自助本来就是158，根本不用优惠券秉着吃日料就是吃刺身的原则，我们共吃掉了三大晚的刺身，十足过了把瘾。这家店的刺身十分新鲜，肉质很能，主要还很厚，绝对的一片顶两，三文鱼当然没话说，金枪鱼和白金枪鱼也很不错烤鳗鱼端上来不是很热，量也不多，只有三小块，但是烤鳕鱼却是有很大两块另外觉得肉一吃就饱，也就没有开烧烤环境不错，推荐尝试','158','2011-11-05 18:28:00',NULL),
	('0d6a57e5b07670e8682f658e1226a6e9','b4d056d5be8443367061a76df2bd5a9e','zzp的宝贝','5',3,3,4,'看之前的评价说是门店生意不怎么样，去之前还担心他家的口味不好，但是尝过之后，本人和老公都认为还是不错的。服务相当的到位，很及时的更换骨盘，而且不会随便打扰客人，上菜的时候彬彬有礼的样子，席间我和老公在拍照留念，上菜的服务员就很安静很耐心的在边上等待以防打扰到我们。当我杯子里的饮料快喝完的时候，服务员也很及时的上来问是不是还需要饮料，总之服务很周到热情，不像之前评价的那么不好，可能是改进过了吧。说到菜品，他家也算是比较丰富的，刺身，烤肉类的样样有，刺身也是比较新鲜的，烤肉的话可以自己动手也可以让店家代烤，口味都还不错。不过不知道什么原因他家的生意倒真的不怎么红火，也许是因为客人都冲楼上海底捞去了吧，所以上来给他家打打气，本人认为花水木还是不错的一家日料店','158','2011-10-21 12:06:00',NULL),
	('0da87020a2b748844a46308c143699d3','b4d056d5be8443367061a76df2bd5a9e','心之翼','5',5,5,5,'朋友从国外回来在此小聚，用餐十分愉快。环境确实不错，柔和的灯光，安静的氛围，可以很放松地进餐聊天；食材很新鲜哦，三文鱼咬下去的质感相当好，银鳕鱼也十分入味，我其实不太爱吃肉类，但是这次也忍不住多吃了几块嫩嫩地牛肉和五花肉。总之不虚此行，下次还会来哦。','188','2011-12-21 09:09:00',NULL),
	('19a28b709f4c854ef38f322199392ae0','b4d056d5be8443367061a76df2bd5a9e','牙牙3','4',5,4,4,'本来不太吃日料的仁自从上次吃了几次后就深深爱上日式了（虽然日料水太深－－）于是开始找好吃的日料店。。然后朋友介绍了这家说这家的三文鱼和烤肉都不错的。。于是吃货就到点评来搜啦。。正好这家店有优惠券于是快点打印出来电话预定好时间。。拖上朋友就去啦。。。话说环境还是很不错的啦。。。服务因为日料店总归是不错的喽。。。东东么。。。点了朋友推荐的刺身这种和烤肉啊（肉食主义者呀）。。。味道果然很好的说。。。就是希望店家多多搞活动。。然后力度再大点吧。。哈哈','0','2011-12-27 10:00:00',NULL),
	('00d07c185ee96be7aaffac1139e330d9','b563e03d05d074c64f2d16091ca649cf','lovemontoyaf1','5',4,4,3,'订了位所以是窗口的位子，下雨天从窗口看出去很舒服。本来只觉得环境不错，对食物没抱太大期望，结果有惊喜，蛋糕摆盘很漂亮，而且味道很好，要的巧克力乳酪栗子蛋糕，层层丰富，旁边配的蛋糕也很美味，喜欢~以后会再来。','58','2012-01-18 20:20:00',NULL),
	('041b20e660588f93bcedfabdeb73fde2','b563e03d05d074c64f2d16091ca649cf','可爱的天才蛋蛋','5',3,5,4,'菜单上的菜色都八错，挑八过来了，还是点了个套餐，BF看套餐没他要吃的蓝带猪排就单点了，色拉上来之后发现套餐和单点的差好多啊，我的里面都是“草”，呜，他里面好多肉肉，份量也比我的多多了，唉，终于等到肉肉了，大概是心里作用，还是觉得他的好吃，所以我们就华丽丽的换了，哈哈，蓝带猪排果然好吃～～','150','2011-12-30 09:46:00',NULL),
	('076e6c9319e9cd55c39a790d44db3f4b','b563e03d05d074c64f2d16091ca649cf','kimberly6501','3',2,2,4,'说实话环境，口味都非常一般。烟熏三文鱼不是特别新鲜。海鲜汤料也不是太足。环境么真心一般。还好服务还算周到，否则这个价格绝对是坑跌的～','130','2012-01-24 21:57:00',NULL),
	('0919e4273127688d2491d405ce082b77','b563e03d05d074c64f2d16091ca649cf','落雁碧月','4',3,4,3,'第一次和朋友一起在这里吃的法国菜，灰常好吃的菜，不错！环境布置得也蛮温馨的，很舒服的感觉！煎鹅肝，很美味的，鲜嫩细滑，有点要被融化的感觉，很给力的！牛排也不错，用料实在，很赞的！','100','2012-01-15 09:15:00',NULL),
	('09fcf96f82fa1fdb30c0a69b6c3764d3','b563e03d05d074c64f2d16091ca649cf','mozhelm','4',4,3,4,'人很多排了半天的长队才找到位置可以吃东西，和男朋友一起来聊聊天吃吃东西感觉还行。环境挺正式的，挺好的。以后还会来。','0','2012-01-17 18:49:00',NULL),
	('0b6205bbc192f3ffb0ad542c70471596','b563e03d05d074c64f2d16091ca649cf','PLUME27','3',2,3,3,'晚餐的套餐最便宜118 例汤主食咖啡甜品 然后158 依次类推环境是不错的 安静批情操的地方但是食物镇的 完全没有任何印象的那种水准```还是喝下午茶实惠点相对','170','2012-02-13 00:14:00',NULL),
	('0bc003ff66ce9b1311cb2592cd40e6f8','b563e03d05d074c64f2d16091ca649cf','snoopycat','4',3,3,2,'也就去年去过两次,都是下午茶,以后得过来尝尝正餐一次是去年2月,我们8个MM了吧,虽然是提前订位了,可是小小的环境,只能拼桌,其实JJZZ的并不合适夏朵我点的是巧克力核垯+ 伯爵茶,因为怕甜点太腻,所以以茶解甜.一次是去年10月,和好友一道, 也是提前订了位,意外得是给我们留了靠窗的2人位,那天阳光出奇的暖,沿着透明的窗阶,直接洒到身上,甚至还觉得有些刺有些热照例下午茶蛋糕,那个巧克力核垯真的好喜欢,可惜比半年前的缩水了一些,应该不是我的错觉,谁叫通胀呢~饮品这次换了一个啥金萱茶,据服务生介绍,其实也是乌龙茶的一种,可是喝上去,有种淡淡的甜香,却一点不腻,嗲~好友点的是一个啥卷类的香芋甜点,我也挖了一口试试,清甜的口感,嗲~下次我也要试试~最后我们还加了一个新品松饼,这个东东我们两个人最终也就吃完了2/3, 不得不说,性价比太高了,好像是30多元一份,加份冰其林也就多10元吧,可是量很足,完全可以当午饭了麽~ 松饼有些微甜,淋上香甜的&quot;浇头&quot;还是要加速的吃,否则凉了 就&quot;嘎特勒&quot;楼上的小房间稍微参观了下,总体感觉蛮好的,主要是甜点好吃呢~~这个下午的感觉真的很好!','58','2012-01-24 22:32:00',NULL),
	('0d09b47cf9fb2f5b2545db1cab8268f6','b563e03d05d074c64f2d16091ca649cf','独一无二的妮妮','3',3,3,2,'准确的说，是在他们家边上买的mousse cake & cheese cake,据说最好吃的cheese之一，怎能不行动？！先从口感比较淡的mousse开始说，外面是一层几乎没什么甜味的有点玫瑰香的mousse,里面是偏酸甜的不知道是blueberry or cranberry 的mousse, 在一层蛋糕胚里面还有夹着的blueberry，不得不说很有层次的设计，但是吃完一小块还是有点腻; cheese cake 就简单多了，不过不知道为什么我吃得感觉偏咸的cheese, 但是用料很足，所以也不会不喜欢。','70','2012-01-14 19:41:00',NULL),
	('0dec7c1bacf44e4e4d1b16ec31c72a8f','b563e03d05d074c64f2d16091ca649cf','___錵','5',5,5,4,'很不错的地方，上周去的。环境好，服务员也很亲切。千层面味道很好，南瓜汤的味道很浓郁，而且不腻。布丁也很不错。牛排很嫩~~喜欢','158','2012-02-13 20:44:00',NULL),
	('0e213296f23b707a8fb42a8bd28e9096','b563e03d05d074c64f2d16091ca649cf','titigee','3',2,3,2,'我都来了不知道几次了                 就是老忘记来评论                    这里环境很不错                         服务也算不错                          下午茶很好吃正餐也ok','0','2012-02-15 23:35:00',NULL),
	('1102a21caec0e042fa4eb0ad6657548e','b563e03d05d074c64f2d16091ca649cf','拉布拉多','3',4,3,1,'上个礼拜跟闺蜜去的下午茶，到的时候2点多一点，刚坐下，就被告知下午茶特有的松饼已经没有了，好吧没有就没有，那我们吃蛋糕。点了提拉米苏和巧克力蛋糕，蛋糕是不错啦，口感很好，味道也浓郁。就是吃蛋糕的时候服务员没有给我们蛋糕叉，点了咖啡也没有给糖浆或者糖包。好吧这些我们都接受。后来我们肚子有点饿又点了PIZZA，居然上了PIZZA后没有给我们任何的吃PIZZA的刀叉，也没有盘子。。。服务员么动作看上去很生疏，也没有什么表情的，感觉就是来打2个小时工的没有经过任何餐饮培训的人。哎，服务大不如从前。。。','80','2011-12-26 18:35:00',NULL),
	('11bf374819781070d3fcd1fedf51fbed','b563e03d05d074c64f2d16091ca649cf','甜苹','5',4,5,4,'前两天预定的中午，本来以为会有很多人排队，倒是人不多，有点出乎意料。可能是预定的关系，给了我们靠窗的座位。环境还真是不错，尤其是阳光洒进来的时候点了鹅肝炖奶蛋，味道不错南瓜浓汤，不会觉得很腻，味道也不错菲力牛排以及新产品戴安娜菲力牛排，前者我要的是5分熟，后者要的是7分熟，但是明显后者的牛肉比前者好吃，而且嫩，前面的那个即使是5分还是显老，后者还是很好吃的！还点了烟熏三文鱼和芝士蛋糕，还都不错~','180','2012-01-02 00:36:00',NULL),
	('13b0fbc3ba3cde6f2f60e971cb21e1c4','b563e03d05d074c64f2d16091ca649cf','水梦sweet','4',3,4,4,'里面的环境真心的觉得好，非常的时尚。点了一份提拉米苏，后来又点了一份，这家的甜点真的是让人hold不住看到服务员端上来的鹅肝，虽然很小一份，但是看起来真的很漂亮','0','2012-02-06 11:39:00',NULL),
	('18fa9cddf2d3aa837220b549b1a8fcf7','b563e03d05d074c64f2d16091ca649cf','薇薇的岚','4',4,2,3,'老公给我的圣诞节惊喜。。。门口有一棵不大但却很漂亮的圣诞树 starry starry night...等位区，不大，但是布置的很有氛围圣诞套餐贵的坑爹呢。。。红色，银色和白色三种，价格好像分别是RMB498 RMB 376和RMB276。。。我们选了红色和银色，因为白色好像不怎么灵。。。餐前面包，烤的很软很香，那两个酱我也不知道是什么，沾着面包，很好次哦~~但不敢多吃，怕后面吃不下主菜。。。老公的前菜：有蔬菜色拉，一片橙子，黑橄榄，还有个什么，反正不大好吃...But，这个三文鱼奶油卷好吃，很好吃，这样的配搭很赞啊。。。我的前菜，鹅肝，小香饼，冰镇的蔓越莓，的确很冰，像是刚从冰块里敲出来的...鹅肝，很嫩，有点微甜，一点腥味都没有，肥而不腻...超赞的浓汤，我真没吃出来是什么做的，汤里的白色是豆腐。。温温的，不热不冷，还是中式的热汤在冬天里有感觉。。。大虾大概是大明虾吧，我也没觉得很好吃啊，茄汁里面有罗勒香...四周的土豆泥上有松露，很小的几片，香气很浓郁，传说中的菌中之王..我的主菜是羊排，因为老公要吃牛排hiahia...羊排烤的非常不错，嫩的都有汁水了，底下调的酱汁也不错，甜甜的，配羊排下面的土豆泥，哈哈老公的前菜，鹅肝，黄黄的我以为是炒...蛋，结果老公说是炒饭，尝了一口，的确有米饭，但我表示，这味道有点奇怪呀...老公的主菜，牛排，分了我一大块，哈哈，很好吃，七分熟吧，吃下去就差不多饱了餐后甜点，很好次的小红莓，酸酸甜甜的，就是我喜欢的老公的甜点，提拉米苏，蛮不错的，带我走...餐后的饮料是Twinning的红茶，老公要了咖啡总体上，味道，环境还行吧，不过我觉得真不值这个价啊，坑爹的贵。。。阿拉是讲实惠的，这种地儿下次不去了。。。。服务员还蛮热情的，餐后还送了小姜饼。。不过这空调啊，从头到尾都没开是吗。。。吃得我冷死。。。下次再去 去望江阁，哈哈，开玩笑啦。。。。全文','400','2012-01-08 19:40:00',NULL),
	('19cdb8d01c64396d49162668e51ec636','b563e03d05d074c64f2d16091ca649cf','tracyhehe','4',5,4,3,'吃完晚饭去的，装潢风格还是比较中规中矩的欧式，厅的感觉长长的，踏上二楼，老式的木制地板，高跟鞋敲上去的咚咚声都怕打破了这份沉静，晚上幽暗的灯光下墙壁看上去有种烟熏的朦胧感，点的两种可可，一种是70%热巧克力，一种是热可可，热可可香味浓郁，无功无过，特别惊艳的是70%热巧克力(是不是这个名字具体不记得了)，小杯的，巧克力味醇厚浓郁，爱不释口，意犹未尽，值得推荐！','0','2012-01-20 17:45:00',NULL),
	('1b3da78e1618176d31c61081822c95fc','b563e03d05d074c64f2d16091ca649cf','btg_g','3',2,4,2,'以为是劈情操的地方所以很多人来，果然，东西很一般。什么煎鹅肝，也太老了吧，还不如配菜的焦糖苹果好吃。芝士蛋糕也不怎么样，相当没特色，竟然还这么贵。百利拿铁倒还行。太不值得了，真的','0','2012-01-01 17:56:00',NULL),
	('1ba12caa0269832a28e33e081283f511','b563e03d05d074c64f2d16091ca649cf','JOJOLOVE925','4',4,3,4,'甜品我覺得真心一般啊,上海這樣的水準多了去了!環境么,現在打流行到處都是類似的coffee shop!不過他家的藍帶的確好吃,最重要非常便宜!','200','2011-12-30 22:09:00',NULL),
	('0313c44fe6ee8dd643b35a330c039065','b88e840a8bfe443036fb52aa7b458c4b','蓝珠珠','5',4,2,3,'在当地那可是非常非常有名。打车的时候问了几个司机师傅，张嘴推荐就是商委。第二句话就是很难买。确实难买，要一大清早起来排队才有希望。点评上写的七点开门，我们七点一刻到的，在车上司机就说这时候去不可能买到了，不死心，过去一看，没人排队，还以为人品大爆发运气好呢。结果进门就一块牌子迎接我们——红肠已售完。儿童肠更是想也不要想。买了很多人推荐的干肠。（这个还没吃，吃后更新点评。）买的时候看到前一个人拎了两大袋子鸡丝卷，很好奇，于是我在根本不晓得这是啥玩意儿的情况下买了一个。像外面裹了柔然蛋皮的肉肠，口味和粉后面提到的粉肠很类似。切片做冷盆样子蛮好看的，大大的方方的一片。没买到红肠，特别伤心。于是买了另一种外观很“肠”的肠子——“粉肠”，如其名，估计面粉含量比较多，但是味道还是很不错哒。让我对他家的红肠更加期待了。到时候淘宝上搜搜看有没有喏。话说哈尔滨的出租车虽然难打，但真的很便宜哦。从中央大街附近打过去，感觉开了很久，才15块不到。哎，在魔都的生活压力真太大啦！','0','2012-01-25 20:45:00',NULL),
	('05dd28fe997ef500f59fdcd81f33cbd2','b88e840a8bfe443036fb52aa7b458c4b','青梅煮酒0','4',5,3,3,'去年大哥挨家送了一兜红肠，商委的，很满的一塑料兜，吃了一大正月，居然没吃腻，这才真正认识到商委的红肠真好吃。只是因为他家分店太少，我周围都没有店，所以我很少买。如果能像裕昌、一手店、肉联、道台府……那样有很多分店就好了。据说一到过年就排大长队，就是为了营造这种效果吧？','50','2011-09-12 09:21:00',NULL),
	('05fd12201184b17eff2b0f44ba328667','b88e840a8bfe443036fb52aa7b458c4b','华南虎虎虎','3',3,3,3,'最喜欢吃熟食品了，特别是红肠，尤其是商委的，比肉联和秋林的都要好吃，是传统的口味啊，推荐给大家，有机会一定要去品尝啊！','0','2011-09-08 16:31:00',NULL),
	('061042fef27c07541819d877d95298d8','b88e840a8bfe443036fb52aa7b458c4b','ianerlika','5',4,2,3,'看了点评，特意跑去他家买的，确实很好吃。虽然上午下了雨，但是排队的人还是很多，买了红肠和小肚，味道都很好。蒜味不是特别重，最喜欢的是都不咸，天津卖的小肚和红肠都好咸啊，原来正宗的是这个口味，很喜欢。肉质确实不错，不像现在的火腿肠都是淀粉。买了很多，回来也舍不得送人，呵呵','30','2011-06-10 21:25:00',NULL),
	('062db7ae3ccef04b036c849fd58471d0','b88e840a8bfe443036fb52aa7b458c4b','icutemn','5',5,4,2,'商委红肠只有一家店，前店后厂。很小很小的时候就有，老爸喜欢红肠，肉饼一类的食物。小时候还不太喜欢，因为里面有肥肉，还要把肥肉挑出来。现在大了，还是觉得有一点肥肉的红肠才有味道，我跟哥哥一致认为，商委红肠跟松花蛋一起吃是很不错的搭配。','0','2011-11-12 10:56:00',NULL),
	('0e2aa6c643050235abe858ee0936ed93','b88e840a8bfe443036fb52aa7b458c4b','若水菡','4',4,2,2,'其实我觉得没有想象中的那么好吃，也许是因为之前光听别人说，然后自己就想象的太美好了但是跟一般的红肠比味道还是要好一些的 那个店面的环境看起来还可以 服务态度可就真是一般了','100','2011-09-06 10:04:00',NULL),
	('09eb07c51dbb0302179ba727c0ec30ed','b88e840a8bfe443036fb52aa7b458c4b','jjj3335662','5',3,2,2,'商委红肠在老哈尔滨人眼中非常出名，但是可能本身对红肠这个产品就不是很喜欢，虽然觉得做的不错，但是仍然为火爆程度而惊讶，不至于这么火把','20','2011-07-23 09:31:00',NULL),
	('0a1d6f91500dd8fe5523b1bf1fefa47d','b88e840a8bfe443036fb52aa7b458c4b','Fea_','4',3,2,2,'慕名而去，买了一根粉肠和一个鸡丝卷。哇靠那叫一个拥挤！大家都几百块钱地买，搞的我总觉得自己是去捣乱的，哈哈哈不好意思~~儿童肠卖得快，冬天都这么多人，那夏天可想而知了真是。味道还不错。','20','2011-01-06 16:18:00',NULL),
	('0c0ff6bf91f79a50f0b4c7355f227ce3','b88e840a8bfe443036fb52aa7b458c4b','e13111','5',4,3,2,'每次都是妈妈去买，一买就买一二百块的，他家各种副食我基本吃过，我最爱吃商委的丸子了，早上买回来还是热呼的呢 可香了  鸡脖子也可好吃了 有股烟熏味 小时候的味道 喜欢喜欢啊。 就是离我家太远 一年也就能去买两次吧','50','2011-06-22 11:05:00',NULL),
	('0cf2e77dc94a33be09a3a90d6ed1fd07','b88e840a8bfe443036fb52aa7b458c4b','李奇奇NJ','3',2,3,2,'买的人很多，店面不大，但是还算比较干净，不过红肠实在不是很习惯，虽然肥肉不是很腻人，但是看上去就很让人没有食欲，略微尝了尝，多吃药反胃的','20','2010-08-16 12:22:00',NULL),
	('10b51e44b28d7f9eefdcc17f941b7d95','b88e840a8bfe443036fb52aa7b458c4b','yanggod','3',4,2,2,'味道很好，做得很有风味的红肠，在后面生产好，就拿到前面开始出售了，感觉少了一些运输什么的，卫生能好点。而且红肠做得很好吃，就是不好买。不过节还好，过节的时候一大早就要去排队，特别麻烦，谁让人家就这一家卖呢，生意太好啦。','0','2011-11-07 20:48:00',NULL),
	('151e4e1fcdd005c20ebe10acf8791a65','b88e840a8bfe443036fb52aa7b458c4b','壮壮的小饭盆','5',5,3,2,'商委的东西不错，香！就是离家太远，去一次不容易，而且买东西人特别多，服务员的态度也不耐烦，外面的顾客也是挤的要命，买东西就像打仗似的。不过同事都说他家丸子好吃，不过我不喜欢，这个还是依个人的口味吧。熏的鸡翅味道和裕昌一手都不一样，喜欢。','30','2011-01-20 17:19:00',NULL),
	('19fc9ad1e3778f5e2f25f953a74cb885','b88e840a8bfe443036fb52aa7b458c4b','wangdan0331','4',4,2,2,'想起这家店我真的是心酸呀，提起商委红肠简直成了老百姓的心病了，买这个必须排队，尤其是过年这种年月，大冬天5点多就又起来排队的，就好像不花钱一样，有一次新闻也有报道，排队的人排过了两趟街，天还没亮呢，其实现在哈尔滨市场上基本上红肠是平分天下，大部分什么都有受众群体，不过商委有够神秘，没什么分店，不过他家的味道确实有那么一些特点，特别的香，没有大快腻着的肥肉，叉烧也还挺好吃的，干嚼着特别的香，不是那么鲜艳的艳红色，感觉自己嚼着嚼着能吃一大块，口味偏甜，是女生喜欢的口感那，不过他家的丸子我也特别喜欢，不过每次都是别人买给我的，对于价位真是不大清楚，丸子即使是刚出锅的怎么感觉还是很硬呢，外壳比较硬，凉了不好吃，是比较正统的肉丸子，这个没有商委的红肠那么火，但是我觉得也是受众群体非常大的一种东东，总体感觉都说的过去，但是还是这种卤制品少吃对身体较好，当然比较难忍住，一般是看到别人吃，我自己就像吃了……','20','2012-01-18 23:26:00',NULL),
	('034b253587ac3e773abc68b8e125efaa','b8aee9219b9c1d76b1f5b195e50bd5f7','moonish','0',3,3,3,'扬州有芝心披萨了！！昨天去必胜客的最大收获在于了解到扬州于2008年3月31日开始供应芝心披萨，这是怎样的一种心情啊，在网上看到诸多朋友热切的呼唤，我深刻的意识到：我不是一个人！！新的威尼斯双面，怎么说呢，还不错。刚多拉挺一般的，新出的酒饮料也很一般，但是有了芝心披萨还真是一件可喜可贺的事情！！','60','2008-04-25 08:50:00',NULL),
	('0369b2169ee187021386734e1f2aeef0','b8aee9219b9c1d76b1f5b195e50bd5f7','babyfaceltt','5',3,2,2,'人是那个一个多呀 排队等了好久 天气又热 最喜欢吃鸡翅了 一次能吃好多呢 披萨一般 还不如印石的披萨呢  甜点就提拉米苏了','50','2011-09-26 12:16:00',NULL),
	('06b9ec1db4ef2bee5f44f48ec0c9a180','b8aee9219b9c1d76b1f5b195e50bd5f7','刘丹2341269357442','4',4,3,3,'最近出的小食拼盘很不错~也喜欢他们家的洋葱圈~PIZZA是一向的好吃~不过仍然觉得面饼的含量太大~呵呵（似乎贪心了点）很喜欢吃那种基围虾~也喜欢海鲜意面和鸡茸蘑菇汤~总之会一段时间一段时间的想吃~','60','2010-12-14 12:08:00',NULL),
	('08ba3d32d80b5e65ea1dd32697684788','b8aee9219b9c1d76b1f5b195e50bd5f7','来自埃及的小女巫','4',4,4,4,'每年寒暑假和好朋友必去的地方恩~~~~还记得高中的时候第一次去吃不小心把番茄酱的盖子给弄到地上还是服务员帮忙捡起来的有点小丢人~~~~~呵呵以后每次去都会带着学生证 因为可以打八折有时候点份套餐再打上个八折又实惠又划算虽然在外地吃过各种各样的PIZZA但感觉还是他们家的纯正没钱的时候就过来来份下午茶或是堆份超级至尊沙拉挑战一下你的极限很有趣哦还可以消磨一个下午的时光不过下午茶不打折哦~~~~~~','40','2008-12-24 22:28:00',NULL),
	('0bfd3ff3d59124aa5b6ff694d996dccb','b8aee9219b9c1d76b1f5b195e50bd5f7','希尔维娅','3',2,2,2,'扬州唯一一家必胜客，所以等位很困难，一到了周末节假日什么的门外都要排长队的。同学聚餐去过几次，上菜很慢，味道还行。','40','2011-04-08 22:18:00',NULL),
	('0e80dbd3c3f48f878db9dd06458d39ad','b8aee9219b9c1d76b1f5b195e50bd5f7','o0sha_sha0o','0',4,3,3,'扬州目前只有一家必胜客，所以每到周末或节假日，门外排了好长的队啊我妈总说不就是批萨嘛，至于嘛，排那么长的队~~~O(∩_∩)O~不过，必胜客的批萨的确好吃，专业的嘛海鲜的、田园的等等都尝过了，很不错，一般9寸的就够了再点些小吃，烤翅很香呢，一次还点了份蜗牛，吃起来没啥感觉，里面因为有香菇，吃起来和香菇差不多的口味……卡布基诺（冰）还有水果沙拉。棒(*^__^*) 嘻嘻……','70','2009-06-30 09:43:00',NULL),
	('0f8ce9084513322b4d6e49cd31e9d4a0','b8aee9219b9c1d76b1f5b195e50bd5f7','小狐狸和阿熊','0',2,3,3,'最郁闷的是扬州没有芝心披萨 ，我就喜欢芝心的，唉，别的也没有什么好说，必胜客全国都一样，不过感觉这里的色拉的量没有上海多','70','2008-04-23 23:24:00',NULL),
	('1065e3ae8fe2ae25e6944c5f6d057e64','b8aee9219b9c1d76b1f5b195e50bd5f7','欧阳琳琳','0',3,3,3,'扬州的必胜客没有南京的人多，南京的必胜客特别是市区的，人总是狂多，拍对要排半天，但我在扬州吃，一般不用排队，而且店的面积大，口味嘛也不比南京差','85','2009-06-10 10:05:00',NULL),
	('108d77bba0ed762185d79780f2108976','b8aee9219b9c1d76b1f5b195e50bd5f7','盛夏的浅夏','4',4,4,4,'今年夏天跟同学一起来吃的吃了180但是有学生证打了8折还是蛮划算的喜欢吃鸡翅还点了两份还有酥皮蛤蜊汤不过感觉披萨没有以前在上海吃的好吃','75','2009-12-10 22:43:00',NULL),
	('154224876012c1204a665511a7c79707','b8aee9219b9c1d76b1f5b195e50bd5f7','权权宝贝','3',2,2,2,'【试吃/体验点评】因为在闹市区，人比较多。但是味道非常的一般。因为跟老公找不到吃饭的地方，所以才去这家。就一般般的批萨。不算很好吃。','60','2011-07-05 11:22:00',NULL),
	('190460f8f43604a6dd3505524243e6b0','b8aee9219b9c1d76b1f5b195e50bd5f7','塔咩咩','3',3,3,2,'出门在外吃必胜客，已经是很无语了，还第一次经历了在必胜客吃饭不能刷卡的情况，真是囧死！SO服务给的一分。。。中午在文昌阁附近想找个吃饭的地儿，扬州市中心区域居然没有什么招牌显眼的饭店，好崩溃啊。店挺大的，上菜速度和服务都OK，经典的鸡翅和新出的德克萨斯风味烤鸡排都蛮让我满意的，还发现了个雪梨百合冰绿茶很适合夏天尝试。','60','2010-06-18 10:53:00',NULL),
	('194f9e3053d9d356b305c1e521a37ced','b8aee9219b9c1d76b1f5b195e50bd5f7','akail','3',3,3,3,'扬州最早的一家PIZZA店 地段也非常好 在市中心所以生意真的很好 节假日经常看到门口排长龙.....老实说有点想不通... PIZZA HUT有什么好排队的...虽然自从扬州有了PAPA JOHNS之后就再没去过这家了但是以前还是去过不少次....东西嘛全国都一样的 跟PPJ比 无非是有一个无边的选择而已不过无边太薄了 我个人不喜欢 还是喜欢传统的单论传统的PIZZA的话 还是PPJ做的比较好吧...热门的BBQ鸡翅的话 我专门比较过 真的是..恩 那家比较好..现在把自选沙拉取消了 建筑师和结构工程师们没有用武之地了PIZZA HUT里也算是少了一道风景.... 哎 没意思啊','80','2010-12-12 16:20:00',NULL),
	('1d0099ba9a2c8256b99f3adc5aae8699','b8aee9219b9c1d76b1f5b195e50bd5f7','生如__夏花','2',2,2,2,'刚放假就跑去吃了，东西的分量变少了，盘子变脏了，味道没有以前好了，服务员的衣服也非常的脏，看了就没有食欲了。！居然等了20min什么小吃，主食都没上，就先上了甜点，完全无语了，搞什么啊。正好坐在原来放沙拉的地方，外面还有人排队，就觉得人家一直盯着我们看，难过死了。再也不要去了！','100','2010-02-08 17:18:00',NULL),
	('1d4ca4e4f9174d19e17a2c116c4a674f','b8aee9219b9c1d76b1f5b195e50bd5f7','只为厚疯狂','4',4,3,3,'想吃比萨还是要去必胜客，芝士较多，很正宗。吃来吃去还是最喜欢至尊系列的比萨，特别是超级至尊。还有酥皮海鲜汤，味道特鲜美，最后再吃一点抹茶蛋糕，不甜，特爽口。','80','2012-02-09 07:58:00',NULL),
	('1e21680b3ad4ea8fd1a4898024b8062f','b8aee9219b9c1d76b1f5b195e50bd5f7','君子爱财取之有道','3',3,3,3,'去了两次，都算是当点心吃的，鸡翅，披萨什么的都不错，就是这奶茶，热的还有点甜味道，冷的也太淡了吧，水肯定加了很多，而且我是不加冰块的，哎，很失望~~','40','2012-01-26 22:53:00',NULL),
	('019b5c445ace8b8c1bb180bdc2897cf7','ba0d2f57626d6e789a1e988d551a29f3','bugaosongni','3',3,3,3,'感觉一般。没有什么特别的，肉还行，热馍夹肉还是挺好吃的。还要了稀饭，比别家贵一块钱，但是东西一样。老板还让我后面一个地税的人插队，感觉不爽。','10','2011-08-27 22:35:00',NULL),
	('073888d4aeb2348276a4d4ea2fe0e62b','ba0d2f57626d6e789a1e988d551a29f3','红袖酥酥','3',2,2,2,'其实和其它的肉夹馍相比，秦豫的肉夹馍就是馍馍大点，肉的味道比其它的也就咸点，他们家的凉皮还行，平时逛街在附近可以吃吃，绝不会特地跑去吃。','12','2011-10-11 13:59:00',NULL),
	('0a67b5cd1ad7b7deca1a6ef65f69b75d','ba0d2f57626d6e789a1e988d551a29f3','安娜与国王2012','4',4,3,3,'来买肉夹馍的人很多，要排队，听说他家的肉夹馍很好吃，正好路过就买了两个，味道确实很不错，很喜欢，难怪很有名，恩，以后会再光顾的。','10','2011-12-27 16:05:00',NULL),
	('0c4495ddecd4203e8bd361b0ce485cc6','ba0d2f57626d6e789a1e988d551a29f3','大老妖怪','4',4,2,2,'馍烤的很脆,肉很嫩很香,再陪上碗凉皮,冰峰真的很过瘾啊~!不过就是人买的太多了,还得排队,有时候1个人买很多...弄个大点的门面就好了.','0','2011-09-08 03:13:00',NULL),
	('0e394f9b4f14f7be7b38ed6873108dd0','ba0d2f57626d6e789a1e988d551a29f3','赈早间琥珀川','4',4,2,2,'早晨10点多的火车我9点多出发跑去东木头市这家超级牛的凉皮儿肉夹馍去的时候大家都在排队 队伍不长不短的 我也顾不上赶不上火车的危险端直就断然的排队了额 这大概是我做过的最疯狂的事儿了最后我还剩半个小时出发结果到达火车站火车晚点了啊哈哈刚刚好优质肉夹馍超好吃的尤其是在火车上更难得啦','0','2011-09-02 17:17:00',NULL),
	('10be77943d9397e6330860af2ff24e72','ba0d2f57626d6e789a1e988d551a29f3','明渊紫香','4',3,1,2,'这简直就是西安肉夹馍的一家旗舰店，历史悠久，自打他在柏树林1号的时候，我总是光顾，11点去排队，一到12点就米有了。。。现在还好，每次中午也就是排队排到大门外头，等个二三十分钟，也还是能吃到嘴里的！肉质熟烂，饼酥脆~咬一口下去。。。口水已经出来了！话不多说，您去尝尝就知道了！','15','2011-07-22 15:46:00',NULL),
	('15fdaa1ecc5d9d0a07a4092ca937060e','ba0d2f57626d6e789a1e988d551a29f3','ycmxmalong','5',4,2,3,'都说是西安最好吃的肉夹馍，慕名而去，有一点小失望，没有想象中那么好吃。夹的肉很多，馍很大，还算是特色。后来每次去，还是上午十点左右的样子，但是却关门了，不知道是不是卖完了。（我第一次去的时候都已经是中午过后了）','0','2011-07-19 13:12:00',NULL),
	('16749f9e67891196ad5b4cff9ea00209','ba0d2f57626d6e789a1e988d551a29f3','青芥末开门','4',4,2,2,'以前在碑林对面时就去排过那长队，后来搬到柏树林偶然找到了继续排队，算得上西安最好吃的肉夹馍，因为非常正宗，比起现在很多用电饼铛打馍的地方不可同日而语。所谓小吃主要就是吃那个特有的味道，馍不用炭火打，肉再煮的不烂，还不如不吃呢。每次都得中午之前去，下午一点后基本就是白跑了，人家卖完了。这生意做得真好。每年三伏天居然还休暑假，直接关门，佩服的五体投地。就一个字：牛。为啥牛，好吃啊。肉又烂又香，馍既有瓤还很酥脆，最好别吃纯瘦的，带点皮和肥肉才香那。环境一般，每次最少得排10分钟队，然后挤挤挨挨的坐下吃完，环境服务都一般，但顾客们爱的也就是这个味。','12','2011-07-18 11:03:00',NULL),
	('1aacdab8e805c69b2fff2cdc8a3df28c','ba0d2f57626d6e789a1e988d551a29f3','十一月蓝','5',5,4,4,'每次去都要拍超长的队伍。。他家荚膜很赞 但是中午去往往都木有饼了。。只能吃到凉皮然后 悻悻而归。。哎。。。老字号 口味正 生意好。。桑不起啊。。。','10','2011-08-01 13:26:00',NULL),
	('1d9e0a742e94bc42ff74146463a100b0','ba0d2f57626d6e789a1e988d551a29f3','大嘴巴到处走','4',3,2,2,'去西安第一天，出租车司机指给我们，于是心心念念。不过他家貌似卖的很快，于是第二天一大早，朋友就去排队，给每个人买了两个，优质，纯瘦肉，我表示这个馍真心好大，一个都吃不掉。。。不过是蛮好吃的，值得一尝。据说人很多，看来早去是正确的。','18','2011-10-17 10:19:00',NULL),
	('0321b7e6839e7d3d863627ad031b2e37','bbc694632a4d5992602914cf1c2eb0b9','麟欣','5',5,5,5,'我一直觉得，只有桥香园的米线最正宗，而且也最好吃。属于云南的味道。每次上街都会经过这里，但是从来都没有进去吃过，因为太贵了，所以也不知道口味怎么样。每次都是在路边的小店叫碗吃，虽然便宜但是 口味和我们厂子的差不多，在云南生活了四年，每天都吃过桥米线，厂里每天的早饭也是米线，里面 放些韭菜 和炸酱肉末，看着很辣 的 ，其实一点都不辣，很好吃的，已经习惯 这种口味了。一次领导带我出差，去这家桥香园吃的，里面的客人很多的，几乎没有位子坐下来，好不容易找个坐下来等了好久，结果端上来的米线白白的碗里绿色食物一点都没有。只有什么鸡汤和鸡肉，真让我看着有点失望，在领导的催促下勉强拿起筷子吃，这吃不要紧，口味还真不错，挺新鲜的，不过突然换种口味对于我来说还是一下子习惯不过来，里面的汤太油了，真所谓一份价钱一分货 ，虽然贵了点，但是值得，怪不得领导每次都是去 桥香园吃过桥米线呢！实惠！也值得我推荐 下。。。。。','16','2011-05-18 14:08:00',NULL),
	('0db131c002aa47f757d4346e698252cf','bbc694632a4d5992602914cf1c2eb0b9','林潇','4',3,4,3,'出差的时候去的啊，在火车站附近，很方便嘞我们住在附近，然后几乎天天去吃米线，然后发现一周下来，瘦了7斤，哈哈很喜欢这儿的环境，在楼顶边看风景边吃饭，不错地选择','50','2010-07-28 11:41:00',NULL),
	('0f4c497044a31111bc2697bbdee06e7d','bbc694632a4d5992602914cf1c2eb0b9','reddany','1',2,2,1,'非常一般还没有在北京时吃的桥香园分店好吃，最恶心的是切凉菜的那个男的，态度特别恶劣，就因为称猪耳的时候称了两次就摔东西，欠抽','25','2011-10-26 16:19:00',NULL),
	('10085012377db6e9741ca68dd8a14d69','bbc694632a4d5992602914cf1c2eb0b9','杨蕥','4',5,4,4,'来昆明，下了车，吃的第一个晚餐，老颠过桥米线是相当可以的，特别是汤汁十分鲜美，五十元的套餐，非常给力。','50','2011-10-27 09:28:00',NULL),
	('123d290eaa8dedeb05f2055b10e38bba','bbc694632a4d5992602914cf1c2eb0b9','dudu_73','4',4,4,3,'怀着对桥香园及米线深深的失望来到这里，终于发现还是有些店家在认真做事。汤很浓，加水可以稀释成5碗桥香园，肉新鲜，厚，可批为3片桥香园，让我这个外地人对米线恢复信心。','20','2009-11-30 21:37:00',NULL),
	('16bcd1c8700fe8b3f1090cba37c16d1b','bbc694632a4d5992602914cf1c2eb0b9','dog_lily','4',3,4,4,'环境很好，二楼的露台跟咖啡厅似的，根本不像吃米线的地方……味道尚可，只是没有和其它家的米线做比较，毕竟这是第一次在云南吃米线，和天津的味道真的不一样，但也很好吃。','25','2011-05-10 16:47:00',NULL),
	('004e4865bbc2ca3411dc1f6a09e7e8e0','bc48f502a82aaa8377c4c0d426baae7d','positivek','4',3,3,4,'第一次在天津吃海底捞就是这家店，服务热情，东西好吃，服务一如既往的热情周到，每次去都有礼物送，如果是学生升学就会送一支笔 这年头 钢笔太少见了','0','2011-08-22 09:20:00',NULL),
	('035fe9cc86c79558d161e09371a61af5','bc48f502a82aaa8377c4c0d426baae7d','猫咪果冻','3',3,4,3,'噩梦开始的地方。。。海底捞一贯的好环境好服务，吃的味道还好，量也不小。唯一悲催的是，吃完的转天，我们几个人集体闹肚子了，以后再也不去这家海底捞了。','0','2011-08-18 17:09:00',NULL),
