	('07a72ceab24d8d47a330ff88c8108f45','bc48f502a82aaa8377c4c0d426baae7d','大美美玩玩大','4',4,5,5,'因为24小时了嘛，所以凌晨去，也不用等位子，没想到人还挺多，挺热闹的，环境好，服务好，喜欢他家的配料，虽然小贵，但是有机会还要去的。','80','2012-01-28 02:14:00',NULL),
	('0870b7ff5964f4ff86cbd452ebe298a3','bc48f502a82aaa8377c4c0d426baae7d','qian1115','4',5,4,5,'和同事去的，感觉非常好，服务很热情。环境有点昏暗，气氛不错，价格感觉比一般火锅店贵一些。    虾滑、滑牛肉都很嫩、很好吃，是我的大爱，鸭血也不错，特别喜欢自调的小料，往里面放了很多果仁粒和牛肉松，吃起来特别香。  总体来说比较喜欢，还会再去的。','70','2011-11-02 12:26:00',NULL),
	('0f1239fd74a5e1ab7604e3cc198bccd6','bc48f502a82aaa8377c4c0d426baae7d','ouchouchwow','5',5,5,5,'味道不错 就是其中的xo海鲜酱我吃起来有点过敏环境好 服务贴心 虽然小贵 还是考虑再去啊虽然没去美甲 但每次去都会有礼物呢','70','2011-03-16 17:44:00',NULL),
	('13d2e3f426b0e247908868390a742f49','bc48f502a82aaa8377c4c0d426baae7d','咕咚小顺','4',3,5,5,'以前就听朋友们介绍过，后来在西湖道人人乐的楼上开了一家分店，和朋友去了一次，环境布局优雅，别出心裁，餐厅的服务员个个都够得上全国劳动模范，底锅味道很有特色，价格稍微有点贵。','0','2011-06-14 20:39:00',NULL),
