	('0622321ba4d61bbf3f28caf746b4524b','bd274cf3ea5874c9fda89fe39f82fe95','snake2000198','3',2,2,2,'【团购点评】团购去的，还是蛮值的，一个牛排一份鸡排总共要100块钱，牛排做的很嫩，刀子下去很容易就切开，鸡排烧得也很棒，味道很诱人。环境那，比较适合小情侣偶尔去吃个晚餐，就是场面太小啦，没有几桌。','0','2011-11-28 09:26:00',NULL),
	('0d68f8282863e8787de51594e1cc288d','bd274cf3ea5874c9fda89fe39f82fe95','会员5776345','3',4,4,3,'【团购点评】南山中心区的环境不错，装修格调高雅，非常适合拿一本书阅读或望着窗外发呆的一个地方，菜品也还算不错，但没有什么特色之处，也许是只去过一次的缘故吧。','80','2011-09-15 23:19:00',NULL),
	('105164b52cd2ca84591fd51588933b17','bd274cf3ea5874c9fda89fe39f82fe95','carcarcar','3',2,3,3,'团购去的，环境不错，适合情侣拍拖去。服务还行，对于西餐来说感觉有点不够专业。牛扒点的五成有点过熟。餐前面包不好吃，汤一般。','60','2011-08-05 16:34:00',NULL),
	('114609b659797d34c77e027a14ea3bd1','bd274cf3ea5874c9fda89fe39f82fe95','kyle2000','3',2,2,2,'【团购点评】团购去的，因为见到点评网上评价很不错所以就去试了一下。套餐：顶级和牛肉眼扒+香蒜牛油扒龙利柳，老实说对这两个是比较失望的。可能是期望太高了，还以为跟蓝马赫差不多，但是不知道为什么这个扒嫩是很嫩，就是少了牛肉的味道；那个鱼和其他东西就更加一般了。还有本来楼高就矮，还要用黑色调，加上射灯环境，总感觉好压抑。洗手间好简陋。加上新手服务员。哎，是我的rp有问题？。。。','0','2012-02-08 01:21:00',NULL),
	('133e016130babfccd920fb7fa8e5c9f0','bd274cf3ea5874c9fda89fe39f82fe95','winny722','5',5,5,5,'【点评团消费】团购去的~店里的环境非常的好，可能由于地方比较偏，人比较少，非常安静。服务员的态度也非常好，面包一般，不过很新鲜，端出来的时候是热乎乎的~沙拉和饮料都没有什么特别，不过主菜很惊艳，鸡排很香，皮很脆，牛柳很嫩，很好吃！','60','2011-10-27 22:52:00',NULL),
	('05a7cb45881dc2b3f8c46f019875a54e','c1d71126b7c18cb5b97382b0f7e24522','糯糯紫米汤圆','3',2,2,2,'【团购点评】还是去年的DP团购了， 188元双人还是198元双人都有点记不清了，刚好有事情到SOLANA，所以也就提前预约了，地方挺好找的，在美食广场里面，门脸也比较显眼。里面的灯光什么的看起来还可以， 有一个小小的锅台每桌上，                                                  因为早就听过将太无二的大名，直到人气很好的，不过锅料理的口味倒是感觉一般了，可能海鲜类的有点不适合涮着吃吧，比较不容易入味，整个菜品没有什么特别的印象，倒是就记得最后的面挺好吃的，可能因为各种鲜美滋味都浸在汤里了吧，所以面反而最好吃，其他的没有什么印象了，普通吧.                   但是偏巧有件事记得清楚， 就是关于服务的， 怎么说呢， 也不是大事儿， 就是当时餐里包含的柚子茶，感觉不错，挺可口的， 所以上菜的时候问服务员是否可以续杯，答曰可以，还觉得店里想得挺贴心， 大概5分钟后，一杯茶喝光， 遂请服务员帮忙续杯， 不是刚才询问的那位， 结果告知只有一杯，不能续， 这个， 怎么说呢，不是计较一杯柚子茶， 只是觉得这么有名的店家，怎么基本的培训还不到位呢，前后2人不到5分钟答案完全相反...，印象一下子受到影响罢了.                                              服务业本就以细节取胜的，虽然一点小事无需计较，但是第一印象阿， 觉得这般有名，却也不过如此.全文','0','2012-02-10 22:02:00',NULL),
	('05ed6ea29609ace142413988f5c07582','c1d71126b7c18cb5b97382b0f7e24522','flyideal','5',4,4,4,'【点评团消费】团购的198元双人套餐，真的是超值！两个女生吃的非常饱，还剩了好多。服务态度也很好，店在蓝色港湾，晚上去的，户外特别美，吃完还可以到处逛逛，真是既饱了口福又饱了眼福~- 前食 味付五拼（1份，价值36元）其实我这个大土人都不太清楚那五种都是些什么食材，但有酸甜口的，也有辣味的，吃火锅时可以调剂一下，开开胃，清清口，很爽心！- 沙拉 照烧牛肉沙拉（1份，价值42元）- 刺身三拼 三文鱼、白金枪、北寄贝（1份，价值88元）中规中矩，大爱北极贝~~- 特色寿司滑 斑鱼海胆寿司滑（2粒，价值28元） 赤贝墨鱼寿司滑（2粒，价值36元） 鲍鱼鲑鱼寿司滑（2粒，价值38元） 蟹钳虾肉寿司滑（2粒，价值36元） 芦笋牛肉寿司滑（2粒，价值26元） 福袋寿司滑（2粒，价值24元）服务员一开始上菜时会告诉食客要把上面的肉类和下面的分开涮，每一种大概涮多久可以吃也都交待得很清楚。味道都挺不错的，只是鲍鱼略微有一点不新鲜。建议大家可以多吃肉，饭团太占肚子啦，哈哈~- 卷类 鸵鸟肾金针菇卷（1份，价值48元） 桂鱼豆苗卷（1份，价值48元）这个实在没肚子了，只吃了金针菇的那个，感觉蛮营养的，好吃~- 肉类 雪龙牛胸肉（1份，价值188...元）肉对我来说都差不多，就一个词：yummy~- 其他 水三鲜（1份，价值18元） 三色豆腐（1份，价值18元） 时蔬组合（1份，价值18元） 珍菌组合（1份，价值38元）喜欢吃豆腐，三种豆腐都好吃！还有菇类，不管吃什么火锅都必点的。- 主食 海带面（1份，价值8元） 乌冬面（1份，价值8元）吃完回来才发现貌似没给我们海带面，两份都是乌冬面，不过这个根本就没什么动，因为实在撑的不行，烫了一两根尝了，很劲道！- 饮品 蜂蜜柚子茶（热）（2杯，价值30元）配着火锅很快就喝没了，好希望可以续杯啊……%〉_〈%- 甜品 什锦水果拼盘配布丁（2份，价值36元）蜜瓜略生，焦糖布丁好吃！- 锅底 深海鱼骨养身汤（1份，价值38元） 深海鱼骨VC汤（1份，价值38元）服务员说养身汤是给男士的……所以我们两个女生自然就要了VC汤了，很清淡，心理作用觉得很健康，嘿嘿~- 赠送 无二沙茶酱（1份） 将太海鲜汁（1份）两个酱汁都很香，可以尝试搭配不同的食材~真是还要赞一次服务态度，没有因为是团购就不好好服务，各种讲解，给汤底加水什么的特别耐心，好店！下次有团购还要来！全文','99','2012-01-31 16:40:00',NULL),
	('07790b54b1fc36a0c5dc7d908e11e079','c1d71126b7c18cb5b97382b0f7e24522','dianping25','5',4,5,5,'【点评团消费】服务周到，环境雅静，食材新鲜，佳肴看上去很美份量不小，三个人都没吃完。在左岸酒吧街里面，晚上有点难找~总之非常感谢','99','2011-11-13 21:40:00',NULL),
	('0849eabda5358401ab51132f1b89a1ab','c1d71126b7c18cb5b97382b0f7e24522','oo0544','3',3,3,4,'【点评团消费】参加的团餐，应该说是很实惠了，鱼生、海鲜还是挺新鲜的，但还是觉的有点华而不实，总之不是特别喜欢，觉的没有将太无二寿司店那么喜欢。菜品看上去种类挺多的，但对于四个人来说，真是挺勉强的，要是吃的多的话也就两个人吃饱。环境还不错吧，但位置太偏了，不太好找。服务不错。总之我们不太适合这家店','100','2012-01-27 19:14:00',NULL),
	('09187cb8956bdaca4bb8e86c6ad8c050','c1d71126b7c18cb5b97382b0f7e24522','酷儿咪咪','4',3,3,3,'很给力的地方，布置得很有情调的，食物也很精致，味道很赞的！很喜欢这里的乌冬面，很有嚼劲，口感挺赞的！雪花牛肉不错，很嫩很入味，特别喜欢！其他的菜也很赞！','0','2012-02-08 21:35:00',NULL),
	('092759c7e3a88b1cbb4813f2d302c251','c1d71126b7c18cb5b97382b0f7e24522','桃灬','5',4,4,5,'【点评团消费】用的团购的券去的 真的挺超值的 两个人根本吃不掉 最后剩了一堆东西在那很可惜 不过吃的倒是很满足啊满足。地方有点难找，可能是刚开业的缘故，人也不多，但服务员的态度非常好。虽然锅底没有什么亮点，但涮品非常赞，雪花牛肉分量很足恩，然后寿司滑灰常好吃嗷嗷嗷。','99','2011-11-19 10:11:00',NULL),
	('09bcc72cc258c72c038e4780a307f379','c1d71126b7c18cb5b97382b0f7e24522','skyecha','3',2,4,4,'【点评团消费】团购的分量很足，两个人吃足够了，但是说实在的，我觉得有什么东西不新鲜，因为晚上回家，我们俩都拉肚子了，很JIONG，所以呢，建议大家吃的时候煮得透透的，拉肚子的几率应该也小了。环境很好，服务也很好，不过没有像有人说的可以给小票换停车券喽，大家去可以再要求要求。其实这里如果没有团购，来吃饭的人应该很少吧，我感觉哦，因为味道其实挺一般的。','100','2011-10-20 10:55:00',NULL),
	('10ad4da976bdce5fc4e0cc6e25833724','c1d71126b7c18cb5b97382b0f7e24522','一夫吃北京','4',3,3,3,'这里的环境不错，我们提前预定的，要的是包间。当时搞活动398一位，买一送一。上的海鲜都挺新鲜，有小鲍鱼和大螃蟹爪子等等太多了，够吃。','200','2011-10-28 15:43:00',NULL),
	('10f6e06fbdc7ad50cedb6c10d6da0d02','c1d71126b7c18cb5b97382b0f7e24522','nasu0401','3',2,3,3,'【点评团消费】团购去的，号称原价888元。但是赶脚菜多，硬货少~可能是酱汁没有选好，雪花牛肉吃了几片后，就觉得腻。鸵鸟肾、生牛肉那些寿司，没有三文鱼这样大众口味的鱼生味道好。环境不错，服务也可以。但是没有团购或促销活动的话，性价比就不高。即使再去，也不会尝试奇特肉类了。','100','2011-12-02 11:33:00',NULL),
	('139604e5223513f350978aad5993d8f7','c1d71126b7c18cb5b97382b0f7e24522','nirvana01','4',4,4,5,'【点评团消费】团的198的2人餐，3个人去的，一个10几岁的半大小伙和我们2个女的，所以后来又加了100多块钱的东西，其实如果是涮品要不了那么多钱，后来又加了一份鱼生拼盘，总的来说价格真的不算很贵。本来想给五星，但是地方还真不算好找，其他什么都好，如果有四星半最合适，总觉得五星还欠那么一点点如果2个女的感觉团购都吃不完，但因为我们有个半大小子，所以战斗力还是很强，菜品感觉也都不错，鱼生新鲜，不过白金枪一般，虽然比普通日料店好很多，但是比起和风细雨还是差了点，其他不错。那个雪花牛肉，也没吃出多好来，原价要198，单点我肯定不考虑。那些滑都很有特色，看这样子好而且口感也不错。蔬菜也都不算很贵，相对于环境来说，挺好的。最后还给上了3粉甜点和水果，本来团购餐里只有2份的，所以比较感谢！感觉这里适合朋友小聚和情侣约会，SOLANA周边环境也很好，吃喝玩乐都有，以后有机会还是会去的。','130','2012-01-01 16:24:00',NULL),
	('13d73d0fd11f731b655e65a09414a75b','c1d71126b7c18cb5b97382b0f7e24522','alice航航','4',2,5,5,'【点评团消费】料理做成火锅的感觉真的不是很好啊，太淡了。吃的我很难受，小料点的海鲜酱，说是酱，就是一些类似酱油的液体……吃的我咸的不行开胃的沙拉不错，火锅太淡了太淡了','100','2011-12-25 19:27:00',NULL),
	('145aabbd6a2c9a550f537546ce393320','c1d71126b7c18cb5b97382b0f7e24522','叶紫楠','3',3,3,2,'【团购点评】这个团购券是点评db竞拍得到的 2000+db啊~主要一直对将太无二比较长草 但是拍完才明白过来 原来这家店是单独的锅料理和蓝色港湾的另一家店不在一个地方家离这里很远 无奈团了就得来啊地方不算太好早 也可能是第一次来蓝色港湾 对地形不熟悉 找了半天还迟到了他家是一定要提前预约的 否则你到了即使里面有位置也不能进 都是留给预约的客人 如果晚了也要等位早知道把预约的时间约晚一些了 也给即将要去的亲提个醒再说说团购的菜品吧主要都是涮品 这种涮法还是挺新鲜的 味道也不错不知道店家是因为看我们在那拍来拍去 还是所有团购的顾客都送 反正送了我们2个寿司滑 刚开始还都挺开心的但是当我们离开蓝色港湾在路上bf无意在点评上发现我们这次的团购还有一份甜品店家没有给上而且看到很多亲都表示那个甜品很不错 一下郁闷了后来回忆一下 也的确是 当时店员很糊涂 上菜上到一半 居然过来问我们什么滑给我们上过没有而且2杯柚子茶也是吃到一半的时候 店员才想起来的 当时也怪我 就忘了甜品这回事儿了但是的确挺郁闷的毕竟店家每天接待很多单团购 应该比我们了解团购上得内容啊以前团购也没碰到过这种事情 所以感觉这方面店家需要改进下还有就是他家桌子上得湿巾...是单独收费的 这个在我们坐下后 店员并没有及时提醒后来上菜前店员才说那个湿巾要收费~~ 这点觉得有点郁闷 毕竟湿巾没多少钱 但是寿司滑都可以送 一个湿巾倒要单收费~~ 而且以前汉拿山的团购里都包括这些湿巾的费用的~~全文','0','2011-12-11 18:04:00',NULL),
	('161cc2ab85db96473c2d972022951421','c1d71126b7c18cb5b97382b0f7e24522','非宝贝','4',3,4,3,'【点评团消费】团购的大众点评网价值888元的将太无二锅料理双人美食套餐。包含：- 前食 味付五拼（1份，价值36元）：特别少，而且每一种都是粘乎乎的。味道很相似，比较喜欢其中的八爪鱼。- 沙拉 照烧牛肉沙拉（1份，价值42元）：下面的蔬菜与一般的沙拉差不多。上面的牛肉很像炒的，口感比较硬。- 刺身三拼 三文鱼、白金枪、北寄贝（1份，价值88元）：这个很不错，虽然少了一点【三文鱼（3片）、白金枪（2片）、北寄贝（2片）】，但质量非常好。- 特色寿司滑 斑鱼海胆寿司滑（2粒，价值28元） 赤贝墨鱼寿司滑（2粒，价值36元） 鲍鱼鲑鱼寿司滑（2粒，价值38元） 蟹钳虾肉寿司滑（2粒，价值36元） 芦笋牛肉寿司滑（2粒，价值26元） 福袋寿司滑（2粒，价值24元）这些不单独评价了。都差不太多，比较喜欢的是蟹钳虾肉寿司滑，如果是整个的虾就更好了。- 卷类 鸵鸟肾金针菇卷（1份，价值48元）：煮了之后比较脆，没有什么其他的味道。 桂鱼豆苗卷（1份，价值48元）：鱼肉很嫩。- 肉类 雪龙牛胸肉（1份，价值188元）：相当好，牛肉质量一流。- 其他 水三鲜（1份，价值18元）：藕、百合、马蹄 三色豆腐（1份，价值18元）：黑豆嫩豆腐、黄豆韧豆腐及玉子豆...腐合称为三色豆腐。 时蔬组合（1份，价值18元）：豆苗、生菜、菠菜 珍菌组合（1份，价值38元）：珍菌组合包括鸡腿菇、蟹味菇、白玉菇、香菇、虫草花及竹笙。作为配料是相当丰富的。- 主食 海带面（1份，价值8元）：有特色的面，还是第一次吃。海带味道特浓。 乌冬面（1份，价值8元）：这个味道很一般。- 饮品 蜂蜜柚子茶（热）（2杯，价值30元）：太甜了。- 甜品 什锦水果拼盘配布丁（2份，价值36元）：挺好的。西瓜、火龙果、椰蓉布丁。- 锅底 深海鱼骨养身汤（1份，价值38元） 深海鱼骨VC汤（1份，价值38元）差不多，没尝出差别。- 赠送 无二沙茶酱（1份） 将太海鲜汁（1份）两种酱都不好吃，我还是喜欢芝麻酱的。食材很丰富，口味不太喜欢，但内容的确很健康。擦手巾单独收费2元/个，质量很好，还是物有所值的。服务很好，只是姑娘们站在边上看着我吃，有点儿不自然。全文','99','2011-10-17 13:03:00',NULL),
	('1704f473e6ffa1556ebf9e5aeb4849b9','c1d71126b7c18cb5b97382b0f7e24522','泡泡和泡泡','5',4,3,5,'【团购点评】东西很新鲜，料很足，但是确实量太多，两个人吃不完，服务太到位了，但是不太好找。总的来说很好，下回可以继续搞这种活动哦，量可以适当减一下，避免浪费。','99','2011-11-14 13:08:00',NULL),
	('19ebde6989d0c798ad396581058e2277','c1d71126b7c18cb5b97382b0f7e24522','怪盗kitty','5',4,5,5,'【团购点评】我们两张团购券，那菜上完后满满一长桌啊，特有宴会的感觉~~~~~~~雪花牛肉味道很赞，沙茶酱比较有味，寿司滑的外形和味道都很有爱，那个蔬菜筐摆的像盆栽一样，蘑菇都很好吃，虫草花最爱。','88','2011-11-24 22:06:00',NULL),
	('1b9f5c6cd45dc6877ff768a241407188','c1d71126b7c18cb5b97382b0f7e24522','M_sting','5',4,4,5,'周六下午试试看能不能约上 没想到真的很好约 地方在酒吧街 比较靠里的位置 不是很显眼~很宽敞的沙发坐 就是觉得俩人面对面坐着 距离甚远啊~~~服务员态度超级好 很耐心 轻声细气的解释 恰到好处的加水上菜 培训的不错~前食--味付五拼：还行 有个鱼子格外好吃 鱿鱼的那个 芥末味比较冲。沙拉--照烧牛肉沙拉：靠着沙拉里的菜清口来着 牛肉反而没怎么吃了~~~刺身三拼--三文鱼、白金枪、北极贝；这个真的大爱 切得很厚 口感超级好~特色寿司滑--斑鱼海胆寿司滑，赤贝墨鱼寿司滑，鲍鱼鲑鱼寿司滑，蟹钳虾肉寿司滑，芦笋牛肉寿司滑，福袋寿司滑，确实都不错 有两种牛肉里面有芝士 由于大爱海鲜类 所以真的是每一种都喜欢 卷类--鸵鸟肾金针菇卷，桂鱼豆苗卷，没吃出什么特别 反正别煮老了就味道还不错。肉类--雪龙牛胸肉，服务员告诉说15秒 还真差不多 味道很好 。三色豆腐，豆腐控 哈哈 日本豆腐 白豆腐 黑豆腐 都不错 时蔬组合，基本没吃啊~~~珍菌组合~~也基本没吃 量太大了乌冬面和海带面 就尝了一些海带面 还真的挺有海带味道的~挺新鲜的柚子茶 很好喝~甜品是一小块布丁和水果 布丁的味道很好 喜欢~总之真的是很喜欢的一家店 希望有机会再来啦~~~','0','2011-11-16 22:51:00',NULL),
	('1bda0317ef70a5393b53a41787f7d48e','c1d71126b7c18cb5b97382b0f7e24522','吃撑与后悔之间','5',4,4,4,'平时晚上来的，没什么人就餐，下载了买一赠一的优惠券，比较划算，2个人，点了3种寿司类涮品、鸵鸟肾、桂花蚌、肥牛等等，比较清淡，味道不错，喜欢日式火锅，感觉很健康。','150','2012-02-02 16:06:00',NULL),
	('0357d5e997abe99f884d42e2ff08964c','c61bde78d6a3f06b2e3b6565b084f325','hyy冰凌花','4',4,4,3,'【试吃/体验点评】可以算是免费试吃吧~~抽中的100元现金券，于是和某人一起去的。这是第一次在花园餐厅吃饭，还好因为季节没什么蚊子。嘻嘻两个人吃了153，因为后来还加了2呗红豆什么冰，比想象的好吃多了，是椰子沙冰的。一共五个菜，避风塘盐焗大虾，鲜果酿油条，手工豆腐，清炒西兰花，铁板蛤蜊。本来嘛很喜欢鱼的，可是有人不吃鱼头，就没点这招牌菜咯！个人最喜欢鲜果酿油条，没想到油条也能做的这么好耶！沙拉加点黄瓜，菠萝，蓝莓酱，难忘呀！还有手工豆腐，没想到是汤的，还有点海鲜在，味道出奇的好，误打误撞点的吧~运气很好哦！盐焗大虾还好，蛮多的，就是不是道洒在上面的到底是什么类？蛤蜊不错，只是个人对海鲜不感冒，所以3/4都是XX吃的。西兰花入口即化，看着不怎么样，不过尝了才吃到。好喜欢呀！周围离很多景点都近，吃的饱饱的，慢慢散步，慢慢游玩。很适合约会呀！','0','2010-10-23 14:56:00',NULL),
	('042e39c7ac1c9b6b6a43ab1d1adbf1ed','c61bde78d6a3f06b2e3b6565b084f325','饕餮小猫咪','4',3,3,3,'酒店环境一般，没想象中的好，不精致，不过不能要求过高，毕竟这附近都以农家菜为主，我看这里都没人推荐整个菜，但是建议一定尝尝，吃过这么多次，什么龙井茶香鸡什么的，只有这家的花雕东坡鸡，酱汁浓郁，肉质细腻，很是爽口，出了北京绿波廊吃过一个用猪蹄配合鲍汁的鸡煲跟它的口感相似外，还真没吃过这么好吃的鸡煲，回味无穷，让我到了北京还在想念中呀。咖喱蟹，咖喱汁很不错，但是螃蟹是不是有些问题，选得时河蟹，在泰国吃的时候基本以海蟹为主，个人觉得海蟹壳薄，配合起来更适合。2个人来吃，2碗米饭，一个青菜，配合一个鸡刚刚好，鸡配米饭太绝了','90','2011-10-18 22:47:00',NULL),
	('06b6fc93ebf0e1dee519984aff032ff6','c61bde78d6a3f06b2e3b6565b084f325','风风吹','4',3,4,3,'不小心就抽中DP100元现金券上次年会的时候，米抽中，结果米空去现在运气又降临了偶滴神O(∩_∩)O喜欢那边的环境。不过。吃个饭跑这么远。相对来说还是远了点闹','80','2010-11-05 15:31:00',NULL),
	('0e2a05285f3f0ab9f28f2fb0054c9fd9','c61bde78d6a3f06b2e3b6565b084f325','星璇','3',3,3,3,'环境还不错，附近很多类似的店，比如汝拉小镇神马的。7个人点了11个菜+羊肉串，总体来说味道还不错，比较偏东南亚风味。菜的点评见照片。。。','0','2011-06-06 16:04:00',NULL),
	('0b3be0d16046b92f119e1fbb7dcc059d','c61bde78d6a3f06b2e3b6565b084f325','hanhan0690','3',2,4,2,'晚上去的，比较难找。不过环境真的是比较好呀，前一天这家店被包场了，办婚礼，很适合呀，比较有情调。菜品一般，这种餐厅一般就是以环境取胜','50','2011-11-05 15:14:00',NULL),
	('1b948edfd7f10d67cb2af5dab938581d','c61bde78d6a3f06b2e3b6565b084f325','拉拉起','4',3,3,3,'有机鱼头的配的年糕蛮有新意的 感觉比鱼头要抢戏 然后咖喱土豆泥也蛮香的 有种边吃边上火的感觉 主要胜在 环境还好','0','2011-09-30 21:17:00',NULL),
	('1be29d6355acca61029a201cf17431c9','c61bde78d6a3f06b2e3b6565b084f325','金牌吃货','5',4,4,3,'绕了西湖一大圈，才找到，周围都是山和茶园，环境真的超好，这么热的天，是在室外吃的，很大的吹风机。点菜是小黑板，没有菜单。我当时重感冒，吃什么都没味道，但当吃到这个鱼头时，那个肉好嫩啊，真的非常好吃。还想去。','80','2011-09-27 10:34:00',NULL),
	('1dac4a097e98ff8dd61160918a86dbf5','c61bde78d6a3f06b2e3b6565b084f325','蓝莓女孩love','4',3,4,2,'花园餐厅吃饭，因为季节还有点小冷，还好有煤气灯。环境当然没得说，聊天享受不错，不过还是有阳光的白天比较好，晚上太冷了。味道还过的去，适合情侣一起。','155','2010-12-12 10:21:00',NULL),
	('017d0663b10a82a5e6609e01abb151e8','c620c5fa17bc4cd4113d4aa86e7dcc6d','kikikikis','3',3,2,2,'节假日如果一家老小去上下九步行街购物,通常中午我们都会到陶陶居酒家这里喝午茶,虽然上下九步行街上的饮食店非常多,吃的种类也繁多,但总觉得喝茶为首选,因为品种多,可以吃到不同东西,面食,小吃,糕点等应有尽有,虽然价格偏贵,但起码大酒家,比较放心,而且小孩要上洗手间洗手等也方便,不象那些饮食小店,不配洗手间,极其不方便.','50','2011-09-06 22:22:00',NULL),
	('0222ae117e3695287ada70b8e5ce64cd','c620c5fa17bc4cd4113d4aa86e7dcc6d','ooga','3',2,3,3,'老字号，所以老人多。不是他不好，而是你说不出有什麽好或者有什麽不好。平平淡淡， 就算是招聘烧鹅也是这样，但吃不出来什么特别，好吃，是烧鹅本身就好吃。','0','2011-09-20 10:13:00',NULL),
	('0678c428c2dee48b1d6637b3e2f0626f','c620c5fa17bc4cd4113d4aa86e7dcc6d','crystalpann','4',3,2,2,'【试吃/体验点评】老字号的酒家,胜在老字号,虽然装修过,但都不失已经的装潢,至于点心,反而没有以前的好,去那里的都是上了年龄的老人家,我想他们去的不是为了吃,而是以前到现在的情怀和茶友们吧,所以我也会同长辈们有时都会去的,但如果是朋友们的,就应该都去那里了吧.','60','2011-09-08 12:44:00',NULL),
	('06f087fe618e78831ff5275fe78b5a1f','c620c5fa17bc4cd4113d4aa86e7dcc6d','mimiwucaiyun','4',3,3,3,'干蒸 烧卖,历史悠久。这家也是历史的历史。很不错的早点茶楼。不管什么时候都是排队等待。如果要及时有位。最好还是定下位。不然让你久等呢。哈哈。','0','2011-09-13 09:03:00',NULL),
	('0749116268ecd662ec2c65bcc3bd748e','c620c5fa17bc4cd4113d4aa86e7dcc6d','jing20042008','5',4,4,4,'老字号，去到还要排队的。环境是真的好。气氛也非常不错的哦。中秋节前还有好大好大的月饼在门口里面的哦！味道很好的！','0','2011-09-13 13:08:00',NULL),
	('0777c1eff9cd117a0951091a423bea76','c620c5fa17bc4cd4113d4aa86e7dcc6d','lycwaz','4',3,4,2,'去趟广州，怎能不喝早茶？去喝早茶，怎能不去陶陶居？就这样，我慕名而来。早早的就去占座，等朋友来，跟大爷大娘们一起喝早茶，感觉很像老香港电视里演的，呵呵~','0','2011-11-04 21:10:00',NULL),
	('0bb31eeb7327069fb06e98e3dc27b0af','c620c5fa17bc4cd4113d4aa86e7dcc6d','wwsshh','3',2,3,3,'陶陶居原名“葡萄居”，取“乐也陶陶”之意。茶楼大堂上耀眼的牌匾上“陶陶居”是清末文人康有为的手笔。文化大革命时期，陶陶居曾被迫换上“东风楼”招牌。2000年，幸运楼饮食集团以租赁形式接管“百年老字号”陶陶居。在休息日，上下九人头涌涌，入陶陶居内饮茶的人也是人头涌涌，取点心是自助的，在点心档前也是里三重外三重，大厅很“嘈杂”，同桌讲野还要用吼，真是怕怕！这也是早茶特色。在以前，也曾去过陶陶居，前一段，也去了趟，觉得装修明显比以前好了很多，尤其是房间漂亮了不少，包房内会专门配备一个服务员，服务也比较到位，餐具干净，公用的餐具和个人使用的颜色不同，易于区分，食物用料也可以，白切鸡肉的质地几好，鱼就明显蒸老左；炒丁打的芡具然没有搅好，一团一团的生粉粘在表面，真没有想到会范这种低级差错！','80','2011-09-12 23:35:00',NULL),
	('0c52800a6b902ea21feb065702b59d83','c620c5fa17bc4cd4113d4aa86e7dcc6d','nego1983','3',2,2,2,'去广州怎能不饮茶 看点评陶陶居的评价还不错 于是赶去饮了下午茶 等位时间不长 很快轮到 不过要跟别人拼桌 貌似下午茶是14:30才开吃 到的早了的，都在坐等 再说味道吧 说实话我感觉陶陶居的味道一般般 爪子不够入味 牛百叶也是 排骨还凑合吧 期望太高 有点小失落啊~','40','2011-12-14 14:42:00',NULL),
	('0e7b43f6227825532141186823575561','c620c5fa17bc4cd4113d4aa86e7dcc6d','annakwan','4',3,3,3,'西关传统婚宴酒家。宴会环境比较宽敞，有新娘化妆间，迎宾区有足够地方可以摆设鲜花画像、兄弟姐妹团有足够地方活动。酒席价格相对于星级酒店比较经济，平民化。','0','2011-11-16 10:39:00',NULL),
	('1138fbb20795f6195e2edef0a15ce875','c620c5fa17bc4cd4113d4aa86e7dcc6d','SMJZ','4',5,3,2,'【试吃/体验点评】好吃就真的是好吃啦。不过人真的太多了，又要排号。。下午2点半之后打折的下午茶更是人多死了。。不过好多老人都在吃，应该可以说是绝对的老字号啦~','50','2011-11-18 16:36:00',NULL),
	('1533d833323b86b13aa9523471b9a95a','c620c5fa17bc4cd4113d4aa86e7dcc6d','cindy42','3',2,2,2,'初五同左个同事去饮下午茶，人好多啊，不过过年都系咁多人啦，两个人吃左好多野啊，拿左个炒面、凤爪、排骨、牛羊杂汤、虾饺、甜薄饼、萝卜糕、哈哈！！吃得好满足啊！！而且结账后个数好意头啊，88元','44','2012-01-31 12:23:00',NULL),
	('18d590ced59c5c0ea609031986b0a201','c620c5fa17bc4cd4113d4aa86e7dcc6d','Zz_Lingxi','3',3,2,2,'去过好多次的酒家了，下午茶有几款六蚊特价，觉得唔错噶~好食又唔贵~不过真系好多人咯，唔想等位要两点去到啦，跟住去摞野食个度，滴人好似唔使钱感系甘争住摞~因为个度真系好多特色东西吃·~服务员就唔多咯....下面有个外省人觉得陶陶居的服务员老，人家做了几十年的，经验丰富啦，你是来看美女的吗?！要想喝贵茶靓茶就要功夫茶啦，这么懂品味茶就不要到茶楼啦，你不懂广州人的喝茶方式就不要乱说啦，如果真的像你讲的那么差，广州人都不会去。','40','2011-08-20 11:08:00',NULL),
	('1a8c9ee011ffdb4bd969992901a1307b','c620c5fa17bc4cd4113d4aa86e7dcc6d','不了吃','3',2,2,2,'去喝茶，周一的早晨人依然很多。多数是“老广”们，一壶茶，一份点心。叹人生啊。。。惬意之前一般都去旁边的广州酒家，这次也是突发奇想决定也来这件老字号尝尝。环境广州的早茶酒楼都差不多，要拼桌，也要忍受对面人的烟雾缭绕。食物认为就不及广州酒家了，首先凤爪不够软糯，虾饺的皮有点厚，最郁闷的是没有榴莲酥，哎 我最爱的榴莲酥啊。。。但是貌似价格就平过广州酒家，俩个人吃了70多，撑了还打了包。','40','2011-07-14 13:15:00',NULL),
	('1b60a2eee3119eb79af846c621b25e3a','c620c5fa17bc4cd4113d4aa86e7dcc6d','chavalito','3',3,2,2,'广州老字号啦，很受欢迎，但是如果作为婚宴场所就显得略为老派了，可能老人家会喜欢，但是出品一般，环境比较吵杂，更惨是停车难','0','2011-11-24 12:26:00',NULL),
	('0d7946d7d56fbbfc5ee8166f545f26dc','c77f33f692f4f5239ed2965568c6e20f','巴黎没有摩天轮','0',3,2,2,'名字叫太贵，其实也不是太贵啦它家砂锅最有名的就是鲶鱼锅，味道很不错，最适合两三个朋友小聚，吃点家常菜','0','2009-09-16 14:21:00',NULL),
	('1132c899a832e26a37f1e114f44d7cb5','c77f33f692f4f5239ed2965568c6e20f','食神梵梵','4',4,3,4,'味道非常的好！我是在清泉寨那里吃的！和我同学聚会的时候第一次吃到那么好的鲶鱼沙锅！后来我还带去了很多顾客去品尝！','25','2010-04-06 19:31:00',NULL),
	('115f086e753c52d49c94054915f09195','c77f33f692f4f5239ed2965568c6e20f','宫泽蝶野','3',3,2,2,'就在学校附近，我们学校很多人喜欢去。自己去过一次，不是很喜欢。而且要走好长一段路。听说最近搬新店了。更大了，环境更好了。特色当然是砂锅了。品种很多。生意很好。想去的话要挑好时间，否则会去等很久的。','15','2009-12-25 23:36:00',NULL),
	('13c735058936eaf434dc68f81aa83851','c77f33f692f4f5239ed2965568c6e20f','zacer','4',4,4,3,'口味和环境总体不过，尤其是凉拌黄瓜不错，还有几个特色砂锅也不错，服务还有待提高，价格也不是很贵，性价比较高，推荐大家可以去尝试尝试。。。','40','2010-09-29 00:24:00',NULL),
	('15bcccef7ae729b1cb05b10dab7e12dd','c77f33f692f4f5239ed2965568c6e20f','我和雨菡','0',2,2,2,'看了大众点评 去了烟大的店 环境还行 就是不怎么爽亮 老板娘和老爷爷都跟大家说的一样 砂锅还行吧 看介绍挺好的 养生锅 吃在嘴里有点腻','30','2009-09-06 07:26:00',NULL),
	('1d0e0dabbdbf3bf6813df1eb646d701f','c77f33f692f4f5239ed2965568c6e20f','流落小岛的筷子','4',3,2,3,'读书的时候经常去吃，快成了第二食堂了，鲶鱼砂锅不错，凉拌黄瓜很爽口，一定要试试！还有那个什么小白菜炒粉条吧，也挺好吃。菜的味道整体偏浓，喜欢重口味的肯定喜欢，整体挺好，价格也不贵，就是吃完身上一股子味。','0','2011-05-15 07:35:00',NULL),
	('0219a5cb2ab91b3c6a6457d04e10387a','c8342e51bf34b77e9c1257e9f1a5d2a8','tl19820509','5',4,5,5,'哈根达斯吃到饱，生鱼片还行，甜点也很有特色。每次吃很多，烧烤之类的就没什么特色了，还是海鲜类值得吃一次，小羊排也很不错。','138','2011-07-21 19:14:00',NULL),
	('026ff77ac72759977744b91898b234f7','c8342e51bf34b77e9c1257e9f1a5d2a8','daijiajia515','4',4,3,3,'【试吃/体验点评】【团购点评】东西新鲜，味道也蛮好的，多弄点团购就好了，鲍鱼汤去晚了就没有了的。环境是蛮好的，去的比较早，所以很多东西都吃到了','168','2011-07-13 21:37:00',NULL),
	('074c49d6cd7de10a27d72f09eea7eccd','c8342e51bf34b77e9c1257e9f1a5d2a8','chong53','3',2,2,4,'【试吃/体验点评】第一次吃海鲜自助的地方，不敢多吃怕拉肚子，所以说实话没吃出什么味道来。后来去过了金马门和金鲨之后有了比较，更想不起来到银鲨吃到了什么好东西了。悲催啊。印象中吃了雪蟹腿，蟹身子，酥皮汤，排队等了油炸天妇罗（这个我以后都不会再吃了，划不来，占肚子。。。。。），还有刺身（吃的心惊胆寒）。如果有人再请我去吃饭，我一定好好再品一品。。。。。。。。。','98','2011-07-28 17:16:00',NULL),
	('09879eccad35cb7c622ad5e404ee3ac3','c8342e51bf34b77e9c1257e9f1a5d2a8','124678559','3',2,4,4,'感觉非常一般 当时 是小侄子看到门口挂的水晶门帘跑进去了 所以我们也就在里面吃了 环境还不错 不过菜品不怎么样，而且 我们还没吃完 服务员就开始收盘子了 才一点钟 东西吃完了也不补了 去了四个人 估计连一个人的钱都没吃回来','148','2011-07-20 09:07:00',NULL),
	('0d4da97094e0955f66eec25fce9ece13','c8342e51bf34b77e9c1257e9f1a5d2a8','蜜小莞','3',2,3,2,'广发6折去的，东西确实比金鲨少，而且味道也真的是太不怎么滴了，好在人少，环境不错半价还是可以考虑的，全价的话，还不如去金鲨呢！','88','2011-09-07 17:02:00',NULL),
	('0f4b8236d60c09d939089a58db06db1d','c8342e51bf34b77e9c1257e9f1a5d2a8','落花深处马蹄香','3',2,3,2,'汉口银行做活动打6折去的，价格还划算。不过象我这种不大吃海鲜的人来说怎么都是回不了本的。只喜欢吃基围虾，但是他家的虾都是冰的，有点不适应。丢牌子的食物，进去就丢了，到要走了还没上，这点很郁闷。服务的问题，不好说，缺少温馨的感觉。环境倒是我喜欢的。没折扣肯定是不会去了。','102','2011-07-16 16:44:00',NULL),
	('12cb66e46195bc9c662909307af6fc9e','c8342e51bf34b77e9c1257e9f1a5d2a8','阳光妈妈咪','4',3,4,4,'广发信用卡打6折去的，环境和服务都不错。菜品做得还算精致各种档次的菜品都有，可惜的就是品种不是很多。性价比跟金鲨比起来还是要差一些的。不过银行活动去的还是满划算，老公的一盘刺身可能就抵回整餐饭钱了。','101','2011-07-19 07:43:00',NULL),
	('0448b5e70b344bc47a9211f72baf1174','ca4304fd503b4d731f6a655031cf3a27','囩囩乖尛囡','4',3,3,2,'【点评团消费】团购去的，想给小宝尝个鲜~他家预约电话灰常难打，基本么人接的，就直接冲了~店小小的，MS台湾人开的，进门空间相对有些拥挤，零星摆着几张桌椅，楼上没去，不予置评~团购验证、领单、开等，之前有客户因等待时间过久差点翻毛腔……【厚切猪乐米堡】：比想象中大，猪肉厚实，炸后香脆，配以洋葱丰富味蕾，米饭软糯，一个下去管饱~【海连奇奶茶】：要了热的，偏甜，总体不够浓郁，冷后反而口感更加~总的来说单点性价比不高，偶尔不妨尝试一下套餐~','20','2012-02-12 13:00:00',NULL),
	('057d2e233a5a08dbffd4f83fc30da95c','ca4304fd503b4d731f6a655031cf3a27','永远爱老公','4',3,4,3,'和朋友在附近，所以就去填填肚子，东西还不错的，吃了一个米汉堡，还吃了个金黄地瓜，嘿嘿，在里面吃东西一点都不冷呢。她吃了那个猪排，说蛮好吃的，就是不知道哪里好吃，傻样啊','35','2011-12-26 11:44:00',NULL),
	('06a55a0e6bbe2b66ec2e515c95914943','ca4304fd503b4d731f6a655031cf3a27','IMJUPITER','5',3,3,3,'算是比較精致的快餐店，丁丁杏鲍菇讚一下！難得吃到油炸的蘑菇啊！套餐性價比很高。環境還不錯價格又不貴，於是看到很多小情侶在那劈情操和自拍= =','35','2011-12-20 10:22:00',NULL),
	('0a12dc2f868858786d633346936acdbf','ca4304fd503b4d731f6a655031cf3a27','Rita999','4',4,4,4,'外壳金黄香脆，夹着醇香帕玛森芝士和鲜香火腿，一口咬下去超幸福，汁水四溢，热cheese，很容易烫口的，要有技巧！愚园路店是独栋白色的三层小洋楼，环境很好的休闲餐厅，点套餐还有小食+甜点+饮料','33','2012-02-02 15:20:00',NULL),
	('0dfd0f974efbbef126ac76e624d4782f','ca4304fd503b4d731f6a655031cf3a27','Luei啊','4',5,5,5,'长的一点不像买猪排的地方 环境很好 服务也是 有无线 要密码 和同学点了套餐 东西都很不错，我点了蓝带猪排 同学点了波波鸡排 觉得猪排好吃哦 里面的芝士好烫的 可以拉好长。东西量也很大，当顿饭吃可以。','35','2011-12-25 11:58:00',NULL),
	('0ee445aafba415a24eae76a1050c2437','ca4304fd503b4d731f6a655031cf3a27','金小MAN','4',3,3,3,'就吃快餐来说 他家的环境还真不错 点了米汉堡套餐 地瓜干超好吃的配上梅子粉 味道哈嗲 奶茶也跟正点 茶味够浓 套餐里唯一比较不灵的就是鸡蛋布丁了 怪怪的味道 蓝带猪排也蛮不错的 丁丁杏鲍菇味道蛮特别的 整体不错','42','2011-12-09 21:04:00',NULL),
	('1119879dbd224938ddab7357ceef2674','ca4304fd503b4d731f6a655031cf3a27','橙家小宝coco','4',4,4,4,'2012.02.02 午餐吐槽一句原来我是在这么压韵的日子去的酱烧牛乐米堡套餐（32元）米堡味道很赞，牛肉很入味，只是单一个堡不饱，必定要配餐，地瓜条太甜了，仙草无爱，饮料有香精味。服务不错哒。这不是快餐，需要等十五分钟，赶时间的筒子们放弃吧。','32','2012-02-03 13:51:00',NULL),
	('1c851862d4bcae7e8af3ce0d44e7a160','ca4304fd503b4d731f6a655031cf3a27','easykafka','4',3,4,3,'慕名而来，没有失望第一次要了招牌义法蓝带猪排挺大的一块，外壳很脆，一口咬下去汁水四溢内里是上下两块猪排，芝士也是不少，呈流质夹在中间，另有火腿两片，外观看起来则浑然一体猪排没有过多的调味，淡淡的，完全靠肉质本身的鲜味，跟其他专注于调味料添加的店相比，有些冒险巧在我相当喜欢芝士的味道不浓厚的，也没有照片上看起来粘稠，倒是挺能烘托出猪排口感饮料要的是白桃乌龙，顾名思义是桃子口味的乌龙茶，歪打正着毕竟猪排还是有些油腻，正好用乌龙茶来解腻，口味不错第二次要了鸡腿套餐比起单点来套餐划算很多28元的鸡腿套餐包含16元的鸡腿、12元的饮料、小食和甜点要了海连奇奶茶、丁丁杏鲍菇和布丁鸡腿外裹的是跟猪排的炸粉不同的面浆，吃多了略油腻，鸡肉略干丁丁杏鲍菇外脆内韧，外壳鲜中带甜挺有特色，但时间久了就会软掉，最好趁热吃布丁一般，口感接近果冻奶茶还行，但也没太大特色总体来说套餐比单点划算，整体价钱略贵，胜在环境不错，独栋小洋楼，装修虽不豪华但整洁温馨，映着暖色灯光窝着舒适沙发，看窗外梧桐摇曳，好过大多数外卖鸡排店捧着食物风中凌乱就是发现二楼靠窗的桌椅中间没有空隙，如果都坐满的话，服务员想要送餐到最里...面的座位可能不太容易全文','40','2011-12-15 23:26:00',NULL),
	('188c51bb16709e6bd31fa37fa66d339e','ca4304fd503b4d731f6a655031cf3a27','maydaymasa','3',2,3,3,'朋友推荐而去 感觉有点失望波波脆鸡排 撒拉梅子粉 觉得很一般 但是鸡块很大 义法蓝带猪排 没有猪排味道 香肠味道有点浓 办桌大鸡腿 值得推荐 一面都是梅子粉 好吃环境不错 就是速度有点慢 各个套餐价格还可以','32','2011-12-17 20:59:00',NULL),
	('002509d5667c4f425ba59ce0de5706b1','cbb00c00c821c51ebccbdd6e36872b35','zhenxin54321','1',2,1,1,'实在是不明白这家店为什么人那么多，我们下午5点到的，等了至少两个半小时了吧，才排到，东西和其他新疆餐厅差不多，也没什么特别的地方，桌子和桌子之间离得很近，胖的人估计侧着身都走不进去……上菜速度特别慢，我们的菜都吃完了，还有一道菜没上，尤其是服务员态度特别差，让他帮我们催催竟然不愿意，竟然和顾客吵了起来，真不知道他们是怎么服务的，就这个态度，以为自己店人多就了不起了么？以后不会再去了，全都浪费时间排队了……','0','2012-02-12 00:14:00',NULL),
	('0520d0839966576b72a1b76efbced398','cbb00c00c821c51ebccbdd6e36872b35','michelle0907','4',4,4,4,'和闺蜜去的，下午三点没什么人，两个女人点了大盘鸡，发菜，羊排，厥根粉，奶茶，酸奶，其他都不错就是厥根粉太难吃啦！不如味，不q。奶茶还不错','80','2012-02-08 08:57:00',NULL),
	('0530f86ae22c6f353af449128627e826','cbb00c00c821c51ebccbdd6e36872b35','火焰玛瑙','4',4,3,3,'我有一元秒来的 半夜随手刷屏 结果秒到了 晕死 以为可以去南丹路用 结果发现仅限政通路 太远了不吃了 谁要送给她','0','2012-02-15 19:14:00',NULL),
	('080cbf25f0c86fc22cb69cc86b20d0e0','cbb00c00c821c51ebccbdd6e36872b35','占东占西','4',3,2,3,'【点评团消费】因为有秒到1元券所以下班从长宁区了杨浦~因为先有排队所以到了就可以吃。点了羊排、番茄牛腩、牛奶饭、木耳和杏鲍菇。签到送了奶茶，量蛮大，吃不掉。羊排味道很好，没有腥味，番茄牛腩就很一般了。浪费了一大半。牛奶饭是甜品，一直想念的味道，大爱，不过19元的量好小哦~总体价格不便宜~不过味道还是不错哒~','100','2012-02-10 11:01:00',NULL),
	('0876e0386d235fecf7fe270d00d1d811','cbb00c00c821c51ebccbdd6e36872b35','捞家hj','3',2,2,1,'很火爆的一家新疆菜馆，不知道什么原因那么火爆，朋友等位子将近1个半小时才排到的。其实菜什么的也很普通啦，不过打8折，价格方面倒是很优惠的。它家的酸奶不错，是那种老酸奶，味道很正，奶茶也不错的，口感很细很滑。羊肉串一般般啦。那个牛心菜还是不错的。丁丁炒面味道也不错。不过那个菌菇和牛肉的菜就很一般，里面放辣椒影响口感。因为生意实在太好了，所以服务员都忙不过来，拿两个杯子竟然叫了3个服务员。还有上菜的顺序也不大多，主食先上了，后面还有一个菜等我们吃好了都没上，最后取消了。总体上不错的一家店。','60','2012-02-10 23:10:00',NULL),
	('09e9eb9083294e92155984615faee4f5','cbb00c00c821c51ebccbdd6e36872b35','蔚蓝的天空Jane','4',3,2,2,'2011.2月逛五角场特地安排在此午餐～ 双休日中午的生意超级好，等座等了30分钟～环境：感觉比较普通，之前吃过其他分店的，虽然该店是新开的，但感觉装修稍微简单了一点，没有其他的好。口味：点了以下几个菜大盘鸡：亮点在于土豆，这个土豆和平日吃到的不同，估计是专门的地方供应的吧，相当的酥，糯，超级好吃，鸡肉平平，就是普通的肉鸡，这款菜的酱汁很好，烧的很入味。Ps：不能吃辣的同志免尝。羊排：很嫩，很新鲜，Lg说这个是他吃到过最好吃的羊排。脆皮豆腐：超级不好吃，外皮不脆，味道也不怎么好，怀疑是回锅的。羊肉串：味道纯正，肥肉稍微多了一点，如果能肥瘦比例再匀称一点更好。番茄炖牛肉：和图片上不是很一样，像一盆汤，类似于罗宋汤，但没有罗宋汤那么浓郁的味道，清新许多，相当的开胃，牛肉量不算多，但肉质新鲜，推荐牛奶饭：说的直白一点就是：一份牛奶布丁+米饭粒，爱吃甜品的应该会喜欢，作为吃完菜后的甜品还不错的。招牌饮料：口味纯正+香气浓郁+原料新鲜=美味奶茶：口感平平，不具亮点。总的来说在五角场又多了一家人气餐厅，爱吃新疆菜的可以去尝试一下，但最好能提前订位，否则排队时间满节棍～BTW：无法提供餐饮发票...','0','2012-02-11 18:30:00',NULL),
	('0d50f1e2d2c20e77e480a5bb67927131','cbb00c00c821c51ebccbdd6e36872b35','krisyding','5',3,3,2,'9个人去吃的，定制了一只20斤的烤全羊，味道不错，可惜吃伤掉了，如果13个人左右应该就正好了。饮料不错，奶茶、蜜柚情缘都很原汁原味。以为提前预定的，所以没有等位，但是由于全场八折，所以排队的人很多很多','140','2012-02-12 19:34:00',NULL),
	('12e33841301dd83978b30bc8860eab32','cbb00c00c821c51ebccbdd6e36872b35','非席','3',3,3,3,'周日的下午四点就去门店了，料想够早了吧，结果已经很多人排队了，三个人六点才排到，妈妈咪呀，那下次要提前到几点啊。等位的地方幸好找到了位子坐，还有免费的奶茶可以供应。因为新开业打八折的关系，真的是人山人海。下面来点评一下吃食，因为之前有看到点评上说量不多的吧，所以三个人点了六个菜，结果七个菜，结果有三个菜基本没动过啊。首先最喜欢的是羊排（68元），看上去像一个整羊腿切的，提供两种酱料，外皮非常脆，肉也很嫩，吃着赶着不干燥，我个人喜欢什么酱料都不用，就这样吃。羊肉串每人点了两串，一共六串（3元每串）。我觉得味道还是比较好的，一定要趁热吃，然后就是呢有一点挺奇怪的，上面的瘦肉和肥肉是分开的，就是有一块是全肥的的肥肉，其他都是全瘦肉。大盘鸡（68元），其实羊排混着酸奶喝下去，已经有些饱了，大盘鸡果然是好大一盘啊，里面肉也挺多的啊，但是真的应该是肉鸡的关系，真心觉得肉有些粗，不是很喜欢，里面的土豆烧得很酥烂了，但是偶没有吃。番茄牛腩（48元），之前纠结是点这个还是点另外一个小番茄牛腩，后来看到图片上有亚克西的字样，我们觉得是推荐的意思，就点了这个，怎么说呢，牛肉是那种很有嚼劲的，我不喜欢，然后番茄...牛腩里面的汤水我以前都是直接喝的，但是这个喝了一口，很咸很辣的。一般般。还有一个貌似叫什么羊肉薄饼吧，（48元）就是类似于片皮鸭的吃法，吃不下了，一口没动，不点评了。丁丁炒面（18元），这个热的时候味道真心不错的，有点酸，做主食不错啊。还有一个牛筋菜（20元），想想都是大肉了，总归要点一个蔬菜吧，就是手撕包菜，和其他店差不多，无功无过。酸奶（9元一杯）：就是自制酸奶，但没那么酸，上面点缀着几个葡萄干，手工酸奶我一直很喜欢的，所以全喝完了。街旁网签到送一杯奶茶（原价说要10元），可以点甜的、咸的、原味的，我们一个人点了一种口味，其实就是等座时外面送的那种奶茶，加糖加盐进去吧。原味的还挺香浓，朋友反映咸的味道有点怪，特别是吃到后来，感觉嘴巴是苦的。氛围还可以吧，从六点半开始没隔十分钟左右会有舞蹈表演，还会请客人上去跳，热闹是挺热闹，但是如果朋友间是想聊聊天的话，那还是免了，根本听不清楚。上菜的速度很快，除了番茄牛腩等了半小时最后一个上来，其余在半小时内都上齐了。最后打八折是260元左右。回来家里都知道我今天吃了新疆菜，据说因为闻出了我衣服上的味道，所以口味还是有点重的。从三月一日起是搞满一百减二十的活动，觉着吧，如果是肉食动物去还是会满意的，哈哈。全文','85','2012-02-06 11:24:00',NULL),
	('140f4e51d9974314cc82bbd2dcc8ad33','cbb00c00c821c51ebccbdd6e36872b35','niro_nzaus','1',1,4,1,'【试吃/体验点评】周末下午3点50分去的。等了10分钟有了座位，点菜，第一个酸奶最快了，接下来面条（热的），吃完了。。手抓饭还没有来，半小时后去问，才被告知饭卖光了（为什么要半小时候才告诉我）。后来我点了烧肉拼盘饭，才发现原来手抓饭是有的。（这不是明摆欺骗客人吗）。 知道为什么不卖饭了吗？原因是4点半的时候有四桌他们自己的员工开始出来吃晚饭了，约20几个人。就把客人凉一边，估计只有5个人在外面服务。到了5点才上了烧肉拼盘饭和羊肉串（等了将近1个半小时的羊肉串） 。全部都是冷的！！！我们也算了，知道新疆人很凶悍。。便吃了。。。大家以后去的话，接受好1小时只有8桌的饭桌率吧。我们离开的时候，不夸张的说里外估计有50几桌人在等，比什么外婆家夸张多了。。就为了那个8折优惠吧。这样的地方请我去也不要去。。。','35','2012-02-12 10:20:00',NULL),
	('14a6ab27eace426cb6ef785f84db0b1e','cbb00c00c821c51ebccbdd6e36872b35','gump0502','5',5,5,5,'五角场店不用等太长时间，酸奶很好吃，酸汤漏鱼味道很特别，咸奶茶要慢慢适应，羊肉串有点小，大盘鸡的面有点少，服务态度挺好！','50','2012-02-08 21:04:00',NULL),
	('173fcc6250af8dc0a335c0fee305dc97','cbb00c00c821c51ebccbdd6e36872b35','Celiababy','3',2,3,3,'五角场。。。向来不喜欢~~~介于又一会吃得各种不爽后，有人提议继续第二腐~~~错克是蛮错克额，好选不选，选个阿里巴巴。。。。NND，姐不要次的好哇~~~这年头啊，好人未必有好报~~~但坏人肯定还是会有报应、报应哒~~~哇咔咔~~~能见着的就数等位的可爱人群了~~~吃呀，再吃呀~~~尼玛！！！！！！居然跑去外卖了，神马世道啊~~~服务员貌似也灰常的乐意，还同样给打了8折，我泪奔T_T~~~提着各种骚味，走吖晃吖~~~想吐啊~~~晚上后来尝了下下~~~哎呦，被嘲笑死了~~~不过有句说句，羊肉串的味道还是可以的~~~自打中学之后，就再也没吃过羊肉串。。。。与以前在云南路海宁路口吃的那家，有的一拼~~~羊排也挺嫩的，但相对羊肉串，少了几分羊骚味~~~传说中的丁丁炒面，坚决不次，诡异的颜色，怪异的做法，看着就没胃口~~~还有个牛舌，OMG。。。点的什么菜。。。不！好！吃！带着股小辣，一点都不来劲~~~虽说这家店生意好到不行~~~但偶依旧不喜欢~~~HOHO~~~','0','2012-02-13 10:30:00',NULL),
	('196bb0c861224ee2cdaf9878e9867c5b','cbb00c00c821c51ebccbdd6e36872b35','xellosss','4',4,2,4,'味道不错，但是排队太长。羊排很香，大盘鸡味道不错，量挺少的。据说酸奶是特色，但好像没什么味道，不酸。奶茶很奶，有点微咸。','80','2012-02-12 17:31:00',NULL),
	('1ad66dbe43a946ff42059217887a167d','cbb00c00c821c51ebccbdd6e36872b35','aoxinyi减肥进行时','4',3,3,2,'曾经在田林那里吃过，映像非常深刻。这次内阁说要请我吃饭，正正好最近想吃点味道重的东西就决定去那里了，看到DP有团购，可惜下手晚了只能直接去吃了。内阁很早就去排队了，可惜还是要等号，不过还好，差不多第一批翻台的时候就到我们了。因为镜子的关系，店里看上去很宽敞。人气相当旺，一会会时间就很多人在排队了。店里在搞活动，全场8折，估计很多人就是因为这个来的吧。点了羊肉串，大盘鸡，牛奶饭，奶茶。羊肉串是冷的，没有田林现烤的好吃，大盘鸡味道蛮好，但是比田林那边的量要少一点，牛奶饭很不错，比较合我口味。吃了一半服务员来说奶茶原料没有了，正在送来的途中，至少要半小时，个么就点了两份别的饮料，结果搞笑嘞，点完10分钟，奶茶上来了。。。叫了服务员去退单后面的两杯饮料，结果确认了三次，连领班都叫来过，领班回复是都推掉了，过了会儿，饮料竟然上来了。。。服务说实话感觉真心乱，我吃完逃单的话估计都不知道。。。中间有穿插歌舞表演，还算不错，至少没有某蕉叶吓人。。。总的来说还过得去，但是相比更愿意去田林那里吃。。。','100','2012-02-16 00:08:00',NULL),
	('085a12804e6c26ace4e7925ea5e3968b','cca6d4116325f6ccb85b04ee56213b7e','b3b','4',3,5,4,'从动物园地铁c口出出往首展方向很快到，格瓦斯、红菜汤好喝，烤鱼太老，罐牛肉好吃，但份量少，有两俄女散步唱歌，环境大会堂的宽敞，喜欢！有情结！首展的广场气派，原来爱乐在这！','140','2011-10-21 12:25:00',NULL),
	('0a641ebb61fb8574cc0dcd8e4109179d','cca6d4116325f6ccb85b04ee56213b7e','bertillawu','5',3,5,2,'我个人口味比较清淡，所以实话说不太适应老莫的菜品风格，但是老爸老妈吃的很哈皮，罐儿焖、烤杂拌、烤鱼、红菜汤、首都salad。。。。还有几盎司的伏特加（一般，而且小贵！如果不是无酒不开席的，不建议买，呵呵）。带老人来这里吃饭是不错选择，我们是装修前去的，环境超一流，我很喜欢这里的环境。','100','2011-11-25 09:27:00',NULL),
	('0f44b31bd7991b839591ffde85a35107','cca6d4116325f6ccb85b04ee56213b7e','蓉咩咩','3',2,4,3,'今天和男友两个朋友一起去的，知道老莫是一家很有名的餐厅，一直想去尝尝味道。四个人吃了一千多，菜都是小份小份的，人很多，难道都是去回忆的？吃不太习惯菜的味道，总之是领教了，尝尝不同风味嘛~~~(〉_〈)~~~本人还是比较喜欢罐焖羊肉吧！','0','2011-09-11 22:48:00',NULL),
	('10a540ff9cd78c7b4c5736f336a7b6f3','cca6d4116325f6ccb85b04ee56213b7e','精灵鬼燕子','3',3,4,3,'朋友请客去的，之前没去过，朋友经常去，觉得无功无过吧，装修还不错，很富丽堂皇的感觉，不过居然在哪遇到了之前的同事 嘿嘿有点意思','150','2011-09-10 15:47:00',NULL),
	('10bb0bce79c8ce997d70af364ff40304','cca6d4116325f6ccb85b04ee56213b7e','天堂在笑','5',5,5,5,'只去过一次老莫，但给我留下了极其深刻的印象。我记得红菜汤，特别的好喝，我们当时去了三个人，两个人要的红菜汤，一个人要的奶油蘑菇汤~我一个人就把两份红菜汤给喝完了~味道很特别，有点番茄味，咸甜的~当时还要了奶油烤鱼，挺香的，但是我这人不大吃奶油，基本上是别人消灭这道菜的~当时吃的不是大咧巴面包，要是什么黑麦还是全麦的面包，麦香味道特别足，很好吃~走的时候，从他家自己的面包房买的大咧巴回家吃，就喜欢这个味儿！','200','2012-01-19 17:23:00',NULL),
	('189402bdf700d15e70c1b64da72d809f','cca6d4116325f6ccb85b04ee56213b7e','不懂世的猫','4',3,4,2,'老莫是多少年以来北京西餐的标志之一啊..父母那一代就极富盛名的&quot;传说&quot;.. 装潢非常之好~ 虽然性价比不算很高.. 但是试试还是可以的... 菜量不大.. 但是奶油什么的热量比较高.. 也算是能接受的价格可以吃饱嗯.. 瓦罐牛肉还是不错的~ 沙拉实在是不推荐... 也就是第一次去的时候见识一下..  奶油味道很正点哦~ PS晚餐时段穿插的表演还是挺有气氛的~ 有点莫斯科的意思..','100','2012-01-01 14:14:00',NULL),
	('192f51a71d41be0e0de4ae282596fe7a','cca6d4116325f6ccb85b04ee56213b7e','企鹅最爱西班牙','5',5,4,5,'一共去了两次，和朋友去了一次，和老公去了一次老莫总归是莫斯科西餐的老店了，做菜的味道还是相当正点的特别喜欢他家的奶油烤杂拌，不腻，里面的肉也很好，各种肉类很齐全，分量也还算足有一次点了美人沙拉，觉得蛮好吃的，土豆泥和火腿的混合，最喜欢土豆神马的菜了奶油蘑菇汤用汤盘盛的，一开始看是盘子还嫌少，真喝起来才知道量大的可以，喝完都快饱了，汤很浓，奶油味十足某次吃了那个鸡排，也不错，肉很嫩可惜一直没点罐焖牛肉，因为小时候吃过，总想再去就尝尝新鲜的，但是其实自己也忘了小时候吃的味道了，以后再去回味一下吧','150','2011-10-20 17:58:00',NULL),
	('1c2ce08b3cdef0c3944887935cbce141','cca6d4116325f6ccb85b04ee56213b7e','xue小duoduo','3',2,3,3,'来老莫吃俄餐，完全是出于对那个时代的回忆，口味相当的清淡，几乎没有可圈可点的菜色，来感受下环境，吃个名声而已。。。不如彼得堡，大笨象那几家小馆的口味好。','190','2011-11-07 00:02:00',NULL),
	('1e2ee86a3e635a5edb57a08841091615','cca6d4116325f6ccb85b04ee56213b7e','斯乔','4',4,4,2,'最近写的点评都有点刻薄。。不行要写的好的，攒一下RP！知道老莫的途径不是口口相传，不是美食推荐。而是装修杂志和一溜国产连续剧的场地鸣谢！貌似高干男主和女主总有那么几段是在老莫发生的呀！ 个么一定要去体会一下！老莫很霸气！ 人家的霸气在于location！开在北京展览馆里面。同志们。是真的在展览馆里面啊，和在展览馆附近租个小店门搞个小承包是不一样的概念啊~进了转门，看不到餐厅，先看到10多米高的吊灯，闪闪发光。然后往左转上台阶。各位~餐厅到了！我们不说餐厅挑高，不说那方方正正的格局，也不说那桌子的摆设。这随随便便一看，就是个上海酒店会议厅的样子啊。。点菜开始格瓦斯先来2杯。这个和在新疆餐厅喝到的好像是同一个东西，价钱也是一样的。只是人家15块是一瓶，这里15块是一杯。红菜汤：我妈说就是稍甜点的罗宋汤。虽然这种场合附和她会有损我选这么个餐厅作为晚餐的自信，不过事实的确是如此！奶油烤鱼：这个东西好吃~奶油土豆加雪鱼(maybe) 香浓四溢，在家还么办法DIY！酸黄瓜：都是我吃的。我妈嫌酸，我觉得给力~罐闷牛肉：罐子看起来不大，但其实里面东西还真多啊~吃啊吃啊吃啊的，我还真饱了！列巴：话说不来老莫我真是不...能感受到列巴到底是个啥东西啊，不过吃过以后原来列巴就是这么个东西啊~所谓俄罗斯菜的关键就是鱼子酱，不过我环顾一圈貌似么人点，个么。。全文','170','2012-01-16 20:56:00',NULL),
	('07fa27eb0e573d79031346cccc93580e','cd93a73c72027bf514109465e368a05f','蛋桶豆豆','4',3,3,2,'豆豆到科大看老公就一直住在江南春的，这里话说比上海的房价要实惠太多了，商务房178一晚（会员价），床非常非常大，还有卫生间也很宽敞，水龙头很舒服，总之非常满意的。至于下面二楼的餐厅豆豆也是要表扬一下滴~吃过自助早餐，东西基本都是中式点心，品种不是很多，口味还行。尤其喜欢里面的玉米，非常糯，豆浆也很好喝。但是包子、窝窝头什么的就有点冷掉了，影响口感。配粥的小菜味道还是蛮好次的~~这回中午也在这里吃了一顿，是自己跑到3楼去点餐的，话说他们家午市生意真的灰常灰常好，幸好偶们11点就下来吃饭了，到11点半貌似就很少有空位了额。。点了一个冷菜——茶树菇荷兰豆，几个热菜——鳕鱼菌菇煲，花蛤冬笋松柳，塔菜炒冬笋，和一个点心——苹果酥。上菜速度好迅速，这点要表扬。茶树菇荷兰豆（12）：这个很好吃呀，非常清爽，荷兰豆的清香搭配茶树菇的鲜美~~豆豆太喜欢啦！这个菜市最后加上的呢，很庆幸要了一份呀！花蛤冬笋炒松柳（22）：这个菜色面哈好看的，花蛤比较少，但是鲜还是蛮鲜的。松柳以前么见过额，有点像豌豆苗一类的才，嫩绿色的，清新的味道。整道菜也是很鲜美滴，可惜有点点温，不是很热的，否则应该更赞吧。塔菜炒冬笋（18）：...这道菜不错哦，塔菜有点像青菜的口味，但是长得不一样额。。反正老公哈喜欢吃这道菜的，豆豆也觉得很不错，只是稍稍油了一点~~配饭吃确实很好哦~鳕鱼菌菇煲（88）：这个价格其实也不算巨啦，毕竟鳕鱼本身就很贵，再搭配菌菇。。汤是奶白色的，一看就很浓，非常的醇厚。菌菇有蟹味菇和金针菇，都很好吃，银鳕鱼非常的肥美多汁，只是豆豆吃了三块就感觉饱了。。难道鱼肉也占地方。。剩下的交给老公啦~~苹果酥（4块一个，四个起卖）：他家的酥类点心还可以，酥皮很松，但是奶香味不够，而且稍油腻了，不过应该表扬的是内馅的苹果馅很不错，甜度适中，苹果香气十足。白米饭（2碗3块）：这个米饭的质量真的是让豆豆惊艳到了！在家里的米饭也不过如此，甚至还比不上他家~是长长的米粒，硬度适中，关键是粒粒分明，米香味浓郁呀~豆豆不大吃米饭的也吃了小半碗呢，老公更加是吃的开心啦~总之菜品不错，在合肥餐馆中属于上乘了吧。而且中午堂吃打6.8折，还是蛮格算的额。全文','60','2010-11-30 18:42:00',NULL),
	('098d6edab5e3e45b68c3394f85832671','cd93a73c72027bf514109465e368a05f','earnest','4',4,2,3,'在科大的时候吃过几次，无锡酱排做的相当不错，菜的平均水平还可以，至少点过的菜还没有哪个觉得难吃，一般都会送个凉菜，除部分菜品外大厅和包厢还可以打折','40','2011-02-01 11:10:00',NULL),
	('0a72686f616a1ba8badfa2f6fd5c2327','cd93a73c72027bf514109465e368a05f','kakaru12','0',4,4,2,'性价比还是比较高的饭店。菜的味道也不错。印象最深的就是排骨。上次去的时候合肥还在修路，不知道现在修好了没有。修好了去那里就非常方便了。','40','2008-09-15 19:25:00',NULL),
	('0dc416ed4e814fafb44cd223ae0ee383','cd93a73c72027bf514109465e368a05f','vivian2162006','3',3,3,2,'菜的分量很足，人多的时候吃比较划算，tx不想在家吃了，就和lg，公公，婆婆一起去吃，嚷嚷没有两人生活，这时候四人生活也是有好处的，聚餐会选择这里，人少就不推荐了','30','2009-12-23 11:17:00',NULL),
	('1015fd1728c0a9a987005b70c2086ea6','cd93a73c72027bf514109465e368a05f','zephyr_li','3',2,2,2,'回过合肥几次，却从来没有再走进过以前的大学，这次回来，东区西区逛了下，其实自己还是很爱科大的。这可能得感谢朱校拒绝扩招和并校，让我觉得这还是我读书时那个学校，虽然他在南科大有些实际的困难，希望他还是能够坚持走下去。吃的什么忘了，大学周围的饭店么，谈的挺好，而且这家店我十年前就来过，号称红绿蓝...','140','2011-06-22 09:13:00',NULL),
	('14ee31b371060981cb0f04885a14ea3f','cd93a73c72027bf514109465e368a05f','seeksun','0',4,3,4,'最近去了几次，感觉很好，做活动的时候人特别多。比较喜欢的几道菜：香炸羊排，葱香牛柳，还有个鲫鱼的菜忘了叫什么名字。有个好像叫沸腾鱼的菜，太一般了，没什么味道。由于长期打折，还是比较划算，性价比很高','30','2009-08-16 19:33:00',NULL),
	('1ba1e4ee0724e854bb1dd7b5113e448b','cd93a73c72027bf514109465e368a05f','芥末心晴','4',3,3,3,'呵呵，科大食堂哦，我在科大的第一次聚会就是在这里啊，好多菜都不知道名字，但味道还是不错的，而且貌似打了不小的折扣，记得有个烤羊排蛮好吃的，还有几种小点心不错啊，量大实惠，喜欢\\(^o^)/~','0','2009-11-28 17:27:00',NULL),
	('1ccd76b6c1cb401252a7181f663757ff','cd93a73c72027bf514109465e368a05f','eyuanxu','0',2,3,2,'人很多,也可能这个原因服务不是很好.态度都很冲.有不少海鲜,包括多宝鱼,野生甲鱼,鲍鱼,鱼翅.服务态度有待提高.','60','2008-01-03 20:51:00',NULL),
	('1dcb5a0e4e06047b347a784994e92faa','cd93a73c72027bf514109465e368a05f','紫风旋律','4',3,3,3,'茶树菇荷兰豆,花蛤冬笋炒松柳,塔菜炒冬笋,鳕鱼菌菇煲苹果酥 无锡酱排,铁板鲈鱼,椰汁青豆泥,风味白干，这些都不错，喜欢就吃个味道！','50','2010-12-23 23:38:00',NULL),
	('020a583bf28902dca2234017ca479d28','cff37ab84b50487e4d5328054acd6c37','哇猫','5',4,4,4,'环境一流,食品精良,是个只要付得起钱任何情况下都适合来的地方.不过品种不太多,只有半边是有食品的.鹅肝酱夹着饼干也很好吃,可是没有香煎的做法终究让我很失望鲍鱼是放在高汤里烫熟的,虽然也很好吃,我吃了N个,吃到后面就觉的一般了,如果别的做法其实更好.香煎大虾确实很大,不过我倒是希望这是蒸的才显鲜味,也许它是冰鲜所以只能煎吧生的东西比较多,但我还比较喜欢熟的,所以只尝了几款鱼子酱,有黑的有红的生蚝也很鲜,但任吃反而就吃得不多了最遗憾的是没吃到龙虾,所以如果不是能拿到折扣价我觉的还是不值','200','2010-02-22 16:17:00',NULL),
	('02a2ba3e201122a2920eee7ba25a2be2','cff37ab84b50487e4d5328054acd6c37','lcclcllc','4',3,3,3,'花园酒店自助餐的品种和四海比不多，但对于我这些吃东西也不多的人来说，也足够了。胜在人少，一种样品吃完了，会很快供应上来，甜品很美味，带小孩去的，1.1米以下都是免费，所以只收两位大人的钱，加收15%，买单好像是432元吧，忘了呢','220','2009-12-15 08:25:00',NULL),
	('05d14f56a6a266e02a0b41121d321959','cff37ab84b50487e4d5328054acd6c37','TMD猪猪','4',3,3,3,'我觉得几好啦,比较多野食,而且是比较新鲜,我比较喜欢食里度的海鲜,比较鲜美,吾会好似其它地方食的吾新鲜的,而且是环境卫生方面都几好的.','0','2010-04-03 11:58:00',NULL),
	('0b289e67777e97dbac70fdd34daee0e1','cff37ab84b50487e4d5328054acd6c37','huzhirui','4',4,4,4,'【试吃/体验点评】旋转餐厅嘛，挺好。去吃过几次，出品还不错，环境也很好。就是价格有点贵，毕竟是五星级的嘛。服务也挺好的。可以说，吃的就是环境！','250','2011-04-01 14:26:00',NULL),
	('09f33e2c509c2074a158c4d5beba675b','cff37ab84b50487e4d5328054acd6c37','cc_wong','4',4,5,5,'以前成日都去~~~不過後來大個先知計埋加收500幾600一個人囖~~~幾貴下~~不過人哋真系吃裝修同吃服務囖~~話曬都系白金五星級嘛~~~晚黑好有feel~~轉轉轉..啱曬一家大細同埋d朋友去囖~~去嘅人都要有翻咁上下...感覺唔錯~~超靜..','500','2011-09-13 07:09:00',NULL),
	('0c9c3bb7b888dd0c2006756fdd7ff99b','cff37ab84b50487e4d5328054acd6c37','lloy','4',4,5,5,'贵是真贵，味道感觉也还好吧，谈不上最好，环境应该算是一流了，三文鱼那里的服务员态度不好，问他要多点说我们四个人，接过回答我吃完再来。。。哎。。。','478','2010-10-02 17:02:00',NULL),
	('0e0f7b8a0987c23436fdd954c9440435','cff37ab84b50487e4d5328054acd6c37','irisfzm','0',4,5,5,'自助餐是338元一位，另加收15%服务费，但是交通银行、建设银行的信用卡可打8.5折，晚上8：30后进场系268一位。位处广州五星级花园酒店的30楼，系广州为数不多的旋转餐厅，环境、服务都是一流的，价格虽然是最贵的，但性价比与白天鹅的流浮阁、君悦凯菲餐厅相比还是高的。品种不算多，但价格贵的东西比较多，而且不限量，象拔蚌新鲜、三文鱼腩鲜甜、生蚝肥美、鹅肝香滑、小龙虾爽口、大海虾弹牙、太湖蟹清甜，虽然哈根达斯的雪糕品种不算多，但是真的比其他的都好。人不算多，不会有哄抢的情况出现，加上优美的环境，我个人觉得如果要去五星级的自助餐尝试的话还是应该选择最贵的花园酒店凌旋阁。','388','2009-10-11 22:31:00',NULL),
	('18e485ac644a64afafdd7febc55aea04','cff37ab84b50487e4d5328054acd6c37','godwinn','3',4,5,3,'以前没怎么留意到这家餐厅，后来因为一个商务目的聚会到了这家餐厅，吃了一顿大餐，感觉环境特别的舒适，菜的出品也特别精致，味道很正宗，特别是一些海鲜的制作，生猛的没的说，赞一个！','0','2012-02-11 11:21:00',NULL),
	('1de4712959c04f3d0e1180de79e0368d','cff37ab84b50487e4d5328054acd6c37','quallea','5',4,5,4,'国庆晚去的，满座，好在有提前订位，刺身品种好似多了几款，但当日无了龙虾，得大虾，有毛蟹,还睇到珠江新城放的烟花末端，建行信用卡打85折，相当于免了加收。东西还是保持水准。','338','2010-01-26 11:53:00',NULL),
