	('0800ef0c57b70c6759f805c349bfaf86','d4c0935f498de3dd7f4d11c0fce84f9c','m_cc___','3',3,5,3,'【试吃/体验点评】前段时间搞的什么火锅美食节，价格很优惠，就去尝试了，环境很好，菜色少了点，。第一次尝试了蜗牛，本来不想吃的，可是活的蜗牛在我盘子里爬来爬去，实在是没办法，扔锅里去了，不知道怎样才算熟了，就一直煮了十几分钟，结果，后悔啊，以后还是不要尝试了','68','2011-05-09 15:12:00',NULL),
