	('10194c23910b1c661701f4d3e123285c','d4c0935f498de3dd7f4d11c0fce84f9c','douzi1874','3',2,2,2,'【试吃/体验点评】当时刚开业的时候还是很红火的，海鲜啊羊肉啥的都不错，很新鲜，但我觉得那里环境不咋地，虽然离啤酒节很近，但装修的很乱，服务也一般，好在可以刷卡，自助餐的性价比在青岛也算高了','50','2011-04-09 10:07:00',NULL),
	('105bd096386e1fa36499e645bd7404e3','d4c0935f498de3dd7f4d11c0fce84f9c','attorney11','4',3,3,3,'青岛菜的量还是蛮大的，这家量还好，不多。环境不错，据说是适合商务宴请的地方。这家饭店是位于啤酒街上。饺子味道不错！','0','2011-05-03 17:50:00',NULL),
	('19376cd40a3ae82286671fb09ecf3f4e','d4c0935f498de3dd7f4d11c0fce84f9c','swy619','5',5,5,5,'去年朋友请客去的，环境非常好，餐厅很大，里面有个大舞台，有人演出，我们去的那天有萨克斯表演，洗手间装修很豪华。。室外环境也非常好，有水池。。停车场很大，上菜速度很快，最喜欢生鲍鱼，上面有鱼子酱，味道非常好，其他菜品口感也不错，量也可以。朋友聚会，商务宴请，婚宴都很适合。。在啤酒街附近。。还是比较好找的。。','100','2011-06-15 17:53:00',NULL),
	('07ea1700e8a00f8fe274932b34d6230e','d5ecddc32cca4264dea3b01b5cdc965d','Michelle429','5',5,4,5,'我终于来到了很久很久以前就想来的小小花园，现在有我老公的陪伴让我觉得我不是永远都会一个人特别是在新年的第一天。虽然我的肚子很痛但是我还是很开心，一开始我们坐在室外。由于椅子坐的实在不舒服所以我换桌子了，一个我认为最安静的地方。每次去到一个咖啡店我总想自己以后也开这么一家。和妹妹二个人。他们家的杯子很大只，我点的热巧克力和熔岩巧克力，熔岩上了之后我二分钟解决了哈哈，个人觉得比godiva的还好吃。呵呵最近大爱巧克力。老公老样子点的红茶。我感谢他能一直这样纵然和陪伴我，虽然不知道未来的事。','50','2012-01-01 13:56:00',NULL),
	('08fae27eb02390102e1e31fdc53dcb5f','d5ecddc32cca4264dea3b01b5cdc965d','蜡笔小雯子','4',3,3,3,'因为在以前学校附近，又听好多人推荐，于是鲜嘎嘎的和闺蜜去了。。。环境不错的，大家现在都是吃环境的嘛。。。就是周末人太太太多了。。。排了半个钟头的队。。。拍拍照还是不错的~味道一般性。。。热巧克力还可以，我觉得比古董花园好吃！','40','2012-01-15 16:03:00',NULL),
	('09165cbf1d6f1ec8c57dad06c7e1a277','d5ecddc32cca4264dea3b01b5cdc965d','蘑菇頭菇涼','4',3,3,3,'话说以前一直混迹在那一带的时候都木有进去过，然后某个无聊得发慌的晚上和朋友一起去劈情操了，记得当时到那里已经晚上十点多了，人家十一点就要打烊了，好吧。我和朋友点了熔岩巧克力蛋糕，真心好吃，我是很喜欢的，一人一杯拿铁，噶噶三胡蛮惬意的，以后再去的话点别的试试看，哈哈。','51','2012-01-20 17:22:00',NULL),
	('0a5f3555c78fe153213df79cbd937dbb','d5ecddc32cca4264dea3b01b5cdc965d','kikokim918','3',3,3,2,'某些人仗着什么呢…其中一个服务员态度太差了！！！差到不行！！！！！！！哎，现在这世道，服务员都狠过顾客。进门也木有人接待','0','2011-12-21 15:41:00',NULL),
	('0e555acd519babc91f84e6c74f9ef964','d5ecddc32cca4264dea3b01b5cdc965d','小猫猫Gina','3',2,4,3,'去了觉得也一般，就是布置的有点噱头，蛋糕什么的味道也不过如此。小猫太少，也不陪我玩，都在睡觉，不开心呀！还有就是没有坐到花园','50','2011-12-04 23:27:00',NULL),
	('11b028273e6641c1c1f87487d3051a70','d5ecddc32cca4264dea3b01b5cdc965d','YING0423','3',2,2,1,'咖啡很一般！店面环境除了养了很多猫咪的关系，其他都不咋地...拍照时还不允许用闪光灯，要保持他们的色调..服务也很差...现在类似的咖啡店开的太多，没什么特色的东西。','50','2012-02-13 12:06:00',NULL),
	('138075bbe5b2f17c7ac563972bbe0f31','d5ecddc32cca4264dea3b01b5cdc965d','plumezy','4',4,5,5,'这个地方不好找 真的不好看。。特别是晚上暗搓搓的环境不错 菜味道也还可以店里装修一看就是花了心思的走复古风 还有肥猫走来走去的感觉大部分人来都是来拍照的。。。','0','2011-12-14 03:24:00',NULL),
	('1509997fd80ff5d84dfc21a90829e5b8','d5ecddc32cca4264dea3b01b5cdc965d','lxgloria','3',2,2,2,'下午茶貌似就剩这家店没有去了。于是决定去一试究竟。周末人多的要扑出来，等了大概4，5桌的样子才轮到我们。屋里面的摆设感觉实在是杂乱无章，没有让我有温馨的体验。桌子和桌子之间的距离不到10厘米，旁边情侣低声说什么我都能不费力的听见。让我对这家店的好感度一下子降低很多。点了红茶和熔岩蛋糕，红茶没有精致的茶壶和茶杯，让人对这次下午茶有了怀疑。蛋糕甜度比较高，纯度不足。倒是别人点的芝士蛋糕不甜，浓浓的cheese味道让人陶醉。没有窝的温馨，没有夏朵的精致，鉴定完毕。','70','2011-12-21 10:59:00',NULL),
	('189a0ee10464a7cf1de88a6d6e65b88c','d5ecddc32cca4264dea3b01b5cdc965d','ABC可爱','4',3,3,3,'这个名字起的很好,里面的环境蛮好的，服务也很到位,最喜欢吃的是巧克力蛋糕,巧克力很浓郁蛋糕很嫩滑特别的好吃,价格也不贯的.','0','2012-02-02 18:33:00',NULL),
	('0503cb1cf15e746ac738d8d11353d0a2','d649a0bce44ad0ca36662582d9ba097e','花小肉','3',2,5,3,'低脂低油的柠檬鱼、马来娘惹等东南亚健康流行美食及时尚饮品，其独特的设计风格，引领着时代的生活潮流。舒适的环境、精致的餐品、平实的价格、亲切的服务以上是广告语··我的感觉是，菜色不地道··味道很一般··环境倒是非常好  格外赞的是奶茶','0','2011-12-28 18:12:00',NULL),
	('04f0c6adb76299113b239f9e79e0788b','d649a0bce44ad0ca36662582d9ba097e','马小白','2',1,2,2,'难吃的要死 咖喱没香味 河粉不够滑 粘黏糊糊 的一驮就上来了 证明咖喱汁调的厚度不好泰香茄子褒 哪里跟泰国扯的上关系?没有任何东南亚香料的味道 到是老北京卤酱的味道很重 颜色发黑 形状干扁 还很咸 稀稀拉拉的几条茄子 真好意思叫褒荷叶包鸡 油黑咸老的不得了 还不如街边的新鲜 荷叶颜色都变了 明显是当天卖不掉 回锅回锅再回锅的结果 内什么红咖喱南瓜排骨 真糟蹋红咖喱的名声 干巴巴的连点汁都没有 肉也是反复煮炖又烂有咸 卖相也很差所有的菜都是不新鲜而且非常油 还很咸 还号称东南亚菜 请问用了什么香料?门口摆瓶鱼露就证明你家的工夫了?环境也很装B 热的要命 唯一可以的就是盘子都是叶子状的跟名字很贴切 菜到是很便宜 但是太糊弄人了 大连人们 你们都没吃过正宗的东南菜吗?就这样的菜馆还有人去捧场 不好意思 我是朋友请去的 反证我绝不会再去','40','2010-05-22 00:04:00',NULL),
	('05f23215ef10cf17a86e4c72b71ca971','d649a0bce44ad0ca36662582d9ba097e','exelco','2',2,2,2,'越来越差 越来越破 无法用语言形容失望啊 服务员素质实在不敢恭维 还有那菜越做越糊弄人 充值卡里的钱用光了就再也不打算去了','60','2012-01-01 09:19:00',NULL),
	('095d382a74b471a94111585c82f158be','d649a0bce44ad0ca36662582d9ba097e','LoritaR','4',4,3,4,'这家店是在太平洋百货的顶楼，所以环境并不是特别好。店面偏小，座位也不多，不过椅子的靠背非常高，也挺舒服的，蛮有异国风情的。菜色比较丰富，从重口味的咖喱到清淡的汤水都有。咖喱肥牛味道很好，虽然不一定很正宗，牛肉也有点儿老，魔芋丝还是很Q很有弹性的。有一个什么什么鱼柳的，看上去量挺足的，其实一半是薯条，不过里边儿花生米的味道很有特色。还有一个虾饼，完全不知道是啥，外边儿看起来就像炸面团，吃上去也蛮像的。我们还点了一道叫什么金果的菜，其实就是咸蛋黄焗南瓜，蘸上特制酱料，趁热吃的话，味道还是可以的。之前忘了说，冷菜的话推荐手撕凉菜，上面有大量虾米，就着各种菜叶吃起来很鲜美爽口。饮料，什么美人露值得推荐，底下有椰果上面是芒果冰激凌，在吃得辣辣的时候吸一口真是爽死啦。','70','2010-05-12 18:18:00',NULL),
	('0cff2413abe92980b681861244d77bd4','d649a0bce44ad0ca36662582d9ba097e','红色尖兵八哥','3',2,3,2,'芊雨叶作为饭店名字听上去感觉挺诗意，特别是看了不少网友评价一直想去试试。闲来无事过去尝试下才发现，前不久在这里已经吃过一次了，只是上次来这里目的不单纯是为吃东西，所以感觉稀里糊涂，甚至吃完以后都不知道原来这里就是芊雨叶，只模糊记得这里吃的菜咖喱味很重。这次重新来过，还是选择上次靠窗坐过的位子，上次吃过的菜已经记不得了，还好还有很多其他菜可以选择。点了一份荷叶包鸡，嫩嫩的味道不错。一份什么鸡球，口感可以，但是味道一般般。一份沙丁鱼菠菜饭，盘子底下包的锡纸，感觉很精致，而且能像披萨一样拉出丝，味道也很好。他家店空间不算大，但环境不错，菜的品种很多，而且价格大多不算太贵，只是量很小，适合点很多品种，尝试各种口味，而且菜的样子啊味道都很特别。第一次来的时候口渴有免费的柠檬水提供，这次就只有白开水，不知道是什么缘故。','35','2010-11-17 09:10:00',NULL),
	('0f1767e764a68a534905e2790849f7fd','d649a0bce44ad0ca36662582d9ba097e','ooliveoyl','3',4,3,3,'最近迷恋东南亚菜~刚好同学有这家的打折卡，所以得到机会就赶紧去。持会员卡可以赠送一份饮品或小菜。本来我以为会赠送饮品的，结果送了一份水果沙拉，果然是赠送的，不怎么样...点了荷叶包鸡，虾滑咖喱，米粉，土豆泥沙拉。米粉真的很酸，但是我同事说跟她以前在云南上学的时候吃过的一家越南米粉一模一样~荷叶包鸡，我感觉就是炸鸡蘸甜辣酱~土豆泥沙拉还不错，味道挺特别。虾滑咖喱。虾滑里面有柠檬的味道，挺怪，但是还可以吃~好像很多人都点芒果奶昔呀，下次去一定尝尝~地方真的很小，就一个小拐角~','50','2010-05-20 09:01:00',NULL),
	('117460de67415a8ab847c15a283f92c4','d649a0bce44ad0ca36662582d9ba097e','大连猪头哥哥','5',3,3,3,'和老婆去这家东南亚餐厅，环境很好，水晶灯是个特点桌椅很近，有点挤很重服务态度还可以，咖喱味价格有点贵，不是太好','50','2011-11-12 15:26:00',NULL),
	('1128e163b761385498c6ff085028c077','d649a0bce44ad0ca36662582d9ba097e','emily8229','4',3,5,5,'很有特色的店铺,环境一级棒,大概是新装修的,而且很有特色,只是地方比较小,略微拥挤.菜色搭配比较有特色,口味还可以,菜量很小,适合两人吃','80','2010-06-22 17:05:00',NULL),
	('13e0573110e20d301c788b55ef1c40e1','d649a0bce44ad0ca36662582d9ba097e','wyxzlwsh','5',4,4,4,'【团购点评】团购去的，但是一点儿团购的感觉没有，仍然受到了很好的服务。很喜欢他们家的口味，东南亚风味的，以咖喱著称，麻麻辣辣的，吃起来很爽。装修风格很高档，在百年城六楼的几家餐厅装修都不差，而且价位不高，物超所值啊。旋风明炉咖喱肥牛除了肥牛之外，还有海带、蘑菇等辅菜，麻辣口味，辣嘴不辣心，很下饭；娘惹豆腐外焦里嫩，配有马来口味酱料，另外搭配新鲜蔬菜，很爽口；海皇土豆沙拉说是没了，很认真的向我们道了歉，并帮我们换了另外一个粉丝凉菜，很清爽，挺满意；芝士南瓜笼仔海鲜饭芝士味道浓郁，香；皇家热柠檬蜂蜜红茶甜度适宜，另外赠送的冰雪银耳木瓜羹略甜。','40','2011-03-28 16:39:00',NULL),
	('159535886900cbc511355aaf85934855','d649a0bce44ad0ca36662582d9ba097e','薇安vivian','3',2,4,3,'总的来说觉得他家的不是泰式的辣味，更像湘菜的味道，感觉很不正宗。不如新资味，需要改进。装修确实很赞，椅子很漂亮，不论款式还是颜色，是密友聊天小聚的好选择，至于菜嘛，如果不是非要吃泰式的，这里也马马虎虎了，完全中国菜的味道。','70','2010-04-02 22:28:00',NULL),
	('19c5af871c65fbf94c54d93e3997b005','d649a0bce44ad0ca36662582d9ba097e','莫奇妙','5',4,4,4,'【团购点评】团购去滴，服务态度很好，团的经典单人套餐一份：印尼炒饭1份+夏威夷热带水果优格1杯。炒饭内容很多，但是量少，女孩子吃刚刚饱吧。总体非常满意^^','19','2011-07-22 20:54:00',NULL),
	('1bc71939854db44c598ec15eb2bcb1b3','d649a0bce44ad0ca36662582d9ba097e','我才是转转','3',2,2,3,'看大家的点评不错，昨天七夕的时候去吃的。百年城的六楼我还是第一次知道。刚上去就看见了好几个和尚穿了僧衣从花样年滑他家进去了~ 和尚真有钱都吃花样年滑~芊雨叶他家果然不大，隔出来的一条长长的空间。这家饭店像以前的饭店一样，期望越大失望越大.....这个菜不咋滴啊。我们两个人点的：柠檬鱼，荷叶包鸡，菠萝蜜炒饭，牛肉炒河粉，还有一个什么烧西生菜。柠檬鱼太酸了..... 我以为是有淡淡的柠檬味，结果全是酸味，一点鱼的鲜味没有。荷叶包鸡还行，那个蘸酱挺好吃的，又辣又甜~菠萝蜜炒饭不好吃，没什么味，也不香。而且没多一会儿就凉了。牛肉炒河粉还行，但是我没吃出牛肉......那个西生菜有点油了还那么少....总体来说他家量少，油大。（也可能是我自身的问题，是我不适合吃东南亚菜吧~~~）不过服务员态度不错~女服务员不好，让我们多点菜，两个男服务员挺好的~正好赶上七夕，人可多了......这家下次不会去了。PS：他家结完帐以后赠送了一张刮刮卡，我刮出来的是甜品，下次去可以得到一个夏威夷热带水果优格一杯，有人想要吗？ 站内信我~~~','53','2010-08-23 11:28:00',NULL),
	('0085aa878b48b43ae0fb7f9b9e64ada4','d7fada9ad3082a7836d388017ff8dc6c','刘和朱','3',2,4,3,'环境真心不错，玻璃房子，转角，浦江第一排名不虚传菜品味道一般般，本帮菜还是可以吃吃的，不建议吃有西餐元素的菜服务一般，但还算有求必应。一个更适合看风景的地方。','0','2012-02-08 09:24:00',NULL),
	('01df4bf1a003a00b9df5350f9160257d','d7fada9ad3082a7836d388017ff8dc6c','恋上虫子的鱼','4',4,3,3,'大光明电影院楼上，菜味道一般，本帮菜，鸡汤味道很不错。大厅环境有点乱。推荐的是他们家的室外座位，有包厢是玻璃房，满灵的。要提前定位。','0','2012-01-20 15:55:00',NULL),
	('02c4d8649cf04501ba006cca8fc135c0','d7fada9ad3082a7836d388017ff8dc6c','土豆莫莫','3',2,2,2,'这家店开在大光明上面，有个露台是大大的卖点。只可惜大冷天，我们肯定选择坐里面，工作日的晚上生意也蛮好的，店堂内的桌椅挨得比较近，这点不是很舒服。点了浦江第一排，很大一块，服务员会主动提出帮你切分好，蘸酱酸酸的不错，吃多了有点腻...XO杏鲍菇味道不错，稀饭牛蛙是特价菜，烧得还不错榴莲酥没有单位对面的好次，而且个头小，价格贵店员推荐的杂粮汁...真的是...太让我失望了...跟我自己在家机打得完全不能比，而且里面用料极少，多数为紫米...特价38元一扎...这种东西卖18元我下次都不会要~','150','2012-02-15 22:47:00',NULL),
	('0392864e20471bcdedc7c51d2faa6f77','d7fada9ad3082a7836d388017ff8dc6c','cjw_jess','4',4,4,4,'闺蜜生日请客吃饭~环境非常好有大大的露台花园包房~就是我们去得晚了一点~很多菜都卖完了~服务还是满到位的~菜的味道也OK~~','150','2012-01-08 10:51:00',NULL),
	('044b79ffb6742d1592e11b05c9544364','d7fada9ad3082a7836d388017ff8dc6c','阿宝ki','4',3,3,2,'teambuilding去的 只是服务员态度一直不冷不热菜的味道还ok 顶楼开放式的环境也狠美~~~','110','2012-01-28 19:15:00',NULL),
	('06cf44a2f9d1b1a593bcc0f1b5c39b98','d7fada9ad3082a7836d388017ff8dc6c','独守一份记忆','3',4,3,3,'环境很不错的  刚进去就能够感觉到不同之处他们家的特色菜 浦江第一排  我个人是比较的喜欢吃的我推进大家也去尝尝  味道很不错','0','2012-02-07 22:18:00',NULL),
	('06ea0604db5f780409832a51395ea587','d7fada9ad3082a7836d388017ff8dc6c','yanaina1985','4',4,4,3,'大年初五，朋友结婚发帖请大家吃饭，我们坐在玻璃屋包房，那天有点下雨，雨中的魔都却很美丽。菜的味道都很不错，东坡肉超大一块，吃下去就撑住了；浦江第一排也就是超级大的炸猪排，是我吃过最酥嫩的。有机会的话自己也会带家人去。','0','2012-02-08 16:11:00',NULL),
	('0a9c4b6448725c6d92309359f4129178','d7fada9ad3082a7836d388017ff8dc6c','妞妞_点点','4',3,3,4,'来这里吃饭的人绝对是冲着这边的环境过来的，反正这就是我的感受之一，那天过去正好下雨的，实在是遗憾不止；因为很早就听去的朋友说那里有个阳光房，阳光下用餐的感觉要多思一就多思一呢，可惜呀可惜。服务很是勤快，一点也不用人说的，那种善解人意的灵活感当场就让我深深的思索自己了，想如果自己也一个服务员的话，可能很难及格吧，那种揣摩客人一行一动的灵敏实在让人折服。浦江第一排早有耳闻了，说来这里是必点的一道菜，也是他家的一个招牌了，味道很鮮美，不知那个密制的浇汁都有些什么材料啦，但可以吃出很多种味道的。XO酱杏鲍菇也很特別的，有一些中西合并的味道；第一口吃上去感觉很像是紅烧的，因为入味也很浓，可慢慢嚼的時候又发现有一比的酒香，这应该就是他得名的所在了吧。还有樟茶鸭什么的也不错，但鱼感觉做得不是很合我的口味。','0','2012-02-08 11:03:00',NULL),
	('1015853b7fc63221e6380b7e7f92f043','d7fada9ad3082a7836d388017ff8dc6c','SalaZhu','4',3,3,3,'是本帮菜，味道还不错，环境也不错呀，浦江第一排蛮好吃的而且量不错的呀。元宝虾很脆的，肉也很厚的，牛仔骨的味道很好的哟。','80','2012-01-25 22:34:00',NULL),
	('10f2d7dad816be9f5d55b7a09a57844d','d7fada9ad3082a7836d388017ff8dc6c','管小多','5',3,3,3,'亲戚生日宴安排在那里，一上去就惊艳了，从没去过天台上玻璃房子的饭店，可惜这家天台看出去的是黑漆漆的人民公园，如果望出去的是霓虹闪烁的南京路就更完美了服务小姐态度不错的，毕竟价格也摆在那里的菜都是别人点的，就觉得价格不便宜，菜豆满好吃的，印象最深的就是他家最后上的水果，是一盆火龙果。。。','300','2012-02-07 14:27:00',NULL),
	('19256f37bff0373a91889c06f86faa68','d7fada9ad3082a7836d388017ff8dc6c','你好susan小姐','4',4,5,4,'去吃的晚饭，天气不好，下雨，就没能见识到露台玻璃房的美景。一进大堂就有点人声鼎沸，桌子排的比较满，客人很多。还好我们提前预定了。这里的服务人员态度非常好。像熏鱼，马兰头这种本帮菜是必备的，味道清淡微甜，符合上海人的口味。黑椒牛肉粒，肉质非常的嫩，摁，感觉是嫩肉粉太多了的样子。黑椒味不是特别的重，基本还是属于浓油赤酱型的。茶树菇煲虽然味道不错，不过这茶树菇用的不是新鲜的而是干的茶树菇烧出来的，应该新鲜的烧更好吃吧。来雅科，浦江第一排是不能少的。炸的金黄酥脆的面包糠，包裹的排骨却很嫩，火候掌握的很好，配上甜辣酱和爽脆的新鲜蔬菜，一点都不会觉得油腻，反而非常的美味！一锅鲜的食材很丰富，不过有个海鲜的通病就是贝壳类的多多少少有点沙子没弄干净。点心点了榴莲酥和生煎包。说实话有点失望了，榴莲酥的皮太厚，所以吃起来会觉得太油腻，榴莲味道倒是很正。生煎包太太太失望了，别看个头很大，但是里面的肉馅儿好小。。。好小。。。好小。还不如小杨生煎呢。汤汁儿也不是皮冻的，一咬一包油，腻的不行。最后送的水果是火龙果，每块儿都很大，给力！另外当时是六人同行，送瓶红酒，额，这红酒据同事说，很差。','0','2012-02-05 20:20:00',NULL),
	('1b760fd6720e30bd0b407af319dedecb','d7fada9ad3082a7836d388017ff8dc6c','su6632mr','4',3,3,3,'公司年会选在这里，环境确实不错，大光明三楼空中花园餐厅，能看到人民广场的景色。十几个菜中印象比较深刻的有海鲜水果沙拉，酱鸭，xo酱杏鲍菇，浦江第一排，海鲜汤等。海鲜水果沙拉很大一盘，里面有各式各样的水果，哈密瓜，火龙果等很甜，还有大虾。酱鸭很入味，偏甜，我喜欢，皮也不肥，很不错。XO酱杏鲍菇很浓油赤酱，味道挺重，不过很好吃。浦江第一排确实是一道很不错的大餐，很大一盘切好的猪排，蘸着酸辣酱，包着卷心菜吃，味道很不错。还有每人一小碟海鲜，有海螺，虾和蛤蜊，蘸着酱料吃很鲜美。有个叫不出名字的海鲜汤味道不错，里面貌似有鱼还有牛蹄筋之类的，很鲜。最后的水果是火龙果，不错，很甜。总体综合环境来说，还是很不错的吃饭地方。','0','2012-01-22 13:40:00',NULL),
	('1c5120bf8a153262fc7546d468916f87','d7fada9ad3082a7836d388017ff8dc6c','flyxy','4',3,3,2,'中午在大光明看好电影就上去吃饭了~以前在新天地叫ARK的时候经常去看LIVE的~所以看到筷子套上的ARK标志还是咯感慨的！菜式嘛都是本帮菜，味道还是可以的~元宝虾甜甜的味道超灵~','120','2012-01-15 20:57:00',NULL),
	('04f3bbecf97a926f8142f510af541530','d9e28a900f373a834a1ebb3ceffa78f7','gentcool','0',3,3,2,'店大人多，每天食客盈门，招牌菜剁椒鱼头非常好吃。菜量也较大，剩菜打包使用纸袋，很容易漏，建议换塑料袋。','50','2007-08-22 00:17:00',NULL),
	('086b249f3e752f02a50e784533c5f846','d9e28a900f373a834a1ebb3ceffa78f7','luckjian83','4',3,3,3,'很少能给一个饭店打好，湘君府绝对算一家。环境很不错，大家聚会的好地方。最经典的是剁椒鱼头，每次都要两份面条。呵呵！很好吃。','60','2009-11-30 22:41:00',NULL),
	('0cc1bc1cdef3f418063a06c725fc0c3c','d9e28a900f373a834a1ebb3ceffa78f7','海蓝色的小屋','0',4,2,2,'这个地方曾经去了无数次，每次剁椒鱼头和萝卜丸子是必点的。还有干煸豆角也很好！还有一个类似的地方叫做湘粤情。具体位置忘了，不过东西差不多。光明渔港里的剁椒鱼头也可以。但是这里可能便宜一些吧！','60','2008-12-21 21:26:00',NULL),
	('0fedc8153e012e4b07f78283c12807df','d9e28a900f373a834a1ebb3ceffa78f7','卡雅','0',3,3,3,'这里的婚宴味道不错自然首推&quot;剁椒鱼头&quot;..','40','2006-10-26 16:09:00',NULL),
	('12f31f9b7e0cd07f7ec0bcae66d1e2f6','d9e28a900f373a834a1ebb3ceffa78f7','一杯苦茶','0',3,3,3,'真没想到会发现湘君府也在这里找到味道确实算不错，不过我可不敢多去不是环境差，环境算可以！味道也不错不过价格似乎有点相对高哦','50','2008-01-18 22:27:00',NULL),
	('188981b0ff216cd4c6e822ba39ba5d4b','d9e28a900f373a834a1ebb3ceffa78f7','爱的涟漪','0',3,3,3,'这里很有名气,环境很不错,提到这里都会想起剁鱼头,鱼头很大,很嫩,味道很好吃.他家很多菜都很好吃,喜欢吃辣的可以来试试看,一定会很喜欢的.','0','2008-08-13 06:54:00',NULL),
	('1affac4d5489c3bb4d12218638881931','d9e28a900f373a834a1ebb3ceffa78f7','勇敢的可乐','0',3,2,2,'我就喜欢吃鱼头里面的面条其它都不感冒散台人太多乱哄哄的布局不合理','0','2009-03-12 13:52:00',NULL),
	('025c1fb9c7f202d3cb3835a15be20495','da68323c302849b36844423139800fd4','福楼法餐客服','5',5,5,5,'【试吃/体验点评】童鞋们，我已经偿过皇冠蛋糕了，味道很好哦。图片中我们已经上传了皇冠蛋糕的照片了希望大家点击查看啊。如果需要了解或订购可拨打福楼电话022 26626688-11或12','200','2012-01-03 18:52:00',NULL),
	('0399b232094f48c6e77a4a03d0526d82','da68323c302849b36844423139800fd4','Hope_Beatty','4',4,4,4,'新意街附近的店差不多都快吃过来了，这家是新开的，还没有机会吃。上次女友抽中了试吃，去接女友的时候，在门外逛逛，看看立在小院外的招牌上的菜单，这时候就有服务生主动上来询问是否需要帮助，服务有点特色啊！听说领班和大厨都是法国人啊？只是价格太贵了，还没机会吃到，有机会一定要尝尝。','0','2011-09-19 15:59:00',NULL),
	('0419baf0482fc50c02223fde8cd00e5d','da68323c302849b36844423139800fd4','清水芹菜','5',5,5,5,'环境非常好，很有法国风情，晚上每个桌子上都点了蜡烛，感觉非常的浪漫。酸菜很好吃肉的品种很多也不腻。芝麻菜味道很特别我喜欢，虾仁的肉很结实吃起来像野生的，味道也非常的鲜。服务也还不错都很亲切。','0','2011-08-13 12:57:00',NULL),
	('04bcbc7bb808fe3420abfb336bc1e860','da68323c302849b36844423139800fd4','skirtwang','5',4,5,5,'生日去的，还送了现烤的巧克力蛋糕，很赞!餐前赠的面包干配金枪鱼，很棒!海鲜拼很棒，有牡蛎，田螺，虾，面包蟹，个人偏爱田螺，配海鲜酱超赞!!鹅肝很美味，入口及化!就是牛排吃不太惯。服务没话说，全程服务。值得去的地方!','700','2011-11-03 00:57:00',NULL),
	('059102a982abe996769a1a9e78a60008','da68323c302849b36844423139800fd4','iamfc','5',4,5,5,'环境超赞，是看到建筑物外观很漂亮进来，进来之后发现也很美就坐下了。当然服务生相当好态度，也是赞。食物很精致，味道也很好，牛肉很香，能感受到肉汁在喉咙里流过...可能吃不惯法国菜，太甜...','138','2011-11-06 12:54:00',NULL),
	('074484945efc9ac560939e71142b3c46','da68323c302849b36844423139800fd4','ab_z','4',5,5,4,'总体来说不错，口味算是比较正宗的法餐。新鲜烤制的法棒算是在天津最好的，但是还是没有法国的好吃。牛排很赞，5分熟，嫩嫩的。服务态度还可以，不过美女始终没有微笑，外国帅哥微笑了。无线上网速度很快。甜品综合拼盘很好，非常推荐。','350','2012-01-29 10:42:00',NULL),
	('08c112fc27581c644ded8026702f5373','da68323c302849b36844423139800fd4','豆豆jasmine','5',4,4,5,'去了有一阵才想起来点评。环境服务都很好，味道在天津算是法餐比较正综的。俩人，点了两种不同套餐，主菜一个是马赛海鲜煲，味好量大，不过吃到后面有点小腻，可能我胃口太小了。另一个主菜扒青岛牛脊，小小一块但很厚实，喜欢配很多胡椒和酱吃，要的貌似六成熟，肉口感不是很嫩，这款的性价比还可以。甜品超喜欢大份的焦糖香草布丁，不是很甜，布丁的奶香更能体现。另一个甜品选的是风味甜点，包括冰激凌，焦糖杏仁布丁，和巧克力蛋糕。焦糖杏仁布丁比焦糖香草的更甜，个人更喜欢后者不太甜。巧克力蛋糕也很醇，软软的很新鲜，可惜只吃了几口剩下很多。最后还有主厨送的小点心很贴心，味道也好。不过感觉蜗牛没有塞纳河的新鲜，可能和空运时间有关。','300','2011-11-17 11:56:00',NULL),
	('0a625c1aa3ffe9c0df3d0251ea795c45','da68323c302849b36844423139800fd4','魔法猫','5',5,5,5,'很赞的西餐厅，看上去价格小贵但是用料实在，在同类型的餐厅里价位还可以。外籍服务员仲文还好，在里面订做了个蛋糕很棒。在里面做活动音像设施很齐全，没想到工作日的晚上人也这么多。','300','2011-12-16 17:35:00',NULL),
	('0d2068181b0dfff6030c09468dd87587','da68323c302849b36844423139800fd4','Stormlap','2',2,5,5,'我真心不知道为什么这个餐厅排名和口味分数那么高!服务不错,口味实在不敢恭维!!一直在别的城市,对家乡天津的饭店不是很了解.. 好不容易有空回家..还带了男朋友和2位北京来的朋友回天津..想招待他们吃顿美味的有档次的,在大众点评网搜到的flo,找过去.开门的是个外国人蛮帅的..里面也很漂亮. 但是菜,尼玛的..我真的越吃越不好意思,严重怀疑自己是土鳖,吃不来高级东西么?! 隔壁桌是相亲的,吃的很文雅..后面都是阿公阿婆带着自己家的小孩集体相亲的.. 就我们几个是冲着饭来的!有海鲜的几个菜都很腥!分量一般,造型一般,口味严重一般! 我们4个人当时就觉得自己弱暴了不懂人家,不信邪,非常没形象的换着吃!... 换来换去 基本是怎么端上来的,大部分又端下去了.. 领班的人还挺尽职的,很温柔客气的问我们哪里不和口味(第一道前菜的面包沾的金枪鱼酱就很腥了!后面还有各种面包,管够..)服务小生不停的给我们加面包... 朋友(家里条件都很不错,都是吃货,好吃的吃大的)问我:法国菜不是很有名么..难道法国美食都是面包,法国人好可怜哦=-=! 个人就觉得..如果是享受下高档的环境和法国的风情,可以来这里.. 想吃美食的吃货们趁早放弃吧! 价格和台塑王品差不多,味道天差地别了!! 甚至不如...很多200的自助餐,香格里拉凯宾斯基什么的,甚至有的188 198人均的餐厅和日料都不如..原来大众点评网的口味也是可以刷上去的.桑心.. 叫我偶尔回来这种..怎么相信阿!!全文','298','2011-12-28 22:20:00',NULL),
	('0db2534fa62a2cced8cbb55c90e7e1cf','da68323c302849b36844423139800fd4','JOKERWS80','5',5,5,5,'最开始是看旅游卫视，北京广告提到的福楼，据说比那个布鲁宫差点，但价格还能接受。就像找机会去北京试试。结果每一个月，天津就开了，于是就跃跃欲试。正好刚开张有优惠卷，基本就是套餐打九折。也看了新上去的几个点评，还没人说不好。就特地找时间去试试。整体来说确实不错。口味：整体来说不错，所有的原料在菜单上都详细写出，同样的酱料也都标明产地，空运来的、青岛的、四川的都写明了。特地点了牡蛎一人一个，空运的、国产的都明码标价。点的空原来的56一个，确实很鲜，比生 生蚝鲜。不过也应该主要是运费高。不然MR.BEAN吃牡蛎吃窜稀了，肯定在产地价格不会很高。牛排：确实是真正的牛排，写明了是青岛的牛脊，提前拍散了，头一次看拍的那么到位的。不比食神里双刀火鸡拍牛丸的功夫差。要的八成熟，里面肉微红，但熟而嫩，不错。小姐单独给加黑椒，不加黑椒的牛排原味很嫩，加的黑椒也是手工磨的很细。鸭胸：应该是提前腌的的，带的酱料也不错，超市里买的味道比不了。甜点：焦糖布丁的焦糖确实是单独熬出来的，不是随便撒的。红酒、啤酒：红酒不会偿，小姐给看瓶子再倒的。啤酒不错，全麦的味道很浓，颜色也均匀的，至少不是普通的百威嘉士伯。遗憾的...是没吃炬蜗牛。留着下次。服务：确实有老外在服务。看介绍应该是，主厨、领班、老板是法国过来的。每班都有几个老外的服务生，估计是俄罗斯的，会说中文。其他所有的服务员基本都是南方人，不过应该都是精挑细选的。外形不比国航空姐差，气质也好。摆餐巾、餐具，上菜、都很到位。每道菜都是随时注意客人的表情及要求，吃完一道后，不用喊，小姐主动过来撤走，换下一道。而且，上沙拉时，小姐还专门说大厨让尝尝看，是否吃得惯配料。最后吃完甜品后，大厨，一个老外大胖子亲自端上餐巾和附赠甜点来执意。严格按照法式西餐的规矩来服务。出来时，老外大堂经理按例亲自送到门口。门口站岗的可能是天津人，不用专门培训的。环境整体还好，主要是地点在新意街，装修也不需要太好，整体感觉还不错，不比星级酒店差，就是周围环境一般，步行街太乱。旁边的LAVILLA，天天结婚的，热闹。总结，优惠卷168一个人，吃饱了基本人均不少于200。也接待结婚的，不过价位不便宜。肯定不如中餐、铁板烧自助等的一类实惠。主要是感受一下正宗法式西餐。虽然东西不是很多，但确实是精工细作、服务到位。顺便提到小老鼠做的Ratatouille，问领班，领班说这个是法式一般的炖菜，只作为配菜。最近的主厨出的菜单里没有（注意，菜单是主厨自己决定，不懂得朋友可以看看老外电影里的法式西餐。）套餐里的沙拉和Ratatouille的做法类似，只是调料不同，建议常常，就是前面说到的主厨问吃不吃得惯的沙拉。Ratatouille，冒充的西餐厅听都没听过，连PIXAR，老乔布斯的电影都不看。Ratatouille法式西餐的精髓，就好比 用豆腐做出来的猴脑，满汉楼待了三年半，就学会一个蛋炒饭。全文','225','2011-08-26 18:33:00',NULL),
	('0dc2a7d4929d4f9127d110ef1cab41a6','da68323c302849b36844423139800fd4','yqqy66','4',4,4,4,'喜欢这家的环境, 还不错, 一进去就给人舒服的感觉, 这是我想找的, 而且音乐不错, 菜品算是可以, 喜欢焦糖布丁和蜂蜜鸭胸, 服务也不错, 在这里就餐, 不仅环境还是感觉都是舒服哈!','0','2011-12-05 22:11:00',NULL),
	('11e49e69548cdf8d00e56ed1c7d09aa7','da68323c302849b36844423139800fd4','卢比埃','4',4,5,5,'去天津玩 然后就顺路去了天津的福楼法~~北京也有但是一直木有去过。。其实我是觉得上菜有点太快了。。餐前面包和开胃菜几乎同时上的。。个人觉得法餐还是慢一点的好服务超好 临走的时候还送了美味的小礼物~~是很好吃的蛋糕捏~~','118','2011-11-29 09:52:00',NULL),
	('13023f00dedd7e787f5aef4fa7d7423d','da68323c302849b36844423139800fd4','lakers13','5',4,4,4,'由于这是第一次吃正餐，没有比较，就说说自己的感受吧！环境是相当不错了，音乐正好聊天的时候不会很吵，但是安静的时候又可以听到音乐。服务没话说，毕竟那么大的西餐厅如果服务不好，太说不过去了吧。今天是3个人去的，点了两个300元套餐和一个135套餐，两位女士喝的果汁，我点了杯红酒，毕竟吃牛排还是配红酒比较好。超赞的还是青岛牛排，还有更贵的，没敢点，不过建议一般朋友还是点全熟的，7分熟的偶尔能看到血水，吃不惯的可能会反感吧。鹅肝，蜗牛都不错。最后厨师还赠了一篮小点心，不知道是不是都赠送。总之，感觉还不错，不过小贵，不是经常能消费的地方。','300','2011-12-11 00:50:00',NULL),
	('1bf30ba3584889944976ec4bd6bbe38a','da68323c302849b36844423139800fd4','一一ere','4',3,3,4,'过生日和老公去的 一个法国帅哥给我们服务 很爽啦 回国一直都没有吃到正宗鲜嫩的牛肉 这次算是如愿了 本人认为蜗牛很一般 不太值呢dessert 点了一份french pancake 服务员现场制作 很炫的烟火 可味道一般下次尝尝焦糖布丁吧','300','2011-10-15 13:21:00',NULL),
	('1d59d603d636dbb8a451f90410388ed2','da68323c302849b36844423139800fd4','小败媳妇','5',5,5,5,'上周五和老公去过结婚纪念日的，因为这个大堂经理一个法国帅哥还送了我一本礼金券。服务员很有素质，吃完一道菜上一道菜并配上专用餐具，并且简单介绍不会有不熟悉法餐不会用的尴尬。一开始看到这菜量还和老公丢人的讨论了一下能不能吃饱，因为我们都属于饭量可以的，事实证明西餐的热量的确很高，这个不用担心，还有赠送的面包什么的。这里的环境也很好，真的很有气氛，法国大厨也很热情，我往洗手间走还给我指路。因为没有看到差评所以才去的，去过了回来也给五星。生蚝只有周二和周五有。','360','2011-10-14 23:02:00',NULL),
	('04ce434b2568dc733e471896336aad30','daeac5a83e7843ad40567988bc77395c','wo501','4',3,3,3,'每次都是吃他家的自助餐！好喜欢，因为有很多海鲜。甜点做得很精致，都不舍得吃了，哈哈~还有，冰淇淋是哈根达斯的哦~~~赞一个！','200','2011-06-10 10:26:00',NULL),
	('05e24c7655e0d2d0b5eede5dfa47e375','daeac5a83e7843ad40567988bc77395c','momjane','0',4,4,3,'这里的自助早餐品种丰富，食品味道好。非常喜欢，就是早餐好但也毕竟是早餐，能吃多少呢，而且也贵，住酒店我们协议是不含餐的。','168','2009-10-29 20:09:00',NULL),
	('09cfcc0abb375ae2daa317f1114aca12','daeac5a83e7843ad40567988bc77395c','yinsiyi','4',3,5,5,'其实它家的自助餐我是耳闻，真正品尝的是它家的蛋糕，由于单位在那办招聘会办了一天，闲的没事就跟同事去楼下买了它家自制的蛋糕~一个黑森林一个抹茶，我好像每次都是买这两个品种~说实在的味道还是不错的，加上咖啡~很赞的下午茶~','0','2009-12-10 16:27:00',NULL),
