	('113c1af345847cf789df4170c54b7a78','daeac5a83e7843ad40567988bc77395c','会吠的猪','3',2,4,4,'吃了自助餐，西式的，乡下土包子实在吃不惯。三文鱼浅尝辄止，金枪鱼吃不惯，牛排味道怪怪的还有股臭味。德国香肠很好吃，吃了8个。就是去吃香肠和水果而已。','158','2009-12-11 16:55:00',NULL),
	('137ec0c85e50068286b66e0a80ab8105','daeac5a83e7843ad40567988bc77395c','勤勉的无奈','5',4,5,5,'【试吃/体验点评】海鲜偏多，菜系是德国的为主，是国际大酒店，每月都有各国风味小吃，就是价格不低，他的宾馆服务很好，有老外服务员，需要额外服务费15%。','220','2011-11-17 16:47:00',NULL),
	('152b03d2d1d592d71bfe209759c273c0','daeac5a83e7843ad40567988bc77395c','兔兔子爱吃','4',4,4,3,'没有吃自助，招待客人选的这里，商务宴请是个很不错的地方，大包间很宽敞，洗手间里面还有洗手液和毛巾。餐具都很精致，点的红酒都帮我们装在小杯里倒上来，服务态度也很好的说。菜点了不少，也不知道菜名，就说说具体的菜吧。烤鸭，吃起来感觉应该是无锡烤鸭，端上来一整只当场帮我们分好的。羊排，炸的那种小排，很好吃。蟹粉鱼翅，一般，觉得不环保。海参，装在一个放满石头的盘子里，其实偶不喜欢吃海参，但是听说有营养，强迫自己吃。。老虎斑，这个肯定好吃的啦。牛肉粒，一般，口感不好。鱼皮饺，一般。其他没有什么特别有印象的菜了。','0','2010-11-25 21:51:00',NULL),
	('15b4577cd80a6f987b0a79c3ad690eb4','daeac5a83e7843ad40567988bc77395c','饮食之宝','4',3,3,3,'黑啤是他们家自己酿的。作为四星级的连锁酒店餐厅的环境可以说是可以的。大小包房都有，在当地宴请客人也算不错了。菜的味道跟上海这边这么多店比起来没什么特别之处，算是中规中矩的。吃个环境而已','300','2011-05-14 18:26:00',NULL),
	('18865f5c5647680878acc564a13fbdbb','daeac5a83e7843ad40567988bc77395c','52苏小志','4',3,3,3,'【试吃/体验点评】去吃了一次凯宾斯基的自助餐！感觉挺值的，里面的东西非常的丰富，而且是各式各样的都有！最爱的三文鱼和哈根达斯里边都会有，保你吃到肚子撑死！','138','2011-06-22 07:22:00',NULL),
	('18bc1121a123d14dc72390dc03c85405','daeac5a83e7843ad40567988bc77395c','灵山小雨点','4',4,3,3,'工作应酬去过一次，后来是陪朋友去订房去过一次，总体印象挺不错的，环境很好，交通也方便，吃的东西又多又好吃，喜欢吃海鲜自助餐的朋友可以去光顾一下的，因为那里的自助餐海鲜很多','0','2011-12-14 17:04:00',NULL),
	('1c303daceb2d28cc4a3913e933c637e5','daeac5a83e7843ad40567988bc77395c','饼干妞','4',2,3,3,'环境不错，就是周边不大热闹，开会在这住了2天，服务很好，房间设施不错，不过早饭不大灵，第一天的小笼包里的肉有股异味，吃了之后胃不大舒服。午饭吃的西餐，选了牛肉为主菜的B餐，还不错。','0','2010-11-19 22:05:00',NULL),
	('1c4657d181c2005ae178081517dd50af','daeac5a83e7843ad40567988bc77395c','win圈圈','3',3,3,3,'去喝喜酒滴。。。亲爱的小Z做了伴郎。。。婚礼前一天，去看了下场地，。。这个傻瓜一眼看上了中间的那个T 台。。。。偷笑。。。。这个可以搭起来的呀。。。。唉。。。。真是傻。。。。路过一楼大堂的时候，能看到进进出出蛮多老外在CHECK IN 。 看来，老外来住店的还是蛮多的，价格肯定不便宜。。。。门口停了好几辆好车。。。用来接新娘的。。。。总体还不错吧，不过，好像是5星的吧。。。怎么这里说是四星的呢？菜品还可以吧。。。。反正订的是配好的菜。。。。有点印象的有这么几个菜：【芥末牛肉】，牛肉块挺大的，满足！牛肉本身带有芥末味道，我是蛮能接受的，觉得不错。【红烧蹄髈】个头有点小，比较秀气，还不错，太大了就野蛮了，呵呵。。。亲爱的知道我是爱吃蹄髈的祖宗，还示意我吃，多吃点，嘿嘿。。。。。【酸辣汤】这个很失败，反正，不适合我，味道很冲，不好味。不喜欢。。。。【百合莲子红豆沙】这个甜羹主要是取它的美意的，百年好合，甜甜美美。。。当然，味道也不差的。。。甜品么，我总是哈的呀。。。【蒜蓉粉丝焗澳龙】肉质不错，最主要是派头能满足了。。。。用来撑撑台面的，这个大家都懂的。。。。【清蒸多宝鱼】多宝鱼么，我喜欢的呀。清...一色的做法，考究的就是鱼肉的质量。。。。新鲜品质好，那味道就OK 。。。。一道甜品，做成小鲤鱼模样的。。。。是椰汁木瓜做的。。。。味道QQ的。。。和豆腐布丁差不多。。。一般吧。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。。差不多就记得这些菜了。。。。。亮点没有。。。。否则，我肯定全能记得。。。。。善哉。。。。不过我发现，主桌的菜和其他桌的不一样，最后送的水果也不一样，不光是品种，量也有差异。。。。这还是第一次遇到。。。总体还可以。。。表扬亲爱的，中午没有喝酒。。。。全文','0','2011-04-20 14:48:00',NULL),
	('1de9e461d51abf3b743ffa83da4df1ae','daeac5a83e7843ad40567988bc77395c','上岛咖啡屋','3',2,3,3,'一般吧,东西品种不多,而且总觉得都是一个味,点心还是满漂亮的,口味也可以.我最喜欢吃虾了,朋友还特地要了个辣的芥末,冲死我了','188','2010-02-08 11:30:00',NULL),
	('1e138425d955393e1a62ca5019f24536','daeac5a83e7843ad40567988bc77395c','飞机的炸弹','4',3,3,3,'给你们说这家店的东西很贵哦，但是这家店的自助餐很好的，价格也不便宜的。我现在是出差的时候就会在这里小吃一下','0','2010-12-31 13:01:00',NULL),
	('039c351c4e33f85e7501d8d9ea9a6b40','dbac6df8ef3f121596d52fd3246b4f82','Edmond_JF','4',3,4,4,'【试吃/体验点评】位置在云霄路靠近香港路的地方，比较好找。环境不错，很水乡的感觉。还有很多关于丽江的图片、书籍。包间中规中矩，有两种风格，最大的包间可以容纳20多人的样子。再说说美食，斑鱼其实就是我们平时所说的黑鱼，这种鱼是一种食肉鱼，所以这种鱼的肉特别的鲜美细腻。这里最有特色的是一鱼三吃，或者说是四吃：鱼肉有刺身和涮鱼片；鱼头和鱼骨熬成鱼汤；鱼皮是炸着吃的。我个人最喜欢的还是刺身，黑鱼的刺身比三文鱼香，有韧劲儿，有嚼头儿；鱼汤也很喜欢，是养生的佳品；只是炸着吃的鱼皮感觉不好，提个建议，可不可以把鱼皮用来涮着吃？那样，胶原蛋白可以更好的吸收，对于爱美的女士不失为一道养颜菜品。印象比较深的还有那四种丸子，Q性十足，芝士丸是女士的最爱，一定要尝尝；还有蟹籽丸和海胆丸，造型非常漂亮，有卖相，吃起来能嚼出蟹籽的感觉，试试就知道噢……','0','2011-09-11 17:29:00',NULL),
	('08d03f4102150292f3b1e3fba63d7fe7','dbac6df8ef3f121596d52fd3246b4f82','isobella','2',2,2,3,'【团购点评】我发现我现在越来越懒了，点评都懒的写。所以就言简意赅的评论一下吧。这家店只适合团购的去吃，像我们这样非团购的实在找不到物超所值的感觉。坐下来半个多小时，东西都上来了筷子却没有，为了要双筷子费了多大劲啊，比到处喊人收拾桌子和点菜都难多了。我们遇到的情况无非三种：1.没有服务员；2.有服务员却不理你；3.服务员告诉你好的请稍等然后就nothing happened了。点四斤的鱼才那么几片鱼肉，骗鬼呢。锅里的骨骸也绝对不是我们那条鱼的，头只有半只，骨头倒是蛮干净的，连点肉都不见，刀工神了。劝大家要去的话还是拿着团购券去吧，也就值那个钱。','0','2012-01-27 11:07:00',NULL),
	('09598db2eb8918d98969d9152c1ca323','dbac6df8ef3f121596d52fd3246b4f82','马赛鱼汤99','4',3,2,4,'【点评团消费】团购去的，刺身很Q，斑鱼片切得很薄很好熟，斑鱼片换成了炸鱼皮，还算酥脆，味道不错，只是鸡肉丸一般般啦，量挺大的，两个人吃不了','100','2011-11-08 10:15:00',NULL),
	('0b44ba66d922a6c7636f67a6a1b13c9d','dbac6df8ef3f121596d52fd3246b4f82','candyfish820','4',3,3,3,'看到网上评价不错，就抱着试试看的想法去试吃，果然没有失望，斑鱼片真的是很好，很嫩很滑，芝士丸很香醇，还有赠券送，很划算。吃得有点儿多，嘿嘿~所以赠券多了吃不完，过期了好可惜~低价转了，有想要的可以联系我：）','100','2012-01-06 16:56:00',NULL),
	('0c06fa6a6d5fd3d82133ff1b7941a0bb','dbac6df8ef3f121596d52fd3246b4f82','singmysun','5',4,3,3,'【试吃/体验点评】【团购点评】有幸被抽中参加试吃活动已经过去好几天了，可是斑鱼用来涮着吃的那份鲜嫩美味口感却久久不能忘怀……好想再吃到啊！因为工作缘故，在北京经常可以吃到用黑鱼做的烤鱼。龙记老板跟大家讲了黑鱼就是斑鱼，只是盛产这种鱼的广西人都称黑鱼为斑鱼。龙记这次，让我领略到原来黑鱼涮鱼锅吃竟会更美味！将黑鱼切成薄如蝉翼般的“纸片儿”，最薄的时候都能透过其看清报纸上的字儿（老板说云南丽江的龙记店能够做到），等喝掉由大棒骨、鸡熬制成的高汤后，放进鱼片，稍微一涮变白后就可以吃了，啊啊肉太嫩了！好吃好吃……不得不提这里的芝士丸，第一次吃这种带有甜品气质的海鲜丸^_^，咬破丸子，芝士滚滚流出来，味道太正！还有开胃菜品中的蜂蛹、竹节虫等等就不多说啦，都是营养极其丰富滴东东。牛肝菌、松茸这些野生菌类更是大爱！哎，貌似爱上龙记了，下次会推荐给各路达人去吃！','0','2011-09-09 20:56:00',NULL),
	('0c5ead0bad5de5403504206ebbf64c30','dbac6df8ef3f121596d52fd3246b4f82','DP_yuanyuan','5',4,4,5,'这次团购去的，很好吃，以至于到了最后吃捞饭，老公都劝我别吃了.......太好吃了.......那个服务员态度也那么好，一直给我们解释，还帮我们弄.......要是有最佳员工评价，一定投她.......很喜欢...还会再来...','0','2011-09-08 20:31:00',NULL),
	('0cb98bf43ec789a954ba7d3ac60d87a7','dbac6df8ef3f121596d52fd3246b4f82','可澜','4',4,4,4,'【试吃/体验点评】呵呵，最近这家店的出镜率很高，今天终于可以一探究竟。斑鱼片真的是鱼片，薄如蝉翼，不过在锅里“七上八下”以后居然不会散，真的很神奇。经理在介绍的时候特别强调说斑鱼不会有土腥味，而且营养价值很高。四种丸子中据说女生很喜欢芝士，不过我个人更喜欢蟹籽丸。芝士的就还好啦。很喜欢他们的酸梅汁，还有赠送的那种白萝卜，酸酸甜甜的很好吃。当时说捞饭很有特点，可是感觉还是连汤加米，觉得有点像平时吃饭的时候往里加菜汤o(╯□╰)o基本上试吃体验没有服务态度不好这一说。不过当时在楼下照大厅环境时，看到本菜单，我就随手照了两张，这个时候一个服务员走过来，冷冷地说，你照这个干什么？呵呵，我想哪怕是在普通的一家店面，照个菜单也是很正常的，实在不需要脸色这么难看。','0','2011-09-05 22:48:00',NULL),
	('13abdf0c4fdd50e21dae3934c8172d75','dbac6df8ef3f121596d52fd3246b4f82','巧克力de味道','4',3,3,3,'【团购点评】很幸运中了他家的试吃~吃完真是留恋往返，还是大众点评给力，紧接上了团购哈哈~不叨叨，为自己和家人团了2份，本身偶就是丸子控，斑鱼庄家的丸子真是很Q，很好吃','80','2011-09-26 09:17:00',NULL),
	('165524243d8b5aabd80c108c4a40cf90','dbac6df8ef3f121596d52fd3246b4f82','大桃子。','4',5,4,5,'环境一般咯提前预定的二楼房间觉得一楼其实气氛应该也不错鱼是很好吃的 推荐！服务也比较到位~适合朋友聚餐 属于好吃实惠型的','70','2012-02-03 23:58:00',NULL),
	('1a1782d112f26dfbce641e001be5607c','dbac6df8ef3f121596d52fd3246b4f82','sdlb887','4',3,5,4,'【试吃/体验点评】【团购点评】之前在还没开业就发现了这家饭店，感觉很有特色，希望能来吃一顿，正好赶上大众团购，很合算，就团了准备去吃，看大家对这家店还很满意，评价很不错，我也很期待……','0','2011-10-08 15:05:00',NULL),
	('04e201404518adc4fc44b5650d23ac2e','dc68e38b663e751cc7dd2228683a9157','淼淼kathy','3',2,2,2,'陪一个天津来的老爷子去的，点名要吃大清花饺子，说是慕名而来，在沈阳很有名。于是陪着去了。老实讲，觉得没有妈妈包的饺子好吃，几个饺子下肚后，觉得有点儿腻，不过，他们家人气貌似很旺，去的时候没有位置，很多人在等','0','2011-01-01 11:34:00',NULL),
	('073be25539fb3044fd0f4812b7e5e8f1','dc68e38b663e751cc7dd2228683a9157','瘦丁','5',5,4,4,'要不是师姐推荐还真不会来这家店，但来了一次之后就知道肯定会有下一次！这次给了难得的五星！之前看点评说这家店很火，要等位子。所以专门早点到，算是慕名而来吧~交通其实还是很方便的，就在百联旁边，地铁公交神马的都能到。门脸也很好认，全都是木头的，门口还有大炮和大酒坛子，感觉就很不一样。进去之后发现格局比较奇怪，但是很古朴，而且一个个都是小隔断，感觉很舒服，没有那种大堂吃饭的吵杂感。不过这就不适合同学聚会什么的了。因为到得挺早，五点半左右吧，人不多，所以说不用等位子。服务也就那样吧，随叫随到，但绝对不会说站在旁边盯着你吃饭。让我感觉比较好的是我们有一支筷子掉地上了，会马上有人送上一双新的筷子。这就是服务的意识！再说说菜，我们四个人点了松鼠鲤鱼，锅包肉，萝卜焖牛腩，还有一个青菜香菇之类的。一个鲅鱼冰花煎饺，一个松蘑饺子。然后还送了一份豆腐花和一份卤汁豆腐皮。量很大！都没吃完，打包带走了。然后口感那叫一个好啊！首先说说松鼠鲤鱼，这是来了沈阳之后正经吃的一次，感觉很好！鱼皮炸得酥脆，鱼肉香嫩，酥酥的~很好吃！然后是锅包肉，跟平常吃的锅包肉很不一样，虽然说同行的几个人都认为就是锅包肉，但我始终认...为这个锅包肉比平常吃的更清淡一点，可能是因为糖没放那么多，但我更认为是放了姜丝的缘故，入口酥脆，而且有一股淡淡的姜味，这让我感觉很爽啊~接下来说说萝卜焖牛腩。其实就是萝卜牛腩汤，挺清淡的，而且喝喝汤，暖暖的很舒服~然后有一份青菜香菇之类的素菜，中规中矩吧。最后是两个饺子，都很好！尤其是松蘑饺子！很好吃！力荐！下次去还会点！然后是鲅鱼冰花煎饺，其实有点小失望，冰花的卖相没有新洪记和老边饺子的好看，然后味道的话也就那样，可能我太吃不惯鲅鱼吧。不过，总的来说还是很好很好的！吃得好饱！环境和服务都很好！绝对值这个价钱！全文','50','2011-05-27 22:50:00',NULL),
	('08f957209cc0aca271dcdb82736a94f4','dc68e38b663e751cc7dd2228683a9157','吃FAN','4',4,4,4,'很有名的一家饺子馆，连锁的，哪都有，饺子很多种馅料，还有西红柿这种奇怪的。其他的菜品也不错，不过连锁就难免服务不那么一样。','50','2011-09-11 15:14:00',NULL),
	('0db586780982d66652618a0002d100e2','dc68e38b663e751cc7dd2228683a9157','rongxin_1965','4',3,3,3,'很有特色的餐馆，环境挺特别的，很有点历史的味道，有一些挂饰挺有意思的，菜品也不错，很适合东北人的口味，饺子的种类比较多，价格也算实惠。','41','2011-09-10 21:20:00',NULL),
	('0fa3f9efe84f37c618104fcd40d0f0f0','dc68e38b663e751cc7dd2228683a9157','安德私人造型','5',5,5,5,'超爱大清花饺子！他家还有一种饺子是蒜泥馅的！很难吃到的！下次再去一定要问问怎么能吃到！就在家里楼下，真的很方便！还好吃！每次有朋友来！首选','100','2011-11-25 11:12:00',NULL),
	('1022cd3bed322606772c2a1eee7527a0','dc68e38b663e751cc7dd2228683a9157','mavis_mu','4',4,4,3,'【团购点评】虽然饭店比较小，但是还算有特色，里面实木装修，格局有些乱，人多的时候有些闹，不过他们家的饺子算是特色，味道不错，挺好吃。松鼠鲤鱼也不错。','50','2011-06-14 21:07:00',NULL),
	('10bbe8266d2b8318d80917ef42543974','dc68e38b663e751cc7dd2228683a9157','雨田307','5',5,5,5,'在沈阳经营饺子的饭店算是最便宜的了，非常的实在。饺子的种类也是相当多的，一般一家三口要两盘饺子，一个菜，一个汤，就足够了','30','2011-11-12 16:23:00',NULL),
	('12c2e195a43c42a63de19b2b06782c83','dc68e38b663e751cc7dd2228683a9157','当年上和御姐碰到一起','5',4,4,3,'环境不错，挺有特点的，不过里面像迷宫一样绕来绕去的= =松鼠鱼超赞，吃一口就上瘾了哈哈。鲅鱼饺子也很好，超级鲜；不过锅包肉很一般，不是很好吃。其实如果是家庭聚餐或者请客、工作聚餐什么的他家是个不错的选择，不过如果是和好朋友吃饭，我想我不会选择他家，因为价钱不是很划算啊╮(╯_╰)╭','100','2011-06-17 22:34:00',NULL),
	('12cf234581be94c853502ef05db368da','dc68e38b663e751cc7dd2228683a9157','凝露翡翠','3',2,2,2,'昨天和老公去吃的，两个人点了角瓜、三鲜两种煮饺酱猪蹄、酸辣蕨根粉两个菜酱猪蹄的味道一般、但很软烂饺子很腻，不太好吃酸辣蕨根粉挺好吃，不过这菜在哪都好吃老公喝了瓶啤酒一结帐花了83觉得不值下次恐怕不会去了','45','2011-02-10 09:46:00',NULL),
	('150df56021e489a1d2cc410e493da57b','dc68e38b663e751cc7dd2228683a9157','朗吟越洞庭','5',5,4,4,'这家店闻名已久，上周和大学老师小聚，选了这家店吃。装修有些古典的韵味，不过浮俗些许。老师请客，点了一桌子的菜。要了二两白酒。松鼠鲤鱼，拔丝地瓜超好吃。饺子很是不错，不过俺去晚了，没问什么馅的。有一种是绿色的面皮。青炒也不错，清淡而味美。总体而言属于比较好吃又不是很贵的上佳食店。','85','2010-11-20 10:29:00',NULL),
	('16a3a47d02477eb01ec5bc1f2a749681','dc68e38b663e751cc7dd2228683a9157','奔跑的千年小妖','3',2,2,2,'东西比较便宜，饺子有特色，算是市内很正宗的满族菜。如果有外地的朋友来，建议带去他家，感受一下正宗的满足文化装修有特色，但是空间比较小。','40','2010-09-24 17:21:00',NULL),
	('1978114008fc13cd43f430cc675de085','dc68e38b663e751cc7dd2228683a9157','吃点就行','4',3,3,4,'【试吃/体验点评】装修的古香古色的，很有文化的一家店，他家的饺子很全，我爱吃西红柿陷的，大骨棒也不错，以前带妈妈去大吃过，很适合老人家的口味。','45','2011-06-20 10:26:00',NULL),
	('1de611c2c244ccb7ef75ae45c6dc1f3e','dc68e38b663e751cc7dd2228683a9157','安妮小厨','5',5,3,3,'他家的虾爬子馅儿饺子是我吃的虾肉馅饺子里最好吃的了，比水晶虾饺还好吃。都打成那么细的肉糜了都还保留着鲜味，很难得。菜吗也大的很~本来就吃不了了还要送菜。肉丝拉皮也不错~大棒骨稍微有点膳。','40','2011-07-05 18:05:00',NULL),
	('07677a35aa4a0bd9bc2ae30d22690b35','df5b9203fc990975861741e2b90ae30e','CRB2005','4',3,3,2,'听说是颇受热捧的饭馆儿，湖北菜。朋友常来这儿，很会点，故点了很多好菜，可惜没看菜单，有的菜不知道叫什么，以至于记忆不清啦。楚风霸王鸭是熏的，有辣味，不错。大丰收很有趣，把红薯玉米放在铁板上，最上面烤的是鸡翅，味觉丰富也很入味。有一个肘子肉，类似酱肘子，但是热菜，非常糯软香。橄榄菜虾球，点心拼盘有肉包，蛋挞和南瓜饼似的东西，小孩子爱吃。最受大伙儿欢迎的是疙瘩汤，十分清香可口。啤酒有雪花和燕京纯生。','65','2010-08-18 17:37:00',NULL),
	('09a3e43598bab51518ffde6e7eea0888','df5b9203fc990975861741e2b90ae30e','狂想2046','4',3,2,2,'同学婚礼在这里办的答谢，感觉味道还是不错的，而且据说价格不贵，很划得来！感觉有些湖南特色似的，有点辣辣的！但还好啦！','50','2010-02-28 20:41:00',NULL),
	('0ae4cd6cacaa24b15d5c4de696a913f3','df5b9203fc990975861741e2b90ae30e','又见紫色月光','3',3,3,2,'同事婚宴经常订在这里，去过几次感觉东西味道还好，只是上次去汤里吃出了清洁丝，大堂经理竟然还说饭店吃出这种东西很正常，对他家有些失望。有几样菜感觉还好，剁椒鱼头很入味，牛仔骨也很好吃，桂花米酒羹很有营养，口感也很嫩滑。总体来讲还是个可以去试试的地方吧。','60','2010-07-01 10:38:00',NULL),
	('0c8a8fdb25ca59d5cb8ea1a26935753c','df5b9203fc990975861741e2b90ae30e','mandy0404','0',4,4,4,'去参加朋友婚礼的答谢宴。环境还是不错的，菜品也比较有特色。餐具比较精致，无论是宴客还是自己品尝，都是比较合适的。','50','2009-10-03 19:46:00',NULL),
	('105588b209ca7fe6b8d04781a2bc97d9','df5b9203fc990975861741e2b90ae30e','dayangy','0',2,2,2,'每次必点&quot;干锅茶树菇&quot;,而且只要想吃&quot;茶树菇&quot;就会想起这里,味道与众不同,香\\鲜\\微辣\\嫩,值得一提. 其他的就没觉得特别,不难吃,也没觉得特别好吃,','0','2008-05-07 14:03:00',NULL),
	('1692f5d3e5660bfc83d778598f64d82b','df5b9203fc990975861741e2b90ae30e','念彤','0',3,3,3,'湖北菜做得非常地道，环境也很好，就是交通不太方便，离大部分商圈都比较远，去一趟有些麻烦，不过菜好吃也是值得的，唯一觉得不好吃的就是热干面，不知道是我点的那次没做好，还是不太习惯面的口味，其他的都很好吃','60','2008-01-30 09:27:00',NULL),
	('159856f205583a2f26e1ae040d3cb888','df5b9203fc990975861741e2b90ae30e','a_chuan_x168','3',3,2,3,'85%的同事答谢宴选在这儿！主要是离着近。说到味道，湖北的同学都说好吃，其他人都说一般，不知道是不是鄂菜就是这味儿的。大厅、包房的酒水不便宜，婚宴除外。别人怎么说都没有自己亲自尝尝来得直接，想去就点两个菜吃吃看吧。','50','2010-12-21 18:17:00',NULL),
	('16882644db547badb96e39f1549a86fc','df5b9203fc990975861741e2b90ae30e','玫宝','0',2,3,2,'装修很有特色，环境也很好，很安静。湖北菜的特色瓦罐汤不错，味道清淡，口感好。菜式感觉都还不错，不太记得具体吃过什么了，但是大家都推荐的竹筒粉蒸排骨我个人不是很喜欢，感觉味道有点怪异。','50','2009-10-30 15:14:00',NULL),
	('1b724c6cacbf185ab2ec0ac78bac3dcc','df5b9203fc990975861741e2b90ae30e','饕餮他爷','0',2,3,3,'应该算是主题酒店，和金三湘、大秦瓦罐、灶王爷什么的差不多，代表一方特色。老饕去的时候是几年前了，并未感觉非常的正宗，热干面尤其不好吃。竹筒蒸菜还是不错的，没点威名遐迩的沔阳三蒸，臭鳜鱼什么的。而且不是很实惠，不适合当食堂。','50','2008-09-01 15:21:00',NULL),
	('1cc09091233d9d12555f984ab502c371','df5b9203fc990975861741e2b90ae30e','申发义','4',4,4,4,'味道不错，环境也不错，价位更不错，不少同事在这摆的婚宴，不太适合大众消费。一般都是商务宴请比较合适，偶尔可以尝尝','50','2009-12-10 13:34:00',NULL),
	('1d5ce783c65fb998b8efed54b2cd0bee','df5b9203fc990975861741e2b90ae30e','郑小兴','0',3,4,2,'楚风楼 手撕饼超级好吃，哇哈哈哈，甲鱼味道也不错，肉很鲜美。总之，菜的味道都不错，很喜欢。服务态度也好。老板很有品位，走廊里陈列了很多古董，虽然有的应该是赝品哈。商务请客吃饭是个不错的选择。','75','2009-07-18 14:49:00',NULL),
	('00b1f95e22b60509f657179073a16659','e191fc37aea68d6ea8cd8434e54b8d78','也许的幸福','4',5,5,3,'【试吃/体验点评】烤肉不错哦，就是量不算大 土豆泥好吃 免费送的 续加了好几次。。。 环境不错，食品味道也不错，就是服务慢了点，狂摁铃，才来的服务员呢。。。','25','2011-06-21 21:59:00',NULL),
	('01134e5ef34539651f662ec36128012a','e191fc37aea68d6ea8cd8434e54b8d78','Emma_23','5',4,4,4,'韩料里面最喜欢的一家。首先桌子很舒服，可以把腿伸直，卫生条件很好，虽然价格小贵但是量比较大，最喜欢的是牛肉炒粉丝，还有那个牛肉章鱼汤，没想到这两样东西顿在一起那么好喝。会员卡可以打八五折好像。','70','2011-06-17 21:06:00',NULL),
	('01a1831d6632462d1357e9d5c281b088','e191fc37aea68d6ea8cd8434e54b8d78','effic1984','5',3,3,3,'晚上去吃的人很多，环境有点嘈杂，服务员很忙，叫了好多次才能过来，南瓜粥好喝，一开始吃着小菜喝着南瓜粥，等五花肉上来时都有点饱的感觉了','68','2011-09-13 12:47:00',NULL),
	('057364bd5fdb8aa3a5781f019f5cb71a','e191fc37aea68d6ea8cd8434e54b8d78','牛小魔','5',4,3,4,'很爱的一家韩餐店。韩国老板夫妇经营打理。食材很正宗，口感相当好。餐前小菜也很丰富。餐后总会随着季节搭配不同的小食。榻榻米的构造也深得人心。强烈推荐哦。','80','2011-05-25 10:11:00',NULL),
	('064a0b2a00864d972ffe3a8e8c08223c','e191fc37aea68d6ea8cd8434e54b8d78','顺水扬帆_55','4',3,3,4,'绣罗这里的服务也不错，我向一个男生咨询怎么去石老人，他很不好意思的告诉我他不太清楚，后来人家又特意去问了别人再回来告诉我们。餐前送了很多小菜都是各种泡菜啊什么的还有个什么鱼，吃起来也不错，穿穿竟然吃了很多辣白菜。很令我惊讶。这里还有最爱的南瓜粥，我俩一共喝了6碗。点了烤五花肉（25元/份）我觉得切得有点儿厚；烤牛排(好像70左右，不记得了)穿穿喜欢，我不喜欢吃肉，所以不做评价；还点了菌菇拼盘，里面有小口蘑、金针菇、猴头菇等，价格不详。炒年糕(20元/份)量很足，我俩根本吃不完；还赠送了鸡蛋羹，这个我喜欢。吃的很饱很饱。餐后还会送口香糖。这顿饭好像130到140吧。记不清楚了。','70','2011-08-31 15:04:00',NULL),
	('0c5e2a9c587ced7acc13fdd8ba1fa198','e191fc37aea68d6ea8cd8434e54b8d78','毛什么毛','4',3,3,2,'【试吃/体验点评】她家店里我觉得最好吃的竟然是免费赠送的南瓜粥~！！！小菜的量很大，光赠送的东西就摆满了一桌子。韩国料理里我最喜欢吃的是泡菜炒饭，她家的这道饭可是一般。服务跟不上，朋友的饭都吃完了我的还没上。','40','2011-09-06 09:31:00',NULL),
	('0d076d3155293ef750bcffe3a69d154d','e191fc37aea68d6ea8cd8434e54b8d78','wenzinger','4',3,3,3,'东西比香港花园其它韩国料理店稍微贵一些。朋友很喜欢他们家的南瓜粥。其它东西，如烤肉啥的，感觉口味和其它家没有多大差别。服务还行','0','2011-09-06 12:11:00',NULL),
	('0e96dbdffd431414023b36cbbdc9cdc0','e191fc37aea68d6ea8cd8434e54b8d78','crystal_qd66','4',4,4,4,'晚上很朋友去吃的，人很多，要排队等位子。泡菜饼的料很足，味道很好。送的小菜很多，很喜欢那个蒸鸡蛋和南瓜粥。有个牛肉什么火锅挺好的，里面东西的种类很多，量挺足的。秋刀鱼的味道也还行。','55','2011-06-27 15:25:00',NULL),
	('1398f2e617d2b8e0348fe8d2753992fb','e191fc37aea68d6ea8cd8434e54b8d78','floralinjing','4',3,4,3,'提前定的位置 里面有可以脱鞋进去坐着的位置 不错 喜欢哦 很韩式的风格，五花肉和牛舌头一般都会点 五花肉偏肥 牛舌偏瘦 中和一下，每次吃韩国料理最喜欢就是小菜一大推 哈哈 吃了不够还可以再免费要 小自助一个，牛尾大补 但是到后面 实在太撑了 没吃了 很多肉，吃五花肉的时候一定喝着南瓜粥 不然要腻死了，他家的炒年糕 甜辣味刚刚合适 好喜欢 就是吃起来不消化 撑人','100','2011-06-22 09:34:00',NULL),
	('13fd9be50d02f1a6fa1e8abe4d65e5aa','e191fc37aea68d6ea8cd8434e54b8d78','我爱我家家83','4',4,3,3,'小菜很多 人很多 我是他们搬家之前去的 搬家以后没有去过 石锅拌饭很好吃 有一次我还去打包他家的石锅拌饭 挺好的挺喜欢的','60','2011-06-17 16:32:00',NULL),
	('141e5c19b2cafcdc0b2ce6eea2fbb5ec','e191fc37aea68d6ea8cd8434e54b8d78','silencefall','5',3,3,3,'小菜送得真多，光吃小菜都够了。菜量也大，口味也好，每次去人都满满的，周末还时常等不到位子。小菜里南瓜粥是我的最爱。最爱蘑菇火锅、烤牛肉、烤五花肉。经典的就这几样吧，百吃不厌。','40','2011-01-20 16:19:00',NULL),
	('15f74da5bb3d0716b9394ab22a704c39','e191fc37aea68d6ea8cd8434e54b8d78','SASA824','3',3,3,3,'很久以前去过一次，点的什么吃的什么味道不是很记得了，没有特别有印象有冲动非去第二次不可的菜，只记得哇塞好多小菜啊。。。价位相对来说偏高，可去可不去吧....','60','2011-06-22 10:07:00',NULL),
	('1bb3b0c0479134d9de08a9f10877e709','e191fc37aea68d6ea8cd8434e54b8d78','XIAO胖脸','4',4,4,3,'位置相对偏一点 但是生意很好。送的小菜很多，鸡蛋羹和南瓜饭不错土豆炖鸡 是很大的一盘，能不断的加热，能吃的超饱。适合几个人小聚。','60','2011-02-26 11:10:00',NULL),
	('045872b065c0d87a51422a52c74821ae','e227fbc8988149f9c6566ca03a7b4fdb','风继续吹fjxc','3',2,2,2,'元宵节3点去排的队，等第二批进去的，其实里面位置很多的没必要等很久的，看来排队不过是店家的噱头，菜价一般，量没传说的那没多，尤其是冷菜每样都只有一点点，冷菜中：外婆将军冻，外婆醉鱼干，味道不错，汤泡海草很爽口，话梅花生除了甜味没其他味道，奇怪怎么会有人在网上推荐。热菜：石锅牛蛙值得一试，特别是里面的莴笋好吃，酸菜鱼个人认为是比较值得推荐的，里面萝卜和冬瓜味道挺好的，窝蛋肥牛里洋葱是生的鸡蛋黄没结住，肥牛肉和吉野家牛肉饭里的味道一模一样，外婆红烧肉则是肉和咸鱼一起烧的没吃头，青豆泥不错，泉水牛肉上来让人大跌眼镜，就是开水煮牛肉，牛肉没几片，乾隆香干味道不错，培根高丽菜和手撕包菜没区别，绿茶饼味道还是可以的，水果园子羹也不错，总的来说性价比还可以和辛香汇应该是一个档次，服务可以忽略，可以说点好菜基本就别指望有人为你服务了，不过随便吃吃还是不错的啦。','60','2012-02-07 13:58:00',NULL),
	('0a7cddddde637bbab508cf45d2cb424b','e227fbc8988149f9c6566ca03a7b4fdb','食全客2','5',5,4,3,'【点评团消费】1月20号是团购的最后一天，带上妈妈从闵行匆匆赶到店里，正好是下午一点多了，门口已经有人在拿晚上的好了，和前台说了声团购就吃中饭后就直接给了个号，也没人领位，店堂环境偏暗，有点乌漆墨黑的，入座后问小姐要了菜单，茶水是要自己去倒的，我来之前已经做过功课，大致了解了招牌菜有哪些，所以就直接照推荐度高的点。外婆红烧肉39，果然是招牌，肉炖的超级酥烂，味道都渗进肉里，周围的鱼干鱼肉相比就只有陪衬的份儿了，连我平时不吃猪肉的人都忍不住食指大动，好吃的打耳光都不肯放啊~~茶香鸡45，鸡肉也是相当的酥烂嫩滑，鸡皮可能经油锅高温炸过所以鸡皮颜色泛金黄，用筷子一戳感觉像捅破一层窗户纸的轻脆感，鸡肉饱含汁水，既便是鸡胸肉都没有柴或干，木的感觉，不过最好是趁热吃，这样才能品尝到鸡肉充盈汁水的幸福口感。值得推荐!!!窝蛋肥牛32，最早端上桌的一道菜，趁热先将当中的生鸡蛋和肥牛拌匀，但似乎铁板不够热，蛋液丝毫没有凝结的状态，想趁热吃来着但似乎大厨这铁板火候不给力呀，再来说说牛肉，就是加了老抽等调料调过味的牛肉片，味道中规中矩，似乎还不是很入味，而且牛肉口感有些老，有些筋筋拉拉的，要是牙口不咋地朋友还是不要点，味道也真的是...一般，而且价格也不便宜，所以这道菜一般般吧。西湖醋鱼38（原本应该是青鱼做的22元，但服务员说青鱼没有，就换成了鲻鱼38元），这道菜是一桌菜里最难吃的，蛮好不要点的，还不如点豉椒蛏子呢，先来说说这鱼，这条鱼的河泥腥实在太重，妈妈吃过一口后都几乎没再动过筷子，我本着做人家的优良作风硬吃了半条，另外半条打包，奉劝各位要去外婆家拔草的朋友们，这道菜还是不点为妙......有机花菜16，这道菜不错挺爽口的，味道也不错，本来我就喜欢吃花菜，在大鱼大肉吃多的间隙吃几口花菜解解腻不错哦，值得推荐哦!!!绿茶饼12，不甜糯糯的，芝麻香香的，一定要趁热吃啊，推荐！！！麻婆豆腐3，三元的菜嘛譬如伐是，最主要性价比高呀，不过老辣的，不大会吃辣的就pass掉这道菜好了。抹茶红豆优格13，帮妈妈点的，很大一瓶，妈妈说好喝。总共消费198元，去掉两张88的团购券，176元，实际支付22元。其实这些菜就我和妈妈两人根本吃不掉，不需要点那么多，无非是要把团购票子用掉才拼命点的，后来有些菜打包带回家了，要是一家三口估计这些菜也绰绰有余了，所以人均还是很便宜的，属于比较实惠的，下回来试试豉椒蛏子，非诚勿扰，石锅牛蛙，糖年糕，当然外婆红烧肉不能错过哦。另外他们家外带盒两元一个。以上内容希望能给大家一些参考建议。全文','60','2012-01-25 01:15:00',NULL),
	('0b3ab31d30cb7e35f4f802d8d7ccff73','e227fbc8988149f9c6566ca03a7b4fdb','咚咚小猪','4',4,3,3,'对这家餐厅的音箱可以说是最深了 上海比较有名的几家排队时间最长餐厅之一不过和辛香汇那边比起来还算是好的了 基本上一道两个小时左右就会听到喇叭喊到我们的号 最可爱的就是这个喊号方式太特别了 是童声喊的外婆喊你吃饭了 哈哈 好玩的很再说说菜吧 个人感觉一般化 真的是没有太大的特色呢 但是为什么这么多人排队 我至今还是比较费解外婆红烧肉 量不大 中间放一块肉 旁边是鱼还有点笋之类的吗 鱼是真的咸鱼 那叫一个齁啊 肉呢 没有想象中的那么细嫩糖年糕 最后可以用难以下咽来形容了 块头很大 吃起来太甜了 反正我是不喜欢啦绿茶饼 唯一一个觉得味道不错的菜 了面的味道像绿豆糕 亮点就是外面的一圈芝麻 这样一口咬想去 满口香还发现一个很有意思的细节就是 他们家的菜底下放几块石头 好几道菜都是这样的 最后我们分析应该是保温用的饿','0','2012-02-12 19:43:00',NULL),
	('0b6e6ed2e900b800497749d4641a7cc8','e227fbc8988149f9c6566ca03a7b4fdb','SeBackXy','3',3,3,3,'等位一天世界，还好会提供小食。我们有早有准备，带了牌！等位的时候可以在机器上点菜，不过由于实在是人多，感觉还是蛮混乱的。味道么蛮好，性价比不错啦','60','2012-02-10 13:41:00',NULL),
	('0db763cff1ec05a0ba2800333dac13f6','e227fbc8988149f9c6566ca03a7b4fdb','flora1218','3',2,3,2,'办公室三个女同事晚上约好按摩，结束周边觅食，突然想起外婆家在附近，晚上八点多预计应该不用等位了，果然去了就有位，这还是第一次在上海吃，应该人气太旺以前想也不敢想。饭后一致评价太太太不怎么样，虽然便宜但味道不好吃，环境不错，不排队也不想再来。','0','2012-02-02 22:31:00',NULL),
	('102cb724e620d36edea5a46c38dda8a7','e227fbc8988149f9c6566ca03a7b4fdb','shirley_zll','3',2,3,3,'慕名前去的，唉。。。吃下来实在是发现没啥好吃的。。。菜都很油，而且很咸。。10点20去排的队，没多久就进去了，3个人吃掉211，用了点评的现金券，规定一次只能用一张，好吧。。吃下来觉得还不错的是有机花菜。这个花菜和一般的花菜味道不大一样，比较难形容，不过我很喜欢。外婆红烧肉实在是。。。好油啊，居油无比，而且都是肥肉，还是里面的鱼比较好吃。绿茶饼，唉。。没我在另外一家吃的好吃，还是两个字，好油。。而且貌似变小了茶香鸡，受伤了，这根本就是咸鸡嘛，唉。。。麻婆豆腐，这个还可以，而且很便宜，3米糖年糕，这味道很奇特。。。怎么和一般的糖年糕不一样。。。油炸后淋的酱汁糖醋里脊，都是面粉啊。。酱萝卜倒是不错，酸酸辣辣的，很快开胃算是拔草了。。吃吃也不是很便宜','60','2012-01-27 19:54:00',NULL),
	('1134447b677e916e7eddd222debc4339','e227fbc8988149f9c6566ca03a7b4fdb','lemon6','3',2,2,3,'年初二晚上去吃的,排队的人很多,但是速度还是蛮快的,很多人都走了.2个人点了红烧肉,麻辣豆腐,茶香鸡,糖醋里脊,竹筒面,甜品一份,最后都没吃完,因为那天人不太舒服,都吃不下.老实说,菜的味道也没什么特别的,和家里烧的差不多,.她们家打包要另收费的,1元1个,别家的都不要的,甚至打包的话可以有折扣的,节省嘛!可能是价格上便宜吧,所以才吸引这么多人!环境是不错啦,就是人一多太嘈杂了.','100','2012-01-29 17:19:00',NULL),
	('12cb0738b6c2c07599d6556974c7b75a','e227fbc8988149f9c6566ca03a7b4fdb','Iivyee','2',2,3,3,'第一次去吃，六点到的时候很，门口排队的人群已经很壮观了。吃下来大失所望，菜都不大入味，西湖醋鱼，很腥；麻辣豆腐就是便宜，然后就是辣味;有机花菜还可以；粉丝煲也不好吃，比较干；因为没有什么菜吃，只好叫了碗饭，饭大概时间久了，已经是温的，而且有些干。因为很饿，就吃了三个糯米糍粑，味道还不错。总之，吃过这次后，彻底拔草，以后再也不想去了!','60','2012-02-02 11:00:00',NULL),
	('1748bc1a76f42cc54475f682f7dd25f4','e227fbc8988149f9c6566ca03a7b4fdb','amber1412','4',3,2,2,'话梅花生很好吃，糖醋里脊不好吃，石锅牛蛙没什么好不好吃。服务真心没有什么好水要自己倒···等一个糖醋里脊等了30分钟。刚刚装修好，有一些地方有一股味道。杨枝甘露不好吃····性价比不过真的蛮高地·····','40','2012-01-30 16:36:00',NULL),
	('174dede781049978b7601d81366cac6d','e227fbc8988149f9c6566ca03a7b4fdb','大气隐于市','3',2,3,2,'我們叫了:養心百合~冰塊多過百合.乾拌牛筋、糖醋里脊、糖年糕、有机花菜、炒花蛤~都不錯只是烤茄子、蔥包繪與臭豆腐不太喜歡。如果臭豆腐是乾炸就更加好！它的梳乎里真的不錯。因是１１：３０到所以不用等位。','70','2012-02-15 09:57:00',NULL),
	('1bdfd59f94c61fb65f7984195c7bd792','e227fbc8988149f9c6566ca03a7b4fdb','简漪','3',3,2,2,'【点评团消费】一直听很多朋友说实惠好吃，但是同时也听说等位时间要很久，但是终究抵挡不了美食的诱惑，乘个周末乖乖地16点半不到就去等位了。直达电梯直接到8楼，已经是人山人海了。好不容易挤身到前台拿号。拿号机的触屏貌似还有点问题，每个人输入手机号都要输好久。。。在外婆家等位，等位的位子是要靠抢的，点菜的机器也要排队的。爆米花，水果，茶水都是一出来就哄抢而光的。。。最后，在我们等了3个多小时后，终于等到了个小桌。这里我要强调的是进去前是要把等位单给前台小姐的。但是后来不愉快的事情发生了，我们明明四个人，等位拿的是B桌的号码，理应被带到四人位。但是我们屁股还没做下来，另一对情侣被带到了我们桌前。我们稍有争执，前台小姐也搞不清谁给她的什么号。这样的员工还真要培训一下了！最终情侣被带去别桌，但吃饭的心情以此受了影响。点了话梅花生和虎牌扎啤均被告知没了。。凉菜就点了长寿菜（9元），口感偏苦，但还算可口。有些人也吃不惯，因人而异。麻婆豆腐（3元），物美价廉，每桌必点。石锅牛蛙（42元），牛蛙满嫩的，味道也不错。外婆红烧肉（39元），肉真的是一拍桌子就狂抖的那种。里面还有咸鱼。看上去虽然很肥，但口感却不油腻。有...机花菜（16元），这个很好吃，属于上桌后10分钟内被消灭掉的菜。绿茶饼（12元/半打），没大家说的那么好吃，个人觉得一般。外婆糖年糕（12元），很家常的菜，一般。后来加点了如下菜品西胡藕韵（15元），就是糖藕啦。芒果冰沙（18元），这个建议大家不要点，感觉不是鲜榨的，芒果味很淡，就像在咬冰渣。外婆鱼头（58元），里面还有面的，味道不错，推荐。茶香鸡（45元），这个很好吃，鸡很香很嫩，烧得已经酥烂了，轻轻一撕鸡肉就下来了，老年人吃也很好！总体来说，这家店是比较实惠的。但是鉴于服务态度很这么长的等位时间，不如换家~全文','50','2012-02-06 16:19:00',NULL),
	('1caeb1f7f4ba11df17d52efb2c31b603','e227fbc8988149f9c6566ca03a7b4fdb','_瓶子_','5',5,4,4,'终于吃到了！味道真不错，价格也很实惠。茶香鸡很好吃，炖的很酥烂，味道都进去。窝蛋肥牛略是我，牛肉筋筋啦啦太多，吃起来不方便，没几块就没了。铁板烤虾，不错，虾很新鲜，肉质蛮紧实。长寿菜好像是田七叶做，有股味道，吃不怪。要是排队人再少点就好了。另外叫号的小童声太可爱了。','100','2012-01-26 21:50:00',NULL),
	('073a2a27ce9984702031987092db6f06','e2848eb32035ff7ecdb1f24634d1f6fd','西街小爷','4',4,3,3,'【团购点评】当时是在网上团购去的，价位不贵，69元4人一桌口味很棒，以前在西安经常吃，没有想到这里的也这么棒！加汤后再下些面条效果会更棒的！遗憾的就是不够吃，呵呵，都是男孩的缘故吧！','69','2011-06-11 09:42:00',NULL),
	('07ce0ccd805a54abf60ba9707f43792c','e2848eb32035ff7ecdb1f24634d1f6fd','胆固醇万岁','0',2,2,1,'味道是在一般，没有感觉到很浓郁的羊肉汤的味道，而且菜单上的配菜很多都没有了，实在不敢恭维。服务态度也很差。','50','2008-11-24 09:57:00',NULL),
	('08dfb8926c08cdebc51995c089fb879d','e2848eb32035ff7ecdb1f24634d1f6fd','我自狂舞','4',4,3,2,'天气慢慢变凉了， 去吃吃热腾腾的羊蝎子，还是很不错的， 味道不错，没有辜负他的名气， 环境一般， 服务员的水平也一般，没什么特别好感，除了口味以外。    想吃好东西的，还是可以去下。','40','2010-09-26 10:15:00',NULL),
	('09e965e39855f56851ef350bb888c272','e2848eb32035ff7ecdb1f24634d1f6fd','拉面周','4',3,2,3,'店面看起来非常的普通，就像一般的火锅店，感觉没什么特色，我也是被朋友拉着才去吃这个的，但是东西却真是很好吃，羊蝎子味道很鲜，口感也非常好，吃着火锅喝着冰啤酒真的很过瘾，这家服务也很好，点菜的时候， 我们四个人点了很多，服务员说我们点的太多了会吃不完，让我们先点一大半，吃完了的话再点，后来真的吃不下了，真的是很贴心的服务，呵呵。','50','2011-09-06 02:56:00',NULL),
	('0cfda239864270a9f03286b2fe1b39dd','e2848eb32035ff7ecdb1f24634d1f6fd','莫斯萨','3',2,2,2,'很久以前去吃过一次，唯一的一次，有点记不清了味道好像还可以吧，但是我不爱吃羊蝎子、猪弯弯这类的东西，跟啃鸭脖似的，吃的好累人。。嘴巴都吃疼了，也没吃到点肉。。。我还是比较喜欢大口吃肉的感觉，所以后来再也没去过了最近路过那的时候，发现它家又在羊蝎子店附近开了一家新店，好像是做筋子和脑的。。不晓得为莫斯它家老拿这些边角余料做文章，不会去尝试，估计是不会对我这个大口吃肉的人的胃口','50','2010-10-22 16:10:00',NULL),
	('0fdf62a52dffbd7e62104a3ed2def244','e2848eb32035ff7ecdb1f24634d1f6fd','投河的鱼','0',5,4,4,'朋友带我去吃的吃羊蝎子，开始执著地不去，老觉得肯定有股膻味。没想到吃的却是又香又辣的羊蝎子，很合胃口，马上从不进来吃到喜欢吃了。汤也很好喝的，份量也可以。彻底改变了我对这个羊蝎子的印象啦。','50','2008-11-21 01:02:00',NULL),
	('13a4ccd737b315c47ee6d09d12e9acc6','e2848eb32035ff7ecdb1f24634d1f6fd','syl123','0',3,3,2,'武汉晚报上经常刊登这一家的广告，位置也很好找，就在中华路邮局的斜对面，一排门面的第一件门面，呵呵 。点一大锅羊蝎子，在点点配菜，再喝点锅里面的汤，味道还是很不错的 。个人觉得点一个小锅就够了，不过我们是2个人去的 ，呵呵。觉得那个汤煮着很好喝，喝汤就喝饱了。马上冬天了吃这个应该是很爽的吧，呵呵','50','2008-11-16 21:35:00',NULL),
	('186114d91b3a15d52fdf4fa9eb2bdaa1','e2848eb32035ff7ecdb1f24634d1f6fd','sherly_lee','2',2,2,3,'【团购点评】团购去的 火煱份量足够三至四个人我们两人去的没吃完 就是配菜太水 假鱼丸假蟹棒 没有等位!基本物有所值','40','2011-12-10 15:17:00',NULL),
	('1de5875dde61e69d0a219fc3c581bcea','e2848eb32035ff7ecdb1f24634d1f6fd','Alicest','5',5,3,3,'3个人去吃的，量很足，根本吃不完啊，锅底是用冬瓜打的，挺有创意的。汤很鲜、辣，地道的湖北口味！不过吃完，觉得有点咸~','50','2011-12-03 09:38:00',NULL),
	('01421990b65ea530fe3c9870aa276f49','e39ec81f7bac501b893e755bc0f147ad','丛奔','3',3,3,3,'满记甜品的环境不错，甜品也做得很精美的， 芒果白雪黑糯米甜甜和红豆香草凉粉都是比较喜欢的，很有人气的一家店的。','0','2012-01-31 22:55:00',NULL),
	('016c308753bcafd60904614582c3a36c','e39ec81f7bac501b893e755bc0f147ad','lovemelovemeforever','2',2,1,1,'真的都很差，人多，杂乱，都吃完了，找钱还没有来。味道也不行，卖相难看，竟然还要等座，恒记就行何必满记。店大欺客，名不副实，诚不谬也。','30','2012-02-05 14:39:00',NULL),
	('01d819b7005ef46f7d9c59911e2b8c7f','e39ec81f7bac501b893e755bc0f147ad','未央Andrea','3',2,2,2,'布丁下架了 真可惜最早喜欢杨枝甘露和糯米甜甜最近很爱双皮奶这家的人没有水游城那么多上次点了一个芝麻糊+红豆沙 热乎乎的甜甜的 很舒服可以来坐坐哦','30','2012-01-28 21:14:00',NULL),
	('034b10fc34c3cc4c517405c21a74a914','e39ec81f7bac501b893e755bc0f147ad','哦咪妞','3',3,2,2,'走了好久到了这里，一进屋黑压压的一片，这个乱呦。找了个有沙发的角落，刚落座一会儿就被墙上的异物砸到了头，天呀！没有榴莲的产品，只好点芒果，芒果那个酸呦，够生的，肯定不是澳芒，品质不太好，班戟的皮裹的很松，没有在香港吃时的眼缘好，芒果黑糯米白白里根本没吃到碎冰，难道是怕我冷？糯米夹生，比甜甜向上的差远了，估计今后不会再来了。以后解馋还是去甜甜向上吧。而且而且不能刷卡，不给发票，坚决抵制！','50','2012-01-31 17:55:00',NULL),
	('07b039b445a95c27ce10be7105e891b9','e39ec81f7bac501b893e755bc0f147ad','liyaze0102','3',3,3,4,'带孩子来大悦城玩儿，一天都在不停的吃东西，其实那里是玩儿，就是专门转吃的东西来了，哈哈！路过这家甜品店，儿子累了，坐下休息会儿，给点了杨枝甘露，我对于这类甜品东西不感冒，小孩子很喜欢，先不论是否好吃，品像就很好看，而且刀叉勺什么的，孩子全当玩儿了，下次试试那个芒果白雪黑糯米甜甜，看着不错哦！','20','2012-01-28 23:46:00',NULL),
	('0b2a8ade439fe182e80ea5f5920275bc','e39ec81f7bac501b893e755bc0f147ad','lil_bmw520','3',2,2,2,'点的88元的套餐，结果四个孩子都不爱吃，双皮奶很一般，其他的也是，勉强吃完。感觉水果不是很新鲜，以后再去的话要考虑考虑了','40','2012-02-09 21:59:00',NULL),
	('0bcd43f9d57138b59d88133b062bf26e','e39ec81f7bac501b893e755bc0f147ad','tangtangyu','4',4,3,3,'本人最爱榴莲，他家榴莲太正了。一开始是从水游城发现的，但是去那总得等，人好多呀，而且有时候想吃的东西都卖没了，这里人到还不多。','40','2012-01-25 16:10:00',NULL),
	('112406e4a56c76d4bdad0a6554a2af80','e39ec81f7bac501b893e755bc0f147ad','cymilk','4',3,3,3,'朋友推荐去的,人很多,但是服务还是很到位.味道不错,比某些甜品店的要好很多.用料纯正,货真价实呵呵~~就是地方小点,人太多了~~','30','2012-01-23 21:19:00',NULL),
	('12c307f8610fa7ee5db2007f06710a4c','e39ec81f7bac501b893e755bc0f147ad','石榴mirror1130','3',2,1,2,'和老公带宝宝逛街，看有位，就进来了。点了杨枝甘露、双皮奶、芒果班戟，味道嘛，不想传说的那么神奇，杨枝甘露一般中的一般，实在不会再点第二次了。双皮奶有点腻，不如恒记的好吃。芒果班戟更是被传得神奇了，可是实物太一般了，奶油很腻，吃了一口不想吃第二口，只能把奶油都弄掉，光吃了芒果。餐厅布局太紧凑了，邻座之间相距仅20CM，太别扭了。','30','2012-02-13 01:08:00',NULL),
	('1acc283f3579273c1f71b6b464d065c5','e39ec81f7bac501b893e755bc0f147ad','Amanda_2008','4',3,3,3,'第一次光顾，去的比较早，所以可以随意选位子。味道甜甜的，但不腻。服务员很实在，也很周到，给的建议也很中肯。快离开的时候，发现开始有等位的了，看来生意很红火！有机会还会再去的。','22','2012-01-27 21:32:00',NULL),
	('1b6f15c338ec66f98dcdee0b2353481e','e39ec81f7bac501b893e755bc0f147ad','芥末小料','5',4,4,4,'两个人点的杨枝甘露，糖不甩，芒果白雪黑糯米甜甜，芒果班戟。。。我们俩中午都没吃饭，结果最后还是吃不了了。。。。。都很好吃，就是芒果班戟奶油吃的太恶心了，剩下的强烈推荐。。。','45','2012-02-13 21:54:00',NULL),
	('1d45ceede47646497603d12035273ee8','e39ec81f7bac501b893e755bc0f147ad','EspresSong','3',3,2,2,'这次真不想发表任何意见，只是叙述，我们吃了晚饭在楼里逛了下，很多店都没开业，就想来这里坐坐，但是人真的多，等位，大约20分钟后有了位子，点了四种， 我的杏仁茶是最失败的，水放的太多了。可以理解，实在是人多，后面厨师，前面的服务员都超负荷工作了。就这样吧，不说了。','30','2012-01-02 17:52:00',NULL),
	('00e3ebc5c0802b69c4fb86982e2cf506','e4cfb0758361bfcba20f47935e180291','花朵闪闪','4',4,4,3,'去那吃过一次晚餐，剩下都是喝酒。晚餐点了芥兰，造型凹的很好，放在冰做成的容器里。。。别的记不住了去那里一定要点提拉米苏啦，放在酒杯里的，奶油味很浓郁，我爱用它配试管酒呢！','150','2011-12-17 14:57:00',NULL),
	('0183d3c8224ce334c889f6b2bcfea535','e4cfb0758361bfcba20f47935e180291','Kid_Dark','5',3,3,3,'总体环境很不错的情调小店适合有事没事的晚上约上三五好友或者情侣两个去劈劈情操喜欢吃里面的提拉米苏装在一个高脚杯里面 很好吃饮料也不错 挺好喝的聊聊天什么的 很舒服门口那个进门密码 也挺好玩的','150','2012-02-04 01:23:00',NULL),
	('01eb52a89eeb22c371851e5a248b94b5','e4cfb0758361bfcba20f47935e180291','nwlala','4',4,4,3,'慕名去的 一定要预约。没有预期的那么好吧，但也不算失望。总的来说还是比较有特色。招牌菜基本都点了，味道都还行，但也没有惊艳。大爱的就是提拉米苏，下次去穹六再尝尝~','160','2012-01-18 14:58:00',NULL),
	('041d3177c5fb1088375017654eb3015e','e4cfb0758361bfcba20f47935e180291','小艾Ariel','4',4,4,3,'年初和男友来吃的，看到网上评价挺高的慕名前往。适合情侣或者是一群朋友来，小有情调，就是价格不便宜。巨鹿路一条路都不错，有很多特色的餐馆呢。','150','2011-12-28 12:55:00',NULL),
	('082247c543acedf7ec68845f8c89f519','e4cfb0758361bfcba20f47935e180291','colinzhang36','3',3,3,2,'环境不错，就是服务态度有待提高，服务员态度很生硬，在禁烟区只是把烟盒放在桌子上，服务员就很生硬的命令说:这不准抽烟！而且还是说两次！！不过这也是上海大部分餐饮界的通病！','200','2012-02-14 08:59:00',NULL),
	('0cdb5c1ea55de9ed0a73731539d05193','e4cfb0758361bfcba20f47935e180291','倾雨花花','4',4,3,2,'当时和男朋友来就不是想吃饭来的，听说这里有好玩的什么猜密码还有什么惊喜啊，心里头一热就拖着他过来瞧瞧新鲜。期待着可以发生什么奇妙的事，所谓创意就是没玩过的，这对我而言就是小儿科，轻轻松松就完成了。果然我这里还是吃饭的地方，并不是游乐场或者说是冒险乐园，吃了点饭还是不错的。其实可以一边玩一边吃好饭也是可以偶尔玩玩的。','0','2011-12-31 14:50:00',NULL),
	('0f8da2bd6e4f2944b2ea859917d480f2','e4cfb0758361bfcba20f47935e180291','CHEN_LOVER','4',4,4,4,'和穹六是一个老板，也是人间系列餐厅，因为去过几次穹六，也想看看莹七，其实走的路线是一样的，但是创意还是无处不在的，进门需要密码，当天预订时服务员会告知，厕所依然有小亮点，与穹六的迷宫当然是不一样的，我是圣诞去吃的，只有套餐，也只有一个价位，当天的东西还是吃的饱的，下次去单点菜式感受下','500','2012-01-30 10:16:00',NULL),
	('1224a0ef68da1a0653b7101c44131ae9','e4cfb0758361bfcba20f47935e180291','小爱诗','3',3,4,4,'环境诡异，厕所诡异的一家店。。。边上有桌男男女女貌似在相亲。无聊的时候可以猜猜桌布上的成语。味道么，只能说还好。梅子排骨无感，最近吃酸的都不感冒。。。笔筒色拉形式大于内容了。甜品倒是都不错，服务员比较赏心悦目。','130','2012-02-12 13:47:00',NULL),
	('142c0b6f66a09809efb988d912d735c3','e4cfb0758361bfcba20f47935e180291','弹力小猪','3',2,3,2,'去喝酒的,灯光昏暗,有点小意思.和慢摇吧一样不太吵,不过东西小贵,服务员半天见不到一人,感觉酒都和软饮一样,度数一般。','0','2011-12-13 10:17:00',NULL),
	('1776eaf55f344f44c679733f4d49eec2','e4cfb0758361bfcba20f47935e180291','cathy_yan','4',4,4,4,'提前预约拿了密码，这地方貌似不预约还进不去。。。环境不错，昏暗的灯光伴随轻柔的音乐，挺享受的，外面是一片竹林，风景的确不错。吃饭在二楼，点了几个经典菜，梅子排骨配合笔筒色拉，一点不觉得油腻，酸酸甜甜很入味，凤梨虾球，好吃的忘拍照了，量很迷你，价格满辣手额，味道还是挺赞的。最后来了个甜品，提拉米苏是我吃到现在最好吃的，大爱啊临走前，在某人强烈要求下，感受了下这边的厕所，居然没找到。。。只能说他们家的厕所是亮点。。。','120','2012-01-21 22:17:00',NULL),
	('17e78dd70bab123078821b808fe3f3cb','e4cfb0758361bfcba20f47935e180291','兜啊兜','4',3,5,3,'菜品笔筒色拉，很特别。里面有细长条的春卷，在一开始是最受欢迎的，后来排骨吃多了，一根根蔬菜棒很是解腻。提拉米苏，很惊艳的造型和口味。五小块精致的甜品用心盛放在一个玻璃杯里，光造型就与众不同。这灯光配合这造型看着就让人心醉。。。梅子排骨，量挺足。味道其实还好，没有说的那么过。配合蔬菜吃，不然最后腻死。韩风烤鸡，个人感觉一般。量很小很小，然后个人不喜欢泡菜，这道菜的口味略属于重口味。人间豆腐，其实感觉就是纸火锅盛载着麻婆豆腐。杏鲍菇三文鱼，这款很好吃，杏鲍菇片包着三文鱼外面裹着面包粉，虽然是油炸的但不觉得腻。情人面包，很坑爹，非常干。这个面包的量其实蛮大的，轻信了服务员。。。最后几乎没吃，因为实在吃不下，还有排骨我很努力地吃，还是有一半剩下。。。环境要预定位子拿到开门密码，九孔很可爱很适合我这样最喜欢看侦探小说的娃。摸第一个数字的时候镜子开了，和朋友吓一跳呢，第二个数字一摸门开了，感觉仿佛在武侠小说里暗门进去了一样。厕所事先知道会有反过来的玄机，其实过去稍微思路换下就能知道是怎么回事了，厕所里面布置其实还好，个人还是更喜欢王鼎的厕所布置。分割式的装修，错落有致的层次我...很喜欢。一楼有吧台有沙发软座，二楼餐厅没看到有沙发软座，不能点酒精饮料，可惜了我特地想尝下试管，下次特地来一楼坐下，应该不错的。再说下餐桌，桌上果真都是字谜，猜成语的，不是第一次见到，但是还是很欣喜，一边吃一边玩像孩子一样。台湾人的餐厅好像很喜欢这种仓库式的风格，又省装修费又有新意其实还蛮不错的，全靠灯光打造梦幻氛围，每个餐桌都一束灯光照在上面，很是不错。总的说来，口味也就还好，但是我喜欢那种氛围真心喜欢啊。旁边就是无二人间，一开始走错了，惊艳于无二的竹林，下次要再去那边看看！全文','0','2012-01-19 16:24:00',NULL),
	('188c0f7f0846bb29a18b1af7fa6438de','e4cfb0758361bfcba20f47935e180291','kavara','4',3,4,3,'吃的是氛围 吃的是环境 吃的是一份安宁菜式精致 量少 梅子排骨 虾球 很好吃 喜欢~~~第一次去的人 肯定比较精细 重重机关哦 哈哈','200','2011-12-31 13:23:00',NULL),
	('1bfba06c344c2ffad81b634c1b720a49','e4cfb0758361bfcba20f47935e180291','水色泡沫','5',5,5,5,'很灵的一家店，值得一去啊，吃饭的时候还遇到明星，胃口大增。菜也做的很精致。环境也很好。有机会还会再去。','100','2012-01-23 20:04:00',NULL),
	('078413c643a27c2df8d9237d9405b1b5','e56154c6569d6dcf8261589d0411eaf7','lyis','0',4,4,4,'和男朋友家人一起去吃的很好吃的一次本来1号要去吃但是事先没订座，导致排着常常队没吃成2号一大早，就打电话预订座位了从小东门打车十多块钱就到了很不错，我们订的个包厢装潢很大方富贵让人很有食欲吃了他们那海鲜滑 还点了乌龟厨房师傅会乌龟先提上来给看看然后会问你是否要白酒 可以自带师傅给调好胆酒和龟血汤很鲜美，食物也很美味好吃他那蔬菜面也很好吃','50','2008-01-12 11:27:00',NULL),
	('0888c6625cbd0a0b4924e1809812182d','e56154c6569d6dcf8261589d0411eaf7','紫艳半开105','4',3,3,3,'当时去的时候好像是三年前，吃完的感觉就是 贵  两个人没点什么海鲜居然吃了260，着实吓了我一跳，吃完觉得红枣汁好喝','100','2011-06-09 16:12:00',NULL),
	('0de24f6254d43bcd75fa384d618167ba','e56154c6569d6dcf8261589d0411eaf7','阿萨克斯','4',4,3,3,'饭菜口味不错，胃口大的话价格也不低，包间环境很好，服务也周到，在太原算是比较不错的火锅/豆捞了，推荐','80','2011-09-16 08:26:00',NULL),
	('11da0968288a04939cf692914914d41b','e56154c6569d6dcf8261589d0411eaf7','爱玩才会赢','0',4,4,4,'在太原有两家店，生意很红，感觉金港的环境更好一点。菜价有点贵，味道不错，虾滑和牛肉滑好吃，鱼滑不能点，特别不好吃。菌类拼盘还可以，楼上国泰君安的去吃能够打折，不过折扣也不多，感觉大厅比包间空气好，但就是有点吵，靠玻璃窗的那一行最好（金港）','60','2008-10-30 14:59:00',NULL),
	('12c516b5feb30e776dc3e40b2dea41fe','e56154c6569d6dcf8261589d0411eaf7','lbhw5854','5',4,4,4,'这是在北京吃完海底捞回来，发现的第一家总算能比一下的火锅店了，味道环境都很不错，算是比较贵些，但东西都很新鲜。很喜欢那个银汤，瑶柱汤。每回吃火锅都是各类的滑，墨鱼仔，鸭血。','60','2010-08-16 01:35:00',NULL),
	('19274e9b84083c4968962f2ef7a1cf1f','e56154c6569d6dcf8261589d0411eaf7','不再流浪的猪2008','0',3,3,3,'前几天在北大街如一方就餐，是听说那里的保安走正步很帅，想去瞧瞧，顺便吃吃火锅，嘻嘻，然后去店里转转，发现他们的订餐卡上印有出租车司机的车牌号码，不过总体来说，服务不怎么样！哈哈','50','2008-01-24 14:14:00',NULL),
	('19d1f5ba69b72bb8f9f642b493039afb','e56154c6569d6dcf8261589d0411eaf7','tarzan_ts','4',4,5,4,'客户请吃午餐，就在公司附近，环境还不错得，一个大锅，先要喝汤，味道不错，很有特点。除了肉类之外，印象最深的是豆腐，尤其是绿豆腐，感觉很不错，而且绿面条味道很好，比其他吃起来感觉好很多，有机会可以再去。','80','2010-06-23 00:07:00',NULL),
	('1a196b47c9300b22e26bcbc0501c6085','e56154c6569d6dcf8261589d0411eaf7','b型蟹','0',3,3,3,'环境很好，有停车位，服务很周到。汤底和涮品好吃，最爱虾滑，鲜味十足，口感有韧性。价格小贵，不过物有所值。','70','2008-10-25 23:04:00',NULL),
	('1a502b76aa6670cf656f7b511b8177c9','e56154c6569d6dcf8261589d0411eaf7','清凉菜','0',5,2,2,'这里是我在太原最喜欢的一个吃饭的地方勒.因为是南方人,所以不大习惯太原的饮食.但是这里的菜品跟家里吃的火锅还是比较像的,鲜,而且调味料比较多.够自己调来调去~~!环境一般吧,感觉乱乱的.服务生,好像有点木纳.不过还是有几个机灵得很哟~!','0','2008-01-26 02:13:00',NULL),
	('1c2ee3aa3c1918e5c6c4d8361e0459a1','e56154c6569d6dcf8261589d0411eaf7','lunar198686','0',3,3,2,'不错哦，汤很清淡。滑挺好吃的，不过鱼滑很大土味，可能是用四大家鱼的原因。。。人是超级多，没有定位就要排队，有一次吃饭的时候外面排了二三十人。。。恐怖','50','2008-06-22 19:53:00',NULL),
	('1da30ec959c3fd51c9ab6e628434d901','e56154c6569d6dcf8261589d0411eaf7','CandyYAY','5',4,4,5,'每次吃到不好吃的火锅都得回来这里补一顿，简直是救命的地方。喜欢！不喜欢菌汤，有种刷锅水的味道，银汤就不错，喜欢在里面涮菜。','70','2011-10-19 23:36:00',NULL),
	('01788ef2334a5831e01e571463cd5b6f','e8b3a69f94840b473be5e0e9138eb44c','玫瑰乱了','0',2,2,2,'如果不是有人带我去，这家店路过几万年我都不会看见。。。老板娘的态度非常好，服务员就一般般了。看见老板娘在很费劲地清洗咖啡机，小汗了一下。。。坐在狭窄的阳台上，觉得实在是狭窄了一点点，再大点就好了。不倒翁水杯吓了我一跳，很怕摔坏。去得很不巧，白酱都没有，只有青酱和茄汁，蛋糕也只有抹茶慕斯和蓝莓芝士。青酱炖饭的味道还可以，调味比较寡淡。青酱鸡肉和青酱蘑菇只是配料的区别，有点小失望。不过对小店要求太高也不现实，毕竟量是很多的，味道是可以吃吃的。抹茶蛋糕的味道还可以。抹茶的风味不太浓郁，而整体的偏淡掩盖了这个弱点。一块抹茶蛋糕，抹茶味不足而不太甜，还能接受。如果抹茶味不足却太甜，那就完全失败了。中间的抹茶慕斯也是一样。正宗的抹茶蛋糕是甜的，但是甜得浓郁，甜得有风味。麦德龙卖的明治抹茶蜂蜜蛋糕就很好吃。咖啡还可以。因为我本身对咖啡没什么研究，酸味不是很明显，所以我还蛮喜欢。','50','2009-08-17 15:39:00',NULL),
	('01c56193d81ebae1655d6c94b01ee497','e8b3a69f94840b473be5e0e9138eb44c','sinxiangchen','0',4,5,4,'腿受伤，在家不见天日了很久，一好点。就被人拉出来透透气，来了这家让她口水喷了很久的店：环境超好的跟你说~~哇那蛋糕最好吃了跟你说··不后悔来趟的跟你说——  先讲讲位置吧，要不她来过，刚进门的瞬间，还以为私闯民宅了，的确有点隐蔽但进去后感觉还不错:吧师还小帅的哈哈，难怪要来了这花痴。白色的主调简单却很舒服，沙发、书橱、阳台、吊扇··很有来朋友家的感觉。但也有很多私人的个性的：厕所成留言墙了写什么东西的都有、居然还有个小后花园、寄卖的东西也蛮搞的（买了个披头四的明信片）、不倒翁水杯差点也吓到我心脏了（Dangerous大家怀念下迈克尔 ）。。。  好了，跳到吃的上：  蛋糕她点了致命跟蓝莓，这个她有发言权点:跟你说了！超好吃的，哇！ 自己不是很爱甜食，但尝了几口，的确纯正很多，不会让让人感到腻。服务员说蛋糕不是自己做的，从上海一家榖屋进过来的（有可能错别字）  接着点了烤翅，这比较对我味，味道烤的确实不错，很肥啊哈哈，有点像奥尔良烤翅，但翅出去鸡而胜于鸡  我叫了杯沙冰，够天然的全是芒果，喝着还ok  恩差不多了，很小资很私人的一家店，感觉蛮对的，既然杭州不是云南西藏，那就去云南调调的cafe  哦对了，...再扯下店名，居然叫a to z 也就是A-Z，这让我想到我喜欢的一个歌手：jason mraz 而他有张专辑就叫：Mr A-Z 而他最经典的歌就叫:  I&apos;m yours  巧了！！全文','45','2009-06-26 12:17:00',NULL),
	('0252d03e0bcdeaf8c4de6b0a2d531691','e8b3a69f94840b473be5e0e9138eb44c','looxin','4',4,3,3,'地方没有别人说的难找，招牌还是挺醒目的，就是没停车位。下午一个人去的，还没什么人，选的下午茶套餐，不倒翁水杯比较特别，咖啡一般，但那个配的蛋糕好吃的没话说，推荐一定要试试！','48','2010-12-16 15:14:00',NULL),
	('02d9a16b47e66a5d18b4fa187de5ba0b','e8b3a69f94840b473be5e0e9138eb44c','becky85922','4',4,3,4,'春节假期的时候去的，因为其他地方人都很多，相对这里安静些。主要是为了玩桌游，顺便吃个便饭。我点了青酱蘑菇炖饭，觉得口感不错，比较对我的味蕾。看着朋友点的其他的饭，也很不错。也许是人少的关系，店里可能清闲些，所以加水很及时，也很贴心的说。','30','2011-02-07 09:55:00',NULL),
	('05437f82c1bbccb93c723da0a810eaf0','e8b3a69f94840b473be5e0e9138eb44c','麦基陈','3',3,2,4,'在尝试了杭州所有我能知道的并想去的咖啡馆外，最终挑了Costa作为经常活动的Cafe。前两天心血来潮想换个地，于是在和某人聊天时就顺口问了下，他毫不犹豫的推荐了这里。介于稍了解他的品味，觉得这可去，因为朋友刚来杭州，没什么想法，就完全交给我定，我就选了这。狼狈之下到的这，因为1 手机没电，朋友上了车，会不知道往哪走（之前没告诉他地址是因为他对杭州没概念，外加这有点小难找，一不留神就会错过。准确地址是环城西路66号，省府大楼东），我急着找插孔充电；2 急着上厕所。 终于在老板娘（其实我是乱猜的，当时店里没什么人，她的样子就像这的主人）的帮忙之下，我踏实的坐在了阳台的位子。空间有点挤，藤的椅子，加上个有点大的靠枕，能置臀的地方就剩一半了，稍微丰满点的男士估计会无处置臀。老板娘是亲自服务的，端来杯水，装在不倒翁的透明玻璃杯，很小巧，漂亮，一不留神还怕摔着。墙上有人性化的挂外套等东东的地方。问了下女主人店名的来源。她说这家是以英文字母C开头的店，他们希望以后能开26个字母的其他的店。这里C代表的是Cafe, Cake, 和Chocolate. 这点也解释了店名中把Cafe隔开(C-afe)的原因。下午茶有三种套餐：50元每位的，任选一款咖啡，...或德国老牌茶，或另外一些指明的饮料，外加任一款当天有供应的蛋糕。还有30元每位的及25元每位的（Sorry没留意）。我要的是德国茶中的？香草茶，对于我这个几乎不喝茶的人来说，纯属被其名字和知名度吸引，我还要了推荐的致命巧克力。朋友要的是日本绿茶和蓝莓芝士。在网络及媒体及老板娘的介绍之下，知道这的蛋糕都是来自上海很有名的穀屋，价格上才比在上海卖的贵了几块钱，很合理（蛋糕价格都在40以内）。其实点时，朋友更想尝试她家的招牌芝士（打着杭城最好的芝士蛋糕的旗子）。说真的，我的致命巧克力没有想象中的致命（可能是期待太高了吧），个人更偏爱普罗旺斯的和亿多瑞站的。朋友的蓝莓芝士很棒，他说这是他在中国吃过的性价比最高的蛋糕。本来还想点香草榛子蛋糕很其他的，但因为晚餐会饱餐一顿，于是决定下次来。中途研究了下吧台对面的那块墙，发现有很多家媒体报道过这，初读了下，评价貌似都挺高的。另外还有一些展示的，可出售的小东西，挺有创意的。不得不提的是她家的洗手间，涂鸦的不行，涂鸦的就差地板和天花板是原貌。瞟了下，虽然写的东西层出不穷,然而真的很有创意和温馨。哦，还有，这里竟然有公共抽水马桶用的那种垫纸（一般在机场或一些上路点的地方才会提供，或有类似于此的设备），可避免交叉感染，很体贴。里面还有个装点的像living room感觉的小屋子，据说阿里巴巴的人在这举行过头脑风暴。这的服务很好，老板娘很有礼貌，看得出是有素质的人。有点觉得做的不好的是阳台旁边的玻璃窗，很脏。是外面那层脏，我觉得店家应该每天或至少隔天清洗。全文','0','2011-12-01 22:57:00',NULL),
	('05611e31e91d6b225004a190a46bb3a4','e8b3a69f94840b473be5e0e9138eb44c','santahuang','5',3,2,3,'门面非常小，是一套大约80平左右的老公寓改建的。因为离我单位近，去过几次。蛋糕不便宜，味道还可以。环境一般，居家类型。路过可以进去坐坐消磨一下时间，特地过去不值得。','50','2009-10-05 22:04:00',NULL),
	('07a1a1e5c5548e3fefa78439847c80c1','e8b3a69f94840b473be5e0e9138eb44c','苏打小米','4',4,3,4,'上半年5月底的时候，有一次要去逛西湖，路上走过它家店门口。。忽然就觉得走不动了，非进去不可。。。门口小小的黑板，很有诚意的粉笔字，还有透过玻璃门可以看到的墙上挂的小卡片。。。一切都是召唤我走进去的理由。。店内的空间也不大，摆了一点别人寄卖的小物。。服务生不会无厘头的热情，只有在你需要的时候才会出现。。。舒服的距离。。桌椅都是最干净的白色配上最简约的款式。。心情会跟着明朗起来。。桌上的水杯是不倒翁的样子，看起来站不稳，却也不会倾倒，碰一碰它，就愉快地摆动。。坐了唯一的一个沙发座。。靠着软垫子看书，玩点童心未泯的小游戏，飞行棋，强手棋。。。还在厕所里满墙的涂鸦中，留下了自己的爪印。。似乎是这样就过掉了一个下午。。。听CC说这里的蛋糕超级超级好吃，致命巧克力里有好吃的曲奇。。。一定要有下一次，再用掉一个下午的时间，吃一份好吃的蛋糕。。。无论是致命巧克力还是蓝莓芝士。。','40','2009-12-24 22:28:00',NULL),
	('09e265395d20571c84802c19fd8a8e35','e8b3a69f94840b473be5e0e9138eb44c','美味莲蓉','4',3,4,3,'只是路过进去的，坐在那里感觉蛮放松心情的。环境很好，风景也不错，一边吃蛋糕，味道不错好吃，一边聊天，看看风景，心情也开心咯。还有下午茶提供，服务不错，下次再去。','0','2010-10-11 17:53:00',NULL),
	('0a9051f9f70f44647be50d96fa7de04f','e8b3a69f94840b473be5e0e9138eb44c','海豚搁浅','4',3,2,3,'最值得一提的是这里的蛋糕，味道很不错，推荐蓝莓芝士蛋糕，致命巧克力蛋糕，但价格有点小贵。咖啡味道一般般。环境挺安静，但是装饰有点显陈旧。','0','2010-11-01 18:24:00',NULL),
	('0c70441eca3d8c91c46606b56a8d2a41','e8b3a69f94840b473be5e0e9138eb44c','S_GUNDAM','4',4,2,2,'致命巧克力和 奶酪的味道都很赞，因为我吃的奶酪不多，不知道算不算杭州头一把交椅，但是味道真的不错。至少比两岸什么的奶酪强多了。环境比较一般，但不失幽静，和女朋友小聚非常不错的地方。','50','2010-01-17 11:14:00',NULL),
	('0c7ab29c4a1e23cbcda6ea1031a116db','e8b3a69f94840b473be5e0e9138eb44c','小鲨鱼范范','0',3,2,3,'收藏这家已经很久了，最近才发现这里最好吃的东西竟然是从上海穀屋&C by House of Flour运过来的蛋糕们门脸很小，顺着门牌号倒也不难找，在街边民宅的首层。主要是地图标注有问题，现在我已经把它改好了墙壁、桌椅都是白色，有点地中海风，一侧的房间都是沙发座，已经被携带笔记本前来的顾客坐满了；另一侧都是硬质座椅，但由于临街靠窗，比较亮堂店内还有一些饰品出售，在各种装饰品中，发现一个相框，里面是一张好男儿“君君”在此店的照片坐下后主动提供了柠檬水，玻璃“不倒翁水杯”挺好玩的服务态度不错，但是连我那很少出门的BF都说这里的服务员看起来像理发店的小工，我一看，形容得还真确切＝ ＝b餐盘刷得不够干净，尤其是餐盘装饰花的凹陷处，有明显的油渍窗台上不时有蚂蚁经过，还不时地爬到我们身上……“致命巧克力没有”，“85宗罪已经缺货很久了”那只好吃【C Cake】了，正好以前在上海没吃过【C Cake】，33块钱，推测比上海的价格贵3元，因为这里的致命巧克力是36元，在上海卖33元。蛋糕果然没什么问题，吃一整块巧克力蛋糕可能会过甜，正好拿一半芝士来中和一下，但其实我最钟爱的是【致命巧克力】中镶嵌的巧克力脆心【冰乌梅汁】味道很淡很淡...【水果沙拉】18，哈密瓜、苹果、梨，没一样是甜的。【白酱培根意面】35，卖相真的很难看，白酱已经变成了“橙酱”，除了培根，面里还有蘑菇和芦笋。量不多，但味道还可以，于是我问BF好吃吗，他犹豫了一下回答——“饿了什么都好吃”从中，我看出了他对此店的不屑 一 一b全文','38','2009-07-31 10:16:00',NULL),
	('0f1ffef0093c646a7c73fe19d8c287e0','e8b3a69f94840b473be5e0e9138eb44c','温温晚晚','4',3,3,4,'这家店的风格十分简约，感觉没有一丝刻意，典型的自家自娱自乐的那种感觉。如果你不是熟客，你肯定不能融入这个温馨的小集体。最值得的一提的是这家小小的咖啡店居然有一整面墙的书，对我这个书虫来讲这无疑又是一份惊喜。我喜欢这种随便一抽就能抽出本卡夫卡的氛围。当然如果你不爱书，旁边还有许多桌游帮你度过一个有一个懒散的下午时光。','0','2011-12-15 19:21:00',NULL),
	('1150140794f711139c50885f3a433a88','e8b3a69f94840b473be5e0e9138eb44c','emilyzouduff','4',4,3,4,'(我汗，我才发现，我居然忘了评价这家了，都一个多月了，都快彻底遗忘了）地方不大好找，又遇到西湖边单行道时间，搞得特郁闷。三轮看着地图陪我转悠了半天才到。一进店门就是典型的cafe装饰---照片墙先说他们家洗手间（不想倒大家胃口，不好意思）：非常有特色。因为一般公厕会有人乱涂乱画，这种做生意的小店老板怎么会容忍涂鸦这种事？但是这家，就很创新：专门准备了彩绘笔来给你涂鸦。除了陶瓷墙壁外，还有磨砂表面的两个墙纸让你来涂鸦。真是很有新意。我自然也抓紧机会，抒发一番咯~。可能是到店的时候，已经6点半了，天黑的差不多了，估计是过了下午茶时间的原因，店里人很少。我挑了一个很角落的位置，都有些隐蔽了，但是很安静，可以让我一个人专心忙活下事情。他们家柠檬水上上来的时候吓我一大跳。看着杯子歪下去，我嗓子眼都快冒出来了。以为快摔坏了，立马伸手去接。才发现原来是底部的特殊设计，本来就不平的。这个杯子像不倒翁，很有趣的。奔着他家的一个落地的广告标语“杭州城最美味的芝士蛋糕”点了块蓝莓芝士。比较mini的一个切片，但是蓝莓颗粒还算比较多。芝士很鲜，很厚的两层，不是松塌踏的，奶味很足，又不腻。好吃！还点了一个芒果...木瓜沙冰。双水果味，非常大一杯，没有多少印象了。全文','70','2010-05-29 18:17:00',NULL),
	('15a882457087789b10454577851c838f','e8b3a69f94840b473be5e0e9138eb44c','最后一抹荷兰橙','3',2,3,3,'东西还行不过性价比真的不高。一个蛋糕加一杯咖啡要70块？！东西真的没什么特别的啊！地方也很难找，不是什么商业区的地方。店很小但是装潢还不错。总之还蛮失望的吧。','70','2010-12-10 12:13:00',NULL),
	('01d036ea236ee81dbc8589d39ae90e87','e96f6168f028d48d23caa9f6f80dea1a','洋芋娃娃','4',3,5,3,'那天还在跟别个讨论银杏咧，还收藏了这家，没想到昨天就有机会去吃这家银杏金阁，虽然是作为乙方出现的，但说起要吃这家我还是很嗨啊，唯一不嗨的是他们居然一个茶点也没点，提的虾饺也否了，点了个生煎包just so so啊~~杯催T_T  绝对的商务宴请地点嘛，而且是比一般的商务宴请还贵的地方啊，吃的心疼，点菜的时候我去看了一眼，看的菜单上画的多大的一盘龙虾，上桌后只有小盘，真心是小龙虾啊，只有6坨虾球，剩下全部是菌子和大蒜块块，这道菜800多啊，8大800啊！！！！其他菜可想而知。这家的美女依旧很漂亮，身材好，但上菜手脚太慢了。','0','2012-01-05 23:09:00',NULL),
	('0413af20f19b2a70d6dc0e686a4886cf','e96f6168f028d48d23caa9f6f80dea1a','玄霜绛雪Alice','4',3,3,3,'在这里吃宵夜的人很多，包括我们也是，虾饺皇和凤爪做的很好吃，和上海的避风塘的有的一比，在成都能吃到这么正宗的港式点心很难得哦！','0','2011-07-20 00:58:00',NULL),
	('086a59098ce0915114ec9c7e89a6b633','e96f6168f028d48d23caa9f6f80dea1a','颖儿的天空','5',5,5,5,'单位请客的常去之处，个人觉得大餐不如小吃好。往往几个朋友喝喝茶、吃吃小吃的感觉好过请客吃饭点的燕鲍翅。隆重推荐它家的广东早茶和夜宵，成都味道第一哈。','110','2011-07-20 11:41:00',NULL),
	('06ae6c6aaed2ef5db0d4096fd204f247','e96f6168f028d48d23caa9f6f80dea1a','lovevannie','5',5,5,5,'金阁个人感觉是银杏里面最好的~~~菜品很新鲜很有特色，服务也是很好的，很多漂亮的美女服务员，蛮养眼的呵呵~~地理位置很好，喝茶的话价格并不贵~~早茶和宵夜味道都很不错~宵夜的性价比是相当高的','0','2010-11-10 10:24:00',NULL),
	('0a981ec83edf7e0f443926660d763ff3','e96f6168f028d48d23caa9f6f80dea1a','amkids','3',2,4,3,'冲着排行第一去的，都说排队很长进去也没排队，一上来就问喝什么饮料，我问有酒水单么，她就直接说有什么，就点了个橙汁和玉米汁，结果坑爹的一杯48元，两杯100没了。撇开这种低劣的抢钱手段不谈来客观的评论下口味。点了牛仔骨，虾饺，凤爪，萝卜糕，肠粉，两碗粥，芥兰。牛仔骨还行，但是保温久了有点温，虾饺虾倒是挺多的，但皮有点黏不够薄，凤爪和一般港式茶餐厅做法不一样，没那么入味反而腥味有点重，萝卜糕朋友吃了一口就没动过了，很咸,粥也就很一般，口味口感都非常一般，芥兰有点焦味，不爽哭。价格也很技巧的采用XX.8这种标价。只能说环境挺高档的，口味和上海烂大街的避风塘差不多，甚至还差点，性价比就更差远了，服务嘛进门没人接待的，要自己跑去问有没有位子。总之我不明白怎么能上第一的，估计成都人民很少吃这种类型的菜系吧。','120','2011-10-02 10:16:00',NULL),
	('0d5f152e6d41f7017b686d8f87853cf2','e96f6168f028d48d23caa9f6f80dea1a','山猪冲冲','3',2,3,3,'下午茶时间除我们以外没其他人，服务生很不乐意专门为我们开空调，热得叻。味道真的很一般，比起悦中餐厅差距不是一点点。但总体来说，形色还是不错的。让我最桑心的是萝卜糕，我最爱的萝卜糕。','100','2011-09-14 08:23:00',NULL),
	('11c349aa3d20e129224a53e3be30bb4f','e96f6168f028d48d23caa9f6f80dea1a','律师向前看','4',4,3,4,'这里菜的口味很好 我很喜欢吃的 尤其是这里的龙虾烧的很鲜美 样子做的也不错 就是一盘龙虾消费也很贵了 请客的时候带着客户来过','0','2012-02-01 12:42:00',NULL),
	('11ee657fd2022015e048a0c79f515e37','e96f6168f028d48d23caa9f6f80dea1a','甜心物语','5',5,3,2,'真是没想到一个做川菜的地方能有粤菜做的那么好的餐馆，也不枉费我从九寨沟返回成都特地打车去吃了。环境并无出挑，上海环境做的雅致的餐馆不少。服务生全程没啥笑脸，虽然是一个美女。。。吃的是点心。否则这个人均至少400+了。虾饺很新鲜，菌果是自创的吧？第一次吃到这样的做法，清爽不油腻又很鲜美。其他点心也都很好吃。Yummy啊~~~','100','2011-01-17 16:11:00',NULL),
	('14d90e6271cb53a54418225163143e4f','e96f6168f028d48d23caa9f6f80dea1a','cateyes08','5',4,4,4,'点心精致可爱 粥小碗价格是比起其他广式店略贵 但既要环境又要可口 综合下来甩其他店几条街去了。吃过几次 唯一值的是有盘点了杯橙汁48块钱。。。','100','2011-06-19 17:22:00',NULL),
	('1375e606160a52c615a0ed8ef2f24bf4','e96f6168f028d48d23caa9f6f80dea1a','new126621','5',5,5,5,'这家的一楼很超值，环境和服务都非常好但是价格并不贵，当然每次去也不好意思坐太久，和朋友小聚一下吃完就走人。粤式点心做得应该算是成都最正宗的了。','60','2011-05-31 16:14:00',NULL),
	('1518e22a6f63fb440438cc0cab2a7f6b','e96f6168f028d48d23caa9f6f80dea1a','汀藤若紫','5',5,5,5,'这家就不用说了，东西做得还算比较地道，价格嘛就不那么地道啦，早茶和夜宵都不错，当然不能和广州比，钱出的多味道自然还是比较能成正比，成都的高档餐厅了。','500','2011-03-24 14:02:00',NULL),
	('18eaeb5b4c1f9af4fa9985c4deef97d7','e96f6168f028d48d23caa9f6f80dea1a','飛飛Y','5',5,5,5,'听说这家是成都档次最高的饭店,生意也很红火.东西的味道也不错神户牛肉真心的贵,不过东西却很好吃,也算是值了~鱼翅捞饭也不错,嘎嘎~肚子又开始饿了~','0','2011-08-12 22:41:00',NULL),
	('01e4312869b6baf74af71771a573adb8','eacad9d32fa51d8365532d01db4a0511','aleccao119','4',4,4,3,'去的早，人超少，当时还以为这家店很一般，结果出去的时候门口已经排满了人。夫妻肺片一般，一直觉得大连川菜馆的这道菜都做的不理想。辣子鸡脆骨很不错，酥酥脆脆的。干煸四季豆外酥里嫩。水煮鱼不辣，吃着没感觉。总体还是不错的。','65','2012-02-12 12:04:00',NULL),
	('01e63eced9b6261bd8127dbc6d9c3854','eacad9d32fa51d8365532d01db4a0511','elyn0310','4',3,3,3,'春节期间去的，一楼大厅很冷，冷的穿着羽绒服吃川菜...还是第一次呢。点了水煮鱼，58元一份的草鱼，味道有些淡，但是整体不错，量很足，两个女生各吃了一碗半饭还是剩下了。酸辣粉味道还行~~还点了个四季豆，挺好吃！~~价格不算便宜，但确实比新玛特对面的某家川菜馆的味道要好很多~~~都不知道那个K同学咋评的，这个店明明可以刷卡啊~我们问服务员后告诉刷卡要去二楼。我们懒得上去而已~~就现金结账了~~','50','2011-02-16 19:08:00',NULL),
	('024001089ff0c6d3175930122e0335f1','eacad9d32fa51d8365532d01db4a0511','夜色霓裳','4',3,3,3,'水煮鱼的味道真的是没得说，其他炒菜也很好吃，但不建议在他家吃酸菜鱼。没去过的可以去尝尝。最好是3个人去，因为水煮鱼的分量真的很大，人少了，会吃不了的，因为鱼的斤数都是那么大的，呵呵~~','65','2009-12-21 18:05:00',NULL),
	('03177516ada5bc6f54819597b5fa77cd','eacad9d32fa51d8365532d01db4a0511','甜食控lyl','4',4,4,4,'三个女生两个男生一起去吃的~提前打电话订的包房，环境很不错，不过要是在大厅吃的话，会有点乱，人很多，很火爆啊~！鸭下巴很好吃，赞~~~服务员态度很好，不错~还挺有意思的哈~！哈哈~~~','80','2010-11-02 08:01:00',NULL),
	('0429a0fa3271fef490b30d769ea34782','eacad9d32fa51d8365532d01db4a0511','杨悦cynthia','4',4,4,2,'挺早之前去吃过一次，当时觉得好辣好辣，这次去却觉得还好，可能是功力进步啦。我们五个人点了酸菜鱼、辣子鸡脆骨、干煸豆角、毛血旺、回锅肉、三鲜小豆腐，事实证明点多了。。。酸菜鱼是按斤点的，说这样会用活鱼做。两斤六两80多，觉得还好。贵的是辣子鸡脆骨，居然58了！毛血旺48吧，里面就有黄鳝，应该比北京的麻辣诱惑实惠吧~味道不错的。干煸豆角出乎意料居然完全不辣，三鲜小豆腐应该是融合了大连的海鲜特色，就是有点太鲜了，味素加多了的感觉。。。回锅肉蛮香，能吃出豆瓣酱的味道。比较惊喜的是酸梅汤，当时就是为了解辣才点的，意外地觉得很好喝，略带咸味的那种，不错~总之此行觉得这家店确实蛮好吃，就是有点贵，其他一些甜品的价钱都二三十了。。。再就是服务不给力啊。。。服务员的业务水平急需加强。。。','70','2011-10-03 22:38:00',NULL),
	('07c9774c17d6fa211e0cabf5437d2272','eacad9d32fa51d8365532d01db4a0511','lovehe0428','4',3,3,3,'单位聚餐想吃川菜就去她家了，整体来说口味比较不错，环境服务都还不错。记得酸菜鱼比较好吃，其余的味道都不错，上来一个什么东西来着了，同事说是冰欺凌，其实不是，忘记叫什么名字来着了。有室内卫生间比较方便。','70','2011-12-22 22:11:00',NULL),
	('08d4db52c20a7343c005c3befc487e16','eacad9d32fa51d8365532d01db4a0511','八点之后','3',2,3,2,'名声很响的一家店。去了还要排队等坐。不过说实话口味真的很一般，很多川菜做的真是不咋地，服务员有些冷淡！环境还不错，适合商务宴请！','0','2011-03-03 17:17:00',NULL),
	('0a1d75c19153f0d65b36990892239188','eacad9d32fa51d8365532d01db4a0511','量饭PK钱柜','4',4,3,3,'人多的时候一定要点水煮鱼，味道真是不错，鸭下巴是我的保留曲目，除了去巴蜀人家不点之外，它家做的不太好吃，其余说得上名字的川菜馆都必点，但是蜀乡情绝对排第一！口水鸡配合我最爱的炸馒头，那味道叫一个绝，不过相比来说还是喜欢吃川外川的口水鸡！其余的菜没太大惊艳的感觉，味道都中规中矩，菜品不如麻辣百分百的奇，当然，价格也没有它贵！','80','2009-12-26 16:56:00',NULL),
	('0e3cc4cdc8725f6147fe5686c05a990e','eacad9d32fa51d8365532d01db4a0511','布布Bowen','3',3,3,2,'那份服务我真...人都到店里了不给包间...我出门打了个电话他就给了..我...还行吧 一般只能说 没有什么特别好吃的东西和出奇的东西四川凉面好吃 就是那个面条不太好像是方便面','0','2011-09-08 00:40:00',NULL),
	('1028972e6a271fb900b30d304c391d91','eacad9d32fa51d8365532d01db4a0511','detruire','4',5,4,2,'装修后环境不错，晚上都要排很多人等位，很火爆。水煮鱼的味道很赞，还有凉面，有四川的味道~~（我在重庆上了四年学），水煮肉片会有点重庆火锅的味道，总之很正宗~~','55','2011-08-26 21:52:00',NULL),
	('12f61a1ccbe2091f468ec3bde615047b','eacad9d32fa51d8365532d01db4a0511','lindaonly','5',5,2,2,'吃川菜最常去的地方了，离单位近，但是还总是得排队，排队也吃，最疯狂的一次是七点才去，以为人会少点，可是还排队！要了号，开车跑了一圈回来，还没到我们，一直等到九点多才排到，等待期间服务员让我们先点上菜，说厨师十点就下班了，晕！那次是我第一次去吃，倒不是说他家就是好吃的不得了，其实等到那么晚就是要那股子犟劲儿了！好不容易坐下了，菜都是他推荐的，他常来吃，点的水煮鱼，盆盆虾，鸭下巴，夫妻肺片，他要了龙抄手，我要了醪糟汤圆，味道不错，辣的够劲儿，吃的血受！就是两个人吃不了，剩了好多，呵呵。记忆中深刻的一顿饭啊！呵呵，跑题了。之后就常常来吃，三不五时就来报到，水煮鱼是我的最爱，其他的川菜味道也不错，每次都要来个凉菜解解辣，过瘾啊！环境一般，乱糟糟的，不甚干净，不过为了水煮鱼，忍了！','80','2009-12-12 20:44:00',NULL),
	('14871a6dc4df8e1397396d1d5958c0a9','eacad9d32fa51d8365532d01db4a0511','草上的露珠儿','5',4,4,4,'水煮鱼味道很不错，一端上来就是扑面的香味，和好友们一起去，大家一致反映不错。最最推荐的是川北凉粉，必点的，味道有点甜甜的，很好吃。菜品不是很多，但经典的川菜都有。','45','2010-12-06 11:07:00',NULL),
	('156c0b953a61c0b3621f7abb5b145ac3','eacad9d32fa51d8365532d01db4a0511','麦兜兜66','4',3,2,1,'【试吃/体验点评】陪朋友一起去的，和菜品相比价位有点高。我们点的水煮鱼还不错，但是老干妈茄子真是不敢恭维，大家都没吃。味道着实是一般。店里服务太差，吃的东西都很一般了，服务还不给力。','30','2011-03-23 13:28:00',NULL),
	('020e725880eca45a515e51b8ec017bd4','ee18e8d64c64a64513802d8805b2447e','carol0269','4',4,4,4,'环境不错，一般也是得等位，喜欢他家的炒黄瓜钱，很下饭，其他菜的味道也是各有特色，服务很到位，煲仔饭很有特色，值得一试','100','2011-04-13 19:59:00',NULL),
	('08ccd319fe3ce55574d4810b3d2ef511','ee18e8d64c64a64513802d8805b2447e','哎呦静静','3',2,5,3,'我是去年去的了，我家里2个男性成员以前经常去那里吃饭，所以一直耳闻，但是都没有去过，后来搬家规模扩大，我去年才去了这么一次，所以非常期待。那天去的时候爸妈和我们去的，点了4个菜，都不是贵的，但是味道很普通啊，主要说说香鸭吧，颜色很深，味道很重，非常的咸，刚吃头几口的时候还觉得能打80分，可是后来咸的什么味道也吃不出来了。当时是下午2点，没有几个人，服务员都在擦玻璃。门脸特别大，里面装修的也很上档次，明挡点菜，看着没啥可点的，大厅里面也很大，请客应该很有面子吧，价格又不贵。我记得特别清楚那天花了160元，我爸爸平时都是吃贵的地方，这次服务员都不怎么理我们，他很诧异，我说160还想要什么服务呀，他觉得我说的有道理，所以才把价格记得这么清楚。','50','2011-05-06 15:05:00',NULL),
	('0b21cc33ac269598de5814d841e7aa65','ee18e8d64c64a64513802d8805b2447e','Uto灭绝','4',5,5,4,'这是一个评价菜品以外的补充：周一至周五，下午两点至四点（如果我没记错的话），厨师休息，这期间去服务员领班MM会华丽的把你拦在门口…囧','0','2010-12-26 19:24:00',NULL),
	('0b6d031dcd094c985ab471d1105f2102','ee18e8d64c64a64513802d8805b2447e','sillysister','5',5,4,4,'开发区里，1000元左右请客，不会被骂小气，而且吃得很舒服的地方不多，这是其中之一，一进门好几个大美女，衣着上看就和那些红旗袍的感觉不一样，视觉上提升一个档次，一楼水池中姿态各异的鸭子模型，二楼的锦鲤，即便喝大了出来透气时也不会很无聊，私密性可能不是太好，二楼包房只有几间是看不到外面的正经包房，得提前预定，很火，更多的其实是玻璃围成的房子，请家人朋友无所谓，别人就不好了。酒水也不贵。喜欢鸭子，花生米，猪手黄豆煲，“口吉”“口吉”类的东西都好吃，尤其牛肉，煲仔饭的米饭有些硬，味道还好，凉菜。','100','2010-01-16 19:47:00',NULL),
	('0be740c5ac968ea5dd1fbfe34c155646','ee18e8d64c64a64513802d8805b2447e','爱在深秋1971','3',2,4,4,'去他家就是奔着环境去的，包房很有特色。就是有的包房只挂着珠帘，私密性不太好。菜做的很精致，味道不错。贵是贵了点。请客在这里还是很有面子的。','200','2010-07-14 10:26:00',NULL),
	('10d7424e91c52276a5fe8960083cb4b9','ee18e8d64c64a64513802d8805b2447e','andyatm','0',3,3,3,'鸭子好吃，我爱吃鸭子，感觉环境特别不错，干净，明亮，菜的味道不错，是和朋友聚会过去的，因为鸭子属于凉性食物，所以夏天吃比较好，而且本人也特别喜欢吃鸭子，每个城市都有代表性的鸭店！','80','2009-06-17 00:37:00',NULL),
	('148d4539be8ab92b9502ec2bf3b9d024','ee18e8d64c64a64513802d8805b2447e','Abby1982','5',5,5,5,'这里真的非常好 如果有贵宾招待可以去那里 因为酒店很大 内部装潢很大气 档次很高 菜品也非常好吃 尤其是招牌鸭子 真的特别好吃 还有 包房环境很好 真是棒极了','100','2011-10-24 23:42:00',NULL),
	('1669863524d38ab8acdd7afca65e9ad4','ee18e8d64c64a64513802d8805b2447e','烟花三月下米粥','4',3,3,2,'环境不错，但是包房四壁都是玻璃私密性欠佳。八府香鸭，48半只，味道一般，和其他地方的烤鸭差不多，大家都不是太爱吃，没惊喜。豉汁蒸石斑鱼，148一斤，豉汁蒸鱼是他家的特色，味道很不错。木瓜排骨煲，58元，骨香肉烂，汤也很好喝。榄菜肉末四季豆，很好吃，很受欢迎。干锅茶树菇，很一般，没有在其他饭店吃到的好。排骨煲饭，没传说中那么好。八府拌菜，普通水准。海鲜拉皮，海鲜在哪里？饮料比较贵，鲜榨芒果汁88元一扎。','120','2010-08-29 23:08:00',NULL),
	('1cd63e3d93692d0bf55ab220d0726c77','ee18e8d64c64a64513802d8805b2447e','Noar','4',3,4,4,'今天下午 第一次去。门面很大，招牌也大。进去很宽敞，很干净。感觉有点浪费地方呵呵。蛮高档的。去的时候已经点好菜了，菜品好像走湘菜系。或许点的就偏湘菜系的。没看到菜单。感觉口味还行，烤鸭也比较不错，但和北京烤鸭差一点。适合商务宴请。都是2楼好像都是包间，很优雅～','100','2009-12-29 21:23:00',NULL),
	('0243b9fbc625095687db07cfdeec1324','f1d306f7926e523c13095595b1cd00f2','linda_1019','0',2,3,2,'老字号的一家日本料理店,自助餐不如菊,蟹渔狮家等日式料理店,点了日本清酒和梅酒,但味道都不怎么样..','200','2009-05-30 11:48:00',NULL),
	('0307ebd3ce19c04f01988f206f3fb5e2','f1d306f7926e523c13095595b1cd00f2','geniusdm','5',5,4,3,'【团购点评】感觉团购去的性价比较高呀，吃得很饱，最爱吃那个三文鱼卷了，味道很不错，还有蜂蜜南瓜粥也很好喝，虽然每道菜的量很少，但是味道都很不错的，如果有机会还要尝试一下它家的自助，应该会吃到更多好吃的东东吧。','84','2011-12-01 21:03:00',NULL),
	('045faf6bdb92dba97052eb2914cb7d78','f1d306f7926e523c13095595b1cd00f2','pla8888','0',3,4,3,'晚上8点才过去的，两个人选的138的自助。一起去的朋友和服务员说他家的分量太小了，服务员MM说，你们就多点，要不怎么能吃回来呢，好实在啊。生的还是吃不太习惯，好像就是吃了几种生的马上就饱了。烤鳗鱼挺合我的口味。下次去要找多些人去才有意思，点一桌子吃。两个人吃起来没感觉啊。','138','2008-05-09 09:36:00',NULL),
	('0873b0b3366e44a5fb32088c4fac5597','f1d306f7926e523c13095595b1cd00f2','凄风春雨1989','3',2,2,3,'大连历史比较悠久的日本料理店。由于是中国人经营管理的店，而且店里也聘请了很有名望的中餐大厨，很多菜品借鉴了中餐的烹调技艺。200元的自助可以吃到很多种菜品，口味做得都不错。不过品种多了有时候品质就会参差不齐，比如有时候牛排的软嫩程度，生鱼片的新鲜程度。。。等等在国内日本料理一旦做成了自助形式品质大部分都比单点的有所下降，在中国人经营的日餐店体现的尤其明显。','200','2010-04-26 18:27:00',NULL),
	('08af0f5f10df74557e8d2cf3482ce1f0','f1d306f7926e523c13095595b1cd00f2','自由的狗','0',3,5,4,'最大的特色就是有四种档次的自助120 不含酒水 大厅自取150 含酒水 大厅自取200 含酒水 点餐300 赠送鲍鱼 鹅肝等如果是大厅自取,有些东西比如金枪鱼片是没有的，其他的如烤鳗鱼、寿司等还是不错。可以根据喜好选择不同档次，比较划算。','200','2008-01-21 16:53:00',NULL),
	('0e8ab0c4a8b89bf9ae0b68ac7ae1cdc1','f1d306f7926e523c13095595b1cd00f2','馋死你不偿命','4',4,4,2,'和闺蜜一起去，我俩都认为单点400肯定吃不饱，所以还是自助吧。基本上该点的都点了。三文鱼刺身很好吃呀，现在还想念呢。盐烤大虾不错，值得一试。松茸鸡饭挺好，就是有点慢，提前点吧。寿司呢，红叶寿司比较好吃。其他的东西还都中规中矩，只是量好小，记得至少要4份以上。河豚饺子，我们都说很像鲅鱼水饺。。。。。烤鳗鱼好吃，我自己就吃了 6条，啊哈哈哈~','200','2009-12-25 10:47:00',NULL),
	('0ef75ef646fb43c653ce5f1fbde966a2','f1d306f7926e523c13095595b1cd00f2','蝴蝶不过沧海','0',3,3,3,'只去了一次，由于她胃口不好，没有吃河豚，点的定食！鸡、牛肉盖饭感觉都不怎么好吃。环境很好，还有小隔间！','60','2009-05-08 00:14:00',NULL),
	('100ff2362f0e9b892b5ec59a7b75b89d','f1d306f7926e523c13095595b1cd00f2','泡沫咖啡v','0',4,5,3,'第一次去红叶没想到环境会那么好，比想象中好很多，特别喜欢在干净的环境里用餐，简直就是享受。就是很遗憾我们选的自助里不包括河豚肉，看到shandyfly点评里写着200元里包括河豚所以就去品尝一下，结果只吃到河豚水饺统共就几个还掉地一个。不过总体感觉还是不错的，吃得很满意，总类比五毂多，加上里住的地方不太远以后想吃日本料理我会首选这家。','200','2007-12-23 15:47:00',NULL),
	('124fe1ea093d6294b4206bfc48b123ec','f1d306f7926e523c13095595b1cd00f2','铜管灵魂','0',4,4,3,'早就听说红叶了，据说有很多日本人都飞过来吃，但是还是不习惯吃生的东东，偶尔体验一下，也要做好拉好几天肚子的准备不过食物看起来很雅致，蛮地道的日本味道……','200','2007-10-10 20:34:00',NULL),
	('12988a09c4b92bc9b5d37db06612e90c','f1d306f7926e523c13095595b1cd00f2','小毛の宝宝','5',4,5,5,'吃日本料理一般就会选择他家喜欢他家的海胆，虽然不是特别大，但是很新鲜，可惜这个一人就一个~菜的样式很多，可以随便点，服务员也很有素质，一般都在门口呆着，有事情拍拍手就进来外观环境不是很好，但是里面很好，没在大厅呆过，包间感觉很舒服，谈谈天唠唠磕很不错的选择。饮料的样式也很多，还有带气的苏打，好像在其他地没有看到过，适合不愿意喝甜的人~','200','2010-07-29 10:40:00',NULL),
	('132310d4cf7001a5f451fcb9f3419e8c','f1d306f7926e523c13095595b1cd00f2','大连老宋','0',5,5,5,'这里是大连最正宗的日本料理店之一，河豚鱼水饺不错，味道很鲜美，服务员态度也很好，可能是因为是日本料理店的原因价格有点贵，不过物有所值嘛哈哈~。','200','2008-12-14 22:09:00',NULL),
	('139050bfe6d18e3def5c7e6990f307b9','f1d306f7926e523c13095595b1cd00f2','sonmeiu','0',4,4,4,'200元的自助 没点太多生的东西 吃不惯印象最深的是螃蟹 很肥 每人点了2只海胆和烤大虾也不错鳗鱼不太爱吃 太甜了那天的服务员是个蛮帅的小伙态度也很好 要了好几次大虾也没不耐烦不过后来好像下班了 换成另外一个女的 态度就不咋地 巴不得我们快点走似的另外他们家的门实在是太不显眼了服务生说好多都是经过厨房进的店里','200','2007-10-14 20:27:00',NULL),
	('1558f1769585b89e107554ecadb6dc10','f1d306f7926e523c13095595b1cd00f2','长不大的uuu','4',4,3,3,'【团购点评】味道比较地道，服务员MM挺实在，由于我们是买的自助，服务员MM总推荐我们点一些贵一些的东西，感觉此MM超可爱的。整体就餐环境也很好，我们选择的是8人日式包房，里面有电视、独立卫生间。建议吃他家的时候买自助吃，不然单点的话价格超咋舌的，自助很划算~.','200','2011-12-06 09:23:00',NULL),
	('15db689e6ee5b83362a2584bcc44bedd','f1d306f7926e523c13095595b1cd00f2','我爱鸡蛋清','0',4,4,4,'价格挺高，不是一般人能承受得起的，呵呵，不过味道和品类还是很多，可以带女朋友偶尔消费一下。日本人居多。','70','2008-06-12 10:56:00',NULL),
	('17acfe55bfa383f5994d6040189a393d','f1d306f7926e523c13095595b1cd00f2','easymilk','0',4,3,2,'穷学生，因为今年推出68元自助才走进去的~然后就每次都78自助，然后不太敢去了，觉得害怕胃被撑大了，自助好可怕~味道么对得起价钱，反正在大连很难吃到便宜的日本料理，知足矣~','78','2009-07-31 00:12:00',NULL),
	('1b555094591a000067107756b3eb2142','f1d306f7926e523c13095595b1cd00f2','Mimosa茜','3',2,3,4,'慕名而来，有点小失望，河豚鱼饺子还不错，口味很清淡，烤鳗鱼分量很足，但过甜了点，凉拌海藻很清爽，点了河豚定食，非常失望，鱼肉咬都咬不动，也许刺身更好吃吧，也点了红叶寿司，很大一个，但做的有些散，点了个红豆粘糕，就是红豆粥煮了两个汤圆，总体来说，服务很好，味道真的很一般','80','2011-06-06 20:45:00',NULL),
	('0873718ed9d061d8693c2ad2bb284f59','f2b295a0001ac2e558511184404e5edd','sj9900','4',2,4,2,'由于堵车，去了为了马桶座还是等了位！这里顺便说一句前台的收钱服务员，脾气不好！而且早就该排号，希望下次安排好！味道正如大家说的，真的一般了，料也不是特别好的料，不过做的还是非常形象的，推荐的全都点了，觉得马桶一号冰都化了之后，简直太传神了！是个恶搞的好地方！','35','2011-11-12 00:04:00',NULL),
	('092d9e7c3b8b3f8efd435c949c3edb14','f2b295a0001ac2e558511184404e5edd','坠翥','1',1,1,1,'很无语的环境，盗版山寨的太厉害了；一点台湾特色美食都没有；大概是真的比@大便@还难吃吧……吃的东西质量差到极限；贵的要死，要是好吃也值了，可惜呀，一杯椰香奶茶绝对的速溶版；一杯柚子红茶糖精放得都苦了，最后服务员说：“柚子茶就这个味道”一帮农村人搞的山寨餐厅，太差了；香菇滑鸡做出了溜腰花的膻气味，那叫一个骚，为了尝试屎尿结合的口味吗？太创意了大家别为了好奇心冒险啦，除非你想尝尝大便的感觉，不过这个餐厅有一个优点——吃了一口就不想吃下一口啦，对于减肥的朋友相当有利；马桶五号一款最简单的冰激凌，外面可以3元买到的巧克力冰激凌，放到马桶里就变10元了，不过放到水游城就算唯一值得的消费了！！！朋友几人去了，以为会有啥新收获，一进去，环境就像成都小吃店，除了座位用马桶桌子有装饰，其他都很低俗——环境成绩over不给大菜单点菜，弄个小快餐店的破纸片点餐，原因是正宗台湾特色一无所有，只有仿冒的几款山寨货，就胡点了才发现，我们上当了；去了的感觉只有一个，价位真是太忽悠人了，味道太欺诈了，环境太烂了……总体感觉，用高等享受的费用享受了一顿最差劲的垃圾小吃……椰香猪排拉面还没有方便面（红烧牛肉味）好吃呢...；大家记得把钱留好了，不如吃顿沙县或成都小吃呢，朋友说还没大饼鸡蛋好吃呢~_~ 奉劝大家不要轻易尝试，会后悔的，除非打一折！！！全文','60','2011-10-19 22:48:00',NULL),
	('0f8970f7350ec243b817f8ea9331a17d','f2b295a0001ac2e558511184404e5edd','chenchen0530','3',2,4,4,'比较爱吃蛋包饭便所1号看着图片挺多的其实下面是用冰渣垫的火锅还没有家里的好吃呢不过装修特点突出很多进来拍照的带着孩子感受一下','60','2012-02-03 17:32:00',NULL),
	('10c6cf498401e4bf6f3ef0eb99501bed','f2b295a0001ac2e558511184404e5edd','宅小七','4',4,4,4,'和朋友来这边逛，看到的一家很特别的餐厅，店家的椅子都是马桶，餐具都是卫生间里面的设施，很有创意，没有进去吃，但是看到了别人吃，有一桌吃的是冰淇淋，蹲式的厕具，里面是便便形状的，应该是巧克力味道的，好大一坨，还有浴池形状，洗手盆形状的，好多样子，以后再去会来尝尝，虽然很恶心吧 哈哈','0','2011-10-09 13:10:00',NULL),
	('14d9aa8400ede19927d5e15d4e24906f','f2b295a0001ac2e558511184404e5edd','臭臭小猪','3',2,3,3,'很欢乐的一家餐厅，一边吃一边照相一边笑~~就是装修还没有完，抬头看顶上连吊顶都没做，裸露着钢筋水泥还有电线神马的。装修完的部分看着还是不错的。菜品确实一般，那个厚厚马桶咖喱猪扒饭实在是很少量，好在我不饿，要是来个男的，两份都吃不饱~~~味道确实很一般。奶茶是装在小便池里的，味道还不错，很搞笑~~','40','2011-10-16 10:56:00',NULL),
	('17c22132c66c0094c8fafb0d2fdf4d98','f2b295a0001ac2e558511184404e5edd','赵美子life','3',2,4,3,'就是店里装潢和盛冰淇林用的器具比较有意思,口味真的不怎么样,一般~ ZZZZZZZZZZZZZZZZZZZZZ','10','2011-10-11 00:42:00',NULL),
	('18d07c9fe0e2b7db9b52c15b41b0b2e4','f2b295a0001ac2e558511184404e5edd','姬舞','1',1,2,2,'绝对是去一次不会去第二次的地方。真的没有见过这么差的，味道十分难吃，还量小，材料还次！本来期待很大，非要朋友和我一起去，结果到了那里，被朋友埋怨一顿！不明白怎么饭馆会开成这样，用心一点也不至于啊。','50','2011-12-22 21:55:00',NULL),
	('1a2d020c8119b221526168d02e0a46b2','f2b295a0001ac2e558511184404e5edd','KAKA091126','3',2,3,2,'很有特色的主题餐厅，器皿都是便池、洗手盆的样子，价格不算便宜，味道一般。室内装潢也都是卫生间的风格，坐在马桶上吃饭还是挺有意思的。可以一试。','46','2011-11-17 12:04:00',NULL),
	('1a55531b334e9d2ea270fe9c59afb392','f2b295a0001ac2e558511184404e5edd','暖圆','4',3,4,3,'黄金便便条很好吃，12元一份，一共5个便便，是甜点类的，外面炸的金黄色，里面甜甜腻腻的马桶五号是冰激凌，10元一份，挺大的一份，够单人吃的了，口感倒是一般坐在马桶上吃的，还有个大便的靠垫挺好玩的，服务也不错','30','2011-11-06 00:27:00',NULL),
	('04b1edaf003b9042f2c0a639d116bf68','f3846f948ef52bc04648be6972e521f9','好吃小母猪','0',4,5,3,'晕，这个我这么喜欢的店店，竟然搞忘记点评了。一定要加紧点评，鼓励大家去吃哦，莫给搞倒闭了，说实话我每次去看到生意都不太好，但是味道和服务还是一如既往的好哦。环境——这的环境很清幽。难得能用清幽来形容自助餐厅哈，因为一般自助餐给大家的印象应该是热火朝天之类的吧。这有12星座的卡座，每个卡座都是临窗的，而且作为是那种很舒服的靠背沙发。中午和下午来用餐的人都不多，晚上不知道。但是菜品和服务不会因为人少打折哈。而且还能免费上网，很不错。菜品——其实这里主要就是感受个环境，没的特别出彩的菜品。但是也是什么都有，还比较丰富。中午是11点-14点，78一位；下午茶是14：30-16：30，58一位。下午茶和中午的区别是没的印度菜，并且也不能吃巧克力。海鲜类：：都是冷食，有冰鲜虾、扇贝、牡蛎，还算新鲜吧，主要是那个蘸汁太好吃了，每次我都要吃很多。印度菜:;一些带咖喱的菜，不喜欢，没怎么吃。小吃：：有叉烧包、竹叶鸡、鱼丸、糯鸡爪、排骨、鸡翅等，还有好喝的猪蹄汤；以及一些台湾小吃，比如蚵仔煎热菜：牛排（切成坨的，比较老，中午才有）。。。还有巧克力和甜点，这个是亮点，做的非常好吃，中午去巧克力放在柜子里，自己随...便拿，哇，感觉很爽哦。总之，这个店呢，还算值得一去的。--------------------------11.02怀着复杂的心情，再补充点。昨天又去了。呵呵，感觉还是一如既往的好哈。每次去的东西都会有点不一样，比如昨天增加了一个小炒虾，味道很巴适。难能可贵的是，每次去吃，都只有4、5桌人。你能想象这么大个餐厅，这么多菜品，只有4、5桌人吃饭，感觉有多爽吗，呵呵。绝对不会出现在一般自助餐厅的嘈杂或排队取菜的情况哈。生意不好，但是菜品是绝对的好哈。从照片中应该可以看出来，原材料都是非常新鲜、非常好的那种。总之，一切都很好。以后一直会常去的地方。全文','58','2009-11-02 13:49:00',NULL),
	('075fce9e5432526c1e4a708baa4c7bcf','f3846f948ef52bc04648be6972e521f9','nikki320','2',2,3,2,'【团购点评】在打了3-4通电话预约了很多次终于成功的时候我在想他家到底是有多火于是星期天12点准时到达因为是团购的先登记了密码然后选了个比较亮的位置刚好是整个餐厅最亮的地方结果人挺少的说上座率大概百分之三十地毯踩着挺舒服的杯子颜色我也比较喜欢刚开始对这家感觉还不错直到我去逛咯一圈菜品没有刺身只有3寿司连三文鱼和金枪鱼寿司都没有只有很普通的豆皮寿司和普通的卷有2个区是海鲜的有冰冻的虾青口扇贝扇贝很不新鲜肉和壳都是分离的青口是后头才有的但是量不多补充的也很慢所以我吃了很多虾这算将就能吃的海鲜而且配的酱很不好吃那个酱油的味道很咸反正酱我都不喜欢有个鸡翅 去了几次才拿到也不好吃 其他热菜味道都很一般黑胡椒牛排不好吃酱不好吃 肉质也不怎么样鸭子等其他的都比较冷了完全不是热菜了可供选择的本来也就很少炸的天妇罗似乎只有蟹肉棒而且外面的炸的很厚天妇罗的汁也不好吃沙拉方面配料还算多有杏仁片 芝士粉沙拉的酱还比较齐全由于其他吃的都不好吃 老公吃了无数多蔬菜沙拉和水果沙拉水果沙拉我还算喜欢有火龙果和哈密瓜这2样吃了很多啊还有个自助的刨冰也还算不错可以自己加配料 甜点里面有几样用...杯子装的味道还可以芝士都比较细腻巧克力要了2块抹茶的里面有夹心但是不好吃另外一个果仁的将就巧克力和部分装在柜子里的甜点是只有晚餐和午餐才供应的下午茶没有蛋糕要了2款 味道也不怎么样果汁有3款 橙汁 西柚 菠萝个人觉得橙汁还好 鲜榨的冒菜区没有尝试蒸菜去全是包子 馒头也没有吃这些就是所有菜品了翻来覆去走了很多转都没有几样想吃的 即使是想吃的尝试咯的也没有一样觉得好吃的味道太粗糙了最后我吃了无数多水果老公吃了无数多蔬菜沙拉我们一致认为性价比极低团购都不划算被列为再不光顾类全文','68','2011-06-20 11:25:00',NULL),
	('07ced5891f0687f83cf268fc7849d304','f3846f948ef52bc04648be6972e521f9','薇薇00','3',3,4,4,'很久前去吃的了，记不清午自助是多少了，大概就100左右，不收服务费内容还算丰富，味道就乏善可陈。大概是包容了太多国家的原因，所以每一种都不够精细小牛排和焦糖炖蛋还不错除此之外没有什么记忆深刻的了倒是服务很好，吃得很慢， 到后来下午茶时间都到了服务生说如果你们愿意可以把下午茶都吃完再走很饿的时候去吃吃算了','98','2011-03-02 10:33:00',NULL),
	('082f4638fdc4138ae39ed14de7533758','f3846f948ef52bc04648be6972e521f9','leeloo龙儿','5',4,4,5,'团购99元的晚餐去的。刚开始一看并不是很大，还想着会不会不太好。结果出人意料，虽然是团购但是每天限量接待，吃什么都不用抢，环境很舒服，四个人边吃边聊，惬意。三文鱼不用排队，吃完又取就行了，口感肥美。黄桃派好好吃，甜度刚刚好，可惜后面就没有了。不想吃的时候，还可以拿点红酒，坐着聊天。算是一个闹中取静的地方吧。','99','2011-07-21 09:41:00',NULL),
	('08c53a511b12bc20bcab4505e038004a','f3846f948ef52bc04648be6972e521f9','爱吃的米米妈','0',2,3,3,'昨天是第二次去了，因为第一次去非常满意。吃的下午茶，让我失望，人多得就跟菜市场一样~~~跟第一次去已经没有办法比了，食物的水准下降，很多东西都没有了，从菜品和服务生的态度就看得出来~~~~不过现在他家是买一送一去的，价格下来了，肯定品质就得不到保证了，不过虾还是供应的，其他的就没有特别了，唉，不想去了~~！','39','2009-07-05 21:47:00',NULL),
	('122e45e5ca0d94ed212a2a32a1ebf477','f3846f948ef52bc04648be6972e521f9','裙子娃娃','0',3,3,3,'前天中午去吃的，真的很不错哈。人很少，很安静，服务员很热情。巧克力和蛋糕种类多，每个小小的，可以多尝尝几种，做得精美，味道很好。还有牛排很嫩，咖喱鸡肉，虾，寿司……菜品种类虽然不如一般自助多，但都有卖相，口味好，我喜欢炒饭，里面的虾仁和肉挺香的，呵呵！建议爱吃点心和巧克力的亲们去尝尝这家哈','78','2009-01-14 21:55:00',NULL),
	('17ab91aac999413a122fcce53800f7da','f3846f948ef52bc04648be6972e521f9','maria1011','3',3,4,4,'【团购点评】本来去之前就知道菜品种类很少，但是对甜点抱的期望很大，不过多少有些小失望，不知道是不是因为中午的关系，感觉种类没有那么多，质量也一般，有些不是很新鲜，感觉都是隔天的。菜品也看到不是现做，有的居然是热一下就上了，像是早餐剩的，看着不是很雅观。不过尤其推荐芝士蛋糕，很好吃。在这个价位感觉总体不错，环境也不错，周围较清静，位置很好找。','49','2011-12-26 18:03:00',NULL),
	('1868510c9b9f550eab98c45b103dae2e','f3846f948ef52bc04648be6972e521f9','arashimiwa','3',2,2,2,'是去吃得午餐去了以后会觉得很失望除了甜品没有任何值得期待的东西，早知道就去下午茶了说实在的同等价位的，在这家吃还不如去新豪威斯汀。','0','2010-05-23 21:09:00',NULL),
	('1af55b318c89a6051f6f115660a2ff4b','f3846f948ef52bc04648be6972e521f9','电风扇啊电风扇','4',2,3,3,'周末吃海悦下午茶的很多，时间还没有到，门口的位置都坐满了。乐然真的成了网上说的扶墙进，扶墙出，（网上的意思是吃好吃的之前不吃饭饿的扶墙进，吃完了撑的不行，扶墙出）乐然是一瘸一拐的进去的。   开始展示我们吃的东西哈。我可以一一介绍。。。    水杯，我很喜欢这个蓝色。里面是温水，其实吃自助喝白水就可以了。那些甜饮料留到最后喝。。主要是一般都不好喝   第一盘：寿司、海鲜、小甜品    寿司不是很新鲜，米粒已经硬了。我基本没有咋个吃了。但是那个豆腐皮寿司的那个外皮非常好吃，就是中间咖啡色三角形状的。虾虾非常的多，很好吃。扇贝不错，但是如果加上粉丝和蒜茸就优秀了。青口不新鲜。没有吃    第二盘：小甜品和海鲜。   这里的小点心都做的很精致，味道也很好吃里面夹心有芝士火腿和鱼肉。园的里面还是鸭蛋心的。小盘子里面是三文鱼和鸡蛋。做的很好看。味道也不错   第三盘：小甜心   用可爱的容器，装上果冻蛋糕和鸡蛋慕斯又好看又好吃。绿色的是巧克力的，白色的是鸡蛋的。黄色的是果味的，上门都加了水果。吃多了就容易胖。。我不怕。。。因为我已经胖了哈哈   第四盘：各种肉和蔬菜   这边内容很丰富...哈，鸡翅还不错。水煮牛肉比较辣，兔肉的骨头都是去了的。都是大块大块的肉疙瘩。秋刀鱼肉太腥，有点苦，不喜欢。咬了一口就淘汰了。。。芝士焗的花椰菜很好吃，奶香奶香的。。。我和乐然都喜欢。还有一种是菇类。有各种菇炒在一起，还多好吃的。咬下去就像在吃肉一样。口感不错   第五盘：天妇罗是炸的南瓜片，南瓜甜的糯糯的。很好吃。。乐然很喜欢，要了好多份，假把意思点了个红红的日本小菜，结果是姜。。。。吃不下去   吃到第六盘的时候。就有点涨了。但是水果是一定要吃的。。尤其是我喜欢的火龙果，在网上看到这里的菠萝也很好吃。。我是不会放过滴。昨天晚上花了3元买了2亚非常小的菠萝，一会就吃完了。今天我一定要把菠萝吃够。。菠萝没有怎么去皮，但是也很甜。确实好吃。火龙果水分很足，吃下去还可以咬里面的小粒粒。。多安逸的   在充分的休息后，开始我的第七盘。。。。其实我还是有点来不起了。。   第七盘：鱼肉、火腿、蛋挞、炒饭、松子、炒河粉、蒸元子    火腿还多好吃的。肉多，粉很少。肉质也比较好。蛋挞稍微甜了点。还是多松脆的。好吃。元子是在蒸锅里面的，很软，入口轻轻一咬就碎了。。。。蒸锅里面还有包子和馒头。。这些撑胃的东西我不得吃。。。。    松子是来搭配蔬菜沙拉的，因为春节期间吃了很多松子，伊藤要买100元一斤，虽然这里的松子不能和伊藤比。但是他也姓松3.。还是好吃。。。   第八盘：类似冒菜的冒海鲜     这个是需要现场制作的，像冒菜一样。里面有虾虾和鱼肉还有牛肉以及蔬菜。里面的虾和鱼比之前的还要更新鲜。厨师做出来是白味的，要自己调味。。非常好吃。我还加了木耳青菜和香菇   我已经来不起了。。。但是还是可以再解决几个虾虾，于是我的第九盘就出来了    第九盘：虾虾和小甜点     朋友早就已经在对面沙发上躺起。。。紧闭双眼。。嘴巴里面一直在喊，来不起了。。。撑死了。。哈哈，小甜品是鸡蛋味道的。又可爱又好吃。。。。。   总结：    1、58元的价格，在市中心吃到那么丰富的东西，性价比还是很高    2、菜品很丰富。不只是下午茶那么简单。    3、时间是从下午2点半到5点。不过4点半就开始撤菜了。。。       推荐可以去吃吃哈。。。。。全文','58','2010-05-13 09:22:00',NULL),
	('1d582d01e646534fdc9e35304eca67d5','f3846f948ef52bc04648be6972e521f9','meme88','4',3,4,4,'年初的时候，周日中午和朋友去吃的，硕大的餐厅就三桌人，我和朋友找的靠窗边的位置。先吃的甜点，都好好吃，可能吃得太多都有点难以区分哪些最好吃得。主菜也不错，多是炒菜熟菜，印度老挝什么的名字记不清了。朋友想吃刺身的但中午没有~~~总体来说很不错啦，吃得蛮开心的','98','2011-07-14 22:42:00',NULL),
	('00914f61fc11aed0e0f95cd247a2737c','f4450574c06a6cef8efe9f14498654a3','dolphin1988','3',3,4,3,'中规中矩的饭馆，比较大众化，不过口味比较符合陕西人的要求什么锅盔呀也都有，不过感觉地方挺小的，我在哪里吃过婚宴，太挤了不推荐办席面。味道没什么特色，该有的菜都有，味道也是正常的味道，价钱蔡量都可以。','35','2010-10-01 19:14:00',NULL),
	('049441e225f05086daa4227c465e3941','f4450574c06a6cef8efe9f14498654a3','雪衣行云','5',4,3,4,'基本是这家店的饭托，带很多朋友去过，然后朋友们都觉得不错，于是朋友继续带着朋友去~~就餐的环境需要再装修了~~PS：酸菜鱼太腥了','100','2011-07-22 17:03:00',NULL),
	('08d56fa0f13285947bcbf67966308a81','f4450574c06a6cef8efe9f14498654a3','freefish888','4',4,4,3,'味道不错，很老的川菜馆子了，价格是越来越贵了，现在还有烤鸭点，喜欢鳝鱼粉丝，夫妻肺片一般，没有四川吃的地道。环境还不错。','50','2010-11-05 22:51:00',NULL),
	('0c39caf34cd23ba54571b80243adbc04','f4450574c06a6cef8efe9f14498654a3','hanhan_san','4',3,2,2,'和朋友一起去滴，在一楼用的餐！一共4个人，点了五菜一汤，才不到90块钱！在钟楼这片儿，算是便宜了！个人比较喜欢梅菜扣肉！都是一些家常菜，价位也比较适中，菜单也很简单，就是一张纸！总体还行~~~','25','2011-08-04 10:51:00',NULL),
	('0c502ef9583a41d3318a26af31083f90','f4450574c06a6cef8efe9f14498654a3','西安老餮关中生活','4',3,3,2,'门面正在装修，与川渝人家挨得很近，其实不是一家。主营陕西本帮菜。品种有炝拌油麦菜，炝拌腰花，油泼辣子，有果木烤鸭，有岐山臊子一品参，味道很正宗。','0','2010-09-10 09:02:00',NULL),
	('0c90311d12d0496a91c54ae7926195b6','f4450574c06a6cef8efe9f14498654a3','康杜阿冉','3',2,5,4,'【点评团消费】团购去的，总觉得服务吧挺到位但是冷冰冰的那个鱼调料放多了还糊了，真难吃夫妻肺片跟鸡豆花都蛮好吃的如果那个鱼能换个菜就好了','34','2011-05-26 10:02:00',NULL),
	('0f1bbadba01ca2246632d0239a9bf932','f4450574c06a6cef8efe9f14498654a3','乐颠哪','3',3,2,2,'对普通工薪阶层来说，价格有点贵哦，陪老板请饭去过一次，糯米排骨一点都不油腻，夫妻肺片和酸菜鱼都很不错滴说，非常正宗，强烈推荐','0','2011-04-29 17:45:00',NULL),
	('0fab27b84598f37489d4a055389158b8','f4450574c06a6cef8efe9f14498654a3','lampardqin','4',3,3,3,'哥们请客在包间吃的，我到的时候人家都已经点好了。味道是改良的川菜版陕菜。哥们强烈推荐的烤包子，吃了感觉到罢了，但对烤鸭倒是情有独钟，还有夫妻肺片。总体来说价格公道，味道适宜，值得一吃。','0','2011-05-31 10:50:00',NULL),
	('1299da8e02243f25a821b1c4fba51d06','f4450574c06a6cef8efe9f14498654a3','wj雁南','5',4,4,3,'【团购点评】团购去的，自己感觉比桃园路的那家味道好，服务好，一样的菜还是有些区别，这家位置也不错，停车4块不计时，整体感觉挺好','30','2011-07-28 10:52:00',NULL),
	('17607589d1ed79bdefbc601f2ec05d7f','f4450574c06a6cef8efe9f14498654a3','秀逗电脑','3',3,3,2,'经常去他们家的一楼吃午餐，比较快，虽然类似工作餐，但是也有比较好吃的必点的菜，比如：宫保鸡丁、冒菜，都做得不错。还有就是鸭汤也可以。','30','2011-08-16 14:59:00',NULL),
	('17c0a193fe4316deec8c52fd49b93db5','f4450574c06a6cef8efe9f14498654a3','yuxing917','4',3,3,3,'【团购点评】三楼的大厅晚上7点依然很多人团购去的我感觉就夫妻肺片的味道很正宗其他的都一般鱼的味道太咸了鱿鱼丝炒的过干蘑菇也咸说是鸡汤豆花的结果味道太淡我看真么也不值58啊以后还是不要团购的好....','50','2011-05-29 22:22:00',NULL),
	('18266525caa6ef1fe49c75163095cb44','f4450574c06a6cef8efe9f14498654a3','aska爱美食','4',4,4,2,'【点评团消费】个人认为，团购咧就要团这种大的餐饮集团的人家财大气粗的，要做也做的起，不会小气所以菜的品质不会下降至于服务，我觉得不是对团购区别对待啦，是人家服务员本来就神气的很当天亲眼见对一个客户没好气，还要求人家要高点素质，我勒了个去~~来评菜品~没啥新鲜的，大家都说的差不多了说说自己的一些看法盆盆鱼鱼肉真的很嫩很滑，觉得更甚苏福记，口味也比苏福记的重，麻辣类型的夫妻肺片也很不错呢，有点油慈禧豆花，纯属砸自己家招牌。。。其余无功无过，跟大家感觉一样，不过室友都说黄瓜口味很好，恰到好处，清清爽爽~报告完毕！','0','2011-07-15 21:04:00',NULL),
	('18654121adce219f32c8d04c20103100','f4450574c06a6cef8efe9f14498654a3','低頭淺笑1','4',3,3,2,'这里的环境很好哦，也算是性价比高的一家餐厅了，就是可能位于南大街，所以每次饭点去吃的时候，人都很多，服务员根本就忙不过来，上菜的速度还行。个人很喜欢他们的酸菜鱼，鱼肉很嫩，而且汤很好喝，我想没有哪个女生会拒绝的吧！','40','2011-08-10 12:34:00',NULL),
	('00d29c73c923de6c5ed68f0fa7e16daf','f454a0a43e71ab23d02d943cc7c7416f','小丫头不贪吃','3',3,3,3,'一直觉得这种风格的店多是外地人去的，作为青岛人，还是觉得自己家做的海鲜比较地道。经朋友推荐来到渔码头海鲜舫，吃的是全鱼宴，用一条很大的鲈鱼，做成各种菜肴。我平时对鱼的感觉一般，所以评价也算中规中矩。说几个印象比较深的：生吃鲈鱼片，比较鲜嫩；鱼丸汤不错，很鲜；溜鱼片，也不错，有咬头；还有那个鱼饺子，推荐。这里的价格相对而言还可以，在这个地段算中等的。老板很亲和，很实在，所以这个店的生意在云霄路算很好的。爱吃鱼和海鲜的可以去试试。','80','2010-08-29 02:05:00',NULL),
	('01c80b79c3b3ceb055f76cd771251f79','f454a0a43e71ab23d02d943cc7c7416f','芥末小妞','0',3,3,1,'海鲜饭菜就不多说了，质量还说得过去。服务上可真让人“大开眼界”：隔壁一桌是一家三口，小男孩所坐的椅垫不知什么原因是湿的，结果红色的椅垫掉颜色把他的白色T恤染花了，餐厅非说能洗掉并答应帮忙洗，结果洗了半天也不行，磨叽了半天才答应给这桌打个8折，让人觉着挺没诚意的；更精彩的是我们吃完饭结账的时候居然要多收一些杂七杂八的费用，包括餐巾纸费每位1元、餐布费每位1元、茶位费每位1元（你以为你是五星级大酒店呀！），而且这些费用在消费前根本没有被告知，本人当即拿起法律武器准备找负责人据理力争，结果刚把道理一讲他们就妥协了。碰上这样的事，就算吃得再好，估计谁也不会再去第二次了。','50','2009-08-02 11:52:00',NULL),
	('025e90017736bcc181366c308ad6679d','f454a0a43e71ab23d02d943cc7c7416f','青年快酒手','0',2,2,3,'菜量很小，花了800多6个人没吃饱。  要了个金丝卷大虾 说是12个结果只上9个，虾还很小，韭菜炒八带的韭菜很柴。 虾虎数也不够。蛏子全是空的，，，，啤酒不是原浆还要30一扎。','100','2008-04-14 13:48:00',NULL),
	('07cb630d77d0d3019535e9cf7e151014','f454a0a43e71ab23d02d943cc7c7416f','小老虎11','0',2,2,2,'同事9人利用周末出游威海青岛两日游,我们到了青岛问了计程车司机,都说这家店不错,正好离我们入住的北海宾馆很进,于是安顿好就直奔渔码头了,还厉害,一条路上有一家总店,两家分店哦,我们先进了三分店,点了好多菜哦,印象最深刻的就是蛤蜊疙瘩原汁汤,名字怪,味道好,普遍觉得这里的菜都是清一色的咸,','60','2006-04-17 13:30:00',NULL),
	('10b374328dc38fac45ef0df1d3105686','f454a0a43e71ab23d02d943cc7c7416f','雪兔子小美','0',3,2,2,'从酒店溜达到这里。一条街全是海鲜餐馆。两家渔码头分店竟然挨着。真是够火爆的。上海同事点了毛蚶，端上桌，轻轻撬开，毛蚶的鲜血直流，俗称血蚶。只见上海同事麻利且熟练的撬开毛蚶，一侧贝壳丢弃，血蚶的血肉留在另外一片贝壳上，拿着轻轻的往姜醋汁里面一涮，一舀，就势送入口一吸，连血，带肉，带姜醋汁。熟练程度不亚于黄金甲里面巩俐喝中药啊。苦菜，凤爪，芝麻核桃，海鲜饺子做的中规中矩。墨子，看着像是小虾酱。椒盐虾虎，清蒸虾虎，梭子蟹，蒜容扇贝，蚶子豆腐，有个菜是海肠，海蜇和豆芽一起炒，看着一般，吃的时候才发现里面有淡淡的芥末油。很有特色啊。结账的时候要小心，他们有的菜等我们结帐了也没有给上，不过结账的时候一样的算钱，结果算了3次帐，才算清楚。因为客人较多，结帐的时候要多留心些。','70','2007-07-19 22:38:00',NULL),
	('11044b68677e6b5fbcfcf665bc8b848d','f454a0a43e71ab23d02d943cc7c7416f','淘淘乖乖','0',4,2,3,'去青岛的时候去了这个餐馆，觉得不错，所以连续两天都在这儿吃的东西，交通也比较方便，不远处就是家乐福和五四广场。吃的很不错，有个海鲜炸茄盒很好，每个茄盒里面都有大虾。海参牛尾煲也不错，就是有点儿少。去这吃饭已经是2年前的事情了，至今仍然印象深刻，好像能回忆起每一个细节。','80','2008-06-04 15:12:00',NULL),
	('128a58d5a56d53c41154f3cbd92b1b89','f454a0a43e71ab23d02d943cc7c7416f','悠悠tamaki','0',2,2,1,'前一天吃过同路段的海岛渔村,改吃旁边这家,感觉蛤蜊味道都差不多,蛏子也很新鲜,但元贝做得没有海岛的好吃感觉.另外就是这家店的服务生水平那叫一个寒- - 点鲍鱼时明明说好一人一只,但很快端上来却变成一人两只,也就算了,后来点主食时问有啥种类都说不出来,点了之后又很久不上,催了N次最后说要退了才端上来.和之前点海鲜时的上菜速度完全不能比.同类型比起来的话,宁可去海岛的说.','80','2008-03-31 10:57:00',NULL),
	('13cf2a1b11cf2350e9db1133bab19822','f454a0a43e71ab23d02d943cc7c7416f','come1127','0',3,3,2,'这里海鲜还是很全的。但是感觉价格有点贵，不过来青岛，怎么能不吃海鲜，所以 对这些也就不太在意了。吃的蛮好。只是感觉服务很一般。','0','2008-07-15 12:30:00',NULL),
	('17622d63e5ce06a4d08eb11612fa3eb1','f454a0a43e71ab23d02d943cc7c7416f','又馋又懒的猫','0',1,2,2,'来青岛的第一顿饭就在这里吃的，菜不算便宜，但烧得质量也不够好。虾虎太小，油里一炸肉都啃不到几块。酱爆黄泥螺烧好后有股腥怪味，而且泥螺里的沙够多的。毛蚶血淋淋的，带着点腥，小朋友们都不敢吃，我也只吃了几个不动筷了。点了条鱼，叫不出名字，清蒸，肉老渣渣的。香螺和小八爪鱼味道不错，扎啤也很清口，后来再也没吃到比这更好的扎啤了，只是觉得这里的厨师手艺不怎么样，海鲜也不到位。','70','2007-08-27 13:41:00',NULL),
	('1a1c7ce9d8eb92b55b5c22991f0380b6','f454a0a43e71ab23d02d943cc7c7416f','pisceschen','0',2,2,2,'第一天去青岛，不知道吃什么，司机推荐了台东和云霄路。所以就来了这家，因为看到里面人还算稍微多一点。要了皮皮虾，看标签写的是虾虎，蛤蜊、蛏子，还有著名的基围虾炒白菜。还有一锅菌汤以及一个崂山馒头。说不上多好吃，但是也还行。就是店里冷了点，饭最后都冰了。','65','2008-12-03 10:49:00',NULL),
	('1b273904724ab7e41232a31c86424637','f454a0a43e71ab23d02d943cc7c7416f','higher89','0',3,3,3,'这次青岛旅行我光临的第一家饭店，味道还过得去，但这家的元贝好象只有一颗肉，而在海岛渔村吃的元贝有两颗肉，不知是我弄错了还是真的是这样。','50','2007-10-23 20:01:00',NULL),
	('1dad86fb18871087c33ff61a920c1ce3','f454a0a43e71ab23d02d943cc7c7416f','waxs','0',2,2,2,'环境一般，2层，有包间，人每天都很多，以海鲜为主，家常口味，价格不贵，鱼作的不错，海鱼的腥味基本去除了。青岛云霄路上他家和海岛渔村都有3家分店，算是规模比较大了，推荐那里的海鲜水饺。','60','2005-10-25 15:08:00',NULL),
	('02b1ad297fb9491b304d5c4fc68189fe','f6e0b78c52c759bfe06e7b4dcdc13389','rebaca','3',2,1,2,'徐州本地人带过去的，去的是家乐福楼下那家，凉皮酸酸甜甜的，不是太习惯，我还是习惯陕西凉皮的味儿~爱辣油~爱老虎油~','5','2009-11-17 17:18:00',NULL),
	('0525113be0cd1207e124ef8a19f1cb08','f6e0b78c52c759bfe06e7b4dcdc13389','wenzi1764','0',3,2,3,'笑笑凉皮一直觉得是徐州不错的小吃之一。价钱便宜，重要的是味道好。虽然环境不是很宽敞，还要排队，但是周围会卖许多小吃，在吃凉皮的同时买来炸串~~其他小吃，真是不错的选择。','0','2008-10-03 20:18:00',NULL),
	('0955c24e39ec9b5298e4c1743f37f379','f6e0b78c52c759bfe06e7b4dcdc13389','兰兰和蓝蓝','0',3,2,3,'味道带甜的，比较喜欢手艺每次都不大一样，可以说发挥的不稳定吧，有时候很好吃，有时候一点也不好吃总的来说性价比蛮好又是在市中心','5','2008-12-26 17:38:00',NULL),
	('0f6bbe4d9c2c1b678f0413afc2253202','f6e0b78c52c759bfe06e7b4dcdc13389','你少装','1',1,1,1,'我哪家的凉皮都很难吃   不晓得放的什么东西 感觉味道就是怪怪的 卫生差 服务差    不只是家乐福那里的凉皮不好吃  大润发一楼的笑笑凉皮  更没办法说   可能是 都不好吃吧   很无语','0','2010-03-13 12:06:00',NULL),
	('13554e4316f2985d379194db2e33e22a','f6e0b78c52c759bfe06e7b4dcdc13389','肉肉去跪搓板','0',5,2,4,'哇哈哈，又是我最爱，经常去家乐福楼下的那家一份混合装，酸酸辣辣的还有点甜，味道真是足的了，真不知道他们那个酱料是怎么做的。凉皮Q的一塌糊涂，超有弹性。每次我爸看我吃这个就很无奈，那么多好吃的，我偏要吃这破凉皮 - -+','3','2009-09-21 15:20:00',NULL),
	('174c055643a966a013ca3150157e23e0','f6e0b78c52c759bfe06e7b4dcdc13389','酸甜猫猫','0',3,2,2,'很爽口中，一根肠一杯水。不过每个店到吃饭的时间人都很多，谈不上服务，要自已端，自已找位子，份量稍小些，如果味口较大，就吃不饱了','5','2009-03-29 12:31:00',NULL),
	('1c53cd1d1edabc3782ad3520b71ce490','f6e0b78c52c759bfe06e7b4dcdc13389','lalachen0','4',4,4,4,'味道还不错 挺好吃的 服务态度也很好 速度也很快 环境也还行吧 都是爆满的喜欢吃混合装还有他们的烤肠 才好吃 不错','0','2010-08-20 15:03:00',NULL),
	('019dad6311632e50d97ba9b84cf99b65','f6e3cd8e0bd3fe827ac779651438946f','小鹿叮咚','4',4,4,4,'慕名定了一个金牌拿破仑，奶油香甜不腻，齿颊留香。服务还可以，当天早上电话预订，晚上下班去门店自提，买单完立刻有服务生将打包好的蛋糕递给我。包装里还含一个冰袋。','90','2012-02-11 22:05:00',NULL),
	('01dbf7b61d1b401ae3a99b02f701be4d','f6e3cd8e0bd3fe827ac779651438946f','yunsok','5',5,5,5,'看了网友的推荐，提前定了一个5*17的拿破仑，抱着很大的希望去取，结果，果然完全不让人失望，一口下去满嘴惊喜。环境以白色为主，干净简洁，服务人员热情周到，很满意的经历。如果下次再去上海，仍然会去。','90','2012-02-01 15:12:00',NULL),
	('029609f195ac3e8b5856437030129084','f6e3cd8e0bd3fe827ac779651438946f','猫与山茶花','5',5,2,3,'本人最热爱甜食。特别是蛋糕。特别是拿破仑。这家的拿破仑实在太好吃了，也不枉我又是预定又是等待的了。叫的外卖，叫了好几个同事一起拼的。上面一层又酥又脆的实在太好吃了，奶油也太好吃了，不是特别甜腻。但是你一口气吃掉还是很撑的，所以做人千万不能贪心。缺点就是他们开门实在太晚，关门 太早，要吃拿破仑还要提前两天订。地方又小坐也不好坐。不过好在有外送还是很贴心的。','100','2012-01-26 21:09:00',NULL),
	('0444c77441fcd6aa5534a873035af6a9','f6e3cd8e0bd3fe827ac779651438946f','摇啊摇啊摇啊摇','1',2,1,1,'看了点评网上成堆成堆的好评后去的。小小的店铺挤满了人，大多都是去劈情操的年轻人，很是热闹。店内也就两三张台子根本没办法买了现吃只能打包带走。最令人咂舌的是柜台上还有一张令人瞠目的告示：从即日起外送半块起，切块不算！。。。柜台里的蛋糕品种说实话并不多，畅销的拿破仑丝毫吃不出有多么的好吃，而且所谓的半块简直是小的可怜。店员态度极差，完全把我当成空气，人家买几百块的你就笑脸相迎，我买一百多的你就板着脸，让我在那边等了足足20分钟！好吧，下次还不如也索性贴张告示：低于300元产品不卖！','0','2012-01-30 17:09:00',NULL),
	('05d196515bb5b9bbd423c412c2aa3deb','f6e3cd8e0bd3fe827ac779651438946f','ritadelove','3',4,3,2,'朋友电话从初二就开始打了 一直无人接听 直到初四晚上才有人接 初五四人冒雨赶去 之前电话预定了拿破仑堂吃 下午二点到的 里面已经坐满了等位的人 一家店小是小的来 无奈还有行程 就坐在外面 外面不用等 服务员送来了毯子 盖在我们身上像在医院里面推轮椅出来的四个病人 我们从叫他们送上蛋糕到吃到蛋糕 等了起码二十分钟 大概生意太好了 拿破仑吃多了还是会腻 四个人吃太多了 当中的酥皮的确很脆 好吃是好吃 但绝对不到惊艳 三月试试看榴莲蛋糕 最后结帐要发票 叫了三个人 最后还等了十分钟发票也没拿来 服务态度绝对让你惊艳倒是真的ps：里面靠窗那桌 点的是三层下午茶198那款 我们吃加等起码有一个小时 直到我们走 看到他们才吃到第一层（里面蛋糕大小都是一口一个 超级迷你的）可怜了还在等位的人 蔡嘉肯定不会再去吃下午茶了 买个带走就算了','0','2012-01-29 10:47:00',NULL),
	('082867011867e18bd8744d1752cd14f7','f6e3cd8e0bd3fe827ac779651438946f','叶提丝嘎','3',3,3,3,'店堂还敢再小一点么。。。为嘛外面的露天座不开放呢。。等了半天。。活生生从下午茶等到快晚饭时间了。。下午茶点了个花香茶（happy birthday），很喜欢！还有草莓奶油，有点普通。。心心念念的榛子奶油，也有点普通。。。6寸奶油蛋糕均价180？性价比之低到想不通了。。拿破仑倒是看上去很不错，必须试试的。。今天预定的明天的哎。。真的很不方便啊= =|||','55','2012-02-13 22:49:00',NULL),
	('0b938492c80853e72e62a0a3acd3e10f','f6e3cd8e0bd3fe827ac779651438946f','手电筒奇侠','1',5,2,1,'这里的点心没话说，可惜服务态度不是一般的差。强烈建议打包，小小店面，五六个服务员，很空闲，还都撅着一张后娘脸，可见老板管教的太松散了','0','2012-02-11 13:07:00',NULL),
	('0e491693bb6ab4a5acc31bf6278e538f','f6e3cd8e0bd3fe827ac779651438946f','衣裤饼','5',5,3,3,'这家店的蛋糕口味胜在甜度不高很清淡，提前预定了金牌拿破仑里面的奶油淡淡的甜甜而不腻酥皮脆脆的，二个人订的最小号的全吃完了，服务员还送了一小块里面夹葡萄干的蛋糕给我们试吃，也很好吃','80','2012-02-06 11:08:00',NULL),
	('10a5a5077696df475fd6708c2db360a1','f6e3cd8e0bd3fe827ac779651438946f','Nicolezz','4',3,2,4,'朋友帮买的榛子奶油和黑森林期待很高，包装很好，事实是，从我个人口感来说，和21cake的差不多，但这个价格可是21客的2倍哦~我觉得用料还是君悦饼屋的好~3.5cm*3.5cm的歌剧院，也就2块麻将牌叠起来大小39元~好贵……应该除了再想吃虾榴莲蛋糕，不会再来了~一般般吧~','130','2012-02-12 21:56:00',NULL),
	('16c6e5ea45016dbae3968a9daf229791','f6e3cd8e0bd3fe827ac779651438946f','要妖夭柒','4',3,3,3,'去看刚出月子的朋友，实在也想不出送啥好正巧当时刚知道蔡嘉这个新牌子西点一直在家闷得慌的朋友应该会喜欢当时是电话预订直接送货上门的，简单又方便关键是得到一群女友们的称赞，看来没挑错礼哦','0','2012-02-05 14:16:00',NULL),
	('181afd64c07c1733bb0a5e45d8cd4ed6','f6e3cd8e0bd3fe827ac779651438946f','baby_you','4',3,4,3,'有下午茶套餐，也可以单点蛋糕。欧式古典的装潢，白色的基调，看着“清爽又小资”；露天座比室内座“多”，坐那儿品美食，“别有一番情调”。 可惜没吃到拿破仑，下次预定','60','2012-01-14 11:02:00',NULL),
	('01317f57115a3534d9b8c7bd12481cb4','fae0ee890c1d728ebf0436178f3d5586','zhoukun7','5',5,2,2,'人太多，什么时候去都得排队，桌子总是很紧张，经常几波客人拼桌。希望老板可以改变一下店内布局，将就餐环境优化。大排骨真的很好吃，每次去就是为了吃大排骨，再配上虾蓉白菜，每个人都撑的要命。','40','2011-06-06 15:01:00',NULL),
	('01f24d3c6f3e7610af6b3ec5c0791e0d','fae0ee890c1d728ebf0436178f3d5586','大梦雅','5',4,5,4,'感觉不是太大的一个地方，没想到里面人可是超级多。每次去晚了都得排队。最喜欢这里的特色李家大排、砂锅丸子。下次还会带朋友来这吃的。','0','2011-09-06 10:40:00',NULL),
	('050c154e440d05733eca56ed6b871dd8','fae0ee890c1d728ebf0436178f3d5586','萌哆哆','2',1,1,1,'炒这么火 点俩特色一尝 大排很甜很腻 糖精的那种腻 虾蓉白菜那个鸡蛋打的过火 涩牙的很 我就吃了点大白菜叶子 不会再去了','50','2011-07-28 14:35:00',NULL),
	('08763154710e74f96600974cbc438862','fae0ee890c1d728ebf0436178f3d5586','小彘connielyx','4',3,3,3,'误打误撞的走到了砂锅李 早就有耳闻 既然到门口了 就进去品尝一番吧 店面不大 有小桌大桌之分 来晚了 只有坐在大桌跟人家拼桌 好在之前的人都走了 只剩我们两个人享受一个大桌 点了李家大排 四宝（荷兰豆和山药等）以及砂锅豆腐 大排还好 不是很甜也不是很腻 两个女生吃有点量大 素菜还可以 砂锅真是大啊 光灌水饱了 高汤 豆腐冬瓜以及不多的粉丝 适合探店 家庭聚会','50','2011-08-31 22:38:00',NULL),
	('0b0049482fb2257b2ed06f6217705cdc','fae0ee890c1d728ebf0436178f3d5586','princess涟漪','5',5,2,2,'地方非常简陋 但是味道超级好 很喜欢李家大排 跟九转大肠 都是偏甜口的 罗宋汤也很赞 基本属于吃一次还想吃第二次的 就是价格有些高了','60','2011-07-07 10:52:00',NULL),
	('0b9ab2d3c6972311ecd0b009040118bf','fae0ee890c1d728ebf0436178f3d5586','令狐轩辕','3',3,2,2,'地方挺隐蔽，也真不是一般的挤啊。比较运气的是没有排队。虽然说的是地道天津菜，怎么都是甜的呢？不过好在我还挺喜欢甜口。菜量还是挺大的，比较适合很多人一起聚餐。不然感觉很划不来，毕竟菜价都挺,,,有个叫砂锅红菜的吧，个人比较喜欢，再推荐个什么什么鳝鱼，我们吃的唯一没有那么甜的。','55','2011-07-30 22:39:00',NULL),
	('0ebba2a23ac153715f24ae16b48c6b7f','fae0ee890c1d728ebf0436178f3d5586','沙田秞','4',3,2,2,'朋友请客去的，果然不虚此行，李家大排虽然贵啊，但是好好吃啊，不知道他怎么做的，滋味很浓，虾茸白菜最爱，清淡，还点了其他的也不错，就是贵了','100','2011-09-11 09:45:00',NULL),
	('13b74d4716bc89e3fe6eefec5c4f6c38','fae0ee890c1d728ebf0436178f3d5586','小丸子317','4',5,2,3,'很多年的老店了，以前最爱大排，前一阵再去，美味依旧，就是店小了点，经常排队。听说梅江也开了一家，下次去试试。','50','2011-06-03 21:54:00',NULL),
	('1649ab9ba1d72f8bddc8f98ae6ba0323','fae0ee890c1d728ebf0436178f3d5586','yqqy66','3',3,3,3,'主任请客, 说是天凉了, 大家一起去吃这个, 而且这家店真是超级火, 有同事推荐的, 所以我们就去了, 第一次吃, 感觉确实不错, 挺热乎的, 爱吃虾茸草菇白菜','0','2012-01-11 19:27:00',NULL),
	('1710948ecad1c77a524fd5c524141864','fae0ee890c1d728ebf0436178f3d5586','skyff','3',3,2,3,'地点很难找！环境也叫一个差！座儿很挤！至于味道么！我觉得也就是还可以！没传说中的那么好吃！李家大排够甜了！虾茸草菇白菜还不错！看别的桌儿都点了芙蓉鲜贝，决定如果有下次可以试试！哎呦，砂锅那叫一难吃。。。一点儿不值！一锅水啊！大众点评卡可以用！但告诉我们要在点餐时出示！所以，有什么折扣就不清楚了。。。','50','2011-12-14 17:25:00',NULL),
	('180151cde71a1c6a30ceed395af0f0bb','fae0ee890c1d728ebf0436178f3d5586','小酒窝大脸蛋儿','3',3,3,3,'地方是很火爆，有时候去要排会队。味道不错，很喜欢他家的砂锅豆腐味道很鲜。价位也不高，值得聚餐什么的去来尝试一下。','0','2011-06-03 13:29:00',NULL),
	('1d90179f0f0ee17bea9e21a9a4f9c7b9','fae0ee890c1d728ebf0436178f3d5586','rainbowwwwww','4',5,2,2,'非常之牛的一家饭馆儿呀！有着一副“你爱来不来”的架势， 反正平日基本上6点到的话您就排队等着吧！周末更不必说。。。但是菜的味道真是好吃，好吃！尤其是李家大排和虾茸草菇白菜，每次必点！大排是甜口儿的，非常嫩，但是吃多了会有点腻。','0','2011-06-05 11:48:00',NULL),
	('0194eb12c4a3b55f374a9cc5978a99c3','fcce223d196cedfd5226ddd21772f8a3','福娃迎迎迎','5',5,4,4,'真是非常好吃，好久没有吃过这么对味的饭了。乌克兰菜，量大，醇香。黄油烤鸡居然是里面的肉最好吃，非常的入味，基辅烤鳕鱼也是极美。基辅奶茶味道很厚。以前对俄式体系的饭菜没有特别的好感，基辅算是改变了我的看法~','170','2011-12-03 16:08:00',NULL),
	('070f2a08e49c0d95d5592472734b2dfd','fcce223d196cedfd5226ddd21772f8a3','smdawn','4',4,5,4,'单位聚餐来这里预约了一个包间，一个大长方形的桌子。感觉很多菜都是烤制的。牛肉、土豆为主要材料。啤酒有号几种，黑的，绿的。罐焖牛肉很好吃，烤鳕鱼也很不错呢。大厅还有歌舞表演，整个餐厅气氛很欢快。值得一去。','200','2012-01-03 15:55:00',NULL),
	('0885d8f767c6325b1f990e704d1c5f46','fcce223d196cedfd5226ddd21772f8a3','shirleylss','4',3,4,4,'很独特的风格，还听到了俄罗斯歌曲，整体装修风格很俄式。个人很喜欢那个大列巴，配草莓酱很好吃。其他的菜感觉一般，但还是吃了很多，晚上都没什么胃口呀','130','2012-02-12 20:19:00',NULL),
	('08ab0d0a0157356c999fe0757d60ab53','fcce223d196cedfd5226ddd21772f8a3','bluemaryann','5',4,4,3,'下午两点开吃的。没有演出，也已经没什么人了。可是服务也很不到位，可能都忙着收拾中午的残局呢。叫n次没人理的情况发生好多回。。。红菜汤很不错 罐焖牛肉更好吃 格瓦斯特别好喝 还要了个沙拉拼，包括金枪鱼沙拉基辅沙拉和红豆鸡丁沙拉三种全有，是非常合适的选择。有个茄子卷的冷菜，也特别好吃，原谅我都记不住菜名。。。看图片好了。。。还有个肉丸子焗土豆，也不错，原本以为是类似祖母厨房的烤薯皮，但实际上这里的是大个纯肉丸，cheese没很多。','120','2011-12-03 01:51:00',NULL),
	('08d0243e22339417976a01a073e58b5b','fcce223d196cedfd5226ddd21772f8a3','wan9xu','4',2,2,2,'感觉吃不惯，好多东西都不太合我口味，老公倒是吃的津津有味，寻找下在乌克兰的记忆吧~可以点歌，唱的都很好，据说都是国家功勋级别的演员，爸妈公婆都听得很到位。','80','2011-08-10 16:15:00',NULL),
	('0ba5e0fdd0f7963a9c013b885a4bf063','fcce223d196cedfd5226ddd21772f8a3','amerliamm','4',3,3,3,'上学时就知道的一家餐厅，终于来了，说实话比较适合父母那一代人来怀旧的！似乎和我的生活有点远！不过，还是很喜欢这里的环境，中午人不是很多，一边吃着饭一边听着歌，感觉不错，一顿饭下来，除了格瓦斯，吃了什么都忘记了！下次一定带着父母来！','0','2011-09-07 16:07:00',NULL),
	('143c36e15df6a6c5ce4a97c3568380cd','fcce223d196cedfd5226ddd21772f8a3','ArdixXL','5',5,4,5,'这里的东西很好吃，一开始还担心每人一盘主菜够不够吃，后来发现虽然菜量一般，但都是比较耐饿的，最后根本吃不了。基辅烤鳕鱼和奶酪焗蘑菇强烈推荐。这家店最大特色是自然是功勋艺术家唱歌，唱得挺不错，一看就是有功底。过生日的顾客还会得到他们的特别照顾。不过唱了好多俄罗斯歌曲只有莫斯科郊外的晚上听过，其他的都没听过。后来竟然还唱了我的太阳和歌唱祖国。总之是挺新颖的形式。','110','2012-02-15 23:15:00',NULL),
	('16b690c2df0ee9ba14979aa3c3ecb6c6','fcce223d196cedfd5226ddd21772f8a3','不会笑的猫','4',3,3,3,'藏在小巷子里的餐厅~很喜欢这里的红菜汤，味道真是不错，每隔个几分钟，表演者们就成群成队地满场子唱歌，太热闹了~很适合爷爷奶奶这一辈的人来怀旧~','120','2011-12-13 18:58:00',NULL),
	('1b90dcd6b15ea28d976eecef428d753f','fcce223d196cedfd5226ddd21772f8a3','hongo_azalea','4',3,3,3,'怀旧感很重的餐厅，俄罗斯感觉，菜品种类多，稍微点几样就能吃得很饱。有人唱歌，东西都蛮好吃，就是腻。没喝惯格瓦斯，甜索索的粮食味，还有气泡。','100','2011-11-17 01:17:00',NULL),
	('1bd8e1eb6107817942a8ffb9c8070e71','fcce223d196cedfd5226ddd21772f8a3','强尼汪汪','5',5,4,5,'和莫斯科餐厅一相比好吃又高信价比。红菜汤，土豆泥，蒲基沙拉，奶油杂拌，罐焖牛肉，炸猪排，黄油鸡卷，白面包都比莫斯科餐厅好吃。以后想吃俄罗斯饭，就是它了。','100','2011-09-10 22:09:00',NULL),
	('06576f0b4cf43a67252d994242bbae3c','fd8177126c2e997c27c491a2a9394cfe','橙爱樱','0',3,3,3,'一下小桥就是了，位置不错，店里的环境也不错，店家的态度也不错，呵呵，总之也是我在阳朔喜欢的店之一，有一次很晚还跑来打包东西，老板很热心的给包的很好，还送了东东。','50','2008-03-20 13:21:00',NULL),
	('085267105e938e137dcf8736e87ba77a','fd8177126c2e997c27c491a2a9394cfe','in_seven','0',3,4,3,'店里充满了恰到好处的对比色，红蓝、黄蓝，还有那几张同样艳丽的点彩画，像是到了法国南部……楼下是几张桌子，门口处很低矮，旋转楼梯往上，可以看到一个小阁楼，涂满了电影画报，三角屋顶加白砖墙，晚上一群人来这里悟着看电影应该很爽吧~~从小马的天出发我们开始了一天的骑行……','25','2008-12-17 19:57:00',NULL),
	('0985ac1040c834322dfc760e738833bb','fd8177126c2e997c27c491a2a9394cfe','chinasidney','0',3,3,4,'2006年世界杯。法国男人给我做了一个祖母风味烤鸡，至今念念不忘。2007年，我们天天去吃早餐。一个充满人情味的好地方！','0','2008-05-21 12:41:00',NULL),
	('0dd23814322fa6a8927f15a215e11fe2','fd8177126c2e997c27c491a2a9394cfe','tvuknow','4',3,3,3,'看了那么多的好评 下决心一定要来试试的~一大早（其实已经11点多 西街的店开得都晚 因为真的不需要开那么早 嘻嘻）店刚开 服务员还是热情的招待我们 让我们先在江边的桌坐坐等等享受了悠闲的时光后 服务员过来说可以点菜了~点了 招牌匹萨 巧克力蛋糕 还有酸奶酸奶很好喝哦~ 我好奇上面的料是什么匹萨没有拉丝 这个让我有点遗憾 但味道不错啦~巧克力蛋糕味道不错 只是吃得我好撑了 就小剩了点 边边的奶油超好吃~','35','2010-08-23 14:14:00',NULL),
	('0e7c094423799db5ce8ee4b43c89567d','fd8177126c2e997c27c491a2a9394cfe','典心melc','5',5,5,5,'很值得去的地方，就在双月桥旁边，而且有些桌子就设立在小溪的旁边，晚上红灯笼亮起来的时候，再加上旁边的小溪石桥，别有一番诗情画意，你别说，鬼佬真的很会享受生活耶~~~','0','2010-10-22 19:59:00',NULL),
	('11eca3c634981c39deb71d6d4199b278','fd8177126c2e997c27c491a2a9394cfe','julienC','3',3,3,3,'晚上吃完饭过去的。11月有点小冷。点了两杯鸡尾酒饮品。记得味道还不错。本来是打算去外面的座位坐的。不过天冷的时候还是不太适合~','40','2011-05-05 16:37:00',NULL),
	('13cbba1245283c57d12ead9be3bda281','fd8177126c2e997c27c491a2a9394cfe','granazul','0',3,3,2,'两年前去过大理那家小马的天，喝着sol啤酒，从露台看着漫天的星斗，那里小马的天是布满星星的天，在阳朔看到了分号，只是这里看不到星星，却有小桥流水，弥漫着淡淡雾气的早晨，从容享用一顿丰盛的早餐，看着街上同样慢条斯理无所事事的人，就让一切都慢下来，慢下来。。。','40','2007-04-22 01:50:00',NULL),
	('178d6007505b706ae6f17518c77141c9','fd8177126c2e997c27c491a2a9394cfe','冰瑩','0',4,4,3,'我是衝著雞尾酒去的俱說做得很好當時以紅酒做基酒、加了蛋清香料、果汁、可可等沒有請他們加烈酒味道很不錯變漂亮成功點在於不會太甜太苦否則就會掩施原因的酒味後也品嚐了一下朋友的烈酒調調制的亦不錯的值得推薦','0','2009-06-03 09:23:00',NULL),
	('1b2173e3c02392f28f816dedd05337dc','fd8177126c2e997c27c491a2a9394cfe','x_smile','0',4,4,4,'小马的天在网上的确很热评如潮~可是据我在西街上的观察 有格调的店 或者说比他家还有格调的店真的是大把大把~其实不外乎一个从众心理而已一个人说好 两个人说好 就都觉得好了~餐牌上的价格居中 店面很小~ 位置比较偏 我觉得他家的安静云云也和这个有一定的关系~还有2条斑点狗~隔壁或者对面也有几家店 很有个性 而且老板也够豪爽~','20','2009-05-25 10:28:00',NULL),
	('1d876c41f69b0c862e4b50d8fbbab007','fd8177126c2e997c27c491a2a9394cfe','carey_zj','0',4,4,4,'早上10点去的吧大概，反正在那里一直起的很晚的说。。。要了法式早餐，好大的一份哦，东西很多，次的很饱的去月亮山了，如果需要早饭有足够能量的话这里是不错的选择哦！PS：去的时候店里就我们4个人，难道大家都起的很早的说，唉~','30','2009-02-16 16:33:00',NULL),
	('00ee59853a69d6a020fd1ccd92ecb5a3','ff6a438a8972c2b98f4a8f85f37b5e75','午夜的烟','5',5,5,5,'我们是吃的中午商务套消费仅仅58——78元，就有餐前面包，可以选一个汤哎，我们选择的是蔬菜汤，和奶油蘑菇汤，味道非常好，还可以选一个沙拉，最后主食我们选的是牛排和卡普里其沙批萨，服务员说是他们家的特色，牛排肉质非常好，尤其是配了，芝士土豆泥，很好吃哎，批萨的芝士和配料分量很足，可以选择一种饮料，饭后又赠送了我们咖啡。太实惠了。有空在尝尝其他的菜。','38','2011-01-11 18:00:00',NULL),
	('02a34118a88b16078e7cced5985c7575','ff6a438a8972c2b98f4a8f85f37b5e75','wendy熙','3',3,3,3,'卡萨米亚披萨感觉不错，四品芝士披萨很大的一股芝士烤出来的臭臭的味道，吃到最后有点受不了。鱿鱼圈很很很好吃~~~可能是因为外面那层酥皮吧。我对饭要求比较高，所以觉得西班牙海鲜饭的饭都很散，不够有嚼劲。而且番茄太多，感觉味道也像番茄炒饭了。。意大利肉酱面中规中矩，还好。烤薯皮比祖母的厨房的好吃，比较薄，烤出来就比较脆。还不错。总之，可能卡萨米亚披萨我会想再吃，其他的还好、','40','2010-11-07 17:45:00',NULL),
	('033fce0786899db8bd55c1a094d0e552','ff6a438a8972c2b98f4a8f85f37b5e75','candice_S','4',3,3,3,'去年请朋友吃饭，阳光灿烂的初冬，和朋友一起窝在卡萨米亚的二楼说悄悄话。今年朋友已经回了老家，少了一个吃货陪我到处混，Sigh！那天点了西班牙海鲜饭，海鲜意面，提拉米苏和香蕉奶昔，最后还双拼了一个pizza带走。西班牙海鲜饭材料很丰富，味道很标准。饭煮得软硬适中，份量很多，没吃完。海鲜意面我一直对意面没什么感觉，吃起来又麻烦。不过他家得海鲜意面味道还真不错，筋斗。香蕉奶昔感觉这样的西餐厅，奶昔水准都差不多，好味道！提拉米苏这个让我小失望，因为朋友之前一直说他家的提拉米苏多好吃，可是端上来看着感觉就好奇怪，卖相不好，味道也一般。也许真的像朋友说的是换厨师了？)^o^(pizza双拼的，一半是鸡肉的一半是牛肉，什么口味忘记了，不过个人感觉比必胜客的大烧饼好吃多了。带回办公室，同事也都觉得很赞。啊呀，说起来，今天再去吃好了。今天果然又去了。烤薯皮比祖母的厨房要好吃，土豆底更薄，烤出来脆脆的。熏肉没有祖母的厨房咸。黑椒牛柳扒一点都不嫩，明明是七成，切的时候明明看到红红的肉，可是肉已经老得刀都切不动。虽然我不是很挑剔牛扒的味道，不过这么老的牛扒我真的第一次吃啊。椰汁猪扒，中规中矩。','65','2011-05-01 00:04:00',NULL),
	('053c4cd2d43bcc661a0b6261b287d931','ff6a438a8972c2b98f4a8f85f37b5e75','小西瓜小小','5',4,4,3,'这家离彼德很近~店面在科华路众馆子中挺不起眼的~里面有两层~环境很温馨安静的感觉~适合约会~两个人要了一饭一面一汤一奶昔~饭面都是挺正宗的意式~奶味啥的挺浓~特别喜欢奶昔~冰过的感觉有加奶油~可以上网~下午去坐坐也不错~~','50','2012-02-11 23:36:00',NULL),
	('06c6c1f13ff2a412f31e4a8f56df86a6','ff6a438a8972c2b98f4a8f85f37b5e75','yicat','0',4,3,3,'饼子从峨边回来了，她说要去吃PIZZA，于是就来了这家本人喜欢意大利薄皮PIZZA，而且没文化地觉得越薄越好吃这家的还不错，要的双拼的，不记得是哪两个味道了，但是芝士给得很足，料也还不错～要了芝士蛋糕，也还不错然后还要了个啥，呜呜，不记得了，快2个月前的事情了有人说这是成都最正宗的意式PIZZA，额，还不错吧','60','2009-09-05 00:53:00',NULL),
	('06dbec6b5c44cc5a75b67e5e22ef8ddc','ff6a438a8972c2b98f4a8f85f37b5e75','TuAnMuA','4',4,5,5,'很喜欢的一家西餐，以前最爱的是PETERS，现在就是卡萨米亚啦~首先大爱他家的 巧克力蛋糕，是主厨ERIN菜单里的那款哈，超级好吃，口感介于布朗尼和戚风蛋糕之间，有点湿润，特别是上面淋得酱搭配一起更好味~然后是 黑胡椒意面，其实这东西应该是比较容易被四川人接受的西餐菜了吧，也没什么特别，就是味道比较重，我很中意哈哈哈！~第三个也是ERIN菜单里的，有个叫西南鸡啥子的。。。还有个春鸡啥子的。。反正都比较特别，貌似是德州那边的菜哈，不过可能有部分人不太能接受淡奶做的菜，奶味重，但是我非常喜欢，。第四个推荐他家的披萨，以前貌似是炉烤的，现在全是烤箱烤的了。。。不过味道还是不错，喜欢四品和卡萨，最后，非常不推荐，并且超级不喜欢他家的沙拉。。。很难吃。。。真的。。。普切塔也不好吃。。很干，味道也很单调。另外卡萨米亚貌似每周日都会举办一个ENGLISH CORNER哈，还是免费的（也就是你什么都不点坐在里面都可以，）还会教你做一些主厨ERIN的家乡菜。。','70','2009-08-03 21:38:00',NULL),
	('08f074924fdccea920a5fcb5a2075235','ff6a438a8972c2b98f4a8f85f37b5e75','橙橙琳琅','0',2,3,3,'咋个说喃味道真的很一般。其实这家刚刚开业我就去过，还办了卡，因为不用额外给钱嘛。但是去的时间比较少，有时候想起了会去一次。味道不怎么样，比旁边的PETERS差，不地道，不过，环境还好。位置比较松，私人空间比较大，装修也不错。适合聊天谈事情。去年圣诞送了会员礼物，今年没人给我发短信，不知道是不是我太久没去的缘故，嘿嘿','50','2008-12-29 13:20:00',NULL),
	('0ed88cd6a6192a4974c9f9df24c01e50','ff6a438a8972c2b98f4a8f85f37b5e75','philipwu51','3',2,3,2,'个人觉得这里的披萨比必胜客的好吃，因为薄，所以比较入味，而必胜客的太厚了，中间的不入味的像白锅盔。点了个招牌披萨，点了个海鲜饭，还有沙拉，罗宋汤。罗宋汤好辣，但是汤味不厚重，不喜欢。沙拉也一般，远不如必胜客的，可惜必胜客现在不卖沙拉了。海鲜饭不错，很鲜，适合口味清淡的人。环境还好，空调很足，就是房间小了点，说话大声一点全屋的人都听得见。话说吃饭中来了一队人，中间一个老外，声音洪亮，极其健谈，之后整个吃饭过程都是在这位老兄纯正美音中度过，练听力倒是不错。停车可以停在川大。','55','2010-08-02 10:29:00',NULL),
	('0c091a5751dc3a717ff4a6be5835e2a0','ff6a438a8972c2b98f4a8f85f37b5e75','猪想游泳','0',3,3,3,'招财尽饱♀猪想游泳————————————————————周五扫荡的第二家，之前已经吃过饭了，所以到这家完全就是为了聊天和喝水的。进门上了二楼，发现整个店就只有我们四个人，本来蝎总提议坐非卡座的，但是我对于沙发有很大的喜好，于是选择了卡座。服务生走上来就解释了营业时间只到11点，这点很贴心，毕竟谁都不想还意犹未尽的时候，被人通知打烊了。冒着被嘲笑的危险，我也点了果汁，因为看来看去不知道喝什么，奶昔对我来说偏甜，而且过于浓稠我不是很喜欢，只好点了果汁。蝎总特地交待果汁不要加糖，服务小弟说他们本来就不加糖，不错。不一会儿东西都上来了，此前我一直抱着他们的柠檬水猛喝，老实说，我觉得柠檬水的味道不怎么样，有种我说不上来的味道，感觉似乎有点刺激，不喜欢他们的柠檬水。西瓜汁不错，是用新鲜的西瓜打出来的，确实没有加糖，喝起来就是自然的香甜味道，而且打得非常细腻，我还能喝到被打成粉末状的西瓜籽，看来无籽西瓜还没有上市，呵呵。喝了两小口蝎总的橙汁，微酸，后头有丝回甜，也是不错的，但是ms蝎总不太习惯，最后都没有喝完。水煮的奶昔我也尝了口，味道浓郁，不过我从小对牛奶的反应巨大，大了虽然能喝一点...牛奶了，但是除开酸奶以外的奶制品，我一概都是敬谢不敏的，所以就没有什么资格发表看法了。zhangda是唯一没有点饮料点了甜品的，待到我要尝试她的盘中物的时候，蛋糕只剩下可怜的1/3了，小小地挖了一块，确实很不错，入口有些酸酸的，我一度以为是酸奶口味的，刚才看dp才发现是青柠的，还好没有问出口，不然又该丢人了，呵呵。可能是因为本来建筑就不是两层的设计，所以二楼的空间相对来说要压抑一点，不过总体的环境还是很温馨的，确实是适合情侣约会或者是老朋友饭后聊天休息的地方，我还开玩笑说以后要是找了bf就带他来这里敲诈他一顿，呵呵。全文','15','2009-04-19 12:49:00',NULL),
	('0d0658ff436595e39736121790d97042','ff6a438a8972c2b98f4a8f85f37b5e75','鸣峥与虾子','4',4,2,3,'性价比蛮高 三个人吃了120还撑死了。披萨点的卡撒米亚和四品芝士双拼 觉得四品的味道有点怪 不是很喜欢 卡撒米亚比较正常 总体来说芝士比较足 烤得还算香 比昨天吃的甜叔叔好太多 烤薯皮很好吃 很香 牛肉芝士焗饭分量太足啦 三个人都没吃完 味道不错 只是吃多了比较腻','40','2011-08-13 23:06:00',NULL),
	('116b697083e680de368851bcdbb46846','ff6a438a8972c2b98f4a8f85f37b5e75','桃子小妹儿','2',2,3,2,'招牌的东西都点了，真的只能说一般一般，海鲜饭饭算不错的了，不过就真的是番茄蛋炒饭的味道，真的很无语，还有千层面，太耙了，真的很怪异，其他的东西大部分都是偏咸，味道很单一，没有特色，就这个价格来说，真让人失望，唯一觉得还算可以的就是烤薯皮了哦。只能说，下次再也不会去当冤大头了。','120','2011-06-17 10:46:00',NULL),
	('11fa75e6f77e2ea65759f871834b69fd','ff6a438a8972c2b98f4a8f85f37b5e75','alanhou','0',4,4,5,'因为是晚上比较晚的时候去的，所以没有吃很多；如果是正常一餐应该人均70左右。牛肉芝士烩饭味道香浓，口感很不错，个人推荐加上一些干cheese粉和黑胡椒。Pesto的意大利面吃起来还不错，但是对于喜欢重口味的人来说，不推荐这个。土豆沙拉没有想象的好吃，不过里面有芹菜粒，还算比较爽口。cheese finger炸得还不错，但是cheese的味道不够浓。环境不错。地方不大，比较安静也很可爱。主厨房前面有一个开放式厨房，放餐具和一些简单的沙拉，兼卖酒水和卖甜点；给人很温馨的感觉。小阁楼都有小窗可以看到楼下，有一种“邻家”的感觉。服务态度很不错，也都比较具有专业素质。价格比较合理，和同档西餐厅比起来算是让人喜欢的类型。','59','2009-01-06 23:41:00',NULL),
	('161e59ecf83abbfcf2ec121dd1ae9dcb','ff6a438a8972c2b98f4a8f85f37b5e75','xiaochongsly','0',2,3,4,'地方很小，装修很别致，服务不错，点了田园沙拉、罗宋汤（配面包）、卡萨米亚风味的披萨、提拉米苏田园沙拉的蔬菜感觉不是很新鲜，罗宋汤没有彼得的好吃，不过配的蒜蓉面包很好吃，披萨虽是他家的特色，但没有觉得特别喜欢，提拉米苏是很不错','55','2009-09-10 22:41:00',NULL),
	('1bd7ef79f46487c0f36312250fd12b95','ff6a438a8972c2b98f4a8f85f37b5e75','旋转Sanlin','4',2,3,3,'圣诞节的晚上和L去吃的，起初一直想去体验朋友推荐的彼得，可是当天人爆满，并且只能点圣诞套餐，看来看去也不是我们的菜，于是往下接着走看到了卡萨米亚。进去的时候也有两个女生在等着，不一会就有位置出来了，我们还调了一下坐到了窗边，服务员感觉很亲切，一有位置马上就给我们换了。汤我们要的罗宋和蔬菜汤，罗宋汤的味道只能说我不喜欢的味道，于是把L的蔬菜汤占为己有，哈哈。餐前的面包，额...不咋地，一个都没吃完。牛肉酱意大利面好像还得过什么奖，味道还行，L的大粪黑胡椒牛肉意大利面真是分量充足，当天工作原因到晚上才算正式吃一餐，于是我们就点着意大利面狂吃起来= =|||沙拉点的鸡肉的，不咋地。还点了一个青柠蛋糕餐后上，吃完时间紧就没要了。最想要的炸薯皮....没了 T T，泪奔~~~~~~下次还是得去彼得看看，卡萨米亚的环境还不错，（我们坐的二楼，我只针对二楼）。','60','2011-01-13 09:31:00',NULL),
	('1a5f241a09ccf1dd693d927b78cc6042','ff6a438a8972c2b98f4a8f85f37b5e75','cici_mickey','4',3,3,3,'跟好朋友一块去的，店面不大，但整洁朴实、小清新，第一感觉挺好的。2人点了披萨、蝴蝶意面、烤薯皮和水果沙拉，呃，明显太多了，没吃完，披萨打包的。但是披萨很赞啊，金丝很长，很香，喜欢，焦糖味的那个水也很好喝啊，朋友跟我抢着喝。服务员推荐的蝴蝶意面，呃，味道有点不适应。总体来说不错，分量都很足，应该还会再去。','100','2011-05-17 15:26:00',NULL),
	('1aa12cd8cfcb04a06e2373c8aa59f3be','ff6a438a8972c2b98f4a8f85f37b5e75','joyzyh','4',3,3,3,'才去过第一次，只是喝了点东西。。。香蕉奶昔！强烈推荐！好好味啊！热茶也不错。冲着奶昔也会当回头客的。','0','2011-11-27 00:07:00',NULL),
	('01a8e8a03accb884a999d1636bd09b5c','ffef124c4f06997dad94e316e5dde3f0','馋嘴寶寶_要减肥','0',3,1,2,'吃过最好吃的猪脏粉就是很粗的粉干··然后里面有猪大肠···我不吃血···有些人会加那个猪血的··味道的确不错···','5','2009-08-23 06:42:00',NULL),
	('07b803d76aa4dc91782ba858ad22e324','ffef124c4f06997dad94e316e5dde3f0','fylzj','5',5,2,3,'好吃,,,,无比的好吃~温州的特色小吃，在大南门的一条巷子里，以前央视有报道过这家店，也算有一定历史了，大肠这家店要洗7到8遍，特别是那个汤很鲜！','10','2010-11-01 21:38:00',NULL),
	('047db66bcc813ad365597ee1b54d479a','ffef124c4f06997dad94e316e5dde3f0','吃鲸的维京人','0',4,1,2,'香啊香的很, 好吃的要死难道我真得是吃路边摊的主吗?好吃的米粉, 好吃的内脏.吃完就撤, 随性的很.','10','2009-04-03 06:55:00',NULL),
	('09eb90bb154c5888e9c10cbf86354323','ffef124c4f06997dad94e316e5dde3f0','Queenchiu_北上','4',3,2,2,'呼呼，是喜欢吃小吃的人们的最爱，尤其上学的学生的人最喜欢吃的的东东哦。，人在外地上班，现在想吃也没有了。不过真的很好吃，而且价格那么的便宜，所以真的算是好东西了，汤好鲜。最喜欢 喝··','5','2009-12-16 15:09:00',NULL),
	('0bb3d377bf319912d9099e16ce33fa69','ffef124c4f06997dad94e316e5dde3f0','妩媚居居','0',5,2,3,'城西街的那家真的很好吃，记得在外读大学时，猪脏粉是我最想念的温州美食之一，时常向同学介绍，可是不是温州本地人却不怎么了解。','5','2008-07-29 15:54:00',NULL),
	('0e60ab7d7a97d385cd04309e6b4c5279','ffef124c4f06997dad94e316e5dde3f0','真遐','4',5,3,2,'我个人很喜欢吃猪脏粉~,很香.吃起来口感特别好,小时侯也很喜欢吃,以前自己家门前就有,不过现在已经没了.要跑老远的.粉干滑滑的~~一般都是吸上来推荐!','0','2010-08-21 16:08:00',NULL),
	('11d7dd8b6be66f777ca844db52497289','ffef124c4f06997dad94e316e5dde3f0','llqhappy','0',3,2,2,'温州小吃，没来前还真不知道。去年10.1去温州玩，特意吃了一次，原来是猪杂汤下的宽米粉，猪杂里最多的是猪大肠。我觉得还不错，挺好吃的，同行的其他姐妹有的受不了猪大肠味。','0','2009-02-16 14:08:00',NULL),
	('12dda1f3c22024395f31f80888795e06','ffef124c4f06997dad94e316e5dde3f0','親愛哒','4',4,3,3,'记得小时候才3块钱一份的现在涨了好多了·从小吃到大的面食了·在温州很有名气的·在外地吃的味道就是不一样·永中2号农行外边摆摊的味道就很好吃·','7','2010-11-30 02:16:00',NULL),
	('14e95de2f4737e4413ee06b583d25fbd','ffef124c4f06997dad94e316e5dde3f0','悠乐儿__远离美食要减肥','5',4,2,3,'但凡温州的朋友都向我推荐猪脏粉，描绘得怎么怎么好吃。馋得不行，也把猪脏粉想象得神乎其神。来到温州的第二天，就立即找了一家专卖猪脏粉的店尝了一尝。亲眼看着老板拿出各种猪肠、猪血、粉条下过，说实在的，不怎么干净。早就有耳闻，温州的美食，大多是不卫生的路边摊，为了尝新，就罢了。很快就端上来了。猪肠，量不多，味道很好，一点也不腥臭。猪血也蛮好吃的。 这个要看人，有些人吃不惯觉得恶心。粉条味道蛮特别的，和杭州一带吃的不一样，比粉丝粗很多，但是味道比较细腻，不像面那么劲道。滑滑的，蛮好吃的。最好喝的是汤，很鲜美，果然不错。一碗6元，算便宜的。问了温州朋友说，一般他们都是吃10元一碗的。我只能说，温州物价太贵了。个人感觉其实比较普通，没有温州人说的那么那么好吃，也许是他们描述得让我想象得太好了吧。','6','2011-06-21 23:57:00',NULL),
	('18a0e4e33c34f8d11710ec7a9110fc2e','ffef124c4f06997dad94e316e5dde3f0','piaoIiangchu','0',5,2,2,'其实温州人蛮少自己出去吃饭的，即使搞宴请也是喜欢把酒店的饭菜端到家里来。粉干也是自家担米去做的，所以记忆中很少有吃到外面的粉干，除了一次偶然的机会在初中的时候在一家很脏很小的店里吃了一碗猪脏粉，那味道我现在都忘不了，这种好吃不是一言能说清楚的。我想它不是其他东西能替代的。','0','2009-03-23 09:46:00',NULL);
